INSERT INTO `movies` VALUES (7096,'Маска Зорро',1998,136,0.0,7.5,44383,'1998-07-17','https://st.kp.yandex.net/images/film_iphone/iphone360_7096.jpg','The Mask of Zorro','Стареющий герой, отдавший все силы борьбе за справедливость, проведший десятилетия в темнице, потерявший жену и дочь, передает свои знания, умения и черную маску молодому отчаянному бойцу, который отныне и будет сражаться с теми, кто вершит зло.','$95 000 000'),(7097,'Балто',1995,71,0.0,8.3,142158,'1995-12-22','https://st.kp.yandex.net/images/film_iphone/iphone360_7097.jpg','Balto','Наполовину лайка, наполовину волк, Балто и сам не знает кто он такой на самом деле. Всеми гонимый бродяга в ледяной пустыне Аляски. Только его друзья русский полярный гусь Борис, медвежата Мак и Лак и красавица-лайка Дженна уверены, что хотя он и не такой как все, но в его груди бьется благородное сердце.<br /><br />Однажды случается несчастье. Эпидемия дифтерии охватила детей небольшого поселка, а свирепая вьюга сделала непроходимыми все дороги. Лишь собачья упряжка может преодолеть шестьсот миль через ослепляющий арктический шторм и привезти спасительное лекарство.<br /><br />Но собаки сбились с дороги где-то на замерзших просторах. Теперь только Балто может найти упряжку и спасти детей, а заодно стать героем и настоящей легендой!','Нет данных'),(7098,'Каспер',1995,100,0.0,7.2,44929,'1995-05-26','https://st.kp.yandex.net/images/film_iphone/iphone360_7098.jpg','Casper','Каспер, маленькое дружелюбное привидение, не желает походить на своих хулиганствующих собратьев. Его дружба с девочкой-подростком Кэт помогает ей и ее отцу, доктору Харви, справиться с опасностями, поджидающими их в населенном призраками доме.','$55 000 000'),(7100,'Мы вернулись! История динозавра',1993,72,0.0,7.3,1064,'1993-11-24','https://st.kp.yandex.net/images/film_iphone/iphone360_7100.jpg','We\'re Back! A Dinosaur\'s Story','Добрый профессор с говорящим именем Благовзгляд отправился во времена динозавров на своём чудесном дирижабле, способном перемещаться во времени. Поймав четырёх злобных динозавров, профессор накормил их специальным препаратом, превратившим монстров в говорящих весельчаков. После этого Благовзгляд дал динозаврам послушать своё Радио Желаний, в котором можно было услышать мечты детей, ради которых, собственно, учёный и отловил доисторических животных.<br><br>К сожалению, из-за временных неполадок в системе корабля все четыре гостя из прошлого были катапультированы прямо на голову мальчишке Луи, занимавшемуся сёрфингом. Он отнёсся к появлению «монстров» как к обычному явлению — впрочем, только он. Дабы не напугать горожан, пришельцы притворились роботами. И всё бы ничего, если бы их не разоблачила маленькая девочка, а Луи вместе со своей новой знакомой не оказался в плену у злобного братца Благовзгляда — инфернального Дурноглаза, устроившего цирк страшилищ…','Нет данных'),(7102,'Боязнь пауков',1990,105,0.0,6.7,3105,'1990-07-18','https://st.kp.yandex.net/images/film_iphone/iphone360_7102.jpg','Arachnophobia','В душе каждого живет неуправляемый первобытный страх. И однажды человеку суждено столкнуться с ним лицом к лицу. Доктор Росс Дженнингс страдает арахнофобией, экзотическим заболеванием, связанным с боязнью пауков. Он перебирается в маленький провинциальный городок в надежде на тихую и спокойную жизнь. Но по роковой случайности, из южноамериканских джунглей туда попадает смертоносный паук.','$31 000 000'),(7103,'Назад в будущее 3',1990,118,0.0,8.2,245190,'1990-05-25','https://st.kp.yandex.net/images/film_iphone/iphone360_7103.jpg','Back to the Future Part III','Из газет 1955 года Марти узнает, что доктор Браун погиб еще сто лет назад. Несмотря на просьбы Дока не навещать его в XIX веке, Марти вновь хочет вмешаться в ход событий и на машине времени уносится в 1885 год, навстречу Дикому Западу. <br><br>Это путешествие, как и все прежние, не обходится без опасных приключений, но смелый Марти, рискуя жизнью, предотвращает трагедию в жизни Эммета Брауна. Тот, в свою очередь, без памяти влюбляется в очаровательную незнакомку, которую спасает от гибели, и поездка домой — в будущее — теряет для него всякий смысл…','$40 000 000'),(7104,'Сны Акиры Куросавы',1990,119,0.0,7.8,2827,'1990-05-10','https://st.kp.yandex.net/images/film_iphone/iphone360_7104.jpg','Yume','Восемь новелл, связанных лишь тем, что они являются «снами» режиссёра. Среди них рассказ о том, как молодой Куросава попадает в картину Винсента Ван Гога и встречается там с самим автором. Также рассказы о жертвах Второй мировой и об апокалиптических картинах ядерной войны.<br /><br />В одной из новелл, повествующей о лисьей свадьбе, домик, на фоне которого стоит герой — маленький мальчик, является воспоминанием Куросавы о доме, в котором он жил в детстве. Весь фильм во многом автобиографичен.','$12 000 000'),(7105,'Всегда',1989,122,0.0,7.0,2169,'1989-12-22','https://st.kp.yandex.net/images/film_iphone/iphone360_7105.jpg','Always','Пит Сэндич — легендарная личность, лётчик-ас и человек отваги необыкновенной. У него была замечательная жизнь: интересная работа, любимая женщина и лучший друг. И вот однажды, ни секунды не сомневаясь, Пит жертвует этой жизнью, чтобы спасти товарища.<br><br>Но смерть забрала героя раньше, чем он успел убедиться в том, что с близкими ему людьми всё будет хорошо. И пилот возвращается, чтобы в этом убедиться, но уже… как призрак…','$29 500 000'),(7106,'Папа',1989,117,0.0,7.0,322,'1989-11-10','https://st.kp.yandex.net/images/film_iphone/iphone360_7106.jpg','Dad','Преуспевающий бизнесмен с Уолл-стрит Джон узнает о том, что его 75-летний отец Джейк при смерти. Джон возвращается в дом своих родителей и начинает ухаживать за пожилым отцом.<br><br>Несмотря на то, что много лет назад Джон и Джейк пережили тяжелый разрыв, положивший конец их теплым отношениям, неожиданное воссоединение учит их заботиться друг о друге и понимать друг друга заново. И вскоре отец и сын становятся близки друг к другу как никогда раньше…','$19 000 000'),(7107,'Земля до начала времен',1988,69,0.0,8.0,53705,'1988-11-18','https://st.kp.yandex.net/images/film_iphone/iphone360_7107.jpg','The Land Before Time','Было время, когда нога человека еще не ступала на Землю. То было время извергающихся вулканов, громадных землетрясений и ужасных катаклизмов. Наша планета тогда была населена удивительными и странными существами.<br><br>Герой этого мультика, очаровательный бронтозаврик Крошки-Ножки, отправился на поиски легендарной Великой Долины, где по слухам можно неплохо подкрепиться. По пути он прихватил с собой в путешествие еще четырех малышей-динозавриков. В дороге эту пеструю компанию поджидают удивительные и опасные приключения.','$12 300 000'),(7108,'Кто подставил кролика Роджера',1988,103,0.0,7.8,80336,'1988-06-21','https://st.kp.yandex.net/images/film_iphone/iphone360_7108.jpg','Who Framed Roger Rabbit','Частный детектив расследует загадочное преступление, в котором подозревается… мультипликационный персонаж кролик Роджер! Сыщик попадает в непредсказуемый мир, где его ожидают нарисованные злодеи с настоящими револьверами, говорящий автомобиль и соблазнительная мультяшная красотка. Наконец, на горизонте появляется мрачная фигура того, кто подставил кролика Роджера.','$70 000 000'),(7109,'Батарейки не прилагаются',1987,106,0.0,7.7,6694,'1987-12-18','https://st.kp.yandex.net/images/film_iphone/iphone360_7109.jpg','*batteries not included','Дом, в котором живут наши герои, подлежит сносу, и горстка домочадцев — пожилая семейная пара Райли, бывший боксер Гарри, молодая пуэрториканка Мариса и художник Мэйсон — отчаянно борются за спасение милых сердцу трущоб.<br><br>Беднягам остается надеятся только на чудо, и оно случается: помощь приходит от братьев по разуму. Однажды ночью квартиру Райли посещают неожиданные гости — крохотные НЛО.','Нет данных'),(7110,'Внутреннее пространство',1987,115,0.0,7.3,7204,'1987-07-01','https://st.kp.yandex.net/images/film_iphone/iphone360_7110.jpg','Innerspace','Американский пилот лейтенант Так Пендлтон принимает участие в эксперименте, в процессе которого он должен быть очень сильно уменьшен в размерах и в летательном аппарате, похожем на подлодку обследовать внутреннее пространство кролика. Но технотеррористы рушат все планы и похищают шприц, в котором находился миниатюризированый Так.<br><br>По ошибке содержимое шприца попадает в ипохондрика Джека Паттера. Теперь террористы начинают охотиться за ничего не подозревающим Джеком. Единственная, кто ему может помочь, это девушка Така — журналистка Лидия…','Нет данных'),(7111,'Американская история',1986,80,0.0,7.6,6144,'1986-11-21','https://st.kp.yandex.net/images/film_iphone/iphone360_7111.jpg','An American Tail','Фильм повествует об удивительных приключениях маленького отважного мышонка по имени Фивел. Корабль, на котором он отправился в путешествие из России в Америку на рубеже 19 и 20 веков, был застигнут страшным штормом, и Фивел оказался один в открытом море.<br /><br />Волны вынесли его на берег в Нью-Йоркском порту. Фивел смело отправляется на поиски своей семьи навстречу опасностям и захватывающим приключениям в новом, незнакомом мире.','Нет данных'),(7112,'Молодой Шерлок Холмс',1985,109,0.0,6.9,2189,'1985-12-04','https://st.kp.yandex.net/images/film_iphone/iphone360_7112.jpg','Young Sherlock Holmes','В Лондоне происходит серия ужасных и таинственных убийств. Молодой Шерлок Холмс и его новый друг Ватсон приступают к расследованию своего самого первого, но невероятно запутанного и опасного дела…','$18 000 000'),(7113,'Фанданго',1984,91,0.0,7.2,788,'1985-01-25','https://st.kp.yandex.net/images/film_iphone/iphone360_7113.jpg','Fandango','Заводила Гарднер Барнс подбивает четверых своих приятелей прокатиться по Техасу в первый же уик-энд по окончанию университета. Сумасшедшие выходки вчерашних студентов — по сути, прощание с беззаботной молодостью, краткая передышка перед вступлением во взрослую жизнь, где одних ждет Вьетнам, других — принятие духовного сана или скучная жизнь клерка.','Нет данных'),(7114,'Гремлины',1984,106,0.0,7.4,47289,'1984-06-08','https://st.kp.yandex.net/images/film_iphone/iphone360_7114.jpg','Gremlins','Очаровательный пушистый зверек Магвай способен растрогать даже камень. Вдобавок, у него — абсолютный слух. Только будьте осторожны: он может погибнуть от солнечного света, на него нельзя брызгать водой, а что будет, если накормить его после полуночи, просто страшно представить.','$11 000 000'),(7115,'Сумеречная зона',1983,101,0.0,6.8,4419,'1983-06-24','https://st.kp.yandex.net/images/film_iphone/iphone360_7115.jpg','Twilight Zone: The Movie','Каждый из постановщиков снял свой сегмент для этой ленты. Лэндис предлагает страшноватый пролог и первую новеллу о злобном расисте, которого наказали самым кошмарным образом, который только можно себе вообразить.<br><br>Спилберг расскажет о невероятных чудесах омоложения, которые происходят под покровом ночи в доме для престарелых. У Данте припасена поразительная история о странном мальчике со сверхъестественными способностями.<br><br>Ну а Миллер — завершит фильм своим леденящим душу финалом!','$10 000 000'),(7116,'Полтергейст',1982,114,0.0,7.0,13243,'1982-06-04','https://st.kp.yandex.net/images/film_iphone/iphone360_7116.jpg','Poltergeist','Они здесь… Сначала они кажутся призрачными, играя в прятки в загородном доме Фрилингов. Но затем становится по-настоящему страшно! Тучи сгущаются, ожившие деревья нападают, а малютку Кэрол Энн Фрилинг засасывает в спектральную пустоту. И пока ее семья борется с вереницей кошмаров и пытается спасти девочку, по соседству, где-то рядом затаилось нечто…','$10 700 000'),(7117,'Континентальный водораздел',1981,99,0.0,6.4,117,'1981-09-18','https://st.kp.yandex.net/images/film_iphone/iphone360_7117.jpg','Continental Divide','Жесткий и высокопрофессиональный чикагский репортер Эрни Сучак, известный своими политическими очерками, попадает в немилость преступников и вынужденно зализывает раны в больнице. Дабы уберечь одного из своих лучших сотрудников от крупных неприятностей, редактор газеты посылает его в леса штата Колорадо. <br><br>Теперь Эрни предстоит выполнить сложное задание — написать статью об известном ученом — орнитологе Нелл Портер, живущей в горах на дикой природе. Будучи совершенно разными и скептически настроенными по отношению друг к другу людьми, Эрни и Нелл постепенно оказываются в водовороте внезапно возникших чувств! Однако Эрни вынужден вернуться назад в каменные джунгли… Смогут ли они сохранить то хрупкое и прекрасное чувство, что зародилось меж ними вдали от цивилизации…?','Нет данных'),(7118,'Подержанные автомобили',1980,113,0.0,6.9,2129,'1980-07-11','https://st.kp.yandex.net/images/film_iphone/iphone360_7118.jpg','Used Cars','Продавец подержанных автомобилей Руди Руссо, работающий в магазине старика Люка Фукса, беззастенчиво переманивает клиентов у конкурента — Роя Фукса, брата Люка. Однажды терпению Роя приходит конец, и он решает разом избавиться от надоевшего соседства и поправить свое финансовое положение.<br><br>Но и Руди, мечтающий занять место в сенате штата, тоже озабочен поисками крупной суммы денег на предвыборную кампанию. Однако, судьба наносит ему сокрушительный удар с совершенно неожиданной стороны…','$8 000 000'),(7119,'Я хочу держать тебя за руку',1978,104,0.0,7.6,2530,'1978-04-21','https://st.kp.yandex.net/images/film_iphone/iphone360_7119.jpg','I Wanna Hold Your Hand','1964 год, расцвет битломании. Знаменитая ливерпульская четверка впервые прилетает в США. Три подруги — импульсивная битломанка Роузи Петрофски, фотокорреспондентка Грейс Корригэн, мечтающая сфотографировать Битлз, а также нейтрально относящаяся к музыке Пэм Митчелл уговорили знакомого простофилю Ларри Дюбуа «позаимствовать» отцовский лимузин и отправиться в Нью-Йорк, на телешоу Эда Салливана, где Битлз дадут первый концерт на территории Соединённых Штатов. <br><br>По пути к ним присоединяются активистка- противница битломании Дженис Голдмэн и хулиган-дебошир Тони Смерко, втихаря задумавший сорвать выступление группы. Прибыв в Нью-Йорк, разношёрстная компания разбредается кто куда — кто на поиски билетов, а кто и на поиски самих Битлз, расположившихся в гостинице, тщательно охраняемой охраной…','$2 700 000'),(7121,'Парк Юрского периода',1993,127,0.0,7.8,124730,'1993-06-09','https://st.kp.yandex.net/images/film_iphone/iphone360_7121.jpg','Jurassic Park','Экспансивный богач и профессор уговаривает двух палеонтологов приехать на остров у побережья Коста-Рики, где он устроил парк Юрского периода. Парк населен давно вымершими динозаврами, воссозданными профессором по образцам крови из ископаемого комара, которые должны стать гвоздем программы нового аттракциона. До открытия остается несколько дней, а один из сотрудников, пытаясь украсть бесценные эмбрионы, нарушает систему охраны, что вместе с грозовым ливнем приводит к отключению электричества и защитных барьеров. Как раз в тот момент, когда палеонтологи с внуками профессора отправились на пробную экскурсию.','$63 000 000'),(7122,'Индиана Джонс и Храм судьбы',1984,118,0.0,7.9,74988,'1984-05-08','https://st.kp.yandex.net/images/film_iphone/iphone360_7122.jpg','Indiana Jones and the Temple of Doom','Вторая часть невероятных похождений прославленного археолога и искателя приключений Индианы Джонса. В этот раз бесстрашный доктор Джонс совершит путешествие в сердце Гималаев вместе с ресторанной певичкой Уилли Скотт и своим верным маленьким помощником Коротышкой.<br /><br />Здесь, среди величественных гор, археологу и его спутникам предстоит столкнуться с кровавым культом поклонения древней Богине Смерти — Кали. Станет ли Индиана следующим несчастным, погибшим на жутком алтаре человеческих жертвоприношений, или ему, как всегда, удастся вырваться из цепких лап страха и разобраться со злодеями.','$28 000 000'),(7123,'Шугарлендский экспресс',1974,109,0.0,6.9,2216,'1974-03-29','https://st.kp.yandex.net/images/film_iphone/iphone360_7123.jpg','The Sugarland Express','«Шугарлэнд Экспресс» основан на подлинной истории Лу Джин Поплин, которая похитила заключенного из техасской тюрьмы и вовлекла полицию в безумную погоню по всей территории штата, пытаясь спасти своего сына от грозящего ему усыновления приемными родителями.','$3 000 000'),(7124,'Бредущие',1968,26,0.0,6.3,237,'1968-12-18','https://st.kp.yandex.net/images/movies/poster_none.png','Amblin\'','Роуд-муви о путешествующих автостопом молодых парне и девушке.','Нет данных'),(7130,'Заблудшие души',2000,97,0.0,5.3,741,'2000-10-13','https://st.kp.yandex.net/images/film_iphone/iphone360_7130.jpg','Lost Souls','Главная героиня узнает о существовании таинственного дьявольского заклятия, воплощение которого грозит человечеству приходом Сатаны. Для того, чтобы предотвратить пришествие Зла, ей надо найти человека, в тело которого собирается вселиться дьявол, и убедить его, что все это — не религиозные бредни, и его жизни угрожает реальная опасность…','$50 000 000'),(7131,'Люди в черном: Атака чужого',2000,4,0.0,7.4,5497,'2000-04-08','https://st.kp.yandex.net/images/film/7131.jpg','Men in Black Alien Attack','Промо-ролик одноименного аттракциона во Флориде.','Нет данных'),(7133,'В луче света',1992,92,0.0,7.6,198,'1992-05-14','https://st.kp.yandex.net/images/film/7133.jpg','Visions of Light','Документальный фильм о величайших и классических примерах работы кинооператоров с 1895 по 1990 годы. Рассказы «мастеров кинокамеры» иллюстрируются кадрами из различных фильмов, среди которых «Унесённые ветром», «Гражданин Кейн», «Ребёнок Розмари», «Беспечный ездок», «Крёстный отец», «Таксист», «Голова-ластик», «Апокалипсис сегодня», «Синий бархат», «Славные парни» и многие другие.','Нет данных'),(7137,'Возвращение в страну Оз',1985,113,0.0,7.1,888,'1985-06-21','https://st.kp.yandex.net/images/film_iphone/iphone360_7137.jpg','Return to Oz','Дороти вернулась домой в Канзас, но не перестает думать о стране Оз. Ее тетя Эм, беспокоясь о здоровье девочки, отводит ее к известному доктору. Но Дороти убегает из клиники и вместе с курочкой Биллиной оказывается снова в стране Оз.<br><br>Она надеется найти своих друзей в Изумрудном Городе, но оказывается, что их всех похитил Король Ном, а злая ведьма Момби хочет заполучить голову Дороти. Теперь ей вместе с Биллиной, Тик-Током, Джеком Тыквоголовым и другими сказочными персонажами необходимо победить Момби и вернуть на престол законного короля.','$25 000 000'),(7138,'Лица',1968,130,0.0,7.7,1189,'1968-04-06','https://st.kp.yandex.net/images/film_iphone/iphone360_7138.jpg','Faces','Ричард и Мария женаты уже четырнадцать лет, но их брак переживает не лучшие времена. Устав друг от друга, они решают поискать забытую остроту ощущений на стороне. Однажды вечером Ричард сообщает Марии, что им пора развестись, и отправляется к проститутке.','$275 000'),(7141,'Братья Блюз',1980,148,0.0,7.7,9068,'1980-06-20','https://st.kp.yandex.net/images/film_iphone/iphone360_7141.jpg','The Blues Brothers','Братья-музыканты Джейк и Элвуд Блюзы узнают, что их родная церковь будет снесена, если за нее вовремя не внесут плату в 5 тысяч долларов. На поиск денег у братьев не много времени, и они решают дать концерт.<br /><br />Однако Джейк только что вышел из тюрьмы, а у Элвуда свои неприятности с законом, и добраться до них мечтают все кому не лень: полиция, бандиты, неонацисты. Прежде чем спасти церковь, братья Блюз устроят настоящий беспредел на улицах Чикаго…','$27 000 000'),(7142,'Дон Жуан де Марко',1995,97,0.0,7.6,15869,'1995-04-07','https://st.kp.yandex.net/images/film_iphone/iphone360_7142.jpg','Don Juan DeMarco','Романтическая мелодрама о взаимоотношениях стареющего врача-психиатра и его молодого пациента, который искренне считает себя Дон Жуаном. Дружба, возникшая между героями фильма помогает вернуть врачу утраченную молодость духа, свежесть чувств и способность мечтать.<br><br> Помешательство его подопечного окажется не чем иным, как исключительным отношением к женщинам, удивительной способностью молодого человека доставить каждой своей избраннице несравнимое ни с чем удовольствие любви…','$25 000 000'),(7143,'Новичок',1990,102,0.0,6.6,637,'1990-07-20','https://st.kp.yandex.net/images/film_iphone/iphone360_7143.jpg','The Freshman','Студент-первокурсник кинематографического факультета Нью-Йоркского университета Кларк Келлогг нанимается на летний семестр к богатому дельцу, американцу итальянского происхождения, подозрительно напоминающему Дона Корлеоне. Простодушный и доверчивый провинциал не сразу догадывается, что попал в самую сердцевину американо-итальянской мафии.','Нет данных'),(7144,'Формула',1980,117,0.0,6.4,118,'1980-12-19','https://st.kp.yandex.net/images/film_iphone/iphone360_7144.jpg','The Formula','Во время Второй мировой войны Германия разработала метод добычи дешевого и экологически безопасного синтетического топлива. Но после поражения Третьего рейха феноменальная формула исчезла. Теперь, спустя 35 лет, один детектив из Лос-Анджелеса находится на пути к разгадке старой тайны, которая может изменить ход мировой истории.','Нет данных'),(7145,'Супермен',1978,143,0.0,7.1,12766,'1978-12-10','https://st.kp.yandex.net/images/film_iphone/iphone360_7145.jpg','Superman','Цивилизация планеты Криптон стоит на грани гибели. Ученый Джор-Эл, чтобы спасти своему ребенку жизнь, отправляет его на Землю. Маленький мальчик вырастает и открывает в себе неземные возможности. Он — Супермен!<br><br>Огромная сила и способность летать помогают ему в борьбе с любыми проявлениями зла. И когда коварный злодей Лекс Лютор строит зловещие планы, угрожающие всему человечеству, только Супермен может помешать ему…','$55 000 000'),(7146,'Ночные пришельцы',1971,96,0.0,6.2,328,'1971-08-30','https://st.kp.yandex.net/images/film_iphone/iphone360_7146.jpg','The Nightcomers','Садовник Питер Квинт завязывает нездоровые отношения с гувернанткой, втягивая в свои порочные игры хозяйских детей.','Нет данных'),(7147,'Последнее танго в Париже',1972,129,0.0,7.5,18974,'1972-10-14','https://st.kp.yandex.net/images/film_iphone/iphone360_7147.jpg','Ultimo tango a Parigi','Действие происходит в Париже конца шестидесятых. Сорокапятилетний американец потрясен недавней смертью жены, он считает себя виновным и находится в состоянии глубокой депрессии.<br><br>Отчаянно цепляясь за жизнь, он знакомится с юной парижанкой, странной и эксцентричной девушкой, намного его моложе. Их связь переходит в страсть, доходящую почти до умопомрачения, страсть, пределы которой даже трудно представить…','$1 250 000'),(7148,'Кеймада',1969,121,0.0,7.5,296,'1969-12-20','https://st.kp.yandex.net/images/film_iphone/iphone360_7148.jpg','Queimada','Начало 19 века. Сэр Уильям Уолкер отправляется на далекий остров Кеймада в одну из португальских колоний. Его задача — нарушить сахарную монополию, удерживаемую португальцами. Для этого сэр Уильям провоцирует бунт рабов на плантациях. «Революция» проходит удачно. Уолкер возвращается домой героем Британии. Но через десять лет ему приходится вернуться на остров для того, чтобы подавить антибританское восстание, поднятое его бывшими соратниками…','Нет данных'),(7149,'Ночь следующего дня',1969,93,0.0,6.4,155,'1969-02-19','https://st.kp.yandex.net/images/film_iphone/iphone360_7149.jpg','The Night of the Following Day','В парижском аэропорту двое отморозков похищают девушку и отвозят её в дом на побережье, где находится штаб-квартира всей банды. После получения запрошенного выкупа, и без того натянутые отношения между похитителями сразу разлаживаются.','Нет данных'),(7150,'Сладкоежка',1968,115,0.0,6.2,465,'1968-12-17','https://st.kp.yandex.net/images/film_iphone/iphone360_7150.jpg','Candy','Молодая девушка по имени Кэнди, восхищаясь талантами или доблестями своих поклонников, неизменно оказывается в их постели. Она нравится всем без исключения, и они ее вожделеют.<br><br>Однако из-за этого всеобщего помешательства сначала в маленьком заштатном городке, а затем и в Нью-Йорке творятся странные вещи и даже трагедии. Там, где ступает очаровательная ножка Кэнди, мужчины сходят с ума, а женщины готовы убить друг друга.','$3 000 000'),(7151,'Аппалуза',1966,98,0.0,6.3,208,'1966-09-14','https://st.kp.yandex.net/images/film_iphone/iphone360_7151.jpg','The Appaloosa','Действие происходит в 70-х годах позапрошлого века. Мэтт разыскивает своего коня, украденного мексиканским бандитом…','Нет данных'),(7152,'Погоня',1966,135,0.0,7.4,1358,'1966-02-17','https://st.kp.yandex.net/images/film_iphone/iphone360_7152.jpg','The Chase','Штат Техас. В тихом провинциальном городке следит за порядком добропорядочный шериф Колдер. Однажды покой городка нарушает известие о том, что из тюрьмы бежал Баббер, который желает свести старые счеты кое с кем из жителей города. Коррумпированные отцы города испугались появления беглеца, ведь он слишком много знает об их грязном прошлом.','Нет данных'),(7153,'Моритури',1965,123,0.0,7.0,241,'1965-08-25','https://st.kp.yandex.net/images/film_iphone/iphone360_7153.jpg','Morituri','Вторая мировая война в самом разгаре. Агент британской разведки Роберт Крэйн — кодовое имя Моритури — под видом нацистского офицера направлен на немецкий корабль, который якобы транспортирует каучук. На самом деле, корабль перевозит военнопленных, которых и должен освободить агент, устроив на судне саботаж…','Нет данных'),(7154,'Сказка на ночь',1964,99,0.0,7.4,485,'1964-06-10','https://st.kp.yandex.net/images/film_iphone/iphone360_7154.jpg','Bedtime Story','История двух альфонсов, которые поспорили, кто из них лучший в своей профессии. Бенсон презирает женщин и изобретает все новые способы, чтобы уложить их в постель, а затем бросить. Джеймисон — настоящий профессионал, который изображает из себя сосланного принца и не только заставляет женщин делить с ним постель, но и дарить свои драгоценности для осуществления контрреволюции. Соревнование начинается. Тот, кто в нем победит получит право «окучивать» небольшой курортный город на Ривьере.','Нет данных'),(7155,'Гадкий американец',1963,120,0.0,6.9,101,'1963-04-02','https://st.kp.yandex.net/images/film_iphone/iphone360_7155.jpg','The Ugly American','Умный и харизматичный Харрисон МакУайт выставляет свою кандидатуру на суд Сената, дабы стать послом в Сархане, стране в Юго-Восточной Азии, где назревает гражданская война. Несмотря на свои знания о ней, кои он получил будучи военным, МакУайт видит во всем противостояние между США и коммунизмом. Он не хочет признавать, что антиамериканские настроения могут быть стремлением к самоопределению и национализму. Так он теряет своего друга Деона, местного героя, лидера оппозиции, игнорирует совет о приостановлении строительства дороги, и сталкивается с неминуемыми последствиями.','Нет данных'),(7156,'Мятеж на Баунти',1962,178,0.0,7.5,1004,'1962-11-08','https://st.kp.yandex.net/images/film_iphone/iphone360_7156.jpg','Mutiny on the Bounty','1789 год. Экипаж британского корабля «Баунти» под руководством жестокого капитана Блая, наполнив трюмы, отчаливает от берегов Таити. До этого дня в течение шести месяцев команда корабля подвергалась физическим и моральным издевательствам со стороны капитана, стремившегося любой ценой, даже ценой жизни матросов, выполнить приказ Адмиралтейства: доставить саженцы хлебного дерева на Ямайку. Изнурительная работа, отсутствие пищи, а под конец и ограничения в выдаче питьевой воды вынуждают моряков во главе с первым помощником Флетчером Кристианом поднять бунт…','$19 000 000'),(7157,'Одноглазые валеты',1961,141,0.0,6.6,485,'1961-03-30','https://st.kp.yandex.net/images/film_iphone/iphone360_7157.jpg','One-Eyed Jacks','Рио и Папаша — бандиты. В 1880 году они грабят банк в Мексике, но уходить от погони им приходится на одной лошади. Понимая, что на одной лошади им не оторваться, Рио посылает Папашу найти вторую лошадь, пока он будет отстреливаться от отряда погони.<br><br>Папаша, однако, оставляет попытки найти вторую лошадь и уезжает прочь вместе с добычей. Рио, естественно, поймали, когда у него закончились патроны, и он попадает в тюрьму. Через пять лет зверского обращения пленнику удается бежать и снова встретиться с Папашей, все таким же вероломным и опасным человеком, но теперь ставшим шерифом в небольшом городке и живущим вместе с женой и падчерицей.<br><br>Папаша, конечно, понимает, что Рио приехал не для того, чтобы поздравить его с Днем Отца, и принимает меры, чтобы защититься от обуреваемого жаждой мести Рио.','Нет данных'),(7158,'Из породы беглецов',1960,119,0.0,7.6,902,'1960-04-13','https://st.kp.yandex.net/images/film_iphone/iphone360_7158.jpg','The Fugitive Kind','Валентайн Ксавьер — бродячий музыкант, решивший сменить образ жизни и покончить со злачными местами и ночными клубами. Волею судьбы он попадает в провинциальный городок, где устраивается на работу продавцом в магазин Джейба Торренса. Между ним и Леди Торренс — женой хозяина магазина возникает симпатия. Но на сердце парня также претендует молодая и взбалмошная Кэрол Кутрер. В складывающихся обстоятельствах ему предстоит сделать нелегкий выбор.','Нет данных'),(7159,'Молодые львы',1958,160,0.0,7.2,690,'1958-04-02','https://st.kp.yandex.net/images/film_iphone/iphone360_7159.jpg','The Young Lions','Военная эпопея, в центре которой трое молодых людей. Один из них — немецкий офицер Кристиан Дистл. В ходе боев в Северной Африке он все более и более разочаровывается в вере в свою страну. Две другие истории раскрываются в американском военном лагере.<br><br>Еврей Ноа — застенчивый и неуклюжий клерк, страдающий от притеснений на национальной почве со стороны своих сослуживцев. Майкл Уитекр — певец и бродвейская звезда. Все они, полные надежд и стремлений, молодые львы, но война расставляет свои акценты.','$3 000 000'),(7160,'Сайонара',1957,147,0.0,7.4,1036,'1957-12-05','https://st.kp.yandex.net/images/film_iphone/iphone360_7160.jpg','Sayonara','Майор Ллойд Грувер служит на японской военно-воздушной базе в разгар войны в Корее. Грувер видит проявления расизма со стороны американских военных по отношению к японцам: военнослужащим запрещают жениться на японках.<br><br>Будучи первое время равнодушен к такой ситуации, Грувер вынужден изменить свою позицию, когда его друг Джо Келли влюбляется в местную женщину и собирается сочетаться с ней законным браком. Келли через голову командования обращается с прошением в Конгресс.<br><br>Поддерживая своего товарища, Грувер сам влюбляется в прекрасную японскую танцовщицу Хана-оги и оказывается в таком же положении, что и Келли.','Нет данных'),(7161,'Чайная церемония',1956,123,0.0,6.9,201,'1956-11-29','https://st.kp.yandex.net/images/film/7161.jpg','The Teahouse of the August Moon','Полковник Пурди крут и прямолинеен — жители оккупированной окинавской деревушки в Японии должны признать демократию американского образца. «Иначе я их всех перестреляю,» — безаппеляционно заявляет он.<br><br>Ответственным за приведение этого приказа в жизнь назначен капитан Фисби. Но придурковатый и рассеянный симпатяга Фисби сразу же попадает под тонкое, поначалу слабо ощутимое, но всепроникающее обаяние востока. Он сам не замечает, как хитрющий проныра-переводчик навязывает ему свои правила игры.<br><br>А когда его начинает опекать чувственная и обольстительная гейша с волшебным именем Цветущий Лотос, когда он растворяется в неге и безделье — всем начинает казаться, что пропал мужик.','Нет данных'),(7162,'Парни и куколки',1955,150,0.0,6.5,650,'1955-11-03','https://st.kp.yandex.net/images/film_iphone/iphone360_7162.jpg','Guys and Dolls','Прожжённый игрок Натан Детройт получает предложение организовать большую игру в кости, однако для этого требуется где-то достать 1000 долларов. Пребывая в затруднении, Натан случайно встречает Ская Мастерсона, славящегося своей страстью заключать пари практически на что угодно. <br><br>Скай хвастается, что может взять с собой в поездку на Кубу любую женщину, которую бы он только пожелал. Воспользовавшись этим случаем, Натан предлагает пари, что указанная им женщина не согласится отправиться со Скаем. Тот соглашается на поставленные условия, а Натан выбирает строгую Сару Браун из «Миссии по спасению душ». Скаю предстоит непростая задача…','$5 500 000'),(7163,'Любовь императора Франции',1954,110,0.0,6.9,334,'1954-11-16','https://st.kp.yandex.net/images/film_iphone/iphone360_7163.jpg','Désirée','Один неизвестный офицер по имени Наполеон, прекрасная простушка по имени Дезире, ставшая в конце концов Королевой, богатая и могущественная Жозефина, будущая императрица — вот далеко не полный перечень действующих лиц.<br><br>Дезире на протяжении всего фильма следит за триумфальным шествием великого Наполеона и борется то за свое чувство, то усмиряет свою страсть к нему, которою так никогда и не воплотить в реальности…','Нет данных'),(7164,'Дикарь',1953,79,0.0,7.1,2070,'1953-12-25','https://st.kp.yandex.net/images/film_iphone/iphone360_7164.jpg','The Wild One','Байкеры, называющие себя Черными бунтарями, врываются в легально проводимую гонку и пытаются присоединиться к соревнованию, но их выкидывают. Один из членов группы, однако, ухитряется украсть второй приз и вручает его лидеру Джонни.<br><br>Закрепив трофей у руля, Джонни уводит свою свору в городок Райтсвиль. Многие заваливаются в местный бар, «Кафе Бликера», принадлежащий шерифу Хэрри Бликеру — он сам там и работает. Ошеломленный происходящими безобразиями, он ничего не предпринимает, чтобы утихомирить грозных на вид ребят, пока те не напиваются до беспамятства.<br><br>Байкеры забавляются тем, что терроризируют городок, а главарь, увидев симпатичную девушку Кэти, следует за ней в бар. Та оказывается дочерью шерифа, он пытается произвести на нее впечатление, подарив ей кубок-приз. Хотя Кэти и заинтересовалась этим странным, несколько не от мира сего, жестким парнем, подарок она принять отказалась.<br><br>Тревога нарастает, когда в город с грохотом въезжает еще одна группа байкеров во главе с Чайно.','Нет данных'),(7165,'Юлий Цезарь',1953,120,0.0,7.5,1048,'1953-05-08','https://st.kp.yandex.net/images/film_iphone/iphone360_7165.jpg','Julius Caesar','Разгромив войска Помпея, римский полководец Цезарь стал главой государства. Он обладал пожизненными полномочиями диктатора, ему было дано исключительное право распоряжаться войском и казной. В честь него была воздвигнута статуя с надписью «Полубогу». Кассий и Брут возглавили заговор против Цезаря.<br><br>Жена Цезаря Кальпурния была напугана плохими знамениями, неоднократно предупреждала об опасности. В мартовские иды 44 г. до н. э. в Капитолии, во время заседания сената, Цезарь был убит. После бегства заговорщиков в Рим прибыл приемный сын Цезаря Октавий. Вместе с Антонием они начали готовиться к войне против войск Брута и Кассия.','Нет данных'),(7166,'Вива, Сапата!',1952,108,0.0,7.3,910,'1952-02-07','https://st.kp.yandex.net/images/film_iphone/iphone360_7166.jpg','Viva Zapata!','Фильм про великого Сапату, простого мексиканского крестьянина, поднявшего свой голос против произвола богачей и поднявшего руку на их ценности.','Нет данных'),(7167,'План «В»',2001,98,0.0,6.0,140,'2001-06-14','https://st.kp.yandex.net/images/film_iphone/iphone360_7167.jpg','Plan B','Чтобы отработать долги покойного мужа, рассеянная и неуклюжая Фрэн устраивается счетоводом к своему родственнику, мелкому мафиози Джозефу Мэлоуни, который вскоре дает ей ответственное задание: похитить и убить его могущественных врагов.<br><br>Ошарашенная Фрэн, которая за свою жизнь и мухи не обидела, соглашаетсястать убийцей, но выполняет миссию по-своему. Она похищает своих «жертв» и на время прячет их в доме своего брата. Кажется, что все проблемы блестяще решены, однако вскоре Джозеф изъявляет желание лично проверить, как его кровавая наемница справилась со своей новой ролью.<br><br> Теперь Фрэн нужно срочно придумать, как обмануть жестоких мафиози, спасти своих незадачливых подопечных и самой не стать жертвой своего гениального плана.','Нет данных'),(7168,'Город и деревня',2001,100,0.0,5.6,572,'2001-04-27','https://st.kp.yandex.net/images/film_iphone/iphone360_7168.jpg','Town & Country','Однажды семьянины со стажем: Портер Стоддард и его приятель Гриффин допрыгались. Первым попался Гриффин. Его похождения выплыли наружу, и его жена отреагировала… как и подобает случаю. Пытаясь выкрутиться, друзья запутываются окончательно. И тогда гуляки, наломавшие дров, решают сбежать в горную деревушку с твердым намерением завязать… Но городские привычки подводят их и здесь!','$90 000 000'),(7169,'Другая сестра',1999,129,0.0,7.4,1115,'1999-02-26','https://st.kp.yandex.net/images/film/7169.jpg','The Other Sister','Когда Карла Гэйт возвращается домой после многолетнего обучения в закрытой школе, девушка надеется, что пребывание там изменило ее. Ведь до этого она была «ребенком с отклонениями в психике».<br><br>Но ее надежды не оправдались, и Карла вновь рискует погрузиться в пучину депрессии, если бы не встреча с молодым человеком — Дэниелем, с такими же проблемами, как и у нее. Вспыхнувшая любовь переворачивает их жизни. И теперь весь мир мало интересует влюбленных, ведь отныне у Карлы и Дэниеля есть их взаимное чувство.','$35 000 000'),(7171,'Уж кто бы говорил 3',1993,96,0.0,6.7,6084,'1993-11-05','https://st.kp.yandex.net/images/film_iphone/iphone360_7171.jpg','Look Who\'s Talking Now','Подросшие дети — Майки и Джули — усиленно познают мир, выбирая для этого самые беспокойные и нервирующие бедных родителей способы. А помогают им методично превращать семейный очаг в сумасшедший дом парочка очаровательных псов.<br><br>Подобно детишкам из первых серий, собачки умеют говорить, хотя их, опять-таки слышат только зрители, но не герои.<br><br>А тем временем, пока лучшие друзья человека изощряются в остроумии, над браком Джеймса и Молли нависает угроза в виде красивой и изнывающей от одиночества богачки Саманты, которая наняла мистера Убриакко в качестве личного пилота. И она не прочь позволить ему выйти за рамки рабочих отношений…','Нет данных'),(7172,'Хорошая мать',1988,104,0.0,6.0,171,'1988-11-04','https://st.kp.yandex.net/images/film_iphone/iphone360_7172.jpg','The Good Mother','После недавнего развода в жизнь Анны, наконец, приходит настоящая любовь. Но чем больше ее сердце переполняется этим прекрасным чувством, тем большее непонимание вызывает ее образ жизни у окружающих.<br><br>Дело доходит до рассмотрения в суде вопроса лишения родительских прав на воспитание дочери. И перед Анной встает непростая задача доказать окружающим, что она непросто хорошая мать, а самая лучшая мать на свете.','Нет данных'),(7173,'Бэби-бум',1987,110,0.0,6.9,501,'1987-09-17','https://st.kp.yandex.net/images/film_iphone/iphone360_7173.jpg','Baby Boom','Деловая женщина, безумно занятая на работе, вынуждена круто изменить свою жизнь, когда у нее на руках оказывается крохотный плачущий комочек в пеленках. Она мечется между младенцем, боссом и «другом семьи» и находит успокоение, только уехав за город, где встречает замечательного человека — местного ветеринара. Среди бесконечных хлопот о ребенке наконец-то появляется время для любви.','Нет данных'),(7174,'Преступления сердца',1986,105,0.0,6.6,183,'1986-12-12','https://st.kp.yandex.net/images/film_iphone/iphone360_7174.jpg','Crimes of the Heart','Три истеричных сестрички Мэгги, Лени и Бейб собираются по случаю смертельной болезни их дедушки, а также из-за того, что младшая из них чуть не застрелила своего мужа-сенатора. Пытаясь решить проблемы друг друга, сестры то предаются ностальгическим воспоминаниям, то грызутся между собой.','$20 000 000'),(7175,'Маленькая барабанщица',1984,130,0.0,6.3,248,'1984-10-19','https://st.kp.yandex.net/images/film_iphone/iphone360_7175.jpg','The Little Drummer Girl','Израильские спецслужбы для поимки палестинского террориста Халиля вербуют англичанку Чарли — актрису одного из лондонских театров.<br><br>Руководитель операции Марти Курц убеждает Чарли «сыграть» роль любовницы младшего брата Халиля — Салима, которого держат в тюрьме. Они разрабатывают убедительную легенду, и палестинцы принимают «наживку» и увозят Чарли в горы Ливана.','Нет данных'),(7176,'Как аукнется, так и откликнется',1981,124,0.0,7.0,312,'1982-01-22','https://st.kp.yandex.net/images/film_iphone/iphone360_7176.jpg','Shoot the Moon','Брак Джорджа и Фэйт Данлэп дал трещину: это случилось после 15 лет счастливой совместной жизни, плодами которой стали четыре очаровательных дочери и замечательный собственный дом в Калифорнии.<br><br>Джордж заводит себе любовницу, а Фэйт — находит любовника. Но трагедия крушения семьи сумела доказать лишь то, что даже в самые страшные и безжалостные минуты супруги не переставали любить друг друга…','$12 000 000'),(7179,'Любовь и смерть',1975,82,0.0,8.1,15886,'1975-06-10','https://st.kp.yandex.net/images/film_iphone/iphone360_7179.jpg','Love and Death','Молодой русский дворянин из провинции пытается избежать призыва на войну с Наполеоном. Он ведет бесконечные «интеллигентские» разговоры со своей кузиной. Политика, философия и война — эти высокие материи стали темой бесконечного фейерверка иронии и юмора.','$3 000 000'),(7180,'Сыграй это еще раз, Сэм!',1972,85,0.0,7.8,2975,'1972-05-04','https://st.kp.yandex.net/images/film_iphone/iphone360_7180.jpg','Play It Again, Sam','Аллена, замкнутого и чудаковатого кинокритика, бросает жена. Нашего впечатлительного героя начинает посещать призрак Хамфри Богарта, исполнителя главной роли в легендарной ленте «Касабланка» (название фильма «Сыграй это снова, Сэм» — знаменитая реплика из классической картины).<br><br>Дружелюбная галлюцинация дает нашему герою ценные советы по части поведения с женщинами. Но амурные похождения горе-любовника оканчиваются полным провалом…','Нет данных'),(7183,'Подержанные львы',2003,109,0.0,7.7,8581,'2003-09-05','https://st.kp.yandex.net/images/film_iphone/iphone360_7183.jpg','Secondhand Lions','Последнее, что хотел юный герой картины, по имени Уолтер, так это «застрять» на все летние каникулы на ферме у своих родственников. К тому же, владельцы фермы, два пожилых дяди мальчика, Гарт и Хаб, оказались стариками «с приветом».<br><br>Например, для них абсолютно в порядке вещей заказать по почте… настоящего африканского льва! Поначалу Уолтер был шокирован странностями своих родственников, но со временем ему становится известно о тайнах прошлого.<br><br>Ходят слухи, что почтенные дяди были известными грабителями банков (а может что и похуже), ибо денег у них — превеликое множество!<br><br>Вскоре Уолтер узнаёт удивительную историю о приключениях в экзотических землях, где будут и похищенная принцесса, и арабские шейхи и, естественно, потерянные сокровища!','$30 000 000'),(7184,'Боги и генералы',2003,280,0.0,6.5,598,'2003-02-10','https://st.kp.yandex.net/images/film_iphone/iphone360_7184.jpg','Gods and Generals','Широкое эпическое полотно о начале Гражданской войны между Севером и Югом, рассказ о сражениях при Манассасе, Антиэтеме, Фредериксберге и Чанселлорсвилле. Основное действие разворачивается вокруг армии конфедератов и её генерала Джексона, удостоившегося прозвища Каменная Стена…','$56 000 000'),(7185,'Убийственное танго',2002,114,0.0,5.8,126,'2002-09-11','https://st.kp.yandex.net/images/film_iphone/iphone360_7185.jpg','Assassination Tango','Наемный убийца-профессионал Джон Джей получает важнейший заказ в своей карьере: убить погрязшего в коррупции аргентинского генерала и вернуться в Америку. И на все — три дня.<br><br>Неожиданно убийство откладывается и Джон, оказавшись среди пьянящих улиц и клубов Буэнос-Айреса, проводит время с прекрасной танцовщицей Мануэллой, которая становится его учителем и проводником в мире чувственности и страсти. Но он все же понимает, что идиллия не может продолжаться долго, и то, зачем он здесь, должно быть исполнено…','Нет данных'),(7186,'Апостол',1997,134,0.0,6.6,253,'1997-09-06','https://st.kp.yandex.net/images/film_iphone/iphone360_7186.jpg','The Apostle','Немолодой техасский проповедник Юлисс Дьюи переживает тяжелую полосу в жизни. У его жены роман с Хорэйсом, другим проповедником. Дьюи избивает Хорэйса бейсбольной битой, уходит из дома и пытается начать жить с нуля…','$5 000 000'),(7187,'Семейное дело',1996,109,0.0,6.7,116,'1996-03-29','https://st.kp.yandex.net/images/film_iphone/iphone360_7187.jpg','A Family Thing','У главного героя умирает престарелая мать, а через несколько дней ему передают ее предсмертное письмо, в котором она сообщает, что он — сын чернокожей служанки от ее мужа…','Нет данных'),(7188,'Счастливые звезды над Генриеттой',1995,109,0.0,7.0,151,'1995-04-20','https://st.kp.yandex.net/images/film_iphone/iphone360_7188.jpg','The Stars Fell on Henrietta','Оптимизму мистера Кокса позавидовал бы мул. Он непоколебимо верит, что около городка Генриетта, на хлопковой ферме, от которой больше пыли, чем хлопка, под тощей почвой лежит черное золото.<br><br>Конечно, лоза рудоискателя, пробование почвы на вкус или подбрасывание кота — несколько странные способы поиска нефти. Но, может быть, они не так безнадежны? Иначе говоря, как мог бы выразиться и сам мистер Кокс: «Лови сразу журавля в небе, впряги звезду в свою повозку!»','Нет данных'),(7189,'Тема для разговора',1995,106,0.0,6.4,864,'1995-07-20','https://st.kp.yandex.net/images/film_iphone/iphone360_7189.jpg','Something to Talk About','Жизнь главной героини Грейс, как картинка. Так она и течет сама по себе, будто «не в фокусе», до тех пор, пока Грейс не обнаруживает, что ее муж Эдди ей изменяет…','Нет данных'),(7190,'Джеронимо: Американская легенда',1993,115,0.0,6.9,699,'1993-12-02','https://st.kp.yandex.net/images/film_iphone/iphone360_7190.jpg','Geronimo: An American Legend','1885-86 годы. Пять тысяч американских солдат брошены на то, чтобы раз и навсегда подавить сопротивление индейцев. Во главе повстанцев стоит легендарный индейский воин Джеронимо. Похоже, что ему и горстке его храбрецов не страшна даже такая большая армия.<br><br>Легендарного индейца удаётся взять в плен, но Джеронимо сбегает в сторону Мексики. И тогда разъярённый бригадный генерал приказывает разделаться с непокорным предводителем краснокожих…','$35 000 000'),(7191,'Чума',1992,145,0.0,5.9,245,'1992-08-26','https://st.kp.yandex.net/images/film_iphone/iphone360_7191.jpg','La peste','Современный мегаполис охватывает эпидемия чумы. В городе начинается паника. В этой отчаянной ситуации каждый борется только за свою жизнь. Главным героям фильма предстоит пройти через все мыслимые и немыслимые кошмары, чтобы сохранить жизнь и достоинство.','Нет данных'),(7192,'Беспутная Роза',1991,112,0.0,6.5,320,'1991-09-10','https://st.kp.yandex.net/images/film_iphone/iphone360_7192.jpg','Rambling Rose','Когда девушку Розу наняли служанкой в зажиточный дом в штате Джорджия, вряд ли кто-нибудь из семьи Хиплеров предполагал, что их жизнь кардинально изменится. Роза привносит в их пресный быт такой заряд нерастраченной сексуальной энергии, что заряжает ею как благонравного отца семейства, так и его 13-летнего сына Бадди.','$7 500 000'),(7193,'Заключенные',1991,93,0.0,6.2,92,'1991-12-06','https://st.kp.yandex.net/images/film_iphone/iphone360_7193.jpg','Convicts','История мальчика-подростка, который во время Великой Депрессии находит работу на сахарной плантации и извлекает удивительные уроки жизни, общаясь с заключенными, работающими там.','Нет данных'),(7194,'Рассказ служанки',1989,108,0.0,6.2,1651,'1990-02-15','https://st.kp.yandex.net/images/film_iphone/iphone360_7194.jpg','The Handmaid\'s Tale','В Республике Гилеад царит полуфашистский режим. На каждом шагу военные патрули. Люди в офицерской форме — самые желанные гости в респектабельных домах и самые желанные клиенты во всех государственных и прочих заведениях. Жены людей в офицерской форме — самые чопорные дамы в обществе. У них у всех сплошные достоинства и только один досадный недостаток: они не рожают детей. Потому для вынашивания потомства насильно сгоняются со всей Республики женщины подходящего возраста, способные к деторождению. Они под постоянным надзором живут в специальном охраняемом помещении, пока проходят курс подготовки, после чего становятся любовницами людей в офицерской форме.','Нет данных'),(7195,'Цвета',1988,120,0.0,6.7,1006,'1988-04-15','https://st.kp.yandex.net/images/film_iphone/iphone360_7195.jpg','Colors','Лос-Анджелес захлестнула волна преступности. В городе орудуют сотни преступных группировок, в которых состоит более 70000 человек. Ежедневно в бандитских разборках гибнут мирные жители. Такое положение вещей не устраивает двух «горячих» полицейских.<br><br>Один из них — умудренный опытом и чрезвычайно жестокий, второй — молодой, но с очень крутым нравом. Вместе они пытаются остановить насилие на улицах города. Постепенно ситуация выходит из-под контроля, и Лос-Анджелес превращается в кровавое поле боя. И без того напряженное положение осложняется любовной интригой, возникшей между молодым полицейским и прекрасной девушкой, состоящей в одной из банд.<br><br>Но смогут ли они быть вместе; ведь в мире, где правит жестокость, за ошибки приходится платить кровью.','$6 000 000'),(7197,'Давай спасем Гарри',1986,102,0.0,5.8,74,'1986-10-31','https://st.kp.yandex.net/images/film_iphone/iphone360_7197.jpg','Let\'s Get Harry','Драматический боевик о похищении американского посла и случайно оказавшегося рядом рабочего бандой торговцев наркотиками в Южной Америке. У рабочего оказались друзья, которые при помощи наемника отправляются в джунгли его спасать.','Нет данных'),(7199,'Каменный мальчик',1984,91,0.0,5.9,71,'1984-04-04','https://st.kp.yandex.net/images/film_iphone/iphone360_7199.jpg','The Stone Boy','Младший брат случайно застрелил старшего — как жить дальше?','Нет данных'),(7200,'Нежное милосердие',1983,92,0.0,6.6,675,'1983-03-04','https://st.kp.yandex.net/images/film_iphone/iphone360_7200.jpg','Tender Mercies','Жизнь певца кантри не удалась. Каждый день одно и то же, никаких перспектив, и радость приносит только общение с рюмочкой, которая с каждым днем становится все милее и милее и, наконец, оказывается единственной верной подружкой. И только нежное милосердие молодой привлекательной вдовы и ее сынишки заставило его однажды взглянуть на мир трезвыми глазами и пробудило стремление к нормальной жизни, которая, оказывается, существует, просто он из нее выпал…','Нет данных'),(7201,'Преследование Д. Б. Купера',1981,100,0.0,6.3,84,'1981-11-13','https://st.kp.yandex.net/images/film_iphone/iphone360_7201.jpg','The Pursuit of D.B. Cooper','Талантливый авантюрист по прозвищу Д. Б. Купер умудряется претворить в жизнь хитроумный и необычный план ограбления на борту «Боинга-727». Однако его бывший армейский «сослуживец», а ныне — агент страховой компании Билл Гриен догадывается, кто на самом деле скрывается под личиной Купера, и отправляется на его поимки. Подобные догадки озаряют светлую голову еще одного армейского «товарища» Купера — Рэмсона, который также присоединяется к веселой, полной приключений и курьезов погоне!','Нет данных'),(7202,'Тайны исповеди',1981,108,0.0,6.2,765,'1981-09-24','https://st.kp.yandex.net/images/film_iphone/iphone360_7202.jpg','True Confessions','Два великих актера — Роберт Де Ниро и Роберт Дюваль играют роли двух братьев, ищущих таинственного убийцу, чья жестокость не укладывается в рамки обычного понимания — тело жертвы разрезано пополам.<br><br>Расследуя это зверское убийство юной проститутки, офицер полиции Том приезжает в город, где живет его брат — священник монсеньер Десмонд Спелласи. В деле оказываются замешанными самые уважаемые люди города, жертвующие огромные деньги на благотворительность и церковь.<br><br>Так или иначе, но и священник, и полицейский тоже втягиваются в эту грязную игру, где запах денег отравляет души всех смертных.','Нет данных'),(7203,'Величайший',1977,101,0.0,7.1,187,'1977-05-19','https://st.kp.yandex.net/images/film_iphone/iphone360_7203.jpg','The Greatest','Агент боксёра Кассиуса Клея жёстко разбирает условия предстоящих боёв, говоря, что величайшие чернокожие боксёры по окончании карьеры становились бедными и Клей не должен проходить этот путь.<br><br>Кассиус Клей переходит в ислам, принимая имя Мохаммед Али. Позднее он отказывается отправиться на войну во Вьетнаме. Это осложняет его профессиональную карьеру и приводит к судебному процессу, который Али выигрывает.','Нет данных'),(7204,'Критическое решение',1976,113,0.0,6.0,174,'1976-10-24','https://st.kp.yandex.net/images/film_iphone/iphone360_7204.jpg','The Seven-Per-Cent Solution','Новое приключение Шерлока Холмса и доктора Ватсона забрасывает знаменитых детективов на просторы континентальной Европы. Причиной такого дальнего путешествия стали серьезные проблемы со здоровьем знаменитого сыщика: пагубное пристрастие Шерлока Холмса к наркотикам достигло критичной отметки и вылилось в манию преследования.<br><br>Спасти Холмса может только знаменитый австрийский медик Зигмунд Фрейд, но упрямый частный детектив не желает даже слышать о лечении. Доктор Ватсон пускается на хитрость, заманивая своего друга в Вену, а по их следам уже идет демонический профессор Мориарти…','Нет данных'),(7205,'Побег',1975,96,0.0,6.6,331,'1975-03-07','https://st.kp.yandex.net/images/film_iphone/iphone360_7205.jpg','Breakout','Отчаянный летчик Ник Колтон берётся вытащить из мексиканской тюрьмы некоего Джея Вагнера за вознаграждение в 250 тысяч долларов. Операция по спасению заключенного представляется практически невыполнимой даже для хорошо подготовленных и вооруженных спецгрупп. Уникальность задания заключается в том, что выполнить его под силу лишь одиночке. Но лучшему из лучших.','$1 000 000'),(7206,'Команда',1973,103,0.0,6.5,154,'1973-10-19','https://st.kp.yandex.net/images/film_iphone/iphone360_7206.jpg','The Outfit','Гангстер Маклин, выйдя из тюрьмы, узнает, что не так давно его брат был убит киллером. Оказывается, банк, который они пытались ограбить, принадлежит мафии, а она подобных вещей не прощает…','Нет данных'),(7210,'Великий налет на Нортфилд',1972,91,0.0,6.2,68,'1972-05-12','https://st.kp.yandex.net/images/film_iphone/iphone360_7210.jpg','The Great Northfield Minnesota Raid','Одна из многочисленных киноверсий о похождениях банды Джеймсов — Янгеров, на этот раз довольно удачная благодаря прекрасному актерскому коллективу. Действия легендарных бандитов реалистичней, чем обычно, причем режиссер не стесняется показывать изнанку этой одной из самых «святых» легенд Дикого Запада.','Нет данных'),(7211,'Представитель закона',1971,99,0.0,6.9,157,'1971-03-11','https://st.kp.yandex.net/images/film_iphone/iphone360_7211.jpg','Lawman','Шериф приезжает в маленький городок, намереваясь арестовать нескольких ковбоев, пристреливших по пьяной лавочке несчастного старика. И, хотя все население городка встречает его с ненавистью и проклятиями, это лишь вызывает улыбку на его лице.','Нет данных'),(7213,'Люди дождя',1969,101,0.0,7.2,869,'1969-06-24','https://st.kp.yandex.net/images/film_iphone/iphone360_7213.jpg','The Rain People','Замужняя молодая женщина Натали, живущая в Нью-Йорке, имеет все — мужа, дом, достаток. И все-таки ей чего-то не хватает. Узнав, что беременна, она однажды утром покидает спящего мужа и отправляется на своем автомобиле в далекое путешествие по стране.<br><br>Она встречает красивого парня и берет его с собой, чтобы испытать новое сексуальное приключение. Но скоро выясняется, что Джимми — человек слабоумный и ведет себя, как ребенок.<br><br>Натали привязывается к нему, испытывая материнские чувства и ответственность за беспомощного человека. Что с ней будет дальше?','$750 000'),(7214,'Детектив Буллитт',1968,114,0.0,7.3,3290,'1968-10-17','https://st.kp.yandex.net/images/film_iphone/iphone360_7214.jpg','Bullitt','Известный в Сан-Франциско политик, сенатор Уолтер Чалмерс, получил шанс продвинуться по карьерной лестнице. В его руках оказался важный свидетель Джон Росс, который готов дать показания на боссов крупного преступного синдиката. Жизни Росса угрожает опасность, и Чалмерс помещает его под охрану местных полицейских. Ответственность за безопасность свидетеля ложится на плечи лейтенанта Фрэнка Буллита.','$5 500 000'),(7215,'Детектив',1968,114,0.0,6.4,157,'1968-05-28','https://st.kp.yandex.net/images/film_iphone/iphone360_7215.jpg','The Detective','Полицейский детектив Джо Леланд ведет расследование запутанного дела по убийству молодого гомосексуалиста. В ходе расследования он обнаруживает связь с должностной коррупцией в Нью-Йорке и оказывается в ловушке между рядом компромиссов и собственной честностью…','Нет данных'),(7217,'Капитан Ньюмэн, доктор медицины',1963,126,0.0,7.1,121,'1963-12-25','https://st.kp.yandex.net/images/film_iphone/iphone360_7217.jpg','Captain Newman, M.D.','1944 год. Герой истории — капитан Ньюмэн, начальник невропсихиатрического отделения армейского госпиталя во время войны, который ставит свои медициниские обязательства выше военного долга. Рассматриваются три истории болезни. Первая о капрале с множеством наград, который считает себя трусом потому, что бросил друга в горящем самолете. Другая о полковнике, ставшем буйнопомешанным из-за чувства вины так как послал так много своих людей на смерть в воздушном бою. А третья о капитане, который стыдится того, что прятался один в погребе больше года на территории, окуппированной немцами.','Нет данных'),(7221,'Даллас 362',2002,100,0.0,5.8,94,'2003-06-14','https://st.kp.yandex.net/images/film_iphone/iphone360_7221.jpg','Dallas 362','Даллас и Расти — лучшие друзья. Их цель в жизни — девочки, вечеринки, сквернословие и аресты. Если бы не мать Расти, Мэри, друзья бы никогда не покидали тюремных стен. Однажды, Расти оказывается на перепутье. Благодаря своей матери, он разрывается между желанием, по примеру своего отца, стать ковбоем и участвовать в родео, и своим нынешним образом жизни, который не приносят ничего, кроме проблем.<br><br>С благими намерениями Мэри обращается к своему бойфренду, психотерапевту Бобу, с просьбой помочь друзьям и наставить их на путь истины. Расти и Бобу удается наладить хорошие отношения, что влечет за собой изменения в жизни первого. А вот Даллас предпочитает ничего не менять в своей жизни, и ставит дружбу под удар. Он понимает, что Боб может изменить жизнь друзей навсегда!<br><br>Когда Расти говорит Далласу о том, что собирается покинуть его и отправиться на поиски своей мечты, Даллас уговаривает его согласиться на последнее приключение, во время которого им встречаются интересные личности, включая любительницу травки Пег, удачливого гангстера Беара, мелких хулиганов Кристиана и Рубена, а также девушку-мечту Аманву, каждый из которых сыграет свою роль в удивительном будущем, Далласа и Расти.','Нет данных'),(7222,'Эльф',2003,97,0.0,6.3,10431,'2003-10-09','https://st.kp.yandex.net/images/film_iphone/iphone360_7222.jpg','Elf','Много лет назад игривый малыш спрятался в мешке Санта-Клауса и отправился на далёкий Северный Полюс.<br><br>Очутившись среди эльфов, бедный мальчуган был усыновлён одним из них, получил имя Бадди и спустя годы пытается утвердиться в сложном мире волшебных пигмеев. Одна проблема — слишком уж он высок и заметен, чтобы стать настоящим эльфом… <br />','$33 000 000'),(7224,'Пансион Джерико',2003,94,0.0,6.2,196,'2003-09-06','https://st.kp.yandex.net/images/film_iphone/iphone360_7224.jpg','Jericho Mansions','Маленькая квартирка Леонарда Грея превратилась для него во Вселенную, заменив весь окружающий мир. Каждый миллиметр поблекших обоев, старый ковер, бряцающий эскалатор стали для него крепостью, защищающей от ночного кошмара улицы.<br><br>Но неожиданно эта крепость начинает рушиться. Лили Мельник, домоправительница, обвиняет его в краже вещей из квартиры.','$6 200 000'),(7226,'Догвилль',2003,178,0.0,7.9,104687,'2003-05-19','https://st.kp.yandex.net/images/film_iphone/iphone360_7226.jpg','Dogville','Юная Грейс, сбежав от банды гангстеров, находит спасение в маленьком городке Догвилль где-то в Скалистых горах. Местные жители — один прекраснее другого — готовы ее укрыть. А взамен им совсем ничего не надо, ну, разве что помочь по дому или присмотреть за детьми. Но постепенно милый Догвилль превращается для девушки в тюрьму.','$10 000 000'),(7227,'Город призраков',2002,116,0.0,6.0,566,'2002-09-10','https://st.kp.yandex.net/images/film_iphone/iphone360_7227.jpg','City of Ghosts','После уклонения от расследования по делу жульничества со страховкой в Соединённых Штатах, Джимми Кремминг оказывается в Бангкоке. Он узнаёт, что его партнёр и наставник был замечен в Камбодже, после чего он решает отправиться на его поиски.<br><br>Но он попадает в странную и зловещую обстановку, где ум — это соблазн. Чем больше Джимми ищет Марвина, тем глубже он погружается в муки.','$17 500 000'),(7228,'Ночь в Золотом Орле',2001,87,0.0,6.1,55,'2002-04-26','https://st.kp.yandex.net/images/film/7228.jpg','Night at the Golden Eagle','Томми выходит из тюрьмы после семи лет заключения. У дверей тюрьмы его встречает старый друг Мик, решивший вернуть приятеля к честной жизни. В течение двух лет Мик копил деньги и теперь предлагает Томми вместе уехать в Лас-Вегас, найти работу и честно зарабатывать себе на жизнь.<br><br>Не сказать, чтобы Томми в восторге от идей друга, но возвращаться в тюрьму (а именно к этому все придет, если вести прежний образ жизни) ему тоже не хочется. Он соглашается.<br><br>Но прежде чем сесть в автобус, идущий в Лас-Вегас, и окончательно распрощаться с прошлым, друзьям предстоит провести всего лишь одну ночь в затрапезной гостинице с громким названием «Золотой Орел», пристанище проституток и неудачников…','Нет данных'),(7229,'В тени',2001,105,0.0,5.1,108,'2001-08-02','https://st.kp.yandex.net/images/film_iphone/iphone360_7229.jpg','In the Shadows','Выполняя опасный трюк для нового фильма, погибает молодой каскадер Джимми, также служивший наркокурьером в крупной мафиозной семье, глава которой теперь хочет отомстить за его смерть.<br><br>Он поручает талантливому наемному убийце Эрику жестоко расправиться с постановщиком трюков Лэнсом, но у Эрика более серьезные планы — он стремится разыскать крупную партию наркотиков, которую Джимми спрятал накануне своей смерти. Сблизившись с Лэнсом, Эрик влюбляется в его очаровательную дочь и вскоре успешно пробует себя на новом поприще трюкача.<br><br>Он хочет защитить своего друга и наставника, забывая о том, что мафия всегда добивается своего, даже если ради этого ей приходится избавляться от своих самых верных слуг…','Нет данных'),(7230,'Убийство в «Центре Америки»',2000,97,0.0,6.3,125,'2001-06-15','https://st.kp.yandex.net/images/film/7230.jpg','Viva Las Nowhere','Где-то на бескрайних просторах Канзаса расположен обдуваемый всеми ветрами мотель с гордым названием «Центр Америки». Постояльцы редко осчастливливают своими визитами этот одинокий приют усталого путника.<br><br>А посему содержателю мотеля, Фрэнку Джэйкобсу, приходится трудно. И не только из-за того, что дела идут неважно, но и потому, что Джэйкобсу очень не повезло с женой. Эта несносная женщина без конца «пилит» и унижает несчастного Фрэнка. И жил бы он в тоске и бесправии, если бы не повстречалась ему на пути настоящая роковая женщина.<br><br>После этой фатальной встречи унылая жизнь владельца мотеля невообразимо изменится. В течение последующих нескольких дней герой переживет абсолютно невероятные приключения: жену владельца «Центра Америки» пристрелят, роковая женщина тоже отправится на тот свет, а самого Фрэнка заживо закопают, одновременно подарив шанс осуществить его заветную мечту!','Нет данных'),(7231,'Бутылочная ракета',1995,92,0.0,6.7,4853,'1996-02-21','https://st.kp.yandex.net/images/film_iphone/iphone360_7231.jpg','Bottle Rocket','Трое молодых друзей из Техаса — Диган, Энтони и Боб — долго не могли решить, чем им заняться в этой жизни. И вот, наконец, сделали судьбоносный выбор, встав на путь… преступности.<br><br>Они думали, что жизнь вора полна романтики. А оказалось, что на этом поприще удача уготована далеко не всем. После первого же дела — ограбления книжного магазина — друзья пустились в бега…','$7 000 000'),(7233,'Плоть от плоти',1993,126,0.0,6.2,295,'1993-11-05','https://st.kp.yandex.net/images/film_iphone/iphone360_7233.jpg','Flesh and Bone','Мелкий техасский бизнесмен Арлис Суини вот уже тридцать лет живет, преследуемый одним и тем же кошмаром. В детстве он стал свидетелем жестокого убийства, совершенного его отцом Ройем: погибла целая семья, в живых осталась лишь малышка в колыбельке.<br><br>А теперь случайное знакомство с симпатичной девушкой Кей Дэвис поселяет в душе Арлиса смутное чувство тревоги. И не спроста! Коварная судьба решила вновь свести уцелевших свидетелей событий той страшной ночи.','Нет данных'),(7234,'Медовый месяц в Лас-Вегасе',1992,96,0.0,6.5,2830,'1992-08-28','https://st.kp.yandex.net/images/film_iphone/iphone360_7234.jpg','Honeymoon in Vegas','Джек и Бэтси едут в Вегас, чтобы пожениться. Там они встречают богатенького азартного игрока, который подстраивает, чтобы Джек проиграл в покер 65 тысяч долларов, взамен долга он предлагает взять на выходные «в прокат» его невесту. Что делать, приходится соглашаться.<br><br>Неожиданно Джек начинает безумно ревновать. Он летит на Гавайи, преследуя их…','$25 000 000'),(7235,'Поцелуй меня на прощанье',1982,101,0.0,6.2,227,'1982-12-22','https://st.kp.yandex.net/images/film_iphone/iphone360_7235.jpg','Kiss Me Goodbye','Спустя три года после смерти мужа Джолли Виллано, его молодая вдова Кэй решает вновь сочетаться узами брака. Но на пути казалось бы безоблачного счастья возникает неожиданное препятствие. Появившийся так некстати призрак ее бывшего мужа явно намерен сорвать предстоящую свадьбу…','Нет данных'),(7236,'Болеро',1981,184,0.0,7.0,154,'1981-05-27','https://st.kp.yandex.net/images/film_iphone/iphone360_7236.jpg','Les uns et les autres','Картина, повествующая о судьбах европейских музыкантов, охватывающая период с начала 20-х до конца 70-х годов нашего века.','Нет данных'),(7237,'Вор',1981,122,0.0,7.1,1847,'1981-03-27','https://st.kp.yandex.net/images/film_iphone/iphone360_7237.jpg','Thief','Фрэнк — эксперт по вскрытию сейфов, профессионал высшей пробы, и работы для него всегда хватает. Но он уже побывал за решеткой, и возвращаться туда не собирается. Нужен всего один, но верный взлом.<br><br>И тут дразнящая мечта о будущем заставляет его потерять осторожность: поддавшись искушению, матерый волк-одиночка соглашается поработать на крупного мафиози! Капкан захлопнулся, разовых контрактов с мафией не бывает. Лучший друг Фрэнка убит, любимая женщина — в руках бандитов, а сам он становится их собственностью…','Нет данных'),(7240,'Приближается всадник',1978,118,0.0,6.2,146,'1978-10-25','https://st.kp.yandex.net/images/film_iphone/iphone360_7240.jpg','Comes a Horseman','Когда миловидную вдову вынуждают передать старенькую ферму ее бывшему, бессовестному и могущественному любовнику, она, в последней попытке спасти хозяйство, обращается за поддержкой к враждующему с ней соседу.<br><br>С великой изобретательностью и усилиями они сводят концы с концами, лишь бы выплатить долги. Но настоящие неприятности для них еще только начинаются.','Нет данных'),(7243,'Роллербол',1975,125,0.0,6.0,735,'1975-06-25','https://st.kp.yandex.net/images/film_iphone/iphone360_7243.jpg','Rollerball','Фантастический фильм. 2018 год. Нет больше войн и преступлений. Корпорации правят миром и властвуют над умами людей. Игра роллербол — жестокая и кровавая — стала самым популярным видом спорта во всем мире.<br><br>Чемпион Джонатан Е. — атлет с десятилетним стажем — становится кумиром миллионов людей. И этот факт очень тревожит руководителей корпораций. Они настаивают на уходе Джонатана из большого спорта. Но получают категорический отказ. И тогда в игре резко меняются правила…','Нет данных'),(7244,'Смешная леди',1975,136,0.0,7.1,476,'1975-03-15','https://st.kp.yandex.net/images/film_iphone/iphone360_7244.jpg','Funny Lady','Фанни Брайс была уникальной женщиной. В истории американской эстрады не было другой звезды мюзиклов, которая могла бы сравниться с ней голосом, чувством юмора и насыщенностью жизни событиями и приключениями.<br><br>В этом фильме Вы увидите Фанни на пике карьеры — но не в самый лучший миг личной жизни. Она расстается с мужем Ником Арнштейном, который не смог примирить свою любовь к супруге со страстью к азартным играм.<br><br>Но неисправимая оптимистка Фанни не умела долго горевать, на ее горизонте появляется обаятельный и талантливый импресарио Билли Роуз, и вот уже Смешная леди, отбросив депрессию, снова погружается в водоворот жизни, где ее ждут новые песни, новые шоу, новые забавные приключения, и, конечно, новая любовь!…','Нет данных'),(7246,'Увольнение до полуночи',1973,117,0.0,6.2,102,'1973-12-18','https://st.kp.yandex.net/images/film_iphone/iphone360_7246.jpg','Cinderella Liberty','Джон Бэггс, боцман одного из военных кораблей, отправляется в отпуск в Сиэтл поправить здоровье. В местном баре он знакомится с женщиной легкого поведения Мегги. Довольно скоро Бэггс без памяти влюбляется в Мегги и привязывается к ее 11-летнему сыну Дугу. Он мечтает жениться и создать семью, вот только его избранница не готова начать новую жизнь…','Нет данных'),(7251,'Путешествие в Шилох',1968,101,0.0,6.1,99,'1968-05-10','https://st.kp.yandex.net/images/film_iphone/iphone360_7251.jpg','Journey to Shiloh','Канун гражданской войны XIX века в США. Семеро молодых, отважных ковбоев-красавцев путешествуют по просторам Дикого Запада, защищая честь молодых прелестниц и порабощенных чернокожих жителей. Именно они призваны вступить в конфедеративную армию и прославиться!','Нет данных'),(7253,'Славные парни',1965,112,0.0,6.1,71,'1965-07-07','https://st.kp.yandex.net/images/film_iphone/iphone360_7253.jpg','The Glory Guys','Что может быть хуже для двух кавалерийских офицеров, чем бой с местными племенами из-за женщины?','Нет данных'),(7254,'Женщина в клетке',1964,94,0.0,6.8,173,'1964-06-10','https://st.kp.yandex.net/images/film_iphone/iphone360_7254.jpg','Lady in a Cage','Однажды поэтесса Корнелия застряла в лифте и привлекла внимание одного алкоголика, решившего, что такой шанс выпадает раз в жизни. Безнаказанно ограбив квартиру поэтессы, мужчина удалился… но не надолго. Вскоре он вернулся в компании приятелей, чтобы вдоволь потешиться над невольной пленницей лифта.','Нет данных'),(7256,'Поцелуй невесту',2002,89,0.0,5.8,255,'2002-10-16','https://st.kp.yandex.net/images/film_iphone/iphone360_7256.jpg','Kiss the Bride','Три сестры возвращаются домой на свадьбу четвертой. Первая — Тони, играет в группе вместе со своей девушкой Эми, вторая — Крисси, преуспевающий инвестор с Уолл-Стрит, третья — Никки, успешная актриса… Четвертой же всегда не хватало того внимания, какое она вдруг начала получать в подготовке ко свадьбе. Однако, оказывается, что не всё в их отношениях однозначно…','Нет данных'),(7259,'Семейное дело',2001,97,0.0,6.5,105,'2001-08-29','https://st.kp.yandex.net/images/film/7259.jpg','The Whole Shebang','Семья Базинни по праву гордится своим бизнесом. Глава клана, папаша Базинни, когда — то эмигрировал из родной Италии, основав в далекой Америке собственное дело — компанию по производству фейерверков. Работа со взрывчаткой — штука опасная.<br><br>Производственные травмы — грозный спутник «подрывника»: если повезет — останешься без пальцев, а если нет — мгновенно отправишься в гости ко Всевышнему. Что, собственно, и случилось с единственным сыном папаши Базинни, который так «раскочегарился» с любовницей прямо на рабочем месте, что от искр его страсти взлетела на воздух целая мастерская.<br><br>Теперь семья Базинни осталась без наследника, а очаровательная жена (Фонда) усопшего — без мужа. Кто теперь продолжит семейное дело? В связи с чрезвычайной ситуацией из Неаполя «выписывают» таинственного родственника, который должен заменить покойного «на боевом посту»…','Нет данных'),(7262,'Хозяйка',1998,95,0.0,5.5,65,'1998-08-26','https://st.kp.yandex.net/images/film/7262.jpg','The Landlady','Мелани с юных лет хотела только одного: выйти замуж за хорошего человека и обзавестись семьей. Но все мечты были разрушены, когда она обнаружила, что муж ей изменяет. Тогда она помогла ему отправиться на тот свет и решила начать новую жизнь.<br><br>Став хозяйкой жилого дома, который достался ей по наследству, Мелани обращает пристальное внимание на своего симпатичного жильца Патрика. Она уверена, что им самой судьбой предназначено быть вместе, и убьет любого, кто осмелится помешать ее планам…','Нет данных'),(7266,'Холодные небеса',1990,98,0.0,5.3,139,'1991-09-13','https://st.kp.yandex.net/images/film_iphone/iphone360_7266.jpg','Cold Heaven','Во время отдыха на курорте Акапулько погибает муж молодой женщины. Труп везут в морг, где он и ожидает вскрытия. Однако в тот день, когда вскрытие должно было произойти, труп исчезает из морга. Вдова вынуждена вернуться домой, пребывая в глубочайшем недоумении. Но затем ее муж возвращается…','Нет данных'),(7267,'Рокки 5',1990,104,0.0,6.8,24742,'1990-11-13','https://st.kp.yandex.net/images/film_iphone/iphone360_7267.jpg','Rocky V','После поединка с советским чемпионом Иваном Драго, боксерская карьера Рокки подходит к концу. Здоровье потеряно, да и возраст уже ветеранский. А все заработанные потом и кровью сбережения украдены или потрачены. Так что единственное, что ему остается — это перейти на тренерскую работу.<br><br>Но и там не все спокойно, его любимый, подающий надежды ученик, бросает Рокки и уходит к другому тренеру. Но никакие удары судьбы не смогут сломить стоический характер Рокки.<br><br>Даже в сложившейся ситуации он не теряет веры в свою счастливую звезду и находит в себе силы для новых достижений.','$42 000 000'),(7268,'Нью-йоркские истории',1989,124,0.0,6.8,3145,'1989-03-01','https://st.kp.yandex.net/images/film_iphone/iphone360_7268.jpg','New York Stories','Лайонел Доби — преуспевающий художник. А Полетт — его преданная ученица. Неудивительно, что между ними возникает роман. Впрочем, любовь зла: герой души не чает в своей протеже, однако это не касается ее дилетантских работ. Перед художником возникает жестокая дилемма: должен ли он честно критиковать ее мазню, или врать, что это шедевры?','$15 000 000'),(7270,'Несломленный',1986,91,0.0,4.2,133,'1986-03-21','https://st.kp.yandex.net/images/film_iphone/iphone360_7270.jpg','Rad','В маленьком городке, дабы продвинуть торговую марку спортивных товаров, организуется соревнование велогонщиков. Собираются лучшие велогонщики со всей Америки, ну и местным парням дают шанс поучаствовать. Один из них Крю Джонс, развозчик газет, будет биться за победу, разумеется организаторы будут ставить на его пути различные препоны…','Нет данных'),(7272,'Рокки 3',1982,99,0.0,7.4,31562,'1982-05-24','https://st.kp.yandex.net/images/film_iphone/iphone360_7272.jpg','Rocky III','Одержав сокрушительную победу над Аполло Кридом, Рокки купается в лучах славы. Его окружает роскошь и престиж. Он с легкостью разделывается со всеми претендентами на его чемпионский пояс. Гонорары велики, а тренировки непродолжительны, и в результате Рокки начинает терять свою знаменитую скорость и точность.<br><br>Плюс ко всему сказываются старые травмы — все-таки он пропускал слишком много ударов по голове. В итоге, когда на ринге появляется молодой непробиваемый, подобный урагану, боксер по имени Клаббер, Рокки оказывается неспособным выдержать его сокрушительные удары и падает мертвым грузом.<br><br>После такого позора от него отворачиваются все, кроме бывшего врага, а теперь товарища по несчастью Аполло Крида.','$17 000 000'),(7274,'Пророчество',1979,98,0.0,5.7,182,'1979-06-15','https://st.kp.yandex.net/images/film_iphone/iphone360_7274.jpg','Prophecy','Доктор Роберт Верн с женой приезжает в североамериканскую глушь, где помимо разногласий между деревообрабатывающей компанией и индейскими племенами по поводу использования земли есть ещё одна проблема — здоровенный монстр-мутант, появившийся на свет вследствие загрязнения здешних вод токсичными отходами.','Нет данных'),(7275,'Рокки 2',1979,119,0.0,7.8,35413,'1979-06-14','https://st.kp.yandex.net/images/film_iphone/iphone360_7275.jpg','Rocky II','Проиграв по очкам в незабываемом поединке за звание чемпиона мира в первой части, Рокки Бальбоа пытается бросить спорт и начать новую спокойную жизнь. Однако, это у него не получается, ведь бокс — его призвание.<br><br>В итоге, несмотря на протесты молодой жены, Рокки принимает вызов своего старого соперника Апполо Крида на матч-реванш. Апполо пребывает в прекрасной физической форме и горит желанием отомстить за нанесенные ему в первом поединке побои. Так что у Рокки есть все шансы потерять не только жену, но и здоровье.','$7 000 000'),(7277,'Человек умер',1972,104,0.0,6.7,140,'1972-12-21','https://st.kp.yandex.net/images/film_iphone/iphone360_7277.jpg','Un homme est mort','Герой фильма — Роже Гарнье — киллер. Выполнив заказ, Роже сам оказывается под прицелом: его преследуют, чтобы убить. Сначала он скрывается от погони, а потом решает найти заказчиков своего убийства…','Нет данных'),(7278,'Газ! Или как пришлось уничтожить мир, чтобы его спасти',1970,78,0.0,5.8,113,'1971-02-17','https://st.kp.yandex.net/images/film_iphone/iphone360_7278.jpg','Gas! -Or- It Became Necessary to Destroy the World in Order to Save It.','В результате утечки газа в секретной правительственной лаборатории на земле погибают все, кому больше 25. Во что превратится Никсоновская Америка в руках необузданной молодежи?','Нет данных'),(7279,'Данвичский ужас',1969,88,0.0,5.6,381,'1970-01-14','https://st.kp.yandex.net/images/film_iphone/iphone360_7279.jpg','The Dunwich Horror','Молодой человек Уилбур Уэйтли отправляется в библиотеку университета города Аркхема, где просит книгу «Некрономикон», редкое издание, содержащее злые заклинания. Но библиотекарь отказывается дать Уилбуру книгу, которая хранится под замком. Но молодой человек не сдается. В читальном зале Уилбур знакомится с девушкой Нэнси, которую приглашает к себе домой. С ее помощью он собирается овладеть магической книгой, а ее саму использовать в церемонии жертвоприношения. Оказывается, Уилбур хочет восстановить свою семью в правах повелителей вселенной…','Нет данных'),(7281,'Львиное сердце',1987,104,0.0,6.0,95,'1987-08-14','https://st.kp.yandex.net/images/film_iphone/iphone360_7281.jpg','Lionheart','В основу фильма положены реальные исторические факты. Согласно некоторым источникам и полумифологическим преданиям, отразившимся даже в знаменитой легенде о Гаммельнском крысолове, в середине двенадцатого века, во времена войны за Святую землю короля Ричарда Львиное сердце, организовывались так называемые «детские крестовые походы». Когда сотни сирот с улиц отправлялись воевать за Грааль наравне со взрослыми, как божии воины, невинные души, которым в бою должен покровительствовать сам Всевышний. Однако чаще всего такие дети просто продавались в рабство, если оставались живы после всех тягот долгого пути.<br /><br />В центре этой истории оказывается юный рыцарь, отчаявшийся вернуть себе отцовское наследство, на которое незаконно посягают сразу несколько претендентов, обращает свой взор на восток. Он надеется завоевать себе славу и богатство, присоединившись к королю Львиное сердце. На своем нелегком пути в Святую землю он встречает группу детей, скрывающуюся от Черного рыцаря, промышляющего похищениями и работорговлей. Юный Роберт, которого дети принимают за самого короля Ричарда I, становится во главе этого небольшого отряда, чтобы вести его в Святую землю.','Нет данных'),(7282,'Никогда не говори «никогда»',1983,134,0.0,7.0,7768,'1983-10-06','https://st.kp.yandex.net/images/film_iphone/iphone360_7282.jpg','Never Say Never Again','Используя непостижимый набор оружия, агент 007 собственноручно стирает с лица земли армию врагов Ее Величества. Но когда прелестная пленница втыкает нож в ребра 007, босс супершпиона решает, что настало время его лучшему агенту заняться оттачиванием своего смертельного мастерства. И вот Джеймс Бонд отправляется на лечебный курорт, а фильм «Никогда не говори никогда» готов вновь поражать ваше воображение трюками.','$36 000 000'),(7285,'Свадебный переполох',2001,103,0.0,6.8,49209,'2001-01-26','https://st.kp.yandex.net/images/film_iphone/iphone360_7285.jpg','The Wedding Planner','Мало кто так хорошо разбирается в любви и браке, как Мэри Фиоре, ведь она — свадебный церемонимейстер. Однако ее собственная личная жизнь оставляет желать лучшего… Однажды, при весьма необычных обстоятельствах, Мэри знакомится со Стивом Эдисоном. Эта встреча заставила героиню фильма поверить в любовь.<br><br>Каково же было ее разочарование, когда она узнала, что Стив должен жениться на очень богатой клиентке! Что победит в душе женщины: разум или чувства, трезвый расчет или любовь?','$35 000 000'),(7286,'Напиши сценарий',1997,102,0.0,6.3,91,'1997-04-19','https://st.kp.yandex.net/images/film_iphone/iphone360_7286.jpg','Just Write','Гарольд — обычный парень. Однажды в кафе он видит свою любимую актрису и решается к ней подойти. Девушка принимает его за модного писателя, а он не торопится ее разубедить. Аманда польщена и очарована. Так начинается эта история. Их отношения перерастают в нечто большее, чем просто дружба. С каждым днем Гарольду все труднее быть «писателем», но его фантазия неистощима. Чтобы остаться с Амандой, он готов сделать невозможное.','Нет данных'),(7287,'Достать коротышку',1995,105,0.0,7.0,8529,'1995-10-20','https://st.kp.yandex.net/images/film_iphone/iphone360_7287.jpg','Get Shorty','Гангстер и рэкетир Чили Палмер, попав в Голливуд, где ему предстояло выбить деньги из продюсера, задолжавшему мафии, принимает решение снять фильм, используя для сюжета свой личный богатый опыт и глубокое знание кино, которое он обожает.<br><br>Причем списывается сценарий буквально с жизни, так как мафиозные разборки, держащие зрителя в лихорадочном напряжении, продолжаются все экранное время. Гангстеры из Майами, из Колумбии и Лос-Анджелеса расстаются с жизнью в этой картине роковых ошибок куда прозаичней, чем в кино, но сколько комичных ситуаций в этой прозе — прекрасный сценарий Скотта Фрэнка по роману Элмора Леонарда.','$30 250 000'),(7289,'Леди в белом',1988,118,0.0,6.5,222,'1988-04-22','https://st.kp.yandex.net/images/film_iphone/iphone360_7289.jpg','Lady in White','Оказавшийся запертым в школьном туалете на Хэллоуин 1962 года юный Фрэнк встречает призраки девочки и человека, убившего её много лет назад. Вскоре после этого происшествия Фрэнку начинают являться странные видения, и в частности призрак загадочной женщины в белом, которая ищет свою пропавшую дочь.','$4 700 000'),(7291,'Возвращение в школу ужасов',1987,89,0.0,4.2,306,'1987-02-20','https://st.kp.yandex.net/images/film_iphone/iphone360_7291.jpg','Return to Horror High','Кинопродюсер Гарри Слирик привозит свою съемочную группу в колледж Криппен Хай, закрытый из-за серии таинственных, нераскрытых убийств. Он хочет создать достоверный фильм ужасов, в который приглашает бывших работников колледжа в качестве актеров. Но внезапное и необъяснимое исчезновение претендента на главную роль послужило началом целого ряда жутких происшествий.','Нет данных'),(7292,'Стик',1985,109,0.0,5.6,82,'1985-04-26','https://st.kp.yandex.net/images/film_iphone/iphone360_7292.jpg','Stick','Не успел бывший заключенный Эрнест Стикли по прозвищу «Стик» выбраться из тюремного заточения, как на воле его ожидали новые авантюры и неприятности. По стечению роковых обстоятельств Стик оказывается втянутым в крупную сделку с наркотиками. И теперь у него есть лишь один шанс из тысячи все исправить, как, впрочем, и потерять голову от чар прекрасной дамы из высшего общества…','Нет данных'),(7293,'Существо',1981,125,0.0,6.5,1163,'1982-09-30','https://st.kp.yandex.net/images/film_iphone/iphone360_7293.jpg','The Entity','Жизнь молодой женщины Карлы Моран превратилась в сплошной кошмар с той самой ночи, когда она в ужасе проснулась от того, что кто-то невидимый избивает и насилует ее. Окружающие не воспринимают всерьез ее страхов, да и сама Карла уже не верит, что это действительно происходит с ней. Но все меняет появление в ее жизни врача-парапсихолога.','Нет данных'),(7295,'Трюкач',1980,131,0.0,7.5,2232,'1980-03-26','https://st.kp.yandex.net/images/film_iphone/iphone360_7295.jpg','The Stunt Man','Скрываясь от полиции, Кеймерон попадает на съемочную площадку фильма о Первой мировой войне. Жестокому режиссеру Кроссу нужен человек, который заменил бы погибшего каскадера. Кеймерон получает укрытие, но он должен заменить каскадера.<br /><br />Прошедший ужасы вьетнамской войны, Кеймерон в роли американского летчика демонстрирует фантастическое мужество.','$3 500 000'),(7302,'Друзья Эдди Койла',1973,102,0.0,7.3,518,'1973-06-26','https://st.kp.yandex.net/images/film_iphone/iphone360_7302.jpg','The Friends of Eddie Coyle','Эдди Койл — мелкий уголовник предпенсионного возраста. Скоро состоится суд, который, вероятно, упрячет его за решетку на пару лет. Вот только годы уже не те, и есть жена с детьми, а еще обывательская мечта о поездке во Флориду. Эдди предстоит сделать выбор: стать стукачом или отсидеть очередной срок.','Нет данных'),(7307,'Безумные мотоциклисты',1965,74,0.0,6.3,203,'1965-08-12','https://st.kp.yandex.net/images/film_iphone/iphone360_7307.jpg','Motorpsycho!','Три полоумных мотоциклиста несутся по пустынным дорогам Запада избивая и насилуя встречных. Ветеринар Кори Мэддокс, чью жену зверски изнасиловала банда помешанных байкеров, пытается отловить подонков, чтобы отомстить или хотябы сдать их полиции. По дороге он встречает Руби Боннер, её мужа убила та же самая шайка. Руби и Кори пускаются вместе в погоню и попадают в ловушку в каньоне, где вступают в жестокую схватку с главарем банды, которым оказывается озверевший и окончательно рехнувшийся ветеран вьетнамской войны.','$38 000'),(7308,'Агент «Стрекоза»',2001,88,0.0,5.9,473,'2001-05-12','https://st.kp.yandex.net/images/film_iphone/iphone360_7308.jpg','CQ','Париж, 1969 год. Действие фильма происходит на съемках научно-фантастического фильма про 2001 год. Режиссер одержим актрисой, играющей главную роль, — сексапильной секретной агентши по кличке Стрекоза, и не может закончить фильм. Завершить съемки фильма приглашен молодой американец Пол.<br><br>Но и ему ничего не удается — грань между реальностью и фантазией стирается. Откуда ни возьмись появляются Фидель Кастро, кубинские революционеры на Луне и сестра режиссера София, а Пол, как и его предшественник, оказывается не в состоянии устоять перед чарами Стрекозы.','$7 000 000'),(7310,'Франкенвини',1984,30,0.0,7.6,4806,'1984-12-14','https://st.kp.yandex.net/images/film_iphone/iphone360_7310.jpg','Frankenweenie','Маленький мальчик Виктор Франкенштейн, испытывающий поразительную склонность к кинематографу и естественным наукам, оживляет погибшего на дороге домашнего любимца — собаку Спарки. Внезапно оживший, но совершенно безобидный, пес наводит ужас на всю округу.','Нет данных'),(7311,'Девственницы-самоубийцы',1999,97,0.0,7.1,29493,'1999-05-19','https://st.kp.yandex.net/images/film_iphone/iphone360_7311.jpg','The Virgin Suicides','В семье Лисбон пять дочерей-подростков. После того, как 13-летняя Сесилия кончает жизнь самоубийством, ее оставшиеся в живых сестры становятся объектом пристального внимания всех жителей городка, особенно соседских парней, устраивающих за девочками настоящую слежку.<br><br>Желая оградить дочерей от окружающих, родители постепенно прекращают всяческое общение с внешним миром и запрещают дочерям выходить из дома.','$9 000 000'),(7312,'Превзойти звезду',1998,14,0.0,6.2,220,'1998-10-01','https://st.kp.yandex.net/images/film_iphone/iphone360_7312.jpg','Lick the Star','Повествование ведется от лица ученицы 7 класса средней школы. После перенесенной травмы Кэти возвращается в привычную обстановку школьных сплетен и потаенных секретов, распространяемых одноклассниками. Сама того не замечая, она оказывается вовлеченной в заговор, ставший проверкой на дружбу и оставивший после себя много вопросов для формирующейся подростковой души, которые теперь предстоит решать совести.','Нет данных'),(7313,'Сердца тьмы: Апокалипсис кинематографиста',1991,96,0.0,7.8,809,'1991-09-07','https://st.kp.yandex.net/images/film_iphone/iphone360_7313.jpg','Hearts of Darkness: A Filmmaker\'s Apocalypse','Документальный фильм о съёмках шедевра Фрэнсиса Форда Копполы «Апокалипсис сегодня», о мучительном создании сценария, съёмке, подборе актёров, бюджета.. Всё это чуть не разрушило жизнь и карьеру прославленного режиссера.','Нет данных'),(7316,'Джиперс Криперс',2001,91,0.0,6.8,40257,'2001-07-20','https://st.kp.yandex.net/images/film_iphone/iphone360_7316.jpg','Jeepers Creepers','Если бы Дэрри и Триш знали, во что превратится их обычное путешествие домой на каникулы, то остались бы в колледже навсегда. Брат и сестра заметили его на безлюдной дороге рядом с жуткой, обветшалой церковью. Страшная фигура в длинном чёрном плаще и широкополой шляпе скидывала в подвал свертки, испачканные чем-то красным. После увиденного нужно было немедленно вдавить педаль газа взятой напрокат машины и умчаться от этого проклятого места как можно дальше. Но Дэрри и Триш допустили непоправимую, смертельную ошибку. Они решили вернуться и посмотреть: что же он прячет там, в подвале покосившейся церкви? Это безрассудное любопытство обернулось самым невообразимым кошмаром, который только можно себе представить…','$10 000 000'),(7317,'Чокнутая',1999,95,0.0,5.5,73,'1999-09-28','https://st.kp.yandex.net/images/film/7317.jpg','Goosed','В детстве Шарлин была невзрачной девочкой, с которой никто из парней не хотел встречаться. Одиночество Шарлин стало вечным предметом насмешек со стороны одноклассниц. Поэтому, вырвавшись из-под родительской опеки, она первым делом решила наверстать упущенное, мгновенно выскочив замуж, и так же мгновенно разведясь.<br><br>Но вот однажды, на спиритическом сеансе, Шарлин узнаёт имя своего «мужчины мечты» — Стивен. Дело за малым — дождаться встречи со своим единственным и не упустить его.<br><br>Проблемы возникают тогда, когда на горизонте появляется не один, а целых пять Стивенов. Попробуй здесь угадай, кто из них твой суженый!','Нет данных'),(7370,'Человек-ракета',1997,95,0.0,6.6,1427,'1997-10-10','https://st.kp.yandex.net/images/film_iphone/iphone360_7370.jpg','RocketMan','Когда компьютерный гений Фред Рэндэлл создал новую навигационную систему, у него появился реальный шанс испытать ее на деле. После того, как новоиспеченный космонавт случайно покалечил двух «коллег» из его группы, отправляющейся на Марс, он вынужден занять их место на корабле.<br><br>Командир экипажа недоволен подобной заменой: вместо первоклассных летчиков ему достается балбес — новичок, прошедший неполный курс подготовки. Единственный на борту, кто понимает Фреда без слов, — шимпанзе по кличке Одиссей, настоящий космический волк. Но на Марсе корабль землян поджидают опасности. Профессионалы бессильны, но, как известно, новичкам всегда везет.','Нет данных'),(7475,'Рожденный побеждать',1971,88,0.0,5.5,208,'1971-12-01','https://st.kp.yandex.net/images/film_iphone/iphone360_7475.jpg','Born to Win','У Джея проблема на проблеме: наркоманка-жена, ненадежные друзья, продажные партнеры, плюс к этому у него на хвосте попеременно висят то мафия, то полиция… Однако судьба, в лице случайно встреченной девушки, дарит ему шанс поменять все самым кардинальным образом. Теперь все зависит только от желания Джея.','Нет данных'),(7477,'Думаю о Дженнифер',1971,90,0.0,4.7,91,'1971-11-10','https://st.kp.yandex.net/images/film_iphone/iphone360_7477.jpg','Jennifer on My Mind','Они богаты… они красивы… они думают, что влюблены…','Нет данных'),(7583,'Грейстоук: Легенда о Тарзане, повелителе обезьян',1984,137,0.0,6.7,747,'1984-03-30','https://st.kp.yandex.net/images/film_iphone/iphone360_7583.jpg','Greystoke: The Legend of Tarzan, Lord of the Apes','Мальчик, выросший среди диких обезьян, возвращается к людям, чтобы заявить свои права на жизнь среди людей. Удивительная сага о Тарзане, созданная писателем Эдгаром Райсом Берроузом, — это волнующий рассказ о столкновении двух миров, дикого и цивилизованного.','Нет данных'),(7584,'Огненные колесницы',1981,119,0.0,6.8,2496,'1981-03-30','https://st.kp.yandex.net/images/film_iphone/iphone360_7584.jpg','Chariots of Fire','Фильм поставлен по реальным событиям и рассказывает о соперничестве двух атлетов-бегунов, представлявших Великобританию на Олимпийских играх 1924 года в Париже: студента Кембриджа, еврея Гарольда Абрахамса и шотландского миссионера Эрика Лиддела. В центре внимания авторов картины — противостояние двух характеров и двух противоположных мировоззрений.','$5 500 000'),(7585,'Легионеры',1977,107,0.0,6.8,344,'1977-08-05','https://st.kp.yandex.net/images/film/7585.jpg','March or Die','Подразделение Французского Иностранного легиона получает приказ охранять археологическую экспедицию, которая отправляется в Марокканскую пустыню продолжить поиски бесценной арабской гробницы.<br><br>Первая экспедиция была уничтожена кочевниками. Вождь кочевников Эль Крим считает, что гробница должна принадлежать его племени, как символ свободы, и готов насмерть сражаться с легионерами за обладание древней святыней.','$9 000 000'),(7586,'Закричи на дьявола',1976,150,0.0,6.6,111,'1976-04-13','https://st.kp.yandex.net/images/film_iphone/iphone360_7586.jpg','Shout at the Devil','Африка во время Первой мировой войны. Сильно пьющий американец, охотник на слонов, его дочь и англичанин с безукоризненными манерам после многочисленных приключений подрывают огромный германский крейсер.','Нет данных'),(7587,'Робин и Мэриан',1976,106,0.0,6.7,811,'1976-03-11','https://st.kp.yandex.net/images/film_iphone/iphone360_7587.jpg','Robin and Marian','После смерти короля Ричарда Львиное Сердце Робин Гуд и его неразлучный друг Маленький Джон возвращаются из крестовых походов в Англию, в Шервуд, где Робин встречает свою старую любовь Мэриан. Но старый шериф все еще на месте, и старая вражда разгорается вновь.<br><br>Робин хочет только одного — он ведь уже совсем не молод — спокойно жить со своей любимой в родном лесу, но новый король отдает приказ уничтожить бунтовщиков. И тогда Робин выходит на свой последний поединок с заклятым врагом шерифом Ноттингемским.','$5 000 000'),(7588,'Джаггернаут',1974,109,0.0,6.2,210,'1974-09-25','https://st.kp.yandex.net/images/film_iphone/iphone360_7588.jpg','Juggernaut','Террорист захватил пассажирский корабль. Он утверждает, что судно заминировано. Если в течение суток власти не заплатят преступнику 500 тысяч фунтов, пассажиры будут уничтожены. На борт лайнера отправляется профессиональный сапер Алекс Феллон. У него есть час, чтобы найти и обезвредить взрывной механизм…','Нет данных'),(7590,'Молодой Уинстон',1972,125,0.0,6.9,212,'1972-07-20','https://st.kp.yandex.net/images/film_iphone/iphone360_7590.jpg','Young Winston','Фильм снят по книге Уинстона Черчилля «Мои молодые годы: преданное служение». Юные годы Черчилля предстают в воспоминаниях Черчилля старого: детство, школа-интернат, родители, авантюры в Индии и Судане, участие в качестве военного корреспондента в Англо-бурской войне, избрание в парламент.','Нет данных'),(7591,'Мария – королева Шотландии',1971,128,0.0,7.2,304,'1971-12-22','https://st.kp.yandex.net/images/film_iphone/iphone360_7591.jpg','Mary, Queen of Scots','Драматическая история Марии Стюарт, последней католической королевы Шотландии.','Нет данных'),(7598,'Нелл',1994,112,0.0,7.6,4396,'1994-12-14','https://st.kp.yandex.net/images/film_iphone/iphone360_7598.jpg','Nell','Девушка никого не знала, кроме матери. Разговаривать, как люди, она не умела, общаясь сама с собой на одной ей понятном языке. Врач, обнаруживший Нелл, предлагает оставить девушку в покое, но у психолога на этот счет свое мнение…','Нет данных'),(7599,'Мужья и жены',1992,108,0.0,7.3,3703,'1992-08-19','https://st.kp.yandex.net/images/film_iphone/iphone360_7599.jpg','Husbands and Wives','В семье писателя постоянные ссоры. Однажды они с женой узнают о том, что их старые друзья собираются развестись. Пытаясь исправить ситуацию, мужья и жёны начинают новые романы.','$20 000 000'),(7600,'Под подозрением',1991,100,0.0,7.0,1125,'1991-09-27','https://st.kp.yandex.net/images/film_iphone/iphone360_7600.jpg','Under Suspicion','Частный детектив «устраивает» разводы. Он добивается супружеской неверности, а роль любовницы, «подкидываемой» в постель к клиентам играет его жена Хейзел. Однажды, в канун Рождества, Тони врывается в гостиничный номер и нажимает на затвор фотоаппарата. В его объектив попадают сразу два трупа: Хейзел и клиента. На наследство убитого, знаменитого художника, претендуют его вдова и бывшая любовница. А Тони оказывается главным подозреваемым в убийстве…','Нет данных'),(7601,'Свет во тьме',1992,127,0.0,6.8,873,'1992-01-31','https://st.kp.yandex.net/images/film_iphone/iphone360_7601.jpg','Shining Through','Скромная секретарша Линда Восс обнаруживает, что ее босс, Эд Леленд, совсем не инженер, за которого он себя выдает, а полковник американской разведки. США объявляют войну фашистской Германии.<br><br>Примерно в это же время оперативного американского агента убивают в Берлине и отважная Линда убеждает шефа, что именно она должна отправиться на место погибшего резидента. Теперь ей предстоит доказать, что обыкновенная секретарша может легко освоить опасную профессию разведчика…','Нет данных'),(7602,'Удовлетворение',1988,92,0.0,6.4,267,'1988-02-12','https://st.kp.yandex.net/images/film_iphone/iphone360_7602.jpg','Satisfaction','Четыре девчонки и один парень — выходцы из рабочего квартала, друзья и рок-музыканты созданной ими же группы «Мистерия» — в первое лето после окончания школы приглашены выступать в клубе на дорогом морском курорте. Правда у каждого из ребят свои проблемы, но и энергии у них хоть отбавляй! Вокалистка группы влюбляется во владельца бара. Ребята получают предложение сыграть в Европе и, возможно, стать знаменитыми. Но готовы ли они к этому?','Нет данных'),(7603,'Подозреваемый',1987,121,0.0,7.0,661,'1987-10-23','https://st.kp.yandex.net/images/film_iphone/iphone360_7603.jpg','Suspect','После самоубийства судьи и убийства его секретарши подозрения падают на глухонемого бродягу. Кейтлин Райли, назначенная общественным защитником, пытается найти доказательства невиновности подзащитного. Но это оказалось небезопасно…','Нет данных'),(7604,'Отходная молитва',1987,107,0.0,7.2,2366,'1987-05-13','https://st.kp.yandex.net/images/film_iphone/iphone360_7604.jpg','A Prayer for the Dying','На глазах ирландского террориста Мартина вместо бронетранспортера на мине подрывается школьный автобус. Потрясенный Мартин решает «выйти из игры» и бежать за границу. Он скрывается и от полиции и от своих бывших товарищей по оружию из Ирландской республиканской армии. Для того чтобы получить фальшивый заграничный паспорт, он должен совершить еще одно, последнее убийство по заказу гангстера Михана.<br><br>Свидетелем убийства становится католический священник Да Коста. Вместо того чтобы «убрать» свидетеля, Мартин идет к нему на исповедь. Теперь священник связан обетом молчания и не может выдать его полиции. Такое положение дел не устраивает Михана, и он решает навсегда «заткнуть рот» всем, кто знает о преступлении…','$6 000 000'),(7605,'Дуэт для солиста',1986,107,0.0,6.6,321,'1986-12-25','https://st.kp.yandex.net/images/film_iphone/iphone360_7605.jpg','Duet for One','Фильм рассказывает историю Стефани Андерсон, известной скрипачки. Она серьёзно заболела. Её окружают близкие ей люди — муж Дэвид и ученик Константин. Все хотят помочь Стефани выйти из её болезненного состояния, в том числе и её психиатр доктор Льюис Фельдман.','Нет данных'),(7606,'Лэм',1985,110,0.0,6.2,71,'1986-10-10','https://st.kp.yandex.net/images/film/7606.jpg','Lamb','Отец Майкл преподает в католической школе для мальчиков. Туда отдают 10-летнего Оуэна, страдающего эпилепсией. Видя жестокое и несправедливое отношение настоятеля к мальчику и испытывая кризис веры, Майкл покидает школу и забирает Оуэна с собой. Преследуемые полицией и финансовыми трудностями, герои пытаются начать новую жизнь, но болезнь мальчика рушит их и без того хрупкое счастье.','Нет данных'),(7611,'Дом из песка и тумана',2003,126,0.0,7.8,31971,'2003-12-19','https://st.kp.yandex.net/images/film_iphone/iphone360_7611.jpg','House of Sand and Fog','Для Кэти Николо последняя надежда на возвращение к жизни — это небольшое бунгало в Северной Калифорнии. В результате бюрократической ошибки её выселяют, и Кэти оказывается на улице. Ей остаётся лишь беспомощно наблюдать, как дом продают на аукционе за мизерную цену. Но она готова на всё, лишь бы доказать свое право на владение им.','$16 500 000'),(7612,'Бессмертные',2002,90,0.0,7.2,5049,'2002-09-08','https://st.kp.yandex.net/images/film_iphone/iphone360_7612.jpg','Tuck Everlasting','Фантастическая история на тему бессмертия. В 1914 году девочка из богатой семьи случайно находит в глубине леса (принадлежащего ее отцу) хижину, где живет очень необычное семейство. Этих же людей разыскивает таинственный человек в желтом костюме, у которого насчет них свои планы…','$15 000 000'),(7614,'Триумф любви',2001,112,0.0,6.6,318,'2001-09-06','https://st.kp.yandex.net/images/film_iphone/iphone360_7614.jpg','The Triumph of Love','Европа XVIII века. В результате придворных интриг трон наследует молодая принцесса. Вскоре она узнает, что существует еще один претендент на престол — законный наследник, скрывающийся в уединенном замке. Тайно пробравшись в его убежище, принцесса начинает следить за молодым человеком и неожиданно для себя влюбляется в него.<br><br>Брак между принцессой и наследником — вот идеальный путь решения всех проблем с престолом! Но чтобы воплотить в жизнь свои надежды и сообщить избраннику о своей любви, девушке придется проявить немало хитрости и изобретательности, и постараться найти выход из казалось бы безвыходных ситуаций.','$5 000 000'),(7616,'С какой ты планеты?',2000,105,0.0,5.8,555,'2000-03-03','https://st.kp.yandex.net/images/film_iphone/iphone360_7616.jpg','What Planet Are You From?','Гарольд Андерсон прибывает из глубин Галактики на нашу планету с эротической миссией и специальным «вспомогательным» средством, изобретенным специально для него космическими инженерами.<br><br>Инопланетный плейбой тут же начинает действовать, но сталкивается с некоторыми трудностями: во-первых, не смотря на неземные технологии новая для Гарольда часть тела постоянно издает странные звуки, а во-вторых, межгалактический Дон Жуан и не представляет, как нужно обращаться с женщинами…','$60 000 000'),(7618,'Исповедь',1999,114,0.0,6.3,112,'1999-01-22','https://st.kp.yandex.net/images/film_iphone/iphone360_7618.jpg','The Confession','На руках у родителей из-за равнодушия врачей умирает маленький Стив. Отчаявшийся отец Гарри Фертиг, убивает трех человек — секретаря, врача и медсестру. Защищать его берется успешный адвокат Рой Блейки. Герою предстоит сделать выбор, что для него важнее: победить и получить вожделенную должность районного прокурора или проиграть, а значит покарать убийцу.','Нет данных'),(7620,'С феями шутки плохи',1997,106,0.0,6.3,742,'1997-09-19','https://st.kp.yandex.net/images/film_iphone/iphone360_7620.jpg','Photographing Fairies','Фотограф Чарльз Касл тяжело переживает утрату своей красавицы-невесты, погибшей во время снежной бури. Утратив вкус к жизни, вне себя от горя, он отправляется на войну, и, работая фоторепортером, не раз встречается лицом к лицу со смертью.<br><br>После войны Чарльз встречает таинственную незнакомку, которая показывает ему фотоснимки, на которых изображены… настоящие феи. Непреодолимое желание докопаться до истины приводит его в захолустную деревушку Беркинвэлл. В этом мирном, на первый взгляд, местечке, Чарльз постепенно оказывается втянутым в мистическую феерию, которая сулит райское блаженство, но приносит окружающим только смерть.<br><br> Сможет ли Чарльз разгадать головоломку, удастся ли ему найти грань между реальностью и фантазией, между жизнью и смертью?','Нет данных'),(7621,'Двенадцатая ночь, или Что угодно',1996,134,0.0,7.4,921,'1996-09-06','https://st.kp.yandex.net/images/film_iphone/iphone360_7621.jpg','Twelfth Night or What You Will','Кораблекрушение разлучает двух юных близнецов: Виолу и Себастьяна. Виола, оказавшись в чужой стране, переодевается в мужскую одежду и, назвавшись Цезарио, устраивается при дворе герцога Орсимо, где становится его доверенным лицом. Герцог пытается добиться благосклонности красавицы Оливии, но в ней неожиданно вспыхивает любовь к Цезарио.','$5 000 000'),(7623,'Багси',1991,149,0.0,7.2,2736,'1991-12-10','https://st.kp.yandex.net/images/film_iphone/iphone360_7623.jpg','Bugsy','Он мог войти в мировую историю, но занял почетное место лишь в кровавой истории организованной преступности. Его имя не попало на страницы школьных учебников, но зато красовалось в заголовках криминальной хроники. Бенджамин Сигал по кличке «Багси» — знаменитый гангстер, наводящий ужас на самых отъявленных головорезов, легенда американской мафии сороковых годов. В отличие от других преступников, он не стремился к большим деньгам и абсолютной власти. Багси мечтал построить невиданный город будущего.<br><br>Профессиональный разрушитель решил воплотить свой идеал посреди безжизненной пустыни в центре Невады. Впоследствии это место стало известно всему миру как Лас-Вегас. Но создавая игорный рай, Багси рисковал как никогда. Ведь в дьявольской игре с реальностью ставкой была его собственная жизнь.','$40 000 000'),(7626,'Челлини: Преступная жизнь',1990,244,0.0,7.2,114,'1990-05-05','https://st.kp.yandex.net/images/film_iphone/iphone360_7626.jpg','Vita scellerata, Una','В Рим, где правит Папа Климент VII, приезжает талантливый, но бедный флорентийский ювелир Бенвенуто Челлини. Он мечтает служить искусству, оставаясь при этом свободным человеком. Для истинных ценителей прекрасного этот амбициозный молодой человек — великий художник, для клеветников — распутник, драчун и наглец. Энергии Челлини хватает на все: и на создание шедевров, и на отпор врагам…','Нет данных'),(7628,'Без единой улики',1988,107,0.0,7.5,2561,'1988-10-20','https://st.kp.yandex.net/images/film_iphone/iphone360_7628.jpg','Without a Clue','Однажды, приблизительно за девять лет до описываемых в фильме событий, доктор Ватсон лечил инспектора Скотланд Ярда. Говорил он с пациентом не только о его болезни, но и о его работе, и, выслушав факты одного очень запутанного дела об убийстве и сопоставив их, помог найти убийцу. <br><br>В то время Ватсон ждал назначения в штат одного очень консервативного медицинского колледжа, руководство которого не одобрило бы его дедуктивное хобби, поэтому он приписал раскрытие преступления вымышленному лицу, несуществующему детективу — Шерлоку Холмсу.<br><br>Должности Ватсон так и не получил, а Скотланд Ярд не забывал про него и его таинственного друга-детектива, постоянно обращаясь к их (точнее, к его — Ватсона) помощи в раскрытии преступлений. На досуге же Ватсон стал писать детективные рассказы о якобы их с Холмсом приключениях, которые охотно публиковал журнал «Стрэнд». И вот настал момент, когда восторженная публика потребовала предъявить ей живого Шерлока Холмса.<br><br>Ватсону не оставалось ничего другого, как нанять актера Реджинальда Кинкейда для исполнения роли великого сыщика, раскрывающего все преступления, которые на самом деле раскрывал сам Ватсон. Сам же доктор теперь был при живом гении кем-то вроде помощника. Тиражи «Стрэнд» росли, популярность и слава Шерлока Холмса множилась день ото дня, но вся беда была в том, что Реджинальд Кинкейд был не только бездарным актером, но, в противоположность своему амплуа — Холмсу, жутким бабником, алкоголиком и напыщенным остолопом, не способным даже на самое элементарное умозаключение.','Нет данных'),(7629,'Остров Паскали',1988,104,0.0,7.1,136,'1988-07-22','https://st.kp.yandex.net/images/film_iphone/iphone360_7629.jpg','Pascali\'s Island','Фильм об искренности, лжи, и некоторых других столь же сложных философских категориях в искусстве и жизни. Главные герои фильма — трое жителей греческого острова.','Нет данных'),(7630,'Гарем',1985,113,0.0,5.9,262,'1985-11-20','https://st.kp.yandex.net/images/film_iphone/iphone360_7630.jpg','Harem','Представьте себе ситуацию — современная молодая женщина вдруг оказывается в гареме у арабского принца, которому этот атрибут царской власти достался по наследству. Практически невероятная история, но именно это происходит с Дайан: пораженный красотой девушки, принц, находившийся по делам в Нью-Йорке, решает похитить американку…','Нет данных'),(7631,'Измена',1982,91,0.0,6.5,184,'1983-02-20','https://st.kp.yandex.net/images/film_iphone/iphone360_7631.jpg','Betrayal','Роберт — книгоиздатель, чья жена Эмма изменяет ему с Джерри, литературным агентом.','Нет данных'),(7632,'Страх отпирает двери',1972,103,0.0,6.2,135,'1972-12-26','https://st.kp.yandex.net/images/film_iphone/iphone360_7632.jpg','Fear Is the Key','Неподалеку от побережья Южной Америки воздушными пиратами сбит самолет, перевозивший золотые слитки. Пилот и пассажиры погибают. Джон Тэлбот, потерявший в этой авиакатастрофе всю семью, клянется найти и уничтожить человека, который разрушил его жизнь.','Нет данных'),(7633,'Хороший вор',2002,109,0.0,6.5,782,'2002-09-06','https://st.kp.yandex.net/images/film_iphone/iphone360_7633.jpg','The Good Thief','Бывалый вор и прожженный аферист Боб Монтанье возвращается на ослепительную Французскую Ривьеру, чтобы провернуть свое последнее, самое крупное дело. Под неусыпным оком своего вечного врага и старого друга инспектора полиции Рожэ он собирает команду первоклассных профессионалов, планируя неслыханное по своей хитрости и наглости ограбление казино. Боба окружают стукачи и предатели, мечтающие поживиться на легкой добыче, но у старого мошенника в рукаве припрятан козырь — налетов будет два, но какой из них — настоящий, возможно, выяснится лишь в самый последний момент…','$30 000 000'),(7634,'Конец романа',1999,102,0.0,7.1,3831,'1999-12-02','https://st.kp.yandex.net/images/film_iphone/iphone360_7634.jpg','The End of the Affair','Когда-то Морис и Сара были единым целым, которое не могла разрушить никакая сила. Их сердца бились в такт, и впереди влюбленных ждала целая вечность. Но одно единственное мгновение изменило все.<br><br>Через несколько лет, проведенных в отчаянии, Морис решает понять, почему Сара ушла от него. Пытаясь раскрыть таинственную причину разрыва, он вскоре понимает, что конец их любви был всего лишь началом.','$23 000 000'),(7635,'Мстители',1998,89,0.0,5.2,3266,'1998-08-13','https://st.kp.yandex.net/images/film_iphone/iphone360_7635.jpg','The Avengers','Мстители пришли к нам из знаменитого телесериала 60 — х годов. Элегантный Джон Стид в шляпе-котелке и стильная, с кошачьей грацией Эмма Пил. Они пытаются остановить коварного злодея сэра Августа Де Винтера, владеющего секретом управления погодой.<br /><br />Замысел преступника — покорить мир, ввергнув его в холод и стужу… Фантастические трюки, масштабные декорации, эффектные костюмы Эммы, — все это в сочных красках, под музыку Шиннед О`Коннор и Энни Леннокс.','$60 000 000'),(7636,'Английский пациент',1996,155,0.0,7.8,40287,'1996-11-06','https://st.kp.yandex.net/images/film_iphone/iphone360_7636.jpg','The English Patient','Вторая мировая война близится к концу. Молодая канадская медсестра ухаживает на заброшенной вилле за своим «английским пациентом», который получил страшные ожоги во время авиакатастрофы в пустыне Сахара.<br><br>Медленно угасая, он воскрешает в памяти свой страстный роман с замужней женщиной, сметенный ураганом войны и банальными предрассудками, что в конце концов и привело к трагической развязке.','$27 000 000'),(7637,'Дитя Макона',1993,122,0.0,7.6,1167,'1993-05-17','https://st.kp.yandex.net/images/film_iphone/iphone360_7637.jpg','The Baby of Mâcon','XVII век. Театр. Перед публикой разыгрывается драма о том, что во времена смуты и голода пожилая женщина рожает чудесное дитя, хотя многие ожидают рождения чудовища. Новорожденный мальчик так хорош собой, что его объявляют святым, чудесным ребенком. Вокруг него разгораются страсти; и церковь и семья используют его для достижения своих целей. И постепенно границы между спектаклем и реальностью стираются.','Нет данных'),(7638,'Грозовой перевал',1992,105,0.0,7.6,11295,'1992-08-25','https://st.kp.yandex.net/images/film_iphone/iphone360_7638.jpg','Wuthering Heights','Ничто не тревожило уединенной жизни Кэти и Хиндли, родных брата и сестры живущих в отдаленном поместье вместе со своим отцом, до тех пор пока, однажды старик не привел в их дом Хитклифа, бездомного парня, которого он подобрал умирающим от голода в Ливерпуле и решил приютить.<br><br>С этого момента страсти на «Грозовом перевале» начали неумолимо накаляться. С каждым днем симпатичный Хитклиф завоевывает все больше симпатии и любви от Кэти и ее отца, потребовавшего от детей, чтобы парня приняли в семью и считали ее полноправным членом. И точно так же с каждым днем растет ненависть Хиндли, чувствующего себя замененным. Как только отец умирает, переполняемый ненавистью Хиндли отправляет парня на конюшню.<br><br>Кэти любит Хитклифа, но в те далекие времена даже любовь не могла перечеркнуть разницу в социальном положении. Кэти не может выйти замуж за бедного парня и отдает свое сердце другому, богатому соседу давно положившему глаз на симпатичную девушку. Однако так ли легко изменить зову сердца? Отвергнутый Хитклиф, вовсе не собирается прощать нанесенной ему обиды и готов посвятить всю жизнь тому, чтобы отомстить за свою несчастную любовь и унижения, не подозревая, что далеко не каждая месть может принести удовлетворение…','Нет данных'),(7639,'Тринадцать привидений',2001,91,0.0,6.7,25212,'2001-10-23','https://st.kp.yandex.net/images/film_iphone/iphone360_7639.jpg','Thir13en Ghosts','После смерти странного дядюшки Сайруса Артур Критикос унаследовал его не менее странный дом. В этом причудливом здании все стены и пол из стекла украшены надписями на латыни, а двери живут своей жизнью, открываясь и закрываясь в ритме, недоступном человеческому пониманию.<br><br>Не сразу Артур поймет, что, переступив порог этого жуткого особняка, он исполнит злую волю Сайруса и освободит дюжину мстительных призраков из подвала. И тогда энергия духов приведет в действие агрегат, открывающий путь ко всей мощи потустороннего мира. Но для этого нужно, чтобы к чёрному Зодиаку двенадцати привидений присоединилось ещё одно.','$42 000 000'),(7640,'Двухсотлетний человек',1999,126,0.0,8.0,96453,'1999-12-13','https://st.kp.yandex.net/images/film_iphone/iphone360_7640.jpg','Bicentennial Man','Начало нового тысячелетия; происходит прорыв в глобальных технологиях. Люди уже не заводят дома собак и кошек: они покупают себе роботов. Вот и семья Мартинов приобретает себе необычный подарок: робота нового поколения NDR-114, а в обычной жизни просто Эндрю.<br><br>Купленный как прибор, запрограммированный для выполнения домашней работы, Эндрю вдруг начинает испытывать странные ощущения. Он еще не знает, что это называется чувствами.','$100 000 000'),(7641,'Мэнсфилд Парк',1999,112,0.0,6.9,4835,'1999-08-27','https://st.kp.yandex.net/images/film_iphone/iphone360_7641.jpg','Mansfield Park','В 12-летнем возрасте Фанни Прайс оказалась в родном поместье ее богатых родственников. Умная и прилежная, она лишена материнского тепла и заботы и по-настоящему дружна только со своим кузеном Эдмундом.<br><br>Через несколько лет Фанни превращается в очаровательную девушку и должна решить: выбрать ли ей благополучие или последовать зову сердца.','Нет данных'),(7643,'Матильда',1996,102,0.0,7.7,15284,'1996-07-28','https://st.kp.yandex.net/images/film_iphone/iphone360_7643.jpg','Matilda','Матильда — очень необычная девочка. Ну посудите сами — умножать в голове огромные числа, двигать взглядом предметы и делать еще много чего сверхъестественного — это что, по-вашему, нормально? Но ее родители равнодушны к ней — их не только не поражают способности Матильды, им даже не интересно, как живет их дочь…','$36 000 000'),(7644,'Последнее лето любви',1995,116,0.0,7.2,172,'1995-10-13','https://st.kp.yandex.net/images/film_iphone/iphone360_7644.jpg','Feast of July','Жизнь Беллы приблизилась к краю пропасти, а она сама — ко дну отчаяния. После того, как ее бросил коварный соблазнитель, у женщины не осталось ни одного близкого человека. Вскоре из-за туч выглянуло солнце: Белла влюбилась и готовится к долгожданной свадьбе.<br><br>И в тот момент, когда счастье было почти в ее руках, на горизонте появилась мрачная фигура того, кто однажды чуть не разрушил жизнь Беллы. Второго удара судьбы она может не выдержать.','Нет данных'),(7646,'К черту любовь',2003,101,0.0,6.9,10591,'2003-05-09','https://st.kp.yandex.net/images/film_iphone/iphone360_7646.jpg','Down with Love','Барбара Новак взрывает весь Нью-Йорк своим бестселлером «К чёрту любовь!» и предлагает всем женщинам стать такими же, как мужчины — делать карьеру, заниматься сексом без обязательств. Кэтчер Блок — прожигатель жизни и дон-жуан. Он решает проучить ярую феминистку и полностью развенчать созданный ею мир женщин, отказавшихся от любви.','Нет данных'),(7662,'Влюбленный Шекспир',1998,123,0.0,7.4,26692,'1998-12-03','https://st.kp.yandex.net/images/film_iphone/iphone360_7662.jpg','Shakespeare in Love','1594 год. Молодой драматург Уильям Шекспир находится в творческом кризисе: муза покинула его, денег нет, хозяин театра требует от автора новую пьесу в кратчайший срок. И когда, казалось бы, у писателя не остается никакой надежды на обретение нового вдохновения, в его жизнь вторгается сама Любовь в лице обворожительной аристократки Виолы.<br><br>Под видом молодого актера девушка нанимается в труппу театра, чтобы сыграть главную мужскую роль в пьесе «Ромео и Джульетта». Виола не только преданная поклонница маэстро Шекспира, но и прекрасная актриса. Существует лишь одна загвоздка: Виола обручена с важным дворянином, который планирует отвезти будущую супругу в далекую английскую колонию…','$25 000 000'),(7663,'Последний император',1987,166,0.0,7.9,15099,'1987-10-04','https://st.kp.yandex.net/images/film_iphone/iphone360_7663.jpg','The Last Emperor','Он был повелителем миллиарда человек. Ему было уготовано «десять тысяч лет счастья». Но мир древних традиций рухнул под напором века перемен… В 1908 году трехлетний Пу И, последний из династии, тысячи лет правившей «Поднебесной империей», был возведен на Трон Дракона.<br><br>К императору-ребенку относятся как к божеству. Он может делать все, кроме одного — покидать пределы своего дворца. В Запретный город не долетают «ветры перемен», сотрясающие мир за его стенами. Но жизнь последнего императора Китая оказывается частью всей великой истории XX века.','$25 000 000'),(7664,'Оливер!',1968,153,0.0,7.4,1205,'1968-09-26','https://st.kp.yandex.net/images/film_iphone/iphone360_7664.jpg','Oliver!','Оливер предпочитает жить на улицах, а не в приюте. Он попадает в добрую «семью» воришек и становится карманником.','$10 000 000'),(7665,'Звуки музыки',1965,174,0.0,8.0,11203,'1965-03-02','https://st.kp.yandex.net/images/film_iphone/iphone360_7665.jpg','The Sound of Music','Действие фильма происходит в австрийском Зальцбурге накануне Второй мировой войны. Молодая девушка по имени Мария, оставшись сиротой, находит приют в женском монастыре и готовится стать монахиней. Однако в силу своего жизнелюбия ей это удается с трудом, и настоятельница монастыря понимает, что такой путь — не для ее юной послушницы.<br /><br />Марии предлагают место гувернантки в семье, состоящей из армейского офицера, патриота своего отечества, у которого недавно умерла жена, мать его семерых детей…','$8 199 999'),(7666,'Моя прекрасная леди',1964,165,0.0,8.1,24427,'1964-10-21','https://st.kp.yandex.net/images/film_iphone/iphone360_7666.jpg','My Fair Lady','Знаменитый профессор Генри Хиггинс заключает пари со своим другом, что сможет обучить безграмотную замарашку, уличную цветочницу Элизу правильной речи и высокосветским манерам и выдать ее за настоящую леди. Искрометный юмор, забавные ситуации, Золушка на глазах у зрителей превращается в принцессу, а убежденный холостяк — во влюбленного.','$17 000 000'),(7668,'Жижи',1958,115,0.0,6.4,1178,'1958-05-15','https://st.kp.yandex.net/images/film/7668.jpg','Gigi','Молодая девушка, которую хотят сделать кокеткой, тем не менее, стремится к настоящей любви.','$3 319 355'),(7669,'Марти',1955,90,0.0,7.2,1419,'1955-04-11','https://st.kp.yandex.net/images/film_iphone/iphone360_7669.jpg','Marty','Марти — одинокий, добродушный человек, живущий со своей матерью. Приземистый, тяжеловатый мясник из Бронкса, он живет в маленьком мире, населенном его итальянскими родственниками и быстро стареющими друзьями. Его лучший друг — Энджи. Когда они встречаются после работы, то подолгу бесцельно стоят, размышляя о том, как бы заполнить свою жизнь чем-нибудь интересным.','$343 000'),(7670,'Величайшее шоу мира',1952,152,0.0,5.9,649,'1952-01-10','https://st.kp.yandex.net/images/film/7670.jpg','The Greatest Show on Earth','Фильм рассказывает о самом гигантском передвижном цирковом шоу на планете, в котором участвовало одновременно более двух тысяч человек, актеров и ассистентов. Все грандиозное зрелище располагалось под огромным натяжным шатром одновременно на трех аренах и вмещало тысячи зрителей. Небывалое количество диких животных, декораций и технических средств перевозилось по всей Америке специальными железнодорожными составами.<br><br>В фильме всем этим огромным коллективом управляет один человек — крепкий и решительный парень Брэд Брейден. Чтобы гарантировать хорошие сборы, он нанимает акробата на трапеции Себастьяна, отдав ему главную роль в шоу, вместо акробатки Холли. С этой минуты между ними начинается соревнование за звание лучшего акробата под куполом гигантского цирка.','$4 000 000'),(7671,'Американец в Париже',1951,113,0.0,6.7,1642,'1951-08-26','https://st.kp.yandex.net/images/film_iphone/iphone360_7671.jpg','An American in Paris','Бывший солдат Джерри пытается стать художником в послевоенном Париже. И имеет некоторый успех, найдя богатую покровительницу, которая покупает его картины и рекомендует их своим друзьям.<br><br>Однажды он заходит в ночной клуб и знакомится с Лизой и молодые люди моментально влюбляются. Но позже она неожиданно сообщает, что помолвлена с его другом. И Джерри, и Лиза поступают благородно, решив более не встречаться.','$2 723 903'),(7672,'Вся королевская рать',1949,105,0.0,6.8,904,'1949-11-08','https://st.kp.yandex.net/images/film_iphone/iphone360_7672.jpg','All the King\'s Men','Мейсон-Сити, 1939 год. Ультраправый политический деятель Вилли Старк стремится к монопольной власти в своем штате. Его выдрессированная команда профессиональных журналистов и аналитиков, используя любые средства — подлог, обман, грязный шантаж, насилие и вымогательство, приводит своего лидера к победе на выборах. Старку принадлежит всё, что есть в штате — от скромной недвижимости до гигантских заводов. Он всемогущ и рвется в высшие эшелоны власти.','Нет данных'),(7673,'Джентльменское соглашение',1947,118,0.0,7.0,1020,'1947-11-11','https://st.kp.yandex.net/images/film/7673.jpg','Gentleman\'s Agreement','В центре повествования молодой независимый литератор, пытающийся привлечь внимание общества к социальным проблемам и выдающий себя за еврея, с тем чтобы написать ряд статей об антисемитизме и взглянуть на трагедию народа без Родины глазами еврея.','$2 000 000'),(7674,'Потерянный уик-энд',1945,101,0.0,7.8,3505,'1945-10-05','https://st.kp.yandex.net/images/film_iphone/iphone360_7674.jpg','The Lost Weekend','Фильм снят по сценарию Чарльза Брэкетта и Билли Уайлдера, адаптировавших для кино роман Чарльза Р. Джексона. На суд кинозрителей представлен мрачный срез быта и нравов американского общества военного времени, в частности, трагедия опустившегося алкоголика.','$1 250 000'),(7675,'Идти своим путем',1944,121,0.0,6.9,779,'1944-05-03','https://st.kp.yandex.net/images/film_iphone/iphone360_7675.jpg','Going My Way','Отец Фитзджиббон, пожилой священник округа, отслужил в старом районе города уже 45 лет, но его церковь бедна, плохо отапливается и имеет долги за аренду земли. Для поправки дел прихода к нему направлен молодой священник Чак О`Мэлли.','Нет данных'),(7676,'Миссис Минивер',1942,134,0.0,7.0,756,'1942-06-04','https://st.kp.yandex.net/images/film_iphone/iphone360_7676.jpg','Mrs. Miniver','Об участии рядовых англичан в годы Второй мировой войны в обороне страны.','$1 344 000'),(7677,'С собой не унесешь',1938,126,0.0,7.8,1948,'1938-09-01','https://st.kp.yandex.net/images/film_iphone/iphone360_7677.jpg','You Can\'t Take It with You','Тони — сын одного из самых богатых воротил бизнеса в Нью-Йорке влюблен в Алису — простую девушку секретаря и молодые хотят обвенчаться. Однако эксцентричное поведение родственников и друзей будущей невесты наводит родителей жениха на мысль, что у них с головами не все в порядке. Их дом — это клуб по интересам «городских сумасшедших».<br /><br />Мать Алисы — Пенни пишет пьесы, потому что пишущую машинку когда-то доставили в их дом по ошибке. Ее бездарная сестра Эсси грезит балетом и берет уроки танца у сумасшедшего русского по имени Потап Коленков, который не прочь отобедать за чужой счет. Папа с друзьями Алисы тратит все свое время, создавая фейерверки и запуская их прямо в доме.<br /><br />Но больше всех отличается эксцентричным поведением дедушка, который отказывается платить налоги по убеждениям. Весь этот балаган шумит, поёт, танцует и прыгает одновременно, под аккомпанемент губной гармоники дедушки и ксилофона мужа Эсси, мешая делать большой бизнес корпорации Энтони П. Кирби — отца Тони.','$1 644 736'),(7678,'Жизнь Эмиля Золя',1937,116,0.0,6.8,630,'1937-08-11','https://st.kp.yandex.net/images/film_iphone/iphone360_7678.jpg','The Life of Emile Zola','Эта картина повествует биографию одного из самых значительных представителей реализма второй половины XIX века, вождя и теоретика так называемого «натуралистического движения» в литературе. Золя стоял в центре литературной жизни Франции последнего тридцатилетия XIX века и был связан с крупнейшими писателями этого времени Флобером, Тургеневым, Доде, Эдмондом Гонкура, Гюисмансом и Мопассаном. <br><br>Сын принявшего французское подданство инженера итальянского происхождения, построившего канал в Эксе, свою литературную деятельность начал как журналист. Многие из его первых романов стали «романы-фельетоны», один из самых знаменитых — «Марсельские тайны». На протяжении своего творческого пути Золя сохранил связь с публицистикой, художник всегда принимал активное участие в политической жизни Франции. <br><br>Как высшая точка политической биографии Золя, становится его участие в деле офицера Дрейфуса, обвиненного в государственной измене, которое обнажило противоречия Франции 90-х годов XIX века. Его знаменитое открытое письмо в газете Клемансо по поводу ареста Дейфуса под заголовком «Я обвиняю», стоило писателю изгнания в Англию в 1898 году.','Нет данных'),(7679,'Великий Зигфилд',1936,186,0.0,6.4,511,'1936-03-22','https://st.kp.yandex.net/images/film_iphone/iphone360_7679.jpg','The Great Ziegfeld','Фильм-концерт, повествующий о реальном деятеле индустрии развлечений, бродвейском шоумене и импрессарио Флоренце Зигфилде.<br><br>Яркие фарсовые зарисовки, перемежающиеся танцевальными и музыкальными номерами, заложили фундамент целого кинематографического направления, а сцена телефонного разговора с участием Луизы Райнер считается в Голливуде классической и по сегодняшний день.','Нет данных'),(7680,'Мятеж на Баунти',1935,132,0.0,7.4,1258,'1935-11-08','https://st.kp.yandex.net/images/film_iphone/iphone360_7680.jpg','Mutiny on the Bounty','Английский флот XVIII века отличался жесткой (даже жестокой) дисциплиной. Малейшие провинности наказывались плетьми, более тяжелые проступки карались смертной казнью. Доведенные до отчаяния матросы поднимали бунты и пытались освободиться от гнета.<br><br>1789 год. Экипаж британского корабля «Баунти» под руководством жестокого капитана Блая наполнив трюмы, отчаливает от берегов Таити. До этого дня в течение шести месяцев команда корабля подвергалась физическим и моральным издевательствам со стороны капитана и его приспешников.<br><br>Изнурительная работа и отсутствие пищи вынуждают моряков поднять бунт. Зачинщиком мятежа становится матрос, аристократ Кристиан Флетчер. Ссадив с корабля капитана и преданных ему людей, «Баунти» взял курс обратно на Таити, именно там Флетчер и другие мятежники решили провести всю оставшуюся жизнь…','$1 950 000'),(7681,'Кавалькада',1933,112,0.0,5.8,433,'1933-01-05','https://st.kp.yandex.net/images/film_iphone/iphone360_7681.jpg','Cavalcade','Фильм «Кавалькада» охватывает исторический период с празднования 1899 Нового года до 31 декабря 1933. Перед глазами героев проходят такие события, как англо-бурская война, смерть королевы Виктории, кораблекрушение «Титаника» и Первая мировая война.','$1 180 280'),(7682,'Гранд Отель',1932,112,0.0,7.3,1754,'1932-04-12','https://st.kp.yandex.net/images/film_iphone/iphone360_7682.jpg','Grand Hotel','Обычный день роскошного Берлинского гранд-отеля, сотни служащих и гостей, люди встречаются, люди расходятся… Убийство и воровство, любовь и ненависть, азарт и жадность — все грехи мира представлены в этом замкнутом мире красоты и порока.<br><br>Барон фон Гейджерн — аристократ, идущий на воровство, чтобы расплатиться с карточными долгами. Пытаясь похитить жемчужное колье балерины Грусинской, он вместо того крадёт ее сердце.','$700 000'),(7683,'Симаррон',1931,123,0.0,6.1,461,'1931-01-26','https://st.kp.yandex.net/images/film_iphone/iphone360_7683.jpg','Cimarron','История газетчика и адвоката Янси Кравата и его жены Сабры, которые во время земельного бума 1889 года в Оклахоме отправились искать счастье на Запад.','$1 433 000'),(7684,'Бродвейская мелодия 1929-го года',1929,100,0.0,5.9,674,'1929-02-01','https://st.kp.yandex.net/images/film_iphone/iphone360_7684.jpg','The Broadway Melody','Сестры Хэнк и Куини Махони — танцующие певицы, приезжают в Нью-Йорк на Бродвей, где их друг Эдди Керне выступает в роли протеже постановки их нового номера для варьете Фрэнсиса Занфилда. Эдди и Хэнк давно знакомы и даже хотят обвенчаться, но когда молодой человек увидел Куини, он влюбляется в нее без ума и, изменив свои планы в отношении будущего брака, начинает ухаживать за белокурой сестричкой.<br> <br>Тем временем Джок Уорринер, богач и представитель высшего общества Нью-Йорка, положив глаз на Куини, дарит ей бриллиантовый браслет и требует повиновения и любви, но только спустя несколько недель девушка поймет, что стала игрушкой в руках хладнокровного джентльмена…','$379 000'),(7685,'Рожденный четвертого июля',1989,145,0.0,7.6,12557,'1989-12-20','https://st.kp.yandex.net/images/film_iphone/iphone360_7685.jpg','Born on the Fourth of July','Фильм, основанный на реальных фактах, рассказывает историю жизни ветерана по имени Рон Ковик. Наивным школьником он записывается добровольцем в армию и, пройдя через ад вьетнамской войны, возвращается домой парализованным калекой. Этот мужественный человек посвящает свою жизнь борьбе с самым страшным врагом человечества — войной.','$14 000 000'),(7686,'На Золотом пруду',1981,109,0.0,7.8,1975,'1981-12-04','https://st.kp.yandex.net/images/film_iphone/iphone360_7686.jpg','On Golden Pond','80-летний профессор Норман Тэйер давно уже на пенсии. Он понимает, что жить осталось недолго, но больше смерти его волнует то, что он не может исполнять свои мужские обязанности. Еще больше он переживает разлад с дочерью. События фильма разворачиваются на берегу Золотого озера, куда приезжают профессор с женой (они считают это 48-е лето будет последним в их супружеской жизни,) и их дочь со своим приятелем и его сыном-подростком.','Нет данных'),(7687,'Полуночный экспресс',1978,121,0.0,7.9,14061,'1978-05-18','https://st.kp.yandex.net/images/film_iphone/iphone360_7687.jpg','Midnight Express','Американского студента Билли Хейса ловят при попытке контрабанды наркотиков из Турции и приговаривают к более чем 30 годам лишения свободы. Тюремная среда оказывается весьма негостеприимной, а в придачу ко всему — тюрьмой заправляет садистский надзиратель Хамиду, который наслаждается психическими и физическими пытками над заключенными. У Хейса есть лишь два выхода из тюрьмы: апелляция через адвоката, семью и американские правительство или «полуночный экспресс».','$2 300 000'),(7688,'Тысяча дней Анны',1969,145,0.0,7.7,987,'1969-12-18','https://st.kp.yandex.net/images/film_iphone/iphone360_7688.jpg','Anne of the Thousand Days','Английский король Генрих VIII всю жизнь мечтал о наследнике, но его жена, королева Екатерина Арагонская за долгие годы совместной жизни произвела на свет лишь дочь. Король просит у Папы римского разрешения на развод.<br><br>Генрих хочет сделать новой королевой восемнадцатилетнюю Анну Болейн, уже беременную от него. Из Ватикана приходит отказ на просьбу короля.<br><br>В 1533 году Генрих VIII идет на разрыв с католической церковью и становится основателем новой церкви — англиканской. Генрих устраняет все препятствия и добивается коронации Анны.<br><br>Но его надеждам не суждено оправдаться, Анна приносит мужу еще одну дочь. Их брак продлится недолго, всего три года. Затем Анна Болейн будет обвинена своим мужем в прелюбодеянии и обезглавлена.<br><br>В скором времени Генрих женится на другой, надеясь, что новая избранница все же родит ему сына…','Нет данных'),(7689,'Бекет',1964,148,0.0,7.7,1179,'1964-03-11','https://st.kp.yandex.net/images/film_iphone/iphone360_7689.jpg','Becket','Генрих II окружен завистниками и интриганами. Единственный человек, которому правитель Англии всецело доверяет, — Томас Бекет. Он — слуга и наставник, военный советник и соучастник амурных похождений короля. Чтобы подчинить себе могучего противника — католическую церковь, — Генрих добивается избрания Бекета архиепископом Кентерберийским. Но веселый гуляка, плюющий на законы, неожиданно превращается в жесткого и целеустремленного политика, жаждущего укрепить авторитет церкви. Бывшие друзья превращаются в злейших врагов, и между ними разгорается тотальная война…','$3 000 000'),(7690,'Кардинал',1963,175,0.0,5.7,109,'1963-12-12','https://st.kp.yandex.net/images/film_iphone/iphone360_7690.jpg','The Cardinal','Фильм рассказывает о судьбе молодого священника Стивена Фермойла, ставшего кардиналом. История начинается вскоре после окончания первой мировой войны и кончается накануне второй. Режиссер показывает жизнь Стивена в тесной связи с миром людей, забывших Бога и живущих греховными страстями…','Нет данных'),(7691,'Пушки острова Наварон',1961,150,0.0,7.2,1265,'1961-04-27','https://st.kp.yandex.net/images/film_iphone/iphone360_7691.jpg','The Guns of Navarone','Греция. Эгейское море. 1943 год. Германия собирается совершить блицкриг на остров Керос. Две тысячи британских солдат оказались в ловушке на этом крохотном островке. Им, измотанным и беспомощным, оставалось жить всего неделю. Эвакуация британских солдат была невозможна, ибо подходы к острову блокировали две немецких пушки с радарным наведением, расположенные на соседнем острове Наварон.<br><br>Пушки настолько точные и дальнобойные, что любая попытка союзников провести спасательную операцию была обречена. Разведка союзников узнает о готовившемся блице всего за неделю до назначенной даты. Срочно была сформирована группа коммандос во главе с капитаном Киффом Мэллори, которая взялась за уничтожение немецкой батареи на острове. События следующих шести дней стали легендой острова Наварон…','$6 000 000'),(7692,'К востоку от рая',1955,115,0.0,7.9,3999,'1955-03-09','https://st.kp.yandex.net/images/film_iphone/iphone360_7692.jpg','East of Eden','Эта картина по праву считается классикой Голливуда и главным фильмом Джеймса Дина — блестящего актера, бунтаря и знаменитости своего времени. Его, еще до окончания съемок, уже прозвали вторым Брандо.<br><br>«К востоку от рая» — экранизация знаменитого романа Стейнбека, романа о семейной драме юноши, который ревнует и страдает, видя как его отец отдает незаслуженное предпочтение другому своему сыну — любимцу. И чем сильнее его отчаяние, чем оно безнадежней, — тем сильнее желание обрести забытую родительскую любовь.','Нет данных'),(7693,'Место под солнцем',1951,117,0.0,7.3,2248,'1951-04-05','https://st.kp.yandex.net/images/film_iphone/iphone360_7693.jpg','A Place in the Sun','Джордж Истмен — парень из сельской глубинки, воспитанный пуританами. Богатый дядюшка предлагает устроить его на работу на принадлежащую ему фабрику по производству купальников. Единственное условие — никаких романов с женским персоналом. Однако запретный плод сладок. У Истмена завязывается роман с напарницей по конвейеру, Элис. Из страха перед руководством они скрывают свои отношения.<br><br>Дядюшка доволен исполнительным родственником и продвигает его по службе. На него обращает внимание и неотразимая девушка из высшего общества — Анджела Викерс. Молодые люди без ума друга от друга, дело идёт к свадьбе. Между тем Элис узнаёт о своей беременности и требует от Джорджа оформить брак. Она угрожает предать их связь огласке, что неминуемо поставит крест на его карьере у Истменов.','$2 295 304'),(7695,'Розетта',1999,95,0.0,7.0,2364,'1999-05-22','https://st.kp.yandex.net/images/film_iphone/iphone360_7695.jpg','Rosetta','Молодая и импульсивная Розетта, живя со своей матерью-алкоголичкой, преодолевая множество разочарований, будет делать всё возможное, чтобы найти работу. Первая сцена в фильме, как и все остальные, это сцена психологической борьбы. 18-летнюю Розетту увольняют с фабрики, потому что недлительный период её работы уже закончен. Девушка мечется в поисках новой работы. Горечь и отчаянье в мыслях молодой Розетты, она вынуждена действовать иначе…','Нет данных'),(7696,'Вечность и один день',1998,137,0.0,7.1,925,'1998-05-23','https://st.kp.yandex.net/images/film_iphone/iphone360_7696.jpg','Mia aioniotita kai mia mera','Знаменитый писатель узнает, что тяжело болен и проживет лишь один день. Он встречает мальчика-албанца и решает посвятить маленькому нелегалу этот день — то время, что ему отпущено.','Нет данных'),(7697,'Вкус вишни',1997,95,0.0,7.4,3842,'1997-05-16','https://st.kp.yandex.net/images/film/7697.jpg','Ta\'m e guilass','Господин Бадии решительно собрался уйти из этой жизни и занят отчаянными поисками того, кто мог бы ему в этом помочь. Он уже даже вырыл себе могилу в горах, чтобы его закопали, когда дело будет сделано. Вот только с помощником просто беда: каждый находит какую-нибудь причину для отказа, а то еще и пытается его отговорить. Но слишком тверд в своем намерении господин Бадии.','Нет данных'),(7698,'Андеграунд',1995,194,0.0,7.9,13639,'1995-04-01','https://st.kp.yandex.net/images/film_iphone/iphone360_7698.jpg','Underground','Во время Второй мировой войны в Белграде подпольщики-антифашисты организовали целую фабрику по производству оружия. Война давно закончилась, а они продолжают свою деятельность. И все эти годы наверху жизнь течёт своим чередом, а в подполье рождаются дети, которые никогда не видели солнечного света.','$14 000 000'),(7699,'Прощай, моя наложница',1992,156,0.0,7.6,1819,'1993-01-01','https://st.kp.yandex.net/images/film_iphone/iphone360_7699.jpg','Ba wang bie ji','История двух актёров пекинской оперы на протяжении нескольких десятилетий.','Нет данных'),(7700,'Благие намерения',1991,186,0.0,7.3,447,'1992-07-03','https://st.kp.yandex.net/images/film_iphone/iphone360_7700.jpg','Den goda viljan','Автором сценария данного фильма является Ингмар Бергман. Сценарий посвящен истории встречи, любви, замужества и семейной жизни его родителей — Хенрика и Анны Бергман.','Нет данных'),(7701,'Секс, ложь и видео',1989,100,0.0,7.5,10557,'1989-01-20','https://st.kp.yandex.net/images/film_iphone/iphone360_7701.jpg','Sex, Lies, and Videotape','Джон считал свою жизнь вполне благополучной. Он был на хорошем счету в своей юридической фирме, имел красавицу жену Энн и любовницу Синтию, которая приходилась Энн младшей сестрой. Эту идиллию напрочь разрушил приезд его университетского товарища Грэма, показавшегося Энн и Джону немного странным. <br><br>Оказавшись в баре с Энн, Грэм признался ей, что в настоящее время является импотентом. Навестив Грэма, Энн обнаружила у него серию видеокассет, каждая из которых называлась женским именем. Проявив настойчивость, Энн узнала, что каждая кассета содержит сексуальную исповедь женщины. А ещё она узнала, что так Грэм получает сексуальное удовлетворение.','$1 200 000'),(7702,'Пелле-завоеватель',1987,157,0.0,7.8,1145,'1987-12-13','https://st.kp.yandex.net/images/film_iphone/iphone360_7702.jpg','Pelle erobreren','1877 год. Восьмилетний Пелле, сын пожилого батрака Лассе Карлсона, перебирается с отцом из Швеции в Данию на эмигрантском судне. Здесь он живет на крестьянской ферме, приобщаясь к сложностям окружающего мира — к светлому и мерзкому, доброму и ужасному, трогательному и ничтожному. Он проходит через привязанность и боль, разочарование и любовь, получает знания в местной школе для бедняков и первые уроки социальной борьбы в надежде однажды уйти и покорить чужой мир.','Нет данных'),(7703,'Под солнцем Сатаны',1987,105,0.0,6.7,840,'1987-05-14','https://st.kp.yandex.net/images/film_iphone/iphone360_7703.jpg','Sous le soleil de Satan','Молодой католический аббат Дониссан истово верует, просиживает над книгами ночи напролет, но сомневается в своем предназначении быть приходским священником и занимается самобичеванием. Заблудившись ночью на сельской дороге, он встречает незнакомца, предложившего себя в попутчики, и соглашается принять его помощь, но потом в ужасе узнаёт в нём Сатану и, борясь с искушением, теряет сознание.<br><br>Утром к Дониссану обращается шестнадцатилетняя Жермена Малорти по прозвищу Мушетта, убившая своего любовника и родившая в психиатрической лечебнице мёртвого ребёнка. Дониссан оказывается не в состоянии помочь девушке, а его увещевания вызывают новый приступ безумия: вернувшись домой, Мушетта призывает Сатану и совершает самоубийство, в котором аббат винит себя…','Нет данных'),(7704,'Папа в командировке',1985,136,0.0,7.8,2922,'1985-01-15','https://st.kp.yandex.net/images/film_iphone/iphone360_7704.jpg','Otac na službenom putu','Действие фильма происходит в Сараево в беспокойное время (1948 — 1952гг.) после разрыва Тито со Сталиным. Трагедия людей, попавших в жернова тоталитаризма, показана с точки зрения шестилетнего мальчика.<br><br>Отец мальчика постоянно уезжает в командировки, и он — тот самый похотливый бабник, из-за которого страдает мать. Судьба наносит удар семье, когда отца по доносу любовницы арестовывают, а его жене и сыну приходится пережить три жутких года, полных горя и нищеты.','Нет данных'),(7705,'Легенда о Нараяме',1983,130,0.0,7.8,2953,'1983-04-29','https://st.kp.yandex.net/images/film_iphone/iphone360_7705.jpg','Narayama bushiko','Действие происходит в XIX столетии в японской деревушке, пораженной голодом. Чтобы не умирать голодной смертью, жители ввели ритуал умерщвления бесполезных членов сообщества: новорожденных мальчиков просто убивали, а пожилых людей их собственные дети относили на вершину горы Нараяма и оставляли умирать. Орин — женщина 69 лет, и она должна умереть. Ее сын не хочет выполнить ритуал, но того требует мать, верная традиции. Найдя жен своим детям, она начинает последний подъем на вершину.','Нет данных'),(7706,'Пропавший без вести',1981,122,0.0,7.3,1250,'1982-02-12','https://st.kp.yandex.net/images/film_iphone/iphone360_7706.jpg','Missing','Молодой американский журналист Чарли таинственно исчезает во время военного переворота в Чили. Его отец Эд Хормэн и жена отправляются на розыски.<br><br>Упрямый Эд, твердо верящий в демократические ценности и непременную помощь со стороны «дяди Сэма», никак не может понять, что всякие представления о справедливости здесь надо выбросить за ненадобностью. Что американские представители здесь действуют рука об руку с военной хунтой, пришедшей к власти в результате переворота. Что на отдельного человека всем наплевать…','Нет данных'),(7707,'Человек из железа',1981,153,0.0,7.2,570,'1981-05-24','https://st.kp.yandex.net/images/film_iphone/iphone360_7707.jpg','Czlowiek z zelaza','Лидер забастовщиков Томчик страдает от преследований и угроз правительства и журналиста Винкеля. Последний ведет грязную кампанию против молодого рабочего активиста, но и его собственная лояльность подвергается проверке во время забастовки…','Нет данных'),(7708,'Весь этот джаз',1979,123,0.0,7.7,3841,'1979-12-16','https://st.kp.yandex.net/images/film_iphone/iphone360_7708.jpg','All That Jazz','Фильм о творческой карьере Джо Гидеона, его взаимоотношениях с женщинами, в частности, с бывшей женой Одри и дочерью Мишель, где он показан эгоцентричным трудоголиком, который доводит себя до инфаркта.','Нет данных'),(7709,'Дерево для башмаков',1978,186,0.0,7.6,593,'1978-05-17','https://st.kp.yandex.net/images/film_iphone/iphone360_7709.jpg','L\'albero degli zoccoli','В фильме рассказывается о жизни крестьян в Италии в конце 19 столетия.','Нет данных'),(7710,'Отец-хозяин',1977,114,0.0,7.3,513,'1977-05-17','https://st.kp.yandex.net/images/film_iphone/iphone360_7710.jpg','Padre padrone','Экранизация одноименной автобиографической книги итальянского писателя Гавино Ледда, которого собственный отец забрал из начального класса школы. До 18 лет — до армии — Гавино обречен оставаться безграмотным пастухом.<br><br>Отец относится к собственному сыну как к рабу, но Гавино решает бросить ему вызов. Он поступает в школу и открывает для себя совершенно новый мир.','Нет данных'),(7711,'Хроника огненных лет',1975,177,0.0,6.2,136,'1975-05-12','https://st.kp.yandex.net/images/film_iphone/iphone360_7711.jpg','Ahdat sanawovach el-djamr','Фильм показывает борьбу Алжира за освобождение от французского колониализма глазами простого крестьянина, покинувшего поражённое засухой село и присоединившегося к движению сопротивления…','Нет данных'),(7712,'Наемный работник',1973,108,0.0,5.9,96,'1973-06-10','https://st.kp.yandex.net/images/film_iphone/iphone360_7712.jpg','The Hireling','В центре сюжета — история шофера, который влюбляется в даму из высшего света.','Нет данных'),(7713,'Дело Маттеи',1972,116,0.0,6.7,224,'1972-01-26','https://st.kp.yandex.net/images/film_iphone/iphone360_7713.jpg','Il caso Mattei','Энрико Маттеи помог изменить будущее Италии, сначала как борец за освобождение от нацистов, затем как инвестор газовую компанию, и в конечном счете как голова ENI, государственной компании для развития нефтяных ресурсов. 27 октября 1962, он погиб когда его частный самолет потерпел крах за одну минуту до приземления в Миланском аэропорту. Официально, он умер от авиационной катастрофы. Фактически, много журналистов исследовали другие вероятные причины для несвоевременного приземления.','Нет данных'),(7714,'Если...',1968,111,0.0,7.4,3642,'1968-12-19','https://st.kp.yandex.net/images/film_iphone/iphone360_7714.jpg','If....','Действия разворачиваются в английской школе, где царят старые порядки — школьников бьют хлыстами за провинности, старшеклассники шефствуют и издеваются над младшими. У группы старшеклассников созревает план протеста…','Нет данных'),(7715,'Фотоувеличение',1966,111,0.0,7.8,18466,'1966-12-18','https://st.kp.yandex.net/images/film_iphone/iphone360_7715.jpg','Blowup','Главный герой — известный молодой фотограф. Однажды в городском парке он случайно снимает целующуюся пару. Позднее при фотоувеличении герой замечает, что за идиллической картинкой прячется преступление.','$1 800 000'),(7716,'Дамы и господа',1965,115,0.0,7.2,351,'1966-02-09','https://st.kp.yandex.net/images/film_iphone/iphone360_7716.jpg','Signore & signori','В картине показана жизнь маленького итальянского провинциального городка: свадьба, предательство, рождение и смерть — вся жизнь любого города. Сюжет можно выразить одной поговоркой «Каждый делает это, но никто не говорит об этом». Картина показывает жизнь 80% населения Италии, которая живет в небольших городках, и каждый итальянец может рассказать подобную историю…','Нет данных'),(7717,'Сноровка... и как ее приобрести',1965,84,0.0,7.3,787,'1965-05-13','https://st.kp.yandex.net/images/film_iphone/iphone360_7717.jpg','The Knack ...and How to Get It','История молодого школьного учителя, который в свободное время пытается приобрести сноровку в знакомствах с девушками, обучаясь этому «искусству» у своего распутного соседа.','$364 000'),(7718,'Шербурские зонтики',1964,91,0.0,7.7,10877,'1964-02-03','https://st.kp.yandex.net/images/film_iphone/iphone360_7718.jpg','Les parapluies de Cherbourg','Женевьева работает в семейном галантерейном магазинчике — продает зонты. Она влюблена в автомеханика Ги, и тот отвечает ей взаимностью. Но вскоре Ги забирают в армию и отправляют в Алжир. Расставаясь, влюбленные обещают ждать друг друга. Затем Женевьева узнает, что беременна, а вестей от любимого всё нет, и девушка соглашается на брак с состоятельным и солидным мужчиной.','Нет данных'),(7719,'Леопард',1963,185,0.0,7.7,3618,'1963-03-27','https://st.kp.yandex.net/images/film_iphone/iphone360_7719.jpg','Il gattopardo','В мае 1860 года в Италии разгорается гражданская война между республиканцами, сторонниками Гарибальди, и приверженцами правящей династии Бурбонов. Князь Фабрицио ди Салина, сицилийский феодал, образованный и мудрый аристократ-интеллектуал, с пониманием и пессимизмом относится к происходящим переменам.<br><br>Поэтому, когда его молодой племянник Танкреди сначала вступает в ряды мятежников-гарибальдийцев, а затем становится офицером короля Савойского, дон Фабрицио не осуждает его. Сам князь Салина не хочет активно участвовать в политической борьбе. Он прекрасно осознает неизбежность происходящих больших перемен и чувствует, что его время «леопардов» и «львов» — уходит.<br><br>«Я принадлежу к уходящему классу, я свободен от иллюзий и не способен к самообману, — говорит он. Мы — леопарды, львы. Те, кто придет на смену, будут шакалишками, гиенами».','ITL 2 900 000 000'),(7720,'Обет',1962,98,0.0,7.7,375,'1962-04-17','https://st.kp.yandex.net/images/film_iphone/iphone360_7720.jpg','O Pagador de Promessas','Зе — очень бедный человек из бразильской сельской местности. Самое дорогое, что у него есть — его осел. Когда его осел заболевает, Зе клянется Святой Барбаре: если его осел выздоровеет, то он будет нести крест — как Иисус — из его городишки до церкви Святой Барбары в столице…','Нет данных'),(7721,'Столь долгое отсутствие',1961,94,0.0,6.7,181,'1961-05-17','https://st.kp.yandex.net/images/film_iphone/iphone360_7721.jpg','Une aussi longue absence','Много лет спустя после войны Тереза Ланглуа встречает бродягу и узнает в нем мужа, которого считала погибшим. Оказывается, после допросов в гестапо он потерял память и живет бездомным, не помня ни ее, ни дороги домой…','Нет данных'),(7722,'Сладкая жизнь',1960,179,0.0,8.0,18818,'1960-02-03','https://st.kp.yandex.net/images/film_iphone/iphone360_7722.jpg','La dolce vita','Журналист Марчелло — наблюдатель и участник всех эпизодов жизни итальянской элиты конца 50-х годов. Женщины как тени сменяют друг друга, не задевая его чувств, даже явление американской кинодивы Сильвии, воплощения сексуальности и порока, не выводит его из ступора…','Нет данных'),(7723,'Черный Орфей',1959,100,0.0,7.2,660,'1959-05-12','https://st.kp.yandex.net/images/film_iphone/iphone360_7723.jpg','Orfeu Negro','В Рио наступило время ежегодного карнавала. В это время можно без всяких ограничений и самоконтроля предаваться веселью, музыке и танцам.<br><br>Орфей работает кондуктором трамвая, играет на гитаре. Орфей помолвлен с Мирой. Мира весьма экзотическая женщина, она каждый день живёт так, как на карнавале.<br><br>Но Орфео должен любить Эвридику — девушку, только что приехавшую в Рио навестить свою кузину Серафину. Она была вынуждена уехать из родного городка, скрываясь от преследований таинственного незнакомца, но он приехал вслед за ней.','Нет данных'),(7725,'Одиссея Жака Кусто: Мир тишины',1956,86,0.0,7.9,1220,'1956-05-26','https://st.kp.yandex.net/images/film_iphone/iphone360_7725.jpg','Le monde du silence','На борту научно-исследовательского судна «Калипсо» капитан Кусто и его команда бороздят бескрайние водные просторы Индийского океана, путешествуют по Средиземному и Красному морям, снимая на пленку многочисленных и разнообразных обитателей морских глубин. Создатели акваланга — уникального оборудования для подводных погружений — исследуют затонувшие корабли и рассказывают об удивительных открытиях в таинственном мире безмолвия…','Нет данных'),(7726,'Врата ада',1953,86,0.0,7.2,412,'1953-10-31','https://st.kp.yandex.net/images/film_iphone/iphone360_7726.jpg','Jigokumon','В 1159 году, во время попытки переворота, преданный сёгуну самурай помогает бежать из города придворной даме.<br /><br />После того, как переворот терпит неудачу, самурай просит, чтобы ему позволили жениться на этой женщине в качестве награды. Но оказывается, что она уже замужем за одним из подданных сёгуна.<br /><br />Самурай не оставляет своего желания и просит женщину бросить мужа, а затем сам бросает ему вызов. И хотя муж и жена ведут себя совершенно спокойно, самурай упрямится и не может больше сдерживать свои чувства, что приводит к трагическим последствиям.','Нет данных'),(7727,'Плата за страх',1952,156,0.0,8.0,6655,'1953-04-15','https://st.kp.yandex.net/images/film_iphone/iphone360_7727.jpg','Le salaire de la peur','Четверо храбрецов, застрявших без денег в крошечном городишке где-то в сердце Латинской Америки, берутся выполнить самоубийственное задание: за 2000 долларов доставить два грузовика с нитроглицерином на нефтяные скважины, расположенные на расстоянии 300 миль от города. Мало того, что груз взрывоопасен, так ещё и дорога — как в российской глубинке. Вероятность добраться до пункта назначения минимальна, но деньги нужны позарез, ведь это пропуск на родину, а другой работы не предвидится.','Нет данных'),(7728,'Два гроша надежды',1952,110,0.0,6.6,122,'1952-04-10','https://st.kp.yandex.net/images/film_iphone/iphone360_7728.jpg','Due soldi di speranza','История любви нищего парня и дочери уважаемого владельца мастерской в итальянской послевоенной деревне. Поначалу молодой Антонио слишком занят поисками работы, чтобы отвечать на заигрывания влюблённой в него Кармелы, а потом сопротивление её родных не делает жизнь проще…','Нет данных'),(7729,'Фрёкен Юлия',1951,90,0.0,7.1,324,'1951-04-06','https://st.kp.yandex.net/images/film_iphone/iphone360_7729.jpg','Fröken Julie','Швеция, конец XIX века. Графская дочь Юлия собирается бежать из родительского дома за границу с лакеем Жаном. Но есть ли между ними любовь?','Нет данных'),(7730,'Короткая встреча',1945,86,0.0,7.8,2673,'1945-11-19','https://st.kp.yandex.net/images/film_iphone/iphone360_7730.jpg','Brief Encounter','Лора Джессон и доктор Алек Харви познакомились в кафе на вокзале и стали встречаться здесь каждую неделю, прекрасно зная, что у их любви нет будущего.','£170 000'),(7731,'Рим, открытый город',1945,103,0.0,7.8,3744,'1945-09-24','https://st.kp.yandex.net/images/film_iphone/iphone360_7731.jpg','Roma città aperta','Рим в последние месяцы оккупации. Умирающая немецкая армия отчаянно хранит последние свои оплоты и жестоко расправляется с мятежниками. Но в сердце города уже родился свой отряд Сопротивления. Близок конец войны…','Нет данных'),(7732,'Мужской стриптиз',1997,88,0.0,7.4,9346,'1997-08-13','https://st.kp.yandex.net/images/film_iphone/iphone360_7732.jpg','The Full Monty','В небольшом английском городке Шеффилд закрывается сталелитейный завод. Успех заехавшей в Шеффилд группы мужских стриптизёров рождает у одного из бывших работников завода идею организовать своё стриптиз-шоу, чтобы хоть как-то сводить концы с концами. А поскольку бывшие сталевары не отличаются ни идеальным телом, ни умением танцевать, то необходимо придумать что-то ещё для привлечения женского внимания…','$3 500 000'),(7733,'Земля и свобода',1995,109,0.0,6.7,390,'1995-04-07','https://st.kp.yandex.net/images/film_iphone/iphone360_7733.jpg','Land and Freedom','Молодой коммунист Дэйв решил поехать в Испанию сражаться с фашизмом. Он в одном строю с парнишкой из Франции, и его отправляют с частями милиции на республиканский фронт в Арагоне. Но происходит непредвиденное: при обучении добровольцев маузер взрывается прямо в лицо Дэйву. Он попадает в барселонский госпиталь, где встречает Бланку, служившую с ним в одном подразделении…','Нет данных'),(7734,'Америка',1994,125,0.0,6.5,164,'1994-09-09','https://st.kp.yandex.net/images/film_iphone/iphone360_7734.jpg','Lamerica','Албания, 1991 год. Двое итальянцев собираются наладить здесь производство итальянской обуви…','Нет данных'),(7736,'Похититель детей',1992,113,0.0,7.1,298,'1992-04-10','https://st.kp.yandex.net/images/film_iphone/iphone360_7736.jpg','Il ladro di bambini','Простая житейская история. Отца нет, мать лишили родительских прав, детей двое (мальчику — 8, девочке — 11). Карабинер Антонио сопровождает их в сиротский приют. Путь не близкий и в дороге спутники становятся друзьями. И оказывается, что совсем немного нужно этим обездоленным детям для счастья…','Нет данных'),(7737,'Открытые двери',1990,108,0.0,6.4,148,'1990-03-29','https://st.kp.yandex.net/images/film_iphone/iphone360_7737.jpg','Porte aperte','Герой фильма — честный судья Вито. Он считает своим долгом работать так, чтобы честные люди могли жить спокойно, оставляя двери своих домов открытыми. Рассматривается дело о тройном убийстве, и всем ясно, что подсудимый, признавший полностью свою вину, заслуживает высшей меры наказания.<br><br>Судья Вито абсолютно бесстрастен, но хочет понять, что побудило человека убить бывшего начальника, сослуживца и собственную жену.','Нет данных'),(7738,'Пейзаж в тумане',1988,127,0.0,7.9,2324,'1988-08-31','https://st.kp.yandex.net/images/film_iphone/iphone360_7738.jpg','Topio stin omihli','Фильм-путешествие про двух детей, ищущих своего отца, который, предположительно, живёт в Германии. Одержимость личностью отца будет удерживать их на границе между детством и юностью.','Нет данных'),(7739,'Короткий фильм об убийстве',1987,84,0.0,7.7,3565,'1988-03-11','https://st.kp.yandex.net/images/film_iphone/iphone360_7739.jpg','Krótki film o zabijaniu','В фильме три центральных персонажа, до поры — никак между собой не связанных, даже незнакомых. Каждый живет в своем мире. Но в какой-то момент их судьбы пересекутся… Первый, 20-летний Яцек — ничем не примечательный, праздношатающийся провинциал, не знающий, чем себя занять. Он словно пытается зацепиться за что-то в городском пейзаже, установить с миром какую-то связь. Но контакт все не возникает…<br><br>В пару ему режиссер дает немолодого таксиста, столь же бессмысленно кружащего по улицам Варшавы. Его съедает безнадежность и мизантропия. Оба они — неудачники, человеческие осколки большого неприветливого города, вызывающего у них схожую неприязнь. И, наконец, третий герой — адвокат, положительный, молодой и красивый, верящий в святость и гуманизм своей миссии.<br><br>Однако и ему суждено стать участником и даже в каком-то смысле проводником события, вынесенного в заголовок фильма…','Нет данных'),(7740,'Усадьба Хауардс-Энд',1991,140,0.0,7.1,2623,'1992-02-27','https://st.kp.yandex.net/images/film_iphone/iphone360_7740.jpg','Howards End','Действие происходит в Англии в начале XX века. История рассказывает о трёх семействах, представляющих три разных класса. Уилкоксы — богатые капиталисты, представляют класс, заменяющий старую аристократию. Сёстры Шлегель представляют просвещённую буржуазию. Басты принадлежат к низам среднего класса. Фильм посредством показа перехода дома «Говардс-Энд» от одного владельца к другому отвечает на вопрос «Кто унаследует Англию?».','Нет данных'),(7741,'Обязательства',1991,118,0.0,7.4,1649,'1991-08-07','https://st.kp.yandex.net/images/film_iphone/iphone360_7741.jpg','The Commitments','Джимми, безработный парень из Дублина, вместе со своими сверстниками создает группу «Коммитментс». Желая возродить интерес публики к некогда популярному стилю соул, группа начинает круглосуточные репетиции. Затем приходит слава. Но именно она начинает обнажать самые неприглядные стороны каждого из «Коммитментс»…','Нет данных'),(7742,'Алиса здесь больше не живет',1974,112,0.0,7.2,2933,'1974-12-09','https://st.kp.yandex.net/images/film_iphone/iphone360_7742.jpg','Alice Doesn\'t Live Here Anymore','Алиса пытается выжить, оставшись после смерти мужа с маленьким сыном без средств к существованию. Они отправляются в другой город, но и там не везет: парень, добившийся ее расположения, оказался обыкновенным подонком.<br><br>Алиса снова в пути. В новом городе, где ей удалось устроиться официанткой, она находит мужчину, похожего на идеал, но проблемы с сынишкой: мальчишка с характером, и с ним не просто найти общий язык. Непросто складываются у Алисы и отношения с одной из официанток…','$1 800 000'),(7743,'Лакомб Люсьен',1974,137,0.0,7.8,1669,'1974-01-30','https://st.kp.yandex.net/images/film_iphone/iphone360_7743.jpg','Lacombe Lucien','1944 год. Провинциальный крестьянский юноша Люсьен Лакомб решает бросить тяжелую и неблагодарную работу уборщика в больнице и податься в партизаны — маки. Но туда его брать не хотят, мотивируя это юным возрастом. Волей судьбы Люсьен попадает в гестапо, где прием ему оказывается куда более радушный…','Нет данных'),(7744,'Американская ночь',1973,115,0.0,7.7,2921,'1973-05-15','https://st.kp.yandex.net/images/film_iphone/iphone360_7744.jpg','La nuit américaine','Эта картина о том, как снимают фильм. Конфликты на съемочной площадке, неудачи с актерами и прочие студийные перипетии улаживает, утрясает и исправляет Владыка творческого процесса — Режиссер.','Нет данных'),(7745,'Кабаре',1972,124,0.0,8.0,9478,'1972-02-13','https://st.kp.yandex.net/images/film_iphone/iphone360_7745.jpg','Cabaret','Американская певица Салли Боулз развлекает Берлин эпохи Веймарской республики на подмостках кабаре Kit-Kat club. За дверями клуба — политический и экономический хаос, восхождение к власти нацистов, еврейские погромы. Внутри — вечный праздник. Перемены в относительно беззаботную жизнь Салли вносят встреча с Брайаном — англичанином, подрабатывающим уроками, которые он дает богатой молодой еврейке, и Максом — богатым немецким плейбоем.','$6 000 000'),(7746,'Воскресенье, проклятое воскресенье',1971,110,0.0,6.5,570,'1971-07-01','https://st.kp.yandex.net/images/film_iphone/iphone360_7746.jpg','Sunday Bloody Sunday','После тяжелого развода Алекс начинает встречаться с дизайнером Бобом. Но ее возлюбленный не совсем моногамен: у него есть любовник — еврейский врач Дэниэл.','Нет данных'),(7747,'В этом мире',2002,88,0.0,6.5,253,'2002-11-17','https://st.kp.yandex.net/images/film_iphone/iphone360_7747.jpg','In This World','В феврале 2002 года в Лагере беженцев Шамшату на северо-западе Пакистана проживает 53 000 беженцев, оказавшихся там после вторжения США в Афганистан. Семейство афганца Энаята и его брата Джамала решает незаконно перебраться в Лондон, чтобы улучшить жизнь. Они нанимают американцев, чтобы те провезли их контрабандой через Иран и Турцию в Италию, скрывая в грузовиках и контейнерах.','£75 000'),(7748,'Кровавое воскресенье',2001,107,0.0,7.0,1249,'2002-01-16','https://st.kp.yandex.net/images/film_iphone/iphone360_7748.jpg','Bloody Sunday','История трагических событий 30 января 1972 года в североирландском городе Дерри. В этот день британские солдаты открыли огонь по участникам марша за права ирландцев, убив 13 демонстрантов и ранив 14. Это «кровавое воскресенье» разожгло огонь жесточайшей гражданской войны, длившейся 25 лет…','£2 000 000'),(7749,'Центральный вокзал',1998,113,0.0,7.6,1705,'1998-01-16','https://st.kp.yandex.net/images/film_iphone/iphone360_7749.jpg','Central do Brasil','Бывшая учительница — Дора зарабатывает тем, что пишет письма для неграмотных людей, приезжающих на Центральный вокзал Рио-де-Жанейро. Безразличная к своим клиентам, она берет по доллару за письмо, и еще доллар, если просят его отправить. А отправляет она не все письма.<br><br>9-летний Жозуэ и его мать тоже пользуются услугами Доры. Они пишут отцу. Отца Жозуэ никогда не видел, но мечтает встретиться с ним.<br><br>А однажды, когда погибает его мать, мальчик остается совсем один в огромном городе. У наблюдающей за бедным мальчиком Доры появляется мысль о возможной выгоде. И она решает найти его отца…','$2 900 000'),(7750,'Приманка',1995,115,0.0,6.7,330,'1995-03-08','https://st.kp.yandex.net/images/film_iphone/iphone360_7750.jpg','L\'appât','Красивая, очаровательная девушка, ее молодой человек и его друг, насмотревшиеся американских боевиков совершают страшные, зверские убийства с целью ограбления. Она выступает в роли «приманки», наводчицы, знакомясь с состоятельными мужчинами и оставляя дверь открытой, когда те приглашают ее в гости.','Нет данных'),(7751,'Свадебный банкет',1993,106,0.0,6.8,519,'1993-08-04','https://st.kp.yandex.net/images/film_iphone/iphone360_7751.jpg','Xi yan','Китаец-эмигрант Вай уже пять лет живет в Америке со своим бойфрендом Саймоном. Но Вай боится признаться родителям, что он гомосексуал, а они постоянно присылают ему анкеты брачных агентств. И вот Вай находит выход из сложившейся ситуации — он решает оформить фиктивный брак с Вей-Вей, которую собираются депортировать из США. Но всё выходит из-под контроля, когда на свадьбу приезжают родители жениха.','$1 000 000'),(7752,'Дом улыбок',1990,110,0.0,5.9,190,'1991-02-22','https://st.kp.yandex.net/images/film/7752.jpg','La casa del sorriso','Двое обитателей дома престарелых полюбили друг друга. Но все — родственники, работники и даже обитатели дома — хотят помешать их любви.','Нет данных'),(7753,'Музыкальная шкатулка',1989,124,0.0,7.3,579,'1989-12-08','https://st.kp.yandex.net/images/film_iphone/iphone360_7753.jpg','Music Box','Венгерский иммигрант Майк Лазло арестован по обвинению в пособничестве нацистам во время второй мировой войны. Лазло угрожают депортацией, и на его защиту встает его дочь, адвокат Энн Тэлбот, уверенная, что отец стал жертвой происков венгерской коммунистической машины.<br><br>Она не верит в виновность отца до тех пор, пока не собирает внушительные доказательства его коллаборационистской деятельности. Кто теперь Лазло — жертва или палач?','Нет данных'),(7754,'Красный гаолян',1988,91,0.0,7.3,1511,'1988-09-11','https://st.kp.yandex.net/images/film_iphone/iphone360_7754.jpg','Hong gao liang','Действие фильма развивается в первой трети ХХ века на северо-востоке Китая. Юную Цзюцзи насильно выдают замуж за больного проказой старика — владельца винокурни. Ее уже несут в красном свадебном паланкине, но один из носильщиков паланкина, молодой и отважный Ю, похищает девушку и тем самым спасает ее от столь незавидной участи. Связав свою судьбу, молодые герои становятся хозяевами винокурни, где производится чудодейственный напиток — крепкое гаоляновое вино, бодрящее дух и исцеляющее многие болезни. Мирную жизнь прерывает вторжение японцев. Вместе с односельчанами Ю и Цзюцзи встают на защиту родных гаоляновых полей. Земля орошается огненно-красным вином и кровью…','Нет данных'),(7756,'Штаммхайм',1986,107,0.0,5.5,72,'1986-01-30','https://st.kp.yandex.net/images/film/7756.jpg','Stammheim - Die Baader-Meinhof-Gruppe vor Gericht','Фильм рассказывает о процессе, проходившем в суде тюрьмы Штаммхайм над леворадикальными террористами из группы Баадера-Майнхоф.','Нет данных'),(7757,'Женщина и чужой',1984,98,0.0,5.8,78,'1985-01-31','https://st.kp.yandex.net/images/film_iphone/iphone360_7757.jpg','Die Frau und der Fremde','Карл и Ричард, двое захваченных русскими в Первой мировой войне немецких солдат, стали очень близкими друзьями. Ричард рассказывает Карлу интимные истории о своей жене Анне. Через эти рассказы Карл влюбляется в нее. Когда Карл убегает из плена, он идет в дом к Анне…','Нет данных'),(7758,'Потоки любви',1984,141,0.0,7.3,724,'1984-02-28','https://st.kp.yandex.net/images/film_iphone/iphone360_7758.jpg','Love Streams','Роберт Хармон, успешный автор эротических романов живет вместе с двенадцатилетним сыном в большом доме, окруженный толпой случайных любовниц, без конца курит сигареты и не расстается с бутылкой. Когда он остается один, его навещает любимая сестра Сара. Она находится на грани нервного срыва из-за того, что ее дочь после развода предпочла жить со своим отцом.<br><br>Запертые в огромном доме, брат и сестра проводят целые дни наедине друг с другом, болтая о вещах важных и не слишком, о том, что их волнует и о том, что волновать уже не будет. В один из дней Сара решает уехать, оставив Роберта наедине с самим собой.','Нет данных'),(7760,'Тоска Вероники Фосс',1982,104,0.0,7.5,1837,'1982-02-18','https://st.kp.yandex.net/images/film/7760.jpg','Die Sehnsucht der Veronika Voss','Возвращаясь поздним вечером домой спортивный журналист Роберт Крон видит мокнущую под проливным дождем даму и любезно приглашает ее под зонтик. Роберта сразу заинтриговывает, как такая красивая и богатая женщина могла оказаться одна в безлюдном парке, а знаменитую кинозвезду Веронику Фосс располагает к незнакомцу то, что он совершенно не интересуется кино и даже не узнает ее. <br><br>А главное — что его доброжетальное отношение к ней не сменяется на заискивание после того, как он понимает, что перед ним — кумир многих тысяч зрителей. Их отношения завязываются все теснее, однако Роберт замечает, что и без того экзальтированная звезда словно не принадлежит себе, а иногда впадает в странные приступы, напоминающие абстиненцию…','DEM 2 600 000'),(7761,'Быстрей, быстрей',1981,99,0.0,6.2,168,'1981-03-23','https://st.kp.yandex.net/images/film_iphone/iphone360_7761.jpg','Deprisa, deprisa','Ангела начинает тусоваться с Пабло и его бандой молодых грабителей.','Нет данных'),(7762,'В глубине страны',1979,96,0.0,5.9,84,'1979-09-22','https://st.kp.yandex.net/images/film_iphone/iphone360_7762.jpg','Heartland','Начало 20-го века, Вайоминг. Элианор прибывает в дом закрытого шотландского фермера Клайда Стюарта на работу домохозяйкой. Несмотря на маленькую оплату, она работает самозабвенно, в надежде накопить достаточно денег, чтобы обеспечить лучшую жизнь для своей 10-летней дочери Эррин.','Нет данных'),(7763,'Давид',1979,127,0.0,5.6,73,'1979-02-27','https://st.kp.yandex.net/images/film/7763.jpg','David','Фильм рассказывает о еврейском юноше, взрослеющем в нацистском Берлине. В фильме раскрываются темы борьбы за самоидентичность и борьбы за выживание, бывшие актуальными для евреев, особенно молодых, в охваченной войной Европе.','Нет данных'),(7766,'Баффало Билл и индейцы',1976,123,0.0,6.0,404,'1976-06-24','https://st.kp.yandex.net/images/film_iphone/iphone360_7766.jpg','Buffalo Bill and the Indians, or Sitting Bull\'s History Lesson','Конец ХIХ века в Америке — это время, когда реальность легко становилась легендой и обыкновенные люди возвышались до мифических размеров. Этот период был временем Баффало Билла. Курьер компании «Пони Экспресс», кавалерийский разведчик, кавалер медали Чести, охотник на бизонов, шоумэн, актер, ставший идолом для женщин, и предприниматель Баффало Билл был национальным символом.<br><br>Но чрезмерное употребление алкоголя и внимание публики не лучшим образом отразились на его характере и послужили причиной тому, что в реальности он далеко не всегда соответствовал образу легендарного героя. Когда Билл, в погоне за славой, уговаривает вождя индейского племени Сидящего Быка принять участие в шоу «Дикий Запад Баффало Билла», то совсем не ожидает, что тот имеет свой собственный тайный сценарий, включающий президента Америки и генерала Кастера.<br><br>Вождь краснокожих намерен преподать Биллу хороший урок, показав, что нельзя унижать достоинство истории посредством дешевой мелодрамы.','$6 000 000'),(7767,'Повелитель',1975,83,0.0,6.9,114,'1977-10-08','https://st.kp.yandex.net/images/film_iphone/iphone360_7767.jpg','Overlord','История 21-летнего новобранца, прошедшего путь от призывного пункта до линии фронта в день высадки союзных войск у берегов Нормандии.','Нет данных'),(7768,'Ученичество Дадди Крэвица',1974,120,0.0,6.4,83,'1974-04-11','https://st.kp.yandex.net/images/film_iphone/iphone360_7768.jpg','The Apprenticeship of Duddy Kravitz','Дадди — дотошный еврейский мальчик, мечтающий разбогатеть. По ходу осуществления своей цели он теряет все личные контакты с женщинами, друзьями и даже родными.','Нет данных'),(7769,'Отдаленный гром',1973,101,0.0,6.6,146,'1973-07-03','https://st.kp.yandex.net/images/film_iphone/iphone360_7769.jpg','Ashani Sanket','Действие фильма происходит в деревне в провинции Бенгалия в Индии в годы Второй мировой войны. Фильм демонстрирует последствия Великого голода 1943 года в деревнях Бенгалии глазами молодого брахмана доктора и учителя Гангачарана и его жены Анаги. Режиссер картины Рей демонстрирует масштабы катаклизма, который унес жизни более трех миллионов человек. События в фильме происходят неторопливо, что характерно для деревенской жизни, но в тоже время постепенно обнажают крах традиционных деревенских норм вследствие голода и недостатка пищи.','Нет данных'),(7770,'Кентерберийские рассказы',1971,124,0.0,6.9,1891,'1972-07-02','https://st.kp.yandex.net/images/film_iphone/iphone360_7770.jpg','I racconti di Canterbury','Действие картины развивается в средневековой Англии на постоялом дворе. В этом фильме режиссер сыграл роль Чосера, который является одним из слушателей четырех новелл, рассказанных путниками. Все новеллы картины пропитаны духом сладострастья и эротики, простотой нравов и юмором средневековой Англии.','Нет данных'),(7771,'Сад Финци-Контини',1970,94,0.0,6.7,495,'1970-12-02','https://st.kp.yandex.net/images/film_iphone/iphone360_7771.jpg','Il giardino dei Finzi Contini','История любви юноши из скромной еврейской семьи к красивой и своенравной девушке из богатой аристократической и тоже еврейской семьи. Северо-итальянский город Феррара, предвоенная фашистская Италия. Правительство дуче Бенито Муссолини принимает так называемые «расистские законы», ущемляющие права итальянских евреев. Но законы строги не ко всем, они допускают исключения для лиц, имеющих «заслуги перед Родиной и фашистами». И кто-то вступает в партию, кто-то жертвует значительные суммы правительственным организациям, получая взамен несколько лет относительного покоя, возможность жить, любить и надеяться на счастье.','Нет данных'),(7772,'Ранние работы',1969,87,0.0,6.4,191,'1969-10-20','https://st.kp.yandex.net/images/film_iphone/iphone360_7772.jpg','Rani radovi','Фильм повествует о группе молодых людей, мечтающих о настоящей революции и абсолютной свободе.','Нет данных'),(7773,'Эне, бене, рес',1968,110,0.0,6.8,158,'1968-03-18','https://st.kp.yandex.net/images/film_iphone/iphone360_7773.jpg','Ole dole doff','Слабый и измученный учитель доведен до предела своими несносными учениками.','Нет данных'),(7774,'Старт',1967,93,0.0,6.9,324,'1967-09-22','https://st.kp.yandex.net/images/film_iphone/iphone360_7774.jpg','Le départ','Первый фильм, снятый Сколимовским за границей. Главный герой, девятнадцатилетний юноша Марк, трудится подмастерьем в брюссельской парикмахерской, но больше всего на свете мечтает принять участие в автомобильных гонках. Одна из таких гонок как раз намечается через два дня, и Марк вписывает свое имя в реестр участников. Есть лишь одна небольшая проблема: у него нет машины. Марк идет на самые разные ухищрения, чтобы раздобыть автомобиль к нужному сроку. За несколько часов до старта Марк и его подруга останавливаются в мотеле, чтобы немного вздремнуть, и просыпают начало гонки.','Нет данных'),(7775,'Тупик',1966,113,0.0,7.5,2767,'1966-06-02','https://st.kp.yandex.net/images/film_iphone/iphone360_7775.jpg','Cul-de-sac','Скрывающиеся от правосудия преступники пытаются найти приют в уединенном замке на морском берегу, где живут в прошлом коммерсант, а ныне — чудаковатый художник, Джордж и его жена Тереза. Один из негодяев, Ричард, слегка ранен в руку, а вот у Альберта дела плохи — ему прострелили живот. Несмотря на свое плачевное состояние, бандиты берут обитателей замка в заложники.','Нет данных'),(7776,'Альфавиль',1965,99,0.0,7.3,4430,'1965-05-05','https://st.kp.yandex.net/images/film_iphone/iphone360_7776.jpg','Alphaville, une étrange aventure de Lemmy Caution','Альфавиль — тоталитарное общество, находящееся в миллионах световых лет от нашей планеты и управляемое электронным Альфа-мозгом. Создал его сбежавший с Земли профессор Носферату, скрывающийся здесь под именем фон Браун.<br /><br />На Земле опасаются инопланетного вторжения, поэтому частный детектив Лемми Кошен получает задание — вернуть назад или убить профессора. Прибыв на место, Лемми влюбляется в его дочь Наташу…','$220 000'),(7777,'Засушливое лето',1963,90,0.0,6.0,113,'1963-12-16','https://st.kp.yandex.net/images/film_iphone/iphone360_7777.jpg','Susuz Yaz','Маленькая турецкая деревушка неподалеку от Эгейского моря. Здесь выращивают табак и это единственный способ обеспечить своё существование. Главными ценностями в этом регионе являются не деньги, а вода и женщины. Воду здесь называют кровью земли, ибо пресная вода — редкий гость этого региона, а женщин гораздо меньше, чем мужчин. В таком вот обществе в очень засушливое лето разворачивается трагическая история двух братьев. Осман, старший брат, обнаруживает на своем участке источник пресной воды. Постепенно он его разрабатывает и пускает течение вниз, в остальную часть деревни, помогая своим соседям. <br /><br />Всё бы хорошо, но в один день в его голову взбрела мысль перекрыть источник и собирать воду в самодельные резервуары, а своих соседей оставить без надежды на будущее. Как говорил сам Осман: они получат её только после того, как он накопит нужное, по его мнению, количество воды для себя. Его брат Хасан выступает резко против такого решения, но ничего не может поделать, ибо по мусульманским традициям обязан слушаться своего старшего брата. Постепенно ситуация накаляется и соседи начинают действовать: сначала то были обычные угрозы, затем начались попытки навредить Осману и его хозяйству. В результате одной из таких вылазок Осман убивает одного из жителей деревни. Но и тут он выходит чистым из воды: старший брат уговаривает младшего взять вину на себя, ибо ему меньше дадут и он быстрее сможет выйти из тюрьмы. Однако Хасану дают восемь лет, и за эти годы его старший брат совсем забудет о родственнике, а также начнёт активно ухлестывать за его молоденькой женой и продолжать ссориться с соседями…','Нет данных'),(7778,'Повесть о жестоком Бусидо',1963,122,0.0,6.9,129,'1963-04-28','https://st.kp.yandex.net/images/film_iphone/iphone360_7778.jpg','Bushidô zankoku monogatari','История самурайской семьи Иигура с начала XVII века по 1960-е годы. Потомок рода рассказывает о судьбе своих предков и их приверженности самурайскому кодексу бусидо: о чести, верности и тяжелой судьбе самураев, вынужденных жертвовать своей жизнью и счастьем близких во имя долга и преданности своему господину.','Нет данных'),(7779,'Такого рода любовь',1962,107,0.0,6.8,228,'1962-04-12','https://st.kp.yandex.net/images/film_iphone/iphone360_7779.jpg','A Kind of Loving','Вик Браун — фабричный чертёжник из Ланкашира, на свадьбе своей сестры знакомится с Ингрид Ротуэлл, работающей машинисткой на той же фабрике. Ингрид серьезно влюбляется в Вика, он же скоро теряет к ней интерес. Беременность, однако, приводит к вынужденному браку и жизни вместе с миссис Ротуэлл — высокомерной и деспотичной женщиной. После того как у Ингрид происходит выкидыш, Вик начинает понимать, что поторопился с женитьбой. Запутавшаяся пара пытается разобраться в своих отношениях и понять, возможна ли «такая вот любовь».','Нет данных'),(7780,'Ночь',1961,115,0.0,8.1,8186,'1961-01-24','https://st.kp.yandex.net/images/film_iphone/iphone360_7780.jpg','La notte','Писатель — Джованни, его супруга — Лидия… Потемки творческого кризиса… Закат чувств… Сумерки привычек… Больница, близкий друг, погружающийся в «ночь»… Бессильные поиски просвета: тьма воспоминаний, ночной ресторан, богатая ночная вечеринка… Юная Валентина со своей маленькой «ночью» в душе… Утренний «ливень» отчаяния, откровений, откровенности, которые может быть…  ','Нет данных'),(7781,'Ласарильо из Тормеса',1959,114,0.0,5.7,74,'1959-11-16','https://st.kp.yandex.net/images/film_iphone/iphone360_7781.jpg','El Lazarillo de Tormes','Фильм основан на анонимном романе 16 века. История мальчика Ласарио, рожденного в бедной семье и отданного матерью слепому нищему после того, как отец мальчика, вор, умирает. Слепой был лишь первым из многочисленных хозяев мальчика, и Ласарио приходится хитрить и изворачиваться, чтобы выжить.','Нет данных'),(7782,'Кузены',1959,112,0.0,7.6,813,'1959-03-11','https://st.kp.yandex.net/images/film_iphone/iphone360_7782.jpg','Les cousins','Шарль приезжает из деревни в Париж и вслед за двоюродным братом Полем поступает в университет на юридический факультет. Поначалу братьям нравилось совместное времяпровождение, многолюдные вечеринки, но их дружба оказывается не столь крепкой…','FRF 6 000 000'),(7783,'Крысы',1955,97,0.0,5.4,73,'1955-07-06','https://st.kp.yandex.net/images/film_iphone/iphone360_7783.jpg','Die Ratten','Беременную девушку из Восточной Германии бросает ее любовник. Когда ребенок родился, она отдала его другой женщине, которая хотела ребенка уже долгое время, но не могла зачать. Это расчищает сцену для конфликта между двумя женщинами из-за ребенка.','Нет данных'),(7784,'Выбор Хобсона',1953,107,0.0,7.6,420,'1954-02-26','https://st.kp.yandex.net/images/film_iphone/iphone360_7784.jpg','Hobson\'s Choice','Гарри Хобсон — процветающий провинциальный сапожник. Он вдовец и главная его забота — растить трех дочерей. Хобсон решает, что позволит двум младшим дочерям выйти замуж, с условием, что старшая, Мэгги, должна будет остаться дома, чтобы заботиться о нем. Но Мэгги не согласна с решением отца и делает все возможное, чтобы переубедить его и жить своей жизнью…','Нет данных'),(7785,'Она танцевала одно лето',1951,103,0.0,6.2,174,'1951-12-17','https://st.kp.yandex.net/images/film_iphone/iphone360_7785.jpg','Hon dansade en sommar','Студент Йорен проводит каникулы на ферме своего дяди. В первый день он встречает 17-летнюю Шерстин, которая живет на ферме поблизости. Молодые люди влюбляются друг в друга, но и родственники Шерстин, и отец Йорена против их отношений…','Нет данных'),(7788,'Колдун',2001,112,0.0,7.1,548,'2001-10-06','https://st.kp.yandex.net/images/film_iphone/iphone360_7788.jpg','Onmyoji','Япония, X век. В царстве вечного благоденствия простые смертные соседствуют с жестокими демонами и призраками, и лишь могущественные колдуны из древнего клана придворных прорицателей способны защитить императора и его подданных от потустороннего зла.<br><br>Но когда алчные заговорщики решают с помощью черного мага Досона свергнуть своего властителя, даже они не подозревают, как опасна неведомая сила заклятий в руках коварного чародея. Его ужасные деяния вселяют ужас в сердца людей, и теперь только великий колдун Сэймей, непревзойденный знаток мистических знаний и чудодейственных обрядов, сможет бросить вызов Досону, стремящемуся ввергнуть империю в хаос мрака и смерти.','Нет данных'),(7790,'Птицы',2001,98,0.0,8.1,5681,'2001-12-12','https://st.kp.yandex.net/images/film_iphone/iphone360_7790.jpg','Le peuple migrateur','Этот сенсационный фильм — зрелище настолько завораживающее, что никакие спецэффекты не смогли бы передать невообразимую реальность происходящего. Работа операторов поистине уникальна — впервые в истории кино птиц снимали непосредственно во время полета.<br><br>Чтобы запечатлеть сезонные миграции главных героев, была максимально усовершенствована съемочная техника, ведь снимать пришлось и в арктическом холоде, и в болоте, и в тумане, а главное — были разработаны сверхлегкие летательные аппараты, способные летать со скоростью и на высоте птиц. Над фильмом работало около 500 человек из разных стран мира, съемки заняли целых три года.','FRF 160 000 000'),(7793,'Благословенно Ваш',2002,125,0.0,6.2,319,'2002-05-16','https://st.kp.yandex.net/images/film_iphone/iphone360_7793.jpg','Sud sanaeha','Минь — нелегальный бирманский иммигрант, его подружка Рун работает на фабрике керамических сувениров, а Орн помогает Рун ухаживать за Минем, который страдает от непонятной сыпи на коже. Однажды им случилось провести ленивый летний день в прекрасных таиландских джунглях.','Нет данных'),(7796,'Рискованные планы',2001,91,0.0,5.9,82,'2002-05-05','https://st.kp.yandex.net/images/film_iphone/iphone360_7796.jpg','Beyond the City Limits','Пара отвязных русских бандитов собирается ограбить крупное казино, однако их планы рушатся, когда гибнут их сообщники — коррумпированные полицейские.<br><br>Кажется, что их замысел уже никогда не осуществится, но тут в дело вмешиваются их отчаянные подружки Миша и Лекси, которые решают разбогатеть без помощи своих глуповатых парней. Обзаведясь оружием и помощниками, они готовы рискнуть жизнью ради богатства, о котором они могли только мечтать.','Нет данных'),(7798,'Зажигание',2001,99,0.0,5.7,97,'2001-11-12','https://st.kp.yandex.net/images/film_iphone/iphone360_7798.jpg','Ignition','Федеральный судья Фэйт Мэттис готовится к самому «взрывному» процессу в своей карьере — делу о коррупции в высших военных кругах. После покушения на жизнь Фэйт к ней приставляют телохранителя — бывшего сержанта корпуса морской пехоты Конора Галлахера. Вместе расследуя исчезновение важного свидетеля, они приоткрывают завесу тайны над преступной операцией по контрабанде оружия и наркотиков, возглавляемой генералом МакЭйтиром. Ставки в игре подняты на самый высокий уровень. Фэйт и Конор оказываются втянутыми в смертельно опасную сеть заговоров, предательств и убийств…','Нет данных'),(7814,'Семейные ценности',2003,109,0.0,6.3,534,'2003-04-25','https://st.kp.yandex.net/images/film_iphone/iphone360_7814.jpg','It Runs in the Family','Проблема отцов и детей — проблема интернациональная. Отличаются лишь взгляды и варианты решения. Свой рецепт предлагает чета Дугласов.<br><br>Фильм повествует о семействе, члены которого — очень разные люди (от преуспевающего юриста до юного бунтаря) и им порой бывает очень непросто найти общий язык. Тем не менее, они пытаются это делать.','Нет данных'),(7819,'Маниакальный',2001,100,0.0,7.2,1910,'2001-01-27','https://st.kp.yandex.net/images/film_iphone/iphone360_7819.jpg','Manic','Лайл Дженсен подвержен внезапным и жестоким вспышкам гнева. После одной из таких вспышек, во время которой он серьезно покалечил своего одноклассника, его отправили на лечение в юношеское отделение Нортвудской психиатрической лечебницы. Там же находятся другие подростки с множеством серьезных проблем. У Лайла по-разному складываются взаимоотношения с пациентами и персоналом — с кем-то дружеские и человечные, с кем-то не такие уж человечные.','Нет данных'),(7823,'Любовь, которая жмет...',2002,135,0.0,7.2,157,'2002-02-08','https://st.kp.yandex.net/images/film/7823.jpg','Piedras','Эта современная философская сказка расскажет лирическую историю пяти женщин, которые отчаянно ищут свою идеальную пару, чтобы рука об руку, шаг за шагом перейти пустыню одиночества. Но порой в реальной жизни Золушка находит не свою туфельку.<br><br>Любовь — то, что делает осмысленным даже бесконечный путь. То, что заставляет сделать шаг и в отсутствие дороги. Но слишком часто она не подходит путнику, как неправильно выбранная обувь, и тогда больбезнадежным камнем прикалывает идущего к земле, как мертвую бабочку.','Нет данных'),(7832,'Глаз',2002,99,0.0,6.6,3406,'2002-05-09','https://st.kp.yandex.net/images/film_iphone/iphone360_7832.jpg','Gin gwai','Мунь ослепла в два года. В двадцать ей трансплантировали роговицу и восстановили зрение, но девушка стала жертвой необъяснимых явлений — теперь таинственные фигуры преследуют её неотступно.','SGD 4 500 000'),(7839,'Лисистрата',2002,89,0.0,5.5,66,'2002-09-13','https://st.kp.yandex.net/images/film_iphone/iphone360_7839.jpg','Lisístrata','Тридцать лет тянется изматывающая Пелопонесская война между Афинами и Спартой. Красавица Лисистрата, полная решимости остановить бессмысленную войну, собирает женщин со всей Греции и предлагает им дать клятву не подпускать к себе мужчин до тех пор, пока не будет заключен мир между городами. Они укрываются в Акрополе и не допускают туда никого. Теперь выбор за мужчинами…','Нет данных'),(7843,'След от поцелуя на щеке',2002,123,0.0,7.0,121,'2002-02-14','https://st.kp.yandex.net/images/film_iphone/iphone360_7843.jpg','Kannathil Muthamittal','История девочки Амудхи. Гражданская война в Шри-Ланке лишила её родителей, её удочерила и вырастила молодая пара из Индии. Амудха, умная и упрямая девочка, росла в любви и заботе в Ченнае, однако её жизнь перевернулась, когда ей исполнилось 9 лет. Её родители решили сообщить ей о её прошлом. Несмотря на то, что её индийские родители так же, как и прежде, продолжают любить её, она упорно желает встретиться со своей настоящей мамой. В маленькой головке Амудхи созревает множество вопросов, которые не дают покоя ей и её родителям. Тогда её отец даёт ей обещание найти её настоящую мать, несмотря на риск оказаться убитым от шальной пули в Шри-Ланке.','Нет данных'),(7845,'Завороженный',2002,97,0.0,5.5,132,'2002-03-14','https://st.kp.yandex.net/images/film_iphone/iphone360_7845.jpg','Spellbound','В фильме рассказывается о восьми подростках, стремящихся одержать победу на национальном конкурсе по правописанию 1999 года.','Нет данных'),(7854,'Возвращение кота',2002,75,0.0,7.8,15106,'2002-07-19','https://st.kp.yandex.net/images/film_iphone/iphone360_7854.jpg','Neko no ongaeshi','В разгар дня на оживленной улице юная Хару храбро выхватывает из-под колес грузовика очаровательного кота. К ее великому удивлению, кот встает на задние лапы и благодарит Хару на человеческом языке. Оказывается, перед ней принц из загадочного Кошачьего царства, и теперь могущественный Кошачий царь хочет женить его на отважной спасительнице. <br><br>Вскоре он похищает Хару, которая вовсе не желает быть кошачьей принцессой, и только верные усатые и хвостатые друзья — толстый бродяга Мьюта и великолепный Барон смогут вызволить ее из кошачьего плена.','Нет данных'),(7855,'Танцующая наверху',2002,132,0.0,6.6,504,'2002-01-11','https://st.kp.yandex.net/images/film_iphone/iphone360_7855.jpg','The Dancer Upstairs','Офицер полиции Аугустин Рехас пытается выйти на след лидера подпольной марксистской группировки Эзекила.<br><br>Эти поиски, которые он ведет уже 12 лет, приводят Рехаса к встрече с Иоландой, учительницей танцев, которая изменяет всю его жизнь…','Нет данных'),(7860,'Болгарские любовники',2003,101,0.0,5.6,77,'2003-02-13','https://st.kp.yandex.net/images/film_iphone/iphone360_7860.jpg','Los novios búlgaros','Это фильм о жизни и любви успешного мадридского адвоката Даниэля. Он ищет свой идеал — красивого, мускулистого, волосатого парня. И однажды он встречает Кирилла — молодого болгарина, который ему очень понравился. Но Кирилл — бисексуал, он даже не целуется с мужчинами, хотя в постели он — бог. А по жизни — альфонс. Его устраивает, что Даниэль за секс может его содержать. Вначале все сводится только к сексу на коммерческой основе, но потом, побывав в семье своего любовника, герой понимает, что он влюблен…','Нет данных'),(7864,'Ангел из будущего',2002,95,0.0,7.6,394,'2002-08-10','https://st.kp.yandex.net/images/film_iphone/iphone360_7864.jpg','An Angel for May','История современного мальчика Тома и его собаки, живущих в Йоркшире, в Англии, которые вдруг переместились в начало 40-х. В прошлом Том оказался на ферме Сэма Виллера. Хозяин фермы, живущий со взрослой дочерью, опекает помешанную бродяжку по имени Мэй, которую извелкли из под обломков разрушенного бомбой дома.<br><br>Под развалинами погибла вся ее семья, и с тех пор Мэй спала на улице вместе с собакой, отказываясь заходить в дом даже для еды. Однако после общения с Томом ее состояние стало улучшаться. Тем временем Том всеми силами пытается вернуться в свое время. Но вернувшись, он понимает, что в прошлом осталось что-то очень важное для него..','Нет данных'),(7883,'Человек с поезда',2002,90,0.0,7.0,1262,'2002-09-03','https://st.kp.yandex.net/images/film_iphone/iphone360_7883.jpg','L\'homme du train','Человек выходит из поезда. Это Милан. У него потрепанный и изнуренный вид. Случайное знакомство на улице с неким Маскье, бывшим школьным учителем, может изменить их ближайшие планы.<br><br>Абсолютно непохожие, они всегда мечтали только об этом: прожить не свою, а чужую жизнь. Милан, приехавший в провинциальный городок для ограбления банка, бредит домашним уютом. Благополучный Маскье жаждет бурных событий. На размышление и выбор им дано всего три дня…','Нет данных'),(7886,'Поездка',2002,95,0.0,6.9,152,'2002-05-05','https://st.kp.yandex.net/images/film_iphone/iphone360_7886.jpg','The Trip','Романтическая история о взаимоотношениях двух мужчин, начиная с их первой встречи еще подростками в 1973 году и до 1984 года. Время было горячее — как раз в 70-е годы радикальные политические и геевско-лесбийские круги вступили в противоборство с консервативно настроенным истеблишментом.<br><br>На одной из вечеринок в Лос Анжелесе Томми — симпатичный блондин и один из гей-активистов — обращает внимание на Алана, мускулистого молодого журналиста — республиканца. Алан работает над своей первой книгой, посвященной теме гомосексуальности, и приглашает Томми на ужин, чтобы взять у него интервью для книги. Вскоре между ними возникает больше, чем просто дружба.','Нет данных'),(7893,'Милые шестнадцать лет',2002,106,0.0,6.6,662,'2002-05-21','https://st.kp.yandex.net/images/film_iphone/iphone360_7893.jpg','Sweet Sixteen','История Лиама, стоящего накануне 16-летия. Мать его сидит в тюрьме, отчим и дед торгуют наркотиками, сестра — всего лишь на пару лет старше Лиама воспитывает одна малыша-сына.<br /><br />Колючий, непокорный подросток месяцами не ходит в школу, и, стремясь вырвать мать из зависимости от злодея-отчима, решает заработать денег. Путь к деньгам в этом захолустном, погрязшем в безработице, наркомании и преступности городке один — та же торговля наркотиками.','Нет данных'),(7894,'Свадебная вечеринка',2003,98,0.0,6.7,6716,'2003-05-19','https://st.kp.yandex.net/images/film_iphone/iphone360_7894.jpg','The In-Laws','Крутой агент ЦРУ во время секретной операции узнает, что его сын повзрослел и решил жениться. Он бросает все и летит на встречу с новыми родственниками. С этого момента жизнь мирного врача — отца невесты превращается в шпионский боевик: международные террористы и колумбийские контрабандисты, роковые красотки и большие-большие деньги, автомобильные погони и гонки на воде, свист пуль и визг тормозов… Ничто не может остановить папаш, когда свадьба их детей под угрозой!','Нет данных'),(7897,'Бешеная',2000,89,0.0,5.7,145,'2000-11-01','https://st.kp.yandex.net/images/film_iphone/iphone360_7897.jpg','Wilder','Делла Уайлдер — женщина-полицейский, острая на язык и с крутым нравом. Вместе со своим напарником она расследует преступление, которое на первый взгляд кажется простым: убийство доктором Сэмом Чейни своей пациентки и любовницы.<br><br>Однако в ходе расследования, между Деллой и Сэмом возникают «особые» отношения, а в деле выясняется ряд неожиданных обстоятельств, которые подвергают их смертельной опасности.','Нет данных'),(7898,'Могильщик Гейси',2003,85,0.0,4.9,839,'2003-05-13','https://st.kp.yandex.net/images/film_iphone/iphone360_7898.jpg','Gacy','История одного из самых знаменитых американских серийных убийц Джона Уэйна Гейси, серийного маньяка, также известного как «убийца-клоун». Бывший полицейский Джон Уэйн Гейси живет в небольшом городке в штате Иллинойс. Он респектабельный и уважаемый всеми человек. Джон женат, работает менеджером торговой точки и нанимает подростков для выполнения сдельной работы. Соседи часто наведываются в гости к Гейси. Все в доме Джона хорошо, за исключением странного запаха, доносящегося из подвала…','$250 000'),(7900,'Дракула: Страницы из дневника девственницы',2002,73,0.0,6.6,227,'2002-02-28','https://st.kp.yandex.net/images/film_iphone/iphone360_7900.jpg','Dracula: Pages from a Virgin\'s Diary','Балетная версия истории о легендарном вампире. Дракула прибывает в викторианскую Англию, где кладёт глаз на юную девицу, у которой появляются серьёзные защитники во главе с доктором Ван Хельсингом.','CAD 1 600 000'),(7901,'Клетка для братвы',2002,84,0.0,6.9,183,'2001-06-08','https://st.kp.yandex.net/images/film_iphone/iphone360_7901.jpg','Friends and Family','Стивен и Дэнни — супружеская пара из Манхэттена, у которой есть все, что нужно для семейного счастья: шикарный дом, добрые друзья и куча денег. Но предстоящий визит родителей Стивена ставит все с ног на голову. И дело вовсе не в том, что Стивен и Дэнни — «голубые». Родители прекрасно об этом знают.<br><br>Дело в том, что Стивен и Дэнни работают киллерами у дона Виктора Патрицци, нью-йоркского босса мафии. А родители думают, что Стивен и Дэнни руководят компанией по доставке готовых блюд. Чтобы поддержать родительское «заблуждение» им предстоит организовать торжественный обед в честь дня рождения отца Стивена. Есть лишь одна небольшая проблема: наша «сладкая парочка» не умеет готовить и понятия не имеет о том, как нужно сервировать банкеты.<br><br> И тогда на помощь Стивену и Дэнни приходят их коллеги-мафиози.','Нет данных'),(7902,'Испанка',2002,122,0.0,7.2,5237,'2002-05-17','https://st.kp.yandex.net/images/film_iphone/iphone360_7902.jpg','L\'auberge espagnole','Заскучав в родном Париже, молодой Ксавье отправляется в удивительную и непредсказуемую Барселону, куда съезжаются студенты со всей Европы. Поселившись в маленькой квартирке вместе с шумным итальянцем, деловой англичанкой, дотошным немцем, жгучей испанкой и неутомимым датчанином, он намерен учиться и только учиться.<br><br>Однако вскоре он понимает, что в такой веселой компании его непременно ждут неожиданные и забавные приключения, а может быть, даже головокружительная любовь!','€5 300 000'),(7905,'Покемон 5: Герои',2002,71,0.0,5.9,598,'2002-07-13','https://st.kp.yandex.net/images/film_iphone/iphone360_7905.jpg','Gekijô-ban poketto monsutaa: Mizu no Miyako no Mamori Gami Ratiasu to Ratiosu','Самым красивым городом на свете считается столица воды, Арутомару. Здесь Эш и Пикачу случайно встречают Покемонов, обладающих таинственными способностями — Латиас и Латиос. Тайно находясь в этом городе, они незримо охраняют сокровище «Каплю сердца». Всемирно известные воры, Заннаа и Риона стремятся завладеть этим сокровищем. Заннаа и Риона вызывают события благодаря которым весь город может быть разрушен, и в которые оказываются вовлечены Эш и его друзья.','Нет данных'),(7907,'Море',2002,109,0.0,6.6,260,'2002-09-06','https://st.kp.yandex.net/images/film_iphone/iphone360_7907.jpg','Hafið','Чувствуя приближение старости, Тордур, глава семейства, попросил всех своих детей приехать в деревню, чтобы обсудить дальнейшую судьбу семейного бизнеса, работу всей своей жизни. Его надежды связаны с младшим сыном — Аугустом, который уехал в Париж изучать бизнес. Но отец не знает, что Аугуст мечтает стать композитором.','Нет данных'),(7908,'В поисках Немо',2003,101,0.0,7.9,193668,'2003-05-30','https://st.kp.yandex.net/images/film_iphone/iphone360_7908.jpg','Finding Nemo','Среди прекрасных тропических морских стихий, в районе Большого барьерного рифа в уединении живет рыба-клоун по имени Марлин. Он растит своего единственного сыночка Немо. Океан и существующие в нем опасности очень страшат Марлина, и он как может ограждает сына от них, но молодой Немо, страдающий излишним любопытством, очень хочет разузнать побольше о таинственном рифе, рядом с которым они живут.<br><br>Когда Немо по иронии судьбы оказывается вдалеке от дома, да и еще сталкивается с угрозой стать обедом рыбы-танка, Марлин отправляется на поиски сына. Но Марлин, конечно же, понимает, что героический спасатель из него не получится и просит о помощи в поисках, Дори — королевскую синюю рыбу, которая хоть и страдает от того, что почти ничего не помнит, но добрее ее не отыскать во всем безбрежном океане!','$94 000 000'),(7910,'Ангел мести',2002,96,0.0,6.8,4756,'2002-08-30','https://st.kp.yandex.net/images/film_iphone/iphone360_7910.jpg','Avenging Angelo','Красивая и богатая Дженнифер Баррэтт к своему ужасу узнаёт, что на самом деле она — дочь недавно убитого главаря мафии Анджело Аллигьери. Теперь ей достались в наследство его верный телохранитель Фрэнки и уйма мрачных типов, мечтающих сквитаться с родней своего извечного врага.<br><br>Чтя клятву, данную боссу, бесстрашный Фрэнки незримо защищает Дженнифер от наемных головорезов, не предполагая, что знойная красавица уже придумывает хитроумный план мести убийцам ее отца.','$17 000 000'),(7912,'Валентин',2002,86,0.0,7.6,238,'2002-09-29','https://st.kp.yandex.net/images/film_iphone/iphone360_7912.jpg','Valentín','9-летний Валентин живет с бабушкой, потому что мама давно ушла от него, а отец вечно бегает по делам или за смазливыми девицами. Страдая от одиночества, Валентин мечтает стать космонавтом.<br><br>Вместе со своим лучшим другом Роберто он без устали тренируется, и только ему он может признаться, как он тоскует по настоящей семье.<br><br>Кажется, никто не хочет говорить с мальчиком о прошлом, но когда бабушка Валентина умирает, он понимает, что теперь ему придется самому искать ответы на все свои вопросы…','Нет данных'),(7913,'Пятница, вечер',2002,90,0.0,5.9,251,'2002-08-31','https://st.kp.yandex.net/images/film/7913.jpg','Vendredi soir','Став беспомощной жертвой одной из бесконечных парижских пробок, Лора думает лишь о своем будущем супруге, к которому она завтра переедет, покончив со своей одинокой жизнью. Вдруг, повинуясь внезапному порыву, она разрешает странному прохожему сесть в ее машину.<br><br>Жан серьезен и немногословен, но в пятницу вечером, когда в воздухе витает любовь, Лора не боится поддаться чарам своего загадочного попутчика. Что их ждет в ближайшие часы — незабываемое романтическое приключение или мимолетный роман в дешевом отеле?','Нет данных'),(7916,'Дыхание',2002,90,0.0,6.8,213,'2002-05-20','https://st.kp.yandex.net/images/film_iphone/iphone360_7916.jpg','Respiro','На маленьком сицилийском островке Лампедуза живёт семья — отец-рыбак, мать-учительница и трое детей. На весь день Пьетро уходит в море, его дети чистят и упаковывают рыбу, а Грация, ещё молодая и очень красивая женщина, задыхается в этом удушающем, зловонном пространстве. Чем больше она пытается вырваться за рамки унылой повседневности, тем больше её поведение кажется вызывающим. Жители Лампедузы распускают слух, что Грация нездорова, и Пьетро собирается поместить её в миланскую психиатрическую клинику. Лишь Паскуале, сын Грации, единственный, кто понимает мать и пытается противостоять отцу в его опрометчивом решении…','Нет данных'),(7920,'Захват Фридманов',2003,107,0.0,6.4,560,'2003-01-17','https://st.kp.yandex.net/images/film_iphone/iphone360_7920.jpg','Capturing the Friedmans','Фридманы были нормальной, среднего класса семьей, живущей в богатом Нью-Йоркском пригороде Грет Нек. Как-то раз в день благодарения, когда семья собралась в доме для праздничного обеда, их дверь внезапно разлетелась на куски и дом наполнился полицейскими. Они обвинили Арнольда Фридмана и его младшего сына Джесси в сотнях шокирующих преступлений. Фильм описывет их историю взглядом со стороны и с помощью уникальных материалов, отснятых в семье Фридманов во время кризиса. Полицейское расследование и реакция общественности способствовали началу распада семьи и раскрытию всей правды о ней…','Нет данных'),(7928,'Демон скорости',2003,80,0.0,1.6,266,'2003-11-11','https://st.kp.yandex.net/images/film_iphone/iphone360_7928.jpg','Speed Demon','Мистический водила, на сверхзаряженной тачке преследует банду местных отморозков, которые уже несколько месяцев терроризируют местное население и полицию. В голове у молодых бандитов нет ничего кроме выпивки, наркотиков, денег и девок. Но однажды герой-одиночка садится на хвост банде и началось…','Нет данных'),(7930,'Оседлавший кита',2002,101,0.0,7.3,1090,'2002-09-09','https://st.kp.yandex.net/images/film_iphone/iphone360_7930.jpg','Whale Rider','Действие фильма связано с древнейшей легендой маори — о вожде древних времен Кахутиа Те Рани, который был спасен от мести своего завистливого брата Руатапу огромным китом по имени Паикеа. Кит унес героя на далекую землю Аотеароа, где Каху принял имя своего спасителя — Паикеа, осел и обзавелся семьей в местечке, впоследствии названном Уангара.<br><br>Много веков спустя вождь племени Уангара — Коро — считал свою жизнь законченной, так как у него нет наследников мужского пола, которые бы имели право носить имя «Оседлавшего кита». По обычаю племени вождем может быть только мужчина, причем он обязательно должен быть ребенком-первенцем у своих родителей. Его внук погиб вместе со своей матерью при родах близнецов, а его сын с горя покинул страну, оставив свою выжившую дочь на воспитание дедушки и бабушки.<br><br>Внучка Коро по имени Пай долго боролась с предрассудками своего деда относительно нее, и в конце концов решила доказать, что способна стать вождем, возглавить племя и носить гордое имя Паикеа. Для этого нужно совершить практически невозможное — овладеть боевым искусством предков, которое доступно только мужчинам, изучить древние заклинания, доказать, что ты обладаешь сильным духом, а еще, забраться на спину кита и прокатиться на виду у всех, оседлав океанского гиганта…','$3 500 000'),(7931,'Нация прозака',2001,95,0.0,6.8,6722,'2001-09-08','https://st.kp.yandex.net/images/film_iphone/iphone360_7931.jpg','Prozac Nation','Прозак — препарат, делающий жизнь человека счастливой. Она курит травку и учится в Гарварде. Она пишет лучшие музыкальные обзоры и публикуется в журнале «Rolling Stone». Она временами грустит, а иногда закатывает развеселые вечеринки. Она пьет шампанское из горлышка и срывается в крик на окружающих. Она обязательно станет знаменитой, ведь ее зовут Элизабет Вурцель. Надо только немного разобраться в своей жизни и пережить встречу с человеком, выписывающим рецепты на счастье…','$9 000 000'),(7932,'Горечь любви',2001,104,0.0,7.2,1523,'2001-08-08','https://st.kp.yandex.net/images/film_iphone/iphone360_7932.jpg','Love the Hard Way','Они не подходят друг другу: Джек — мелкий мошенник, зарабатывающий на жизнь грабежами в дорогих отелях, и Клер — студентка биологического факультета из Нью-Йорка, подрабатывающая в кинотеатре.<br><br>Их пути пересекаются, и вспышка эмоций, словно молния, поражает обе их жизни. Они влюбляются друг в друга, попадая в водоворот запретной страсти. Джек утянет с собой Клер в бездонную пропасть…','Нет данных'),(7933,'Леший',2005,96,0.0,4.3,2778,'2005-04-21','https://st.kp.yandex.net/images/film_iphone/iphone360_7933.jpg','Man-Thing','Молодой шериф Кайл Уильямс зря надеется, что в тихом городке Байуотер его ждет спокойная жизнь. Серия загадочных убийств заставляет его поверить, что в глухих болотах близ города кроется нечто таинственное, убивающее людей. Индейцы предупреждают Кайла, что в их краях пробудилась страшная древняя сила, но местный нефтяной магнат Шист, стремящийся прибрать к рукам бескрайние топи, не верит в мифы.<br> <br>По ночам из болот доносятся ужасающие стоны и крики, в воздухе нависла атмосфера гнетущего страха, и Кайл решает сам отправиться в топкую глушь на поиски истины. Там, в зловещем мраке вековых зарослей, его ждет роковая встреча с грозным хранителем диких болот…','$7 500 000'),(7934,'Сердце Америки',2002,87,0.0,6.3,1611,'2002-09-05','https://st.kp.yandex.net/images/film_iphone/iphone360_7934.jpg','Heart of America','В обычной средней школе в самом сердце Америки начинается последний день учебы. Для многих выпускников это праздник, но ребята подозревают, что для кого-то из них этот день станет последним днем их жизни. Ненависть, копившаяся в школьных стенах, скоро выплеснется наружу, и никто не сможет остановить тех, кто поклялся заглушить финальный звонок криками и грохотом выстрелов…','$3 000 000'),(7936,'Дракула 2: Вознесение',2002,85,0.0,5.1,1101,'2003-06-07','https://st.kp.yandex.net/images/film_iphone/iphone360_7936.jpg','Dracula II: Ascension','История о группе студентов-медиков, которые случайно наталкиваются на тело самого печально известного вампира. Когда появляется таинственный незнакомец и предлагает им 300 миллионов долларов за то, чтобы выставить его кровь на аукцион, они едва ли могут отказаться от такого предложения.<br><br>Соблазн богатства вступает в противоречие с невообразимым ужасом… Они еще не знают, что окажутся безжалостно преследуемыми убийцей вампиров из Ватикана.','$5 000 000'),(7945,'Девдас',2002,185,0.0,8.2,4462,'2002-05-23','https://st.kp.yandex.net/images/film_iphone/iphone360_7945.jpg','Devdas','Сын Заминдара Нарайяна Мукхерджи — Девдас вырос в мире, где богатство ценилось больше человеческой жизни. Его другом детства стала красивая девочка Паро и они весело жили в живописной деревне Тадж Сонапур. Казалось, весь мир существует только для двух детей, но семена страсти уже были посеяны. Мечты Паро были разбиты, когда Девдас уехал на учебу в Лондон.<br><br>И вот однажды Девдас вернулся в деревню уже взрослым мужчиной, воспитанным в традициях Запада. Паро все еще любит и ждет его, но разница между ними уже очевидна для всех. Но Девдас, даже понимая эту разницу, не мог устоять перед той, кто из его товарища по детским играм превратилась во взрослую женщину.<br><br>Семья Заминдара, сравнив статус двух семей, выбрала не в пользу Паро. Мучимая сознанием безысходности, Паро вверила свою судьбу единственному человеку, которого она когда-нибудь любила… Но Девдас не смог понять, что боль в глазах Паро — это и его боль. Он слишком поздно понял, что его чудовищная слабость и трусость убьют их любовь. Девдас пошел своей дорогой, ведущей к мучениями… сногсшибательной куртизанке Чандрамукхи, которая нашла в Девдасе то, по чему она тосковала долгие годы. Нельзя сказать, что он не любил ее, но блеск золота и звуки ситары отныне не казались ему великолепными…<br><br>Странная судьба Девдаса: его любили две прекрасные женщины, с одной из которых он не хотел связать судьбу, а его желанная не могла разделить свою судьбу с ним. Вечная сага о Радхе, Кришне и Мире — эхо отражения в жизнях Паро, Девдаса и Чандрамукхи.','INR 500 000 000'),(7949,'История любви',2002,91,0.0,7.2,5688,'2002-09-07','https://st.kp.yandex.net/images/film_iphone/iphone360_7949.jpg','Décalage horaire','В сутолоке огромного парижского аэропорта возможны самые удивительные события и невероятные встречи… Феликс спешит к любимой женщине. Роза убегает от нелюбимого мужчины. Он — преуспевающий бизнесмен, серьезный и молчаливый. Она — королева салона красоты, болтающая без умолку.<br><br>У них нет ничего общего, но пока все рейсы задержаны из-за забастовки, им придется составить друг другу компанию. Что сулит это странное знакомство двум непредсказуемым европейцам — скуку и головную боль или незабываемое романтическое приключение?','FRF 85 000 000'),(7950,'Сердце моё',2002,96,0.0,7.4,1805,'2002-09-06','https://st.kp.yandex.net/images/film_iphone/iphone360_7950.jpg','The Heart of Me','Лондон 1930 год. Две сестры Мэдлин и Дина. Одна выходит замуж за Рикки, другая влюбляется в него. Он позволяет себе с ней интрижку, не подозревая, какие последствия его ожидают в будущем.','$7 000 000'),(7954,'От Джастина к Келли',2003,90,0.0,4.4,237,'2003-06-20','https://st.kp.yandex.net/images/film_iphone/iphone360_7954.jpg','From Justin to Kelly','Келли и ее подружки Кайя и Алекса решают провести весенние каникулы на пляже в Майями. Туда же приезжают трое друзей — Джастин, Брендон и Эдди. После случайной встречи на пляже Келли и Джастин понимают, что влюбились друг в друга с первого взгляда. Но вот незадача — Джастин теряет номер телефона Келли, а Алекса собирается совершить подлость, отбив у Келли парня…','$12 000 000'),(7955,'Король муравьев',2003,102,0.0,6.0,550,'2003-06-13','https://st.kp.yandex.net/images/film_iphone/iphone360_7955.jpg','King of the Ants','Шон Кроули, перебивавшийся случайными заработками, наконец-то устроился на хорошо оплачиваемую работу в строительной фирме. Его даже представили владельцу компании и «по совместительству» гангстеру Рэю Мэттьюсу, который неожиданно попросил Шона убить одного слишком надоедливого адвоката за вознаграждение в 13 тысяч долларов.<br><br>И Шон не только согласился, но и выполнил заказ. Проблема лишь в том, что никто не собирается платить ему обещанные деньги. А если Шон станет «возникать», то его просто «раздавят, как муравья». Но все не так просто, как кажется Рэю. Теперь жизнь Шона обрела смысл и цель. Он открыл в себе свое истинное призвание в жизни — призвание убийцы — и готов сыграть с Рэем смертельную игру «в кошки-мышки».','Нет данных'),(7956,'Леденец любви',2004,64,0.0,6.1,171,'2004-11-21','https://st.kp.yandex.net/images/film/7956.jpg','LolliLove','Преуспевающая пара из Лос-Анджелеса решает заняться благотворительностью и организовывает кампанию по раздаче леденцов на палочке с воодушевляющими слоганами на обёртках бездомным. По их мнению, таким образом, они смогут вдохновить бездомных найти работу, перестать употреблять наркотики и даже угонять самолёты и взрывать дома.','$2 000'),(7957,'Легенда аллеи звезд',2003,94,0.0,6.6,71,'2003-06-17','https://st.kp.yandex.net/images/film_iphone/iphone360_7957.jpg','Mayor of the Sunset Strip','Легендарный Родни Бингенхаймер, знаменитый ди-джей лос-анджелесской радиостанции KROQ, «приемный сын» Сони и Шер, основатель уникальной дискотеки «English Disco», открывшей для британского рока дорогу в Штаты, — этот экстравагантный коротышка, «раскрутивший» карьеру молодого гения Дэвида Боуи, на протяжении 30 лет является «мессией» новой музыки в Америке.<br><br>Кумиры миллионов: Шер, Элис Купер, Дэвид Боуи, Кортни Лав, Мик Джаггер, Нэнси Синатра, Гвен стефании — признаются в любви своему лучшему другу, харизматичному Родни Бингенхаймеру, человеку, который помог прославиться многим британским группам и сольным исполнителям в Америке.','Нет данных'),(7958,'Темп',2003,83,0.0,5.5,250,'2003-06-10','https://st.kp.yandex.net/images/film_iphone/iphone360_7958.jpg','Tempo','Молодая американка Дженни приезжает в Париж и устраивается на работу в ювелирный магазин. В один из дней она знакомится с обаятельным и милым парнем Джеком и без памяти в него влюбляется. Дженни не подозревает, что у ее возлюбленного совсем не романтические планы на будущее…','Нет данных'),(7962,'Халк',2003,138,0.0,6.2,72354,'2003-06-17','https://st.kp.yandex.net/images/film_iphone/iphone360_7962.jpg','Hulk','Доктор Брюс Бэннер (ученый, работающий над изобретением новой бомбы) подвергся воздействию гамма-лучей и превратился в Халка — существо невероятной физической силы, которое в состоянии ярости становится огромным зеленым монстром.<br><br>Его преследуют военные под предводительством генерала Росса, ему приходится бежать через всю страну. В конце концов, у него возникает любовная история с генеральской дочкой Бетти…','$137 000 000'),(7966,'Бензин',2001,90,0.0,5.0,61,'2001-11-20','https://st.kp.yandex.net/images/film_iphone/iphone360_7966.jpg','Benzina','История любви двух молодых женщин, Стеллы и Элеоноры, находящихся на двух противоположных краях социальной лестницы. Одна — темноволосая Стелла — работает автомехаником. Вторая — блондинка Элеонора — происходит из богатой семьи. Но они любят друг друга и вместе управляют небольшой бензоколонкой в Италии и их идиллия продолжается до тех пор, пока не появляется мать Элеонор, крайне категорично настроенная против их союза… <br><br>Потом происходит такое, после чего девушки понимают, что им придется бежать, если они хотят оставаться вместе…','Нет данных'),(7971,'Синдбад: Легенда семи морей',2003,86,0.0,7.7,30831,'2003-06-22','https://st.kp.yandex.net/images/film_iphone/iphone360_7971.jpg','Sinbad: Legend of the Seven Seas','Мультфильм рассказывает об одном из многочисленных приключений известного аравийского моряка Синдбада. Приключение начинается тогда, когда Эрис, богиня Хаоса, крадет Книгу Мира, подставив тем самым Синдбада и сделав из него преступника.<br><br>Намеревающийся доказать свою невиновность, а также спасти жизнь своего лучшего друга Протеуса Шейпершифера, моряк отправляется в царство Эрис, кишащее ужасными монстрами, такими как гигантские скорпионы, змеи и 40-футовые птицы, сделанные из льда и снега.<br><br>Даже если Синдбад сможет обезвредить всех этих чудовищ, ему также придется иметь дело с магией Эрис, обладающей эффектом Яблока Раздора, которое имеет способность превратить друзей во врагов, когда оно брошено посреди них. Синдбаду помогает во всем Марина, подруга Протеуса.','$60 000 000'),(7972,'Бассейн',2002,102,0.0,6.9,9742,'2003-05-18','https://st.kp.yandex.net/images/film_iphone/iphone360_7972.jpg','Swimming Pool','Английская писательница Сара Мортон приезжает в поместье своего издателя, чтобы с головой окунуться в работу. Сара успевает написать только первые строки нового романа, как на виллу приезжает Жюли — дочь хозяина. Девушка постоянно пристаёт к Саре со своей болтовнёй, а по ночам приводит в свою спальню новых мужчин. Ситуация предельно накаляется, когда очередная «одноразовая» связь Жюли оборачивается трагедией.','Нет данных'),(7975,'Лига выдающихся джентльменов',2003,110,0.0,6.9,67895,'2003-07-11','https://st.kp.yandex.net/images/film_iphone/iphone360_7975.jpg','The League of Extraordinary Gentlemen','Прославленный авантюрист Аллан Куотермейн вступает в борьбу с международным террористом по прозвищу Фантом и за собой ведёт целый выводок столь же примечательных джентльменов — капитана Немо, вампиршу Мину Харкер, человека-невидимку Родни Скиннера, тайного агента американского правительства Тома Сойера, бессмертного Дориана Грэя и доктора Джекила, время от времени перерождающегося в мистера Хайда. Дело в том, что Фантом собирается захватить бразды правления миром в свои руки, и для этого ему нужно поссорить нации между собой, развязав войну миров. А наши выдающиеся герои совместными усилиями должны обезвредить бандита…','$78 000 000'),(7976,'Домохозяйка',2002,91,0.0,6.3,100,'2002-11-13','https://st.kp.yandex.net/images/film_iphone/iphone360_7976.jpg','Une femme de ménage','Звукорежиссер средних лет расстался с подругой и, взглянув однажды на свое захламленное жилище, решил обзавестись домработницей. Так в его квартире появляется юная дева, сначала эпизодически, затем постоянно.','Нет данных'),(7977,'Я захватываю замок',2002,111,0.0,6.9,982,'2003-01-11','https://st.kp.yandex.net/images/film_iphone/iphone360_7977.jpg','I Capture the Castle','30-е годы прошлого века, отдаленный уголок Англии. Семья 17-летней Кассандры Мортмэйн на грани банкротства, а старый фамильный замок, в котором она живет — на грани разрушения. Отец девушки, писатель Джеймс Мортмэйн отчаянно пытается повторять давний успех своего первого романа, хотя за последние 12 лет ему не удалось написать ни строчки.<br><br>На сестру Роуз, впрочем, как и на мачеху Топаз, последовательницу философии «натуристов», тоже нет никакой надежды. Спасение приходит в лице двух приехавших богатых молодых американцев — братьев Саймона и Нейла Коттонов — настоящих хозяев замка, доставшегося им по наследству.<br><br>Родители счастливы и очень рассчитывают выдать дочерей замуж за этих дальних родственников. Но так случается, что Кассандра безумно влюбляется в Саймона, уже помолвленного с ее сестрой…','$8 000 000'),(7978,'Нулевой километр',2000,108,0.0,6.4,80,'2000-06-30','https://st.kp.yandex.net/images/film_iphone/iphone360_7978.jpg','Km. 0','«Километр 0» — секс-фарс, рассказывающий о жизни людей, которые все волею судеб встречаются летним днем на нулевом километре в самом центре Мадрида. В фильме присутствуют несколько независимых сюжетных линий. <br><br>Молодой режиссер, встречает проститутку вместо сестры подруги… пожилая дама, которая платит молодому хастлеру вдруг узначет что он… учитель танцев, познакомившийся с парнем в чате встречает вовсе не его… Серджио — девственник, который собирается жениться, но случайно знакомится с геем… Случайные связи, упущенные связи, путаница, новые друзья, романтические свидания… обо всем этом поведает фильм.','Нет данных'),(7979,'Таксидермист',2002,101,0.0,6.3,391,'2002-05-21','https://st.kp.yandex.net/images/film_iphone/iphone360_7979.jpg','L\'imbalsamatore','В неаполитанском зоопарке двухметровый 22-летний парниша с открытой мальчишеской улыбкой познакомился с 50-летним карликом формата Дэнни Де Вито.<br><br>Карлик отрекомендовался таксидермистом и предложил парню работу подмастерья за баснословные деньги. Не подозревая, что карлик в него по уши влюблен, верзила переехал к нему жить. А потом привел девушку.','Нет данных'),(7982,'Настольная книга анархиста',2002,101,0.0,6.0,565,'2002-06-01','https://st.kp.yandex.net/images/film_iphone/iphone360_7982.jpg','The Anarchist Cookbook','Коммуна анархистов из Далласа, штат Техас, живущая спокойной и размеренной жизнью, взбудоражена действиями нового члена — полубезумного нигилиста Джонни Блэка. Он заявляет своим товарищам, что только одному ему известно, в чем суть анархии, и до каких пределов может дойти настоящий бунтарь в своем протесте. От привычной жизни не осталось и следа.','$2 500 000'),(7983,'Агент Джонни Инглиш',2003,84,0.0,6.7,35740,'2003-04-06','https://st.kp.yandex.net/images/film_iphone/iphone360_7983.jpg','Johnny English','История самого некомпетентного и недалекого Британского дипломата, которого только можно представить, которого ошибочно принимают за самого знаменитого и опасного шпиона Великобритании, Джонни Инглиша. Из-за этой путаницы герой оказывается вовлеченным в смертельную схватку с авторами очередного дьявольского плана.','$40 000 000'),(7984,'Неудачники',2002,105,0.0,5.7,236,'2002-10-03','https://st.kp.yandex.net/images/film_iphone/iphone360_7984.jpg','Garage Days','Пиршество современных технологий, столь характерное для Алекса Пройаса, многих отталкивает, а многих берет за горло. Новая работа мастера параноидальных фантазий лежит в совершенно иной плоскости: феноменально талантливый режиссер возвращается в город своей юности — Сидней.<br><br>Именно там развернется действие, трогательного посвящения взрывному панк-року и простецким развлечениям молодых музыкантов…','$6 000 000'),(7985,'9 мёртвых геев',2002,79,0.0,5.9,212,'2002-10-18','https://st.kp.yandex.net/images/film_iphone/iphone360_7985.jpg','9 Dead Gay Guys','Комедия о двух друзьях ирландцах, приехавших в Лондон в рассчёте на «улицы, вымощенные золотом». В итоге они влегкую порешили на том, что любовь может быть только за деньги и претворяют свой план в действие в гей-баре, попросту снимая мужчин. <br><br>Но вот пошёл слух: Умерла королева! А в матрасе её большой кровати спрятан клад! Наши герои не долго думая понеслись по следам убийцы с трёхдюймовым членом. А постоянно у них на дороге, опережая их действия, стоит лесбиянка по кличке «Железная леди», содержащая тот самый гей-бар, куда ходят наши парни.','Нет данных'),(7988,'Лара Крофт: Расхитительница гробниц 2 – Колыбель жизни',2003,117,0.0,6.6,55073,'2003-07-21','https://st.kp.yandex.net/images/film_iphone/iphone360_7988.jpg','Lara Croft Tomb Raider: The Cradle of Life','Во второй серии приключений прекрасной расхитительницы гробниц Лары Крофт география действия становится ещё обширней и экзотичней. Ларе предстоит побывать в Греции, Кении, Танзании, Гонконге и Китае, и, разумеется, не для того, чтобы оценить местные красоты.<br><br>Она будет противостоять злодею-интеллектуалу Чену Ло, возглавляющему китайский преступный синдикат. Ло, искусный бизнесмен и хладнокровный убийца, замыслил использовать Ящик Пандоры оружие Судного дня.','$95 000 000'),(7989,'Я буду рядом',2003,105,0.0,6.7,145,'2003-06-13','https://st.kp.yandex.net/images/film/7989.jpg','I\'ll Be There','Пол — рок-звезда. Он живет в одиночестве, накачивая себя спиртным и гоняя по дому на «Харлее». Однажды, напившись до безумия, Пол вылетел из окна и попал в больницу. Но не случись эта беда, Пол так бы и не узнал, что у него есть дочь — плод любовного приключения с Ребеккой, одной из его многочисленных поклонниц.<br><br>В те времена Пол находился на пике славы. Его жизнь была нескончаемой чередой концертов, записей, вечеринок, золотых дисков… Пол решает увидеть дочь и приезжает к Ребекке. Оливии исполнилось 16, она поет и у нее просто ангельский голос. Правда она не имеет ни малейшего понятия о том, кто ее отец. И вот теперь Полу и Оливии предстоит познакомиться друг с другом…','Нет данных'),(7990,'Шоу века',2003,112,0.0,5.4,536,'2003-01-22','https://st.kp.yandex.net/images/film_iphone/iphone360_7990.jpg','Masked and Anonymous','В неведомой стране, измученной гражданскими войнами, правительство решает провести масштабный благотворительный концерт.<br><br>Эта миссия поручена первоклассному антрепренеру Нине Веронике, но когда становится ясно, что звезды не спешат ехать в адское пекло, ей на помощь приходит бывалый Дядюшка Добряк.<br><br>У него есть гениальная идея — вытащить из тюрьмы своего бывшего подопечного, легендарного рокера Джека Фэйта. Среди всеобщего безумия его шоу может стать сенсацией или провалом, но чтобы оно состоялось, Нине и Добряку придется рискнуть всем, в том числе — своей головой…','Нет данных'),(7991,'Солнечные понедельники',2002,113,0.0,7.0,392,'2002-09-23','https://st.kp.yandex.net/images/film_iphone/iphone360_7991.jpg','Los lunes al sol','«Понедельники на солнце» начинаются с журналистского репортажа о стычке между полицией и рабочими, уволенными в связи с закрытием судоверфи в североиспанском городке, так как владельцы верфи посчитали более выгодным продать эти земли под строительство элитной недвижимости. В центре фильма — история нескольких безработных мужчин, которым так и не удалось выкарабкаться спустя два года после того, как они остались на улице. Они встречаются в баре Рико, единственного, кому удалось выстоять, так как он вложил денежную компенсацию в покупку бара, а по понедельникам сидят на прогретых солнцем камнях на берегу моря.','$4 000 000'),(7993,'Лагерь',2003,114,0.0,5.4,156,'2003-01-21','https://st.kp.yandex.net/images/film_iphone/iphone360_7993.jpg','Camp','Музыкант-неудачник Бер Хэнли после ряда провалов вынужден устроиться в летний лагерь для музыкально одаренных детей. Наблюдая за этими юными созданиями, мечтающими о карьерах актеров, певцов и танцоров, Бренту приходит в голову отличная мысль набрать команду для своего нового проекта. Однако он не подозревает, чем обернется его решение, и что ему придется пережить этим летом.','Нет данных'),(7994,'Отель',2001,93,0.0,5.3,491,'2001-09-12','https://st.kp.yandex.net/images/film_iphone/iphone360_7994.jpg','Hotel','Интернациональная съемочная группа прибывает в Венецию для того, чтобы экранизировать классическую трагедию Джона Уэбстера «Герцогиня Мальфи» в «модном» стиле «догма». Компания останавливается в милом и чистом отеле, не подозревая, что их ждет «приятный» сюрприз: в подвале гостиницы промышляют каннибалы, которые убеждены, что из киношников выйдет… замечательный ужин! Добро пожаловать в «Отель» — «чудное» место, по которому не стоит гулять в одиночку…','Нет данных'),(7995,'Грязные прелести',2002,97,0.0,7.0,5698,'2002-09-05','https://st.kp.yandex.net/images/film_iphone/iphone360_7995.jpg','Dirty Pretty Things','Подпольный мир Лондона. Здесь все продается и покупается. Молодой человек и девушка работают в одном отеле, очаге преступной деятельности.<br><br>Они практически незнакомы до того момента, пока один из них не делает леденящее душу открытие. Герои не могут сообщить об этом ни коррумпированному боссу, ни полиции. Они будут счастливы, если им удастся остаться в живых.','$10 000 000'),(7999,'Бабье лето',2001,100,0.0,7.2,82,'2001-09-27','https://st.kp.yandex.net/images/film_iphone/iphone360_7999.jpg','Babí léto','Трагикомическая история молодого душой 75-летнего Франтишека Ганы, вечного мечтателя и игрока, который сильно отличается от своей любящей и беспокоящейся жены Эмили. Он не желает жить как старик, уже приготовившийся к смерти, поэтому пускается в новые и новые авантюры, играя самые разные роли в жизни.','Нет данных'),(8002,'А теперь, дамы и господа...',2002,133,0.0,7.0,1043,'2002-05-25','https://st.kp.yandex.net/images/film_iphone/iphone360_8002.jpg','And Now... Ladies and Gentlemen...','Загадочный и элегантный король мошенников Валентайн садится на борт роскошной яхты, чтобы в кругосветном путешествии избавиться от груза прошлого и от «хвоста» детективов. Этот хитрый вор знает цену своему богатству и счастью, и он готов ее заплатить.<br><br>В это же время красавица Джейн, поющая блюзы в ресторане марроканского отеля, отправляется в далекую деревню, чтобы забыть обо всем. Их разделяют океаны воды и песка, упрямые полицейские и случайные любовники, но это лишь начало удивительной и страстной истории любви.','Нет данных'),(8003,'Развод',2003,117,0.0,5.7,2268,'2003-08-08','https://st.kp.yandex.net/images/film_iphone/iphone360_8003.jpg','Le divorce','Брак поэтессы Рокси Уолкет и художника Шарля-Анри де Персана трещит по швам, и дело начинает пахнуть разводом. На помощь беременной и оскорбленной Рокси прилетает из Америки ее сестра Изабель. Легкомысленная и романтичная иностранка не имеет ни малейшего представления о традициях и нормах поведения во Франции. Вместо того, чтобы способствовать затуханию семейного скандала, Изабель начинает крутить роман с женатым дипломатом, который к тому же приходится мужу Рокси дядей…','Нет данных'),(8005,'Фредди против Джейсона',2003,97,0.0,6.1,27906,'2003-08-13','https://st.kp.yandex.net/images/film_iphone/iphone360_8005.jpg','Freddy vs. Jason','Фредди Крюгер доведен до отчаяния: он больше не может убивать. Лишь используя неуклюжего серийного убийцу Джейсона Вурхиса, Фредди удается истреблять детей с улицы Вязов. Но когда Джейсон начинает понимать, что им попросту манипулируют, планы Фредди готовы рухнуть.<br><br>Теперь дело за тинейджерами Уиллом, Лори и Кией. Каким-то образом им надо заставить Джейсона раз и навсегда убить Фредди Крюгера.','$30 000 000'),(8007,'Однажды в Средней Англии',2002,104,0.0,6.6,361,'2002-05-20','https://st.kp.yandex.net/images/film_iphone/iphone360_8007.jpg','Once Upon a Time in the Midlands','Дек и Ширли живут с 12-летней Марлен — дочкой Ширли от обольстительного афериста Джимми, пропавшего много лет назад и с тех пор не подававшего ни слуху, ни духу. Порядочный, но занудливый Дек любит Ширли так сильно, что однажды без предупреждения делает ей предложение руки и сердца по национальному телевидению. Как и все, кто знал Ширли, Джимми увидел телепредложение Дека и решил вернуться в город, в полной уверенности, что его тюфяк-соперник не имеет никаких шансов против натиска его вновь вспыхнувшей романтической страсти.','£1 950 000'),(8010,'Пиявки',2003,85,0.0,2.9,244,'2003-08-19','https://st.kp.yandex.net/images/film_iphone/iphone360_8010.jpg','Leeches!','Каждый американский колледж гордится своей спортивной командой, но в этом учебном заведении атлеты намерены любой ценой добиться успеха на соревнованиях. Не желая разочаровать своих очаровательных поклонниц, группа талантливых пловцов горстями принимает стероиды и проводит всё время в бассейне, не зная, что в стоках давно поселились маленькие слизняки-кровопийцы.<br><br>Незаметно присасываясь к телам спортсменов, они насыщаются гормонами силы и роста. И когда во время медицинской проверки капитан команды выбрасывает в канализацию огромную дозу стероидов, пиявки обретают новые формы. Город не подозревает, что скоро он проснется, облепленный гигантскими мутантами, и тогда несчастным жертвам уже не удастся отделаться от них легким кровопусканием!','Нет данных'),(8011,'Тринадцать',2003,100,0.0,6.7,14235,'2003-01-17','https://st.kp.yandex.net/images/film_iphone/iphone360_8011.jpg','Thirteen','Трудностей переходного возраста не удалось избежать даже никогда не прогуливавшей уроков отличнице Трэйси. После знакомства с самой популярной девочкой в школе по имени Иви её как подменили. Теперь Трэйси старается во всём походить на свою новую подружку — быть такой же раскованной, общительной и безбашенной. Матери Трэйси Мелани придётся нелегко, ведь образец для подражания у её дочери ещё тот: Иви — сирота, живёт с тётей и большую часть времени проводит на улице, выпивая, куря и встречаясь с парнями.','$2 000 000'),(8012,'Тайная жизнь дантистов',2002,104,0.0,5.7,104,'2002-09-09','https://st.kp.yandex.net/images/film/8012.jpg','The Secret Lives of Dentists','Пациенты этого успешного дантиста всегда знали, что у него не все в порядке с головой, в той части, которая выше зубов. Уж больно странные шутки он отмачивал. Но однажды у него совсем крыша поехала.<br><br>Мало того, что он заподозрил свою примерную жену и мать троих детей в неверности. Так он еще взял себе в советники явившегося ему призрака-мачо, чтобы вывести коварную на чистую воду…','Нет данных'),(8013,'Скейтбордисты',2003,105,0.0,7.0,4327,'2003-08-13','https://st.kp.yandex.net/images/film_iphone/iphone360_8013.jpg','Grind','Четверо друзей — фанатов скейтбордов — решают добиться известности. Они организуют свою команду и пускаются в авантюрное путешествие по местам соревнований и тусовок. Пережив массу приключений, они добиваются признания.','$6 000 000'),(8015,'Марси Икс',2003,80,0.0,4.8,152,'2003-08-22','https://st.kp.yandex.net/images/film_iphone/iphone360_8015.jpg','Marci X','Марси Фелд — непревзойдённая королева шоппинга, которая понятия не имеет, что такое «рэп»… Она предполагает, что возможно, это — любимое занятие продавцов в бутиках, где она обычно покупает себе наряды.<br><br>Но очень скоро героине суждено восполнить этот досадный пробел. Рэппер Доктор Эс решает выпустить свой новый скандальный диск в звукозаписывающей компании, которой владеет папочка Марси.<br><br>Хип-хоп хиты рэп-доктора вызвали настоящую волну общественного протеста, а папочку, в связи с этим пренеприятным обстоятельством, подкосил сердечный приступ. Теперь Марси решает действовать самостоятельно, чтобы спасти репутацию и семейный бизнес.<br><br>Заручившись поддержкой своих «модных» подружек и вооружившись дизайнерской сумочкой, полной кредитных карточек, Марси принялась отстаивать права черного рэппера Доктора Эс.<br><br>Чтобы выиграть эту битву, девушке нужно будет расправиться с толпой злобных репортеров, консервативным сенатором в юбке и «опасной» подружкой Доктора Эс-Йо Ло.','$20 000 000'),(8018,'Так внезапно',2002,90,0.0,6.6,145,'2002-04-26','https://st.kp.yandex.net/images/film/8018.jpg','Tan de repente','Юную толстушку-продавщицу Марсию, живущую обыденной и серой жизнью в Буэнос-Айресе, внезапно похищает пара девушек-панков, называющие себя Мао и Ленин.<br><br>Они сажают ее в машину и везут к морю, которого Марсия никогда не видела. Их путешествие, наполненное фантазией и юмором, становится все более странным из-за непредвиденных событий, происходящих с ними…','Нет данных'),(8023,'Любимец учителя',2004,73,0.0,5.4,152,'2004-01-16','https://st.kp.yandex.net/images/film_iphone/iphone360_8023.jpg','Teacher\'s Pet','Спот Хелперман — щенок, умеющий читать и писать. Мечтая получить образование, он умудряется под видом человека посещать школу вместе со своим хозяином Леонардом. В итоге любознательный щенок становится лучшим учеником 4-го класса. Когда же чудаковатый ученый доктор Крэнк предоставляет Споту шанс стать настоящим мальчиком, маленькие собачьи трудности обретают масштаб общечеловеческих проблем.','Нет данных'),(8026,'Демон-любовник',2002,115,0.0,5.8,635,'2002-05-19','https://st.kp.yandex.net/images/film_iphone/iphone360_8026.jpg','Demonlover','Твою игру делает другой… Диана работает в транснациональной корпорации «Вольф» и одновременно является «агентом влияния» интернетовской компании «Mangatronics». Задание Дианы — любой ценой сорвать подписание контракта между конкурирующей интернет -компанией «Demonlover» и ее «родной» корпорацией на право распространять в «сети» трехмерную порнографическую анимацию «манга». Но вскоре она обнаруживает, что окружена шпионами конкурентов, которые готовы на самые крайние меры. Диана знает слишком много смертельно опасных тайн. Удастся ли ей выбраться из западни…. А может быть, Диана все время была погружена в виртуальную реальность?','€7 032 000'),(8027,'Лихорадка',2003,93,0.0,6.0,9143,'2002-09-14','https://st.kp.yandex.net/images/film_iphone/iphone360_8027.jpg','Cabin Fever','После тяжелого учебного года пятеро студентов решают провести пару дней в маленькой лесной хижине. Несмотря на странное поведение местных жителей, они намерены как следует расслабиться, но внезапно их планы нарушает встреча с бродягой с ужасной, будто бы гниющей кожей. Ребятам удается отделаться от несчастного, но они не знают, что он успел отравить местный водоем, и неизвестная инфекция уже распространяется по округе.','$1 500 000'),(8028,'Шлепни ее, она француженка',2002,84,0.0,6.2,5031,'2002-01-31','https://st.kp.yandex.net/images/film_iphone/iphone360_8028.jpg','Slap Her, She\'s French!','У Старлы есть всё, что хотела бы иметь любая девушка в её возрасте. Она — королева красоты маленького техасского городка и капитан болельщиц школьной футбольной команды. Но вот в её доме появляется Женевьева — застенчивая студентка-француженка, приехавшая по культурному обмену из Парижа.<br /><br />Пока ничего не подозревающая Старла знакомит «мадемуазель невинность» со своими друзьями и родственниками, Женевьева тайно готовит коварный план по свержению королевы с её трона, лестью и хитростью завоёвывая дружбу одноклассников Старлы, расположение её родителей и сердце её жениха.','$10 000 000'),(8031,'Борьба с искушениями',2003,123,0.0,6.1,410,'2003-09-17','https://st.kp.yandex.net/images/film_iphone/iphone360_8031.jpg','The Fighting Temptations','Дэррина Хилл, напористый нью-йоркский рекламный агент, отчаянно нуждающийся в деньгах, отправляется к себе на родину, в Джорджию, чтобы получить наследство, которое ему оставила его тетушка.<br><br>По прибытию Дэррин узнает, что прежде чем вступить в права наследника и получить кругленькую сумму, он должен исполнить последнюю волю тети — возглавить местный евангелистский хор, который должен победить в национальном ежегодном конкурсе. Дэррин вскоре обнаруживает, что его родной городок кишит разнообразными колоритными персонажами, но талантливых певцов в нем днем с огнем не сыщешь.<br><br>И вот он встречает Лилли, красивую джазовую певицу с голосом, которому позавидовали бы даже ангелы. Дэррин понимает, что его молитвы услышаны, и теперь дело за малым — убедить девушку, что его намерения чисты и заставить ее петь.','$30 000 000'),(8032,'Моя жизнь без меня',2002,106,0.0,7.5,7956,'2003-02-10','https://st.kp.yandex.net/images/film/8032.jpg','My Life Without Me','Энн двадцать три, и у нее две дочери, безработный муж, мать, которая всех ненавидит, и отец, отсидевший последние десять лет за решеткой. Она работает уборщицей в университете, в двери которого и днем она никогда не решилась бы войти.<br><br>Ее монотонная жизнь меняется, когда врачи сообщают ей о неизлечимой болезни, и что ей осталось жить всего два-три месяца. Энн решает радикально изменить свою жизнь.','€2 000 000'),(8035,'Под солнцем Тосканы',2003,113,0.0,7.5,17035,'2003-09-20','https://st.kp.yandex.net/images/film_iphone/iphone360_8035.jpg','Under the Tuscan Sun','Тяжело переживая развод, писательница Фрэнсис Мэйс медленно погружается в пучину депрессии. Душевный кризис перетекает в творческий. Опустошенная и разбитая, Фрэнсис все же поддается на уговоры подруги и едет развеяться в Италию. Происходит настоящее чудо! <br><br>Ласковое южное солнце пробуждает в очарованной красотой Тосканы Фрэнсис страстное желание начать новую жизнь — именно здесь, в этом теплом и дружелюбном краю. Первым делом она покупает себе старинную виллу. Вторым — заводит новые знакомства. И она еще не ведает, что третье вскоре найдет ее само. И это будет новая всепоглощающая любовь.','$18 000 000'),(8038,'Возвращение реаниматора',2003,92,0.0,5.9,2323,'2003-04-04','https://st.kp.yandex.net/images/film_iphone/iphone360_8038.jpg','Beyond Re-Animator','После ужасных событий в университете Мискатоник гениальный ученый Герберт Уэст отбывает срок в сырой камере старой провинциальной тюрьмы. Он по-прежнему одержим зловещей идеей оживления мертвецов.<br><br>Используя любой доступный материал, Уэст продолжает свои чудовищные эксперименты, и, кажется, он близок к успеху — им выделена субстанция, покидающая организм в момент смерти. Получив ее, умерший человек должен обретать не только жизнь, но и разум.<br><br>Доктор уверен, что новые опыты с человеческой плотью подтвердят его правоту, но он не предусмотрел их опасные побочные эффекты…','$3 000 000'),(8039,'Йосси и Джаггер',2002,65,0.0,6.8,577,'2002-08-01','https://st.kp.yandex.net/images/film_iphone/iphone360_8039.jpg','Yossi & Jagger','В основе фильма лежит реальная история любви Йосси и Джаггера, двух израильских офицеров с далекой военной базы на ливанской границе. Они командиры, они влюблены, они пытаюся найти место в суровой системе подавления индивидуальности, пославшей их защищать идеалы, в которые они не верят. Без размахивания знаменами и идеологических установок авторы ведут речь о молодых людях, стремящихся выжить в невероятно сложном мире.','Нет данных'),(8040,'Запятнанная репутация',2003,106,0.0,6.7,5153,'2003-08-29','https://st.kp.yandex.net/images/film_iphone/iphone360_8040.jpg','The Human Stain','Неосторожная шутка, воспринятая как расистское замечание в адрес чернокожих студентов, вынуждает уважаемого профессора Колмана Силка со скандалом покинуть родной университет. Это известие становится фатальным для жены Колмана, которая умирает от сердечного приступа. Убитый горем профессор отчаянно пытается восстановить запятнанную репутацию, но знакомство с молодой уборщицей Фонией дарит ему неожиданное утешение. Поставив на кон свою репутацию, Колман безоглядно отдается новому чувству и вскоре между ним и яркой и неукротимой женщиной, чьи несчастья умножает муж-психопат вспыхивает страстная любовь. Однако их сложные отношения внезапно оказываются под угрозой, когда становится ясно, что Колмана и Фонию объединяет не только страсть, но и мрачные тайны, которые они так долго хранили в своей душе…','$30 000 000'),(8042,'Станционный смотритель',2003,89,0.0,7.2,6442,'2003-01-26','https://st.kp.yandex.net/images/film_iphone/iphone360_8042.jpg','The Station Agent','Финбар МакБрайд — карлик. Этим он обречен на вечные высмеивания на улице и косые взгляды со стороны общества. Он всегда привлекает внимание, но не так как ему бы хотелось. Его оскорбляют, пользуются его бессилием, а кто-то и вовсе сразу берется за фотоаппарат, дабы сфотографировать «иного» человека. Как следствие, Фин привык жить в одиночестве, ему интересней читать книгу, чем поддерживать беседу с кем-либо, так как он не ожидает искренней беседы, в нем видят лишь предмет жалости, а он не терпит такого отношения. Общество не принимает таких, как он, он — изгой.','$500 000'),(8043,'Мечтатели',2003,116,0.0,7.4,76218,'2003-09-01','https://st.kp.yandex.net/images/film_iphone/iphone360_8043.jpg','The Dreamers','Париж, 1968 год — демонстрации студентов, баррикады на улицах, в воздухе пахнет революцией: Но у трех молодых людей — своя реальность, свой мир — мир кино. Дни и ночи напролет они смотрят фильмы и не выходят из дома…<br><br>Кино стало их жизнью. Сначала это просто увлечение, потом — сложная паутина психологических и сексуальных отношений. Между тем, беспорядки на улицах Парижа достигают своей кульминации…','$15 000 000'),(8044,'Автобус 174',2002,150,0.0,6.8,143,'2002-10-22','https://st.kp.yandex.net/images/film_iphone/iphone360_8044.jpg','Ônibus 174','12 июня 2000 года — день, который навсегда останется в памяти народа Бразилии. Рано утром, когда жители Рио-де-Жанейро отправились на работу, несколько человек стали жертвами угона автобуса у исторического центра города — ботанических садов. Лента повествует о событиях того рокового дня..','Нет данных'),(8047,'Девять ярдов 2',2003,98,0.0,6.8,40177,'2004-04-07','https://st.kp.yandex.net/images/film_iphone/iphone360_8047.jpg','The Whole Ten Yards','Много событий происходит в жизни дантиста из Беверли Хиллз Николаса Озерански. Его жена Синтия беременна, а его самого одолела паранойя. Одновременно выходит из тюрьмы главарь венгерской мафии Лазло и хочет вернуть деньги, которые Озз увёл у него из-под носа. Готовый на всё для достижения цели Лазло даже похищает беременную Синтию…','$40 000 000'),(8048,'Уилбур хочет покончить с собой',2002,105,0.0,6.2,364,'2002-11-08','https://st.kp.yandex.net/images/film_iphone/iphone360_8048.jpg','Wilbur Wants to Kill Himself','Уилбуру и его брату Харбору за тридцать. После смерти отца им достается букинистическая лавка. Уилбур, склонный к суициду, в очередной раз пытается покончить с собой. И попадает в больницу. Никто не нравится Уилбуру. Влюбляется не он, а его брат. Эллис замкнута, живет вдвоем с дочерью Мэри. Работая уборщицей в больнице, она собирает книги, оставленные больными, чтоб сдать их в букинистический магазин. Братья и Эллис становятся неразлучны. Уилбур вновь чувствует вкус к жизни, Эллис выходит из добровольной изоляции, Мэри увлекается чтением. Харбор счастлив, как никогда, но он скрывает какую-то тайну…','$4 000 000'),(8050,'Темная сторона страсти',2003,119,0.0,5.8,1500,'2003-09-09','https://st.kp.yandex.net/images/film_iphone/iphone360_8050.jpg','In the Cut','Жизнь обычной нью-йоркской женщины Френни Эйвери необратимо меняется после произошедшего по соседству от неё убийства.<br><br>Детектив, расследующий это преступление, уверен в связи Френни с этим зверством, но это не мешает им завести друг с другом любовную интригу, полную тёмной страсти…','$12 000 000'),(8051,'За гранью',2003,127,0.0,7.4,8133,'2003-10-24','https://st.kp.yandex.net/images/film_iphone/iphone360_8051.jpg','Beyond Borders','Молодая замужняя американка Сара Джордан, живущая в Англии, оказывается на благотворительном вечере и слышит жаркую речь, произнесенную доктором Ником Кэллахэном. Его пламенный призыв о помощи детям стран, вовлеченных в военные конфликты, перевернула жизнь Сары навсегда.<br><br>Очарованная Ником и его благородными идеями, она расстается со спокойной жизнью и, жертвуя своим благополучием, устремляется навстречу риску, опасности и… своей любви. На протяжении десяти лет судьба будет сводить Сару и Ника в разных «горячих точках» нашей планеты — в Камбодже, Эфиопии и Чечне, приготовив влюбленным страшные испытания.','$35 000 000'),(8054,'Дьявол возвращается',2004,88,0.0,3.7,136,'2004-07-26','https://st.kp.yandex.net/images/film_iphone/iphone360_8054.jpg','Trespassing','Карл Брайс убивает своего отца и сжигает заживо свою мать, а затем бесследно исчезает. Дом же семьи Брайсов находится на территории плантации, на которой работали рабы, а владелица этой плантации проводила над ними эксперименты. Студент Марк, занимающийся расследованием подобных мифов и исторических случаев, вместе с компанией друзей берётся за расследование этого дела и направляется в этот дом. Вскоре появляется и сам Карл Брайс, носящий на голове собачью маску.','Нет данных'),(8057,'Братец медвежонок',2003,82,0.0,7.9,45647,'2003-10-20','https://st.kp.yandex.net/images/film_iphone/iphone360_8057.jpg','Brother Bear','Давным-давно, в те времена, когда по Земле ходили мамонты, а вечные льды достигали южных морей, жил охотник по имени Кенаи. Он был храбр и ловок, но однажды прогневил Великих Духов, убив медведицу — священного для него зверя, чей тотем он носил на шее. Тогда духи предков в наказание превратили в медведя самого Кенаи. Теперь он не может говорить по-человечески, за ним охотится его собственный брат, а еще к нему прибился озорной медвежонок Кода, не желающий оставить героя в покое. Но духи не зря свели Кенаи с Кодой — в час, когда охотник увидит в медвежонке родственную душу, он сможет снова стать человеком…','Нет данных'),(8065,'Кот',2003,82,0.0,4.6,11489,'2003-11-08','https://st.kp.yandex.net/images/film_iphone/iphone360_8065.jpg','The Cat in the Hat','Конрад и Салли Валден дома со своей рыбкой одни. На улице дождь и делать решительно нечего. Пока не появляется Кот в Шляпе. Он знакомит детей с их воображением.<br><br>Поначалу это игры и развлечения, но затем всё выходит из под контроля, и ему надо исчезнуть до прихода родителей…','$109 000 000'),(8067,'Радио',2003,109,0.0,7.9,8002,'2003-10-24','https://st.kp.yandex.net/images/film_iphone/iphone360_8067.jpg','Radio','Американская глубинка середины прошлого века… Умственно отсталый паренёк по прозвищу Радио является объектом насмешек всего городка. Однако, тренер местной футбольной команды берёт Радио под свою опеку, и это меняет жизнь всего города…','$35 000 000'),(8068,'В Америке',2002,105,0.0,7.4,2122,'2002-09-12','https://st.kp.yandex.net/images/film_iphone/iphone360_8068.jpg','In America','Тысячи, миллионы людей стремятся в Соединенные Штаты Америки в поисках лучшей жизни, надеясь на исполнение своих самых заветных желаний. Семья театрального актера Джонни переезжает из Ирландии в Нью-Йорк, чтобы начать свою жизнь заново и избавиться от призраков прошлого. Почти мистический злой рок преследовал их, горе поселилось в их доме, и они были вынуждены бежать, чтобы спасти свою семью.<br><br>Без денег и с имуществом в виде пары чемоданов, старой машины и видеокамеры, но полные оптимизма и веры в свои силы, Джонни и его жена Сара пытаются адаптироваться к жестоким и странным нравам Нью-Йорка.<br><br>Их дочки — десятилетняя Кристи и маленькая Ариэль, наоборот, считают Америку волшебной страной, где живут чудесные люди. Как ни странно, именно вера дочерей в доброту людей и любовь ко всем окружающим помогут Джонни и Саре спасти семью от распада.','Нет данных'),(8075,'Любовь не стоит ничего',2003,100,0.0,6.5,1715,'2003-12-10','https://st.kp.yandex.net/images/film_iphone/iphone360_8075.jpg','Love Don\'t Cost a Thing','Старшекласснику Элвину не везет. У бедолаги проблемы с учебой, одноклассники отказываются принимать его в свою «тусовку», да и с девушками — полная катастрофа! Однако судьба предоставляет «везунчику» Элвину прекрасный шанс.<br><br>Когда местная школьная «королева красоты» разбивает машину и обращается к нему за помощью, Элвин предлагает ей сделку. По условиям договора он помогает ей уладить проблемы с машиной — за это Пэрис соглашается притвориться на две недели его подружкой… Теперь у Элвина было все, о чем он мечтал, и это не стоило ему ровным счетом ничего…<br><br>Но сможет ли наш герой довольствоваться фальшивыми дружбой, любовью и признанием, при этом не потеряв… себя?','Нет данных'),(8076,'Девушка с жемчужной сережкой',2003,100,0.0,7.2,24263,'2003-08-31','https://st.kp.yandex.net/images/film_iphone/iphone360_8076.jpg','Girl with a Pearl Earring','1665 год, голландский город Дельфт. В дом художника Йоханнеса Вермеера приходит 16-летняя девушка Гриет, чтобы работать служанкой. Вскоре она обращает на себя внимание живописца, потому что, несмотря на свой юный возраст, Гриет тонко чувствует не только результат творчества, но и сам процесс, механизм создания полотен, которым суждено будет жить в веках. Однажды Вермеер обращается с просьбой к Гриет — позировать ему для новой картины…','Нет данных'),(8083,'Труппа',2003,112,0.0,5.8,541,'2003-09-08','https://st.kp.yandex.net/images/film_iphone/iphone360_8083.jpg','The Company','Начался новый творческий сезон. Многообещающее содружество молодых танцовщиков вновь собирается под крылом Альберто Антонелли, гениального директора труппы, славящегося своей беспощадной требовательностью к артистам.<br><br>Впереди месяцы упорного труда, выматывающих репетиций, боли и отчаяния. Талантливая танцовщица Рай знает, что может стать солисткой в новой экстравагантной постановке «Синяя Змея». Но сумеет ли она и ее друзья выдержать огромное напряжение, чтобы однажды создать на сцене незабываемое зрелище?','$15 000 000'),(8084,'Форт Аламо',2004,137,0.0,6.2,1621,'2004-03-27','https://st.kp.yandex.net/images/film_iphone/iphone360_8084.jpg','The Alamo','Эпический фильм по мотивам реальных исторических событий, повествующий о битве при Аламо, где состоялось крупнейшее сражение сил мексиканской армии с повстанческими отрядами американских поселенцев. Мощный, динамичный фильм, насыщенный батальными сценами и повествующий о силе человеческого духа.','$107 000 000'),(8085,'Час расплаты',2003,119,0.0,7.1,33171,'2003-12-25','https://st.kp.yandex.net/images/film_iphone/iphone360_8085.jpg','Paycheck','Майкл Дженнингс, специалист по реверс-инжинирингу, соглашается принять участие в секретном проекте, за который ему обещают огромный гонорар. Когда всё заканчивается, Майклу стирают память. Дальше главный герой с радостью направляется в банк, где узнаёт, что месяц назад он отказался от всех своих акций стоимостью 92 миллиона долларов.','$60 000 000'),(8087,'Рожденный в песках',2003,45,0.0,7.0,937,'2003-12-07','https://st.kp.yandex.net/images/film_iphone/iphone360_8087.jpg','The Young Black Stallion','Издавна в Аравии ходили легенды о волшебных конях, будто бы рожденных из песка, ночного неба и вольного ветра. Встретить такого коня — невероятная удача, редко выпадающая на долю смертного. Они обитают в самом сердце бескрайней пустыни и избегают людей, но… Однажды маленькая Нира потерялась в безлюдной аравийской глуши.<br><br>Девочка была бы обречена на гибель, если б не встреча с загадочным вороным жеребенком, названным ею Шетаном, который помогает ей выжить и найти дорогу домой. Черный красавец становится самым близким другом Ниры, но сможет ли она удержать его при себе, когда вернется к отцу? Ведь если верить легендам, такие как Шетан не могут жить среди людей. Их дом — вольная пустыня. Их судьба — быть свободными…','Нет данных'),(8090,'Спёкшийся',2005,70,0.0,3.2,446,'2005-11-08','https://st.kp.yandex.net/images/film_iphone/iphone360_8090.jpg','The Gingerdead Man','Убийца, казненный на электрическом стуле, оживает в виде фигурной выпечки и пытается отомстить за свою смерть.','Нет данных'),(8091,'Охотники за разумом',2004,106,0.0,7.5,67770,'2004-03-19','https://st.kp.yandex.net/images/film_iphone/iphone360_8091.jpg','Mindhunters','На удаленном острове семь будущих агентов ФБР проходят решающий тест, чтобы попасть в элитный отдел «охотников за разумом» — людей, по мельчайшим уликам и любым сведениям составляющих психологические профили опаснейших преступников.<br><br>Но испытание становится слишком реальным, когда в их группе оказывается настоящий серийный убийца. Успеют ли оставшиеся в живых выявить маньяка в своих рядах, пока он не расправился с каждым поодиночке?','$27 000 000'),(8092,'Лапочка',2003,94,0.0,7.0,26681,'2003-11-24','https://st.kp.yandex.net/images/film_iphone/iphone360_8092.jpg','Honey','Молодая танцовщица Хани — успешный хореограф видеоклипов. Однажды девушка получает двусмысленное предложение, которое тем не менее может сделать её невероятно популярной в мире шоу-бизнеса…','$18 000 000'),(8093,'Высший балл',2004,93,0.0,6.4,4650,'2004-01-27','https://st.kp.yandex.net/images/film_iphone/iphone360_8093.jpg','The Perfect Score','Группа из шести старшеклассников занимается разработкой плана, как обойти главный вступительный экзамен, который определяет их профориентацию. Каждый из них имеет свои веские причины для этого противозаконного действия. Неофициальный лидер группы, Кайл, очень хочет поступить в престижный вуз на архитектурное отделение, но у него недостает нескольких баллов. Его лучший друг, Мэтт, по тем же причинам не может поступить в университет штата Мэриленд, где учится его подружка.<br><br>Анна страстно желает не подвести ожидания своих родителей, но от волнения мало рассчитывает на свои силы при сдаче экзамена. Десмонд, один из лучших баскетбольных игроков, по настоянию своей матери, решает воздержаться от мечты об играх в НБА и поступить в институт. Следующая участница группы, Франциска, разработала саму схему обхода системы. И Рой — одиночка, случайно попавший в эту компанию. Сначала всем ребятам кажется, что у них мало общего друг с другом, но в процессе разработки плана, их мнение кардинально меняется, так как общее занятие очень их сплачивает.','$40 000 000'),(8094,'Техасская резня бензопилой',2003,98,0.0,6.6,32499,'2003-10-15','https://st.kp.yandex.net/images/film_iphone/iphone360_8094.jpg','The Texas Chainsaw Massacre','В Техасе на ферме Томаса Хьюитта обнаружили 33 изувеченных тела. Пресса окрестила убийцу «Человеком с лицом из кожи», а человек, носивший кожаную маску, был застрелен. Однако полиция взяла не того. Уцелевший свидетель поведал о том, что на самом деле произошло, когда пятеро подростков оказались в ловушке у безумца с бензопилой.','$9 500 000'),(8096,'Великий рейд',2005,132,0.0,6.2,1401,'2005-08-10','https://st.kp.yandex.net/images/film_iphone/iphone360_8096.jpg','The Great Raid','Январь 1945 года. Молодой рейнджер армии США, полковник Генри Муччи, на которого пал выбор главнокомандующего генерала МакАртура, должен отправиться на Филиппины, чтобы спасти 500 американских военнослужащих, заточенных в лагере смерти Кабанатуан.<br><br>Перед тем, как выполнить смертельно опасную миссию, полковнику и его подразделению — 6-му батальону рейнджеров — придется пройти жесточайший тренинг, который лишь немного уступает тому аду, который они увидят на Филиппинах…','$80 000 000'),(8102,'Светлячок',2004,97,0.0,6.5,112,'2004-04-09','https://st.kp.yandex.net/images/film/8102.jpg','Lightning Bug','Молодой Грейвис Грин, движимый мечтами о Голливуде, самостоятельно познает искусство гримера и раскрывает секреты создания спецэффектов. Он уверен, что ему удастся создать монстров, которые поразят знаменитую фабрику грез.<br><br>Но реальные демоны в жизни угрожают его мечте: пьяный отчим, терроризирующий мать, группа религиозных фанатиков, которые хотят разрушить его работы, и любовь к девушке, которая не может расстаться с привычной жизнью маленького города.','Нет данных'),(8105,'Темнота наступает',2003,86,0.0,5.8,4943,'2003-01-24','https://st.kp.yandex.net/images/film/8105.jpg','Darkness Falls','В детстве юный герой фильма Кайл Уолш заработал нелестную репутацию городского сумасшедшего после того, как рассказал, будто видел живьём ужасную Зубную Фею, вечную героиню страшилок для малолеток.<br><br>Спустя годы Кайл возвращается в свой родной городок, чтобы спасти свою девушку и её младшего брата от древнего зла, обитающего в городе вот уже свыше 150 лет…','$11 000 000'),(8106,'Надежда',2003,158,0.0,6.5,108,'2003-05-16','https://st.kp.yandex.net/images/film_iphone/iphone360_8106.jpg','Armaan','Ради сохранения клиники, ставшей делом его жизни, нейрохирург доктор Акаш вынужден жениться на дочери крупного магната Сони Капур.<br><br>Но надежда на то, что когда-нибудь он всё же сможет соединить свою судьбу с любимым человеком, доктором Нехой продолжает теплиться в его душе, хотя молодая жена всеми правдами и неправдами пытается выжить Неху из клиники…','Нет данных'),(8108,'Скрытая угроза',2001,89,0.0,6.5,4461,'2001-10-30','https://st.kp.yandex.net/images/film_iphone/iphone360_8108.jpg','Domestic Disturbance','Фрэнк Моррисон больше не живет со своей бывшей женой Сьюзан и сыном Дэнни, у которого теперь есть отчим, известный промышленник Рик Барнс. Несмотря на все попытки Рика подружиться с Дэнни, их отношения не клеятся. Вскоре Дэнни случайно становится свидетелем страшных событий: его отчим хладнокровно убивает и уничтожает труп странного незнакомца, недавно появившегося в городе.<br><br>Дэнни всё рассказывает полиции, но подростку, известному своими фантазиями и враньем, не верит никто, кроме его родного отца, который с риском для жизни начинает копаться в темном прошлом богатого и двуличного чудовища в человеческом обличии. Постепенно Барнс теряет самообладание, но сможет ли Фрэнк вывести на чистую воду жестокого мошенника и убийцу, который живет под одной крышей с его родным сыном?','$75 000 000'),(8109,'Машина времени',2002,96,0.0,7.1,33783,'2002-03-04','https://st.kp.yandex.net/images/film_iphone/iphone360_8109.jpg','The Time Machine','Профессор Александр Хартдеген изобрёл машину времени и отправился в прошлое, чтобы спасти свою невесту от случайной пули. Но это ему не удалось — прошлое нельзя изменить. Хартдеген попадает в будущее и видит Землю в ужасающем состоянии. После ранения и беспамятства он не заметил, как его машина прошла сквозь восемьсот тысяч лет истории Земли…','$80 000 000'),(8110,'Чёрный рыцарь',2001,95,0.0,6.5,23214,'2001-11-15','https://st.kp.yandex.net/images/film_iphone/iphone360_8110.jpg','Black Knight','Был обычный летний день. Джамал, как обычно, чистил ров в городском парке развлечений «Средневековый мир». Но судьба уже готовила ему самое весёлое и безумное приключение в его жизни. Случайно перевернувшись через перила моста, Джамал падает в воду и выныривает в Средневековой Англии. Принятый за посла из Нормандии из-за странной одежды и манеры говорить он знакомится с очаровательной заговорщицей, которая хочет свергнуть короля-тирана.','$50 000 000'),(8111,'Стрекоза',2002,104,0.0,7.3,13280,'2002-02-18','https://st.kp.yandex.net/images/film_iphone/iphone360_8111.jpg','Dragonfly','После трагической гибели в горах Венесуэлы доктора Эмили Дэрроу в жизни её мужа Джо, работавшего с ней в одной больнице, начинают происходить необъяснимые события. Больные дети, которых лечила Эмили, утверждают, что она является им в видениях, пытаясь сообщить что-то важное. Загадочные знаки и пугающие послания неотступно преследуют Джо, и вскоре он убеждает себя, что сумеет разгадать их тайный смысл, только если отправится туда, где его жена рассталась с жизнью.','$60 000 000'),(8112,'Барабанная дробь',2002,118,0.0,7.2,1770,'2002-08-07','https://st.kp.yandex.net/images/film_iphone/iphone360_8112.jpg','Drumline','Как известно, у чёрных парней из бедного Гарлема не слишком много путей выбиться в люди: через шоу-бизнес, спорт или криминал. В отличие от своих сверстников, Девон мечтает стать не гангстером, не актёром и не баскетболистом. Девон грезит о карьере барабанщика — уж больно ему нравиться наяривать палочками по кожаной поверхности.<br><br>Его упорные попытки самоувердиться на улицах не остаются без внимания: парня замечает хозяин оркестра и приглашает постучать по барабану в одном университете. Карьера начинается…','$20 000 000'),(8113,'Экстремалы',2002,93,0.0,6.8,4063,'2002-11-27','https://st.kp.yandex.net/images/film_iphone/iphone360_8113.jpg','Extreme Ops','Группа экстремалов снимает рекламу у подножья Альп, близ югославской границы. Случайно в поле зрения героев попадает секретный лагерь военного преступника Слободана Павла, и теперь им придется мобилизовать все свои навыки, чтобы выжить…','$40 000 000'),(8114,'Настоящие женщины всегда в теле',2002,90,0.0,6.9,271,'2002-01-13','https://st.kp.yandex.net/images/film_iphone/iphone360_8114.jpg','Real Women Have Curves','Покинуть отчий дом, поступить в колледж и начать самостоятельную жизнь? Или остаться дома, выйти замуж и работать на швейной фабрике, где работают сестра и мать?<br><br>На первый взгляд может показаться, что выбор очевиден, но для восемнадцатилетней Аны, выбор, который ей предстоит сделать, определит ее дальнейшую судьбу.<br><br>Жизнеутверждающая история о юной девушке из мексиканского квартала Лос-Анджелеса, вступающей во взрослую жизнь, полную соблазнов и разочарований, правдивый и ироничный рассказ о реальных проблемах реальных латиноамериканских женщин.<br><br>Сейчас Ана шьет одежду для худых красоток, но скоро она поймет, что настоящие женщины дерзают, ошибаются, любят жизнь и, конечно же… всегда в теле!','$3 000 000'),(8115,'Тайна отца Амаро',2002,118,0.0,6.6,943,'2002-08-16','https://st.kp.yandex.net/images/film_iphone/iphone360_8115.jpg','El crimen del Padre Amaro','Почти наши дни. Одно из государств Латинской Америки. Социальные катаклизмы, восстания, нищета, перемены, но традиционные религиозные устои незыблемы. Молодой падре Амаро, недавно принявший сан, нарушает строгие правила, влюбившись в молодую прихожанку.','$1 800 000'),(8116,'Эвелин',2002,95,0.0,7.5,833,'2002-09-09','https://st.kp.yandex.net/images/film_iphone/iphone360_8116.jpg','Evelyn','Это история, действительно имевшая место, в Ирландии. Десмонт Дойл, отец троих детей, вел продолжительную юридическую войну с ирландским правительством и католической церковью, которые лишили его права общаться с собственными детьми после того, как его покинула жена, а сам он потерял работу.','$10 000 000'),(8117,'Империя',2002,90,0.0,6.0,399,'2002-12-03','https://st.kp.yandex.net/images/film_iphone/iphone360_8117.jpg','Empire','Виктор Роза — могущественный бизнесмен, сочетающий в себе, по собственному мнению, качества Рокфеллера, Карнеги и Билла Гейтса. В железном кулаке он держит успешный «драг» бизнес, который заключается в розничной торговле на улицах города героином, и называется им самим Империей Розы.<br><br>Его красивая подружка Кармен, студентка колледжа, знакомит Виктора со своим приятелем — банкиром Джеком Виммером. Они встречаются, и вскоре решают, что между ними много общего — оба преуспевающие бизнесмены, но, правда, по разные стороны закона!<br><br>Когда Джек предлагает Виктору подмять под себя часть рынка акций, тот немедленно соглашается. Но цена, которую нужно заплатить за эту новую, респектабельную жизнь слишком высока, и впервые Виктор Роза сталкивается с такой стоимостью, которая может оказаться ему не по карману.','$4 000 000'),(8118,'Дорога к дому',2002,88,0.0,8.0,3666,'2002-04-05','https://st.kp.yandex.net/images/film_iphone/iphone360_8118.jpg','Jipeuro...','Вредный избалованный мальчишка вынужден некоторое время жить вдали от привычной ему городской суеты со своей немой бабушкой. Казалось бы, беспомощная старая женщина — удобный объект для проявления детской жестокости. Но бабушка терпелива и мудра, она обладает даром, против которого жестокость бессильна — даром любви.','$2 000 000'),(8119,'Фанатка',2002,85,0.0,6.2,6189,'2002-08-19','https://st.kp.yandex.net/images/film_iphone/iphone360_8119.jpg','Swimfan','Бен Кронин — баловень судьбы. Он встречается с красивой девушкой и усердно тренируется, чтобы попасть в университетскую команду по плаванию. Всё резко меняется, когда в город приезжает Мэдисон Белл. Их первые встречи довольно невинны, но вскоре она становится самой верной фанаткой Бена и превращает его жизнь в кошмар.','$10 000 000'),(8120,'Глаз бури',2001,113,0.0,6.5,824,'2001-12-14','https://st.kp.yandex.net/images/film_iphone/iphone360_8120.jpg','The Other Side of Heaven','Простой деревенский парень Джон Гроберг пересекает океан и становится миссионером на далеких и экзотических Тонганских островах. За спиной он оставляет семью и настоящую любовь его жизни Джин, чьи письма поддерживают его дух в трудные времена.<br><br>Джону предстоит преодолеть языковой барьер, психологические преграды и глубокие подозрения, чтобы завоевать доверие и любовь тонганского народа, которому он пришел служить. За три года, что он проведет на островах, он приобретет друзей и мудрость. Эта одиссея изменит его жизнь навсегда.','$7 000 000'),(8121,'Куб 2: Гиперкуб',2002,94,0.0,6.4,28774,'2002-07-29','https://st.kp.yandex.net/images/film_iphone/iphone360_8121.jpg','Cube 2: Hypercube','Таинственный гиперкуб, загадочное творение безумного гения, вновь наполняется невинными жертвами. Восемь незнакомцев очутились в странных комнатах, где действуют лишь законы четвертого измерения, играющие злые шутки с пространством и временем.<br /><br />В отчаянии, пытаясь найти выход из запятнанного кровью лабиринта, где любой неосторожный шаг равносилен самоубийству, они вскоре понимают, что сумеют выжить, только если разгадают все тайны гигантской мозаики смертоносных ловушек, прежде чем она распадется на части вместе со своими пленниками.','Нет данных'),(8122,'Любимец женщин',2002,106,0.0,6.6,2145,'2002-05-09','https://st.kp.yandex.net/images/film_iphone/iphone360_8122.jpg','Roger Dodger','Эта «черная» комедия рассказывает историю специалиста по рекламе по имени Роджер, меняющего женщин, как перчатки, который дает советы, как добиться благосклонности от противоположного пола, своему несовершеннолетнему племяннику, который никак не расстанется со своей девственностью.<br /><br />Фильм предоставляет зрителю возможность провести 24 часа, наблюдая за их диковатыми приключениями в Нью-Йорке.','Нет данных'),(8123,'Заплатить сполна',2002,97,0.0,7.1,669,'2002-08-09','https://st.kp.yandex.net/images/film_iphone/iphone360_8123.jpg','Paid in Full','Действие фильма происходит в Гарлеме в Нью-Йорке в 1986 году. История Эйса, мусорщика, который жаждет дорогих автомобилей и роскошной одежды как у его друзей Митча и Кэлвина. Благодаря случаю мир Эйса внезапно изменяется.<br><br>В обычной прачечной он знакомится с Лулу, чья роскошная квартира и драгоценности говорят о многом. Эйс быстро вливается в мир наркотиков, где легкие деньги предоставляют ему власть в преступном мире, полном смерти.','Нет данных'),(8124,'Один дома',1990,103,0.0,8.2,431340,'1990-11-10','https://st.kp.yandex.net/images/film_iphone/iphone360_8124.jpg','Home Alone','Американское семейство отправляется из Чикаго в Европу, но в спешке сборов бестолковые родители забывают дома… одного из своих детей. Юное создание, однако, не теряется и демонстрирует чудеса изобретательности. И когда в дом залезают грабители, им приходится не раз пожалеть о встрече с милым крошкой.','$18 000 000'),(8125,'Красотка',1990,115,0.0,7.9,154134,'1990-03-23','https://st.kp.yandex.net/images/film_iphone/iphone360_8125.jpg','Pretty Woman','Финансовый магнат Эдвард Льюис, проезжая по ночному городу, останавливается около красивой женщины. Ее зовут Вивьен и она берет только наличными. Наутро он понимает, что не хочет расставаться с ней и предлагает девушке остаться в его номере в отеле еще на некоторое время — за дополнительный гонорар.<br><br>Вивьен оказывается в море блеска и лжи. Она терпит небрежное отношение к ней ради понравившегося мужчины, который перестал быть для нее просто клиентом.','$14 000 000'),(8126,'Крокодил Данди',1986,97,0.0,7.2,24962,'1986-04-24','https://st.kp.yandex.net/images/film_iphone/iphone360_8126.jpg','Crocodile Dundee','Американская журналистка приезжает в глубинку Австралии, и охотник на крокодилов знакомит ее с местными достопримечательностями. Она же приглашает его в Нью-Йорк, и там отважный охотник попадает в неведомые ему джунгли…','AUD 8 800 000'),(8127,'Фирма',1993,154,0.0,7.2,12624,'1993-06-23','https://st.kp.yandex.net/images/film_iphone/iphone360_8127.jpg','The Firm','Том Круз играет выпускника юридического факультета университета в Гарварде. Честолюбивого и амбициозного, женатого на богатой красотке, которого приглашают работать на отличных условиях в небольшую юридическую фирму.<br><br>Молодой фирмач мечтает о высотах карьеры, однако вскоре обнаруживает, что его фирма обслуживает влиятельные мафиозные кланы Чикаго. Отказаться от сотрудничества с ними — значит подписать себе смертельный приговор. С другой стороны, за ним начинают следить сотрудники ФБР.','$42 000 000'),(8128,'Роковое влечение',1987,119,0.0,7.2,12764,'1987-09-16','https://st.kp.yandex.net/images/film_iphone/iphone360_8128.jpg','Fatal Attraction','Беззаботной и счастливой была жизнь адвоката Дэна Галлагера с молодой женой Бэт и пятилетней дочерью Эллен до того рокового дня, когда Бэт и Эллен отправились за город к родителям, а у Дэна появилось два дня «свободы» от семейных уз. Почувствовав мимолётное влечение к Алекс Форрест — новой сотруднице обслуживаемой им фирмы, он был польщён взаимностью дамы и провёл с ней несколько часов любви, сначала в своём доме, а затем уже на квартире любовницы. <br><br>К исходу второго дня Дэн хотел благополучно вернуться к своему семейному очагу, но оказалось, что теперь он зажат мёртвой хваткой настоящей любовной маньячки. Она начала с того, что перерезала себе вены, и охваченному паникой Дэну пришлось бинтовать ей руки и утешать. Когда Дэну всё же удалось вырваться от Алекс к себе домой, его жизнь превратилась в настоящий кошмар…','$14 000 000'),(8129,'101 далматинец',1961,79,0.0,8.0,66895,'1961-01-25','https://st.kp.yandex.net/images/film_iphone/iphone360_8129.jpg','One Hundred and One Dalmatians','История поиска и спасения щенят далматинских догов, которые были похищены у своих хозяев по приказу злобной фурии, Стервеллы Де Виль. Алчная модница задумала сшить себе пятнистый меховой наряд из шкурок бедных малюток. Однако животные, объединившись, ухитряются проучить ее.','$4 000 000'),(8131,'Смертельное оружие 3',1992,118,0.0,7.7,37757,'1992-05-11','https://st.kp.yandex.net/images/film_iphone/iphone360_8131.jpg','Lethal Weapon 3','Третий фильм о неустрашимом полицейском Риггсе. На этот раз Мартин и его напарник Роджер сталкиваются с гангстерами, похищающими оружие со склада полиции. Преступную группу, за которой тянется длинный кровавый след, возглавляет бывший сержант Джек Тревис. Найти улики против «грязного» полицейского напарникам помогает Лорна Коул — решительная женщина-полицейский, которая не останавливается перед лицом опасности и уверенно вступает в схватку с противниками.','$35 000 000'),(8132,'Лихорадка субботнего вечера',1977,118,0.0,7.3,6255,'1977-12-12','https://st.kp.yandex.net/images/film_iphone/iphone360_8132.jpg','Saturday Night Fever','Простой рабочий парень из Бруклина вкалывает всю неделю с утра до вечера как проклятый, живет как заведенный, и всё ради того, чтобы в субботу отправиться на свою любимую дискотеку со своей любимой девушкой и танцевать там до потери сознания. Танцевать, забыв о каких бы то ни было ритуалах и правилах.','$3 000 000'),(8133,'Книга джунглей',1967,78,0.0,7.8,30146,'1967-10-18','https://st.kp.yandex.net/images/film_iphone/iphone360_8133.jpg','The Jungle Book','Выращенный волками человеческий детеныш Маугли по решению стаи должен вернуться к людям, чтобы не попасть в лапы к тигру-людоеду Шер Хану. Вместе с пантерой Багирой Маугли отправляется в путь, навстречу неожиданным знакомствам и опасным приключениям.<br><br>Он подружится с беспечным медведем Балу, будет похищен обезьянами, станет пленником коварного удава Каа, и еще много чего случится со смелым мальчиком, который по словам самого Киплинга «любит дергать смерть за усы».','Нет данных'),(8134,'Ведьма из Блэр: Курсовая с того света',1999,81,0.0,6.5,43768,'1999-01-25','https://st.kp.yandex.net/images/film_iphone/iphone360_8134.jpg','The Blair Witch Project','В октябре 1994 года трое студентов-кинематографистов исчезли в лесах штата Мэриленд во время съемок документального фильма. Год спустя снятый ими материал был найден.<br><br>Они приехали в лес на Чёрных холмах, чтобы снять документальный фильм о местной легенде — Ведьме из Блэр, мучившей и убивавшей всех, кто забредал в её владения. В предании говорится о вековом проклятии, ритуальных убийствах детей, зловещих артефактах и сверхъестественных явлениях. Но не успели студенты, вооруженные 16-миллиметровой камерой, углубиться в лес, как безнадежно заблудились. Вокруг них сгущается невидимое зло.','$22 000'),(8135,'Уж кто бы говорил',1989,93,0.0,7.4,15293,'1989-10-12','https://st.kp.yandex.net/images/film_iphone/iphone360_8135.jpg','Look Who\'s Talking','Молодая, но уже не юная Молли — будущая мать-одиночка. По дороге в роддом она знакомится с сердобольным таксистом Джеймсом. И с этого момента Джеймс становится другом молодой мамы и сиделкой для малыша Мики. <br><br>Казалось бы, все просто. Но дело в том, что у Мики еще до рождения прорезался внутренний голос. То есть малыш все видит, все понимает, просто еще не умеет говорить вслух. Но сам с собой он разговаривает голосом Брюса Уиллиса.','$7 500 000'),(8136,'Выкуп',1996,139,0.0,7.4,13511,'1996-11-01','https://st.kp.yandex.net/images/film_iphone/iphone360_8136.jpg','Ransom','У преуспевающего владельца авиакомпании похищают сына и требуют выкуп в 2 миллиона долларов. Том Муллен по настоянию жены сообщает о похищении в ФБР, и зритель видит детально выписанную работу специалистов в контакте с отцом. <br><br>Выясняется, что в прошлом у Муллена было черное пятно — он дал в свое время взятку и избежал тюрьмы, куда попал другой человек. Фильм имеет довольно неожиданную развязку.','$80 000 000'),(8137,'Черепашки-ниндзя',1990,93,0.0,7.0,15526,'1990-03-30','https://st.kp.yandex.net/images/film_iphone/iphone360_8137.jpg','Teenage Mutant Ninja Turtles','Четыре черепашки и крыса в канализационных трубах Нью-Йорка вляпались в радиационные отходы, мутировали и превратились в человеческого роста разумных черепашек, а крыса, которая раньше жила у японского мастера ниндзя-цу, обучила их боевым искусствам.<br><br>Черепашки Леонардо, Рафаэль, Микеланджело и Донателло подружились с тележурналисткой и помогли остановить рост молодежной преступности.','$13 500 000'),(8138,'Шоу ужасов Рокки Хоррора',1975,100,0.0,7.8,8338,'1975-08-14','https://st.kp.yandex.net/images/film_iphone/iphone360_8138.jpg','The Rocky Horror Picture Show','На свадьбе друзей Джэнет ловит букет невесты, и её парень Брэд предлагает ей руку и сердце. Обручившись, парочка решает сообщить радостную новость своему учителю и отправляется в путь, но по дороге колесо спускает, и молодые люди оказываются в старинном замке эксцентричного доктора Фрэнк-н-Фуртера. Доктор знакомит их со своим новым произведением — мускулистым молодым человеком по имени Рокки. Этот дом и все его обитатели существуют по своим законам. Здесь под энергичную музыку возможно все то, что неприемлемо в приличном обществе. И порой кажется, что все это происходит на какой-то другой планете.','$1 200 000'),(8139,'Дорогая, я уменьшил детей',1989,90,0.0,7.0,33601,'1989-06-23','https://st.kp.yandex.net/images/film_iphone/iphone360_8139.jpg','Honey, I Shrunk the Kids','Последнее изобретение великого новатора профессора Залински — электромагнитная машина которая может уменьшать предметы. Когда чудо техники, наконец, заработало, этими предметами оказались… дети изобретателя, попавшие в поле действия прибора.<br><br>Они и так не отличались гигантским ростом, а теперь еще и сократились в размере настолько, что их вообще не стало видно. Ничего не подозревающий отец опять же совершенно случайно выбрасывает своих отпрысков в мусорное ведро.<br><br>Новоиспеченным лилипутам нужно выбраться из помойки как можно быстрее пока их не затоптали тараканы и вернуться домой чтобы обнять заботливого папочку.','$18 000 000'),(8140,'Смоки и Бандит',1977,96,0.0,7.6,3569,'1977-05-19','https://st.kp.yandex.net/images/film_iphone/iphone360_8140.jpg','Smokey and the Bandit','Парочка водителей, Бандит и Снеговик, берутся перевезти грузовик контрабандного пива из Тексарканы в Атланту за 48 часов. Схема проста: пока Бандит отвлекает полицейских, Снеговик спокойно на грузовике едет за ним. В то же время шериф Бьюфорд Джастис решает во что бы то не стало поймать Бандита, так как невеста его сына сбежала со свадьбы и села к Бандиту в машину…','Нет данных'),(8141,'Завтра не умрет никогда',1997,119,0.0,7.1,21235,'1997-12-09','https://st.kp.yandex.net/images/film_iphone/iphone360_8141.jpg','Tomorrow Never Dies','Медиамагнат Элиот Карвер, один из самых влиятельных и богатых людей планеты. Он хочет присоединить Китай к своей глобальной телекоммуникационной империи. Китай как всегда не спешит с решением, и это выводит Карвера из равновесия. Для достижения своих целей он не остановится ни перед чем.<br><br>А имея в распоряжении самый эффективный инструмент формирования общественного мнения, он готов даже спровоцировать третью мировую войну. Чтобы предотвратить катастрофу, Джеймсу Бонду необходимо использовать все свои необыкновенные способности, благо прогресс не стоит на месте, и Бонда вовремя снабжают новыми высокотехнологичными разработками из шпионских лабораторий.','$110 000 000'),(8142,'Клетка для пташек',1996,117,0.0,7.2,3421,'1996-03-08','https://st.kp.yandex.net/images/film_iphone/iphone360_8142.jpg','The Birdcage','Арман и Альберт живут жизнью, с их точки зрения, идеальной. Они с успехом содержат кичевый ночной клуб в самом центре Майами. Но их уютное спокойствие внезапно сотрясает возвращение сына Армана, который собирается жениться на дочери ультраконсервативного сенатора Кили.<br><br>Мало того — сенатор с женой — уже в пути, чтобы поспеть к ужину, за которым и должно состояться их знакомство с мистером и миссис Идеальная Семья. Смогут ли Арман и Альберт обвести их вокруг пальца? Миленькое представление ожидает застойного консерватора. Чтобы замаскироваться, ему придется примерить шифоновый наряд!','$31 000 000'),(8143,'Телохранитель',1992,129,0.0,7.9,69510,'1992-11-25','https://st.kp.yandex.net/images/film_iphone/iphone360_8143.jpg','The Bodyguard','Фрэнк Фармер, сотрудник службы безопасности президента Рейгана, чувствует себя отчасти виновным в том, что в его отсутствие на президента было совершено покушение. Он покидает службу и за большой гонорар, но все же нехотя, нанимается телохранителем чернокожей певицы и актрисы Рэйчел Мэррон, которая постоянно получает письма с угрозами. Первоначальная антипатия, возникшая между ними, постепенно перерастает в любовь. Сложившаяся ситуация мешает телохранителю исполнять свой профессиональный долг, что приводит к частым конфликтам между Фрэнком и Рэйчел…','$40 000 000'),(8144,'Двойной просчет',1999,105,0.0,7.4,16403,'1999-09-21','https://st.kp.yandex.net/images/film_iphone/iphone360_8144.jpg','Double Jeopardy','Молодая женщина отбывала срок за преступление, которого она не совершала. Более того, выяснилось, что подставил её собственный муж. Однако супруг не знал, на что способна Либби, когда её вероломно предают. Срок закончился, и героиня отправляется искать справедливость. А вслед за ней — офицер по надзору за выпущенными на свободу заключёнными.','$70 000 000'),(8145,'Вздымающийся ад',1974,165,0.0,7.2,2288,'1974-12-16','https://st.kp.yandex.net/images/film_iphone/iphone360_8145.jpg','The Towering Inferno','В роковую ночь группа несчастных гостей остается запертой страшным пожаром на верхних этажах небоскреба. Архитектор здания, ставший вынужденным узником своего творения, пытается помочь шефу пожарных спасти людей.','$14 000 000'),(8146,'Парень-каратист 2',1986,113,0.0,6.6,3334,'1986-06-19','https://st.kp.yandex.net/images/film_iphone/iphone360_8146.jpg','The Karate Kid Part II','Учитель карате Мийаги покидает Лос-Анджелес и едет на Окинаву к своему умирающему отцу. Дэниел сопровождает его во время поездки. Там Мийаги встречает своего давнего врага, а Дэниел — наживает нового…','Нет данных'),(8147,'Русалочка',1989,83,0.0,8.2,139449,'1989-11-13','https://st.kp.yandex.net/images/film_iphone/iphone360_8147.jpg','The Little Mermaid','Таинственные глубины моря хранят немало тайн, а обитатели океана могут рассказать множество удивительных историй. И самой невероятной из них была и остаётся история русалочки Ариэль. Дочь могущественного царя подводного мира Тритона, она однажды влюбляется в прекрасного и мужественного принца. Но разве они могут быть вместе — земной человек и морская дева? Однако настоящие чувства преодолевают любые преграды. Ради своей любви Ариэль готова пойти на всё. Даже если для обретения своего счастья ей навсегда придётся покинуть родной океан и навеки стать земной девушкой…','$40 000 000'),(8148,'Супермен 2',1980,116,0.0,6.3,5852,'1980-12-04','https://st.kp.yandex.net/images/film_iphone/iphone360_8148.jpg','Superman II','Оказывается, он не единственный уцелевший житель погибшей планеты. На Землю попадают три криптонианина-злодея. Они обладают такими же силами, как и Супермен, и собираются уничтожить человечество. Супермену предстоит сразиться с безжалостными врагами и встретить любовь.','$54 000 000'),(8149,'Как ни крути – проиграешь',1978,114,0.0,6.6,733,'1978-12-16','https://st.kp.yandex.net/images/film_iphone/iphone360_8149.jpg','Every Which Way but Loose','Фило Беддо — обычный парень: любит сидеть за рулём своего пикапчика и выпить пивка. Правда, в отличие от других парней, он — лучший кулачный боец на всём Западе, за плечами которого солидное многообразие рукопашных разборок в барах по ту сторону Скалистых Гор.<br><br>Лучший друг и напарник Беддо — громадный, девяностокилограммовый орангутанг по имени Клайд, который тоже при случае может врезать, как следует! Бедолагу Фило угораздило влюбиться в капризную певичку, из-за которой он, собственно, и пускается «во все тяжкие».<br><br>Особенных препятствий на пути отчаянного героя к светлому чувству нет, если не считать зверскую банду байкеров, двух подлых полицейских и легендарного драчуна Мёрдока по кличке «Танк»!','$5 200 000'),(8150,'Порки',1981,94,0.0,6.4,1336,'1981-11-13','https://st.kp.yandex.net/images/film_iphone/iphone360_8150.jpg','Porky\'s','Флорида 1954 год, группа учащихся старшей школы, решают помочь своему другу потерять девственность. Для этого они едут в стрип-бар Порки, расположенный вне города, из-за слуха, что в баре можно снять проститутку. Порки берет деньги подростков и обещает им «незабываемую ночь», но унижает их и вышвыривает из бара, тут же к бару подъезжает местный шериф, который оказывается тем еще подонком и по совместительству братом Порки… Но Порки даже не представляет, что унизил не тех ребят и месть не заставит себя долго ждать!','$4 000 000'),(8151,'Интервью с вампиром',1994,123,0.0,8.0,172270,'1994-11-09','https://st.kp.yandex.net/images/film_iphone/iphone360_8151.jpg','Interview with the Vampire: The Vampire Chronicles','К падкому на сенсации журналисту приходит вампир, чтобы поведать историю своей жизни. Все началось в 1791 году, когда молодой плантатор Луи, потеряв жену и ребенка, захотел умереть, но «родился для мрака» и обрёл вечную жизнь.','$60 000 000'),(8152,'С девяти до пяти',1980,110,0.0,6.9,1148,'1980-12-19','https://st.kp.yandex.net/images/film_iphone/iphone360_8152.jpg','Nine to Five','Три разозлённые секретарши — Джуди, Дорали и Вайолет — решают устранить (хотя бы на время) своего нудного шефа, инсценировав его смерть, а на самом деле заключив под домашний арест. Пользуясь моментом, они наводят на работе совершенно иной порядок, наиболее удобный каждому из служащих.','Нет данных'),(8153,'Челюсти 2',1978,116,0.0,6.1,8554,'1978-06-16','https://st.kp.yandex.net/images/film_iphone/iphone360_8153.jpg','Jaws 2','Акула-убийца, несколько лет назад терроризировавшая побережье курортного городка Эмити, вернулась! Гигантский хищник снова начал охоту. Рискуя жизнью, шеф полиции морского парка Мартин Броди вступает в борьбу с чудовищем, чей голод теперь во много раз сильнее!','$20 000 000'),(8154,'Бэмби',1942,72,0.0,8.1,56042,'1942-08-08','https://st.kp.yandex.net/images/film_iphone/iphone360_8154.jpg','Bambi','Однажды утром на маленькой, освещенной весенним солнцем, лесной полянке родился олененок. На нового лесного принца сбежались и слетелись посмотреть все звери и птицы. Олененка назвали Бэмби. <br><br>Когда Бэмби научился ходить и разговаривать он обзавелся друзьями — кроликом Тампером и скунсом Цветочком. А однажды на лугу, куда привела его мама, Бэмби познакомился с маленькой веселой оленихой — Фэйлин. Но жизнь в лесу бывает опасной и жестокой. Впервые Бэмби столкнулся с этим, когда прозрачный осенний лесной воздух пронзили выстрелы из ружья — все звери начали в панике убегать, и тогда Бэмби впервые услышал страшное слово — Человек.','Нет данных'),(8155,'Генеральская дочь',1999,116,0.0,7.0,6090,'1999-06-15','https://st.kp.yandex.net/images/film_iphone/iphone360_8155.jpg','The General\'s Daughter','Убита молодая и красивая женщина, офицер ВС США, дочь прославленного генерала. Расследование загадочного убийства поручают военному следователю, опытному профессионалу Полу Бреннеру. Постепенно тёмное дело начинает обрастать жуткими подробностями. Чтобы найти убийцу, Бреннер должен распутать клубок страшных тайн и скрытых ужасных страстей.','$95 000 000'),(8156,'Мэри Поппинс',1964,139,0.0,7.6,6562,'1964-08-27','https://st.kp.yandex.net/images/film_iphone/iphone360_8156.jpg','Mary Poppins','Семейство Бенкс озабоченно поисками няни для своих детей. И как это бывает только в сказке, она появилась прямо из воздуха, прекрасная, ни на кого не похожая. Как раз такая, какую мечтали бы иметь в своем доме всякие любящие родители.<br /><br />У неё не просто цветущий вид. Она не просто лучше всех умеет готовить, ходить по магазинам, одеваться, танцевать и воспитывать детей. Это всё лишь элементы, лишь составляющие. Нет, тут нечто большее — она именно совершенна, именно лишена недостатков, ибо она — сказочная. Как же не влюбиться в такую…','$6 000 000'),(8157,'В постели с врагом',1991,99,0.0,7.2,17245,'1991-02-04','https://st.kp.yandex.net/images/film_iphone/iphone360_8157.jpg','Sleeping with the Enemy','Благополучная с виду молодая супружеская пара с первых дней совместной жизни пребывает в атмосфере страха и напряжения… Красавица Лора Берни, доведенная до отчаяния ревностью и агрессивностью обожающего ее мужа Мартина и не знающая, как выпутаться из сетей брака, который стал для нее пыткой и тюрьмой, задумывает рискованную интригу.<br><br>Она решает сымитировать собственную гибель. И ей действительно удается начать новую жизнь под другим именем, встретить хорошего человека. Но бывший муж узнает правду и начинает преследование.','$19 000 000'),(8158,'Буйнопомешанные',1980,111,0.0,6.6,724,'1980-12-12','https://st.kp.yandex.net/images/film_iphone/iphone360_8158.jpg','Stir Crazy','Приятели, Скип и Харри, по ложному обвинению в ограблении банка были приговорены к солидному сроку заключения. У друзей возникают большие трудности с адаптацией к непривычным условиям тюрьмы.<br><br>И так бы они и чувствовали себя изгоями и неудачниками среди остальных заключённых, но однажды их охраннику приходит блестящая идея, как использовать Скипа и его таланты на предстоящем тюремном родео. Харри будет на подхвате.','Нет данных'),(8160,'Аэропорт',1970,137,0.0,7.1,2294,'1970-03-05','https://st.kp.yandex.net/images/film_iphone/iphone360_8160.jpg','Airport','Похоже, что начальнику Международного Аэропорта им. Линкольна Мэлу Бейкерсфелду и всей его команде выпал тяжелый денек — необходимо любой ценой поддерживать работу аэропорта в условиях непрекращающегося снега. Но как же это сделать, если сломанный самолет перекрыл одну из взлетно-посадочных полос, а один из пассажиров прячет в своем чемодане бомбу?','$10 000 000'),(8161,'Джуманджи',1995,104,0.0,7.8,163391,'1995-12-15','https://st.kp.yandex.net/images/film_iphone/iphone360_8161.jpg','Jumanji','Случайно обнаружив настольную игру со странным названием «Джуманджи» Алан Пэрриш, не зная о ее сверхъестественных свойствах, на глазах изумленной подружки переносится в джунгли.<br><br>Долгие годы он находится в потустороннем мире, до тех пор, пока двое ни о чем не подозревающих подростков не находят игру и не снимают волшебные чары, освобождая Алана из многолетнего плена. <br><br>Теперь им предстоит решить нелегкую задачу — победить могущественную силу игры, пройти немыслимые препятствия и одержать победу над силами Магии!','$65 000 000'),(8162,'Крепкий орешек 3: Возмездие',1995,131,0.0,7.6,71052,'1995-05-15','https://st.kp.yandex.net/images/film_iphone/iphone360_8162.jpg','Die Hard: With a Vengeance','На улицах Нью-Йорка офицер полиции Джон МакКлейн видел все, что только возможно. На этот раз для того, чтобы отомстить МакКлейну, террорист Саймон, виртуозно устраивающий взрывы, заставляет героя — полицейского играть в смертельную игру. Ставка — город Нью-Йорк.<br><br>МакКлейн вынужден метаться по городу, следуя телефонным указаниям Саймона, готового разнести пол Нью-Йорка за малейшее отклонение от его требований. И в то время, как вся полиция города занята поисками террористов, преступники похищают золотой запас Национального банка США.<br><br>У МакКлейна бывали неудачные деньки за годы службы в полиции, но сегодня у него, похоже, будет исключительно скверный день…','$90 000 000'),(8163,'Мистер Бин',1997,90,0.0,7.3,32491,'1997-07-03','https://st.kp.yandex.net/images/film_iphone/iphone360_8163.jpg','Bean','Мистер Бин работает смотрителем в Королевской Британской Галерее. Начальство давно уволило бы его по формулировке «за сон на рабочем месте», если бы не покровительство директора.<br><br>Вместо этого Бина отправляют в командировку в Лос-Анджелес. Там его принимают за официальное лицо, приехавшее на открытие величайшей выставки США…','$18 000 000'),(8164,'Скалолаз',1993,113,0.0,7.3,30059,'1993-05-20','https://st.kp.yandex.net/images/film_iphone/iphone360_8164.jpg','Cliffhanger','В горах после снежной лавины теряются 5 человек. На их поиски отправляется один из лучших альпинистов и горных проводников — Гейб Уокер. Неожиданно он понимает, что его специально заманили в горы для совершенно другого дела.<br><br>Также становится ясно, что Гейб станет нежелательным свидетелем, от которого без раздумья «избавятся». Но свою жизнь он терять так просто не собирается и объявляет безжалостную войну банде вооруженных до зубов боевиков под предводительством международного террориста Эрика Куалена…','$70 000 000'),(8165,'Водный мир',1995,134,0.0,7.6,82790,'1995-07-28','https://st.kp.yandex.net/images/film_iphone/iphone360_8165.jpg','Waterworld','В далеком будущем полярные снега растаяли, покрыв всю Землю водой. Авторы погружают нас в фантастический мир немногочисленных людей, живущих на воде, где самым дорогим являются пресная вода, земля, еда, сигареты и т. п.<br><br>«Курильщики» убивают, грабят, обращают в рабство — используют двигатели внутреннего сгорания. Все остальные пытаются выжить, кто как может, а Кевин Костнер плавает сам по себе на своей фантастической лодке, но объединяет их всех одно — все они ищут остров.<br><br>В одной из колоний живут очень красивая женщина и девочка с татуировкой на спине. А татуировка эта — часть карты, на которой и указан этот остров. Естественно, за ней и охотятся «курильщики»…','$175 000 000'),(8166,'Лунный гонщик',1979,126,0.0,6.7,7980,'1979-06-26','https://st.kp.yandex.net/images/film_iphone/iphone360_8166.jpg','Moonraker','За маской добропорядочного американского миллиардера Дракса скрывается сумасшедший учёный. Он вынашивает безумный план: устроить на Земле апокалипсис, и когда на планете не останется ни одной живой души, населить её выращенными на космической станции суперлюдьми. Чтобы помешать планам Дракса, Бонду приходится побывать в Калифорнии, Бразилии, джунглях Амазонки и, в конце концов, даже отправиться в космос.','$34 000 000'),(8167,'Шпион, который меня любил',1977,125,0.0,7.1,8805,'1977-07-07','https://st.kp.yandex.net/images/film_iphone/iphone360_8167.jpg','The Spy Who Loved Me','Спасая мир от безумного злодея Стромберга, который разрабатывает план по уничтожению жизни на земле с помощью сверхмощного звука, Джеймс Бонд знакомится с очаровательной русской разведчицей. Вместе они вступают в неравную схватку с негодяем и его преданным слугой Джозом.<br><br>Это по-настоящему гигантского размера детина с железными зубами, которыми он с легкостью перекусывает толстый стальной трос. Для того чтобы уравнять силы Бонду предоставляют абсолютно эксклюзивный спортивный автомобиль «Лотос», который может плавать под водой и стрелять разными видами ракет.','$14 000 000'),(8168,'Рэмбо 3',1988,102,0.0,5.7,21620,'1988-05-25','https://st.kp.yandex.net/images/film_iphone/iphone360_8168.jpg','Rambo III','Ветеран вьетнамской войны Джон Рэмбо, уставший от своих военных и гражданских подвигов, поселяется в буддистском монастыре. Однако долго пребывать в мире ему не приходится. Захвачен в плен его бывший командир, и Рэмбо отправляется его спасать, вступая в отчаянную и неравную схватку с противником.','$63 000 000'),(8169,'Космический джем',1996,87,0.0,7.3,27625,'1996-11-10','https://st.kp.yandex.net/images/film_iphone/iphone360_8169.jpg','Space Jam','Мультмонстры с планеты «Гора придурков» вторгаются на Землю, желая захватить персонажей популярного анимационного сериала «Looney Toons». Земные зверюшки во главе с кроликом Багзом Банни предлагают на спор сыграть в баскетбол, привлекая на свою сторону суперзвезду Майкла Джордана.','$80 000 000'),(8171,'Только для твоих глаз',1981,127,0.0,7.0,7693,'1981-06-24','https://st.kp.yandex.net/images/film_iphone/iphone360_8171.jpg','For Your Eyes Only','На этот раз агенту 007 предстоит захватывающая дух гонка с русскими коллегами. Дело в том, что Британские военные умудрились утопить в Ионическом море абсолютно секретное оборудование. Если аппаратура попадет в руки советским разведчикам, это может привести к ужасающим для Великобритании и всего мира последствиям.<br><br>Бонду приходится с безумной скоростью прокатиться по трассе для бобслея, повисеть на одной руке над бездонной пропастью, участвовать в захватывающем дух подводном сражении с применением новейшего шпионского оружия. В этом непростом соревновании Бонду помогает великолепная красавица Милена, которая одинаково хорошо владеет боевым арбалетом и, что еще более опасно, искусством обольщения.','$28 000 000'),(8172,'Западня',1999,113,0.0,7.4,18998,'1999-04-15','https://st.kp.yandex.net/images/film_iphone/iphone360_8172.jpg','Entrapment','Следователь страховой компании Вирджиния Бейкер идёт по следу легендарного вора Роберта Макдугала, который специализируется на уникальных произведениях искусства. Чтобы взять Макдугала с поличным, Бейкер выдаёт себя за преступницу и пытается втереться к нему в доверие. Но её интересует отнюдь не торжество правосудия…','$66 000 000'),(8173,'Осьминожка',1983,131,0.0,6.9,7892,'1983-06-06','https://st.kp.yandex.net/images/film_iphone/iphone360_8173.jpg','Octopussy','При таинственных обстоятельствах погибает коллега Джеймса Бонда агент 009. Чтобы разобраться в этом преступлении Бонду предстоит прокатиться в Индию, где он встречается с роковой женщиной, умопомрачительной красоткой по прозвищу Осьминожка.<br><br>Активно пользуясь своими глубочайшими знаниями женской психологии, агент 007 выходит на след абсолютно безумного и столь же амбициозного отставного русского генерала, который мечтает развязать третью мировую войну и захватить все Европейские государства.<br><br>Несмотря на то, что Бонд использует всевозможные приспособления из шпионского арсенала, даже летает на миниатюрном реактивном самолетике, оставить его в живых или убить решает таинственная красавица.','$27 500 000'),(8174,'102 далматинца',2000,100,0.0,6.1,16878,'2000-11-22','https://st.kp.yandex.net/images/film_iphone/iphone360_8174.jpg','102 Dalmatians','Злодейка Стервела де Виль, которая собиралась сшить из шкур пятнистых щенков роскошный меховой плащ, выпущена из тюрьмы, где полностью изменилась и стала упорной защитницей прав животных. И когда наши далматинцы вдруг тайно исчезают, подозрение, естественно, падает на нее. <br><br>Тем не менее Стервела, кажется, не имеет к этому никакому отношения. Но в самом ли деле? Кто-то должен выяснить правду о пропаже пятнистой ватаги. Например, такая необыкновенная команда: женщина-полицейский Хло, собственник собачьего приюта Кевин, лишенный пятен далматинец и сумасшедший попугай, который считает себя… собакой! Настоящие герои и они докопаются до истины!','$85 000 000'),(8175,'Заклинатель лошадей',1998,170,0.0,7.6,4565,'1998-05-15','https://st.kp.yandex.net/images/film_iphone/iphone360_8175.jpg','The Horse Whisperer','Самое страшное испытание для любой матери — несчастье с ее ребенком. Энни Маклин убедилась в этом на собственном опыте. Во время верховой прогулки серьезно пострадала ее дочь. Энни бессильна помочь несчастной девочке и в отчаянии увозит ее из шумного города на Дикий Запад, прочь от суеты и печальных воспоминаний.<br><br>Мать и дочь не подозревают, что здесь они встретят человека, которому под силу изменить их судьбу. Том Букер — укротитель лошадей, обладающий таинственной властью над животными. И его глубокий дар способен исцелять душевные раны.','$60 000 000'),(8176,'Специалист',1994,110,0.0,6.8,11965,'1994-10-07','https://st.kp.yandex.net/images/film_iphone/iphone360_8176.jpg','The Specialist','Шэрон Стоун — в роли сексапильной красотки Мэй с роковым прошлым. Она поклялась отомстить гангстерам, убившим ее родителей, и уже выбрала способ, как с ними расправиться, и нашла человека, который это сделает: внешне невозмутимый бывший эксперт — подрывник ЦРУ Рэй.<br><br>Майами, курорт для сверхбогачей, превращается в охотничью территорию, где Мэй заманивает и соблазняет убийц, а Рэй мастерски взрывает их, превращая в пепел.','$45 000 000'),(8177,'Пик Данте',1997,109,0.0,6.9,12861,'1997-02-07','https://st.kp.yandex.net/images/film_iphone/iphone360_8177.jpg','Dante\'s Peak','Ученый-вулканолог Гарри Далтон, потерявший жену во время извержения вулкана, отправляется на Пик Данте, в маленький городок, расположенный на северо-западном побережье, для того, чтобы заняться там рутинной работой — исследованием сейсмической ситуации.<br><br>Ученый немедленно обнаруживает тревожные признаки надвигающейся катастрофы, грозящей обернуться концом света. Правительство не обращает внимания на его грозные предупреждения, и лишь мэр городка Пик Данте Рэчел Уэндо, с которой у него завязался роман, осознает весь ужас положения и спешит к нему на помощь.','$116 000 000'),(8178,'Совершенный мир',1993,138,0.0,8.0,44634,'1993-11-24','https://st.kp.yandex.net/images/film_iphone/iphone360_8178.jpg','A Perfect World','Батч Хейнс — закаленный жизнью преступник, бежавший вместе с юным заложником, видящим в Батче отца, которого у него никогда не было. Ред Гарнетт — хитрый техасский рейнджер, предводитель шерифов. Ему знакомы каждая тропинка и укрытие. И более того — ему знаком и неуловимый Хейнс, ведь их пути уже пересекались однажды.','$30 000 000'),(8179,'Секретные материалы: Борьба за будущее',1998,121,0.0,7.5,19391,'1998-06-19','https://st.kp.yandex.net/images/film_iphone/iphone360_8179.jpg','The X Files','Даллас, штат Техас. Бомба террориста уничтожает здание. В ходе расследования спецагенты ФБР Фокс Малдер и Дана Скалли сталкиваются с тайным заговором, превосходящим по опасности все, что они до этого встречали. Рискуя собственной жизнью и карьерой, Малдер и Скалли делают все для уничтожения смертельного вируса, способного поразить все живое на Земле и, возможно, имеющего внеземное происхождение.<br><br>В этой погоне за правдой они выходят на таинственный синдикат, состоящий из могущественных людей, которые не остановятся ни перед чем ради сохранения своих секретов. Люди синдиката преследуют агентов в техасской пещере, штабе ФБР и на секретной базе в Антарктике, хранящей самый главный секрет…','$66 000 000'),(8180,'Газонокосильщик 2: За пределами киберпространства',1996,92,0.0,4.4,2242,'1996-01-12','https://st.kp.yandex.net/images/film_iphone/iphone360_8180.jpg','Lawnmower Man 2: Beyond Cyberspace','Косильщик лужаек Джоуб не погиб в пламени, а стал обитателем виртуальной реальности и приступил к работе над созданием новой компьютерной системы — глобальной сети, связывающей все компьютеры так, чтобы было невозможно из нее высвободиться. Безумный Джоуб пытается воссоздать открытие своего «создателя», ученого Бенджамина Трэйса — универсальный компьютерный чип.','Нет данных'),(8181,'Джинна вызывали?',1996,93,0.0,5.9,3079,'1996-07-17','https://st.kp.yandex.net/images/film_iphone/iphone360_8181.jpg','Kazaam','Маленького Макса в школе и на улице обижают злые мальчишки. Родители у него давно расстались, и мама нашла нового мужчину, который Максу совсем не нравится. Макс любит смотреть на звёзды и мечтать о том, что когда-нибудь папа и мама помирятся и снова будут вместе.<br><br>И вот однажды, спасаясь от хулиганов, Макс проваливается в подвал старого дома и пробуждает ото сна Казаама, настоящего джинна, чернокожего верзилу с добродушной физиономией. Казаам, как и полагается сказочному джинну, предлагает Максу загадать три желания. Ирония состоит в том, что джинн не очень-то любит людей…','$20 000 000'),(8182,'Леонард шестой',1987,85,0.0,2.1,123,'1987-12-17','https://st.kp.yandex.net/images/film_iphone/iphone360_8182.jpg','Leonard Part 6','Семь лет назад, после развода с женой, агент ЦРУ Леонард Паркер ушел в отставку и занялся ресторанным бизнесом. Но экстремальные обстоятельства заставляют его снова вернуться в строй. Виновница переполоха — злобная женщина-вегетарианка Медуза Джонсон, одержимая манией величия.<br><br>Ей, в прошлом доктору, удалось найти способ воздействовать на подсознание зверюшек, превращая их в монстров. Теперь эти чудовища — коты, кролики, рыбы и друге представители фауны — совершают кровавые нападения на жителей Сан-Франциско. И остановить этот кошмар по силам одному лишь Леонарду.','Нет данных'),(8235,'Обитатели холмов',1978,101,0.0,7.5,1979,'1978-10-14','https://st.kp.yandex.net/images/film_iphone/iphone360_8235.jpg','Watership Down','Фильм, как и одноимённая книга, повествует о приключениях кроликов. В поисках нового дома, группа кроликов попадает в различные передряги.','Нет данных'),(8288,'Убийцы',1946,97,0.0,7.3,1528,'1946-08-28','https://st.kp.yandex.net/images/film/8288.jpg','The Killers','От пуль наемных убийц погибает скромный служащий бензоколонки. Страховой агент Реардон расследует это на первый взгляд случайное преступление.<br><br>Раскручивая нить жизни погибшего «Шведа», Реардон раскрывает тайну кровавых преступлений и предательств, в центре которых ослепительная женщина-вамп Китти Коллинз. Он слишком близко подходит к давней загадке исчезнувших 250 000 долларов и теперь у него появляется новая задача: выжить!','Нет данных'),(8289,'Риф Ларго',1948,100,0.0,7.4,1456,'1948-07-15','https://st.kp.yandex.net/images/film_iphone/iphone360_8289.jpg','Key Largo','В одном из флоридских отелей появляется ветеран войны Фрэнк МакЛауд. В отеле хозяйничают гангстер Джонни Рокко и его банда. Они держат в заложниках постояльцев отеля. Фрэнк пытается остановить Джонни, пока он не уничтожил всех обитателей гостиницы…','Нет данных'),(8342,'Дьяволицы',1954,114,0.0,7.8,5247,'1955-01-29','https://st.kp.yandex.net/images/film_iphone/iphone360_8342.jpg','Les diaboliques','Директор частной школы Мишель Деласаль — плохой муж и очень плохой человек. Его не выносят коллеги, жена Кристина и даже его любовница Николь. Кристина, которой на самом деле принадлежит школа, хочет развода, но Мишель заявляет, что скорее убьёт несчастную женщину, чем допустит своё разорение.<br><br>Доведенные до предела, бывшие соперницы решаются на крайний шаг — утопить Мишеля во время уикенда. Останется только спрятать труп, заявить в полицию об исчезновении и забыть об этом кошмаре. Но вдруг тело исчезает, а Кристину начинают преследовать странные видения… Тем временем, отставной инспектор Фише начинает поиски исчезнувшего мужа директрисы.','Нет данных'),(8343,'Анатомия убийства',1959,154,0.0,7.6,2806,'1959-07-01','https://st.kp.yandex.net/images/film_iphone/iphone360_8343.jpg','Anatomy of a Murder','Лейтенант армии Фредерик Манайон арестован за убийство владельца бара Барни Куилла. Он утверждает, что бармен избил и изнасиловал его жену Лауру. И, хотя Лаура полностью подтверждает версию мужа, судмедэксперт не может найти доказательств ее изнасилования.<br><br>Защищать Майнона поручают Полу Биглеру, скромному провинциальному адвокату. Обвиняемый не идет на сотрудничество, дело ведет судья из другого города. Биглер понимает, что предстоит очень трудный процесс, и шансов выиграть дело у него не так уж много…','Нет данных'),(8344,'Дзета',1969,127,0.0,7.7,1775,'1969-02-26','https://st.kp.yandex.net/images/film_iphone/iphone360_8344.jpg','Z','На митинге убит глава либеральной организации «Друзья мира». Полиция пытается представить убийство как несчастный случай. Дело получает сильный резонанс, а расследованием занимается следователь прокуратуры, который шаг за шагом получает доказательства заговора, в котором участвует как полиция, так и верхние эшелоны власти.','Нет данных'),(8345,'И не осталось никого',1945,97,0.0,7.0,630,'1945-10-31','https://st.kp.yandex.net/images/film_iphone/iphone360_8345.jpg','And Then There Were None','Десять незнакомых друг с другом людей приглашены таинственным человеком в его замок, находящийся на небольшом острове в океане. Гости размещаются в замке в ожидании появления хозяина. Но вместо этого за ужином они слышат запись голоса незнакомого человека, который обвиняет каждого прибывшего в тех или иных черных делишках, начиная с неуплаты налогов и заканчивая убийством. <br><br>Голос говорит, что каждого из оказавшихся здесь ждет неминуемая кара за совершенные им преступление. Этим же вечером один из гостей погибает, отравившись подсыпанным в его бокал цианистым калием. И вот встревоженные гости понимают, что предупреждение незнакомца было не шуткой. Но покинуть остров им оказывается не под силу. Им ничего не остается, как попытаться остаться в живых или вычислить убийцу, которым несомненно является кто-то из них самих…','Нет данных'),(8346,'Исчезновение',1988,107,0.0,7.2,2984,'1988-08-29','https://st.kp.yandex.net/images/film_iphone/iphone360_8346.jpg','Spoorloos','Двое влюбленных Рекс и Саския едут из Амстердама во французскую провинцию, чтобы вместе провести отпуск. На одной из заправочных станций Саския решает забежать в магазин за напитками и бесследно исчезает средь бела дня. Проходит три года, и Рекс, у которого к тому времени появилась новая возлюбленная, вдруг решает возобновить поиски Саскии. Он расклеивает плакаты в месте исчезновения девушки, и однажды получает загадочное письмо.','Нет данных'),(8347,'Глубокой ночью',1945,95,0.0,7.5,1059,'1945-09-09','https://st.kp.yandex.net/images/film_iphone/iphone360_8347.jpg','Dead of Night','Таинственный клиент приглашает архитектора Крэйга в свой дом, и по прибытии у Крэйга появляется странное чувство, что это место ему знакомо, несмотря на то, что ранее он никогда тут не бывал. Вскоре выясняется, что это на самом деле кошмарный сон, и чтобы пробудиться, Крэйгу придётся выслушать пять страшных историй от собравшихся здесь людей.','Нет данных'),(8348,'Ангел-истребитель',1962,95,0.0,7.7,3381,'1962-05-16','https://st.kp.yandex.net/images/film_iphone/iphone360_8348.jpg','El Ángel exterminador','После роскошного званого ужина гости вдруг обнаруживают, что в силу каких-то таинственных причин не могут выйти из столовой. Проходит день, другой, и множества тщательно выстроенных фасадов и поз — как не бывало. Исчезают без следа понятия о приличиях, обусловленных положением в обществе, люди опускаются до примитивного животного состояния.','Нет данных'),(8349,'Красная скрипка',1998,141,0.0,7.5,3722,'1998-09-10','https://st.kp.yandex.net/images/film_iphone/iphone360_8349.jpg','Le violon rouge','Накануне аукциона группа экспертов, возглавляемая Чарльзом Моррицем, исследует необычную по своему цвету и идеально звучащую старинную скрипку. Выясняется ее удивительное прошлое.<br /><br />Созданная в семнадцатом веке итальянским мастером Николо Буссоти, скрипка загадочным образом вершит судьбы своих владельцев, даруя и отнимая любовь, а порой и саму жизнь. Понимая истинную ценность скрипки, неизмеримую деньгами, словно завороженный, Морриц пытается стать ее обладателем.','$18 000 000'),(8350,'Преследование',1999,70,0.0,7.6,14680,'1998-09-12','https://st.kp.yandex.net/images/film_iphone/iphone360_8350.jpg','Following','Молодой писатель в поисках материала встречает вора, который берёт его под своё крыло.','$6 000'),(8351,'Пикник у Висячей скалы',1975,115,0.0,7.5,10447,'1975-08-08','https://st.kp.yandex.net/images/film_iphone/iphone360_8351.jpg','Picnic at Hanging Rock','В 1900 году, в День Святого Валентина, группа австралийских школьниц во главе с учительницей отправляются на пикник в район Висячей скалы, местной достопримечательности. Некоторые из них бесследно исчезают.','AUD 440 000'),(8352,'Вторые',1966,103,0.0,7.6,1314,'1966-05-16','https://st.kp.yandex.net/images/film_iphone/iphone360_8352.jpg','Seconds','Существует одна тайная организация, которая предоставляет сильным мира сего шанс в прямом смысле этого слова начать новую жизнь. Бизнес этот конечно же нелегален, но сверхприбылен, ибо кто же откажется от возможности фактически обрести бессмертие?','Нет данных'),(8353,'Крик',1981,81,0.0,4.3,98,'1981-01-01','https://st.kp.yandex.net/images/film_iphone/iphone360_8353.jpg','Scream','Группа людей отправляется в путешествие на лодках вниз по реке Рио Гранде в Техасе. На ночлег они останавливаются в пустынном городке. Путешественники не видят местных жителей, что их удивляет. Когда наступает ночь, появляются и первые трупы. Искатели приключений в панике, но покинуть городок они не могут: все их лодки оказываются сломаны…','Нет данных'),(8354,'Невеста монстра',1955,69,0.0,4.9,481,'1955-05-11','https://st.kp.yandex.net/images/film_iphone/iphone360_8354.jpg','Bride of the Monster','Доктор Воронов, безумный ученый, пытающийся создать высшую расу, использует атомную энергию. Ему помогает монстрообразный ассистент Лобо. Доктор создает гигантского осьминога, который терроризирует окрестности…','$70 000'),(8357,'Кошмар зомби',1987,83,0.0,3.7,186,'1987-10-13','https://st.kp.yandex.net/images/film_iphone/iphone360_8357.jpg','Zombie Nightmare','Доброго парня-бейсболиста сбивают на машине подонки-тинейджеры. Его возвращает к жизни в виде зомби колдунья-вудуистка дабы он совершил великую месть. Сказано-сделано. С помощью своей любимой биты и под рок-музыку 80-х, зомби крошит подростков направо и налево.','$180 000'),(8359,'Невеста Франкенштейна',1935,72,0.0,7.2,3070,'1935-04-19','https://st.kp.yandex.net/images/film_iphone/iphone360_8359.jpg','Bride of Frankenstein','Отвергнутый всеми монстр ищет себе пару. Доктор Франкенштейн приходит на помощь и создает заветную подругу.','$397 024'),(8360,'Франкенштейн',1931,70,0.0,7.4,6034,'1931-11-21','https://st.kp.yandex.net/images/film_iphone/iphone360_8360.jpg','Frankenstein','Доктор Франкенштейн решил сыграть в азартную игру с жизнью и смертью, создав жуткое чудовище из частей тела, позаимствованных у мертвецов.','$291 000'),(8361,'Вторжение похитителей тел',1955,80,0.0,7.2,3377,'1956-02-05','https://st.kp.yandex.net/images/film_iphone/iphone360_8361.jpg','Invasion of the Body Snatchers','Врач из маленького калифорнийского городка обеспокоен растущим количеством пациентов, утверждающих, что перестали узнавать своих близких: люди становятся равнодушными, бесчувственными. Начав расследование, он обнаруживает, что речь идет о двойниках, создаваемых загадочными космическими пришельцами, планирующими завоевание Земли.','$417 000'),(8362,'Открой глаза',1997,117,0.0,7.6,10049,'1997-12-17','https://st.kp.yandex.net/images/film_iphone/iphone360_8362.jpg','Abre los ojos','Сезар — красивый парень и богатый наследник, однажды влюбившись, уводит девушку у своего друга. И словно в наказание судьба сыграла с ним злую шутку: его лицо стало безобразным.<br><br>Но происходит странное: его прежняя жизнь не утрачена безвозвратно, иногда он по-прежнему красив и счастлив. Что это? Параллельные жизни или одна из них только сон?! Где теперь реальность?','ESP 370 000 000'),(8363,'Система безопасности',1964,112,0.0,7.5,1019,'1964-09-15','https://st.kp.yandex.net/images/film_iphone/iphone360_8363.jpg','Fail Safe','Компьютер военного ведомства США дает сбой, и пилоты ядерных бомбардировщиков получают команду атаковать Москву. Теперь экипажи самолетов не имеют права выходить в эфир, их единственная задача — выполнить миссию любой ценой. У президента США есть несколько часов, чтобы предотвратить надвигающуюся катастрофу.','Нет данных'),(8364,'Человек-невидимка',1933,71,0.0,7.4,2841,'1933-11-03','https://st.kp.yandex.net/images/film_iphone/iphone360_8364.jpg','The Invisible Man','Химик поселяется в маленькой деревенской гостинице и совершает первое убийство. Оказывается, юный химик открыл ужасную формулу, опасный препарат, делающий человеческую плоть невидимой. Интерес у него был исключительно научный, но препарат имел побочный эффект, превративший его в маньяка. Почти сразу же он начинает искать противоядие, которое могло бы вернуть его в нормальное состояние…','Нет данных'),(8365,'Деликатесы',1990,99,0.0,7.2,8494,'1991-04-17','https://st.kp.yandex.net/images/film_iphone/iphone360_8365.jpg','Delicatessen','Домовладелец хозяйничает в мясной лавке на первом этаже и кормит жильцов, которые являются и клиентами, и сырьем для продукции. Беда в том, что в них постоянно влюбляется близорукая и мышеподобная дочь мясника.<br><br>В прошлом обычно гастрономия одерживала верх над романтическими устремлениями, но новый претендент произвел на нее такое сильное впечатление, что фарша не получилось. Мясник не может поверить в происходящее, но что-то заставляет его откладывать «разделку», пока соседи не начинают жаловаться на нехватку мяса в ежедневном меню.','FRF 24 000 000'),(8366,'Нечто',1982,109,0.0,7.9,78778,'1982-06-25','https://st.kp.yandex.net/images/film_iphone/iphone360_8366.jpg','The Thing','Команде ученых американской исследовательской базы в Антарктике предстоит столкнуться с необъяснимым, чудовищным кошмаром. Отрезанные от всего света полярники вступают в неравную схватку с инопланетной тварью, пробудившейся после тысячелетней спячки во льдах.','$15 000 000'),(8367,'Запретная планета',1956,98,0.0,7.3,3328,'1956-03-23','https://st.kp.yandex.net/images/film_iphone/iphone360_8367.jpg','Forbidden Planet','Командир Адамс и его экипаж должны выяснить судьбу колонии землян в системе Альтаир IV, переставшей выходить на связь несколько лет назад. После года путешествия в гиперпространстве, корабль Объединенных Планет садится на планету, где они находят только двух живых человек — филолога Морбиуса и его сексапильную дочь Альтаиру.<br><br>Все остальные колонисты погибли по неизвестной причине. Морбиус настаивает, чтобы астронавты немедленно покинули планету, ибо он не может гарантировать их безопасность, но командир решает остаться. Той же ночью несколько человек погибает, буквально разорванные на части некоей неведомой и невидимой силой. Несмотря на все усилия экипажа, они не могут противостоять инопланетной угрозе.<br><br> Единственная их надежда — на могучего робота Робби, порождение внеземного разума, и юную Альтаиру.','$1 900 000'),(8368,'Невероятно худеющий человек',1957,81,0.0,7.2,1363,'1957-02-22','https://st.kp.yandex.net/images/film_iphone/iphone360_8368.jpg','The Incredible Shrinking Man','Скотт Кэри, плавая на лодке, попадает в загадочный радиоактивный туман, и вскоре понимает, что в его жизни произошел странный и пугающий поворот. Он начинает уменьшаться буквально на глазах, и постепенно его рост доходит почти до двух дюймов.<br><br>И вдруг вполне обычные повседневные домашние ситуации оборачиваются для него совершенно неразрешимыми и даже опасными для жизни задачами: игривый котенок становится страшным демоном, а паук — гигантским чудовищем.<br><br>Кэри осознает, что может рассчитывать только на собственную сообразительность, если хочет выжить в новом, слишком большом для него мире.','$750 000'),(8369,'Нечто',1951,85,0.0,6.6,2168,'1951-04-05','https://st.kp.yandex.net/images/film_iphone/iphone360_8369.jpg','The Thing from Another World','В глубине арктических льдов сотрудники военной исследовательской станции находят летающую тарелку, которая вмерзла в лед. Единственное обнаруженное там существо в куске льда они неосмотрительно забирают с собой в лагерь, где оно оттаивает. Будучи похожим на человека инопланетянин неуязвим для огнестрельного оружия, обладает немыслимой силой, может отращивать потерянные конечности и крайне агрессивно настроен. Понимая серьёзность положения, полярники пытаются сделать всё возможное, чтобы остановить злобного пришельца.','Нет данных'),(8370,'Ночь живых мертвецов',1968,96,0.0,7.3,12224,'1968-10-01','https://st.kp.yandex.net/images/film_iphone/iphone360_8370.jpg','Night of the Living Dead','Барбара и её брат Джонни приезжают на кладбище, расположенное в уединённом загородном месте. Неожиданно на них совершают нападение существа, напоминающие мертвецов, восставших из могил. Барбара укрывается в расположенном неподалёку доме, где также находят убежище темнокожий парень по имени Бен, супруги Гарри и Хелен Куперы с дочерью Карен, а также влюблённые Том и Джуди.','$114 000'),(8371,'Рассвет мертвецов',1978,139,0.0,7.1,11131,'1978-09-01','https://st.kp.yandex.net/images/film_iphone/iphone360_8371.jpg','Dawn of the Dead','Кошмар продолжается. Убежав от ужаса мертвых на вертолете, четверо путешественников вынуждены приземлиться на крышу торгового центра. Там они находят пищу, приют и неприятности — многоэтажный магазин сверху донизу забит глупыми ходячими трупами.<br><br>Развлекаясь отстрелом мертвецов, люди и не подозревают, что всего через несколько часов один из них станет тем, кого они так легко убивают — плотоядным зомби, а чуть позже в магазин нагрянет банда отморозков, не делающая различия между живым и мертвым, единственным желанием которых является жажда наживы и насилия.','$1 500 000'),(8372,'Человек в белом костюме',1951,85,0.0,7.0,430,'1951-08-10','https://st.kp.yandex.net/images/film_iphone/iphone360_8372.jpg','The Man in the White Suit','Эксцентричный изобретатель Сидни Стрэттон работает на текстильной фабрике. Однажды ему удается создать нечто необыкновенное. Новая ткань, изобретенная им, не рвется, не мнется, не изнашивается. Конкуренты начинают за ним охоту…','Нет данных'),(8373,'На берегу',1959,134,0.0,7.1,1514,'1959-12-17','https://st.kp.yandex.net/images/film_iphone/iphone360_8373.jpg','On the Beach','В 1964 году ядерная война стирает с лица земли население северного полушария. Одна американская субмарина находит временную зону безопасности в Австралии.<br><br>Командир субмарины Дуайт Тауэрс, семья которого стала жертвой чудовищной войны, встречает здесь женщину, которая пробуждает в нем уже как будто навсегда умершее чувство любви. Его избранница — Мойра Довайдсон — измучена заботами и все свободное время проводит с бутылкой бренди. Смогут ли они быть счастливы на фоне угасания последнего оазиса жизни?','$2 900 000'),(8374,'Безумный Макс 2: Воин дороги',1981,95,0.0,7.6,40148,'1981-12-24','https://st.kp.yandex.net/images/film_iphone/iphone360_8374.jpg','Mad Max 2','Катастрофа пострашнее ядерной войны постигла нашу цивилизацию. Страшный энергетический кризис парализовал города, пути сообщения — одним словом, все. За топливо теперь дерутся любыми средствами. Потому что там, где бензин, — там жизнь… Одинокий водитель Макс как раз и бороздит пустоши далекой Австралии в поисках горючего. Повсюду брошенные жилища, машины, разный скарб. Наконец Макс находит поселение, превращенное в укрепленный лагерь со складами горючего. Исхудавшие, измученные люди как могут охраняют то, что им принадлежит. И вот, в довершение всех бед, на лагерь нападают враги, свирепые панки и байкеры под предводительством некоего Гумунгуса, садиста и душегуба. И тогда Макс вступает в схватку…','$2 000 000'),(8379,'Взломщики сознания',1996,92,0.0,4.7,59,'1997-08-19','https://st.kp.yandex.net/images/film/8379.jpg','Starquest II','Несколько людей оказались на межкосмическом инопланетном корабле. Вскоре выяснилось, что в результате глобальных войн все живое на Земле погибло, а корабль направляется к Марсу. Но с какой целью и по какому принципу были отобраны эти совершенно разные люди? И что им сулит пребывание на этом корабле — спасение или гибель?..','Нет данных'),(8380,'Кровавая акула',1984,90,0.0,3.4,197,'1984-09-07','https://st.kp.yandex.net/images/film_iphone/iphone360_8380.jpg','Shark: Rosso nell\'oceano','Дельфины ударяются в панику при ее приближении. И не зря, у этого чудовища, сплава акулы и осьминога, помимо зубов имеются отвратительные щупальца. Мало того, оно обладает способностью регенерации. Из любого кусочка может вырасти новое чудище. Главный герой, электрик, а вместе с ним ученые и местный шериф начинают охоту за монстром на побережье Флориды…','Нет данных'),(8382,'Немезида 4: Ангел смерти',1996,77,0.0,3.2,323,'1996-12-23','https://st.kp.yandex.net/images/film/8382.jpg','Nemesis 4: Death Angel','2080 год. Осев после всех своих приключений в вымирающем восточноевропейском городке, Алекс начинает заниматься тем же, чем промышляет и большинство оставшегося криминального населения — охотой за бандитами и оказавшимися вне закона киборгами. Но когда она по ошибке устраняет не того парня, за её голову назначается награда, и Алекс быстро превращается из охотницы в жертву.','Нет данных'),(8384,'Битва за Алжир',1966,121,0.0,7.6,2219,'1966-08-31','https://st.kp.yandex.net/images/film_iphone/iphone360_8384.jpg','La battaglia di Algeri','В центре фильма — события алжирской борьбы за независимость в промежутке между 1954 и 1960 гг., пропущенные через воспоминания находящегося под арестом главного героя.','Нет данных'),(8386,'Трон в крови',1957,110,0.0,7.9,3031,'1957-01-15','https://st.kp.yandex.net/images/film_iphone/iphone360_8386.jpg','Kumonosu-jo','После грандиозной победы на поле брани, заблудившись в дремучем лесу, лорды Васидзу и Мики наталкиваются на загадочную вещую старуху, которая предсказывает великое будущее Васидзу, и еще более великое — потомкам Мики. Выбравшись из леса, они действительно получают вызов и почетные назначения от императора. Васидзу, подстрекаемый амбициозной женой, и задумывает пойти дальше предсказаний старой колдуньи.','Нет данных'),(8388,'Восстание Кейна',1954,124,0.0,7.2,608,'1954-06-24','https://st.kp.yandex.net/images/film_iphone/iphone360_8388.jpg','The Caine Mutiny','На эсминец назначен новый командир — Филип Квиг. Его подчинённые — офицеры Уилли Кит, Том Кифер и Стив Марик — считают необходимым предупредить начальство о неадекватности Квига. Однако у них недостаточно доказательств, и проблема остаётся без внимания.<br><br>Когда корабль попадает в шторм, командир отдаёт невнятные приказы, есть шанс затопления. Ступор Квига в решающий момент вынуждает Стива Марика действовать, он отстраняет командира и исправляет положение. По возвращении в порт Стива ждёт трибунал как организатора бунта…','$2 000 000'),(8389,'Иметь и не иметь',1944,100,0.0,7.2,1556,'1944-10-11','https://st.kp.yandex.net/images/film_iphone/iphone360_8389.jpg','To Have and Have Not','Идет Вторая мировая война, Франция оккупирована нацистами. Гарри Морган живет на острове Мартиника, ему принадлежит катер, на котором он возит богатых клиентов ловить рыбу. К Моргану обращается Жерар, участник Сопротивления, с просьбой тайно перевезти на Мартинику одного из лидеров движения.<br><br>Морган, которому нет дела до политики, отказывает. Но когда Мари просит его помочь выбраться с острова, он соглашается на смертельно опасное задание Жерара.','Нет данных'),(8390,'Жизнь и смерть полковника Блимпа',1943,163,0.0,6.3,433,'1943-06-10','https://st.kp.yandex.net/images/film_iphone/iphone360_8390.jpg','The Life and Death of Colonel Blimp','О жизни Клайва Кэнди, британского солдата. Она показана в эпизодах, начиная с 1902 года, когда он сделал блестящую карьеру молодого офицера в Бурской войне, до 1943 года, когда он скрипучим, старческим голосом рассказывает о времени бомбежки Лондона, размышляет о потерянной молодости и любви.','£200 000'),(8391,'Правонарушитель Морант',1980,107,0.0,6.7,226,'1980-05-12','https://st.kp.yandex.net/images/film_iphone/iphone360_8391.jpg','«Breaker» Morant','История австралийского лейтенанта во время Бурской войны, который предстает перед трибуналом и приговаривается к смертной казни за ведение войны против врага «необычным и нецивилизованным» образом.','AUD 650 000'),(8392,'Король Генрих V',1944,137,0.0,6.8,542,'1944-11-22','https://st.kp.yandex.net/images/film_iphone/iphone360_8392.jpg','The Chronicle History of King Henry the Fifth with His Battell Fought at Agincourt in France','Действие происходит в 1415 году, когда 28-летний английский король вторгся во Францию, пытаясь укрепить свой пошатнувшийся трон. После ряда дорого доставшихся побед жестоко потрепанная армия Генриха сталкивается с пятикратно превосходящими их силами французов.','£475 000'),(8393,'Командир эскадрильи',1999,100,0.0,5.9,1174,'1999-03-12','https://st.kp.yandex.net/images/film_iphone/iphone360_8393.jpg','Wing Commander','Этот фильм — экранизация знаменитой компьютерной игры «Wing Commander». Десант с земного космического корабля сталкивается со смертоносным оружием в безнадежной битве за будущее человечества. Враждебная инопланетная раса килратхов обнаружила координаты Земли и направляется в Солнечную Систему с планами тотального уничтожения.<br><br>И вот настало время для двух молодых отчаянных пилотов космических истребителей прорвать оборону килратхов и спасти свою планету от орд захватчиков, встреченных землянами в глубинах космоса.','$30 000 000'),(8395,'Особое задание',1983,90,0.0,5.8,793,'1983-02-13','https://st.kp.yandex.net/images/film_iphone/iphone360_8395.jpg','Mi ni te gong dui','Во время Второй Мировой Войны шайка авантюристов должна освободить из японского плена четверых генералов. В процессе спасения им предстоит сразиться с колдунами, привидениями и даже воинственными амазонками.','Нет данных'),(8396,'Битва драконов',1999,92,0.0,5.8,1953,'1999-06-30','https://st.kp.yandex.net/images/film_iphone/iphone360_8396.jpg','Bridge of Dragons','Там, где будущее и прошлое неразделимы, где кровожадный тиран рвется к власти, а народ мирится с угнетением, найдется герой, способный защитить юную принцессу от коварных притязаний злодея и восстановить справедливость в некогда мирном и спокойном королевстве.<br><br>Лишь ему под силу возглавить отважные отряды повстанцев в решающей битве с вооруженными до зубов армиями врага и разрушить грандиозные планы по узурпации трона и установлению безраздельного господства.','$4 000 000'),(8398,'Рейд возмездия',1999,99,0.0,3.9,80,'1999-07-11','https://st.kp.yandex.net/images/film/8398.jpg','Active Stealth','Во время проведения операции по освобождению заложников, попавших в руки одного из наркобаронов Центральной Америки Сальваторе, рейнджеры отряда специального назначения «Си» вынуждены оставить на поле боя раненого лейтенанта Ривкина.<br><br>Под предлогом спасения попавшего в беду товарища полковник Рейнолдс отправляет специальную группу, возглавляемую капитаном Мерфом. Операция настолько секретна, что в качестве средства доставки в центральноамериканские джунгли решили использовать новейший секретнейший истребитель-бомбардировщик «Стэлс».<br><br>Однако, отправляясь на опаснейшее задание, отряд не подозревает, что ему устроена ловушка. Преступный сговор Сальваторе и Рейнолдса имеет совсем иную цель — передать в руки террористов самый совершенный в мире боевой самолет.','Нет данных'),(8399,'Инчхон',1981,140,0.0,3.9,77,'1981-05-04','https://st.kp.yandex.net/images/film_iphone/iphone360_8399.jpg','Inchon','Главным героем фильма является генерал Дуглас Макартур, который возглавлял неожиданную высадку десанта США в Инчхоне, Южная Корея в 1950 году.','Нет данных'),(8400,'Фанни и Александр',1982,322,0.0,7.9,9255,'1982-12-17','https://st.kp.yandex.net/images/film_iphone/iphone360_8400.jpg','Fanny och Alexander','История семьи Экдаль, увиденная глазами двух детей — сестры и брата Фанни и Александра. Пока семья едина и неразлучна, дети счастливы и без страха могут предаваться чудесным мечтам. С потерей близких людей в них растет чувство горечи и неприязни к миру. Но там, где Фанни пытается сохранить чистую душу, Александр замыкается в темном и жестоком внутреннем мирке…','$6 000 000'),(8401,'Манон с источника',1986,113,0.0,7.8,1733,'1986-11-19','https://st.kp.yandex.net/images/film_iphone/iphone360_8401.jpg','Manon des sources','Вторая часть экранизации романа Марселя Паньоля. Манон было 8 лет, когда её отец-горбун умер, так и не найдя воду на своей земле. Ферму по дешевке прибирает семья Субейранов, когда-то специально засыпавшая источник.<br><br>Восемнадцатилетняя красавица-пастушка Манон, уединенно живущая в горах, узнает правду и отвергает притязания племянника главы семейства Юголина, доведя его до самоубийства. А потом перекрывает источник и оставляет ферму без воды…','Нет данных'),(8402,'До свидания, дети',1987,104,0.0,7.7,2565,'1987-08-31','https://st.kp.yandex.net/images/film_iphone/iphone360_8402.jpg','Au revoir les enfants','Вторая мировая война, Франция оккупирована нацистами. Настоятель католического колледжа для мальчиков решается дать приют нескольким еврейским детям. Главный герой, мальчик-француз по имени Жюльен Кантен, подружился с одним из них. И когда гестапо по чьей-то наводке обнаруживает прегрешение настоятеля, и его вместе с еврейскими детьми увозят на верную смерть, это становится для Жюльена страшным ударом на всю жизнь.','Нет данных'),(8403,'Небо над Берлином',1987,130,0.0,7.9,20201,'1987-05-17','https://st.kp.yandex.net/images/film_iphone/iphone360_8403.jpg','Der Himmel über Berlin','Невидимые людям ангелы фланируют по разделенному стеной Берлину, заглядывая в дома, мысли и души его обитателей. Один из них готов променять вечность в раю на любовь акробатки из цирка. Но по силам ли небесному созданию выдержать земные чувства?','Нет данных'),(8407,'Аниматрица: Последний полет Осириса',2003,9,0.0,7.3,4346,'2003-03-21','https://st.kp.yandex.net/images/film/8407.jpg','Final Flight of the Osiris','Спасаясь от стаи роботов-стражей, члены экипажа разведывательного корабля «Осирис» становятся случайными свидетелями готовящейся атаки машин на подземную цитадель повстанцев — Зион.','Нет данных'),(8408,'Гарри Поттер и Кубок огня',2005,157,0.0,7.9,275023,'2005-11-06','https://st.kp.yandex.net/images/film_iphone/iphone360_8408.jpg','Harry Potter and the Goblet of Fire','Гарри Поттер, Рон и Гермиона возвращаются на четвёртый курс школы чародейства и волшебства Хогвартс. При таинственных обстоятельствах Гарри был отобран в число участников опасного соревнования — Турнира Трёх Волшебников, однако проблема в том, что все его соперники — намного старше и сильнее.<br><br>К тому же, знаки указывают на возвращение Лорда Волдеморта. Вскоре Гарри предстоит побороться не только за победу в соревновании, но и, прежде всего, за свою жизнь.','$150 000 000'),(8409,'Хладнокровно',1967,134,0.0,7.6,1334,'1967-12-14','https://st.kp.yandex.net/images/film_iphone/iphone360_8409.jpg','In Cold Blood','Узнав, что семья Клаттеров держит десять тысяч долларов наличными на своей ферме, бездомные бродяги Смит и Хикок решаются на ограбление. Однако денег в доме не оказывается, и приятели зверски убивают одного за другим всех членов семьи.','$3 500 000'),(8410,'Лицо со шрамом',1932,93,0.0,7.8,4836,'1932-03-31','https://st.kp.yandex.net/images/film_iphone/iphone360_8410.jpg','Scarface','Фильм рассказывает историю о жестком контроле организованной преступности над Чикаго в эпоху «сухого закона». Главный герой — Тони Кармонте, честолюбивый преступник, не знающий жалости. Тони идет к своей цели: он намерен стать криминальным боссом города.','Нет данных'),(8411,'Убийцы леди',1955,91,0.0,7.1,1367,'1955-12-08','https://st.kp.yandex.net/images/film_iphone/iphone360_8411.jpg','The Ladykillers','Профессор музыки мистер Маркус снял комнату в доме старенькой миссис Луизы Александры Уилберфорс. Старушке и в голову не могло прийти, что липовый профессор не знает ни одной ноты, а над ней самой нависла опасность.','Нет данных'),(8412,'Рай и ад',1963,143,0.0,8.1,3293,'1963-03-01','https://st.kp.yandex.net/images/film_iphone/iphone360_8412.jpg','Tengoku to jigoku','Преуспевающий бизнесмен должен решить для себя, заплатит ли он выкуп похитителям, которые по ошибке выкрали не его сына, а сынишку человека, работающего у него шофером.','Нет данных'),(8414,'Астро-зомби',1968,92,0.0,4.3,109,'1968-05-19','https://st.kp.yandex.net/images/film_iphone/iphone360_8414.jpg','The Astro-Zombies','Потеряв официальную работу вследствие своих сомнительных экспериментов, доктор ДеМарко и не думает оставлять свои научные изыскания. В его планах создать идеальную человеческую особь, и оптимальным материалом для неё служат части тел покойников. Получившийся в итоге монстр быстро выходит из-под контроля и привлекает внимание государственных спецслужб.','Нет данных'),(8415,'Безумная шестерка',1997,94,0.0,4.2,145,'1998-05-22','https://st.kp.yandex.net/images/film_iphone/iphone360_8415.jpg','Crazy Six','Из стран бывшего СССР в восточную Европу хлынул неудержимый поток преступности. Торговцы оружием и военными технологиями облюбовали Прагу. «Безумная шестерка» и его команда здесь в цене. Очередной заказ — «вмешаться» в ход сделки по продаже радиоактивных веществ. Товар перехвачен, деньги — у заказчика.<br><br>Самое время выйти из этого сумасшедшего мира, где кругом смерть, наркотики и предательство, но кто-то решил, что ему еще рано, и рука снова тянется к пистолету…','Нет данных'),(8417,'Лестница в небо',1946,104,0.0,7.1,1073,'1946-03-14','https://st.kp.yandex.net/images/film/8417.jpg','A Matter of Life and Death','Конец Второй Мировой. Самолет Питера Картера горит, парашют разорван в клочья, и летчик выходит в эфир, чтобы в последний раз перед смертью услышать человеческий голос. Он открывает душу услышавшей его девушке по имени Джун и выпрыгивает из падающего самолета, однако не погибает.<br><br>На Небесах произошла ошибка — Ангел — проводник не смог найти его в тумане. Когда же он отыскивает Питера, тот уже встретился с Джун, и они полюбили друг друга. Питер просит Ангела — проводника, чтобы ему дали еще один шанс, и собирается Суд, который должен решить его судьбу.','£320 000'),(8418,'Кабинет доктора Калигари',1920,71,0.0,7.8,8703,'1920-02-26','https://st.kp.yandex.net/images/film_iphone/iphone360_8418.jpg','Das Cabinet des Dr. Caligari','Молодой человек по имени Фрэнсис рассказывает ужасную историю. Его друг, он сам и их любимая девушка стали жертвами чудовищного эксперимента, задуманного и осуществленного неким доктором Калигари.','$18 000'),(8419,'Рождественский гимн',1951,86,0.0,7.3,752,'1951-10-31','https://st.kp.yandex.net/images/film_iphone/iphone360_8419.jpg','Scrooge','История о старом и ожесточившемся скупердяе Эбенезере Скрудже, который в течение одной ночи переживает испытание глубокого очищения. Духи прошлого, настоящего и будущего заставляют героя увидеть себя со стороны и меняют к лучшему его отношение к событиям в собственной жизни.','Нет данных'),(8421,'Эдвард руки-ножницы',1990,105,0.0,8.0,163190,'1990-12-06','https://st.kp.yandex.net/images/film_iphone/iphone360_8421.jpg','Edward Scissorhands','Старый и одинокий учёный создал человеческое существо. Но не успел доделать его до конца и умер. У сотворённого им молодого человека не хватает рук — вместо них у него нечто вроде ножниц, и он вынужден жить в заброшенном доме в полном одиночестве. Но вот однажды он знакомится с прекрасной девушкой, которая смогла оценить его доброе сердце.','$20 000 000'),(8422,'Сборщик душ',1990,94,0.0,4.5,104,'1990-10-26','https://st.kp.yandex.net/images/film_iphone/iphone360_8422.jpg','Soultaker','Человек в чёрном приходит к людям перед смертью и забирает их души в светящееся зелёное кольцо. Пять человек попадают в серьезную автомобильную аварию. Сборщик душ пытается вынуть из тел жертв аварии души, но находит душу лишь в одном из тел, в остальных телах душ не обнаруживается — и теперь Сборщику необходимо их поймать. Две души вскоре пойманы Сборщиком — их тела тут же умирают — но двум другим, душам Натали МакМиллан и Заха Тейлора, удается убежать.','Нет данных'),(8424,'Тролль 2',1990,95,0.0,3.8,670,'1990-10-03','https://st.kp.yandex.net/images/film_iphone/iphone360_8424.jpg','Troll 2','Фильм рассказывает о семейной поездке, в которой мальчика по имени Джошуа преследуют гоблины-людоеды в городе под названием Нилбог.','$200 000'),(8425,'Ребенок Розмари',1968,136,0.0,7.7,29860,'1968-06-12','https://st.kp.yandex.net/images/film_iphone/iphone360_8425.jpg','Rosemary\'s Baby','Молодая бездетная пара Розмари и Гай Вудхауз переезжают в нью-йоркский Бремфорд. Очень скоро они знакомятся с эксцентричными соседями, Минни и Романом Кастевет, которые то и дело навязываются им в друзья.<br><br>Однажды Розмари видит странное видение, будто она плывет на яхте с Гаем, который превращается в демона и насилует её. Через несколько дней девушка узнает, что беременна. Череда странных событий наталкивает Розмари на догадку, что их соседи — члены сатанинского культа.','$3 200 000'),(8426,'Дождись темноты',1967,108,0.0,7.8,4524,'1967-10-26','https://st.kp.yandex.net/images/film_iphone/iphone360_8426.jpg','Wait Until Dark','В дом Сьюзи, недавно ослепшей в результате автокатастрофы, попадает тряпичная кукла, в которую наркоторговцы зашили крупную партию героина. Содержимое куклы очень хотят заполучить бандиты во главе с убийцей-психопатом Роутом. Слепая девушка беззащитна, лишь в темноте их шансы могут относительно уравняться, поэтому единственная надежда Сьюзи — дождаться темноты.','$4 000 000'),(8427,'Отвращение',1965,105,0.0,7.7,12953,'1965-05-19','https://st.kp.yandex.net/images/film_iphone/iphone360_8427.jpg','Repulsion','Молодая красивая маникюрша Кэрол психически нездорова и опасна для общества. Девушку оставляют на несколько дней одну дома, и тут кошмары Кэрол приобретают явственный характер и материализуются. Ей мерещатся трещины в стенах, к ней тянутся руки, пространство вокруг начинает растягиваться и сжиматься.','$300 000'),(8428,'Невинные',1961,100,0.0,7.2,1556,'1961-11-24','https://st.kp.yandex.net/images/film_iphone/iphone360_8428.jpg','The Innocents','Мисс Гидденс нанимается гувернанткой в шикарное поместье к двум детям без родителей, Флоре и Майлзу. Девочка выглядит абсолютным ангелочком, и прибывший раньше времени из школы Майлз тоже отличается манерами, но мисс Гидденс чувствует, что дети что-то скрывают. По какой-то причине мальчика исключили из школы, и в поместье, как выясняется, обитают призраки не так давно почивших прежней гувернантки и садовника.','Нет данных'),(8429,'Горбун Собора Парижской Богоматери',1939,117,0.0,7.1,389,'1939-12-29','https://st.kp.yandex.net/images/film/8429.jpg','The Hunchback of Notre Dame','Звонарь Собора Парижской Богоматери Квазимодо, его опекун и верховный судья Жеан Фролло, поэт Пьер Гренгуар и капитан королевской гвардии Феб де Шатопер влюбляются в цыганку Эсмеральду, но не предполагают, что тем самым обрекают её на верную смерть.','$1 800 000'),(8430,'Уродцы',1932,64,0.0,7.8,9680,'1932-02-12','https://st.kp.yandex.net/images/film_iphone/iphone360_8430.jpg','Freaks','Клеопатра — красавица-акробатка. В нее влюблен карлик Ганс, которому она предпочла силача Геркулеса… Когда Клеопатра узнает, что Ганс — наследник огромного состояния, она решает сначала выйти замуж за несчастного лилипута, а потом отравить его. Но после неудачной попытки отравления цирковые уродцы (сиамские близнецы, безрукая девушка и гермафродит) решают отомстить Клеопатре…','$310 607'),(8431,'Портрет Дориана Грея',1945,110,0.0,7.4,2003,'1945-03-01','https://st.kp.yandex.net/images/film_iphone/iphone360_8431.jpg','The Picture of Dorian Gray','Очаровательный и невинный Дориан Грей в компании циничного Гарри Уоттонома любуется своим великолепным портретом. Ослепленный своей красотой, юноша клянется, что отдаст свою душу за то, чтобы вечно быть молодым. Десятилетиями Дориан, ставший достойным учеником Гарри, хладнокровно наблюдает за тем, как его жестокость губит всех, кто любит его. Он все так же красив и юн, и лишь его портрет обезображивают бесчисленные шрамы порока. Став прекрасным чудовищем, Дориан уже не верит, что однажды ему придется заплатить за свои грехи страшную цену…','$3 500 000'),(8432,'Что случилось с Бэби Джейн?',1962,134,0.0,7.8,4932,'1962-10-31','https://st.kp.yandex.net/images/film_iphone/iphone360_8432.jpg','What Ever Happened to Baby Jane?','В 20-х годах прошлого века маленькая Джейн Хадсон выступала в мюзик-холле. Девочка имела большой успех у публики. На ее деньги жили родители и сестра Бланш, которая вынуждена была скрывать зависть и раздражение от успеха сестры. <br><br>В 30-х годах ситуация коренным образом меняется. Бланш становится очень популярной голливудской актрисой, в то время, как звезда малышки Джейн начинает затухать.','$980 000'),(8433,'Логово Дьявола',1963,112,0.0,7.0,1668,'1963-08-25','https://st.kp.yandex.net/images/film_iphone/iphone360_8433.jpg','The Haunting','Исследуя историю страшного дома, доктор приглашает в него трех человек, которые должны помочь ему в расследовании. А история этого дома на холме страшна: владелец дома утонул, его две жены погибли при загадочных обстоятельствах, дочь, которая его унаследовала, умерла после того, как сиделка не оказала ей помощь. Сама сиделка после вступления во владение — покончила с собой. Дом принимает новых гостей и начинает с ними ужасную игру.','$1 400 000'),(8434,'Подглядывающий',1960,101,0.0,7.2,2773,'1960-04-07','https://st.kp.yandex.net/images/film_iphone/iphone360_8434.jpg','Peeping Tom','Молодой человек Марк снимает на кинокамеру проститутку. Он снимает искаженное ужасом лицо, когда камера приближается к ней. В это время из ножки штатива внезапно высовывается пика и убивает ее. Позднее он снимает момент, когда труп проститутки забирает полиция. Марк фотографирует обнаженных молодых женщин в студии, расположенной под бутиком, владелец которого приторговывает фотографиями голых женщин…','£135 000'),(8435,'Хэллоуин',1978,101,0.0,7.1,24938,'1978-10-25','https://st.kp.yandex.net/images/film_iphone/iphone360_8435.jpg','Halloween','Убийца-психопат Майкл Майерс, будучи ребенком, совершил убийство собственной сестры в Хэллоуин — День Всех Святых.<br><br>15 лет спустя маньяк-убийца снова взялся за старое и терроризирует небольшой городок. Он сбежал из приюта для психически ненормальных, чтобы снова наносить свои смертельные удары в Хэллоуин.','$325 000'),(8436,'Дракула',1931,75,0.0,7.3,7625,'1931-02-12','https://st.kp.yandex.net/images/film_iphone/iphone360_8436.jpg','Dracula','Агент по недвижимости Ренфилд приезжает в Трансильванию, чтобы подписать с графом Дракулой договор о покупке им старого аббатства Карфакс в Лондоне. Местные жители предупреждают Ренфилда, что замок Дракулы — логово нечисти, но тот игнорирует предупреждения и отправляется в замок. На перевале Борго его подбирает карета с молчаливым кучером. Выглянув по дороге из кареты, Ренфилд видит, что кучер исчез, а над упряжкой машет крыльями летучая мышь…','$355 000'),(8437,'Призрак оперы',1925,106,0.0,7.3,1540,'1925-04-26','https://st.kp.yandex.net/images/film_iphone/iphone360_8437.jpg','The Phantom of the Opera','Голос тайного ангела пел песни Кристине. Только она не знала, что ее тайный ангел — всего лишь Призрак — гений, который жил в подвале театра и наводил ужас на всех артистов, которые там работали.','Нет данных'),(8438,'Звонок',1998,96,0.0,7.1,21083,'1998-01-31','https://st.kp.yandex.net/images/film_iphone/iphone360_8438.jpg','Ringu','Молодая репортер расследует загадочное суеверие о смертоносной видеокассете. В доме того, кто посмотрит её, сначала раздается странный телефонный звонок, а позже человек умирает. После того как такой же смертью умирает её племянница, женщина решает взяться за расследование и сама смотрит злополучную кассету. Чуть позже в её квартире раздаётся звонок. Теперь у журналистки есть только семь дней, чтобы докопаться до истоков страшного проклятия.','$1 200 000'),(8439,'Ночь демона',1957,82,0.0,6.9,702,'1957-11-09','https://st.kp.yandex.net/images/film_iphone/iphone360_8439.jpg','Night of the Demon','После встречи с основателем загадочного культа Джулианом Карсвеллом, в отношении которого он вёл расследование, британский профессор Харрингтон становится жертвой материализовавшегося из воздуха демона. Чтобы выяснить загадочные обстоятельства смерти коллеги, из Америки прилетают профессор Джон Холден и племянница погибшего — Джоанна Харрингтон. Почти сразу с Холденом встречается сам Карсвелл и советует держаться от него подальше, а мисс Джоанна уверена, что тот уже наложил на Холдена смертельное проклятье.','Нет данных'),(8441,'Восход солнца',1927,94,0.0,7.9,2815,'1927-09-23','https://st.kp.yandex.net/images/film_iphone/iphone360_8441.jpg','Sunrise: A Song of Two Humans','Молодой крестьянин Анзас, соблазненный городской красоткой, по ее наущению пытается убить жену, столкнув ее с лодки…','Нет данных'),(8442,'Дети райка',1945,190,0.0,8.0,2301,'1945-03-09','https://st.kp.yandex.net/images/film_iphone/iphone360_8442.jpg','Les enfants du paradis','Действие картины разворачивается в Париже 20-30-х 19-го века. Это обширный рассказ о безответной любви, тайных романах, ревности и страсти в мире театра, преступности и аристократии. «Дети райка» — это бедняки, занимающие галерку театров в «Бульвар Дю Темпль». Они становятся свидетелями истории любви театрального мима Батиста и его обожаемой Гаранс.','Нет данных'),(8443,'Красные башмачки',1948,133,0.0,7.4,1984,'1948-07-22','https://st.kp.yandex.net/images/film_iphone/iphone360_8443.jpg','The Red Shoes','Балет по мотивам сказки Ганса Христиана Андерсена о паре волшебных туфелек, которые наделяют танцора способностью сказочно танцевать, но не дают остановиться, приносит огромный успех Джулиану и Виктории.<br><br>Виктория влюбляется в талантливого композитора и выходит за него замуж, несмотря на возражения ревнующего Бориса, который предупреждает, что она зачеркивает свое блестящее будущее. Так начинается конфликт между импресарио и влюбленными.','£500 000'),(8445,'Повелитель кукол 7: Ретро',1999,80,0.0,3.5,231,'1999-11-09','https://st.kp.yandex.net/images/film_iphone/iphone360_8445.jpg','Retro Puppet Master','1944 год. 4 мили от швейцарской границы. Андре Тулон вместе со своими куклами прячется от нацистов в каком-то доме. Он натыкается на своё старое творение — куклу по имени «Циклоп», вернее — на то, что от неё осталось. Ностальгически закатывая глаза, Тулон приступает к рассказу своего прошлого…','Нет данных'),(8446,'Эммануэль 5',1986,85,0.0,3.8,282,'1987-01-07','https://st.kp.yandex.net/images/film_iphone/iphone360_8446.jpg','Emmanuelle 5','Загадочный принц Рашид добивается встречи с Эммануэль после премьеры ее фильма на Каннском кинофестивале и приглашает ее в гости в свой дворец на Карибских островах. Но галантное приглашение Рашида оказывается коварной ловушкой, и Эммануэль становится пленницей в гареме принца, в котором уже томятся 50 красавиц со всего мира.<br><br>На помощь Эммануэль приходит ее возлюбленный — мультимиллионер Чарльз Фостер. Но удастся ли Чарльзу спасти обожаемую им женщину и вновь заключить ее в свои объятия?','Нет данных'),(8447,'Восставший Дракула',1993,85,0.0,4.0,105,'1993-03-24','https://st.kp.yandex.net/images/film/8447.jpg','Dracula Rising','Как гласит древнее поверье, ведьма, возлюбленная Дракулы была сожжена заживо. Колдунья перевоплотилась и теперь, в наши дни, это молодая хорошенькая девушка…<br><br>Молодая художница Тереза принимает предложение поработать в Румынии, в великолепном древнем замке Графа Влада. Не верящая в леденящие кровь истории, Тереза оказывается в самой гуще событий… Граф Влад жив и его желание — Тереза…','Нет данных'),(8448,'Запретный танец',1990,97,0.0,6.6,155,'1990-03-16','https://st.kp.yandex.net/images/film_iphone/iphone360_8448.jpg','The Forbidden Dance','Активистка «зелёных» Ниса едет в Лос-Анджелес, чтобы остановить представителей строительной компании, угрожающей уничтожением амазонских лесов. Здесь она встречает Джеффа, который уверяет её, что лучшая трибуна для подобного общественного заявления — это телеэкран. И чтобы привлечь к себе внимание ТВ, парочка решает выиграть престижный танцевальный конкурс.','Нет данных'),(8451,'Случай в Окс-Боу',1942,75,0.0,7.6,1119,'1942-12-04','https://st.kp.yandex.net/images/film_iphone/iphone360_8451.jpg','The Ox-Bow Incident','1885 год. Двое бродяг, Гил Картер и Арт Крофт, заезжают в небольшой городок под названием Окс-Боу и становятся невольными участниками событий, происходящими в этом, на первый взгляд, тихом местечке.<br><br>Убит один из местных фермеров, его стадо похищено, и жители городка жаждут мести. Преступников находят довольно быстро, и толпа решает обойтись без шерифа — устроить суд Линча…','Нет данных'),(8452,'Хад',1962,112,0.0,7.3,636,'1963-05-28','https://st.kp.yandex.net/images/film_iphone/iphone360_8452.jpg','Hud','Молодой владелец ранчо в Техасе Хад Бэннон привык потакать своим желаниям, волочиться за замужними дамами и пропивать то, что потом и кровью заработал его отец. Старый Хомер глубоко презирает сына за аморальность и безответственность. Одному богу известно, к чему приведет многолетнее противостояние этих людей.','$2 500 000'),(8453,'Шейн',1953,118,0.0,6.5,1185,'1953-04-23','https://st.kp.yandex.net/images/film_iphone/iphone360_8453.jpg','Shane','Джо и Мэрион Старретт вместе со своим сыном, обожающим приключения, борются за выживание на своем ранчо в суровом приграничном городке. В один прекрасный день подъезжает одинокий всадник Шейн и просит воды для себя и своей лошади. Джо выполняет просьбу. Через некоторое время Шейн уже помогает семье защищать ранчо от злодея Райкера, захватывающего земли под пастбища для своего скота. Шейн остается работать на ранчо и постепенно становится другом и героем для маленького Джои. С присутствием Шейна никак не может смириться алчный Райкер. Решительное столкновение неизбежно…','$3 100 000'),(8454,'Винчестер 73',1950,92,0.0,7.2,788,'1950-06-01','https://st.kp.yandex.net/images/film_iphone/iphone360_8454.jpg','Winchester \'73','В 70-е годы XIX века лучшим оружием на Диком Западе считалась многозарядная винтовка «винчестер «73» образца 1873 года, и многие стрелки готовы были пойти на все, чтобы завладеть этим оружием… Отчаянный Лин МакЭдам, преследуя убийцу своего отца, приезжает в Додж-сити со своим другом Джонни по прозвищу «Высокий клинок».<br><br>Город празднует День независимости США, под зорким, отеческим взглядом шерифа Уайатта Эрпа, который собирает пистолеты у обвешанных оружием чужаков и складывает их в своей конторе на время торжеств. В честь праздника в городке объявляется соревнование на лучшего стрелка, победитель которого получит уникальный (один на тысячу) «винчестер «73». Лин заходит в местный салун и заказывает выпивку.<br><br>Неожиданно, уголком глаза, он замечает «Голландца» Хенри Брауна — своего злейшего врага. Героям предстоит соревноваться в меткости на празднике города за лучший винчестер страны. МакЭдаму удается победить «Голландца» и получить дорогую винтовку, но раздосадованный Хенри нападает на победителя и забирает винчестер. Обозленный Лин начнет преследовать похитителя винтовки…','Нет данных'),(8455,'За пригоршню долларов',1964,99,0.0,8.0,36149,'1964-09-12','https://st.kp.yandex.net/images/film_iphone/iphone360_8455.jpg','Per un pugno di dollari','В маленьком городке идет война между двумя влиятельными семействами, которых абсолютно не интересует закон. Герой Клинта Иствуда — человек без имени, умеющий стрелять без промаха…','$200 000'),(8456,'Сверкающие седла',1974,93,0.0,6.7,2520,'1974-02-07','https://st.kp.yandex.net/images/film_iphone/iphone360_8456.jpg','Blazing Saddles','Железная дорога должна пройти через городок Рок Ридж. Но как выгнать местных жителей из города, если хочешь украсть у них землю? Заслать самую отчаянную банду головорезов… и назначить нового чернокожего шерифа, который протянет не больше суток.','$2 600 000'),(8457,'Дестри снова в седле',1939,94,0.0,7.3,859,'1939-11-30','https://st.kp.yandex.net/images/film_iphone/iphone360_8457.jpg','Destry Rides Again','Опытная проститутка, испытавшая в этой жизни абсолютно все, перебывала в объятиях сотни мужчин, но не утратила нежного, ранимого сердца, которое, как и много лет назад, открыто любви и верности, которое готово раскрыться навстречу искреннему чувству. Даже если это будет стоить жизни.<br><br>И вот в маленьком, захолустном американском городишке появляется странноватый парень по имени Том Дестри. Он вежлив, вроде умен, довольно красив. И он один встает против всего города, чтобы навести порядок и установить торжество закона.','Нет данных'),(8458,'Джоси Уэйлс – человек вне закона',1976,135,0.0,7.2,3371,'1976-06-26','https://st.kp.yandex.net/images/film_iphone/iphone360_8458.jpg','The Outlaw Josey Wales','Мирный фермер Джоси Уэйлс подвергся бандитскому нападению солдат-северян во время гражданской войны в США. Его жену и ребёнка убили, и он, одержимый местью, становится на сторону южан. Южане потерпели поражение, но Джоси не сложил оружие. Теперь он — человек вне закона, которого преследует банда убийц. Компанию одинокому мстителю в его опасном путешествии составит группа изгоев, которых Уэйлс станет защищать в предстоящих переделках.','$3 700 000'),(8459,'Скачи по высокогорью',1962,94,0.0,6.9,566,'1962-05-09','https://st.kp.yandex.net/images/film_iphone/iphone360_8459.jpg','Ride the High Country','Бывшему шерифу Стиву Джадду предлагают работу: перевезти золото из высокогорного поселка старателей в банк. Стив предлагает старому другу, Гилу Веструму, поработать вместе с ним. Но Гилу интересней получить большой куш, чем 40 долларов.','$813 000'),(8460,'Знак Зорро',1940,94,0.0,7.6,488,'1940-11-01','https://st.kp.yandex.net/images/film_iphone/iphone360_8460.jpg','The Mark of Zorro','Молодой щёголь Диего Вега возвращается из Испании в родную Калифорнию, где его отец был алькальдом (мэром) Лос-Анджелеса. Однако те времена давно прошли: сейчас в этой местности заправляет новый алькальд Луис Кинтеро, поддерживаемый войсками капитана Эстебана Паскуале. Они беззастенчиво повышают налоги, ввергая и без того не богатых крестьян в настоящую нищету, а пытающихся сопротивляться подвергают жестоким наказаниям. Однако вскоре после приезда Диего в окрестностях появляется некто Зорро, решивший бросить вызов творящимся несправедливостям…','$1 000 000'),(8461,'Одинокие отважны',1962,107,0.0,6.8,327,'1962-05-21','https://st.kp.yandex.net/images/film_iphone/iphone360_8461.jpg','Lonely Are the Brave','Когда бродяга-ковбой Джек Бернс узнает, что его лучший друг Пол Бонди сидит в тюрьме, он решает освободить его любой ценой. Для этого он устраивает пьяный дебош, а когда его не хотят сажать в переполненную тюрьму, вдобавок оскорбляет полицейского. Цель достигнута, но, встретив друга, Джек обнаруживает, что тот не хочет бежать, а намерен честно отбыть свой срок и вернуться к семье. Бернс убегает один и направляется к мексиканской границе, а за ним в погоню устремляется шериф Джонсон с вертолетами и джипами…','$2 000 000'),(8462,'Джонни-гитара',1954,110,0.0,7.0,973,'1954-05-05','https://st.kp.yandex.net/images/film_iphone/iphone360_8462.jpg','Johnny Guitar','Салун Вьенн расположен на том участке земли, по которому скоро пройдет железная дорога. В салуне постоянно ошивается Танцующий Кид, который влюблен во Вьенн, и которого страстно желает заполучить старая дева Эмма Смол. Эмма собирает толпу, чтобы сжечь салун и повесить Кида…','Нет данных'),(8463,'Путь с Запада',1937,64,0.0,6.2,191,'1937-04-16','https://st.kp.yandex.net/images/film_iphone/iphone360_8463.jpg','Way Out West','На Стена и Олли возложена ответственность доставить документы по ценной золотодобывающей шахте дочери мертвого старателя. Однако они не предусмотрели всех махинаций ее злого опекуна Майки Финна, который намерен забрать золотодобывающую шахту себе и своей жене, салонной певице Лоле.','Нет данных'),(8464,'Большая страна',1958,165,0.0,7.4,667,'1958-08-13','https://st.kp.yandex.net/images/film_iphone/iphone360_8464.jpg','The Big Country','XIX век, юго-запад США. Среди длинных полос земель и гигантских каньонов находятся два поселения. Одно — майора Генри Террилла, другое — неудачника Руфуса Хэннеси. Они оба абсолютные индивидуалисты, использующие для своего скота один и тот же водопой и враждующие между собой. Генри — местный богач, у которого прекрасный дом, большое поголовье скота, красивая дочь и полный штат ковбоев. Руфус — неимущий. У него несколько непослушных и буйных сыновей, дюжина сараев и армия бедных родственников.<br><br>Неожиданно в местечке объявляется образованный джентльмен — капитан судна Джеймс МаКейн. Он собирается жениться на дочери Террилла, но ей этот щёголь не понравился. Однако приезжий бросает вызов окружающему обществу, и он не намерен поддаваться на провокации.','Нет данных'),(8466,'Поддержите своего шерифа!',1969,92,0.0,6.7,188,'1969-03-26','https://st.kp.yandex.net/images/film_iphone/iphone360_8466.jpg','Support Your Local Sheriff!','Джейсон МакКаллоф неожиданно получает освободившуюся должность шерифа в городке, охваченном золотой лихорадкой. МакКаллоф усмиряет нечистых на руку жителей с помощью меткой стрельбы и остроумия, и между делом наводит в городе порядок.','Нет данных'),(8467,'Профессионалы',1966,117,0.0,7.1,690,'1966-11-02','https://st.kp.yandex.net/images/film_iphone/iphone360_8467.jpg','The Professionals','Четыре профессионала — Билл Долворт, Рико, Ханс Эренгард и Джейк Шарп наняты Джо Грантом, чтобы спасти его жену, которую похитили мексиканские повстанцы…','Нет данных'),(8468,'Последний из могикан',1992,117,0.0,7.6,13847,'1992-08-26','https://st.kp.yandex.net/images/film_iphone/iphone360_8468.jpg','The Last of the Mohicans','1757 год. Англо-французская война за американские колонии в самом разгаре. Дочери полковника Манро пытаются пробраться в осажденный французами английский форт. Им на помощь приходит молодой белый охотник Соколиный Глаз. Между Соколиным Глазом, выросшим среди индейцев племени могикан, и старшей из дочерей, утонченной Корой, вспыхивает взаимное чувство.<br><br>Но Кора и ее сестра попадают в плен к союзникам французов — гуронам, и от мучительной смерти их могут спасти только Соколиный Глаз и его верные друзья — индейцы…','$40 000 000'),(8469,'За пригоршню динамита',1971,138,0.0,7.7,4280,'1971-10-29','https://st.kp.yandex.net/images/film_iphone/iphone360_8469.jpg','Giù la testa','На бескрайних мексиканских просторах встречаются два солдата удачи — развеселый бандит Хуан Миранда, грабящий со своими детишками почтовые дилижансы, и ирландский террорист Мэллори, мчащийся на мотоцикле навстречу опасности и оставляющий воронки от разрывов динамитных шашек. Миранда мечтает использовать взрывоопасный талант Мэллори для ограбления банка. Но вместо банковских сейфов он освобождает политических заложников и становится героем революции. Очень скоро друзьям предстоит забыть радости вольной жизни во имя сражения за свободу мексиканского народа.','Нет данных'),(8470,'Бродяга высокогорных равнин',1973,105,0.0,7.4,3727,'1973-04-06','https://st.kp.yandex.net/images/film_iphone/iphone360_8470.jpg','High Plains Drifter','Человек без имени нанят жителями небольшого городка для защиты от троих бандитов, только что выпущенных из тюрьмы, где они сидели за преступления, совершенные как раз в этом городке.','$5 500 000'),(8471,'Иеремия Джонсон',1972,108,0.0,7.8,1818,'1972-05-07','https://st.kp.yandex.net/images/film_iphone/iphone360_8471.jpg','Jeremiah Johnson','Иеремия Джонсон решает покинуть равнины и уйти в горы, где его подстерегает полуголодное существование и угрозы со стороны гризли и индейцев. Он стремится целиком слиться с природой, противопоставляя себя так называемому «цивилизованному человеку». Со временем он вполне осваивается среди дикой природы, недружелюбных индейцев и трапперов.','Нет данных'),(8472,'Семь невест для семи братьев',1954,102,0.0,7.0,751,'1954-07-15','https://st.kp.yandex.net/images/film_iphone/iphone360_8472.jpg','Seven Brides for Seven Brothers','Семь крепких парней живут среди высоких деревьев дремучего леса Орегоны. Их быт и нравы просты, а о приличных манерах и как себя нужно вести в обществе они вообще не слышали. Однажды старший из братьев — Адам приводит в их «холостяцкую берлогу» свою очаровательную невесту.<br><br> Милли — воспитанной городской девушке с крепкими нервами и железным характером суждено укротить дурной нрав мужской компании, научить этикету и в итоге помочь парням найти своих спутниц жизни.','Нет данных'),(8473,'Перестрелка в О.К. Коррал',1957,122,0.0,6.9,473,'1957-05-29','https://st.kp.yandex.net/images/film_iphone/iphone360_8473.jpg','Gunfight at the O.K. Corral','Америка после гражданской войны. Вышедший в отставку шериф Уайтт Эрп переезжает в небольшой городок Тумстоун, чтобы начать спокойную семейную жизнь. Но здесь, как оказалось, промышляет многочисленная банда головорезов, которая держит в страхе весь город и близлежащие окрестности.<br><br>Бывшему шерифу вновь приходиться брать в руки оружие. На сторону закона встанут братья Эрп и лучший стрелок Дикого Запада — «Док» Холлидэй. Они покажут преступникам, кто в городе главный!','Нет данных'),(8474,'К югу от рая, к западу от ада',2000,104,0.0,4.8,145,'2000-01-28','https://st.kp.yandex.net/images/film_iphone/iphone360_8474.jpg','South of Heaven, West of Hell','В маленьком ковбойском городке под названием Лос-Трагос, затерявшемся посреди пустыни в штате Нью-Мексико, есть только один закон, и зовут его маршал Вэл Кэйси. Исполнение служебных обязанностей не представляет для него большого труда. Но в канун Рождества на Вэла и весь городок свалилась большая беда.<br><br>Печально знаменитая семейная банда Лиланда Генри берет Лос-Трагос в осаду, собираясь ограбить местный банк. Появление банды напоминает Вэлу о прошлом, от которого ему никак не удается бежать. Лишившись в детстве всей своей семьи, он воспитывался в доме Лиланда.<br><br>Теперь Вэл должен выбирать между благодарностью людям, относившимся к нему как к родному сыну и брату, и служением закону…','$4 000 000'),(8475,'Караван на восток',1994,107,0.0,6.3,224,'1994-08-26','https://st.kp.yandex.net/images/film_iphone/iphone360_8475.jpg','Wagons East','Проводник ведет фургоны не на запад, куда обычно устремлялись первые поселенцы, а на восток. Люди, которые наняли его, все были неудачниками, не вынесшими тягот и трудностей. Они решили вернуться туда, откуда приехали. Злодей, строящий железную дорогу на запад и получающий от правительства крупные субсидии, строит им всякие пакости, подсылая своих людей, чтобы остановить их.','Нет данных'),(8476,'Счастливчик Люк',1991,83,0.0,6.8,377,'1991-07-04','https://st.kp.yandex.net/images/film_iphone/iphone360_8476.jpg','Lucky Luke','Не сразу Америка строилась. Первые поселенцы Западного побережья и не предполагали, какие суматошные приключения им предстоит пережить в доселе необитаемой долине, но Дикий Запад — это дикие Законы!<br><br>А Счастливчик Люк — не просто шериф по должности. Он — единственный человек, способный эти законы претворить в жизнь. Методы, которыми он добивается своего, нетрадиционны, но ведь действуют.','Нет данных'),(8478,'Язык молчания',1993,102,0.0,5.8,158,'1993-01-28','https://st.kp.yandex.net/images/film_iphone/iphone360_8478.jpg','Silent Tongue','Фильм рассказывает о молодом человеке по имени Талбот Роу, который сошёл с ума после смерти своей жены. Отец Талбота, Прескотт Роу, чувствует боль сына и хочет найти ему новую жену. Он отправляется туда, где нашёл Талботу первую жену, к Ирмону Маккри. Он встречает сестру умершей жены, дочь Ирмона, наполовину индианка и чемпионка по скачкам. Роу просит Маккри отдать дочь замуж за его сына, но Маккри отказывается. Тогда Роу похищает её и пытается убедить помочь ему спасти сына, и она соглашается в обмен на золото и четырёх лошадей. Но Талбот не даёт ей ни шанса — он боится, что она попробует забрать у него тело покойной жены. Последние несколько ночей вдовец видит призрак умершей, которая хочет, чтобы Талбот уничтожил её тело, но он отказывается.','Нет данных'),(8483,'Подними красный фонарь',1991,125,0.0,7.8,3830,'1991-09-10','https://st.kp.yandex.net/images/film_iphone/iphone360_8483.jpg','Da hong deng long gao gao gua','Китай, 1920-е годы. Молодая красавица Сунлянь становится четвёртой женой богатого феодала, и теперь девушке предстоит научиться жить и подчинятся жестким правилам замкнутого сообщества феодального домохозяйства.','Нет данных'),(8485,'Женская логика',2002,96,0.0,6.2,187,'2002-01-13','https://st.kp.yandex.net/images/film_iphone/iphone360_8485.jpg','WiseGirls','Расставшись с мрачным прошлым, очаровательная Мег переезжает в Нью-Йорк, где весьма удачно находит работу в шикарном итальянском ресторане. Но ее радость быстро сменяется страхом, когда она узнает, что ее босс, клиенты и новые знакомые — жестокие и непредсказуемые мафиози.<br /><br />Подружившись с двумя колоритными официантками, Мег решает любой ценой держаться подальше от неприятностей, но когда ее просят в качестве услуги расчленить труп, она понимает, что у нее начались нешуточные проблемы…','$11 000 000'),(8486,'Пи',1997,84,0.0,7.5,33901,'1998-07-10','https://st.kp.yandex.net/images/film_iphone/iphone360_8486.jpg','Pi','Талантливый математик Макс Коэн в течение многих лет пытается найти и расшифровать универсальный цифровой код, согласно которому изменяются курсы всех биржевых акций.<br><br>По мере приближения к разгадке, мир вокруг Макса превращается в мрачный кошмар: его преследуют могущественные аналитики с Уолл-Стрита и жестокие фанатики из тайной религиозной секты, готовые пойти на убийство, чтобы обнаружить код вселенского мироздания в своих древних священных текстах.<br><br>Находясь на грани безумия, Макс должен сделать решающий выбор между порядком и хаосом, святостью и дьявольщиной, мудростью и невежеством и решить, способен ли он совладать с могущественной силой, которую пробудил его гениальный разум.','$60 000'),(8494,'Тайна Николы Теслы',1979,115,0.0,7.4,242,'1980-02-19','https://st.kp.yandex.net/images/film_iphone/iphone360_8494.jpg','Tajna Nikole Tesle','Известный художественный фильм о жизни Николы Теслы, в котором затрагивают его личную жизнь.','Нет данных'),(8500,'Десять негритят',1974,105,0.0,5.7,210,'1974-09-24','https://st.kp.yandex.net/images/film_iphone/iphone360_8500.jpg','Ein Unbekannter rechnet ab','Фильм основан на рассказе Агаты Кристи, в котором группа людей приглашена в изолированное место неизвестным человеком, который хочет убить их одного за другим за преступления, которые они совершили в прошлом. Люди начинают умирать и не знают, кому могут доверять, а кому — нет.','Нет данных'),(8502,'Остров сокровищ',1972,94,0.0,6.1,103,'1972-10-30','https://st.kp.yandex.net/images/film_iphone/iphone360_8502.jpg','Treasure Island','В комнате Билли Бонса, погибшего в схватке с пиратами, юный Джим Хокинс находит карту острова с обозначением места, где спрятаны сокровища капитана Флинта.<br><br>Он с друзьями отправляется в путь на поиски таинственного клада. Немало приключений и испытаний выпало на долю путешественников. Клад был найден, но самым дорогим сокровищем оказалась дружба, проверенная в схватке с пиратами.','Нет данных'),(8504,'Чудовищная декада',1971,110,0.0,6.7,207,'1971-12-01','https://st.kp.yandex.net/images/film_iphone/iphone360_8504.jpg','La décade prodigieuse','С Шарлем, приемным сыном могущественного богача Тео Ван Хорна, творится странное: несколько раз он просыпался в ужасе, с окровавленными руками, и никак не мог вспомнить, что с ним произошло накануне. А, ко всему прочему, какой-то человек, которому стало известно о романе Шарля с его молодой мачехой Элен, начинает шантажировать влюбленных…','Нет данных'),(8506,'Мальпертюи',1971,125,0.0,7.2,321,'1972-05-10','https://st.kp.yandex.net/images/film_iphone/iphone360_8506.jpg','Malpertuis','Молодой моряк Янн прибывает в родной город и отправляется на поиски своей сестры Нэнси. Но в одном из баров он ввязывается в драку и падает без сознания. Он приходит в себя и видит рядом Нэнси. Они находятся в Малпертуисе, старинном особняке, принадлежащем их предку Квентину Кассаву. Янн напоминает сестре, что отец запрещал посещать этот дом, упоминая злую сущность Кассава. Янн пытается уговорить сестру покинуть поместье, но та говорит, что влюблена в одного из его обитателей…','Нет данных'),(8509,'Ватерлоо',1970,128,0.0,7.7,1952,'1970-10-26','https://st.kp.yandex.net/images/film_iphone/iphone360_8509.jpg','Waterloo','Масштабный исторический фильм, основное содержание которого сводится к событиям, предшествующим сражению при Ватерлоо, и самому сражению.','$25 000 000'),(8510,'Кремлевское письмо',1970,120,0.0,5.8,161,'1970-02-01','https://st.kp.yandex.net/images/film_iphone/iphone360_8510.jpg','The Kremlin Letter','Секретная организация принимает на службу молодого офицера разведки с фотографической памятью, который должен отправиться Россию. Он должен восстановить письмо, написанное ЦРУ, с обещанием американской помощи России при условии, если Китай получает атомную бомбу.','Нет данных'),(8511,'Битва на Неретве',1969,144,0.0,6.7,273,'1969-10-07','https://st.kp.yandex.net/images/film_iphone/iphone360_8511.jpg','La Battaglia della Neretva','Европа в начале 1943 года. По личному приказу Гитлера генералы начали исполнять план «Вайс» — уничтожение партизанского государства. Немецкие и итальянские части, составленные из 18 дивизий, при помощи отечественных предателей оттеснили главные Силы Народно-освободительной армии.<br><br>Соотношение вражеских и партизанских частей было 6:1. Кроме того, у партизан было 4500 раненых и сыпотифозных бойцов. Ставка, больные и раненые попали в окружение в долине реки Неретвы. Остался только мост через бушующую и ледяную Неретву. На противоположном берегу ждали сильные вражеские части, подготавливаясь к кровавой резне раненых бойцов и беспомощного народа. Тито приказал взорвать мост на Неретве. Удивленный враг сейчас же перебросил свои части на другую сторону, предполагая, что партизаны попытаются вырваться из кольца окружения.<br><br>Партизаны же врагу подготовили совсем неожиданный сюрприз. В течение ночи они построили возле разрушенного моста монтажный временный мост, через который переправили части, раненых, больных, а также и все гражданское население, которое было с партизанами.','$71 015 000'),(8512,'Один из тринадцати',1969,90,0.0,6.3,234,'1969-10-07','https://st.kp.yandex.net/images/film_iphone/iphone360_8512.jpg','12 + 1','13 стульев — такое наследство досталось парикмахеру Марио от тетушки. Не зная, что в одном из стульев спрятано на 100 тысяч фунтов стерлингов драгоценностей, Марио продает их через антикварный магазин…','Нет данных'),(8513,'Южная звезда',1969,104,0.0,5.9,82,'1969-02-14','https://st.kp.yandex.net/images/film_iphone/iphone360_8513.jpg','The Southern Star','В надежде неплохо заработать молодой геолог Дэн с группой товарищей отправляется на поиски огромного алмаза «Южная Звезда». Кроме того герой влюблен в дочь финансиста, который нанял этот поисковый отряд. Удача улыбается Дэну — он находит алмаз. Но на вечеринке в честь успешного завершения экспедиции алмаз пропадает. Все подозрения падают на Дэна. Теперь ему необходимо сделать все, чтобы доказать свою невиновность и завоевать сердце любимой.','Нет данных'),(8514,'Битва за Рим 2',1968,94,0.0,6.4,117,'1969-02-21','https://st.kp.yandex.net/images/film/8514.jpg','Kampf um Rom II - Der Verrat','Продолжение киноэпопеи о борьбе римлян за освобождение города, захваченного варварами в 526 году нашей эры. Кульминацией войны стала победа Византийской Империи над римлянами и готами.','Нет данных'),(8515,'Тепепа',1969,133,0.0,6.3,119,'1969-01-31','https://st.kp.yandex.net/images/film_iphone/iphone360_8515.jpg','Tepepa','Предводитель партизанского отряда Тепепа борется против шефа полиции Каскорро.','Нет данных'),(8517,'Битва за Рим',1968,103,0.0,6.7,343,'1968-12-17','https://st.kp.yandex.net/images/film_iphone/iphone360_8517.jpg','Kampf um Rom I','Племена готов завоевали Рим в конце IV века нашей эры. На фоне грандиозных потрясений разворачивается драматическая борьба римлян за освобождение города от варваров.','Нет данных'),(8519,'Бессмертная история',1968,58,0.0,7.1,295,'1968-05-24','https://st.kp.yandex.net/images/film_iphone/iphone360_8519.jpg','Histoire immortelle','Португальская колония, XIX век. Мистер Клэй — богатый стареющий торговец, о котором любят посплетничать в городе. Его секретарь мистер Левински рассказывает ему историю о том, как один богач заплатил бедному моряку крупную сумму, чтобы зачать ребенка с его женой. Левински утверждает, что это всего лишь легенда, но Клэй, у которого нет наследника, решает сделать её правдой.','Нет данных'),(8520,'Я никогда не забуду это имя',1967,97,0.0,5.7,67,'1967-12-18','https://st.kp.yandex.net/images/film_iphone/iphone360_8520.jpg','I\'ll Never Forget What\'s\'isname','Успешный молодой человек, звезда рекламного бизнеса Эндрю Куин сыт по горло своей неправдоподобно счастливой жизнью. Неожиданно для всех он бросает свою работу и возвращается к написанию статей для небольшого литературного журнала. Он хочет полностью забыть свою прежнюю жизнь, но не так просто убежать от самого себя и прошлого.','Нет данных'),(8523,'Рогопаг',1962,122,0.0,7.2,805,'1963-02-21','https://st.kp.yandex.net/images/film_iphone/iphone360_8523.jpg','Ro.Go.Pa.G.','Четыре рассказа четырех авторов, которые весело рассказывают о причинах конца света.','Нет данных'),(8524,'Процесс',1962,119,0.0,7.8,3921,'1962-12-22','https://st.kp.yandex.net/images/film_iphone/iphone360_8524.jpg','Le procès','Рядовой клерк Йозеф К. обвиняется в некоем преступлении, которое он не совершал, поскольку не совершал вообще ничего противозаконного. Собственно, состав преступления ему не называют и сами обвинители, поскольку так же не знают, в чём он виноват…','Нет данных'),(8527,'Царь царей',1961,168,0.0,6.6,172,'1961-10-11','https://st.kp.yandex.net/images/film/8527.jpg','King of Kings','Нестареющий классический фильм о жизни Иисуса Христа.','Нет данных'),(8528,'Аустерлиц',1960,166,0.0,6.8,210,'1960-06-17','https://st.kp.yandex.net/images/film_iphone/iphone360_8528.jpg','Austerlitz','2 декабря 1805 г, на территории Южной Моравии (в то время часть Австрии) французские войска во главе с Наполеоном готовятся к решающей битве с российско-австрийской армией, объединившейся под началом Императора России Александра I и австрийского императора Франца I.<br><br>Французская армия почти вдвое меньше, чем войска коалиции, тем не менее Наполеон начинает подготовку к сражению и разрабатывает план, который в последствии будет назван одним из самых гениальных планов сражений.<br><br>Самонадеянные императоры России и Австрии, надеясь на превосходящую численность своих армий, не прислушались к стратегическим советам Кутузова. Быстрота перемещений — вот что послужило ключом к успеху Наполеона.','$4 000 000'),(8533,'Насилие',1959,103,0.0,7.0,450,'1959-04-01','https://st.kp.yandex.net/images/film_iphone/iphone360_8533.jpg','Compulsion','В представлении Джадда Стайнера и Артура Страуса идеальное преступление — то, что совершено без видимых причин, а потому оно вряд ли приведет к тем, кто его совершил. Джадд и Артур похищают и убивают 14-летнего мальчика; они умело пускают следствие по ложному пути и наслаждаются собственной неуязвимостью. Но промах, допущенный одним из них, приводит идейных убийц к фиаско…','Нет данных'),(8535,'Викинги',1958,116,0.0,7.3,2428,'1958-06-11','https://st.kp.yandex.net/images/film_iphone/iphone360_8535.jpg','The Vikings','Тысяча лет назад скандинавские викинги во главе с королем Рагнаром высадились на побережье Англии в надежде захватить вожделенные земли. Движимые жаждой наживы, безжалостные воины опустошали Британские острова, сея смерть и разрушение. <br /><br />Эйнар и Эрик были сводными братьями. Первый — сын короля викингов Рагнара, бесстрашный и непобедимый воин, которому не было равных в боях. Второй — его слуга и раб, ничего не знающий о своих родителях. Братья не подозревали о своем кровном родстве и с детства ненавидели друг друга. Многолетняя вражда достигла критической точки, когда оба влюбились в Уэльсскую принцессу Моргану…','$5 000 000'),(8536,'Долгое жаркое лето',1958,115,0.0,7.5,912,'1958-03-12','https://st.kp.yandex.net/images/film_iphone/iphone360_8536.jpg','The Long, Hot Summer','Ньюман стал звездой, сыграв чужака, мастера на все руки, взбудоражившего покой в семье патриарха-южанина, привыкшего к беспрекословному повиновению. Он решил задержаться в этом маленьком южном городке и жениться на дочери Уэллса.','Нет данных'),(8538,'Моби Дик',1956,116,0.0,7.4,1124,'1956-06-27','https://st.kp.yandex.net/images/film_iphone/iphone360_8538.jpg','Moby Dick','Измаил, от лица которого ведется повествование, молодой человек, уходит в плавание матросом на китобойном судне «Пекод». Вскоре после отплытия из порта выясняется, что рейс «Пекода» совсем не похож на обычные китобойные рейсы.<br><br>Капитан «Пекода» Ахаб потерял ногу в схватке с Белым китом — Моби Диком. Теперь он вышел в море, чтобы отыскать чудовище и дать ему ответный решающий бой. Он заявил команде, что намерен преследовать Белого Кита и ничто не заставит его отказаться от погони.','$4 500 000'),(8539,'Мистер Аркадин',1955,105,0.0,7.3,588,'1955-06-27','https://st.kp.yandex.net/images/film_iphone/iphone360_8539.jpg','Mr. Arkadin','Грегори Аркадин — фигура темная, архикапиталист, чье могущество и богатство окутано тайной. У него есть замок в Испании. Есть дочь, красивая, полная жизни, оберегаемая, как дочь султана. Аркадин страдает амнезией и нанимает мелкого американского контрабандиста, чтобы тот «раскопал» его прошлое. Его скрытая цель — найти и стереть с лица земли старых гнусных помощников, которые могут рассказать правду о нем его дочери.','Нет данных'),(8541,'Наполеон',1954,182,0.0,6.7,138,'1955-03-25','https://st.kp.yandex.net/images/film_iphone/iphone360_8541.jpg','Napoléon','«Он родился на острове, мечтал всю жизнь покорить остров, и умер против своей воли на острове» — так начинает свой рассказ князь Талейран, из уст которого Вы узнаете достоверную историю жизни великого императора и полководца Франции Наполеона Бонапарта.','Нет данных'),(8542,'Тайны Версаля',1953,168,0.0,7.1,218,'1954-02-10','https://st.kp.yandex.net/images/film/8542.jpg','Si Versailles m\'était conté','Уже во времена Людовика XIV говорили, что история Версаля состоит из череды строительстваи обольщений. Работы начались в 1661 году. Впервые два года Людовик XIV потратил несметные суммы денег.<br><br>Возведение Версаля продолжалось несколько десятилетий и потребовало не только невероятных денежных расходов, но и привлечения многих тысяч рабочих рук.<br><br>Первым архитектором Версаля был Луи Лево, его сменил Жюль Ардуэн-Мон-сар, руководивший строительством в течение тридцати лет. Оформление парков было поручено Андре Лено Тру.<br><br>Но дворец известен не только архитектурным великолепием, он знаменит и своими тайнами и интригами дворцовой знати и его владельцев — королей Франции.','Нет данных'),(8545,'Отелло',1951,93,0.0,7.1,445,'1951-11-27','https://st.kp.yandex.net/images/film_iphone/iphone360_8545.jpg','The Tragedy of Othello: The Moor of Venice','Бессмертная кинопостановка бессмертной трагедии Шекспира, в которой главную роль сыграл сам режиссер фильма Джордж Орсон Уэллс. Съемки «Отелло» продолжались 4 года из-за проблем с финансированием и Орсону, в течение этого периода, пришлось играть в чужих картинах, чтобы помочь удержать «Отелло» на плаву. Среди них были «Коварный лис Борджа» — Хенри Кинга, «Черная роза«-Хенри Хэтэуэя и «Третий человек» — Кэрола Рида. Его труды не пропали даром — фильм считается одной из лучших экранизаций Шекспира динамичной, сжатой и напряженной. Его фильм «Отелло» открывается торжественным и скорбным прологом: вдоль морского побережья, на фоне каменных крепостных стен движется похоронная процессия, реют штандарты, сверкает оружие, плывет на плечах латников гроб с телом черного полководца и, ярясь, как пойманный хищник, смотрит на посмертное торжество своего врага запертый в железную клетку Яго.','Нет данных'),(8547,'Маленький мир Дона Камилло',1952,107,0.0,7.6,228,'1952-03-18','https://st.kp.yandex.net/images/film_iphone/iphone360_8547.jpg','Don Camillo','Вся драматургия запутанных дружеско-вражеских отношений пастора с коммунистами основывается на том, что мэр Пеппоне и его соратники — простецы. Таковых же Господь любит — «блаженны чистые сердцем, ибо они Бога узрят»…','Нет данных'),(8549,'Черная магия',1949,105,0.0,6.0,76,'1949-08-19','https://st.kp.yandex.net/images/film_iphone/iphone360_8549.jpg','Black Magic','История Джозефа Бальзамо, цыганского мальчика в южной Франции, озлобленного на весь мир из-за того, что его родители были беззаконно повешены по приказу Виконта де Монтега. Несколько лет спустя Бальзамо обнаруживает у себя способность к гипнозу, меняет свое имя и становится графом Калиостро. Он хочет использовать свой дар для достижения известности и богатства, а в глубине души вынашивает идею мести.','Нет данных'),(8550,'Коварный лис Борджиа',1949,107,0.0,6.6,70,'1949-11-08','https://st.kp.yandex.net/images/film/8550.jpg','Prince of Foxes','Фильм рассказывает об одном из самых хитрых и расчетливых правителей Италии пятнадцатого века — Борджиа Чезаре, Чезаре задался мыслью создать из мелких разобщенных областей Романьи — одно цельное и сильное государство, для этого необходимо было овладеть Болонью, Флоренцией, всею Тосканой и стать абсолютным монархом на всем Апеннинском полуострове.<br /><br />Он окружил себя самыми лживыми и изворотливыми соратниками и пригласил в союзники красивого и словоохотливого Андреа Орсини, поручив ему входить в доверие к врагам и союзникам, чтобы путем интриг и обмана привести «коварного Лиса» Борджиа Чезаре к монопольной власти…','Нет данных'),(8551,'Макбет',1948,107,0.0,7.6,636,'1948-09-03','https://st.kp.yandex.net/images/film/8551.jpg','Macbeth','Киноверсия, основанная на истории реального Макбета — короля Шотландии, представляется режиссером как архетипичная история об опасности чрезмерной жажды власти и измене друзьям.','$75 000'),(8552,'Дуэль под солнцем',1946,129,0.0,6.8,568,'1946-12-29','https://st.kp.yandex.net/images/film_iphone/iphone360_8552.jpg','Duel in the Sun','Приговоренный к смертной казни ЗА убийство жены Чавез отсылает свою дочь Перл к родственникам в Техас. На огромном ранчо Макканлесс девушка знакомится со своими двоюродными братьями Левтом и Джесси, которые сразу влюбляются в нее.<br><br>Ловкий и крепкий объездчик лошадей и покоритель женщин Левт очень скоро соблазняет Перл, однако он не собирается жениться на девушке. Второй влюбленный кузен — Джесси, женившийся по расчету на другой, настолько увлечен красавицей Перл, что просит ее поселиться в его доме вместе с ним и его молодой женой.<br><br>Напряженность отношений в любовном треугольнике достигает кульминации, когда доведенная до отчаяния девушка берется за карабин…','$8 000 000'),(8553,'Путешествие в страх',1943,68,0.0,5.9,191,'1943-01-07','https://st.kp.yandex.net/images/film_iphone/iphone360_8553.jpg','Journey Into Fear','Вторая мировая война. Военный инженер из американской компании, работающей с турецким военным флотом, должен вернуться в Штаты. В Стамбуле обнаруживается, что его преследуют и хотят убить нацистские агенты. Он тайно пытается выехать из Стамбула морем, надеясь ввести преследователей в заблуждение.','Нет данных'),(8562,'Фальшивка',1973,89,0.0,7.6,881,'1973-12-14','https://st.kp.yandex.net/images/film_iphone/iphone360_8562.jpg','F for Fake','О знаменитых подделках произведений литературы и изобразительного искусства. В центре внимания два персонажа: художник Эльмир де Хори и журналист Клиффорд Ирвинг — «мировые лидеры в области фальшивок». Режиссер доказывает, что фальсификатор может оказаться более талантливым, чем автор оригинала.','Нет данных'),(8563,'Другая сторона ветра',2018,122,0.0,6.5,422,'2018-08-31','https://st.kp.yandex.net/images/film_iphone/iphone360_8563.jpg','The Other Side of the Wind','История о режиссере старой закалки Джейке Хэннафорде, который надеется вернуть себе славу с помощью новой провокационной картины.','Нет данных'),(8564,'Мишени',1968,90,0.0,6.9,609,'1968-08-13','https://st.kp.yandex.net/images/film_iphone/iphone360_8564.jpg','Targets','В этом фильме проходят две сюжетные линии, которые развиваются параллельно и независимо. Но это только на время. Известный всем актёр, который решил закончить сценическую карьеру и молодой человек, весьма уравновешенный и благополучный, на первый взгляд. Так что же между ними общего? И какова будет причина их встречи в финале?','$130 000'),(8565,'Библия',1966,174,0.0,7.3,645,'1966-09-28','https://st.kp.yandex.net/images/film_iphone/iphone360_8565.jpg','The Bible: In the Beginning...','Экранизация Великой Книги, библейские истории об Адаме и Еве, Каине и Авеле и многом другом, известном и не очень известном…','$18 000 000'),(8574,'Грозовой перевал',1939,104,0.0,7.0,1113,'1939-03-24','https://st.kp.yandex.net/images/film/8574.jpg','Wuthering Heights','Главный герой Хитклиф влюблен в Кэти, но не может жениться на ней из-за разницы в социальном положении. Всю жизнь он будет помнить об этом оскорблении, и мстить всем, кто причастен к его несчастью.','Нет данных'),(8575,'Рожденная танцевать',1936,106,0.0,6.7,122,'1936-11-27','https://st.kp.yandex.net/images/film_iphone/iphone360_8575.jpg','Born to Dance','После долгого отсутствия подводная лодка приходит к родным берегам. Среди экипажа есть три друга, один из которых женат и не видел жены целых четыре года. Он и не знает, что у них родилась дочь. Когда он с друзьями в увольнение приходит в клуб, жена его не сразу узнает, поскольку брак был скоропалительным, после танцевального марафона, и новоиспеченный муж сразу же завербовался на флот.<br><br>Пришедших с ним два друга сразу же находят себе девушек, поскольку они все пришли в «Клуб одиноких сердец». Между Норой и Тедом вспыхивают нежные чувства. Нора приехала из маленького городка в надежде стать танцовщицей, она рождена, чтобы танцевать, но талантам надо помогать, поскольку устроиться на Бродвей практически невозможно. На следующий день на корабль прибывает с визитом бродвейская звезда музыкальных комедий и волею случая Тед спасает из воды ее пекинеса.<br><br>Ее пресс-агент решил извлечь выгоду из случившегося, чтобы получить дополнительную рекламу для нового шоу и приходится Теду по приказу командира корабля отправиться на свидание со звездой, из-за чего он пропускает свидание с любимой. Утром все газеты трубили о новом романе звезды, а Нора обижена предательством и считает, что Тед ее не любит…','Нет данных'),(8576,'Кейн и Мейбл',1936,90,0.0,5.9,89,'1936-09-26','https://st.kp.yandex.net/images/film_iphone/iphone360_8576.jpg','Cain and Mabel','Менеджеры Ларри Каина, борца в тяжелом весе устраивают своему протеже роман с Бродвейской звездой Мейбл О`Дэйр, чтобы придать знаменитости больше очарования. Но эти двое никак не могут найти общий язык, начав с неправильной ноты.','Нет данных'),(8578,'Додсворт',1936,101,0.0,6.3,420,'1936-09-23','https://st.kp.yandex.net/images/film_iphone/iphone360_8578.jpg','Dodsworth','Продав свою автомобильную компанию, магнат Сэм Додсворт вместе с женой Фрэн уезжает путешествовать. Оказавшись в Европе, Фрэн заводит любовные романы — сначала с Арнольдом Изелином, затем с молодым аристократом Куртом фон Оберсдорфом — и бросает мужа.','Нет данных'),(8579,'Эти трое',1936,93,0.0,6.4,180,'1936-03-18','https://st.kp.yandex.net/images/film_iphone/iphone360_8579.jpg','These Three','Бонита Грэнвилл играет Мэри Тилфорд, подлую, злую девчонку, за которой надзирают учителя в роскошной частной школе, управляемой двумя подругами по колледжу Мартой и Кэрен. Марта — аскетичная, строгая женщина, типичная «янки», тогда как Кэрен — теплое, мягкое существо, она влюблена в местного доктора Джозефа Кардина. Он отвечает ей взаимностью, но поддерживает тесную дружбу с Мартой. Мэри из злобности сообщает бабушке, что Марта и Джо «занимались этим» в спальне рядом с комнатами учащихся. Бабушка знает, что Мэри — лгунья, но верит ей, так как ее ложь подтверждает 9-летняя Розали. Мэри, похоже, шантажирует девочку, зная, что та украла часы. Истина, в конце концов, станет очевидной…','Нет данных'),(8590,'Мальчик на дельфине',1957,111,0.0,6.7,171,'1957-04-10','https://st.kp.yandex.net/images/film_iphone/iphone360_8590.jpg','Boy on a Dolphin','Прекрасный греческий остров Гидра. Красавица Федра зарабатывает на жизнь добыванием губок с морского дна. Однажды, ныряя, девушка натыкается на затонувший корабль и обнаруживает древнюю золотую статую мальчика, сидящего верхом на бронзовом дельфине. Понимая, что ее находка может принести семье много денег, Федра отправляется в Афины. Там она знакомится с хитрым коллекционером Виктором Пармали и ученым Джимом Колдером. Оба горят желанием взглянуть на историческую ценность.','Нет данных'),(8616,'Синий георгин',1946,96,0.0,6.7,433,'1946-04-16','https://st.kp.yandex.net/images/film_iphone/iphone360_8616.jpg','The Blue Dahlia','Жена Джонни не сильно ждала мужа с фронта и давно уже пошла по рукам. После короткой, но яростной ссоры он уходит из дома, оставив свой пистолет, а вскоре Хелен находят убитой.<br><br>Мучимый провалами памяти, вызванными фронтовой контузией, Базз признается в убийстве, хотя полиция подозревает самого Джонни. Поиск истины осложняется непрекращающимися разборками с гангстерами, нарастающей амнезией Базза, чередой новых убийств.<br><br>Подозреваемые меняются как в калейдоскопе, напряжение нарастает. Поможет ли Джойс — жена таинственного владельца ночного клуба «Синий Георгин», любовника убиенной Хелен — найти подлинного убийцу или она ведет свою игру, смертельную для друзей?','Нет данных'),(8622,'Стеклянный ключ',1942,85,0.0,7.0,519,'1942-09-08','https://st.kp.yandex.net/images/film_iphone/iphone360_8622.jpg','The Glass Key','В ходе кампании за переизбрание, Пол Мэдвиг решает порвать с прошлым и отказаться от поддержки гангстеров, присоединившись к респектабельному реформисту Ральфу Генри. Вскоре сына мистера Генри находят мертвым. Между тем босс мафии использует свое влияние, чтобы вызвать у общественности подозрения в виновности Мэдвига.','Нет данных'),(8623,'Оружие для найма',1942,81,0.0,7.3,646,'1942-04-24','https://st.kp.yandex.net/images/film_iphone/iphone360_8623.jpg','This Gun for Hire','Добрый к детям и котам наемный убийца Филип Рейвн, получает оплату своей «работы» от предателя Уилларда Гэйтса в «горячих» деньгах. Крейн (второй после Рейвна) завербован комитетом Сената, чтобы помочь в расследовании деятельности Гэйтса. Рейвн жаждет отомстить Гэйтсу, он отправляется на его поиски…','Нет данных'),(8627,'Мы встретились в Бомбее',1941,92,0.0,7.3,133,'1941-06-27','https://st.kp.yandex.net/images/film/8627.jpg','They Met in Bombay','Джералд Мелдрик превосходно одет и галантен. Профессиональный «вор-джентльмен», считающий себя художником своего дела, он в очередной раз решил сорвать куш. Его цель — бриллиант «Звезда Азии», включенный в ожерелье, принадлежащее герцогине, которая путешествует из Белтрейврса в Бомбей.<br><br>Джералд выдает себя за детектива, уполномоченного страховой компанией охранять бесценный камень. С этой же с целью, завладеть бриллиантом, в отеле поселяется Аня Ван Дурен. Эта аферистка выдает себя за баронессу Дурен. Ее тактика проста, она втирается в доверие к хозяйке, спаивает ее и ворует ожерелье из спальни.<br><br>Джералд обнаруживает пропажу и под видом инспектора приходит в каюту девушки. Он требует отдать ему драгоценность взамен замолчание. Аня соглашается, но на следующий день понимает, что оказалась жертвой такого же жулика, как она.<br><br>Между ними происходит нелицеприятный разговор, после которого они становятся партерами по воровскому бизнесу. Этой симпатичной парочке предстоит пройти не простой путь полный приключений из Бомбея в Гонконг и даже поучаствовать в военных действиях…','Нет данных'),(8629,'Чёрный кот',1941,70,0.0,5.8,150,'1941-05-02','https://st.kp.yandex.net/images/film_iphone/iphone360_8629.jpg','The Black Cat','Когда здоровье богатой и одинокой Генриетты Уинслоу начало ухудшаться, её алчные родственнички и знакомые не замедлили собраться в её особняке, рассчитывая урвать свою долю наследства. Каково же было их разочарование, когда они узнали, что старушка пошла на поправку! Поразмыслив, гости решили, что вместо того чтобы ждать, когда господь соблаговолит забрать Генриетту на тот свет, лучше устранить бабку самостоятельно.','Нет данных'),(8657,'Остров потерянных душ',1932,70,0.0,6.4,373,'1933-01-12','https://st.kp.yandex.net/images/film_iphone/iphone360_8657.jpg','Island of Lost Souls','Главной целью своих опытов Моро ставит изучить до конца пластичность живых организмов, поэтому вот уже десять лет находясь на острове он пытается создать из зверя человека. Создано уже около 60 зверолюдей, начиная от самых маленьких(ленивцеподобное существо) и заканчивая монстрами(леопардо-человек, гиено-свинья, волко-медведь и т. д.).','Нет данных'),(8665,'Звездные герои',1997,99,0.0,5.3,144,'1999-06-17','https://st.kp.yandex.net/images/film/8665.jpg','Laserhawk','250 миллионов лет назад… Всемогущая нация плотоядных существ Арактоидов заронила семена жизни на новой планете Земля, планируя вернуться в будущем, чтобы собрать урожай человеческой плоти.<br><br>Команда межгалактических миротворцев, пытаясь помешать Арактоидам, попадает в засаду, и их корабль погружается на дно земного океана, а экипаж гибнет.<br><br>Наши дни — Зак и Кера — эксцентричные школьники, одержимые идеей НЛО. Встретившись после того, как всех жителей их города похитили инопланетяне, они неожиданно начинают «вспоминать» события той давней миссии, что привела к гибели межгалактических миротворцев.<br><br>Вместе с одаренным создателем комиксов «МК Ультра» и загадочным пациентом психиатрической лечебницы они отправляются на поиски пропавшего межзвездного корабля. Всего лишь за один день до возвращения на Землю Арактоидов Зак и Кера находят его и устремляются в битву, прервавшуюся 250 миллионов лет назад.','$7 000 000'),(8669,'Бэтмен: Маска Фантазма',1993,76,0.0,7.4,5469,'1993-12-25','https://st.kp.yandex.net/images/film_iphone/iphone360_8669.jpg','Batman: Mask of the Phantasm','В Готэме появляется новый борец с преступностью — Фантазм, который в отличие от Бэтмена попросту убивает уголовников. От его руки гибнут мафиозные боссы Чаки Сол и Базз Бронски — члены старой банды, орудовавшей в городе еще до появления человека-летучей мыши. Главарем банды был Сальваторе Валестра, именно он является следующей мишенью Фантазма. Идя по следу убийцы, Бэтмен приходит к выводу, что тот связан с событиями из его прошлого.','$6 000 000'),(8671,'Гайвер',1991,92,0.0,6.3,6345,'1991-03-18','https://st.kp.yandex.net/images/film_iphone/iphone360_8671.jpg','Guyver','Инопланетяне прибыли на Землю, чтобы создать новое органическое оружие — человеческий разум. Имплантируя в человеческий мозг дополнительный ген, они превращают людей в непобедимых монстров.<br><br>Только альтернативное оружие — «Гайвер» может противостоять порабощению. «Гайвер» представляет собой некий биокостюм, стократно увеличивающий прыткость и силу носителя. Случайным обладателем «Гайвера» становится обыкновенный студент, изучающий каратэ.','Нет данных'),(8672,'Ночной попутчик',1990,93,0.0,5.6,354,'1990-07-20','https://st.kp.yandex.net/images/film_iphone/iphone360_8672.jpg','Midnight Ride','Полицейский поссорился с женой, и та от него уехала. По дороге она подсадила попутчика, голосовашего на дороге. Зря она это сделала. Парень, оказавшийся опасным маньяком-убийцей, только что сбежал из психушки. Для нее и муженька, пустившегося в погоню за похитителем, эта ночная поездка превратилась в кошмар.','Нет данных'),(8673,'Собственность дьявола',1997,107,0.0,6.7,7425,'1997-03-13','https://st.kp.yandex.net/images/film_iphone/iphone360_8673.jpg','The Devil\'s Own','Фрэнки Макгуайр — самый опасный террорист Ирландской Республиканской Армии. Прибыв в Америку с миссией покупки оружия, он находит приют в доме Тома О’Миры, нью-йоркского полицейского, который не знает ничего о личности и реальной жизни своего гостя. Все открывается, когда семья Тома сталкивается с террористами по вине Фрэнки. Принципы полицейского и юного мстителя сталкиваются. Борьба между главными героями приводит к неожиданной развязке…','$90 000 000'),(8674,'Кое-что о Генри',1991,108,0.0,7.1,1181,'1991-07-10','https://st.kp.yandex.net/images/film/8674.jpg','Regarding Henry','Генри Тернер — преуспевающий, но бессердечный нью-йоркский адвокат, готовый добиваться успеха любой ценой, даже за счет своих жены и дочери.<br><br>Но однажды случается несчастье, которое обрывает стремительную карьеру Генри. Он оказывается недееспособным и к тому же полностью теряет все воспоминания о своей прошлой жизни. Необходимо начинать все заново, и Генри постепенно узнает тяжелую и неприятную правду о себе самом…','Нет данных'),(8675,'Неукротимый',1987,120,0.0,7.1,6062,'1988-02-16','https://st.kp.yandex.net/images/film_iphone/iphone360_8675.jpg','Frantic','Врач Ричард Уолкер и его жена Сондра когда-то провели в Париже свой медовый месяц. И вот они снова в любимом городе… Разместившись в гостинице, они собираются немного отдохнуть. Но, выйдя из ванной комнаты, Ричард обнаруживает, что жены в номере нет. Поиски не приносят никакого результата. Не зная языка, доктор мечется по городу, в котором никто не хочет ему помочь. Никто, кроме проститутки Мишель.','$20 000 000'),(8676,'Берег москитов',1986,119,0.0,6.7,1677,'1986-11-26','https://st.kp.yandex.net/images/film_iphone/iphone360_8676.jpg','The Mosquito Coast','Элли Фокс обуреваем одной-единственной мечтой: бросить все и убежать с семьей куда-нибудь в джунгли, в первозданный мир, подальше от развращающего влияния цивилизации. Вместе с женой и детьми он садится на корабль, следующий к Берегу Москитов.<br><br>Однако в джунглях Центральной Америки задуманная утопия Фокса превращается в опасное наваждение, а поиски рая сменяются жестокой борьбой за выживание.','$25 000 000'),(8677,'Фриско Кид',1979,114,0.0,6.4,335,'1979-07-06','https://st.kp.yandex.net/images/film_iphone/iphone360_8677.jpg','The Frisco Kid','На дворе 1850-ый год — новоиспеченный ортодоксальный раввин Авраам Белински решил добраться из Филадельфии до Сан-Франциско… верхом на лошади.<br><br>Единственное, что знает о Калифорнии незадачливый ездок — это то, что она «где-то неподалеку от Нью-Йорка». К счастью, Авраам знакомится с бывалым ковбоем Томом Лиллардом, который готов протянуть руку помощи.<br><br>Путь в Сан-Франциско — весьма рискованное мероприятие, принесшее спутникам массу неприятностей: проблемы с законом, встречи с индейцами и бандой жестоких головорезов.','Нет данных'),(8678,'Новые американские граффити',1979,110,0.0,6.2,274,'1979-08-03','https://st.kp.yandex.net/images/film_iphone/iphone360_8678.jpg','More American Graffiti','Фильм рассказывает о том, как меняются надежды, мечты и любовные истории знакомых нам школьных друзей. Прощайте, танцы до упаду, ночные прогулки и борьба с прыщами. Теперь вся жизнь приятелей вертится вокруг вечеринок в студенческом кампусе, романов и маршей мира.','$3 000 000'),(8679,'Ганновер-стрит',1979,109,0.0,6.6,500,'1979-05-18','https://st.kp.yandex.net/images/film_iphone/iphone360_8679.jpg','Hanover Street','Отважный пилот Дэйвид Эллоран встречает прекрасную незнакомку, и в пекле страшной войны разгорается страсть влюбленных. Она замужем, но настоящее чувство не разбирает условностей. Однажды Дэйвид получает рискованное задание — доставить за линию фронта британского разведчика с суперсекретной и опасной миссией.<br><br>Но его самолет сбивают, и двое оказываются на краю гибели. Положение осложняется тем, что Дэйвид вскоре понимает, кто находится рядом с ним — человек, с которым ему предстояло бороться за жизнь, оказывается мужем его возлюбленной…','Нет данных'),(8680,'Отряд 10 из Навароне',1978,118,0.0,6.3,422,'1978-08-16','https://st.kp.yandex.net/images/film_iphone/iphone360_8680.jpg','Force 10 from Navarone','Два главных героя — Клифф Мэллори, ставший майором — и его друг-взрывник Миллер выбрасываются с самолета в Югославии, где им предстоит в сотрудничестве с десантным отрядом полковника Барнсби и местными партизанами взорвать крайне важный для немцев мост. Но им противостоит предатель Лесковар…','$5 000 000'),(8681,'Напрямик',1970,124,0.0,6.9,282,'1970-05-13','https://st.kp.yandex.net/images/film_iphone/iphone360_8681.jpg','Getting Straight','Ветеран войны во Вьетнаме Гарри Бейли решает пойти в колледж. Несмотря на то, что Гарри значительно старше и опытнее большинства студентов, он — активный участник студенческих движений. Но у Гарри не все так хорошо, ведь он хочет стать учителем, а профессора убеждают его в том, что учитель — это просто одна из профессий, причем не самая лучшая.','Нет данных'),(8682,'Забриски Пойнт',1970,112,0.0,7.6,6784,'1970-02-09','https://st.kp.yandex.net/images/film_iphone/iphone360_8682.jpg','Zabriskie Point','Она — секретарша, которая работает над проектом своего босса в Фениксе, он — бывший студент, который угнал самолет. Они гуляют по безжизненной пустыне, выясняют, ради чего живут, забываются и занимаются любовью.','$7 000 000'),(8685,'Вредный Фред',1991,103,0.0,6.7,1256,'1991-05-24','https://st.kp.yandex.net/images/film_iphone/iphone360_8685.jpg','Drop Dead Fred','Вредный Фред — не игрушка. Так называют не домашнего питомца и даже не любимую куклу. Вредный Фред — фантазер и волшебник, неудачник и проныра. Он может доставить тебе массу хлопот: испортить торжественный банкет, превратить деловые переговоры в цирк, напакостить дома и сорвать все твои планы.<br><br>Вдобавок ко всему, он незаметен для остальных, так что если что — нибудь выйдет боком, обвинят в этом только тебя. Но особенных поводов для беспокойства нет, поскольку именно Фред вернет тебе уверенность в собственных силах и впутает в такие приключения, которые ты запомнишь на всю жизнь.','Нет данных'),(8686,'Братья-сестры, соперники-соперницы',1990,87,0.0,6.7,200,'1990-10-26','https://st.kp.yandex.net/images/film_iphone/iphone360_8686.jpg','Sibling Rivalry','Муж не обращает на нее внимания, родственники не замечают, сестра видит в ней только недостатки. В отчаянии Марджори Тернер ложится в постель с очаровательным незнакомцем, а тот возьми и умри от сердечного приступа прямо в койке! Но это еще не все. Покойный, оказывается, был ее деверем…','Нет данных'),(8689,'Герой-любовник',1989,98,0.0,7.1,404,'1989-04-28','https://st.kp.yandex.net/images/film_iphone/iphone360_8689.jpg','Loverboy','В летние каникулы Рэнди работает в пиццерии, развозит пиццу клиентам и клиенткам. А среди последних попадаются весьма и весьма симпатичные, хоть и не очень молодые. Среди симпатичных и немолодых клиенток у него многие стали постоянными и дают на чай столько, что и на многое другое хватает. И дело-то тут не только в пицце… О том, как он из этих приключений выкручивается, и рассказывает непритязательная молодежная комедия.','Нет данных'),(8690,'Свидание со смертью',1988,108,0.0,6.8,507,'1988-04-15','https://st.kp.yandex.net/images/film_iphone/iphone360_8690.jpg','Appointment with Death','На месте археологических раскопок в Палестине произошло загадочное убийство. И, естественно, Пуаро берется за расследование.','Нет данных'),(8691,'Страж времени',1987,87,0.0,4.7,93,'1987-12-03','https://st.kp.yandex.net/images/film_iphone/iphone360_8691.jpg','The Time Guardian','В пятом тысячелетии нашей эры человечество окажется на грани вымирания, истребляемое роботами. Несколько уцелевших людей укрываются в «Городе» — конструкции, которая может перемещаться во времени. Они решают отступить в прошлое. Чтобы подготовить плацдарм для «Города» в нашем времени, гость из будущего Баллард прибывает в 1988 год.','Нет данных'),(8694,'Бигглз: Приключения во времени',1985,92,0.0,6.7,496,'1986-05-30','https://st.kp.yandex.net/images/film_iphone/iphone360_8694.jpg','Biggles','Что делать, если вы оказались временным близнецом прославленного аса Первой мировой войны, и вас постоянно в самые неожиданные моменты отбрасывает в 1917 год и возвращает в настоящее?<br><br>Вам ничего не остается, как возложить на себя сверхзадачу помочь английским войскам уничтожить секретное оружие немцев в 1917-м и спасать себя и Бигглза от полиции в настоящем…','Нет данных'),(8695,'Совершенно секретно!',1984,90,0.0,7.4,7450,'1984-06-08','https://st.kp.yandex.net/images/film_iphone/iphone360_8695.jpg','Top Secret!','Восточная Германия времен «холодной войны». Военщина разрабатывает коварный план по уничтожению кораблей НАТО, для чего похищает ученого доктора Фламонда, запирает его в темнице, заставляя сотворить мину «Поларис». Прикрытием для преступных замыслов служит международный фестиваль, на который приглашают артистов из разных стран. Из Америки приезжает рок-певец Ник Риверс и знакомится с очаровательной Хиллари — дочерью Фламонда. Она — участник подпольного сопротивления, к которому привлекает и Ника.','Нет данных'),(8696,'Тайна острова чудовищ',1981,100,0.0,5.7,397,'1981-04-03','https://st.kp.yandex.net/images/film/8696.jpg','Misterio en la isla de los monstruos','В поисках приключений два героя умудряются столкнуться с пиратами, чудовищами и сумасшедшим, ищущим затерянное сокровище… Удастся ли им спастись? Или загадка острова Чудовищ так и останется неразгаданной…','Нет данных'),(8701,'Жуткие создания',1977,89,0.0,6.7,279,'1977-08-24','https://st.kp.yandex.net/images/film_iphone/iphone360_8701.jpg','The Uncanny','Уилбур Грей-ученый, специализирующийся на паранормальных явлениях. Его ранние работы были посвящены летающим тарелкам и происхождению пирамид. Но Грей убежден, что книга, которую он только что написал, имеет наиважнейшее значение. В ней высказывается мысль, что хозяевами планеты Земля являются не люди, как принято считать, а кошки. И их терпению от тирании человека приходит конец. Издатель Грея Фрэнк Ричардс считает новую книгу по меньшей мере странной, но, тем не менее, соглашается издать ее, если Грей предоставит убедительные доказательства. Он должен написать три рассказа, основанные на реальных событиях, доказывающих кошачий заговор…','Нет данных'),(8702,'На волне ужаса',1977,85,0.0,5.5,245,'1977-07-15','https://st.kp.yandex.net/images/film_iphone/iphone360_8702.jpg','Shock Waves','Сбившись с курса во время солнечного затмения, небольшой кораблик-перевозчик терпит крушение где-то близ Атлантического побережья США, налетев на проржавевшие останки германского военного крейсера времен 2-й Мировой войны. На утро, высадившись на безвестном островке, пассажиры злосчастного суденышка обнаруживают в воде у берега мертвое тело своего капитана, а пробравшись вглубь острова, находят старый заброшенный отель, в котором, в полном уединении, живет таинственный старик-немец, оказавший им весьма холодный прием. На следующий день еще один из потерпевших крушение гибнет, а оставшиеся люди начинают замечать вокруг отеля странные фигуры людей в униформе штурмовиков СС, которые бесшумно появляются из зарослей и так же бесшумно исчезают. Только один человек знает, кем являются эти существа и что им нужно. И только один человек уйдет живым с острова…','$200 000'),(8703,'Путешествие к центру Земли',1976,89,0.0,6.1,197,'1976-08-07','https://st.kp.yandex.net/images/film_iphone/iphone360_8703.jpg','At the Earth\'s Core','Конец девятнадцатого века. Группа ученых решает провести испытания новой буровой машины под названием «Iron Mole», способной проникать в глубь земли. Доктор Абнер Перри и его молодой американский коллега Дэвид Инс считают, что под всеми известными слоями почвы могут быть огромные запасы полезных ископаемых. Но там, к своему огромному удивлению, они обнаруживают необычный мир, населенный динозаврами, гигантскими монстрами, летающими чудовищами, огромными птицами, обладающими телепатическими способностями, людьми-рабами.<br><br>В городе Pellucidar Дэвид влюбляется в очаровательную девушку Дию. Но когда та оказывается выбранной для жертвоприношения, ученые организуют восстание рабов, чтобы спасти Дию и самим выбраться на поверхность Земли…','$1 500 000'),(8705,'Упырь',1975,88,0.0,5.9,81,'1975-06-01','https://st.kp.yandex.net/images/film_iphone/iphone360_8705.jpg','The Ghoul','Англия. 20-е годы прошлого века. Во время вечеринки в отдаленном поместье Дафна подстрекает двух своих воздыхателей, Билли и Джеффри, отправиться покататься на машинах. Джеффри очень разочарован, когда Дафна не только выбирает в качестве попутчика Билли, но и садится за руль его машины. Его настроение еще больше ухудшается, когда сестра Билли Анжела навязывается к нему. <br><br>Гонка начинается. И оба мужчины понимают, что Дафна очень даже неплохой гонщик. Джеффри пытается обогнать Дафну, но Анжела просит его снизить скорость. Тем временем на дорогу опускается туман, и Дафна сбивается с дороги. Вскоре у машины заканчивается бензин, и Дафна посылает за ним Билли. Выйдя из машины, тот в ужасе замечает, что машина остановилась всего в нескольких метрах от края обрыва. <br><br>Тем временем Дафна не замечает странного мужчину, который наблюдает за ней из-за деревьев. Когда Дафна устает ждать, она оставляет записку Билли и отправляется на поиски ночлега. Она встречает незнакомца, Тома Роулингса. Увидев ворота большого дома, Дафна хочет войти внутрь. Но Том хватает ее и говорит, что этот дом пуст. Дафна пытается вырваться, но Том бьет ее по голове, и Дафна теряет сознание. Она приходит в себя в его особняке и Том миролюбиво говорит, что сделал это только для того, чтобы она не заходила в этот дом…','Нет данных'),(8709,'Легенда о Семи Золотых вампирах',1974,89,0.0,4.4,182,'1974-07-11','https://st.kp.yandex.net/images/film_iphone/iphone360_8709.jpg','The Legend of the 7 Golden Vampires','Граф Дракула прибывает в китайскую деревеньку, чтоб оказать поддержку шести вампирам, потерявшим седьмого члена своей секты. Тем временем неподалёку проездом оказался профессор Ван Хельсинг, к которому и обратились за помощью местные жители.','Нет данных'),(8710,'Франкенштейн и монстр из ада',1973,91,0.0,6.1,186,'1974-05-02','https://st.kp.yandex.net/images/film_iphone/iphone360_8710.jpg','Frankenstein and the Monster from Hell','Это последний из фильмов о Франкенштейне о Бароне, который прячется в психиатрической больнице, чтобы и дальше проводить свои эксперименты по воскрешению мёртвых, вместе с соседом таким же душевнобольным доктором Хельдером.','Нет данных'),(8711,'Сумасшедший дом',1974,89,0.0,6.4,202,'1974-03-28','https://st.kp.yandex.net/images/film_iphone/iphone360_8711.jpg','Madhouse','Пол Тумбс, голливудская звезда фильмов ужасов, воплотивший на экранах культовый образ Доктора Смерть, попадает в психушку за убийство. Между тем готов очередной сценарий про Доктора Смерть, и по приходу Тумбса в более-менее нормальное психическое состояние, его просят вернуться на экран. Согласие получено, но когда Тумбс узнаёт, что режиссёром фильма будет бывший порнограф, когда-то снимавший ту самую убитую девушку, он начинает жалеть о своём решении.','Нет данных'),(8712,'А теперь начинается крик',1973,90,0.0,6.2,143,'1973-04-27','https://st.kp.yandex.net/images/film_iphone/iphone360_8712.jpg','And Now the Screaming Starts!','Кэтрин приезжает в старинное поместье Фенгриффен, чтобы выйти замуж за Чарльза — потомка старинного рода. С первого же дня она попадает в атмосферу леденящего ужаса, царящего в поместье. В каждом углу дома таятся призраки, которые нападают на нее в первую же брачную ночь. Ей кажется, что она сходит с ума, и в поместье приезжает известный специалист по психическим заболеваниям доктор Поуп, который узнает, что все дело в старинном проклятии Фенгриффенов…','Нет данных'),(8713,'Байки из могилы',1973,98,0.0,6.2,413,'1974-02-21','https://st.kp.yandex.net/images/film_iphone/iphone360_8713.jpg','From Beyond the Grave','Хозяин антикварного салона «Искушения» продает покупателям старинные вещи с тайнами. Четыре истории, главными предметами в которых являются зеркало, медаль, табакерка и дверь.','Нет данных'),(8714,'Психбольница',1972,85,0.0,6.7,718,'1972-07-06','https://st.kp.yandex.net/images/film_iphone/iphone360_8714.jpg','Asylum','Молодой психиатр доктор Мартин приезжает в психбольницу Дансмора, где надеется быть принятым на работу. Главный врач клиники, доктор Стар, был помещен к своим бывшим пациентам из-за умственного расстройства. Его ассистент, доктор Рутерфорд, чтобы проверить компетенцию прибывшего, показывает доктору Мартину четырех пациентов, среди которых находится и доктор Стар. Доктор должен выслушать их, идентифицировать и обнаружить безумного главного врача…','Нет данных'),(8715,'Возвращение доктора Файбса',1972,89,0.0,5.8,197,'1974-02-22','https://st.kp.yandex.net/images/film_iphone/iphone360_8715.jpg','Dr. Phibes Rises Again','Три года спустя после своей смерти, доктор Файбс воскресает из мертвых в результате совпадения орбит Луны и Сатурна. Он хочет вернуть к жизни свою жену Викторию. Для этого ему нужен древний египетский свиток, на котором указано расположение источника эликсира жизни.','Нет данных'),(8716,'Страх в ночи',1972,94,0.0,6.2,95,'1972-07-09','https://st.kp.yandex.net/images/film_iphone/iphone360_8716.jpg','Fear in the Night','На недавно вышедшую из психиатрической лечебницы девушку Пегги нападает неизвестный и пытается задушить. Ее молодой супруг Роберт отказывается верить в случившиеся, он увозит девушку в деревню где работает школьным учителем. Но и здесь спокойной жизнь Пегги не становится, ей кажется что за ней следят, вскоре покушение повторяется.','Нет данных'),(8717,'Байки из склепа',1972,92,0.0,7.0,1470,'1972-03-08','https://st.kp.yandex.net/images/film_iphone/iphone360_8717.jpg','Tales from the Crypt','Пятеро туристов на экскурсии по катакомбам случайно сбиваются с пути и забредают в странную комнату, где встречают странного человека, который рассказывает им истории об их смерти.','Нет данных'),(8719,'Близнецы зла',1971,87,0.0,5.4,235,'1971-10-03','https://st.kp.yandex.net/images/film_iphone/iphone360_8719.jpg','Twins of Evil','Осиротев две сестры-близняшки Гелхорн перезжают из столицы в небольшой провинциальный городок, под опекунство дядюшки Густава — главу местного религиозного братства. Одна из сестер влюбляется в графа Карнштайн, который принес в жертву Сатане одну из деревенских девушек, за что и был превращен им в вампира. Скоро и она сама становится вампиршей.<br><br>Однажды дядя узнает о случившемся. Разумеется, Фриду ждала смерть на костре, но темные силы во главе с графом Карнштайном подменили заточенную в темницу Фриду на ее милую сестричку Марию, и если бы не помощь влюбленного в нее историка Антона, то гореть бы ей на костре деревенской инквизиции….','£205 067'),(8720,'Любовницы вампирши',1970,87,0.0,5.9,344,'1970-10-04','https://st.kp.yandex.net/images/film_iphone/iphone360_8720.jpg','The Vampire Lovers','После того как семья кровососов Карнштайнов похитила сестру барона Хартога, он отправляется на поиски, чтобы прекратить ее мучения. Открыв гробы вампиров, он вбивает им в грудь осиновые колы. Только молодой Миркалле удается избежать наказания.','Нет данных'),(8721,'Франкенштейн должен быть уничтожен',1969,97,0.0,5.8,237,'1969-05-22','https://st.kp.yandex.net/images/film_iphone/iphone360_8721.jpg','Frankenstein Must Be Destroyed','Франкенштейн похищает из психиатрической лечебницы своего коллегу доктора Фредерика Брандта. Он уверен, что сможет излечить Брандта от сумасшествия с помощью хирургического вмешательства. Но операция проходит неудачно.<br><br>Тогда Франкенштейн похищает другого человека — профессора Рихтера, чтобы пересадить в его тело мозг Брандта. И это ему удается, но оказывается, что получившееся существо вовсе не собирается сотрудничать со своим создателем.','Нет данных'),(8724,'Сад пыток',1967,93,0.0,6.2,147,'1967-11-10','https://st.kp.yandex.net/images/film_iphone/iphone360_8724.jpg','Torture Garden','Антология из четырёх страшных историй. Доктор Дьяболо, владелец ярмарочного шоу ужасов, приглашает нескольких зрителей на «особенный» частный сеанс, где каждый из них узнает о своей дальнейшей судьбе.','Нет данных'),(8725,'Франкенштейн создал женщину',1966,92,0.0,5.9,259,'1967-03-15','https://st.kp.yandex.net/images/film_iphone/iphone360_8725.jpg','Frankenstein Created Woman','Ганс любит Кристину, дочку трактирщика, но отец категорически против их связи. Неожиданно его убивают, и подозрение падает на Ганса — его приговаривают к смерти. После казни решает утопиться и Кристина. Это как раз то, что надо доктору Франкенштейну. Ему удается создать красотку, в которую вселяется дух Ганса, и начинаются убийства.','Нет данных'),(8726,'Саван мумии',1967,90,0.0,5.6,122,'1967-03-15','https://st.kp.yandex.net/images/film_iphone/iphone360_8726.jpg','The Mummy\'s Shroud','В 20-х годах двадцатого века археологическая экспедиция, финансируемая американским промышленником под руководством Бэсила Уордена обнаруживает могилу фараона Катобе. Тем самым они освобождают силы зла, таившиеся в гробнице множество веков…','Нет данных'),(8728,'Остров террора',1966,89,0.0,5.9,86,'1966-06-20','https://st.kp.yandex.net/images/film_iphone/iphone360_8728.jpg','Island of Terror','На небольшом ирландском острове находят тело фермера, полностью лишённое костей. Прибывшая на остров для расследования столь странного случая группа специалистов вскоре обнаруживает и другие такие же трупы и приходит к выводу, что инциденты могут быть связаны с деятельностью некоего доктора Филлипса, одержимого идеей изобрести средство от рака. А вскоре они встречают и самих виновников смертей — жутких монстров, высасывающих костную ткань из живых существ.','Нет данных'),(8729,'Доктор Кто и Далеки',1965,82,0.0,5.8,156,'1965-06-25','https://st.kp.yandex.net/images/film_iphone/iphone360_8729.jpg','Dr. Who and the Daleks','Доктор Кто случайно активирует свое новое изобретение «Tardis» (Time And Relative Dimensions In Space) — машину времени, сделанную под вид телефонной будки. Вместе со своими внучками Сюзан и Барбарой, а также их другом Яном, он переносится сквозь время на планету Скаро, которая опустошена ядерной войной. Вскоре путешественники во времени обнаруживают металлический город, где мирная раса «талов» находится в угнетении со стороны других обитателей планеты, роботов-мутантов «далеков»…','Нет данных'),(8730,'Грех Франкенштейна',1964,84,0.0,5.5,169,'1964-05-08','https://st.kp.yandex.net/images/film_iphone/iphone360_8730.jpg','The Evil of Frankenstein','Прогнанный священником из своего поместья, где он проводил эксперименты, барон Франкенштейн возвращается в Карлштадт и обнаруживает замерзшего монстра. Барону удается вернуть его к жизни. Но монстр, который может существовать только под гипнозом профессора Золтана, поворачивается против своего создателя…','Нет данных'),(8732,'Капитан Клегг',1962,82,0.0,5.5,153,'1962-06-13','https://st.kp.yandex.net/images/film_iphone/iphone360_8732.jpg','Captain Clegg','XVIII век. В прибрежный английский городок прибывает отряд капитана Колье, намеревающегося пресечь деятельность местных контрабандистов. Вскоре до солдат доходят истории о бесчинствующих на здешних болотах всадниках-призраках. Всадников считают проклятьем, наложенным на здешние места легендарным пиратом Клеггом, но Колье не склонен верить в подобные сказки.','Нет данных'),(8733,'Наличные по требованию',1961,89,0.0,6.9,74,'1961-12-20','https://st.kp.yandex.net/images/film_iphone/iphone360_8733.jpg','Cash on Demand','Что может изменить натуру вредного и брезгливого управляющего банковским отделением? Может изощрённое ограбление?..','Нет данных'),(8738,'Меч Шервудского леса',1960,80,0.0,5.7,93,'1960-12-26','https://st.kp.yandex.net/images/film_iphone/iphone360_8738.jpg','Sword of Sherwood Forest','История про благородного разбойника Робина Гуда, который не позволил коварному шерифу Ноттингема отобрать поместье у наследников лорда Бортри, погибшего в Крестовом походе.','Нет данных'),(8739,'Невесты Дракулы',1960,85,0.0,6.1,409,'1960-07-07','https://st.kp.yandex.net/images/film_iphone/iphone360_8739.jpg','The Brides of Dracula','В глухом местечке Трансильвании старая баронесса скрывает в замке сына-вампира и заманивает к нему молоденьких девушек. Одна из гостивших особ выпускает упыря на свободу. К счастью, в глухомань с визитом прибывает известный истребитель вампиров доктор Ван Хельсинг.','Нет данных'),(8740,'Плоть и демоны',1960,94,0.0,5.8,151,'1960-02-02','https://st.kp.yandex.net/images/film_iphone/iphone360_8740.jpg','The Flesh and the Fiends','1820-е годы, Эдинбург. Доктору Ноксу нужны трупы для своих исследований. Но по закону для этих целей могут использоваться лишь трупы казненных преступников. Тогда доктор Нокс нанимает двух сомнительных проходимцев, которые, чтобы быстрее выполнять заказы, просто убивают людей, вместо того, чтобы выкапывать трупы на кладбище…','Нет данных'),(8742,'Месть Франкенштейна',1958,89,0.0,6.2,268,'1958-06-01','https://st.kp.yandex.net/images/film_iphone/iphone360_8742.jpg','The Revenge of Frankenstein','1860 год. Барона Франкенштейна ведут к гильотине. Но ему удается избежать смерти, войдя в сговор с палачом и охранником тюрьмы. Франкенштейн переезжает в Карлсбрук, где становится видным и уважаемым врачом, хотя отказывается состоять в Ассоциации медиков города. Доктор практикует на богатой клиентуре, но в то же время открывает больничное отделение для бедных, в котором работает бесплатно, что вызывает к нему уважение общества. На самом деле эта работа позволяет брать человеческие органы и части тела, необходимые ему для экспериментов…','Нет данных'),(8744,'Снежный человек',1957,85,0.0,6.0,189,'1957-08-10','https://st.kp.yandex.net/images/film_iphone/iphone360_8744.jpg','The Abominable Snowman','Английский ботаник и его американский товарищ организуют экспедицию в Гималайские горы с целью выследить снежного человека. Но мотивы у каждого свои: в то время как англичанином движет научный интерес, американец более заинтересован в коммерческой выгоде, которую может сулить находка легендарного йети.','Нет данных'),(8747,'Александр Великий',1956,141,0.0,6.5,309,'1956-03-22','https://st.kp.yandex.net/images/film/8747.jpg','Alexander the Great','Греция в огне. Большая часть когда-то великих городов повержена в прах. Крохотная горная Македония пока сдерживает удар. Молодой сын царя Александр решает, что пришло время избавить страну от коварных соседей, на протяжении веков приходящих с войной на ее землю.<br><br>Грозная сила обрушивается на врагов, покоряет все новые страны, объединяя народы и расширяя границы империи. Нанося удар за ударом, одерживая сокрушительные победы, гигантская армия Александра Македонского неудержимо катится вперед.<br><br>Все дальше и дальше от родины. Сколько подвигов может совершить человек в одной жизни?','$4 000 000'),(8748,'Конец романа',1955,105,0.0,6.8,64,'1955-02-24','https://st.kp.yandex.net/images/film_iphone/iphone360_8748.jpg','The End of the Affair','Вернувшийся с фронта писатель Морис Бендрикс влюбляется в жену своего друга, и та отвечает ему взаимностью. Однако ревнивый и мнительный Бендрикс не доверяет своей возлюбленной, он страдает и заставляет страдать её…','Нет данных'),(8757,'Человек в железной маске',1939,113,0.0,7.1,93,'1939-06-26','https://st.kp.yandex.net/images/film_iphone/iphone360_8757.jpg','The Man in the Iron Mask','Д`Артаньян и мушкетеры — единственные, кто знает о существовании брата-близнеца, и Фуке использует свое влияние, чтобы заставить всех молчать…','Нет данных'),(8760,'Крошка Доррит',1987,300,0.0,7.1,77,'1987-12-11','https://st.kp.yandex.net/images/film_iphone/iphone360_8760.jpg','Little Dorrit','Экранизация одноименного романа Чарльза Диккенса о семействе банкрота Уильяма Доррита, который 20 лет провел в долговой тюрьме. Его дочь Эми — добрая, отзывчивая девушка, работающая не покладая рук для того, чтобы вызволить отца. Наконец, в один прекрасный момент ей повезло…','Нет данных'),(8761,'Поездка в Индию',1984,164,0.0,6.8,802,'1984-12-14','https://st.kp.yandex.net/images/film_iphone/iphone360_8761.jpg','A Passage to India','Действие этого фильма происходит в двадцатые годы двадцатого века. Столкновение культур Востока и Запада показано на материале нетривиальной поездки молодой своенравной англичанки в Индию.','$16 000 000'),(8763,'Гитлер: Последние десять дней',1973,106,0.0,6.5,157,'1973-04-20','https://st.kp.yandex.net/images/film_iphone/iphone360_8763.jpg','Hitler: The Last Ten Days','Фильм повествует о последних днях жизни Адольфа Гитлера, начиная с 56-ого дня рождения (20 апреля 1945 года) до его самоубийства (30 апреля). Действие картины полностью проходит в бункере.','Нет данных'),(8764,'Брат Солнце, сестра Луна',1972,126,0.0,7.8,536,'1972-03-03','https://st.kp.yandex.net/images/film_iphone/iphone360_8764.jpg','Fratello sole, sorella luna','Рассказ о юности святого Франциска Ассизского, вступившего в конфликт с догматами католической церкви и самим римским папой, а затем основавшего собственное учение — францисканство.','$3 000 000'),(8765,'Скрудж',1970,113,0.0,7.3,164,'1970-11-05','https://st.kp.yandex.net/images/film_iphone/iphone360_8765.jpg','Scrooge','1860 год. Скупой и капризный Эбенезер Скрудж влюблён лишь в своё богатство. Он не разделяет общей радости от приближающегося Рождества. В вечер сочельника Скруджу предстаёт дух его покойного компаньона Джейкоба Марли. Дух Марли сожалеет, что после смерти был наказан за чёрствость и корысть. Он не хочет такой же участи для Скруджа. По его просьбе Скруджа посетят три духа, которые помогут ему измениться. Они будут являться один за другим в течение трёх ночей…','Нет данных'),(8767,'Комедианты',1967,152,0.0,6.8,231,'1967-10-31','https://st.kp.yandex.net/images/film_iphone/iphone360_8767.jpg','The Comedians','О диктаторском режиме на Гаити. В этом мрачном мире беззакония, слежки, убийств и террора правит доктор Дювалье и его специальная полиция под названием «тонтон-макуты». В столицу Гаити Порт-О-Пренс прибывает корабль. Ступившие на землю владелец местного отеля Браун, майор Джонс и пожилые супруги Смит становятся участниками политической драмы.','Нет данных'),(8768,'Меморандум Квиллера',1966,104,0.0,6.7,336,'1966-11-10','https://st.kp.yandex.net/images/film_iphone/iphone360_8768.jpg','The Quiller Memorandum','Берлин, середина 60-х годов. Здесь набирает силу подпольная неонацистская организация. Разведывательный центр, выполняющий особо важные задания по всему миру, должен главных экстремистов найти и обезвредить. Два агента, вплотную к ним подобравшиеся, были убиты. И теперь из Великобритании прибыл новый агент — Квиллер. Его методы работы необычны и крайне опасны для него самого: он намеренно делает так, чтобы противник его быстро вычислил. Квиллера похищают и привозят в логово преступной организации…','Нет данных'),(8769,'Отель Парадизо',1966,98,0.0,6.9,128,'1966-10-14','https://st.kp.yandex.net/images/film_iphone/iphone360_8769.jpg','Hotel Paradiso','По пьесе Мориса Девальере. Бенедикт Бонифас, пока его суровая жена ухаживает за своей больной подругой, решил приударить за соседкой Марселлой Кот, которая несчастлива в браке с архитектором Анри. Бенедикт и Марселла решают провести ночь в отеле Парадизо, пока муж Марселлы исследует архитектурные аномалии. Но оказывается, что объектом исследований Анри является как раз отель Парадизо…','Нет данных'),(8771,'Падение Римской империи',1964,188,0.0,6.9,787,'1964-03-24','https://st.kp.yandex.net/images/film_iphone/iphone360_8771.jpg','The Fall of the Roman Empire','Правлению императора Марка Аврелия приходит конец, умирая, он назначает своим преемником не сына Комадаса, а полководца Гая Ливия, влюбленного в его дочь.<br />Именно из-за этого Комадас все-таки приходит к власти и ситуация в Римской империи резко меняется: рушатся все военные и политические достижения, племена<br />варваров вместе с предводителями бывших имперских провинций нападают на ослабевший Рим.','$19 000 000'),(8772,'Вызывающий проклятье',1962,101,0.0,6.9,101,'1962-02-22','https://st.kp.yandex.net/images/film/8772.jpg','H.M.S. Defiant','Конец XVIII века, во флоте Английского королевства, что находится в состоянии войны с Францией, среди матросов назревает мятеж. Но капитан Кроуффорд не только благородный воин, но и опытный моряк, поэтому его не пугают ни интриги младших офицеров, да и бунт вспыхивает во время и лишь подчеркивает патриотизм команды его фрегата перед лицом опасностей.','Нет данных'),(8773,'Величие одного',1961,156,0.0,5.5,83,'1961-12-27','https://st.kp.yandex.net/images/film_iphone/iphone360_8773.jpg','A Majority of One','Нежная история любви одинокого японского бизнесмена и вдовы из Америки. Но прежде чем наступит счастливый конец, они должны научиться терпению, доброте и прощению.','Нет данных'),(8774,'Мотивы славы',1960,107,0.0,6.5,117,'1960-09-04','https://st.kp.yandex.net/images/film_iphone/iphone360_8774.jpg','Tunes of Glory','Майор Джок Синклер является исполняющим обязанности полковника в Шотландском батальоне, недавно вернувшимся домой после завершения Второй мировой войны. Джок — харизматический лидер, склонный к злоупотреблению виски и закрывающий глаза на устав и правила. Ему на замену присылают полковника Бэрроу, выпускника Оксфорда, героя японской кампании, в последнее время преподававшего в военной академии Сэндхерст. Два противоположных характера моментально сталкиваются.','Нет данных'),(8775,'Наш человек в Гаване',1959,111,0.0,7.3,313,'1959-12-30','https://st.kp.yandex.net/images/film_iphone/iphone360_8775.jpg','Our Man in Havana','Действие происходит на Кубе времён Батисты. Скромный продавец пылесосов Уормолд неожиданно становится резидентом английской разведки. Чтобы как-то оправдать денежное вознаграждение, он начинает выдумывать агентов, якобы им завербованных. К удивлению Уормолда, его фальшивые донесения воспринимаются всерьёз — не только начальством, но и врагами.','Нет данных'),(8776,'Козел отпущения',1959,91,0.0,6.7,123,'1959-08-06','https://st.kp.yandex.net/images/film_iphone/iphone360_8776.jpg','The Scapegoat','Путешествуя по Франции Джон Баррэтт сталкивается с обедневшим французским дворянином, который в точности походит на него. Он опоил двойника, чтобы выдать его за себя, а самому отдохнуть и получить передышку от неурядиц в семье и работе. Проснувшись, Джон-двойник пытается убедить всех с кем сталкивается, что он не тот, о ком они думают, но постепенно все более привязывается к этой семье, включая несчастную жену, властную мать, одинокую но талантливую молодую дочь, несчастную сестру — старую деву и домохозяйку. Джон все больше узнает их, и чувствует, что может помочь им с их проблемами, но он также привыкает и к новому образу чужой жизни, которая впервые дала ему цель.','Нет данных'),(8777,'Из первых рук',1958,97,0.0,7.3,191,'1958-11-11','https://st.kp.yandex.net/images/film_iphone/iphone360_8777.jpg','The Horse\'s Mouth','История художника, чей строптивый, по мнению окружающих, характер, мешает ему принять правила и устои обыденной жизни.','Нет данных'),(8779,'Лебедь',1956,104,0.0,7.6,689,'1956-04-18','https://st.kp.yandex.net/images/film_iphone/iphone360_8779.jpg','The Swan','По одноименной пьесе Ференца Молнара. Принцесса Александра по настоянию своей матери старается понравиться своему дальнему родственнику, кронпринцу Альберту…','Нет данных'),(8782,'Отец Браун',1954,91,0.0,6.7,137,'1954-06-08','https://st.kp.yandex.net/images/film_iphone/iphone360_8782.jpg','Father Brown','История отца Брауна, в рабочее время священника, а на досуге — сыщика. Когда у отца Брауна при перевозке из Лондона в Рим крадут ценный религиозный артефакт, он задается целью не только вернуть похищенное, но и заставить покаяться крупного международного преступника Фламбо.','Нет данных'),(8786,'Ловкач',1952,85,0.0,6.7,67,'1952-02-25','https://st.kp.yandex.net/images/film/8786.jpg','The Card','Молодой, но чрезвычайно амбициозный и проницательный человек владеет тысячей и одним способом — не всегда, к слову, честным — продвижения вверх по карьерной и социальной лестнице. Да вот только он вечно не учитывает один существенный нюанс — он такой не один, и окружающие его хищные бестии не собираются без боя уступать ему дорогу…','Нет данных'),(8787,'Банда с Лавендер Хилл',1951,78,0.0,7.3,828,'1951-06-28','https://st.kp.yandex.net/images/film_iphone/iphone360_8787.jpg','The Lavender Hill Mob','Ограбление века — вот о чём мечтает перевозчик золотых слитков с мягкими манерами, вылитый божий агнец, потаённые мысли которого нездоровы, как у всех бледных поганок… После 20 лет безупречной службы он вдруг решает украсть золота на миллион фунтов стерлингов…','Нет данных'),(8791,'Большие надежды',1946,118,0.0,7.0,1284,'1946-12-16','https://st.kp.yandex.net/images/film_iphone/iphone360_8791.jpg','Great Expectations','В окрестностях Рочестера, старинного городка к юго-востоку от Лондона, жил семилетний мальчик, прозванный Пипом. Он остался без родителей и воспитывала его взбалмошная старшая сестра. Ее мужем был кузнец Джо Гарджери — светловолосый великан, покладистый и простоватый, только он, как мог, защищал Пипа. <br><br>Однажды серая жизнь Пипа изменилась в корне, и началось это в тот день, когда мальчик столкнулся на кладбище с беглым каторжником. Тот под страхом смерти потребовал принести «жратвы и напильник», чтобы освободиться от кандалов. <br><br>Скольких усилий стоило парнишке тайком собрать и передать узелок, но именно этот добрый поступок в последствии привел к целой череде удивительных историй и превращений, которые произошли в его жизни…','£350 000'),(8796,'Преступные связи',1997,102,0.0,7.2,2440,'1997-10-08','https://st.kp.yandex.net/images/film_iphone/iphone360_8796.jpg','Gang Related','Детективы Да Винчи и Родригес, крутые уличные сыщики, под прикрытием полицейских жетонов организовали в городе мощную подпольную сеть наркоторговли. Они действуют просто: находят покупателя, проворачивают с ним сделку, а затем убивают, оставляя себе деньги и товар.<br><br>После этого аферисты ищут новую жертву, списав смерть клиента на бандитские разборки. Дела идут хорошо, пока не выясняется, что один из убитых — агент комитета по борьбе с наркотиками, работавший под прикрытием. Убийц необходимо найти, и детективы рьяно берутся за дело, решив свалить ответственность за свое злодейство на единственного человека в городе, чей секрет еще страшнее, чем их собственный.<br><br>И теперь, когда разоблачительные тиски правды начинают сжиматься, Да Винчи и Родригес должны пойти на самый рискованный и хитроумный обман в своей жизни.','Нет данных'),(8798,'Джефферсон в Париже',1995,144,0.0,6.1,239,'1995-03-31','https://st.kp.yandex.net/images/film/8798.jpg','Jefferson in Paris','Посол Соединенных Штатов Америки во Франции Томас Джефферсон приезжает в Париж накануне Великой французской революции. Высший свет еще живет красивой и роскошной жизнью. На этом фоне и происходит знакомство Джефферсона с людьми и нравами страны, случаются встречи без скуки и морализаторства. Томас обретает и врагов, и друзей, наблюдая за тем, как некогда мощное государство быстро катится к своему закату…','$14 000 000'),(8800,'Человек-метеор',1993,100,0.0,5.6,1749,'1993-08-06','https://st.kp.yandex.net/images/film_iphone/iphone360_8800.jpg','The Meteor Man','Однажды кусок метеорита попадает прямо в грудь Джефферсону Риду, темнокожему парню, который работает школьным учителем. После этого он превращается в настоящего супермена: теперь он умеет летать, обладает сверхъестественной силой…<br><br>Друзья Джефферсона и члены его семьи считают, что он должен использовать свою суперсилу для борьбы с местной бандой «Золотые лорды», терроризирующей их район.','$30 000 000'),(8801,'Соммерсби',1993,114,0.0,7.5,5057,'1993-02-05','https://st.kp.yandex.net/images/film_iphone/iphone360_8801.jpg','Sommersby','После окончания Гражданской войны в США Джек Соммерсби, которого все считали погибшим, возвращается в родной городок. Джек налаживает хозяйство, восстанавливает отношения с женой, однако у неё появляются подозрения: действительно ли этот человек — её муж?','Нет данных'),(8802,'Южане',1991,81,0.0,6.3,86,'1991-07-21','https://st.kp.yandex.net/images/film_iphone/iphone360_8802.jpg','Scorchers','О любви, сексе, страсти и интимных утехах южан из Луизианы. Трагикомическая лента, в которой пытаются найти выход из клубка накопившихся сексуальных и бытовых проблем три женщины, живущие в Луизиане.','Нет данных'),(8803,'Скорая помощь',1990,91,0.0,6.4,428,'1990-03-22','https://st.kp.yandex.net/images/film_iphone/iphone360_8803.jpg','The Ambulance','Молодую девушку прямо на улице забирает машина «Скорой помощи» с диагнозом «диабет». Находившийся рядом молодой человек хочет поехать вместе с ними, но ему отказывают. Когда парень все-таки решает найти понравившуюся ему девушку и приезжает в указанную больницу, девушки там не оказывается. Машины «Скорой помощи» с указанными номерами и такого цвета в больнице просто нет…','Нет данных'),(8805,'Лучшие из лучших',1989,97,0.0,7.3,7657,'1989-11-10','https://st.kp.yandex.net/images/film_iphone/iphone360_8805.jpg','Best of the Best','Пятеро молодых спортсменов должны забыть о своих разногласиях и личных проблемах для того, чтобы единой командой защищать честь национальной сборной США по таэквондо на международных соревнованиях. Под руководством мудрого тренера им это удается, и они демонстрируют свое мастерство.','Нет данных'),(8806,'Три беглеца',1989,96,0.0,6.6,1270,'1989-01-27','https://st.kp.yandex.net/images/film/8806.jpg','Three Fugitives','После пяти лет тюрьмы известный грабитель-рецидивист Лукас решил стать на праведный путь. Но этот путь оказался очень коротким — в первый же день свободы он становится заложником человека, доведенного до такой степени отчаяния, что ему остается только грабить банк. Невероятно? Полиция тоже не может этому поверить. Лукасу снова приходится бежать от полиции, да еще со своим похитителем и его дочерью.','$15 000 000'),(8808,'Аллан Куотермейн и потерянный город золота',1986,99,0.0,5.9,1288,'1986-12-18','https://st.kp.yandex.net/images/film_iphone/iphone360_8808.jpg','Allan Quatermain and the Lost City of Gold','Продолжение фильма «Копи царя Соломона». Герой возвращается в Африку в поисках своего брата, идущего по следам затерянного белого племени.','Нет данных'),(8810,'Свой в доску',1986,104,0.0,6.0,224,'1986-10-24','https://st.kp.yandex.net/images/film_iphone/iphone360_8810.jpg','Soul Man','Узнав о зачислении на юридический факультет Гарварда, Марк вне себя от радости. Но его отец отказывается платить за учебу. А единственная стипендия предназначена для чернокожего студента. Делать нечего, и приняв специальные препараты, Марк превращается в негра.<br><br>В университете Марк влюбляется в красивую темнокожую студентку и крутит роман с Уитни, дочкой домовладельца-расиста, у которого снимает жилье. Но тут к Маркунеожиданно приезжают родители, накрыв «на месте преступления» и Уитни, и Сару, и его самого в виде негра!<br><br>Как выпутаться из этой ситуации, чтобы остаться в университете и не потерять Сару? Тем более, что доставшаяся Марку стипендия предназначалась для нее.','Нет данных'),(8811,'Полёт драконов',1982,96,0.0,8.0,3801,'1982-08-17','https://st.kp.yandex.net/images/film_iphone/iphone360_8811.jpg','The Flight of Dragons','Добрый зеленый волшебник живет со своей прекрасной белокурой дочерью. Естественно, он борется со злом, но в последнее время у него было много неудач. Служат ему летающие драконы и есть у него три брата, один из которых, красный волшебник, олицетворяет зло.<br><br>Зеленый волшебник философски замечает, что добро было бы невозможно без существования зла. Он созывает своих трех братьев, так как обеспокоен тем, что их волшебные силы слабеют, а люди предпочитают надеяться на науку и логику. <br><br>Он предлагает создать последнее волшебное царство, объединив силы, так как мир не должен обходиться без волшебства, необходимого для вдохновения. Но красный волшебник не согласился, он решил использовать силу и страх, восстановить брата против брата.','Нет данных'),(8815,'Последний римейк Красавчика Жеста',1977,81,0.0,6.5,97,'1977-07-15','https://st.kp.yandex.net/images/film_iphone/iphone360_8815.jpg','The Last Remake of Beau Geste','Бесценный сапфир, принадлежавший умирающему аристократу, становится «яблоком раздора» для его жены, дочери и двух приемных сыновей-близнецов. Один из наследников похищает камень и увозит его в Северную Африку, а другие устремляются за ним…','Нет данных'),(8816,'Изгоняющий дьявола II: Еретик',1977,118,0.0,4.1,1749,'1977-06-17','https://st.kp.yandex.net/images/film_iphone/iphone360_8816.jpg','Exorcist II: The Heretic','Странные кошмары преследуют Риган МакНил через четыре года после изгнания злого духа из ее тела, священник-иезуит, посланный Ватиканом и самоотверженный детский психиатр объединяют свои усилия, чтобы раскрыть тайну подсознания Риган.<br><br>Действительно ли Пазузу, демон воздуха, вернулся, чтобы снова вселиться в нее? Африканец, который пережил вселение и изгнание этого демона в детстве, может оказаться ключом к разгадке.','$14 000 000'),(8822,'Большая белая надежда',1970,103,0.0,6.7,116,'1970-10-11','https://st.kp.yandex.net/images/film_iphone/iphone360_8822.jpg','The Great White Hope','Боксер Джек Джефферсон, победив в Неваде Фрэнка Барди, становится первым афроамериканцем, выигравшим титул чемпиона мира в тяжелом весе. Однако, как только Джефферсон вместе со своей белой подругой Элеонор пересекает границу штата, его арестовывают и осуждают за нарушение закона о смешении рас. Приговоренный к трем годам тюрьмы Джек совершает побег и покидает Америку.<br><br>Но, имея неблагонадежную репутацию, он не может найти работу. Неожиданно Джек получает предложение, дающее возможность поправить дела и вернуться в большой спорт: он должен принять участие в боях за звание чемпиона мира и поддаться белому сопернику…','Нет данных'),(8823,'Вирус любви',2001,83,0.0,6.6,4258,'2001-03-09','https://st.kp.yandex.net/images/film_iphone/iphone360_8823.jpg','Get Over It','Выпускной год складывался для Бёрка Ландерса как нельзя лучше. Он встречался с красавицей Элисон, в которую был влюблен с пеленок. Все считали их идеальной парой, и казалось, что это — любовь до гроба. <br><br>Но в один прекрасный день Бёрк получает от ворот поворот, и вот уже Элисон видят в компании самого крутого парня — Страйкера, а ее бывший пребывает в ступоре от отчаяния. Все попытки друзей привести Бёрка в чувство проваливаются одна за одной до тех пор, пока за дело всерьез не берется Келли, младшая сестра его лучшего друга…','$22 000 000'),(8824,'Фаринелли-кастрат',1994,111,0.0,7.4,2972,'1994-12-07','https://st.kp.yandex.net/images/film_iphone/iphone360_8824.jpg','Farinelli','Фильм о легендарном певце 18 века Карло Броски по прозвищу Фаринелли (1705-1782), кастрированном в детстве старшим братом Рикардо, композитором, боявшимся, что с возрастом тот потеряет свой чудный голос. Его искусство покорило самого Генделя, а зрители приходили в экстаз, падали в обморок и называли его «божественным Фаринелли». Трагедия этого сильного, красивого, обаятельного человека, не имеющего возможности обрести полноценного счастья с женщиной, усиливается еще более, когда он узнает, что его увечье было не следствием несчастного случая, а осознанного поступка брата.<br /><br />Они делили женщин — Карло начинал, доводя их до оргазма, а Рикардо «закладывал семя», что позволило певцу опять-таки не до конца, но все же познать радость отцовства, соединив жизнь с любимой женщиной, когда он уже отказался от выступлений и пел только для испанского короля Филиппа V.','Нет данных'),(8825,'Энни',1982,127,0.0,6.5,245,'1982-05-17','https://st.kp.yandex.net/images/film_iphone/iphone360_8825.jpg','Annie','Далёкие 1930-е. Огненно-рыжая сиротка Энни вынуждена жить в ужасном сиротском приюте, которым управляет властная Агата Хэнниган. Однажды её кажущееся безвыходным положение резко меняется, когда она получила возможность провести некоторое время в особняке богатого военного промышленника Оливера Уорбукса. Энни моментально очаровывает всех обитателей имения и даже на первый взгляд толстокожий папаша Уорбукс не может не полюбить такую чудесную девчушку. Уорбукс решает найти родителей Энни и предлагает вознаграждение, если те найдутся и предъявят доказательства, что не являются мошенниками. Мисс Хэнниган, её злобный брат Рустер и сообщница планируют представиться родителями Энни и забрать вознаграждение. Над маленькой сироткой надвигается угроза большой опасности.','$50 000 000'),(8826,'Отчаянный',1995,104,0.0,7.7,53129,'1995-08-25','https://st.kp.yandex.net/images/film_iphone/iphone360_8826.jpg','Desperado','Он — бесстрашный герой, ведущий охоту на короля преступного мира. Но — исполнить приговор невозможно. Но — вновь на карту поставлена жизнь любимой, и начинается жестокое противостояние одиночки и армии вооруженных до зубов головорезов.','$7 000 000'),(8827,'Легенды осени',1994,133,0.0,8.0,64204,'1994-12-23','https://st.kp.yandex.net/images/film_iphone/iphone360_8827.jpg','Legends of the Fall','«Некоторые люди очень ясно слышат свой внутренний голос и живут так, как он им подсказывает. Такие люди сходят с ума. Или становятся легендами». Так начинается история семьи Ладлоу — стремительный и романтический рассказ о трёх братьях, их отце и молодой и неотразимой женщине, которая роковым образом изменяет жизнь каждого из них.','$30 000 000'),(8829,'Отродье',2001,91,0.0,5.1,236,'2001-07-19','https://st.kp.yandex.net/images/film_iphone/iphone360_8829.jpg','The Breed','В будущем вампиры откроются человечеству. Для миллионов людей это будет страшное открытие, грозящее гибелью всей человеческой расе. Двое полицейских оказываются последним рубежом обороны, при падении которого мир между цивилизацией и кровавым племенем будет разрушен.<br><br>Их дуэт тем более необычен, что один из охотников за вампирами — сам вампир и прекрасно разбирается в психологии своих сородичей. Тайный заговор упырей вот-вот начнет воплощаться в реальность. Час решающей битвы настал.','$4 000 000'),(8831,'Гори все огнем',1997,100,0.0,6.3,138,'1997-07-11','https://st.kp.yandex.net/images/film_iphone/iphone360_8831.jpg','This World, Then the Fireworks','Красавчик Марти и его сестра, сногсшибательная Кэрол — плохие дети своих родителей. Марти — законченный преступник, которого ищет чикагская полиция. В поиске легких денег он намечает очередную жертву — доверчивую и страстную Лоис Арчер. Но преступная игра оборачивается чередой убийств…','Нет данных'),(8832,'Охота на носорога',1997,115,0.0,6.6,173,'1997-01-19','https://st.kp.yandex.net/images/film_iphone/iphone360_8832.jpg','Rhinoceros Hunting in Budapest','Молодой американец хочет осуществить заветную мечту: поохотиться на носорога в Африке. Но сначала должен разыскать свою девушку, исчезнувшую в Париже. Он начинает поиски и словно попадает в мир абсурда. Как раз на полпути между раем и адом…','Нет данных'),(8833,'Шутки в сторону',1995,128,0.0,6.5,137,'1995-03-24','https://st.kp.yandex.net/images/film_iphone/iphone360_8833.jpg','Funny Bones','Комедия — самый хрупкий цветок индустрии развлечений, подверженный малейшим дуновениям. Томми Фоукс знает это лучше других, иначе он не оказался бы на сцене в Лас-Вегасе. Но сумеет ли он рассмешить этот зал, в котором к тому же сидит его собственный отец, всемирно известный комик? Томми знает, что для этого ему придется умереть. Умереть по-настоящему.','Нет данных'),(8834,'Бесконечная история 3',1994,95,0.0,4.2,976,'1994-10-27','https://st.kp.yandex.net/images/film_iphone/iphone360_8834.jpg','Die unendliche Geschichte III: Rettung aus Phantasien','Слип, главарь группы школьных задир, издевающихся над Бастианом (главным героем фильма), крадёт из школьной библиотеки волшебную книгу «Бесконечная история». Посредством книги он обретает власть над страной Фантазией. В итоге Фантазия превращается в царство злых фантазий испорченного мальчишки.<br><br>Повелительница Фантазии просит Бастиана отобрать у Слипа книгу. На помощь Бастиану из чудесного мира Фантазии в реальный мир посылаются несколько сказочных существ.','$17 000 000'),(8836,'Принцесса и гоблин',1991,82,0.0,7.8,546,'1991-12-20','https://st.kp.yandex.net/images/film_iphone/iphone360_8836.jpg','The Princess and the Goblin','Король отправился в поход, оставив свою дочь принцессу Айрин на попечение старой няни Лютти, любившей поспать. Принцесса и ее кот по кличке Репка углубились в лес и потерялись, испугавшись черных когтистых лап, пытавшихся поймать их. А в лесу жили страшные гоблины, и неизвестно, чем бы закончились волшебные приключения Айрин, если бы не мальчик Керти, который научил ее петь, чтобы отпугивать гоблинов.','Нет данных'),(8838,'Дьявол песков',1992,87,0.0,5.9,500,'1992-05-10','https://st.kp.yandex.net/images/film_iphone/iphone360_8838.jpg','Dust Devil','Древний демон, заключенный в оболочку из человеческой плоти, бродит по пустыне и совершает ритуальные убийства тех, кто решил самостоятельно расстаться с жизнью. Очередной его жертвой должна быть сбежавшая от мужа женщина. Та легко становится любовницей демона, но стать его жертвенным ягненком не согласна.','£4 300 000'),(8839,'Там, где течет река',1992,123,0.0,7.3,5102,'1992-09-13','https://st.kp.yandex.net/images/film_iphone/iphone360_8839.jpg','A River Runs Through It','Отец двух братьев, живущих в величественных горах Монтаны накануне Первой мировой войны, воспитывал обоих сыновей в духе библейских заповедей. Но братья выросли совсем непохожими друг на друга.<br><br>Старший Норман мечтает увидеть мир и стать профессором литературы. Младший Пол предпочитает ходить по барам, играть в карты и готов всю жизнь провести в родной Монтане. <br><br>Единственное, что объединяет братьев — страсть к рыбной ловле «на мушку». По иронии судьбы, в этом деле ветреный Пол намного превосходит своего серьезного старшего брата…','Нет данных'),(8841,'Железо',1990,91,0.0,5.8,1386,'1990-09-14','https://st.kp.yandex.net/images/film_iphone/iphone360_8841.jpg','Hardware','Постапокалиптическое будущее. Мо выкупает у Сталкера скелетообразную голову робота, и решает подарить ее своей девушке Джилл. Джилл — скульптор, и такая фигура как раз пригодится ей в работе.<br><br>Однако они даже понятия не имели с чем связались — голова робота, оказалась частью убийственного боевого андроида «МАРК 13», обладающего отличным искуственным интеллектом. И вот, робот ожил и начал постепенно собирать самого себя из близ лежащего металлолома. Вскоре оказывается так, что Джилл остается в своей квартире один на один с этой Железякой…','$1 500 000'),(8842,'Американская готика',1987,89,0.0,6.3,863,'1987-08-17','https://st.kp.yandex.net/images/film_iphone/iphone360_8842.jpg','American Gothic','Шестеро друзей отправляются в путешествие на уик-энд. У аэроплана начинаются проблемы с мотором, и они вынуждены сделать посадку на берегу отдаленного острова. Пока Джефф пытается починить мотор, другие разбивают неподалеку лагерь. Вскоре Джефф говорит, что не может устранить неполадки. Он предлагает, чтобы ребята обследовали остров. Путешественники оставляют Пола присматривать за самолетом, а сами отправляются на поиски кого-нибудь, кто смог бы им помочь. Они находят маленький домик, в котором никого нет, хотя вся обстановка указывает на то, что в нем кто-то живет. <br><br>Подростки устраивают танцы, но тут приходят обитатели дома: двое пожилых людей. Они выглядят очень миролюбиво, а мужчина говорит, что через несколько дней на лодке должен приехать их друг, который поможет им. Хозяева дома приглашают ребят остановиться у них, на что те с благодарностью соглашаются. Но современное поведение молодежи вскоре начинает контрастировать с традиционными ценностями пожилых людей…','Нет данных'),(8843,'Медовый месяц с призраками',1986,82,0.0,5.7,242,'1986-07-25','https://st.kp.yandex.net/images/film_iphone/iphone360_8843.jpg','Haunted Honeymoon','Ведущий актер радиотеатра Лари Эббот страдает одним недостатком — он ужасно боится грома и молнии, и это мешает ему нормально выступать в спектаклях ужаса. Один его дядя решил вылечить племянника по странной методике: избавить Лари от страха, как следует напугав его. Поскольку Лари собирался жениться, то его с невестой Вики Пирл пригласили на церемонию бракосочетания в родовой замок Эбботов. На свадьбу съехались все представители семейства со своими женами. С самого начала пребывания в замке Лари погружается в атмосферу таинственности и страха, которую умело создал дядя с помощью невесты Лари. Экстравагантные родственники, среди которых находится знаменитый фокусник, по мере сил помогают дурачить Лари. Однако в этой весёлой семейке оказывается и настоящий преступник.','Нет данных'),(8844,'Вода',1985,97,0.0,6.1,138,'1985-01-11','https://st.kp.yandex.net/images/film_iphone/iphone360_8844.jpg','Water','Открытие источника ценной минеральной воды в заброшенной нефтяной скважине, расположенной на Карибских островах, приводит к целой веренице неожиданных ситуаций. Часть доходов пытаются прибрать к рукам нефтяные магнаты из США и лидеры местных революционных повстанцев.','Нет данных'),(8845,'Белые ночи',1985,136,0.0,7.1,1057,'1985-11-22','https://st.kp.yandex.net/images/film_iphone/iphone360_8845.jpg','White Nights','Советский танцовщик Николай Родченко бежит на Запад, надеясь обрести там свободу. Но однажды случается так, что самолет, в котором танцовщик летел над территорией СССР, сажают на военный аэродром, и Николай вновь попадает «домой».<br><br>Его начинают усиленно обрабатывать, чтобы он «добровольно» остался на социалистической родине. Николай совершает новую отчаянную попытку побега.','Нет данных'),(8846,'Нетерпение чувств',1980,129,0.0,7.0,1084,'1980-04-12','https://st.kp.yandex.net/images/film_iphone/iphone360_8846.jpg','Bad Timing','Вена. Американку Милену Флаэрти привозят в городскую клинику с подозрением на попытку самоубийства. Инспектору Нетусилу поручено расследовать это дело.<br><br>Он допрашивает любовника Милены, профессора психологии Алекса Линдена. Алекс вспоминает историю своих взаимоотношений с Миленой. Где и при каких обстоятельствах безумная страсть могла перерасти в не менее безудержную ненависть?','Нет данных'),(8848,'Леди исчезает',1979,97,0.0,6.3,149,'1979-10-01','https://st.kp.yandex.net/images/film_iphone/iphone360_8848.jpg','The Lady Vanishes','В поезде-экспрессе, едущем по довоенной Германии, случается странное: молодая девушка, американская наследница Аманда Келли оказывает небольшую помощь старушке, мисс Фрой. Но спустя некоторое время мисс Фрой исчезает, как будто ее и вовсе не было, а попутчики все как один отрицают, что когда-либо видели ее.','Нет данных'),(8849,'Валентино',1977,128,0.0,6.8,478,'1977-09-07','https://st.kp.yandex.net/images/film_iphone/iphone360_8849.jpg','Valentino','Рудольф Валентино — актер немого кино, «звездная» карьера которого длилась всего шесть лет. Он приехал в Америку в 1913 году и начинал садовником, работал посудомойщиком, официантом, жиголо и был мелким преступником до того, как начал танцевать на балах за деньги. Знакомство с Аллой Назимовой стало первым шагом на пути Валентино к желаемой славе…','$5 000 000'),(8850,'Интенсивная терапия',1997,107,0.0,6.3,254,'1997-10-06','https://st.kp.yandex.net/images/film_iphone/iphone360_8850.jpg','Critical Care','Герой фильма молодой и обаятельный реаниматор Вернер Эрнст. Его работа в отделении интенсивной терапии сводится к поддержанию жизни безнадежных коматозников и паралитиков, которым не светит возвращение к нормальному существованию. Однажды в отделение Эрнста в бессознательном состоянии поступает очень богатый старик.<br><br>Его огромное наследство после смерти перейдет к одной из двух дочерей. Младшая, сексапильная Фелиция, решает ускорить событияи, соблазнив Эрнста, пытается вынудить его ускорить смерть отца. Вернер оказывается вовлеченным в рискованную и порочную игру, где на кону находятся человеческая жизнь и десять миллионов долларов.','$12 000 000'),(8851,'Ракетчик',1991,108,0.0,6.7,3486,'1991-06-19','https://st.kp.yandex.net/images/film_iphone/iphone360_8851.jpg','The Rocketeer','Америка тридцатых годов, золотое время! Гангстеры, нацистские шпионы и допотопные аэропланы, заполнившие небо. Молодой пилот Клифф Сэкорд находит сверхсекретное устройство — ракетный ранец, позволяющий подниматься в воздух. Вскоре в газетах появляются сообщения о таинственном человеке, парящем в небе словно ракета.<br><br>Журналисты дают ему громкое прозвище «Ракетчик». По его следу пускаются буквально все: репортеры, агенты ФБР и нацисты, больше других заинтересованные в совершенном оружии. В облаках снова мелькнула стремительная тень. Мертвая петля вокруг его шеи затягивается все туже.','$35 000 000'),(8853,'Видеодром',1982,84,0.0,7.0,10880,'1983-02-04','https://st.kp.yandex.net/images/film_iphone/iphone360_8853.jpg','Videodrome','Телевизионный продюсер Макс Ренн, разыскивая свежее и оригинальное порно для своего кабельного канала, случайно натыкается на «Видеодром» — ведущуюся из ниоткуда передачу про секс и убийства, многократный просмотр которой разлагает не только психику, но и плоть человека.','$5 952 000'),(8854,'Американский оборотень в Лондоне',1981,97,0.0,6.9,7362,'1981-08-21','https://st.kp.yandex.net/images/film_iphone/iphone360_8854.jpg','An American Werewolf in London','Двух беззаботных американских туристов предупреждали, что имеются в старушке-Англии лихие места, путешествовать по которым чрезвычайно опасно. Но весёлые заокеанские парни не вняли предостережениям местных жителей и в глухой ночи, освещённой мертвенным лунным светом, сошли с дороги. Во мраке их ждал неописуемый кошмар, после которого одному из друзей было суждено стать призраком, а другому — кровожадным оборотнем.','$10 000 000'),(8855,'Смертельная забава',1981,91,0.0,5.5,470,'1981-03-13','https://st.kp.yandex.net/images/film/8855.jpg','The Funhouse','Четверо подростков и один маленький мальчик Джои решают провести ночь в карнавальном поезде — призраке на ярмарке. Они даже не подозревали, что обезображенный сын оператора карусели впал в ярость из — за отказа гадалки вернуть ему деньги и убил ее. Подростки стали невольными свидетелями убийства и вскоре с ужасом поняли, что жить им осталось совсем немного…','Нет данных'),(8856,'Оно живо снова',1978,91,0.0,4.7,161,'1978-05-10','https://st.kp.yandex.net/images/film_iphone/iphone360_8856.jpg','It Lives Again','Женатой паре перед родами необычного ребёнка делают предложение о том, что-бы помочь им уберечь дитя от мерзких лап правительства, желающего любой ценой уничтожить его. Они соглашаются и ребенок оказывается у подпольных эскулапов, где в подвале живут еще два таких ребенка. Доктора считают, что их нельзя убивать, ведь те являются будущим человечества, видоизменившегося в связи с неблагоприятными изменениями в атмосфере. Но дети вскоре сбегают и снова начинается кровавая вакханалия…','Нет данных'),(8857,'Черви',1976,93,0.0,5.0,203,'1976-07-30','https://st.kp.yandex.net/images/film_iphone/iphone360_8857.jpg','Squirm','После сильного шторма в одну из ненастных южных ночей небольшой провинциальный городок Флай-Крик лишился электричества из-за повреждения высоковольтной линии. Кабель с линии, продолжал подавать энергию, только не в дома мирных сельских жителей, а прямиком в почву, кишащую дождевыми червями. От столь серьезного «электрошока» червяки из безобидных существ превратились в опасных монстров, жаждущих человеческой крови, которая вскоре, и пролилась…','$470 000'),(8858,'Кинг-Конг',1976,134,0.0,7.1,9021,'1976-09-08','https://st.kp.yandex.net/images/film_iphone/iphone360_8858.jpg','King Kong','Нефтеразведочная экспедиция компании «Petrox», к которой хитростью присоединился палеонтолог и защитник природы Джек Прескотт, отправляется на малоизученный тихоокеанский остров. По пути экспедиция спасает потерпевшую кораблекрушение голливудскую звезду Дуэн. На острове нефтяники сталкиваются с гигантской гориллой, которую местные жители называют Конг. Обезьяна похищает Дуан, но Прескотту удается её освободить. Руководитель экспедиции решает, что раз уж нефти на острове найти не удалось, то можно вывезти с него хотя бы обезьяну и заработать, показывая её нью-йоркской публике. Однако во время первого же представления Конг освобождается и начинает крушить все на своём пути…','$24 000 000'),(8860,'Оно живо',1974,91,0.0,5.3,452,'1974-09-28','https://st.kp.yandex.net/images/film_iphone/iphone360_8860.jpg','It\'s Alive','Во время родов жены, счастливый отец ожидал в приемной, но вместо сияющего врача с ребёнком на руках он увидел, как из двери родильной палаты вывалился доктор в окровавленном халате и упал без дыхания. Когда Френк и несколько врачей вбежали в палату, то их взору предстало кошмарное зрелище — вся комната была усеяна трупами эскулапов, и лишь роженица в истерике кричала про исчезнувшее дитя.','Нет данных'),(8865,'Макс, моя любовь',1986,98,0.0,6.3,336,'1986-05-13','https://st.kp.yandex.net/images/film_iphone/iphone360_8865.jpg','Max mon amour','Питер, английский дипломат в Париже, подозревает свою жену Маргарет в измене и нанимает частного детектива. От него он узнает, что жена снимает квартиру, в которой с кем-то встречается. Улучив момент, Питер врывается в квартиру и застает Маргарет в постели с шимпанзе по имени Макс.','Нет данных'),(8866,'Кокон',1985,117,0.0,7.2,7779,'1985-06-21','https://st.kp.yandex.net/images/film_iphone/iphone360_8866.jpg','Cocoon','Обитатели дома престарелых обнаруживают, что если искупаться в близлежащем бассейне, начинаешь чувствовать себя совсем молодцом. Но вдруг выясняется, что на дне бассейна хранится чудодейственный кокон, поднятый из глубин океана и принадлежащий инопланетянам, когда-то навестившим Землю, а теперь вернувшимся.<br><br>Старички резко возжелали омолодиться и пустились в увлекательную, но небезопасную авантюру, которая сопряжена с шумом и множеством нарушений.','Нет данных'),(8867,'Флэш Гордон',1974,78,0.0,4.9,169,'1974-07-30','https://st.kp.yandex.net/images/film_iphone/iphone360_8867.jpg','Flesh Gordon','Земля в недалеком будущем подверглась атаке неизвестных сексуальных лучей из далекого космоса. Флэш Гордон вместе со своей подругой и доктором Флэкси Джеркоффом отправляются в путешествие на планету Порно, чтобы спасти Землю от козней злого и сексуально озабоченного императора Ванга.','Нет данных'),(8869,'Человек-осьминог',1971,79,0.0,3.4,74,'1971-11-03','https://st.kp.yandex.net/images/film_iphone/iphone360_8869.jpg','Octaman','В небольшом провинциальном мексиканском городке в очистительные сооружения случайно попадают ядохимикаты местной атомной станции. Питьевая вода во всем городе оказывается зараженной. Вскоре двое молодых людей, ученый-эколог Рик Торрес и его подруга Сюзан, случайно обнаруживают в пруду мутировавшего осьминога. Они приносят его в свою лабораторию, чтобы начать изучать. Но осьминог вскоре превращается в настоящего монстра, начинает наводить панику на город и убивать его жителей. Начальство доктора Торреса не верит в рассказы ученого, поэтому тому приходится обратиться за помощью к владельцу местного карнавала. Но тому приходит в голову безумная мысль: поймать человека-осьминога и показывать в своем шоу','Нет данных'),(8871,'Пища Богов',1976,88,0.0,4.3,208,'1976-06-18','https://st.kp.yandex.net/images/film_iphone/iphone360_8871.jpg','The Food of the Gods','Футболист Морган вместе со своими друзьями отправляется на охоту на небольшой остров близ Канады. Неожиданно на них нападают гигантские осы, которые кусают их. Морган отправляется на поиски телефона, но в крестьянском амбаре его едва не убивает огромный цыплёнок. Владелица фермы миссис Скиннер отказывается предоставить Моргану возможность позвонить. Морган решает покинуть остров…','Нет данных'),(8872,'Живи и дай умереть',1973,121,0.0,6.9,8696,'1973-06-27','https://st.kp.yandex.net/images/film_iphone/iphone360_8872.jpg','Live and Let Die','Торговля наркотиками в США принимает угрожающие масштабы. Подрывается генофонд нации, от былой экономической мощи не остается и следа. Виной всему является таинственный наркобарон, король преступного мира Док. Кананга. <br><br>Остановить злодея берется суперагент Джеймс Бонд. Для него нет ничего невозможного, ведь он экипирован новейшими разработками шпионской мысли, а умело используя свои таланты в обращении с женским полом, он с легкостью получает любую интересующую его информацию. Но как известно, мафия не прощает обид и теперь жизнь самого удачливого агента оказывается под угрозой.','$7 000 000'),(8873,'Чёрный цезарь',1973,87,0.0,6.9,192,'1973-02-07','https://st.kp.yandex.net/images/film_iphone/iphone360_8873.jpg','Black Caesar','Гарлем. 1960-е годы. Молодой и предприимчивый темнокожий бандит Томми Гиббс, преследуемый воспоминаниями о не очень-то легком детстве, протаптывает себе дорогу в мафиозные верхушки Нью-Йорка. Естественно, дорога та не цветами была устлана, а трупами итальянского клана, место которого и занял Томми. Завладев бухгалтерскими книгами, содержащими тонны компромата, он сделал себя практически неприкосновенным. Однако спрос на эти книги тем временем всё возрастает…','Нет данных'),(8875,'Нечто с двумя головами',1972,91,0.0,5.4,105,'1972-07-19','https://st.kp.yandex.net/images/film_iphone/iphone360_8875.jpg','The Thing with Two Heads','Доктор Максвелл Киршнер находится при смерти, но упорно пытается сопротивляться, ставя на себе самые разнообразные эксперименты. В конце концов, когда доктор Киршнер понимает, что пришел его смертный час, он приказывает своим помощникам пересадить его голову в новое молодое тело.<br /><br />Обрадованные возможностью отомстить своему тщеславному, жестокому и расистски настроенному начальнику, врачи пересаживают его голову негру Джеку Моссу. Доктор Киршнер приходит в себя и обнаруживает свою белую голову на чернокожем теле. Теперь две головы должны вести между собой борьбу за то, кто будет контролировать поведение тела…','Нет данных'),(8876,'В ночи',1985,115,0.0,6.5,1176,'1985-02-22','https://st.kp.yandex.net/images/film_iphone/iphone360_8876.jpg','Into the Night','Жизнь Эда Оркина скучна и уныла: его мучает бессонница, нудная работа не доставляет никакого удовольствия, жена постоянно обманывает. Но однажды ночью все меняется. Встреча в аэропорту Лос-Анджелеса с красавицей Дайаной, которая буквально сваливается на капот его автомобиля, становится роковой. Вместе с загадочной блондинкой Эд, сам того не желая, попадает в самый центр международного заговора…','Нет данных'),(8878,'Победитель дракона',1981,109,0.0,6.2,303,'1981-06-26','https://st.kp.yandex.net/images/film_iphone/iphone360_8878.jpg','Dragonslayer','Безжалостный дракон регулярно пожирает девушек королевства, выбираемых по жребию. Юный белокурый ученик волшебника отважно бросает вызов дракону ради своей возлюбленной и других красавиц, которые могут стать жертвой монстра.','$18 000 000'),(8880,'Космическая одиссея 2010',1984,116,0.0,6.9,5938,'1984-12-07','https://st.kp.yandex.net/images/film_iphone/iphone360_8880.jpg','2010','Действие происходит спустя девять лет после событий предыдущей картины. Космический корабль «Алексей Леонов» с советско-американским экипажем на борту отправляется на Юпитер, чтобы разгадать тайну оставленного на орбите корабля-первопроходца «Дискавери».<br><br>Для этого командиру и членам звездного экипажа предстоит вновь активировать выведенный из строя компьютерный мозг HAL-9000, который явился одной из причин провала первой экспедиции.','$28 000 000'),(8881,'Лазерный взрыв',1978,85,0.0,2.9,154,'1978-03-01','https://st.kp.yandex.net/images/film_iphone/iphone360_8881.jpg','Laserblast','Опасное оружие попало в руки отчаянного парня Билли Дункана. Сверхмощная «лазерная пушка» — доказательство технического совершенства инопланетной цивилизации.<br><br>Теперь он чувствует себя настоящим мужчиной: в его силах уничтожить любого врага. Но сможет ли Билли справиться со специальным агентом ФБР и парой инопланетян?','Нет данных'),(8884,'Отверженный',1986,117,0.0,5.8,155,'1986-11-13','https://st.kp.yandex.net/images/film_iphone/iphone360_8884.jpg','Castaway','Лондон, холодно, дождь, сыро и противно. Что еще сделать девушке, как не ответить на письмо в газете от мужчины, ищущего жену пожить год на тропическом острове?','Нет данных'),(8885,'Линк',1986,103,0.0,6.6,289,'1986-03-05','https://st.kp.yandex.net/images/film_iphone/iphone360_8885.jpg','Link','Профессор Стивен Филипп пытается найти недостающее звено в цепи эволюции человечества. Он нанимает свою студентку Джейн для работы по хозяйству в своем загородном доме, где он проводит эксперименты над тремя шимпанзе. Когда Джейн прибывает в дом, она видит орангутанга по кличке Линк. Однажды профессор уезжает в город договориться о продаже Вуду, самки шимпанзе. Но вскоре Джейн находит в доме мертвое тело Вуду. После этого погибает человек, пришедший за Линком. А профессор Филипп таинственным образом исчезает…','Нет данных'),(8890,'Жар тела',1981,113,0.0,7.1,2996,'1981-08-28','https://st.kp.yandex.net/images/film_iphone/iphone360_8890.jpg','Body Heat','Скромный адвокат из Флориды, Нед Расин, вел тихую размеренную жизнь, пока не повстречал прекрасную незнакомку в белом — «роковую» блондинку Мэтти Уолкер, замужем за богатым и преуспевающим бизнесменом.<br><br>Нед понимает, что перед ним женщина, за которую можно убить. Именно так он и поступает, когда его возлюбленная предлагает ему убить ее мужа в обмен на любовь и состояние.<br><br>Но все далеко не так просто, как кажется на первый взгляд…','Нет данных'),(8895,'Электронный лабиринт THX 1138 4EB',1967,15,0.0,5.6,356,'1970-06-11','https://st.kp.yandex.net/images/film_iphone/iphone360_8895.jpg','Electronic Labyrinth THX 1138 4EB','Будущее. Люди не имеют имён, лишь порядковые номера. Под наблюдением сотен камер человек с именем THX-1138:4EB пытается убежать из этой системы. Ему нужно пробежать лабиринт коридоров…','Нет данных'),(8897,'Фрейхейт',1966,3,0.0,4.8,182,'2000-09-11','https://st.kp.yandex.net/images/film/8897.jpg','Freiheit','Студент ГДР решается на побег из соцлагеря.','Нет данных'),(8900,'Почему человек творит?',1968,29,0.0,5.8,84,'1982-01-29','https://st.kp.yandex.net/images/film/8900.jpg','Why Man Creates','Действие фильма начинается с охоты первых людей. Сначала они используют камни, но безуспешно, и учатся изготавливать копья и приманивать добычу. После удачной охоты появляется наскальная живопись, а затем начинается и постройка первых домов. В остальной части фильма показано дальнейшее развитие человечества.','Нет данных'),(8901,'Гран при',1966,176,0.0,8.0,2164,'1966-12-21','https://st.kp.yandex.net/images/film_iphone/iphone360_8901.jpg','Grand Prix','Личная жизнь и любовь четверых профессиональных автогонщиков, сыгранных Монтаном, Гарнером, Сабато и Бедфордом, перемежаются впечатляюще снятыми автогонками. Герои картины, рискуя жизнью, сражаются за победу в ряде важных европейских соревнований серии «Формула 1», включая Гран При Монако в Монте Карло.','$9 000 000'),(8903,'Дай мне кров',1970,91,0.0,7.6,419,'1970-12-06','https://st.kp.yandex.net/images/film_iphone/iphone360_8903.jpg','Gimme Shelter','Душераздирающий документальный фильм о гастролях Rolling Stones в 1969 году, сосредоточенный по большей части на трагическом концерте в Олтамонте.','Нет данных'),(8905,'Два брата',2004,109,0.0,8.0,6474,'2004-04-07','https://st.kp.yandex.net/images/film_iphone/iphone360_8905.jpg','Deux frères','История двух тигрят, которые были разлучены людьми и по прошествии многих лет превращены в бойцовых тигров, которых приучили сражаться и убивать. Однажды жестокий владелец сводит их вместе на арене…','€59 660 000'),(8906,'Пока не разбудят нас голоса живых',2002,101,0.0,7.1,1174,'2002-09-10','https://st.kp.yandex.net/images/film/8906.jpg','Till Human Voices Wake Us','Во время поездки по Австралии психоаналитик Сэм Фрэнкс спасает очаровательную девушку, бросившуюся с моста в реку. Придя в себя, она не может вспомнить, кто она и что с ней случилось, но Сэм считает, что тайна ее личности кроется в его трагическом прошлом. Он уверен, что спасенная им незнакомка — подруга его детства, пропавшая без вести при весьма странных обстоятельствах.','Нет данных'),(8907,'Людоед',1999,101,0.0,7.1,9871,'1999-03-16','https://st.kp.yandex.net/images/film_iphone/iphone360_8907.jpg','Ravenous','Действие фильма происходит в 1847 году, в период войны Америки с Мексикой. Капитана Джона Бойда чествуют и награждают различными медалями, однако он не рад этим обстоятельствам. Причиной его чествования стал захват ставки противника в одиночку, но только он один знает все обстоятельства столь смелого поступка — он просто струсил, бросил оружие и притворился мёртвым. Так он пролежал длительное время среди мёртвых товарищей, а впоследствии в состоянии аффекта поубивал всех неприятелей. Однако продвижения по службе Джон не получил, вместо этого его направляют в одинокий форт в горах Калифорнии. <br><br>Через некоторое время в форт приходит оборванный и изголодавшийся мужчина по имени Калхун. Из его истории становится ясно, что он был членом каравана, который вёл проводник. Проводник заблудился и люди, в связи с наступившей зимой, поселились в пещере. Однако запасов еды было мало и в тот момент, когда они кончились люди начали поедать друг друга. Калхуну удалось бежать.','$12 000 000'),(8908,'Жизнь по наклонной',1999,109,0.0,6.8,214,'1999-01-22','https://st.kp.yandex.net/images/film_iphone/iphone360_8908.jpg','A Slipping-Down Life','Услышав по радио выступление популярного автора и исполнителя песен Кейси Драмстрингса, застенчивая и робкая Эви Декер влюбляется в него. Решив познакомиться с ним, молодая девушка начинает посещать местный ночной клуб, где певец часто дает концерты…','Нет данных'),(8909,'Битва за новый мир',1998,102,0.0,3.6,69,'1998-10-09','https://st.kp.yandex.net/images/film_iphone/iphone360_8909.jpg','Woundings','На маленьком острове Британский военный контингент поддерживает хрупкое перемирие между враждующими сторонами. В помощь утомленным, измученным войной солдатам новое правительство призывает женщин, чтобы сохранить мир и создать мирную колонию.','Нет данных'),(8911,'Их поменяли телами',1996,97,0.0,6.9,2515,'1996-09-19','https://st.kp.yandex.net/images/film_iphone/iphone360_8911.jpg','Dating the Enemy','В день Святого Валентина знакомятся двое совершенно разных людей. Бретт — ведущий популярного шоу в стиле MTV. Тэш — журналистка, пишущая о серьезных научных проблемах. Он забавен. Она умна. Он легкомыслен. Она задумчива. Между ними нет ничего общего. Но они полюбили друг друга.<br><br>Спустя два года они на грани разрыва. Слава ударила ему в голову. Она хочет, чтобы он ушел с работы. Он хочет оставить все как есть. Тогда она пожелала, чтобы он побывал в ее шкуре.<br><br>И на утро это случилось. Он оказался в ее теле, она в его. Она стала знаменитой и богатой, девушки умоляют ее о встрече. Она получила его лицо, его работу, его квартиру, его любимую кожаную куртку — и его жизнь. Он хочет вернуть все обратно.','Нет данных'),(8915,'Любой ценой',2000,94,0.0,6.1,1974,'2000-03-24','https://st.kp.yandex.net/images/film_iphone/iphone360_8915.jpg','Whatever It Takes','До выпускного вечера осталось несколько недель, а Райан ни на шаг не приблизился к своей заветной мечте — неотразимой и соблазнительной Эшли. Без помощи неудачливому Ловеласу явно не обойтись, и Райан объединяется с Крисом, который влюблен в его прекрасную соседку.<br><br> Друзья пускаются в невероятную авантюру, разыгрывая всех вокруг. Но когда слишком тщательно расставляешь сети, чтобы поймать птицу удачи, можно случайно запутаться самому.','$32 000 000'),(8916,'Симпатико',1999,106,0.0,5.6,252,'1999-09-15','https://st.kp.yandex.net/images/film_iphone/iphone360_8916.jpg','Simpatico','Что общего у мильтимиллионера Лайла Картера, владельца большого конезавода, его жены Рози и спившегося неудачника Винни Вебба? Эта троица на всю жизнь связана криминальным прошлым.<br><br>Двадцать лет назад они задумали и провернули сложное мошенничество вокруг лошадиных скачек. Тогда им все удалось на славу: они заработали кучу денег. И вот теперь Винни решил покаяться в прошлых грехах.<br><br>Узнав об этом, Картер по первому звонку бывшего друга бросает все и мчится к старому приятелю. Удастся ли ему остановить Вебба сохранить свою репутацию, богатство и жену Рози, а также выгодно продать своего лучшего жеребца Симпатико или же грехи двадцатилетней давности разрушат их кажущееся счастье и благополучие?..','$10 000 000'),(8918,'Генозавр',1996,105,0.0,4.8,1412,'1996-11-17','https://st.kp.yandex.net/images/film_iphone/iphone360_8918.jpg','DNA','В глубине тропических джунглей ученые обнаружили следы древнейшей цивилизации. Из окаменелых останков Мезозойских ископаемых они извлекли молекулы ДНК и нашли ключ к их генетическому оживлению. Эксперимент удался — чудовищный ГЕНОЗАВР ожил…','$12 000 000'),(8921,'Костолом',1996,95,0.0,7.5,360,'1997-03-20','https://st.kp.yandex.net/images/film_iphone/iphone360_8921.jpg','Sticks & Stones','Три подростка — Джоуи, Бук, Маут — никак не могут преодолеть страх: над ними постоянно издевается старшеклассник, а над Джоуи еще и старший брат. Этому есть объяснение — ведь насилие порождает насилие. Ребята находят способ, чтобы прекратить это бесконечное унижение, но какой ценой?..','Нет данных'),(8923,'Галактика',1995,91,0.0,4.2,93,'1995-06-27','https://st.kp.yandex.net/images/film_iphone/iphone360_8923.jpg','Galaxis','После захвата планеты Синтария в руки злодея Кайла попадает древний кристалл, являющийся по легенде источником всего сущего и обладающий по этой причине невероятной силой. Однако выясняется, что существует и другой такой же кристалл, хранящийся на Земле, куда вскоре и направляется Кайл. Задача опередить его и не дать заполучить могущественный артефакт ложится на плечи космической амазонки Ладеры.','Нет данных'),(8926,'В плену у скорости',1998,86,0.0,5.4,274,'1999-02-22','https://st.kp.yandex.net/images/film_iphone/iphone360_8926.jpg','Velocity Trap','В космической империи товарооборот между планетами достиг огромных объемов. Соответственно, увеличились и денежные потоки.<br><br>Раз в полгода по специальному «скоростному пути» тяжело вооруженный банковский корабль перевозит миллиарды «вселенских долларов» из отдаленных колоний в Центральный Банк на Землю. Один из этих кораблей попадает в мастерски расставленную ловушку…<br><br>Команда великолепно подготовленных наемников устраивает западню в узком космическом коридоре, где не остается следов, и у свидетелей нет шанса выжить…<br><br>Как всегда, планируется совершить идеальное преступление. Как всегда, находится один человек, пытающийся все испортить…','Нет данных'),(8927,'Шутники',1995,82,0.0,6.1,203,'1995-02-03','https://st.kp.yandex.net/images/film_iphone/iphone360_8927.jpg','The Jerky Boys','С мафией шутки плохи. Но парочка нью-йоркских шалопаев — Джонни и Камаль — подзабыли эту простую истину. Мастера телефонных розыгрышей, однажды они подшутили над местным боссом мафии, заставив того поверить, что они — пара крутых громил из Чикаго. Увы, когда обман раскрылся, оказалось, что раздраженный гангстер принял невинный розыгрыш слишком близко к сердцу. Не успели герои поздравить себя с очередным удачным приколом, как за их пустыми головами начинается настоящая охота. Проклиная свое не в меру развитое чувство юмора, герои пускаются в бега…','Нет данных'),(8932,'Гарфилд',2004,80,0.0,6.8,62576,'2004-06-06','https://st.kp.yandex.net/images/film_iphone/iphone360_8932.jpg','Garfield','Хозяин кота Гарфилда, Джон, приносит в дом милого щенка Оди, и с этого момента жизнь Гарфилда идёт наперекосяк. Он хочет только одного — чтобы пёс навсегда исчез из его жизни и из его дома! Но когда внезапно щенка похищают, Гарфилд, возможно, впервые в жизни чувствует лежащую на нём ответственность. И начинает действовать.','$50 000 000'),(8933,'Вид сверху лучше',2003,87,0.0,6.6,16358,'2003-03-21','https://st.kp.yandex.net/images/film_iphone/iphone360_8933.jpg','View from the Top','Провинциалка Донна сбегает из дома, чтобы стать стюардессой. По результатам тестов её направляют на местный маршрут в Кливленд. Там она знакомится с Тедом. Позже Донна добивается переэкзаменовки и получает работу на международных авиалиниях, но теперь ей нужно выбирать между Тедом и карьерой.','$30 000 000'),(8937,'Мошенники',2000,98,0.0,6.0,174,'2000-09-01','https://st.kp.yandex.net/images/film_iphone/iphone360_8937.jpg','The Prime Gig','Пенделтон Вайз — мелкий мошенник, зарабатывающий на жизнь аферами по продаже фальшивых таймшеров, получает предложение поучаствовать в крупной «игре» под руководством акулы аферного бизнеса Келли Гранта. Однако Пенделтон имел неосторожность влюбиться в любовницу Келли и теперь его цель удвоилась…','Нет данных'),(8939,'Боссанова',2000,95,0.0,7.0,199,'2000-02-18','https://st.kp.yandex.net/images/film_iphone/iphone360_8939.jpg','Bossa Nova','Привлекательная американка Мэри Энн Симпсон после смерти мужа, бразильского пилота, живет в Рио-де-Жанейро и преподает английский на курсах иностранного языка. Каждое утро она начинает с плавания в прекрасном океане, но окружающая красота не доставляет ей удовольствия.<br><br> Мэри Энн одинока, и отчаянно хочет быть счастливой. Преуспевающий адвокат Педру Паулу тяжело переживает развод с женой Таней, покинувшей его ради инструктора по китайской гимнастике. Несмотря на всю респектабельность, он тоже одинок.<br><br>Его решение записаться на курсы английского и знакомство с преподавательницей Мэри Энн резко меняет жизнь обоих…','Нет данных'),(8940,'Герой-предатель',1999,121,0.0,6.3,119,'1999-08-02','https://st.kp.yandex.net/images/film_iphone/iphone360_8940.jpg','One Man\'s Hero','Их, суровых ветеранов, воевавших под своим собственным зеленым флагом, называли «Бригада Святого Патрика» или «Сан-Патрисиос».<br><br>Жестокие религиозные и национальные притеснения со стороны офицеров-протестантов вынудили уйти в Мексику отряд американских солдат — ирландских иммигрантов-католиков во главе с сержантом Джоном Райли. Во время жестокой войны 1846 года между США и Мексикой «Сан-Патрисиос» отважно сражались за братьев по вере и свою новую родину, став одним из лучших подразделений мексиканской армии…','Нет данных'),(8943,'На волне смерти',1996,89,0.0,5.9,110,'1996-04-14','https://st.kp.yandex.net/images/film_iphone/iphone360_8943.jpg','Power 98','Эрик Робертс играет известного Лос-Анджелеского диск-жокея, который не перестает удивлять своих поклонников новыми выходками. Когда в городе начинают происходить убийства женщин, маньяк звонит на радиостанцию, тем самым поднимая ее рейтинг, пока полиция не приходит к шокирующей разгадке…','Нет данных'),(8944,'Дорога домой 2: Затерянные в Сан-Франциско',1996,89,0.0,7.6,6762,'1996-03-08','https://st.kp.yandex.net/images/film_iphone/iphone360_8944.jpg','Homeward Bound II: Lost in San Francisco','Троица говорящих зверей возвращается для нового приключения! Если раньше им приходилось путешествовать по горам и пустыням, то теперь раздражительный пес Ченс, избалованная кошка Сэсси и очаровательный ретривер Шедоу затерялись в бурлящем Сан — Франциско! С целой сворой знакомых дворняг находчивая троица прокладывает путь через городские джунгли домой, к любимой семье.','Нет данных'),(8945,'Мой отец – герой',1994,90,0.0,6.8,1721,'1994-02-04','https://st.kp.yandex.net/images/film_iphone/iphone360_8945.jpg','My Father the Hero','Может ли отец стать любовником? Чтобы решиться на это, нужно проявить настоящий героизм. Долгожданная встреча с дочерью, которую Андре не видел много лет после развода с женой, оказалась более чем неожиданной.<br /><br />За годы разлуки он настолько отвык от роли отца, что поведение повзрослевшей дочери постоянно приводило его в замешательство. Чего только стоило предложение разыграть перед окружающими влюбленную парочку!','Нет данных'),(8946,'Тревор',1994,23,0.0,6.2,181,'1996-06-24','https://st.kp.yandex.net/images/film/8946.jpg','Trevor','Тревор — обычный американский школьник. Он слушает музыку, общается с друзьями, ходит в кино. Но наступил период полового созревания и однажды все меняется: Тревор понимает, что он видит мир не так, как остальные его сверстники. Он интересуется не девушками, а юношами. Люди высмеивают его за любовь к балету, театру и Дайане Росс. Подросток начинает осознавать свою гомосексуальность. Друзья его избегают, родители игнорируют, а священник обвиняет Тревора в том, что он извращенец. Мир померк и парень решает покончить жизнь самоубийством. Но помощь и поддержка приходят оттуда, откуда Тревор их не ждал…','Нет данных'),(8947,'Одинокая белая женщина',1992,107,0.0,6.9,3146,'1992-08-14','https://st.kp.yandex.net/images/film_iphone/iphone360_8947.jpg','Single White Female','«Одинокая белая женщина ищет соседку…». Так начиналось объявление, которое Элли Джонс поместила в газету. Так начинался самый страшный кошмар в ее жизни. Застенчивая Хэди сразу понравилась гостеприимной хозяйке.<br><br>Одинокие женщины делились друг с другом одеждой, духами и самыми сокровенными тайнами. Хэди хотела во всем быть похожей на свою новую подругу. И ей это удалось. Но чтобы добиться окончательного сходства, странной соседке придется забрать у Элли жизнь.','Нет данных'),(8948,'Зеркало, зеркало',1990,104,0.0,5.6,230,'1990-08-31','https://st.kp.yandex.net/images/film_iphone/iphone360_8948.jpg','Mirror Mirror','Миссис Перилли и ее подруга Эмелин делают уборку в доме, готовясь к приезду новых владельцев. Они находят старое зеркало, которое Эмелин хочет взять в свою антикварную лавку. Эмелин также обнаруживает книгу оккультных заклинаний и дневник Мэри Уиверворт, которая жила в этом доме много лет назад и была убита собственной сестрой Элизабет…','Нет данных'),(8949,'Птичка на проводе',1990,110,0.0,7.3,12215,'1990-05-18','https://st.kp.yandex.net/images/film_iphone/iphone360_8949.jpg','Bird on a Wire','Дела Рика Джармина, живущего тайной жизнью по специально разработанной ФБР программе защиты свидетелей, складывается не лучшим образом. Дело в том, что пятнадцать лет назад он дал показания против полицейского, промышляющего торговлей наркотиками, что позволило усадить негодяя за решетку. Преступник, отсидевший свой срок, решает отомстить «стукачу» и начинает охоту на Джармина. Случайно Рик сталкивается с Мэриэнн Грэйвз, своей бывшей невестой. Мэриэнн, естественно, узнает его, что облегчает задачу убийцам, следующим за Джармином по пятам. Теперь бывшим возлюбленным вместе предстоит спасаться от злодеев, но именно это помогает им вернуть утраченную любовь.','$20 000 000'),(8950,'Взломщики',1989,94,0.0,6.1,118,'1989-10-09','https://st.kp.yandex.net/images/film_iphone/iphone360_8950.jpg','Breaking In','Легкая комедия об опытном, стареющем взломщике сейфов Эрни. Он берет в ученики юного протеже, которому еще многому нужно учиться не только по «специальности», но и по жизни.','Нет данных'),(8951,'Большие огненные шары',1989,108,0.0,7.3,1144,'1989-06-30','https://st.kp.yandex.net/images/film_iphone/iphone360_8951.jpg','Great Balls of Fire!','Фильм о знаменитом пианисте, певце и композиторе, легенде рок-н-рола, Джерри Ли Льюисе. В центре картины стоит его любовь к жене, тринадцатилетней Майре, из-за юности которой на него было столько нападок. Майра была дочерью его двоюродного брата, в доме которого он жил, но и музыка в картине, естественно, не забыта. Льюис стал королем рока тогда, когда в расцвете был Элвис Пресли, и это было не легко, но гений, данный ему от бога, заявил о себе бешено и властно.','Нет данных'),(8954,'Космические яйца',1987,96,0.0,6.6,8880,'1987-06-24','https://st.kp.yandex.net/images/film_iphone/iphone360_8954.jpg','Spaceballs','Президент планеты Космические Яйца посылает лорда Темный Шлем выкрасть принцессу Веспу. Взамен он хочет получить весь воздух с планеты Друидия. Остановить злого президента и уничтожить планету Космические Яйца под силу только Лону Старру и великому Йогурту!','$22 700 000'),(8955,'Девчонка не промах',1986,107,0.0,6.3,143,'1986-11-07','https://st.kp.yandex.net/images/film_iphone/iphone360_8955.jpg','Nobody\'s Fool','Узнав о том, что его подружка ждет ребенка, будущий отец резко уходит в сторону, и бедной официантке (Аркетт), ставшей отверженной в этом провинциальном городке, пришлось бы не сладко, не повстречай она настоящего мужчину (Робертс), работающего осветителем странствующей театральной труппы.','Нет данных'),(8957,'Правдивые истории',1986,89,0.0,6.2,114,'1986-10-04','https://st.kp.yandex.net/images/film_iphone/iphone360_8957.jpg','True Stories','Истории нескольких странных жителей городка Вёрджил в Техасе, рассказанные безымянным персонажем в ковбойской шляпе.','Нет данных'),(8964,'Та ночь',1992,89,0.0,7.3,409,'1992-12-17','https://st.kp.yandex.net/images/film_iphone/iphone360_8964.jpg','That Night','Окна 12-летней Элис расположены прямо напротив окон её соседки, 17-летней Шерил. Благодаря этому Элис знает о Шерил всё: какую музыку она слушает, как одевается, что любит, что нет. В то же время Шерил, похоже, даже не подозревает о существовании соседки. У неё своя жизнь, влюблённости, неприятности…','Нет данных'),(8966,'Он сказал, она сказала',1991,115,0.0,6.6,286,'1991-02-22','https://st.kp.yandex.net/images/film_iphone/iphone360_8966.jpg','He Said, She Said','Он говорит — секс, она говорит — романтика. Он говорит — отношения, она говорит — брак. Он говорит — «нет», она надеется, что «да»… Слава богу, они согласны хотя бы в одном — в том, что они влюблены!<br><br>Главные герои — два конкурирующих журналиста, которые находят свою любовь и успех в словесных баталиях на совместном ток-шоу.<br><br>Но интрига, которая делает их шоу настоящим хитом, угрожает их отношениям, поскольку парочка постепенно начинает понимать, что у них совершенно противоположные взгляды на совместную жизнь.','Нет данных'),(8969,'Вечный сон',1978,99,0.0,5.8,191,'1978-03-13','https://st.kp.yandex.net/images/film_iphone/iphone360_8969.jpg','The Big Sleep','Бывший полицейский, а ныне частный детектив Марлоу, берется за новое дело. Марлоу приглашают в роскошный особняк генерала Стернвуда, чтобы он проследил за мошенником, компрометирующим дочь благородного военного. Но то, что на первый взгляд кажется нехитрым заданием, оказывается зловещим и запутанным клубком из шантажа и убийств…','Нет данных'),(8970,'Общественный клуб города Шайенн',1970,103,0.0,6.1,66,'1970-06-12','https://st.kp.yandex.net/images/film_iphone/iphone360_8970.jpg','The Cheyenne Social Club','Техасский ковбой Джон О«Харлан получает письмо, извещающее о том, что он унаследовал коммерческое предприятие под названием »Общественный клуб города Шайенн». Джон, надеясь что он может, наконец, покончить с кочевой жизнью и стать богачом, вместе с приятелем Харли О`Салливаном отправляется знакомиться со своей новоявленной собственностью. Каково же было его удивление, когда оказалось, что под приличной вывеской «скрывается» бордель во главе с привлекательной красоткой Дженни. <br /><br />Оправившись от потрясения Джон первым делом желает перепрофилировать бордель в пансионат, но неожиданно воспротивились узнавшие об этом жители города. Неизвестно чем бы в итоге всё закончилось так как местный забияка Кори Баннистер затевает драку в борделе и, в результате, вмешавшийся в это дело Джон, убивает дебошира. В ответ целый клан Баннистеров собирается что бы отомстить. А Джону и его другу Харли приходится защищать себя, Дженни и остальных девушек из «Общественного клуба города Шайенн».','Нет данных'),(8971,'Бандолеро!',1968,106,0.0,6.8,191,'1968-06-01','https://st.kp.yandex.net/images/film_iphone/iphone360_8971.jpg','Bandolero!','Дерзких контрабандистов и отважных бандолеро, мексиканские простолюдины считают лицами поэтическими. Ди — крепкий парень вне закона. Он со своим приятелем решает ограбить банк в маленьком техасском городке. Во время налета в перестрелке один из них убивает богатого владельца местного ранчо. Полиция арестовывает грабителей и приговаривает их к смертной казни через повешение.<br><br>Узнав о случившимся брат Ди, с намерением освободить «бригаду», прибывает в город под видом палача. При побеге они берут в заложники девушку по имени Мария. Шериф этого городка Джонсон клянется во чтобы-то ни стало поймать преступников и бросается в погоню.<br><br>Но мексиканское солнце улыбается не всем. Когда до границы остается буквально полмили, путь беглецам преграждает шайка жестоких мексиканских бандолеро…','$4 450 000'),(8972,'Файеркрик',1968,104,0.0,6.4,83,'1968-01-24','https://st.kp.yandex.net/images/film_iphone/iphone360_8972.jpg','Firecreek','Джеймс Стюарт в роли шерифа маленького городка Файеркрик объединяет его жителей для отпора грабителям, возглавлямым злодеем в лице Генри Фонды.','Нет данных'),(8973,'Редкая порода',1966,97,0.0,6.5,98,'1966-02-02','https://st.kp.yandex.net/images/film_iphone/iphone360_8973.jpg','The Rare Breed','Фильм рассказывает историю приобретения Америкой крупного рогатого скота из английского графства Херефорд (быки и коровы предназначались для повышения производительности сельского хозяйства в Техасе). В 1880-е годы англичанка Марта Прайс и ее дочь Хиллари приехали в Америку, продавать на аукционе своего быка-призера Херефордской породы.<br><br>После продажи быка диковатому шотландцу Боуэну, женщины нанимают вольного ковбоя по имени Бернетт — он должен помочь им доставить животное новому владельцу. Так начинаются приключения, всем участникам которых предстоят серьезные испытания: они сражаются с убийцами, ищут и ловят сбежавшего бычка и т. д.<br><br>Но когда они наконец-то добираются до ранчо Боуэна, еще более серьезные препятствия заставляют их собрать свою волю и храбрость в кулак, потому что они должны постараться выжить, а заодно и спасти от гибели быка-призера.','Нет данных'),(8974,'Полет Феникса',1965,142,0.0,7.6,906,'1965-12-15','https://st.kp.yandex.net/images/film_iphone/iphone360_8974.jpg','The Flight of the Phoenix','Небольшой грузовой самолет, попав в сильнейшую песчаную бурю, терпит крушение посреди пустыни. Понимая, что помощь не придет, команда принимает решение самостоятельно построить новый самолет из обломков разбившегося.<br><br>Командир корабля Фрэнк Таунс и штурман Лью Моран ведут людей к спасению, несмотря на нарастающее напряжение в отношениях между членами команды.','Нет данных'),(8975,'Мистер Хоббс берет выходной',1962,116,0.0,6.9,203,'1962-06-15','https://st.kp.yandex.net/images/film_iphone/iphone360_8975.jpg','Mr. Hobbs Takes a Vacation','Роджер Хоббс — измотанный городской житель, который жаждет взять свою семью на побережье на каникулы. Он и его жена Пэгги действительно едут с семьей на побережье, но там развиваются новые проблемы, и каникулы оказываются полны приключений.','Нет данных'),(8976,'Икс 15',1961,107,0.0,5.5,60,'1961-12-22','https://st.kp.yandex.net/images/film_iphone/iphone360_8976.jpg','X-15','Три пилота-испытателя и один X-15. Кто выиграет, кто выживет, что кому будет стоить и кто будет готов заплатить?','Нет данных'),(8979,'Колокол, книга и свеча',1958,102,0.0,7.0,604,'1958-11-11','https://st.kp.yandex.net/images/film_iphone/iphone360_8979.jpg','Bell Book and Candle','Джиллиан Хоррой — обычная современная ведьма. Красивая, обворожительная и… одинокая. Единственный спутник жизни — любимый сиамский котик. Но однажды порог здания, в котором живёт чародейка, переступает симпатичный сотрудник одного печатного издания, Шеп Хендерсон.','Нет данных'),(8980,'Опасный перегон',1957,90,0.0,6.7,114,'1957-07-24','https://st.kp.yandex.net/images/film_iphone/iphone360_8980.jpg','Night Passage','После того, как Грант Маклэйн, работающий охранником на железной дороге, не смог задержать грабителя, его уволили. Он стал зарабатывать на жизнь игрой на аккордеоне. Неожиданно он получает предложение от Бэна Кимбела, шэфа ЖД, вернуться на старое место работы, так как банда Уайта три раза подряд ограбила поезда, везущие зарплату рабочим. Бэн Кимбэл поручает ему доставку $10000…','Нет данных'),(8981,'Дух Сент-Луиса',1957,135,0.0,6.8,271,'1957-04-20','https://st.kp.yandex.net/images/film_iphone/iphone360_8981.jpg','The Spirit of St. Louis','Работая авиапочтальоном, отважный пилот мечтал в одиночку перелететь через Атлантику. До него этого не делал никто. Для осуществления своей мечты он ищет спонсоров, и после больших трудов находит сочувствующую группу в Сент-Луисе, штат Миссури. По его заказу для полета строят специальный самолет, получивший название «Дух Сент-Луиса». В день вылета из Нью-Йорка Линдберг вынужден был долго ждать, пока кончится дождь…','$6 000 000'),(8982,'Человек, который слишком много знал',1955,120,0.0,7.4,4837,'1956-04-29','https://st.kp.yandex.net/images/film_iphone/iphone360_8982.jpg','The Man Who Knew Too Much','Доктор Бен и Джо МакКенна, простые, ничего не подозревающие туристы, едут провести отпуск в Марокко. Вместе с ними их сын Хэнк, они наслаждаются отпуском, когда встречают мистера и миссис Дрэйтон, супружескую пару из Англии, и подозрительного, но дружелюбного француза Луи Бернара.<br><br>Позже, когда Бен и Джо ходят по базару, к ним подбегает араб с ножом в спине. Бен буквально подхватывает падающего араба и, к своему ужасу, узнает, что это переодетый Луи Бернар. Француз успевает прошептать что-то Бену, и тот оказывается втянутым в самый центр международного заговора, участники которого ставят своей целью покушение на высокопоставленную особу, остановить ход событий может только Бен. Хичкок сам появляется в фильме в эпизодической роли, как и его композитор, Бернард Херрманн.','$2 500 000'),(8983,'Человек из Ларами',1955,104,0.0,6.8,279,'1955-07-13','https://st.kp.yandex.net/images/film_iphone/iphone360_8983.jpg','The Man from Laramie','Некий Уилл Локхард привозит фургоны с товарами в город, затерянный в землях аппачей. Но главная его цель — найти того, кто продает аппачам оружие, ведь используя эти винтовки, индейцы расстреляли кавалерийский патруль, в котором был брат Уилла. Сразу же у Локхарда возникают неприятности с людьми Алека Вагонмана, фактического хозяина города, в особенности с его сыном Дэйвом. Подозрения, что в истории с оружием замешан кто-то из них, усиливаются, когда Уилла арестовывают за убийство, которого он не совершал…','Нет данных'),(8986,'Далекий край',1954,97,0.0,6.8,277,'1954-07-22','https://st.kp.yandex.net/images/film_iphone/iphone360_8986.jpg','The Far Country','В городок на границе США и Канады приезжает крепкий парень Джефф Уэбстер, для которого перегон скота является профессией и средством к существованию. Он берётся доставить крупное стадо из Сиэтла на Аляску. Однако ему не удаётся договориться о перевозке скота морем, и он решает перегонять стадо своим ходом. Проблема в том, что стадом решил завладеть нечистый на руку судья Гэннон, у которого на службе целая банда…','Нет данных'),(8987,'История Гленна Миллера',1953,115,0.0,7.4,401,'1954-01-04','https://st.kp.yandex.net/images/film/8987.jpg','The Glenn Miller Story','В годы учебы в Колорадском университете Гленн Миллер влюбляется в Хелен Бергер. Получив диплом, он устраивается на работу к Бену Поллаку и через некоторое время дает свой первый концерт из оркестровой ямы Бродвейского шоу.<br><br>Он женится на Хелен, но в первую брачную ночь, к изумлению молодой жены, отправляется на джем-сейшн в Гарлем с Джином Крупой и Луи Армстронгом.<br><br>Позднее в Бостоне, в танцевальном зале, управляемом Сайем Шрибмэном, Миллер совершенствует свое искусство и благодаря случайности становится знаменитым.','Нет данных'),(8990,'Излучина реки',1951,101,0.0,6.8,322,'1952-01-23','https://st.kp.yandex.net/images/film_iphone/iphone360_8990.jpg','Bend of the River','Пятидесятые года XIX века. При сопровождении каравана фургонов через горы, через прерии в Портленд, в поисках новой жизни Глен МакЛинток спасает от линчевания Эмерсона Коула, подозреваемого в краже скота. Благодарный Коул помогает Глену и его друзьям отбить неожиданную атаку индейцев, так они становятся друзьями. <br><br>Подруга Глена Лаура Бэйл увлеклась Коулом и намерена остаться в Портленде вместе с новым знакомым, а не связывать свою жизнь с работой в поле. Но Коул не простой парень: у него темное прошлое, как, впрочем, и у самого Глена есть свои секреты. Тем временем, оплаченные поставки провизии для переселенцев, обещанные мэром Портленда не производятся. МакЛинток возвращается в город, где ему приходится взяться за оружие, чтобы отстоять продовольствие для своей общины…','Нет данных'),(8992,'Сломанная стрела',1950,93,0.0,6.9,218,'1950-07-20','https://st.kp.yandex.net/images/film_iphone/iphone360_8992.jpg','Broken Arrow','Бесстрашный бойскаут Том Джеффордс приезжает на плато Аризоны, чтобы начать новую жизнь. Он испытывает отвращение к войне между индейцами и белыми, которая длится уже десять лет. В одиночку он старается наладить мир с племенами Апачей.<br /><br />Однажды он спасает раненого индейского юношу и попадает в племя, во главе которого стоит вождь Кочис. Том изучает язык и обычаи Апачей и со временем ему удается подписать мирный договор с гордым вождем, который позволит беспрепятственно проезжать почтовым дилижансам по землям индейцев.<br /><br />Кочис и Джеффордс становятся кровными братьями. «Бледнолицый» влюбляется в индейскую девушку «Утренняя звезда», и женится на ней, соблюдая все обычаи Апачей.<br /><br />Но многим белым не нужен мир в Аризоне и они вновь поднимают топор войны…','Нет данных'),(8994,'История Страттона',1949,106,0.0,6.1,139,'1949-04-21','https://st.kp.yandex.net/images/film_iphone/iphone360_8994.jpg','The Stratton Story','Бывший бейсболист, путешествуя по провинции, замечает молодого талантливого игрока Монти Стрэттона. Он убеждает его пробиться в профессиональную лигу, помогает ему в этом.','Нет данных'),(8996,'Веревка',1948,80,0.0,8.0,17183,'1948-08-26','https://st.kp.yandex.net/images/film_iphone/iphone360_8996.jpg','Rope','Двое молодых людей, Брэндон Шоу и Филлип Морган без всякой причины, для развлечения убивают своего приятеля-сокурсника, Девида Кентли, задушив верёвкой. Спрятав тело в сундук, Брендон и Филлип устраивают вечеринку в той же квартире. Среди приглашенных — отец Девида, его невеста Жанет и их преподаватель Руперт. В ходе вечеринки Филипп постепенно осознает весь ужас содеянного, а Руперт начинает подозревать неладное…','$1 500 000'),(8997,'Звонить Нортсайд 777',1948,112,0.0,7.3,405,'1948-02-13','https://st.kp.yandex.net/images/film/8997.jpg','Call Northside 777','Сюжет фильма основан на реальных событиях, имевших место в Чикаго в 1932 году. Джозеф Мазек был обвинен в убийстве полицейского и получил пожизненный срок.<br><br>Одиннадцать лет спустя мать Джозефа дала объявление в газету, которое находит репортер «Чикаго Тайме» Джеймс Мак Гир. В ходе собственного расследования ему удается предоставить государству достаточно веские основания в невиновности Мазека.','Нет данных'),(8999,'Девушки Зигфилда',1941,132,0.0,7.3,305,'1941-04-25','https://st.kp.yandex.net/images/film/8999.jpg','Ziegfeld Girl','Бродвей зажигает огни и на этот свет, как мотыльки, слетаются девушки, в поисках легкой жизни и головокружительной карьеры. Новое бродвейское «Шоу Зигфилда» делает очередной набор участниц и среди других приглашает на работу трех милых девушек: их роли различны, но сцена объединила их судьбы в одну.<br><br>Сюзен профессиональная певица, живущая со старым эксцентричным папашей-композитором, Шейла — симпатичная блондинка с рабочей окраины, делящая постель с пожилым миллионером, а Сандра — жена безработного скрипача, который не может вырваться из душевного кризиса.<br><br>С этого дня девушкам надо забыть обо всем, что их тревожит, ведь теперь они «Девушки Зигфилда» — лучшие модели Бродвея. У каждой из них появился шанс изменить свою жизнь и стать суперзвездой грандиозного музыкального представления, но у любого шоу есть финал и для каждой из участниц он не будет одинаков…','Нет данных'),(9000,'Приходи со мной жить',1941,86,0.0,7.5,357,'1941-01-29','https://st.kp.yandex.net/images/film_iphone/iphone360_9000.jpg','Come Live with Me','Танцовщица Джонни Джонс — нелегальная иммигрантка, которой угрожает депортация из США, единственный шанс остаться в стране — выйти замуж, но ее богатый ухажер-издатель Бартон Кендрик уже женат. Она встречает писателя-неудачника Билла Смита и предлагает ему фиктивный брак, но у Билла на этот счет свои планы.','Нет данных'),(9002,'Смертельный шторм',1940,100,0.0,6.2,164,'1940-06-14','https://st.kp.yandex.net/images/film_iphone/iphone360_9002.jpg','The Mortal Storm','Семья Рота ведёт тихую жизнь в деревеньке в Немецких Альпах в начале 30-х годов. Когда нацисты приходят к власти, семья разделяется, а друг семьи, Мартин Брайтнер, зачинает беспорядки.','Нет данных'),(9003,'Магазинчик за углом',1940,99,0.0,7.9,4889,'1940-01-10','https://st.kp.yandex.net/images/film_iphone/iphone360_9003.jpg','The Shop Around the Corner','«Матюшек и Ко.» — магазин подарков и сувениров на углу. В штате есть сотрудник — Альфред Кралик, симпатичный молодой человек, который влюблен в девушку, которую он никогда не видел, и даже не знает имени (их «роман» завязался через почтовый ящик, по переписке).','Нет данных'),(9004,'Этот замечательный мир',1939,86,0.0,7.6,346,'1939-05-19','https://st.kp.yandex.net/images/film_iphone/iphone360_9004.jpg','It\'s a Wonderful World','Молодой частный детектив Гай Джонсон поставлен на работу, которая заключается в том, чтобы следить за сумасбродным миллионером Уилли Хейвардом, который вечно попадает или впросак или в беду. Но однажды действительно грянула беда. Его очередной поход в питейное заведение закончился тем, что его подставляют и таким образом, что полиция подозревает его в совершении убийства. <br><br>Хотя детектив успевает его буквально унести с места преступления, полиция арестовывает обоих — одного за совершение убийства, а второго за укрывательство. Теперь уже детектив вынужден бежать из-под охраны, поскольку ему просто жизненно необходимо доказать непричастность своего клиента к делу и таким образом автоматически и свою невиновность. Но каков поп, таков приход. <br><br>Он такой же неудачник, как и его клиент. Он тоже попадает во всяческие нелепые ситуации, которые просто снежной лавиной пытаются на него обрушиться. Начинается все с того, что его побег наблюдает эксцентричная поэтесса Эдвина Корде, которую он вынужден прихватить с собой, по сути — похитить, чтобы она не выдала его полицейским, а заодно и воспользоваться ее машиной, чтобы найти реального убийцу.','Нет данных'),(9005,'Ледовое безумство',1939,82,0.0,6.1,89,'1939-03-10','https://st.kp.yandex.net/images/film_iphone/iphone360_9005.jpg','The Ice Follies of 1939','Ларри Холл и Эдди Берджесс успешно выступают на коньках в течение ряда лет, пока Лари не встречает на своем пути Мэри Маккей, весьма посредственную фигуристку, которую он берет в их пару, но из-за неумения девушки их постоянно увольняют. Однако Лари лелеет мечту создать свое ледовое шоу, которое будет именно шоу, а не простым катанием на льду.<br /><br />После очередного увольнения Лари и Мэри женятся, но Эдди открывает девушке глаза, что именно она является обузой в жизни Лари и тянет карьеру новоиспеченного мужа назад. Мэри удается убедить главу студии «Монарх» подписать с ней контракт и она окрыленная прибегает домой, однако в контракте мелким шрифтом напечатано, что ей запрещается вступать в брак без разрешения студии. Лари убеждает, что она должна сохранить свой брак в тайне…','Нет данных'),(9006,'Созданы друг для друга',1939,92,0.0,6.9,173,'1939-02-10','https://st.kp.yandex.net/images/film_iphone/iphone360_9006.jpg','Made for Each Other','Красивая Джейн и Джон Мэйсон — симпатичная молодая пара, которая проходит через все тернии совместной жизни — от безумной влюбленности первых встреч до будней семейной жизни и рождению первого ребенка.<br> <br>В то время как все окружающие уверенны в том, что именно эти двое предназначены друг для друга, судьба решает все иначе и пара должна встретиться с неодобрительными взглядами родственников со стороны супруга, напряженной обстановкой на работе, финансовыми трудностями и смертельно опасной болезнью малыша…','Нет данных'),(9007,'Банальный ангел',1938,85,0.0,6.8,91,'1938-07-15','https://st.kp.yandex.net/images/film_iphone/iphone360_9007.jpg','The Shopworn Angel','Во время Первой мировой войны простодушный молодой техасский солдат Билл Петтигрю отправляется в Нью-Йорк для базовой подготовки, где встречает актрису Дэйзи Хит. Она соглашается изображать его девушку, чтобы произвести впечатление на его друзей, но тем временем у них завязываются настоящие отношения.','Нет данных'),(9008,'Оживленная леди',1938,90,0.0,7.1,222,'1938-05-10','https://st.kp.yandex.net/images/film_iphone/iphone360_9008.jpg','Vivacious Lady','Питер Морган — молодой профессор биологии в Старом Шаронском университете, приезжает срочно в Нью-Йорк, чтобы вернуть «заблудшую овцу» двоюродного брата Кита Моргана домой. Когда он, наконец, находит брата, неожиданно для себя знакомится, влюбляется и скоропалительно женится на певичке из ночного клуба Фрэнси.<br><br>По возвращении домой в небольшой городок, которым заправляет Питер Морган-старший — его консервативный отец, с диктаторскими замашками, Питер никак не может набраться смелости, чтобы поставить в известность о своей женитьбе тирана-отца и больную матушку. Он просит Фрэнси поселиться у Кита, пока он придумает выход из создавшегося положения…','$703 000'),(9011,'Последний гангстер',1937,81,0.0,7.0,106,'1937-11-12','https://st.kp.yandex.net/images/film_iphone/iphone360_9011.jpg','The Last Gangster','История начинается в 1927 году, во времена разгула преступности и процветания бутлегерства, во времена сухого закона в Америке. Джо Корзак, один из главарей преступной банды, решил обзавестись семьей для придания своей персоне статуса добропорядочного гражданина. Он выбирает иностранку, которая ничего не знает о его шумной славе, поскольку она по-английски может сказать только несколько слов. <br><br>Но власти давно имели на него зуб и когда не смогли его уличить в причастности к устранению конкурентов, то на федеральном уровне взяли за уклонение от уплаты налогов. Ему присудили 10 лет. У него рождается столь долгожданный наследник. Но его жена совсем не была готова к тому, что ее сын является сыном известного гангстера, о чем она узнает из газет, и молодая женщина принимает решение — уехать как можно дальше и поменять фамилию…','Нет данных'),(9012,'Седьмое небо',1937,102,0.0,7.3,138,'1937-03-25','https://st.kp.yandex.net/images/film_iphone/iphone360_9012.jpg','Seventh Heaven','Действие разворачивается на улицах Парижа в 1914 году до наступления Первой Мировой войны. Канализационный работник Чико твердо убежден, что он стал атеистом потому, что его молитвы остались без ответа, когда он просил Бога исполнить два его сокровенных желания. Но герой оптимист по жизни и глубоко порядочный и сострадательный человек, хотя свое доброе сердце он скрывает за внешней грубостью. Он помогает Диане, когда ту избивает жестокосердная сестра — содержательница притона, за то, что девушка отказалась быть приветливой с клиентом. <br /><br />Чтобы уберечь ее от ареста, он говорит полицейскому, что это его жена и теперь вынужден отвести ее в свою квартиру, поскольку полицейский обещал их навестить, чтобы проверить, а так ли это. А жил Чико на чердаке дома, куда надо подниматься по лестнице на седьмой этаж. Дерзкий и веселый Чико, говорит, что это небо и отсюда открывается вид на окрестности города и пытается распространять свою оптимистичную философию жизни и на Диану. Через какое-то время молодые люди охвачены взаимным чувством влечения и Чико даже хочет жениться на Диане, но все планы нарушает война — ему прислали повестку.','Нет данных'),(9013,'После тонкого человека',1936,112,0.0,7.3,294,'1936-12-25','https://st.kp.yandex.net/images/film_iphone/iphone360_9013.jpg','After the Thin Man','После того, как Ник Чарльз виртуозно распутывает дело Винанта, супруги возвращаются в Сан-Франциско, чтобы насладиться новогодними праздниками и обществом друг друга. Родственники Норы — ее тетя Кэтрин Форрест и кузина Сельма Ландис — пребывают в отчаянии, так как муж Сельмы, Роберт, не появляется дома вот уже трое суток. Они приглашают супругов на ужин, и Кэтрин просит Ника помочь разыскать Роберта. Тот нехотя соглашается.','Нет данных'),(9014,'Великолепная инсинуация',1936,103,0.0,5.7,81,'1936-08-28','https://st.kp.yandex.net/images/film_iphone/iphone360_9014.jpg','The Gorgeous Hussy','Это историческая драма, когда штаты государства боролись против объединения в мощный союз и за собственную самостоятельность. Все это происходит на фоне рассказа о жизни Маргарет «Пеги» О`Нил Итон, которая получила известность в годы президентства Эндрю Джексона. История начинается еще до избрания в президенты ее дяди. Девушка, является дочерью хозяина гостиницы в Вашингтоне, где предпочитают останавливаться политики. Она прекрасно образована и свободно выражает свои политические пристрастия.<br /><br />Но эти же самые политические убеждения заставляют ее отказаться от самой большой любви своей жизни Джона Рэндолфа, сенатора штата Вирджиния, который был политическим оппонентом ее дяди Джексона. После ее скоропалительного брака с морским офицером, который заканчивается для нее статусом вдовы, Пеги, по совету своего дяди, выходит замуж за влюбленного в нее сенатора и военного министра Итона, который поддерживал политику президента. Тем временем она становится своего рода неофициальной первой леди президента Джексона, поскольку жена президента Рэйчел умирает, перед тем как ее муж занял столь ответственный пост.','Нет данных'),(9016,'Провинциалка',1936,106,0.0,6.8,85,'1936-04-10','https://st.kp.yandex.net/images/film_iphone/iphone360_9016.jpg','Small Town Girl','Жизнь Кэй протекает в провинциальном городке скучно и размеренно. Возможно, хуже всего, ее совсем неромантичный, с далеко идущими планами, то ли друг, то ли ухажер — Элмер. Единственное развлечение, когда стекаются толпы любителей игры в футбол и тогда в городке не протолкнуться. Однажды в такой же суматошный день, Кэй вечером выходит из дома, чтобы хотя бы подышать атмосферой толчеи и судьба ставит на ее пути молодого и обворожительного Боба Дакена, который просит ее указать дорогу к местной таверне.<br /><br />Он слегка навеселе и просит проехаться с ним, так как он не может «понять» ее объяснений. Так жизнь расставила хитроумную ловушку обоим. В ресторане они весело отмечают свадьбу знакомых Боба, и совсем захмелевший спутник везет Кэй в соседний городок к судье, который в любое время суток готов зарегистрировать брак…','Нет данных'),(9018,'Когда мы снова полюбим',1936,87,0.0,7.0,85,'1936-01-30','https://st.kp.yandex.net/images/film_iphone/iphone360_9018.jpg','Next Time We Love','Сесилия Хант выходит замуж за Тайлера Кристофера, молодого, подающего надежды, амбициозного журналиста, который пока пишет маленькие заметки. Чтобы свести концы с концами сосед и друг Криса Томми помогает Сесилии найти работу на сцене.<br /><br />Наконец Крис получает повышение, но для этого он должен стать иностранным корреспондентом в Италии. Сесилия отказывается с ним ехать, утверждая, что ее карьера начала тоже расти и только проводив мужа, она признается Крису, что она беременна и не хотела своим состоянием мешать карьере мужа…','Нет данных'),(9019,'Роз Мари',1936,113,0.0,6.3,91,'1936-01-28','https://st.kp.yandex.net/images/film/9019.jpg','Rose-Marie','Монреаль. Канада. Лучшее сопрано оперной сцены Мари Де Флор умоляет канадского премьер-министра отпустить на свободу её младшего брата Джона Флауэра, осуждённого за ограбление банка. Неожиданно она узнаёт, что брат убил полицейского и сбежал из тюрьмы. Мари оставляет сцену и нанимает Бонифэйса, жуликоватого проводника, чтобы тот проводил её в дикие края на поиски беглеца. Но Бонифэйс обманывает Мари…','Нет данных'),(9023,'Маки – это тоже цветы',1966,100,0.0,5.6,84,'1966-04-22','https://st.kp.yandex.net/images/film_iphone/iphone360_9023.jpg','Poppies Are Also Flowers','Фильм задуман, как часть программы ООН по борьбе с наркотиками, и снят по рассказу Яна Флеминга, литературного отца Джеймса Бонда. На благородный призыв ООН откликнулись многие знаменитые актеры.','Нет данных'),(9024,'Высшее общество',1956,111,0.0,7.3,1680,'1956-07-17','https://st.kp.yandex.net/images/film_iphone/iphone360_9024.jpg','High Society','Очаровательная и избалованная светская львица из высшего общества Трэйси Саманта Лорд собирается выйти замуж во второй раз. Она нашла себе, как ей кажется, идеального мужчину — служащего своего отца. Но тут появляется ее бывший муж Декстер-Хэвен, известный джазовый композитор и музыкант, чьи композиции исполняет знаменитый Луи Армстронг.','$2 700 000'),(9025,'Мосты у Токо-Ри',1954,102,0.0,6.1,255,'1955-01-20','https://st.kp.yandex.net/images/film_iphone/iphone360_9025.jpg','The Bridges at Toko-Ri','Действие фильма происходит во время Корейской войны. В центре повествования лейтенант ВМС США Гарри Брубейкер. Гарри — бывший юрист, пошедший на службу в армии. Дома его ждет красавица жена и двое маленьких дочек. Гарри уже устал от войны и думает, как вернуться домой. Но как военный человек он должен исполнять приказы и служить своей стране. <br /><br />После неудачного приземления, Гарри получает увольнительную на неделю, как раз в то время когда его жена, с дочками преодолев запреты, приехала в Японию. Но, проведя неделю с семьей, Гарри надо возвращаться к службе, чтобы принять участие в опасном, но важном военном задании — разгромить стратегические мосты у Токо-Ри на территории Северной Кореи. Задание очень опасное, и Гарри понимает, что оно может стать последним в его жизни.','Нет данных'),(9026,'Зеленый огонь',1954,100,0.0,6.4,158,'1954-12-24','https://st.kp.yandex.net/images/film_iphone/iphone360_9026.jpg','Green Fire','Райан Митчелл обнаруживает в Южной Америке месторождение изумрудов. Однако, не успевает он начать разработку, как его начинают преследовать. Вместе со своим партнером Виком они все же едут на месторождение. Там они знакомятся с владельцами кофейной плантации Кэтрин и Дональдом Ноуландами. Райан влюбляется в Кэтрин и оказывается перед сложным выбором…','Нет данных'),(9027,'Деревенская девушка',1954,104,0.0,7.6,1088,'1954-12-15','https://st.kp.yandex.net/images/film/9027.jpg','The Country Girl','Уставшему от жизни актеру и певцу Фрэнку Элджину предоставляется неплохой шанс вернуться на сцену, когда режиссер Берни Додд предлагает ему главную роль в своем новом мюзикле. Однако Фрэнк, пристрастившийся к алкоголю, избегает всякой маломальской ответственности.<br><br>Он предпочитает, чтобы за него все решала его жена Джорджи, которой все труднее противиться образу жизни мужа. Берни пытается помочь Фрэнку найти в себе силы переменить свою жизнь. При этом во всем, что случилось с Элджином, он винит его жену…','Нет данных'),(9028,'В случае убийства набирайте «М»',1954,105,0.0,8.1,34514,'1954-05-19','https://st.kp.yandex.net/images/film_iphone/iphone360_9028.jpg','Dial M for Murder','Тони Вендис, бывший плейбой и звезда большого тенниса, прожигающий деньги своей красавицы-жены Марго, решается на преступление, когда узнает, что может лишиться ее миллионов, так как Марго увлеклась американским писателем детективных романов Марком Холлидэем.<br><br>Тони придумывает план идеального убийства, находит надежного исполнителя и организует себе безупречное алиби. Он предусматривает все, кроме необычного поведения Марго и аналитических способностей Марка…','$1 400 000'),(9029,'Могамбо',1953,116,0.0,7.4,1019,'1953-09-23','https://st.kp.yandex.net/images/film_iphone/iphone360_9029.jpg','Mogambo','Кения, центральная Африка. Профессиональный охотник и авантюрист Виктор Марсуэлл помогает группам туристов и антропологов преодолевать бескрайние просторы саванны и непроходимые заросли черного континента. Во время одной из экспедиций он встречает Келли, танцовщицу из варьете, которая намного младше его.<br><br>Между ними завязывается бурный роман, который будет прерван прибытием в поселок семейной пары Нордли. Антрополог Доналд и его чопорная, и на вид неприступная, жена Линда, прибыли для изучения жизни горилл и шимпанзе. Любвеобильный Виктор решает приударить за неприступной женой ученого и не безуспешно. Этот авантюрный поступок причинит боль Келли, но приведет к неожиданной развязке в сложившемся любовном треугольнике.','Нет данных'),(9030,'Четырнадцать часов',1951,92,0.0,7.1,274,'1951-03-01','https://st.kp.yandex.net/images/film_iphone/iphone360_9030.jpg','Fourteen Hours','Молодой человек, морально уничтоженный ненавистью к нему со стороны собственных родителей и своей неспособностью сделать счастливой его девушку, поднимается на карниз здания с намерением покончить жизнь самоубийством. К нему на помощь приходит полицейский, который пытается отговорить его от рокового шага в бездну…','Нет данных'),(9043,'Давно пора',1960,103,0.0,6.7,87,'1960-09-16','https://st.kp.yandex.net/images/film_iphone/iphone360_9043.jpg','High Time','51-летний богатый ресторатор и вдовец Гарви Говард преподносит своей семье неожиданный сюрприз — решает получить высшее образование. Взрослые дочь и сын — в шоке, но отец непреклонен. Отлично сдав экзамены в институт, он селится в общежитии и с головой погружается в учебу. А вскоре попадает в тройку лучших студентов и завоевывает искреннее уважение сокурсников. К тому же, у него завязываются романтические отношения с преподавателем французской литературы профессором Элен Готье…','Нет данных'),(9044,'Займемся любовью',1960,119,0.0,7.5,3079,'1960-09-08','https://st.kp.yandex.net/images/film_iphone/iphone360_9044.jpg','Let\'s Make Love','Миллиардер Жан-Марк Клеман — потомственный бизнесмен и привлекательный мужчина. Он умеет делать деньги и очень любит женщин. Жан-Марк привык блистать в обществе и считает, что для него нет ничего невозможного.<br><br>Получив шокирующее известие о том, что он — «гений бизнеса» — станет объектом насмешек в юмористическом спектакле, Клеман решает самостоятельно разобраться с проблемой и едет в театр. Там он встречает красавицу Аманду и влюбляется в нее. Чтобы добиться расположения гордой девушки, миллиардер вынужден скрывать свое имя, выдавая себя за бедного актера — исполнителя роли Клемана в спектакле. Закручивается великолепная интрига, в центре которой оказывается герой, который должен играть самого себя.<br><br>Серьезному бизнесмену нужно научиться быть смешным, и это оказывается для него большим испытанием. Но для Клемана ведь «нет ничего невозможного». Особенно теперь, когда в сердце миллиардера-плейбоя впервые проникла настоящая, большая любовь.','Нет данных'),(9046,'Легенда Сонной лощины',1949,34,0.0,7.8,654,'1949-10-08','https://st.kp.yandex.net/images/film_iphone/iphone360_9046.jpg','The Legend of Sleepy Hollow','В маленьком городке появляется новый учитель, заядлый сердцеед. Начав ухлестывать за первой красавицей, он не предполагал, что его ждёт встреча со страшным Всадником без головы.','Нет данных'),(9048,'Что бы ни случилось',1956,106,0.0,7.0,92,'1956-11-15','https://st.kp.yandex.net/images/film_iphone/iphone360_9048.jpg','Anything Goes','Билл Бенсон и Тэд Адаме должны выступить совместно в большом Бродвейском шоу. Для подготовки своих номеров они отправляются в Париж, где каждый из них в тайне от другого ищет партнершу для номера и, конечно же, находит. Билл блондинку — американку Патси Блэр, а Тэд брюнетку — француженку Габи Дюваль.<br><br>Обе девушки великолепно танцуют и поют, и каждая из них может стать именно той звездой, которую полюбит вся Америка, но роль солистки только одна. Каждый из парней в тайне от другого приглашает свою претендентку на главную роль на борт трансконтинентального лайнера, который доставит их из Европы в Америку…','Нет данных'),(9049,'Светлое Рождество',1954,120,0.0,7.1,868,'1954-10-14','https://st.kp.yandex.net/images/film/9049.jpg','White Christmas','После окончания Второй мировой войны два бывших призывника Боб Уоллас и Фил Дэвис объединяют свои таланты, чтобы стать лучшим поющим танцевальным дуэтом в Америке. Концерты следуют один за другим, парни становятся все популярней, и гастрольный график расписан на много дней вперед.<br /><br />Однажды они знакомятся с женским дуэтом сестер Бетти и Джуди, и это знакомство приведет молодых людей к идее создать квартет и выступить в рождественский сочельник с концертом в поддержку дома отдыха для лыжников, которым управляет их бывший командир ― отставной генерал Уоверлай.','Нет данных'),(9052,'Дорога на Бали',1952,91,0.0,6.1,156,'1952-11-19','https://st.kp.yandex.net/images/film/9052.jpg','Road to Bali','Боб и Бинг второпях покидают Мельбурн, чтобы не попасть под брачный колпак, и нанимаются ныряльщиками. Судьба приводит их к идиллическому острову на пути к Бали, где они начинают соперничать друг с дургом, чтобы попасть под покровительство Принцессы Лалы.<br><br>Во время опасных погружений они достают со дна сундук с бесценными драгоценностями, Этот случай привлекает к ним внимание со стороны некоторых менее романтичных местных жителей…','Нет данных'),(9055,'Жених возвращается',1951,113,0.0,6.6,118,'1951-09-20','https://st.kp.yandex.net/images/film/9055.jpg','Here Comes the Groom','Питер Гарвей — парижский корреспондент газеты Бостонский Утренний Экспресс, пишущий еженедельную колонку о детях — военных сиротах. Его рабочий кабинет находится в приюте, где он постоянно окружен французскими детьми, ждущими усыновления. Неожиданно раздаётся телефонный звонок главного редактора Джорджа Дегнан, который требует, чтобы Питер отправился на «дальний восток» для ведения репортажей из «горячей точки».<br> <br>Но у героя иные планы. Он решает вернуться в Америку, потому что его невеста Эмми прислала звуковое письмо, в котором на высоких тонах объяснила что её терпению пришел конец, она хочет замуж, кочет иметь детей и если бы ситуация была бы мной, то их старший сын пошел бы в пятый класс. Собрав чемодан и получив право усыновления, Питер, взяв из приюта пятиклассника Бобби и дошкольницу Сюзи, вылетает в Штаты.<br> <br>Но его время упущено, Эмми уже собралась замуж за миллионера Уилбура Стэнли. Питер не из тех парней, которые уступают своих любимых каким-то там миллионерам. Он намерен скрепить себя узами брака именно с Эмми, тем более срок усыновления приближается к концу…','Нет данных'),(9058,'Приключения Икабода и мистера Тоада',1949,68,0.0,7.2,2090,'1949-10-05','https://st.kp.yandex.net/images/film_iphone/iphone360_9058.jpg','The Adventures of Ichabod and Mr. Toad','Это сказка о настоящей дружбе, о необыкновенных и очень опасных приключениях веселого лягушонка и его друзей, находчивость и смекалка которых помогают ему в самую трудную минуту.<br><br>В деревушке под названием Сонная Лощина поселяется необычный человек по имени Икабод Крэйн. Как-то раз ему рассказывают легенду о таинственном всаднике без головы, который обезглавливает свои жертвы…','Нет данных'),(9060,'Янки при дворе короля Артура',1949,106,0.0,6.4,164,'1949-04-07','https://st.kp.yandex.net/images/film_iphone/iphone360_9060.jpg','A Connecticut Yankee in King Arthur\'s Court','Дело было в начале двадцатого века — жил, не тужил в штате Коннектикут, на американском континенте простой и не амбициозный кузнец по имени Хэнк Мартин, трудился себе спокойно в собственной мастерской, да заодно изучал устройство сногсшибательной новинки автомобиля.<br><br>И вот как-то он очень торопился и выехал из дома на лошадке в жуткую грозу. Скакал он быстро, поторапливал кобылку, но тут ударила молния, наш герой упал, потерял сознание. Очнулся и…','Нет данных'),(9061,'Императорский вальс',1948,106,0.0,6.3,175,'1948-04-30','https://st.kp.yandex.net/images/film/9061.jpg','The Emperor Waltz','Путешествующий по Европе продавец фонографов американец Вирджил Смит вместе со своей смешной собакой по кличке Блич оказывается в Австрии. В целях рекламы и для увеличения продаж, он хочет предложить фонограф Францу Джозефу — императору Австрии. Дворцовая стража арестовывает героя, принимая чудо-прибор за бомбу.<br><br>После обычных недоразумений все встает на свои места, и Смит знакомится с графиней Джоанной Августой, которая производит на него неизгладимое впечатление.<br><br>Бизнесмен начинает настойчиво ухаживать за графиней, а его пес Блич за королевским пуделем. Но отношений между графиней и обычным американским гражданином не может существовать в Австрии, по мнению Императора, однако у американца на это свой взгляд.','Нет данных'),(9062,'Дорога в Рио',1947,100,0.0,6.3,80,'1947-12-25','https://st.kp.yandex.net/images/film/9062.jpg','Road to Rio','Два друга-авантюриста Скат и Хотлипс после долгих скитаний по Америке решают отправиться в Рио. На корабле они знакомятся с милой несчастной девушкой, невестой перфекта Бриджпорта. Она не любит своего жениха, но что-то необъяснимое мешает ей отказаться от свадьбы. Друзья решают помочь Люсии, еще не зная, какие опасные приключения ждут их.<br><br>Шутки Хотлипса и Ската не оставят никого равнодушным, а музыкальная обработка картины даст фору любому современному фильму. И, конечно же, все кончится хорошо, ведь вопреки своей любви к деньгам, в этот раз друзья действуют от чистого сердца.','Нет данных'),(9064,'Голубые небеса',1946,99,0.0,6.9,120,'1946-09-27','https://st.kp.yandex.net/images/film/9064.jpg','Blue Skies','Танцовщик и певец Джед Поттер оглядывается назад на любовный треугольник, длившийся много лет, в котором он играл роль «третьего лишнего». Он влюблен в актрису Мэри О`Хара, а она любит импульсивного владельца ночного клуба Джонни Адамса, который непостоянен в своих привязанностях и нигде не задерживается надолго.','Нет данных'),(9068,'Принцесса и пират',1944,94,0.0,6.6,95,'1944-11-17','https://st.kp.yandex.net/images/film_iphone/iphone360_9068.jpg','The Princess and the Pirate','На одном и том же фрегате Британского Королевского флота плыли неудачливый бродячий актер Сильвестр (Боб Хоуп) и скрывавшаяся от своей королевской семьи принцесса Маргарет, но ужасный пират по кличке Хук, имеющий вместо руки металлический крюк, захватывает корабль и требует у королевской семьи выкуп за принцессу.<br><br>Между тем, переодетый в цыганку Сильвестр, демонстрируя тупость, трусость и плоское чувство юмора, но все-таки, устраивает побег с пиратского парусника и спасает принцессу, надеясь на ее взаимное чувство к нему.','Нет данных'),(9071,'Дорога в Марокко',1942,82,0.0,6.3,219,'1942-11-10','https://st.kp.yandex.net/images/film/9071.jpg','Road to Morocco','Оставшиеся в живых после кораблекрушения безбилетные пассажиры Джефф и Орвайл попадают на северо-африканское побережье и скачут на верблюдах через пустыню в Морокко. В надежде купить еду, Джефф продает Орвайл в рабство, но владелицей Орвайла оказывается принцесса Шалмар, которая освобождает его и становится его женой. Но не бескорыстно…','Нет данных'),(9072,'Праздничная гостиница',1942,100,0.0,6.9,729,'1942-07-31','https://st.kp.yandex.net/images/film_iphone/iphone360_9072.jpg','Holiday Inn','Мюзикл, о певце и танцоре Джиме Харди, который оставляет шоу-бизнес, чтобы стать фермером-джентльменом в Новой Англии. Однако фермерская жизнь, оказывается для него слишком трудной и обыденной, и, пытаясь «убить двух зайцев», герой превращает свою ферму в загородный развлекательный клуб, широко открывающий двери в дни национальных праздников и торжеств. Его заведение можно назвать прообразом будущего советского «Голубого огонька».','$3 200 000'),(9075,'Дорога на Занзибар',1941,91,0.0,6.3,70,'1941-04-11','https://st.kp.yandex.net/images/film_iphone/iphone360_9075.jpg','Road to Zanzibar','Два друга — Хьюберт и Чак, путешествуя по Африке исполняют различные фокусы и незамысловатые цирковые представления, зарабатывая деньги на хлеб и на билеты в Соединенные Штаты. Но эти два недалеких парня периодически попадают то в лапы мошенников то ввязываются в случайные передряги и их возвращение домой постоянно затягивается. Однако благодаря своему артистизму их приключения не только хорошо заканчиваются, но и дарят им любовь очаровательных девушек.','Нет данных'),(9078,'Дорога в Сингапур',1940,85,0.0,6.1,79,'1940-03-14','https://st.kp.yandex.net/images/film/9078.jpg','Road to Singapore','Двух друзей Джорджа Маллона и Эйса Ванигана принуждают жениться. Одного деятельная невеста, мечтающая получить вместе с мужем богатства семейства Маллон, другого влиятельная семья Черри.<br><br>Но парни, дав, друг -другу клятву, что больше не будут заглядываться на девушек, сбегают в Сингапур Однако именно в Сингапуре они встречают танцовщицу Мимму и оба влюбляются в нее. На нее претендует и ее партнер Цезарь, он всячески строит козни, но на этом их приключения только начинаются.','Нет данных'),(9095,'По дороге в Голливуд',1933,78,0.0,6.1,77,'1933-12-22','https://st.kp.yandex.net/images/film_iphone/iphone360_9095.jpg','Going Hollywood','Сильвия, учительница французского в школе для девочек, отправляется в Голливуд, услышав голос Билла «Билли» Уильямса по радио. Там она устраивается в хор, а затем предпринимает попытку получить роль в фильме Билли…','Нет данных'),(9105,'Гудзонский ястреб',1991,100,0.0,7.1,30092,'1991-05-24','https://st.kp.yandex.net/images/film_iphone/iphone360_9105.jpg','Hudson Hawk','«Гудзонский Ястреб» — прозвище непревзойденного вора Эдди, который может открыть любой сейф за считанные секунды. Выйдя из тюрьмы, король кражи решает уйти на заслуженный отдых. Но слишком многие на свободе заинтересованы в его криминальном таланте.<br><br>С помощью шантажа коварные злоумышленники заставляют Эдди совершить ограбление века: он должен похитить три шедевра Леонардо Да Винчи из самых охраняемых музеев мира всего за несколько дней! «Гудзонский Ястреб» снова отправляется на охоту, но на этот раз в бескрайнем небе он не одинок…','$65 000 000'),(9108,'Бен',1972,94,0.0,5.9,95,'1972-06-21','https://st.kp.yandex.net/images/film_iphone/iphone360_9108.jpg','Ben','Молодой парень Дэвид Гаррисон связывается с бандой крыс, обученных и натренированных опасным и ужасным Беном.','Нет данных'),(9111,'Семейный заговор',1976,120,0.0,7.1,2014,'1976-03-21','https://st.kp.yandex.net/images/film_iphone/iphone360_9111.jpg','Family Plot','«Семейный заговор» — остросюжетное, остроумное и вообще весьма острое блюдо для гурманов и поклонников старика Хича, где непревзойденный кинокулинар в последний раз изысканно смешал поджог, похищение, ограбление и… убийство.','$4 490 375'),(9112,'Безумие',1972,116,0.0,7.5,4797,'1972-05-19','https://st.kp.yandex.net/images/film_iphone/iphone360_9112.jpg','Frenzy','Ричард Блени обвиняется в совершении серии убийств женщин, которые найдены задушенными мужскими галстуками. Подозрение падает на него после того, как обнаружены тела его бывшей жены и подружки. Дело кажется настолько очевидным, что полиции не составляет труда получить ордер на арест Блени. Однако после того как Ричарда приговорили к тюремному заключению сроком на 25 лет, инспектор Оксфорд, проводивший расследование, начинает сомневаться в его виновности и продолжает поиски убийцы…','$2 000 000'),(9113,'Топаз',1969,143,0.0,6.2,1137,'1969-12-17','https://st.kp.yandex.net/images/film/9113.jpg','Topaz','Агенты американской и французской разведок пытаются разоблачить советских шпионов на Кубе. По полученной информации, советский разведчик внедрился в структуру НАТО. Им предстоит узнать, кто скрывается под кличкой «Топаз». Проведенное расследование приводит агентов в высшие эшелоны Французского правительства…','$4 000 000'),(9114,'Разорванный занавес',1966,128,0.0,6.7,1497,'1966-07-14','https://st.kp.yandex.net/images/film_iphone/iphone360_9114.jpg','Torn Curtain','Майкл Армстронг — американский профессор-физик — разрабатывает новый вид ядерных ракет. Для того чтобы узнать секретную формулу конкурента, ученого Густава Линдта из Лейпцига, Армстронг временно переезжает в Восточную Германию.','$6 000 000'),(9115,'Марни',1964,130,0.0,7.6,6851,'1964-07-09','https://st.kp.yandex.net/images/film_iphone/iphone360_9115.jpg','Marnie','Героиня фильма Марни Эдгар устраивается на работу в различные фирмы под чужим именем и, проработав некоторое время, исчезает с деньгами компаний, не оставляя никаких следов. Она неуловима, так как постоянно меняет не только имена, но и внешность. Марк Ратлэнд, деловой партнер одной из бывших жертв Марни, разоблачает ее, когда она устраивается к нему на работу. Но вместо того, чтобы сдать Марни полиции, Марк шантажом заставляет ее выйти за него замуж. Он узнает о глубоко сидящем в ней страхе перед мужчинами, сексом, грозами и красным цветом…','$3 000 000'),(9116,'Не тот человек',1956,105,0.0,7.6,3288,'1956-12-22','https://st.kp.yandex.net/images/film_iphone/iphone360_9116.jpg','The Wrong Man','История музыканта Мэнни Балестреро — человека, переполненного скрытой яростью из-за своего ошибочного ареста. Его подавленную горем жену Роуз суровые испытания доводят до сумасшествия…','$1 200 000'),(9117,'Я исповедуюсь',1953,95,0.0,7.6,2396,'1953-02-12','https://st.kp.yandex.net/images/film_iphone/iphone360_9117.jpg','I Confess','Отец Майкл Логан, казалось бы, — образец церковной добродетели, выслушивает исповедь убийцы. Показания свидетелей указывают на то, что главный подозреваемый — сам священник, но сан запрещает Логану разглашать тайну исповеди даже ради собственного алиби.','Нет данных'),(9118,'Страх сцены',1950,110,0.0,7.6,2577,'1950-02-23','https://st.kp.yandex.net/images/film_iphone/iphone360_9118.jpg','Stage Fright','Ева Джилл — студентка, которая решилась сыграть главную роль своей жизни, чтобы снять подозрения в убийстве со своего друга, которого подвела под них звезда сцены Шарлотта Инвуд. Какова ее роль? Стать служанкой Шарлотты, чтобы узнать правду. Но наивной Еве предстоит узнать, что жизнь часто не следует написанному сценарию.','Нет данных'),(9119,'Дело Парадайна',1947,125,0.0,6.9,1314,'1947-12-30','https://st.kp.yandex.net/images/film/9119.jpg','The Paradine Case','Известный адвокат и примерный семьянин Энтони Кин защищает роковую красавицу Мадлену Парадайн, обвиняемую в убийстве собственного слепого мужа. Энтони без памяти влюбляется в свою подзащитную. Но не у одного адвоката есть личные мотивы в этом запутанном деле. Безжалостный судья тоже имеет свой личный интерес…','$4 258 000'),(9121,'Приключение мальгаче',1944,32,0.0,5.8,138,'2006-04-21','https://st.kp.yandex.net/images/film/9121.jpg','Aventure malgache','Актер рассказывает о своем участии в движении Сопротивления, работе нелегальной радиостанции и увиливании от нацистов.','Нет данных'),(9122,'Счастливого пути',1944,26,0.0,6.3,149,'2006-06-14','https://st.kp.yandex.net/images/film/9122.jpg','Bon Voyage','Летчик Военно-воздушных сил Великобритании совершает побег с оккупированной немцами территории.','Нет данных'),(9123,'Спасательная шлюпка',1944,97,0.0,7.7,2758,'1944-01-11','https://st.kp.yandex.net/images/film_iphone/iphone360_9123.jpg','Lifeboat','Вторая мировая война. Немецкая подводная лодка торпедирует корабль. В результате оба судна тонут. Оставшиеся в живых пассажиры корабля оказываются в небольшой спасательной шлюпке. Последним к переполненной лодке подплывает капитан немецкой субмарины. Его берут на борт в надежде, что он, как опытный моряк сможет привести шлюпку в безопасную гавань.','$1 590 000'),(9124,'Диверсант',1942,109,0.0,7.2,1326,'1942-04-22','https://st.kp.yandex.net/images/film_iphone/iphone360_9124.jpg','Saboteur','Несмотря на пропагандистскую окраску фильма, обусловленную временем, когда он снимался, эта замечательная хичкоковская история о человеке, ошибочно обвиненном в диверсии, и который пересекает половину страны, чтобы найти настоящих преступников.','Нет данных'),(9125,'Мистер и миссис Смит',1941,95,0.0,7.0,2066,'1941-01-31','https://st.kp.yandex.net/images/film/9125.jpg','Mr. & Mrs. Smith','Дэвид и Энн Смит начали свою совместную жизнь с весьма необычной свадьбы и подписания брачного контракта со множеством правил и условий. Согласно одному из них, супруги раз в месяц задают друг другу по одному вопросу, ответ на который должен быть абсолютно правдивым. И вот однажды Энн спрашивает Дэвида, женился бы он на ней, если бы судьба снова предоставила ему такую возможность.<br><br>Муж честно признался, что брак ему в тягость, семья ограничивает его свободу, и он десять раз подумал бы перед тем, как жениться еще раз. Так случилось, что именно в этот день чиновник из мэрии решил, что из-за сложностей с определением административных границ районов все браки, заключенные между 1936 и 1939 годами, считаются недействительными.<br><br>Дэвид решил обратить эту абсурдную ситуацию в шутку, однако он не подозревал, что то же самое чиновник рассказал его жене…','Нет данных'),(9126,'Иностранный корреспондент',1940,120,0.0,7.3,1421,'1940-08-16','https://st.kp.yandex.net/images/film_iphone/iphone360_9126.jpg','Foreign Correspondent','Джон Джонс — американский корреспондент, направленный в Европу, чтобы побольше узнать о голландско-бельгийском договоре, имеющем большое политическое значение накануне предстоящей войны. В Европе он становится свидетелем похищения голландского дипломата Ван Меера, знающего некий тайный пункт в этом договоре.','Нет данных'),(9128,'Таверна «Ямайка»',1939,90,0.0,6.7,746,'1939-05-12','https://st.kp.yandex.net/images/film_iphone/iphone360_9128.jpg','Jamaica Inn','Мэри, осиротев, приезжает на побережье Корнуолла к своим дяде и тётке, содержащим таверну «Ямайку». Вскоре Мэри понимает, что таверна является базой для банды, грабящей суда, разбившиеся о скалистый берег. Жизни сироты угрожает опасность, однако среди головорезов есть человек, готовый помочь девушке.','Нет данных'),(9129,'Молодой и невинный',1937,83,0.0,7.1,998,'1938-02-10','https://st.kp.yandex.net/images/film_iphone/iphone360_9129.jpg','Young and Innocent','Роберт Тисдолл становится главным подозреваемым по делу об убийстве актрисы. Все улики складываются не в его пользу — девушка задушена поясом от его плаща. Дело ведет полицейский полковник Бергойн, уверенный в виновности Роберта.<br><br>Но дочь полицейского, очаровательная Эрика, считает, что расследование пошло по ложному пути, и у молодых людей завязывается романтическое чувство…','Нет данных'),(9130,'Саботаж',1936,76,0.0,7.1,1165,'1936-12-02','https://st.kp.yandex.net/images/film_iphone/iphone360_9130.jpg','Sabotage','Саботажник Карл Верлок, скрываясь под маской общительного владельца кинотеатра, проводит серию диверсий в Лондоне. Почувствовав, что находится под наблюдением сыщика Теда Спенсера, он просит мальчика Стиви, младшего брата его жены, доставить на другой конец города сверток. Это бомба с часовым механизмом…','Нет данных'),(9131,'Секретный агент',1936,86,0.0,7.0,876,'1936-06-12','https://st.kp.yandex.net/images/film/9131.jpg','Secret Agent','Действие происходит во время Первой мировой войны. Британский агент Эдгар Броди послан правительством в Швейцарию для ликвидации немецкого агента. В сопровождении Эльзы Кэррингтон, под видом его жены, и мексиканца — киллера они останавливаются в отеле.<br><br>В результате ошибки был убит не тот человек, а немецкий агент остался невредимым. В руке у убитого осталась оторванная пуговица, которая и послужила причиной роковой ошибки.','Нет данных'),(9132,'Человек, который слишком много знал',1934,75,0.0,6.9,1412,'1934-12-09','https://st.kp.yandex.net/images/film/9132.jpg','The Man Who Knew Too Much','Боб и Джилл Лоуренс проводят отпуск в Швейцарских Альпах вместе со своей дочерью Бетти. На глазах у супружеской пары погибает их новый знакомый — француз Луи Бернар. Перед смертью он успевает прошептать Бобу несколько слов о готовящемся шпионском заговоре.<br><br>Для того чтобы Боб молчал, злоумышленники похищают и держат в заложниках его дочь. Супруги должны спасти своего ребенка и выполнить гражданский долг — не допустить покушения на известного дипломата.','£40 000'),(9134,'Номер семнадцать',1932,66,0.0,6.2,407,'1932-07-18','https://st.kp.yandex.net/images/film_iphone/iphone360_9134.jpg','Number Seventeen','Несколько тёмных личностей собираются тайком покинуть страну, но они не знают, что полицейский детектив уже сидит у них на хвосте.','Нет данных'),(9135,'Богатые и странные',1931,81,0.0,6.2,367,'1931-12-10','https://st.kp.yandex.net/images/film_iphone/iphone360_9135.jpg','Rich and Strange','Герои фильма, муж и жена, — люди среднего класса, сравнительно невысокого достатка. Если жена довольна семейным уютом, то муж всегда раздражен материальной и духовной ограниченностью существования и произносит гневные речи о необходимости многое испытать, постранствовать, пережить приключения, о полноте жизни, которой он лишен. В этом нетрудно узнать пародию на целый комплекс романтических идей 19 века, вечную фаустовскую неудовлетворенность, стремление в даль.','Нет данных'),(9136,'Грязная игра',1931,78,0.0,6.4,356,'1931-02-26','https://st.kp.yandex.net/images/film_iphone/iphone360_9136.jpg','The Skin Game','Ушедший на покой англичанин продает свое поместье шотландцу. Тот обещает построить фабрику и возвести дома для рабочих, но слово свое не сдерживает. Аристократическая семья сочла это подлой игрой.<br><br>Для того чтобы утвердить моральные права семьи и принудить покупателя выполнить данные обязательства, жена англичанина начинает искать компрометирующие факты в прошлом золовки шотландца…','Нет данных'),(9140,'Мэри',1931,78,0.0,6.3,164,'1931-03-02','https://st.kp.yandex.net/images/film_iphone/iphone360_9140.jpg','Mary','После вынесения обвинительного приговора по делу об убийстве, один из присяжных сомневается в правильности вердикта и начинает собственное расследование, пока приговор не привели в исполнение…','Нет данных'),(9141,'Убийство!',1930,100,0.0,6.8,530,'1930-07-31','https://st.kp.yandex.net/images/film_iphone/iphone360_9141.jpg','Murder!','Полицейские находят актрису Диану Бэринг рядом с телом другой актрисы. Присяжные выносят приговор — виновна. Такое решение не может устроить лишь одного человека из состава присяжных — сэра Джона Менира, которого прекрасно играет Герберт Маршалл. Он начинает собственное расследование.','Нет данных'),(9143,'Человек с острова Мэн',1929,110,0.0,6.6,276,'1929-01-21','https://st.kp.yandex.net/images/film_iphone/iphone360_9143.jpg','The Manxman','Несмотря на разницу в происхождении, рыбак Пит и адвокат Филип — друзья с детства. Пит любит Кейт, дочь местного трактирщика, и хочет на ней жениться. Но её отец и слышать ничего не желает, так как не считает Пита равной партией своей дочери. Тогда Пит покидает остров, пообещав, что вернется, когда разбогатеет. Перед отъездом он просит Филипа присмотреть за Кейт, тем самым разбудив их симпатии друг к другу…','Нет данных'),(9144,'Шантаж',1929,85,0.0,7.2,1099,'1929-07-28','https://st.kp.yandex.net/images/film_iphone/iphone360_9144.jpg','Blackmail','Элис Уайт — молодая англичанка, которой предстоит выйти замуж за детектива Фрэнка Уэббера. Но ее влечет к красивому художнику, невольной убийцей которого она становится, когда он пытается силой заставить ее позировать обнаженной. А потом Элис начинают шантажировать. Ее жених возглавляет расследование убийства…','Нет данных'),(9145,'Шампанское',1928,86,0.0,6.1,334,'1928-08-20','https://st.kp.yandex.net/images/film_iphone/iphone360_9145.jpg','Champagne','Бетти, дочь миллионера, хочет выйти замуж за бедного Жана против воли отца. Она убегает во Францию, где живет в роскоши на деньги от отцовского предприятия — производства шампанского. Чтобы проучить непослушную дочь, миллионер сообщает ей о своем банкротстве. Теперь Бетти придется самой искать средства к существованию. Девушка устраивается на работу в ночной клуб…','Нет данных'),(9146,'Жена фермера',1928,112,0.0,6.0,313,'1928-03-02','https://st.kp.yandex.net/images/film/9146.jpg','The Farmer\'s Wife','Фермер Самуэль Свитланд — пожилой вдовец решает вновь жениться, его выбор падает на трех соседок живущих неподалеку от его усадьбы. Наш герой, опасаясь поступить опрометчиво в выборе будущей спутницы жизни, берет в качестве консультанта по вопросу, — «кто на свете всех милее» свою горничную Араминду — скромную девушку, живущую и работающую в его доме.','Нет данных'),(9147,'Легкое поведение',1927,80,0.0,6.2,380,'1928-03-05','https://st.kp.yandex.net/images/film_iphone/iphone360_9147.jpg','Easy Virtue','Муж Лариты Филтон подает на развод, обвинив её в любовной связи с художником, рисовавшим ее портрет. Во время судебного процесса художник, на самом деле отвергнутый Ларитой, кончает жизнь самоубийством. Униженная и потрясенная, Ларита убегает на юг Франции, где живет под вымышленным именем и пытается начать жизнь с нуля. На французской Ривьере Ларита влюбляется в богатого молодого человека Джона Уиттакера, который женится на ней, не желая ничего знать о ее прошлом «женщины легкого поведения». Однако семья Уиттакера с самого начала настроена против этого брака…','Нет данных'),(9148,'По наклонной плоскости',1927,74,0.0,6.2,352,'1927-10-24','https://st.kp.yandex.net/images/film_iphone/iphone360_9148.jpg','Downhill','Ученика элитной школы Родди Бервика по недоразумению обвиняют в воровстве. Школьные власти изгоняют его, отец не желает его больше видеть. К счастью, умершая родственница оставляет ему небольшое наследство, но неопытный юнец попадает в руки ловких мошенников: полукуртизанки-полуактрисы и ее любовника, которые очень быстро оставляют его без гроша в кармане…','Нет данных'),(9149,'Ринг',1927,89,0.0,6.6,374,'1927-10-01','https://st.kp.yandex.net/images/film_iphone/iphone360_9149.jpg','The Ring','Боксер Боб Корби победил Джека Сандерса в его аттракционном боксе и пригласил работать к себе в качестве спарринг-партнера. Но причиной такой внезапной дружбы послужила девушка Джека — Мейбл. Они стали встречаться втайне от него, что, тем не менее, не помешало Мейбл выйти замуж за Джека. Лишь спустя несколько лет, став успешным спортсменом Сандерс узнает об их тайной связи и вызывает Боба на ринг…','Нет данных'),(9150,'Жилец',1927,90,0.0,7.5,1321,'1927-02-14','https://st.kp.yandex.net/images/film_iphone/iphone360_9150.jpg','The Lodger','В Лондоне объявился новый серийный убийца, нападающий по ночам на молодых блондинок и оставляющий на месте преступления клочки бумаги с подписью «Мститель». В то время как весь город взбудоражен этими событиями, в одном из домов появляется мужчина с признаками нервного расстройства и снимает там комнату. Владельцы дома, их дочь Дейзи и её возлюбленный Джо, полицейский, расследующий серию убийств, обращают внимание на странное поведение нового жильца.','£12 000'),(9152,'Сад наслаждений',1925,75,0.0,6.1,504,'1925-11-03','https://st.kp.yandex.net/images/film_iphone/iphone360_9152.jpg','The Pleasure Garden','Пэтси, танцовщица из театра под названием «Сад наслаждений», устраивает на работу в труппу свою приятельницу Джил. Джил помолвлена с Хью, который работает в колониях.<br><br>Пэтси выходит замуж за Леветта, коллегу Хью, и, проведя медовый месяц на озере Комо, Леветт тоже отплывает в те края. Джил, которая весело проводит время в Лондоне, пользуясь успехом у мужчин, откладывает поездку в колонии, где ее ждет жених. Пэтси остается верна своему мужу, и, получив письмо о его болезни, уезжает к нему. Но на месте она узнает, что Леветт попал под влияние местной жительницы…','Нет данных'),(9180,'Бегущая мишень',1996,106,0.0,5.0,154,'1996-11-27','https://st.kp.yandex.net/images/film/9180.jpg','Moving Target','Безденежье толкает обыкновенного работягу Майкла в темный мир организованной преступности. Сначала он выполняет мелкие поручения мафии, но наконец-то ему поручили серьезное дело. Майкл и его партнер должны доставить крупную партию денег в Бруклин.<br><br>Но по дороге приятели тратят часть денег на девочек, в надежде, что это пройдет незамеченным. Но бандиты обнаруживают недостачу и курьеров превращают в живые мишени. Впрочем, за ними охотится и полиция, которая следит за бандой.','Нет данных'),(9183,'Маска смерти',1996,89,0.0,5.5,164,'1996-02-11','https://st.kp.yandex.net/images/film/9183.jpg','Mask of Death','Во время перестрелки с членами известной преступной группировки Дэниел Маккена, полицейский, не находившийся в тот момент на дежурстве, теряет жену и получает пулю в лицо. Благодаря волшебству пластической хирургии, Маккена получает внешность Лайла Мейсона, одного из членов группировки.<br><br>Маккена идет на это добровольно — с тем, чтобы отомстить за гибель жены. Но об этом никто не предупредил Касс Тернер, сексуальную и опасную напарницу Маккены, которая тайно мечтает о мести.<br><br>И теперь Маккена (он же — Мейсон) должен помешать преступникам заполучить ценный микрочип и в то же время не стать жертвой своей бывшей напарницы, которая не узнает его и хочет убить…','$2 500 000'),(9186,'Сумасшедшая история',1991,87,0.0,5.1,92,'1991-05-16','https://st.kp.yandex.net/images/film_iphone/iphone360_9186.jpg','Driving Me Crazy','Что движется со скоростью 200 миль в час, работает на овощах и не отравляет окружающую среду? Это «Трабби» — самый нелепый автомобиль на свете, но ездит он — что надо! Эксцентричный, похожий на Пьера Ришара механик Гюнтер Шмидт из Восточной Германии отправляется в Лос-Анджелес продавать изобретенную им чудо-машину…','Нет данных'),(9188,'Город страха',1984,96,0.0,6.0,297,'1984-07-18','https://st.kp.yandex.net/images/film_iphone/iphone360_9188.jpg','Fear City','Нью-Йорк, Манхетен. Функционирует круглосуточно. Мир стрип-баров, денег и порочного обаяния. Здесь удовольствие является бизнесом и ночь принадлежит девушкам из стриптиза — шоугелз.<br><br>Стриптизерок поджидает в засаде сексуальный маньяк, жестоко убивающий самых горячих и привлекательных. Одному из сутенеров приходится самому выйти на охоту за убийцей, так как усилий полиции явно недостаточно, тем более, что на стороне преступника оказывается один из полицейских.','Нет данных'),(9195,'Леди поет блюз',1972,144,0.0,7.5,194,'1972-10-12','https://st.kp.yandex.net/images/film_iphone/iphone360_9195.jpg','Lady Sings the Blues','История о тяжелой жизни одной из величайших певиц в истории джаза — Билли Холидей, скончавшейся в 1959 году от передозировки наркотиков.','Нет данных'),(9197,'Приезжие',1969,93,0.0,7.3,427,'1970-05-28','https://st.kp.yandex.net/images/film_iphone/iphone360_9197.jpg','The Out of Towners','Джордж Келлерман и его жена отправляются в Нью-Йорк, где Джордж собирается найти новую работу. Но во время этой поездки все пошло наперекосяк…','Нет данных'),(9199,'Братья Блюз 2000',1998,123,0.0,6.5,1927,'1998-02-06','https://st.kp.yandex.net/images/film_iphone/iphone360_9199.jpg','Blues Brothers 2000','Элвуд Блюз выходит из тюрьмы и обнаруживает, что на воле уже все не так, как раньше. Его партнер Джейк на том свете, ансамбль распался, а сиротский приют, где он провел свои юные годы, отдали под слом.<br><br>И вот Элвуд загорается новой затеей — воссоздать свою группу, на этот раз при помощи сентиментального бармена, чтобы победить на конкурсе «Битва ансамблей» и наставить попутно на путь истинный очаровательного маленького сиротку по имени Бастер.','$28 000 000'),(9200,'Остров сокровищ Маппетов',1996,99,0.0,6.0,249,'1996-02-16','https://st.kp.yandex.net/images/film_iphone/iphone360_9200.jpg','Muppet Treasure Island','Лягушонок Кермит и его друзья продолжают вести войну против безжалостных пиратов. А заодно они отправляются в большое морское путешествие, чтобы найти сокровища.','Нет данных'),(9201,'Рождественская сказка Маппетов',1992,89,0.0,6.4,749,'1992-12-06','https://st.kp.yandex.net/images/film_iphone/iphone360_9201.jpg','The Muppet Christmas Carol','Знаменитая история о скупом и черством Эбенизере Скрудже. Но здесь почти все роли играют знаменитые персонажи Маппет-шоу. Однажды рождественской ночью дядюшке Скруджу являются Дух Прошлых Лет, Дух Нынешних Святок и Дух Будущих Святок, которые заставляют его по-другому взглянуть на свою жизнь.','$12 000 000'),(9203,'Улица Сезам представляет: Иди за той птицей',1985,88,0.0,4.0,143,'1985-08-02','https://st.kp.yandex.net/images/film_iphone/iphone360_9203.jpg','Sesame Street Presents: Follow that Bird','Большая птица покинула свой дом на Улице Сезам, чтобы найти своих сородичей. Её соседи очень опечалены этой новостью, да и Большая птица вскоре тоже пожалеет об отъезде. Она и не знает, что скоро попадёт в опасную ситуацию. Однако верные друзья с Улицы Сезам не забыли о своей подруге и готовы примчаться на помощь!','Нет данных'),(9206,'Домохозяйка',1992,102,0.0,7.2,4021,'1992-06-12','https://st.kp.yandex.net/images/film_iphone/iphone360_9206.jpg','HouseSitter','Талантливый архитектор Ньютон Дейвис строит дом своей мечты в родном городке и предлагает его вместе с рукой и сердцем любимой девушке Бекки. Но Бекки отвергает и первое, и второе, и третье. Расстроенный Ньютон едет в Бостон, а дом остается пустовать.<br><br>В Бостоне Ньютон знакомится с красивой официанткой по имени Гвен. Их отношения длятся всего одну ночь, но история про бесхозяйное гнездышко западает в душу девушки…<br><br>Она едет в родной город Ньютона Дэйвиса и вселяется в дом, выдавая себя за жену архитектора. Она знакомится с его отцом и соседями, выписывает огромные счета на имя «мужа». Ньютон заезжает в родной город, чтобы погрустить в стенах пустующего дома, и попадает в кольцо кредиторов и соседей, поздравляющих его со вступлением в брак.<br><br>Бекки, отвергнувшая «свободного» Ньютона, моментально влюбляется в него, узнав, что он женат. Ньютон просит Гвен еще немножко «поиграть» роль его жены, чтобы окончательно завоевать сердце Бекки. Но вскоре он начинает понимать, что все знакомые и родственники очень любят Гвен.','Нет данных'),(9207,'А как же Боб?',1991,95,0.0,7.3,9047,'1991-05-17','https://st.kp.yandex.net/images/film_iphone/iphone360_9207.jpg','What About Bob?','Некоторых пациентов легче застрелить. Для психиатра Лео Марвина неуравновешенный Боб — всего лишь очередной больной. Несчастный врач и не подозревал, что эта встреча станет для него началом кошмара. Решив отдохнуть от дел, доктор с семьей уезжает в отпуск, наконец-то ему удалось избавиться от скучных будней и назойливых пациентов. Но счастье продлилось недолго — Боб соскучился по «доброму» психиатру и последовал за ним. Если доктор не избавится от навязчивого больного, ему очень скоро самому понадобится врач.','$35 000 000'),(9208,'Отпетые мошенники',1988,110,0.0,8.0,34544,'1988-12-14','https://st.kp.yandex.net/images/film_iphone/iphone360_9208.jpg','Dirty Rotten Scoundrels','Судьба сводит двух отпетых мошенников — Фредди Бенсона и Лоуренса Джемисона, специализирующихся в качестве жиголо в оболванивании богатеньких дам. В городке где-то на юге Франции Фредди сначала берет уроки у мэтра Лоуренса, но, повздорив, коллеги заключают пари: кто из них первый охмурит незнакомую богатую женщину, тот остается в городе, а проигравший должен убраться. <br><br>Предмет спора не замедлил явиться в виде симпатичной и обаятельной миллионерши из Америки — Дженет.','Нет данных'),(9212,'Заложники',1997,88,0.0,6.4,351,'1997-08-22','https://st.kp.yandex.net/images/film_iphone/iphone360_9212.jpg','Under Pressure','Лайл Уайддер умел рисковать. Он, можно сказать, испытывал в этом потребность, преодолевая опасности очень хладнокровно. Но его невозмутимость была как бы оболочкой внутренней ярости, рвущейся наружу.<br><br>И в один из дней Лайл переступил грань разумных поступков, когда отчаянность превращается в ЗЛО, несущее смерть. Когда уже неважно, кто перед тобой: ребенок, женщина или полицейские. И настолько уж велика их вина, чтобы расплатой стала жизнь?!','Нет данных'),(9213,'Свидание на одну ночь',1997,102,0.0,6.9,1320,'1997-08-31','https://st.kp.yandex.net/images/film_iphone/iphone360_9213.jpg','One Night Stand','Прилетев по делам из Лос-Анджелеса в Нью-Йорк, коммерческий директор рекламной фирмы Макс решает повидать своего старого друга-гея Чарли, заболевшего СПИДом. В кафе гостиницы он знакомится с очаровательной женщиной Карен. Опоздав на самолёт, он отправляется с Карен на концерт, после которого спасает её от уличных грабителей и проводит с ней ночь любви, а утром улетает домой, где его ждут жена Мими и двое детей.<br><br>Ночное свидание переменило всю жизнь Макса. Он охладел к жене и всё время вспоминает Карен. Через год он вновь прилетает в Нью-Йорк, так как Чарли уже при смерти. В госпитале у постели больного Чарли Макс встречается с его братом Верноном, который представляет ему свою жену… Карен…','$24 000 000'),(9215,'Дом 2: Проклятая обитель',1987,85,0.0,5.9,939,'1987-05-14','https://st.kp.yandex.net/images/film_iphone/iphone360_9215.jpg','House II: The Second Story','Молодой человек наследует старый дом и приглашает переехать туда свою подругу. С ними происходит ряд мистических случаев, что заставляет парня разрыть могилу своего давно умершего деда, который оказывается жив. И так все еще только начинается…','Нет данных'),(9216,'Протокол',1984,90,0.0,6.0,213,'1984-12-21','https://st.kp.yandex.net/images/film_iphone/iphone360_9216.jpg','Protocol','Тридцатилетняя женщина, работающая официантом, спасает от террористов президента Штатов и его гостя — арабского шейха. Ее берут на службу в администрацию президента, а шейх предлагает выйти за него замуж.<br><br>Американцы используют ситуацию для размещения в его стране своей военной базы. Но тайные планы Пентагона получают огласку и героиня понимает, что ее использовали. Но теперь она не так наивна и действует по разработанному плану.','Нет данных'),(9217,'Вожди 21-го века',1982,91,0.0,5.7,75,'1982-07-01','https://st.kp.yandex.net/images/film_iphone/iphone360_9217.jpg','Warlords of the 21st Century','Бронированный грузовик злодея Стрэйкера и его банды разъезжает по постапокалиптическим пустошам и наводит ужас на остатки населения. Устав от жестокости и самодурства отца, дочь Стрэйкера убегает от него. Вскоре она встречает героя-одиночку Хантера, который решает укрыть девушку в одном из немногих мирных посёлков. Тем временем разъярённый Стрэйкер бросается в погоню за беглянкой.','Нет данных'),(9218,'Огненный лис',1982,136,0.0,4.8,746,'1982-06-14','https://st.kp.yandex.net/images/film_iphone/iphone360_9218.jpg','Firefox','Как адская летучая мышь, проносится он в небе со скоростью, в шесть раз превышающей скорость звука. Словно мерцающий призрак, остаётся он невидимым для самых чувствительных радаров. Будто смертельно ядовитая кобра, он поражает противника своими ювелирно точными ракетами.<br><br>Он — истребитель МИГ-31: самое смертельное оружие, когда-либо созданное человеком. Этот сверхсекретный самолёт был сделан в СССР и получил кодовое название «Огненный лис».<br><br>Чтобы баланс сил в ходе Холодной войны не был нарушен и наши с вами соотечественники не получили преимущества, американцы решают похитить это чудо техники.','$21 000 000'),(9219,'Чужая земля',1981,112,0.0,6.1,1621,'1981-05-22','https://st.kp.yandex.net/images/film_iphone/iphone360_9219.jpg','Outland','Самый удаленный спутник Юпитера. Огромная глыба вулканического хаоса. На его поверхности возвышается горнодобывающая колония, начиненная самой современной техникой. Население колонии состоит из людей, бежавших от цивилизации, и неудачников, которые бродили когда-то по пыльным улочкам какого-нибудь Сити.<br><br>Здесь даже воздух пропитан насилием. На эту землю завтрашнего дня и прибывает герой Шона Коннери.','$16 000 000'),(9220,'Адский мотель',1980,101,0.0,5.7,364,'1980-08-14','https://st.kp.yandex.net/images/film_iphone/iphone360_9220.jpg','Motel Hell','Винсент и его сестра Ида являются собственниками придорожного мотеля, а также предприятия по производству колбасных изделий, пользующегося хорошей репутацией. Когда Винсента спрашивают рецепт такого вкусного копченого мяса, он говорит, что его происхождение восходит к его бабушке, которая любила окуривать дымом все, что движется и шевелится. Но внучок довел бабушкину страсть до крайности.<br><br>Оказывается, ночью Винсент и Ида избивают до полусмерти поселяющихся в мотеле туристов, после чего закапывают их живыми в своем саду таким образом, чтобы на поверхности оказывались только головы. Они окуривают их ароматным дымком, откармливают, а по прошествии некоторого времени трупы становятся первоначальным материалом их знаменитого копченого мяса…','$3 000 000'),(9221,'Сука',1979,94,0.0,4.2,128,'1979-09-19','https://st.kp.yandex.net/images/film_iphone/iphone360_9221.jpg','The Bitch','Богатая, своенравная и независимая Фонтейн Калед, только что расставшаяся со своим юным возлюбленным-американцем, в самолете знакомится с импозантным итальянцем Нико. Но мужчина, приятный во всех отношениях, оказывается контрабандистом, перевозящим из Америки в Европу дорогущий бриллиант…','Нет данных'),(9222,'Янки',1979,141,0.0,6.6,243,'1979-09-19','https://st.kp.yandex.net/images/film_iphone/iphone360_9222.jpg','Yanks','Великобритания незадолго до высадки союзников в Нормандии. Американские солдаты ожидают в небольшом английском городке начала операции. Местные же насмешливо называют американцев «янки». Три американских солдата влюбляются в местных женщин. Один из них — молодой мужчина из Аризоны сержант Мэтт Дайсон, который встречается с молодой Джин Моретон. Другая пара — капитан Джон и Элен.','Нет данных'),(9223,'Вожди Атлантиды',1978,96,0.0,6.9,1374,'1978-05-05','https://st.kp.yandex.net/images/film_iphone/iphone360_9223.jpg','Warlords of Atlantis','Английские ученые отправляются на поиски затерянных цивилизаций на научном судне. При первом же погружении батисферы на нее нападают плавающие чудовища и утаскивают в… подводный город, где укрываются остатки затонувшей Атлантиды.<br><br>Местные вожди способны управлять тварями вроде гигантского спрута или доисторических амфибий как своими механизмами. К тому же, они способны заглядывать в будущее. Англичанам стоит немалых трудов покинуть этих не обремененных гостеприимством хозяев.','Нет данных'),(9224,'Риц',1976,91,0.0,6.4,74,'1976-08-12','https://st.kp.yandex.net/images/film_iphone/iphone360_9224.jpg','The Ritz','Предводитель одного мафиозного итальянского клана умирает, и перед смертью он приказал своему сыночку Кармино уничтожить зятя Гаэтано. Гаэтано с испугу решил бежать. Он вскочил в такси, и просит водителя, увезти туда, где до него никто не доберется, и не подумает там искать. Так он попал в отель для геев «Ритц». Кармино неизвестным образом узнал, где он прячется, собрал целый отряд преследователей и отправился за Гаэтано. И сюжет заворачивается невероятным образом, непредсказуемые встречи, совпадения, которые возникают на пути одного к другому.','Нет данных'),(9227,'Гремучие змеи',2001,97,0.0,4.6,217,'2001-11-29','https://st.kp.yandex.net/images/film/9227.jpg','Venomous','Мощное землетрясение разбудило подземных обитателей городка Санта-Мира. Встревоженные змеи выползли на волю, кусая всех, кто не привык смотреть под ноги. Доктор Дэвид Хэннинг оказывает помощь жертвам укусов, но вскоре они начинают умирать от неизвестной болезни. Таинственный вирус мгновенно распространяется по городу, не щадя никого.<br><br>Власти в панике, и только Дэвид догадывается, что виновники смертоносной эпидемии -неуловимые гремучие змеи. Однако военные ре приняли решение — Санта-Миру нужно стереть с лица земли, и теперь у Дэвида есть всего пара часов, чтобы спасти обреченных сограждан и разоблачить преступный заговор спецслужб, стремящихся любой ценой замести следы своих тайных экспериментов.','Нет данных'),(9228,'Точка падения',2001,93,0.0,4.7,72,'2001-03-23','https://st.kp.yandex.net/images/film_iphone/iphone360_9228.jpg','Crash Point Zero','Искатель приключений, ученый и страстный собиратель старины Морис Хантер организует экспедицию в далекую заснеженную сибирскую тайгу, где, по его сведениям, великий физик Тесла провел в начале XX века испытание, а затем и захоронил свое гениальное изобретение — прибор, способный генерировать «лучи смерти» огромной разрушительной силы.<br><br>Однако удивительная находка Хантера вызвала не только научный интерес: группа международных террористов решила заполучить смертоносное устройство уже на борту самолета, совершающего рейс из России в Канаду.<br><br>Перестрелка во время захвата террористами лайнера привела к экстренней посадке в горной части Канады. Выжило всего лишь несколько человек, включая получившего ранение при падении Хантера, а также его дочь и ассистентку Надю.<br><br>Теперь молодая женщина должна выжить в заснеженных горах и доставить контейнер ученого в безопасное место, а также вызвать помощь для спасения оставшихся на борту пассажиров. На помощь ей приходит агент спецслужб Джейсон Росс. Однако охота за находкой еще не закончилась…','Нет данных'),(9229,'Критическая масса',2001,95,0.0,3.5,129,'2001-07-04','https://st.kp.yandex.net/images/film_iphone/iphone360_9229.jpg','Critical Mass','После внезапного нападения террористической группы Самсона на грузовик с радиоактивными отходами в живых остаётся только агент Майк Джефферс. Спрятавшись в похищенной машине, Майк предупреждает всех об опасности, но власти не в силах остановить Самсона, который угрожает в одно мгновение уничтожить полстраны.<br><br>Внезапно смертоносный груз исчезает из поля зрения полиции, и теперь только бесстрашный Майк сможет спасти свою страну от гибели, если разгадает чудовищные планы террористов и призовёт их к ответу.','Нет данных'),(9238,'Смертельная ярость',1988,84,0.0,6.7,1301,'1988-05-06','https://st.kp.yandex.net/images/film_iphone/iphone360_9238.jpg','Dead Heat','Добросовестный полицейский погибает на боевом посту, пытаясь разоблачить банду ученых, оживляющих трупы, которые затем безбоязненно грабят банки.<br><br>Подвергнувшись случайно той же обработке, мертвый полицейский доводит дело до конца, призвав к ответу своих обидчиков.','$5 000 000'),(9240,'Мужской клуб',1986,101,0.0,5.1,120,'1986-09-19','https://st.kp.yandex.net/images/film_iphone/iphone360_9240.jpg','The Men\'s Club','Семеро старых друзей организуют мальчишник в доме Джордана, а получается что-то вроде сеанса групповой психотерапии. Они вдруг разоткровенничались, и речь пошла о женах и женщинах в их жизни. Незаметно, с выпивоном, киданием ножей в дверь кухни и обязательным битьем посуды ребята «отвязались» на всю катушку, а тут пришла жена. Она сильно огрела мужа кастрюлей по голове, после чего все гости завалились в дорогой публичный дом, и веселье достигло апогея.','Нет данных'),(9241,'Приятный разговор',1985,92,0.0,5.5,134,'1985-09-10','https://st.kp.yandex.net/images/film_iphone/iphone360_9241.jpg','Smooth Talk','Основанный на короткой истории Джойс Кэрол Оутс «Where Are You Going, Where Have You Been», этот фильм повествует о 15-летней девушке Конни, вкушающей запретные плоды сексуальной жизни на окраине северной Калифорнии. Однако любовные эксперименты Конни выходят из под контроля, когда в ее жизни появляется загадочный Арнольд Френд.','Нет данных'),(9242,'Вспышка',1984,94,0.0,6.7,553,'1984-08-31','https://st.kp.yandex.net/images/film_iphone/iphone360_9242.jpg','Flashpoint','Два офицера пограничного патруля случайно находят полузасыпанный песком джип, а в нем скелет, винтовку и 800 000 долларов наличными, что вовлекает их в таинственную историю, начало которой датируется 1963 годом. Эта находка повлекла за собой вереницу захватывающих и насыщенных «экшеном» приключений, ежеминутно грозящих им смертью. И связано это все, возможно, с убийством президента Кеннеди…','Нет данных'),(9245,'Волосы',1979,121,0.0,7.7,2739,'1979-03-14','https://st.kp.yandex.net/images/film_iphone/iphone360_9245.jpg','Hair','В разгар движения хиппи конца 60-х годов в компанию «детей цветов», празднующих наступление «эры Водолея», попадает провинциальный парень Клод со старомодными привычками. Его призывают во Вьетнам…','$11 000 000'),(9246,'Уайатт Эрп',1994,212,0.0,7.1,3119,'1994-06-24','https://st.kp.yandex.net/images/film_iphone/iphone360_9246.jpg','Wyatt Earp','Кевин Костнер в роли самого известного представителя закона из всех, что когда-либо шагали по дорогам Дикого Запада. Он играет человека, ставшего легендой в героической саге, изобилующей острыми и непредсказуемыми моментами.','$63 000 000'),(9247,'Большое разочарование',1983,105,0.0,6.7,1235,'1983-09-09','https://st.kp.yandex.net/images/film_iphone/iphone360_9247.jpg','The Big Chill','Жили-были в Южной Каролине восемь друзей детства. Разъехались в разные края и стали профи каждый в своём деле: журналюга Майкл, вояка Ник, звезда телеэкрана Сэм и влюбленная в него Кэрин, молодые супруги Хэролд и Сара, а также Мег и заводила компании Алекс.<br><br>Последний, кстати, умер. Точнее — покончил с собой. Именно похороны и стали причиной встречи этой семёрки и возлюбленной покойного Хлой. У них есть о чём воспомнить и о чём порассуждать. Каждый актёр — звезда, каждый персонаж — личность. Но отчего умер их общий любимчик? Устал от жизни, или с ним стряслась реальная, а не вымышленная беда?','Нет данных'),(9248,'Узы родства',1989,95,0.0,6.5,107,'1989-10-27','https://st.kp.yandex.net/images/film_iphone/iphone360_9248.jpg','Immediate Family','Линда и Майкл Спекторы женаты уже десять лет и отчаянно хотят стать родителями. Они пытаются зачать ребёнка, но безуспешно. Обратившись в агентство по усыновлению, они знакомятся с беременной 17-летней Люси. Молодая женщина считает, что супружеская пара сможет лучше позаботиться о её ребёнке, чем она сама со своим парнем. Спекторы обеспечивают уход за Люси на время её беременности и они становятся ближе, но Люси начинает сомневаться о том, отдавать ли им своего будущего ребёнка.','Нет данных'),(9249,'Французский поцелуй',1995,111,0.0,7.7,17011,'1995-05-05','https://st.kp.yandex.net/images/film_iphone/iphone360_9249.jpg','French Kiss','Чарли уезжает в Париж на конференцию, а его невеста не летит с ним из-за страха перед самолетами. Через несколько дней он звонит ей и сообщает, что полюбил другую. Кейт сразу же прыгает в самолет, и страх ей помогает преодолеть грубоватый француз — Люк, оказавшийся вором и контрабандистом, положившим в ее сумочку дорогое ожерелье, чтобы избежать трудностей на таможне…','Нет данных'),(9251,'Парень с обложки',2004,104,0.0,6.1,84,'2004-05-08','https://st.kp.yandex.net/images/film_iphone/iphone360_9251.jpg','Poster Boy','Власть — как наркотик, подсядешь один раз и слезть уже очень трудно, особенно если ты сенатор правого крыла, на носу у которого перевыборы. Вот и наш герой решает не гнушаться никакими способами, чтобы завоевать электорат, а именно подключает своего сына, который скрывает от отца свою нетрадиционную ориентацию, помимо его воли, расширить популярность сенатора среди молодёжи и к каким необратимым последствиям всё это приводит…','Нет данных'),(9253,'Убить Эдгара',2003,103,0.0,6.5,62,'2003-01-20','https://st.kp.yandex.net/images/film_iphone/iphone360_9253.jpg','Briar Patch','Юная красавица Инес чувствует себя глубоко несчастной в браке с Эдгаром, мелким жуликом с большими амбициями и полным отсутствием мозгов. Целые дни напролет ей приходится выслушивать нытье Эдгара и отбиваться от неуклюжих приставаний его дружка Флауэрса. Но однажды ее ближайшая подруга, увлекающаяся мистикой, предсказывает Инес, что скоро она обретет Истинную Любовь.<br /><br />И на самом деле Инес начинает тайно встречаться с богатым и романтически настроенным адвокатом Друденом. Узнав об этом, Эдгар избивает Инес и делает пленницей в собственном доме. Инес видит только один выход — убить Эдгара, но удастся ли ей совершить задуманное…','Нет данных'),(9255,'Падающие небеса',1998,95,0.0,7.9,161,'1999-11-01','https://st.kp.yandex.net/images/film_iphone/iphone360_9255.jpg','Falling Sky','Героини фильма — две жительницы Лас-Вегаса, представительницы его низших слоев: молоденькая Эмили и ее спивающаяся мама, которую девушка старается всячески опекать и удерживать от окончательного падения.','Нет данных'),(9258,'Призрак в машине',1993,95,0.0,5.1,371,'1993-12-29','https://st.kp.yandex.net/images/film_iphone/iphone360_9258.jpg','Ghost in the Machine','Этот фильм о вымышленном серийном убийце Карле Хоффмане, так называемом «убийце по записным книжкам», который чуть не погиб в лобовом столкновении с грузовиком.<br><br>В реанимации его сознание передается в компьютер, из-за удара молнии, прошедшей через компьютерный томограф, когда Карл был в нём. Став существом, живущим в сети, он замышляет продолжить своё смертельное хобби, используя электросеть, приборы и компьютерные сети.','$12 000 000'),(9259,'Царь горы',1993,102,0.0,7.3,1279,'1993-05-19','https://st.kp.yandex.net/images/film_iphone/iphone360_9259.jpg','King of the Hill','Детство Эрона пришлось на 30-е годы прошлого столетия, годы Великой американской депрессии. Выпавшие на его долю несчастья не сломили характер главного героя, напротив — закалили его. Благодаря смекалке и находчивости Эрону удаётся не только преодолеть трудности, но и во многом преуспеть и многое понять об окружающем мире.','$8 000 000'),(9262,'Новая рождественская сказка',1988,97,0.0,7.0,7561,'1988-11-17','https://st.kp.yandex.net/images/film_iphone/iphone360_9262.jpg','Scrooged','Наступило Рождество… Но, к сожалению, волшебная сила этого чудесного праздника не в силах растопить лед в сердцах некоторых абсолютно черствых и самодовольных личностей. К числу подобных неисправимых типов относится и герой этой картины — магнат Фрэнк Кросс.<br><br>Он богат, всесилен и абсолютно равнодушен ко всему, кроме собственных денег. Кросс — владелец собственного телеканала, безжалостный и хладнокровный бизнесмен, с очень жестоким чувством юмора.<br><br>В общем, Фрэнк — один из тех парней, которые запросто могут испортить вам замечательный праздник. Таких людей, понятное дело, надо воспитывать, и чем быстрей, тем лучше. Ради такого случая в игру включаются сверхъестественные силы.<br><br>В рождественскую ночь перевоспитанием Фрэнка займутся специально подобранные для этого существа. А именно:призрак прошлого — веселый таксист из ада; призрак настоящего — современная, задорная фея без комплексов, использующая методы рукопашного боя и ужасный, немногословный посланник будущего, с черепом, вместо лица…','$32 000 000'),(9263,'Ответный огонь',1987,90,0.0,6.1,85,'1987-05-13','https://st.kp.yandex.net/images/film_iphone/iphone360_9263.jpg','Backfire','Донни, ветеран вьетнамской войны, не может избавиться от навязчивых кошмаров. Поствьетнамский сидром постепенно обретает новые черты: выясняется, что «ответный огонь» из прошлого имеет объяснения в настоящем, а именно — в незадавшейся семейной жизни Донни и новом подозрительном знакомом его супруги…','Нет данных'),(9264,'Стеклянный зверинец',1987,134,0.0,7.9,346,'1987-09-19','https://st.kp.yandex.net/images/film_iphone/iphone360_9264.jpg','The Glass Menagerie','Том начинает рассказ за кадром и обговаривает сцену «по памяти», представляя всех персонажей. Сам Том — поэт, работающий на складе, чтобы содержать семью, но на самом деле он хочет сбежать от всего. Аманда — его мать, стареющая красотка, которая лишилась своего аристократического происхождения, выйдя замуж за телефониста, который в конце концов бросил семью. Лора — его сестра. В результате перенесенной в детстве болезни у нее одна нога короче другой, но еще больше ее калечит застенчивость. И, наконец, есть джентльмен, работающий с Томом на складе. Лора погружена в мир хрупких стеклянных фигурок, которые она коллекционирует, но у матери навязчивая идея найти дочери мужа, и она просит Тома помочь ей в этом.','Нет данных'),(9268,'Странники',1979,117,0.0,7.2,489,'1979-07-04','https://st.kp.yandex.net/images/film_iphone/iphone360_9268.jpg','The Wanderers','История гангстерской бригады молодых парней из Бронкса начала 1960-х, которая вовлечена в открытое противостояние с враждующей бандой. Но в первую очередь это рассказ о настоящей дружбе, семейных ценностях и приключениях совсем юных и горячих парней, живших в старые добрые времена.','Нет данных'),(9269,'Лютер',2003,123,0.0,7.5,1662,'2003-09-26','https://st.kp.yandex.net/images/film_iphone/iphone360_9269.jpg','Luther','Задавшись вопросом о том, как служение богу «отцов» католической церкви соответствует Священному Писанию, простой монах Мартин Лютер, «увидел свет истины». Прибив свои ставшие достоянием истории «95 тезисов» к воротам собора в Виттенберге, он решительно осудил раздачу индульгенций, дававшую немалые доходы в церковную казну, и был объявлен еретиком и богохульником.<br><br>Удалившись в изгнание, Лютер перевел Священное Писание на немецкий язык, чтобы простой народ смог получить прямой доступ к Слову Божьему. Тем временем, его последователи начали настоящую войну против католической церкви…','$30 000 000'),(9270,'Техасские рейнджеры',2001,86,0.0,5.8,541,'2001-06-15','https://st.kp.yandex.net/images/film_iphone/iphone360_9270.jpg','Texas Rangers','Банда Кинга Фишера бесчинствует в Техасе, убивая людей десятками. Желая остановить кровавый беспредел, капитан Макнэлли и его ближайший помощник — сержант Армстронг создают отряд рейнджеров и объявляют Фишера вне закона. Их вооруженная до зубов, но малочисленная группа, должна суметь достать того, кто пролил столько крови на их земле!','$38 000 000'),(9273,'Самозванцы',1998,101,0.0,6.4,240,'1998-05-18','https://st.kp.yandex.net/images/film/9273.jpg','The Impostors','В поисках пропитания пара безработных актеров устраивается на борт океанского лайнера и предотвращает катастрофу, одновременно скрываясь от полиции. На борту этого лайнера они обнаруживают в себе скрытые способности, благодаря которым меняются безвозвратно, что и спасает их от дальнейшего преследования.<br><br>С помощью неугомонной официантки они находят себя в сумасшедшем мире. Наши герои сталкиваются с многочисленным позерством и лицемерием в поисках путей спасения корабля от затопления…','Нет данных'),(9274,'Человек, который слишком мало знал',1997,94,0.0,7.0,2143,'1997-11-14','https://st.kp.yandex.net/images/film_iphone/iphone360_9274.jpg','The Man Who Knew Too Little','Приехавшего в Лондон Уоллеса Ричи принимают не за того, кто он есть на самом деле. Случайно он получает секретные инструкции и становится крутым суперагентом, сам того не подозревая.<br /><br />Ричи простой и наивный парень, он с трудом выговаривает сложные слова и вряд ли так хорош, как кажется, но… он весело решает все проблемы, особенно не задумываясь над ними. Стрельба, погони, нокауты и бомбы с часовым механизмом — это только начало. Начало жизни шпиона!','$20 000 000'),(9433,'Бог большой, я маленькая',2001,95,0.0,6.3,1269,'2001-09-26','https://st.kp.yandex.net/images/film_iphone/iphone360_9433.jpg','Dieu est grand, je suis toute petite','20-летняя Мишель находится в депрессии после разрыва со своим бойфрендом. И вот в один прекрасный день она знакомится с Бертраном, вегетарианцем и евреем по национальности. После этого знакомства Мишель решает обратиться в иудаизм. Ведь ей обязательно нужно обрести веру — если не в кого-то, то хотя бы во что-то…','Нет данных'),(9487,'Семь дней до смерти',2000,96,0.0,5.9,693,'2000-06-25','https://st.kp.yandex.net/images/film_iphone/iphone360_9487.jpg','Seven Days to Live','Казалось, что после трагической гибели сына Эллен и Мартин Шоу смогут начать новую жизнь, поселившись в старом загородном доме и забыв о мрачных призраках прошлого. Но вскоре с ними стали происходить непонятные и пугающие события.<br><br>Сначала на запотевшем зеркале в ванной появилась цифра 7. На следующий день Эллен увидела дорожный знак, на котором было написано «Тебе осталось жить шесть дней». Ночью с болотистой пустоши до нее донесся голос погибшего сына.<br><br>Эллен начинают посещать кошмарные видения, предупреждающие о приближении неминуемой гибели, а Мартин ничего не хочет знать о надвигающейся опасности и ведет себя более агрессивно. В доме супругов Шоу поселяется страх и ужас…','Нет данных'),(9519,'Хорошая пара',1983,88,0.0,6.3,411,'1983-12-13','https://st.kp.yandex.net/images/film_iphone/iphone360_9519.jpg','Two of a Kind','Господь Бог возвращается из отпуска и видит, что за его отсутствие в мире стало очень плохо. Он вызывает ангелов и заявляет, что собирается стереть с лица земли человеческую расу и начать все заново. Ангелы уговаривают Его изменить свое решение… И судьба Земли оказывается в руках конкретного человека, причем взятого наугад. Выбор падает на неудачливого изобретателя Зэка, который в компании с банковской служащей Дебби должен доказать, что человек не так уж плох, как кажется на первый взгляд…','Нет данных'),(9520,'Городской ковбой',1980,132,0.0,6.9,363,'1980-06-06','https://st.kp.yandex.net/images/film_iphone/iphone360_9520.jpg','Urban Cowboy','Днем Бад Дэвис вкалывает, как проклятый. Но по вечерам он меняет свою рабочую каску на ковбойскую шляпу и направляется в самый популярный ночной клуб Хьюстона, где его ждет новое амплуа — короля и соблазнителя. Здесь герой знакомится с очаровательной девушкой по имени Сисси, которая убеждена, что Бад — «настоящий ковбой». Но, как известно, «настоящий ковбой» познается в деле, и теперь Баду предстоит оправдать свое гордое звание, разобравшись с опасным мошенником, который задумывает ограбить ночной клуб и похитить сердце Сисси.','Нет данных'),(9521,'Миг за мигом',1978,105,0.0,5.8,128,'1978-12-22','https://st.kp.yandex.net/images/film_iphone/iphone360_9521.jpg','Moment by Moment','Завсегдатай пляжей влюбляется в богатую матрону Томлин из Беверли Хиллз, которая не способна на глубокое чувство.','Нет данных'),(9522,'Адский дождь',1975,86,0.0,5.3,223,'1976-05-26','https://st.kp.yandex.net/images/film_iphone/iphone360_9522.jpg','The Devil\'s Rain','Стив Престон возвращается домой во время начинающейся сильной бури. Неожиданно его лицо начинает растекаться под дождем, а он начинает что-то лепетать о какой-то священной книге и о неком сатанинском культе. Стив умирает, его жена исчезает, а Марк, один из его сыновей, захвачен Джонатаном Корбисом, лидером тайной секты поклонников Сатаны, ждущих вот уже три столетия, чтобы воцарить в этом мире.','Нет данных'),(9523,'Три икса 2: Новый уровень',2005,101,0.0,5.3,27416,'2005-04-27','https://st.kp.yandex.net/images/film_iphone/iphone360_9523.jpg','xXx: State of the Union','Группа высокопоставленных заговорщиков в белом доме поднимает мятеж с целью захвата власти. Спецслужбы бессильны — бунтовщики разгромили Агентство Национальной Безопасности (АНБ). Америка на грани хаоса, но у чудом выжившего офицера АНБ Огастеса Гиббонса остаётся последний козырь, способный спасти положение. Это Дариус Стоун — хладнокровный суперагент, отобранный по сверхсекретной программе «Три Икса». Оставляя после себя смерть и разрушения, этот человек-армия вступает в битву, которая решит судьбу Америки и всего мира.','$87 000 000'),(9524,'В моей стране',2004,105,0.0,6.1,230,'2004-02-07','https://st.kp.yandex.net/images/film_iphone/iphone360_9524.jpg','Country of My Skull','В Южной Африке организуется специальная комиссия примирения, которая должна рассмотреть преступления апартеида. На слушания комиссии собираются жертвы и обвиняемые. Репортер газеты «Вашингтон Пост» Лэнгстон Уитфилд не верит в честный исход слушаний, но все равно отправляется в Африку. Здесь он знакомится с полковником Де Ягером, ответственным за многие преступления апартеида, и поэтессой Анной Малан.','$12 000 000'),(9525,'Дом на Турецкой улице',2002,103,0.0,6.0,1983,'2002-10-25','https://st.kp.yandex.net/images/film_iphone/iphone360_9525.jpg','The House on Turk Street','Фильм рассказывает о приключении полицейского детектива Джека, который пытается помочь своей приятельнице найти пропавшую дочь. Дружеская услуга превращается в кошмар. Имея всего лишь фотографию девочки и название улицы, Джек начинает расследование.<br><br>Оказавшись заложником бандитов, Джек понимает, что главарем банды на самом деле управляет его красивая подружка Эрин. Ожидая увидеть перед собой властную и уверенную в себе женщину, Джек сталкивается с нежной и романтичной девушкой.<br><br>Действительно ли она так беззащитна, или просто управляет им, как и всеми остальными? Только финал откроет, чего стоит каждый из них..','$12 000 000'),(9526,'Клошар',2001,105,0.0,6.3,615,'2001-01-19','https://st.kp.yandex.net/images/film_iphone/iphone360_9526.jpg','The Caveman\'s Valentine','Талантливый музыкант, Ромулус Ледбеттер становится бездомным шизофреником, избегающим общества и живущим в пещере в Центральном Парке.<br><br>Пока он борется с пагубным влиянием на него алкоголя и окружающими его серафимами, в существование которых он верит, он обнаруживает около своей пещеры труп и оказывается впутанным в таинственное убийство.','$13 500 000'),(9528,'Глубокое синее море',1999,105,0.0,7.0,29917,'1999-07-26','https://st.kp.yandex.net/images/film_iphone/iphone360_9528.jpg','Deep Blue Sea','Учёные подводной лаборатории «Акватика», разрабатывая препарат от болезни Альцгеймера, находят способ генетического увеличения мозга подопытных акул. Агрессивные и злобные хищники превращаются в думающих монстров-убийц, способных перехитрить своих создателей. Теперь последние пытаются справиться с разъярёнными хищниками, но спастись от острых челюстей огромных и умных акул практически невозможно…','$60 000 000'),(9529,'Пристанище Евы',1997,109,0.0,6.6,308,'1997-09-07','https://st.kp.yandex.net/images/film_iphone/iphone360_9529.jpg','Eve\'s Bayou','Папа Луиз Батист — хорошо зарабатывающий врач, мама Роз — домохозяйка, содержащая замечательный дом в образцовом порядке, и, наконец, их 10-летняя дочь Ева — чистый ангелочек. Но оказывается, что существует и изнаночная сторона этой идиллии, узнав о которой, девочка испытывает глубокое душевное потрясение…','$6 000 000'),(9530,'187',1997,114,0.0,7.2,4512,'1997-07-30','https://st.kp.yandex.net/images/film_iphone/iphone360_9530.jpg','One Eight Seven','Где обитают ублюдки? Учитель из Бруклина Тревор Гарфилд видит их каждый день в школе. Это готовые бандиты, от которых можно ждать чего угодно. Один из них из мести совершает попытку убить Гарфилда.<br><br>После этого Гарфилд переезжает в Лос-Анджелес и. .. оказывается в таком же дерьме. Когда его терпению пришел конец, он заставил подонков расплачиваться кровью за каждый совершенный проступок.','$23 000 000'),(9531,'Поцелуй смерти',1994,97,0.0,6.1,1340,'1995-04-21','https://st.kp.yandex.net/images/film_iphone/iphone360_9531.jpg','Kiss of Death','Бывшему заключенному Джимми Килмартину не позавидуешь. После того, как он вышел из тюрьмы на свободу, полицейские, не оставив выбора, решили использовать его в качестве «стукача», внедрив в одну из криминальных группировок Нью — Йорка.<br><br>Джимми придется лавировать между амбициями честолюбивого прокурора, рвущегося любыми способами усадить гангстеров за решетку, и смертельными играми безжалостного главаря бандитов, для которого нет врага хуже предателя. Джимми, оказавшийся в безвыходном положении, будет готов ощутить на себе поцелуй смерти, лишь бы вырваться из засасывающей его зловещей трясины лжи, предательства и вероломства…','$40 000 000'),(9532,'Аве, Цезарь',1994,97,0.0,5.1,327,'1994-05-11','https://st.kp.yandex.net/images/film_iphone/iphone360_9532.jpg','Hail Caesar','Родители-археологи назвали своего сына Юлий Цезарь. Отчисленный из института, Юлий Цезарь Макгрудер решает «полностью сконцентрироваться» на музыке и своей рок-группе. Настоящая же его страсть — дочь местного магната, Баффер.<br><br>Мистер Бидвелл терпеть не может ухажёра своей дочери. Чтобы Юлий исчез из её жизни, он предлагает ему денежное вознаграждение в 100 тысяч долларов. Но Юлий Цезарь не продаётся, и мужчины заключают пари: через 6 месяцев сам Юлий Цезарь Макгрудер должен предъявить мистеру Бидвеллу заработанные им 100 тысяч долларов…','Нет данных'),(9534,'Дерзкий',1994,114,0.0,7.0,523,'1994-04-01','https://st.kp.yandex.net/images/film_iphone/iphone360_9534.jpg','Fresh','Умному и сообразительному подростку по кличке Дерзкий (Нелсон) удается вырваться из замкнутого круга преступности, наркотиков, насилия, бедности и безысходности. Вырвался он, однако, нестандартным и неоднозначным образом. Для этого он предал и подставил всех, кого ему было нужно использовать для достижения своей цели, и проделал это с хирургической точностью (пригодились уроки игры в шахматы).','$3 500 000'),(9535,'Авторитет',1991,95,0.0,7.3,3285,'1992-01-17','https://st.kp.yandex.net/images/film_iphone/iphone360_9535.jpg','Juice','Фильм рассказывает о тяжелой жизни черных людей в Гарлеме. Четверо подростков ведут преступную жизнь и все казалось бы «хорошо», но их жизнь меняется после неудачного ограбления магазина.','$5 000 000'),(9536,'Джонни-замша',1991,97,0.0,5.9,1053,'1991-09-09','https://st.kp.yandex.net/images/film_iphone/iphone360_9536.jpg','Johnny Suede','В конце XX века в огромном городе живет молодой, симпатичный парень с большим коком под поп-идола Рикки Нелсона. Он мечтает стать рок-музыкантом и сочиняет заурядные сентиментальные песенки про любовь. Как-то вечером ему практически на голову падает коробка с замшевыми ботинками, идеально завершающими его имидж, и Джонни берет себе псевдоним «Замша». Джонни-Замша дрейфует по жизни, не представляя, что нужно делать, чтобы приблизиться к своей мечте…','$500 000'),(9537,'Возвращение Суперфлая',1990,95,0.0,4.6,101,'1990-11-09','https://st.kp.yandex.net/images/film_iphone/iphone360_9537.jpg','The Return of Superfly','Известный по первой части теперь уже бывший наркодилер Прист узнав что убили его старого приятеля и партнера по наркобизнесу возвращается из Европы в Штаты, чтобы разобраться кто и почему это сделал. Предстоит отбиваться и от полиции и от бандитов, которые знают о прошлом Приста, и мочат любого, кто мог бы ему помочь.','Нет данных'),(9538,'Свадьба Бэтси',1990,94,0.0,5.9,142,'1990-06-22','https://st.kp.yandex.net/images/film/9538.jpg','Betsy\'s Wedding','Бывают такие невероятные типы, готовые из самых лучших побуждений испортить все, что только можно. К таким как раз относится Эдди Хоппер, папа прелестной Бетси, собравшейся замуж за парня из богатой, респектабельной семьи.<br><br>Не желая ударить в грязь лицом Эдди с упоением планирует грандиозную свадебную церемонию, мечтая поразить всех пышностью и размахом торжества. Лучше бы он был скромнее: вбухав в это дело кучу денег, неуемный отче и оглянуться не успел, как оказался на грани финансовой пропасти. Еще немного, и все его безумные закулисные махинации выплывут наружу. Или все-таки произойдет чудо, которое спасет фонтанирующего разорительными идеями Эдди?','Нет данных'),(9539,'Искушение',1990,95,0.0,4.3,126,'1990-05-11','https://st.kp.yandex.net/images/film_iphone/iphone360_9539.jpg','Def by Temptation','При расследовании серии загадочных исчезновений мужчин выясняется, что в последний раз их всех видели в обществе «самой лучшей женщины» третьесортной забегаловки. Свидетелю, утверждавшему, что эта эффектная женщина не отражается в зеркале, вначале не верят…','Нет данных'),(9540,'Удар по системе',1990,88,0.0,6.8,513,'1990-03-23','https://st.kp.yandex.net/images/film_iphone/iphone360_9540.jpg','A Shock to the System','Грэхэм Маршалл окрылен идеей получить заслуженное повышение по службе… Но судьба улыбнулась другому. В погоне за успехом иногда приходится убивать. По плану Маршалла убийство жены — это только начало. То, что произойдет потом, взволнует и удивит Вас. Вы узнаете, на что еще способен человек ради достижения своей цели. Неужели план Маршалла осуществится?','Нет данных'),(9543,'Заложник',2005,113,0.0,7.0,22111,'2005-03-09','https://st.kp.yandex.net/images/film_iphone/iphone360_9543.jpg','Hostage','Джеф Тэлли, бывший переговорщик секретных служб Лос-Анджелеса, переезжает работать в провинциальный городок, оставив жену и дочь в Лос Анджелесе. Когда в его округе происходит ограбление, три преступника берут в заложники ничего не подозревающую семью.<br><br>Но у отца семейства есть тайна, которая могла бы поставить под угрозу его семью, а один из преступников уже начал терять самообладание…. Джеф Тэлли должен сделать все, что в его силах, чтобы эта ночь не стала последней для невинных людей.','$52 000 000'),(9544,'Крепкий орешек 4.0',2007,128,0.0,7.4,87486,'2007-06-12','https://st.kp.yandex.net/images/film_iphone/iphone360_9544.jpg','Live Free or Die Hard','Мир снова под угрозой: террористы захватили контроль над глобальной компьютерной сетью. Повсюду воцаряется хаос, правительство и спецслужбы бессильны. Джон МакКлейн давно в отставке, но он не будет стоять в стороне, когда надо защищать семью. Однако в этот раз ему уже не справиться без помощника.','$110 000 000'),(9545,'Завтрак для чемпионов',1999,110,0.0,5.5,1625,'1999-02-13','https://st.kp.yandex.net/images/film_iphone/iphone360_9545.jpg','Breakfast of Champions','Дуэйн Гувер, самый преуспевающий бизнесмен в Мидлэнд-сити, находится на грани нервного срыва. Но никто этого как будто не замечает: ни жена, ни любовница, ни сотрудники офиса, ни ближайший помощник — Гарри! Впрочем, что касается Гарри, он-то как раз сильно переживает.<br><br>Но о другом: за ним есть грешок — он любит наряжаться в женскую одежду и думает, что босс обо всем догадывается. Да, Дуэйну сейчас тяжело как никогда, но никто его не понимает. Ну как тут не свихнуться по-настоящему! А тем временем в направлении Мидлэнд-сити движется странный человек. Его зовут Килгор Траут. Встреча с ним может стать последней каплей для Гувера. Но об этом мы узнаем позже…','$12 000 000'),(9546,'Смертельные мысли',1991,102,0.0,6.3,1493,'1991-04-19','https://st.kp.yandex.net/images/film_iphone/iphone360_9546.jpg','Mortal Thoughts','Синтия и Джойс — лучшие подруги, и судьба подвергает их дружбу страшному испытанию. Неуравновешенный муж Джойс найден мертвым. Много раз несчастная женщина обещала убить его.<br><br> И накануне гибели между ними вспыхнула очередная ссора. Синтия прекрасно знала мрачную историю их взаимоотношений, но у следователя не сказала ни слова правды. Это была ложь во спасение. Но сможет ли она спасти Синтию от страшной истины?','$8 000 000'),(9547,'Возвращение Бруно',1987,56,0.0,6.4,365,'1987-02-07','https://st.kp.yandex.net/images/film_iphone/iphone360_9547.jpg','The Return of Bruno','В данной музыкальной постановке известный ныне всем актёр Брюс Уиллис предлагает вниманию зрителя несколько песен, несколько музыкальных постановок, где сам исполняет песни, веселится и радует публику, перевоплощаясь то в рэп-исполнителя, то в рокера или даже блюзмена.','Нет данных'),(9548,'Вердикт',1982,129,0.0,7.6,3362,'1982-12-07','https://st.kp.yandex.net/images/film_iphone/iphone360_9548.jpg','The Verdict','Когда-то Фрэнк Гэлвин был хорошим адвокатом. Но дружба с бутылкой до добра не доводит. И теперь он — консультант по юридическим вопросам в похоронной конторе.<br><br>Бывший коллега Микки Моррисей, не забывший о способностях Фрэнка, подкидывает ему интересное дело. Это шанс попробовать снова встать на ноги и попытаться занять достойное место в жизни.<br><br>Молодая женщина, получившая во время родов анестезию, превращается в прикованную к постели тяжелобольную. Ее родственники хотят подать в суд на респектабельную бостонскую больницу и на церковь, которой она принадлежит, чтобы получить компенсацию за причиненный физический и моральный ущерб.<br><br>Фрэнк уверен, что сторона-ответчик виновна, но ни за что не признает медицинскую ошибку…','$16 000 000'),(9550,'Первый смертельный грех',1980,112,0.0,6.0,182,'1980-10-03','https://st.kp.yandex.net/images/film/9550.jpg','The First Deadly Sin','Серийный убийца терроризирует Нью-Йорк, и ветеран нью-йоркской полиции, детектив Эдвард Делэйни, берется за расследование этого сложного дела, в то время как его жена лежит при смерти в больнице. Сыщик со стажем, привыкший всегда строго и неукоснительно следовать букве закона, Делэйни на этот раз зарекся поймать преступника любой ценой.<br><br>С помощью куратора музея, угрюмого коронера и вдовы убитого, он устраивает грандиозную охоту на преступника. Один промах — и убийца ускользнет. Но план Делэйни не должен провалиться!','Нет данных'),(9551,'Охотник на крокодилов: Схватка',2002,90,0.0,6.3,213,'2002-07-12','https://st.kp.yandex.net/images/film_iphone/iphone360_9551.jpg','The Crocodile Hunter: Collision Course','«Охотник на крокодилов» — популярное шоу на канале Animal Planet, главные ведущие которого Стив и Терри Ирвин розыскивают диких животных, которые блуждают слишком близко к цивилизации. Стив часто «хватает» животных, подвергая свою жизнь большой опасности. Он известен тем, что его кусали, резали, отравляли, кололи и высмеивали животные, которых он спасает.<br><br>Стив также любит снимать из любых положений, не смотря на угрозы своей собственной жизни. Когда Стив спасает своего последнего крокодила, то он еще не знает, что этот «детеныш» является на самом деле сверхсекретным оружием ЦРУ, а браконьеры, выслеживающие его — действительно тайные агенты.','$12 000 000'),(9552,'Миссия: невыполнима 3',2006,126,0.0,7.0,68806,'2006-04-24','https://st.kp.yandex.net/images/film_iphone/iphone360_9552.jpg','Mission: Impossible III','Суперагент Итан Хант решил расстаться с оперативной работой и заняться подготовкой курсантов. Он даже решил жениться на привлекательной, ни о чём не ведающей Джулии. Руководство ЦРУ просит его принять участие в последней операции: спасении его бывшей ученицы Линдси Феррис из лап торговца оружием Оуэна Дэвиана. Мог ли Итан предположить, что за этим заданием последует целая череда смертельно опасных миссий в Ватикане, Нью-Йорке и Шанхае?','$150 000 000'),(9553,'Опасная земля',1997,95,0.0,5.5,185,'1997-02-12','https://st.kp.yandex.net/images/film_iphone/iphone360_9553.jpg','Dangerous Ground','В каждом обществе существуют свои порядки, официальные или негласные, для живущих в этой стране они являются непререкаемым законом. Пробыв в США более 12 лет, Вузи возвращается в ЮАР, чтобы похоронить своего отца, ему предстоит узнать много нового об этой опасной земле.<br /><br />Младший брат Стивен, задолжав крупную сумму денег, убит местным наркодельцом в Йоханнесбурге. Во время его поисков и последующих разборок с мафией Вузи понимает, что рассчитывать на помощь властей нечего. Времена, когда все были братьями прошли и теперь добиться справедливости можно только испытанными отцовскими методами.','Нет данных'),(9554,'Стриптиз',1996,115,0.0,6.5,16705,'1996-06-23','https://st.kp.yandex.net/images/film_iphone/iphone360_9554.jpg','Striptease','Эрин Гран — женщина, которая танцует стриптиз, чтобы решить серьезную финансовую проблему. Но все осложняется, когда сластолюбивый конгрессмен теряет из-за нее голову.','$50 000 000'),(9555,'Святой из форта Вашингтон',1993,103,0.0,7.7,423,'1993-09-13','https://st.kp.yandex.net/images/film_iphone/iphone360_9555.jpg','The Saint of Fort Washington','Эмоционально неуравновешенный фотограф знакомится в ночлежке «Форт Вашингтон» с чернокожим Дэнни Гловером, досконально постигшем науку выживания и берущим над ним опеку.','Нет данных'),(9556,'Стой! Или моя мама будет стрелять',1992,87,0.0,6.7,24151,'1992-02-21','https://st.kp.yandex.net/images/film_iphone/iphone360_9556.jpg','Stop! Or My Mom Will Shoot','У сержанта полиции Лос-Анджелеса Джо Бомовски жизнь перевернулась вверх дном после того, как его милая мамаша Тутти решила навестить любимого сыночка. К огромной радости подружки и непосредственного начальника Джо, лейтенанта Гвен Харпер, Тутти сразу приводит в порядок его холостяцкую берлогу и начинает налаживать «хозяйство».<br><br>Как вы прекрасно понимаете, бравый сержант не в восторге от всех этих нововведений. А тут еще, в дополнение ко всем проблемам, неугомонная Тутти оказывается свидетельницей убийства и требует… чтобы сын позволил ей участвовать в расследовании!<br><br>В итоге Джо получает нового напарника — собственную мамулю, которая решает задать преступникам солидную трепку!','Нет данных'),(9557,'Люди под лестницей',1991,98,0.0,6.7,7244,'1991-11-01','https://st.kp.yandex.net/images/film_iphone/iphone360_9557.jpg','The People Under the Stairs','В каждом городе есть дом, о котором рассказывают ужасные вещи. Взрослые говорят об этом месте шепотом, а все соседские ребятишки обходят его стороной. От таких мрачных домов веет сыростью и смертью. И вряд ли найдётся смельчак, который даже на спор отважится приблизиться к страшному месту в сумраке ночи.<br><br>Но случилось так, что однажды обыкновенный тринадцатилетний мальчик вступил в жуткое жилище. Тот кошмар, который пришлось испытать герою, невозможно описать словами.','$6 000 000'),(9558,'Полет «Нарушителя»',1990,115,0.0,5.9,286,'1991-01-18','https://st.kp.yandex.net/images/film_iphone/iphone360_9558.jpg','Flight of the Intruder','«Нарушитель» — так называют палубный бомбардировщик «А-6». Этот самолет был создан специально для полетов в экстремальных условиях. Эта боевая машина может летать в любую погоду, но не имеет на своем борту никакого оружия защиты. Поэтому «А-6» доверяли пилотировать лишь настоящим ассам, каковым и был Джейк Грэфтон. <br /><br />Вот уже пять лет идет война во Вьетнаме. Лейтенант Грэфтон служит на борту авианосца под командованием легендарного Фрэнка Кампарелли. Во время очередного задания у Джейка погибает напарник и близкий друг. И теперь у Грэфтона появился новый член экипажа «Нарушителя»: бомбардир Верджил Коул — бывалый «профи», прошедший «огонь, воду и медные трубы». Вместе с отважным Коулом Джейк решает осуществить тайную и невероятно опасную миссию, которая должна будет повлиять на весь ход военных действий…','$35 000 000'),(9559,'Патти Херст',1988,108,0.0,6.4,70,'1988-05-13','https://st.kp.yandex.net/images/film_iphone/iphone360_9559.jpg','Patty Hearst','Патти Херст — хрупкую брюнетку, наследницу газетного магната Херста — в 70-е годы похитили террористы. В течение нескольких лет девушка была невольной свидетельницей бессмысленных и жестоких терактов и, в конце концов, сама присоединилась к своим мучителям. Перерождение заложницы в террористку вызвало широкий резонанс в американском обществе и серьезно подорвало психику папаши Херста.','Нет данных'),(9560,'Родной сын',1986,111,0.0,6.4,90,'1986-12-12','https://st.kp.yandex.net/images/film_iphone/iphone360_9560.jpg','Native Son','Чикаго, 1940-е гг. Молодой чернокожий находит работу шофером у богатой белой семьи. Но происходит трагедия: он случайно убивает дочь своих нанимателей и пытается скрыть это, зная, что справедливого суда не будет. Тем временем полиция подозревает друга убитой девушки, молодого социалиста Яна…','Нет данных'),(9561,'Анатомия порока',2001,93,0.0,4.3,233,'2001-11-13','https://st.kp.yandex.net/images/film_iphone/iphone360_9561.jpg','Diary of a Sex Addict','В этой эротической драме мужчина должен бросить вызов своей сексуальной одержимости или погибнуть от нее. Сэмми — семьянин, нежно любящий свою жену и ребенка, который находится в постоянной борьбе с сексуальным наваждением, заставляющим его спать с бесчисленным количеством женщин — на работе, в баре и даже в собственном доме.<br><br>Боясь потерять свою семью навсегда, Сэмми начинает посещать врача, дабы укротить порочное влечение. Однако женщина — врач, к которой попадает этот необычный больной, вряд ли является для него лучшим решением…','Нет данных'),(9562,'Спросите Синди',2001,93,0.0,6.9,6130,'2001-09-06','https://st.kp.yandex.net/images/film_iphone/iphone360_9562.jpg','Good Advice','Попав в переплет, биржевой маклер Райан Тернер остался без гроша в кармане, без работы, квартиры, любовницы и девушки. Но Тернер не привык сдаваться!<br><br>Он хочет взять реванш и начинает писать в женской газетной колонке «Спросите Синди» от имени сбежавшей подружки. И быстро понимает, что на большинство вопросов просто не способен ответить. Ему приходится включить всю свою изобретательность, чтобы в итоге вернуть утраченное с лихвой!','Нет данных'),(9563,'По ту сторону солнца',2001,120,0.0,6.4,92,'2001-01-24','https://st.kp.yandex.net/images/film/9563.jpg','Things Behind the Sun','Шерри пережила жестокое изнасилование. С того дня прошел не один год, но она так и не смогла забыть произошедшего. Теперь ее жизнь — это концерты в студенческих городках, выпивка и случайный секс. Все меняется, когда ее песня становится хитом.<br><br>Теперь Шерри интересуются глянцевые журналы и среди прочих — Оуэн, журналист музыкального издания, прилетевший из Калифорнии, специально для того, чтобы взять у нее интервью. А может быть не только для этого? Может, этот симпатичный парень имеет какое-то отношение к кошмару, поломавшему жизнь Шерри много лет назад.','Нет данных'),(9564,'Слишком много плоти',2000,110,0.0,5.9,333,'2000-09-24','https://st.kp.yandex.net/images/film_iphone/iphone360_9564.jpg','Too Much Flesh','В маленьком городке в штате Иллинойс нравы очень строги. Но лицемерие и пуританство местечка будет подвергнуто тяжелым испытаниям, когда у 35-летнего женатого Лайла начнется бурный роман с приезжей француженкой Жюльетт. Их отношения столь свободны и шокирующи, что это не может не привести к конфликту.','Нет данных'),(9569,'Украденное проклятье',1998,94,0.0,4.8,69,'1998-12-08','https://st.kp.yandex.net/images/film_iphone/iphone360_9569.jpg','Fait Accompli','Второразрядный воришка крадет большие деньги. К его несчастью, он даже не подозревает, что эти деньги принадлежат жрице вуду, которая наложила на них заклятье. Деньги вскоре оказываются в руках Фрэнка Барлоу, криминального босса и ярого адепта религии вуду.<br><br>С ужасом узнав, каким «богатством» он завладел, Фрэнк решает при первой же возможности вернуть украденное. Но у его любовницы Джезебел дркгие планы на будущее. Всю жизнь ожидавшая подобной возможности, красотка с улыбкой покидает город, захвативс собой туго набитую деньгами сумку. Скрываясь от погони, она прячется в пустующем доме, куда скоро должны вернуться владельцы.','Нет данных'),(9570,'Я тебя теряю',1998,100,0.0,5.5,98,'1998-09-03','https://st.kp.yandex.net/images/film_iphone/iphone360_9570.jpg','I\'m Losing You','По необъяснимому стечению обстоятельств жизнь каждого в этой вполне успешной лос-анджелесской семье вдруг круто изменилась. Все они: глава семейства — успешный кинопродюсер Перри Крон, его приемная дочь Рэйчел и сын Берти по-разному перенесли перемены. И это действительно было непросто, ведь каждый из них пересекся со смертью…','Нет данных'),(9571,'Адская кухня',1998,95,0.0,5.9,605,'1998-09-11','https://st.kp.yandex.net/images/film_iphone/iphone360_9571.jpg','Hell\'s Kitchen','В результате неудачного ограбления Джонни Майлз случайно убивает одного из своих подельников. Джонни сажают на пять лет, а после освобождения он решает круто изменить свою жизнь — покончить с криминальным прошлым и профессионально заняться боксом. Но у сестры того парня, который был застрелен Джонни, совсем другие планы относительно его будущего.','$6 000 000'),(9573,'На рыбалку!',1997,94,0.0,6.4,1881,'1997-05-30','https://st.kp.yandex.net/images/film_iphone/iphone360_9573.jpg','Gone Fishin\'','Двое старых друзей отправляются на рыбалку. Но приключения начинаются уже в дороге, когда они ловят… хитрого мошенника, угнавшего их машину. Затем приятели отправляются на поиски спрятанных драгоценностей.<br><br>По пути незадачливые рыболовы пытаются подцепить двух роскошных женщин — такого богатого улова у них еще не было! Но в любой момент они сами могут стать наживкой…','$53 000 000'),(9576,'Некуда бежать',1993,94,0.0,6.7,9810,'1993-01-14','https://st.kp.yandex.net/images/film_iphone/iphone360_9576.jpg','Nowhere to Run','Сэм, беглый заключенный находит кров на уединенной ферме, где живет молодая женщина с двумя детьми. С трудом сбежав от полиции, он уже на пути к свободе, но безопасность тех, кто помог ему в трудную минуту, заставляет его вернуться.<br><br>Беспомощной женщине и двум ее детям угрожает опасность — подкупленный судья и бандиты хотят отобрать у них дом — и Сэм встает на защиту семьи.<br><br>В трудной схватке он один противостоит нескольким головорезам, но только так он может заслужить любовь и доверие тех, кто стал для него самым дорогими людьми на свете.','$15 000 000'),(9577,'История с ограблением',1991,98,0.0,7.3,480,'1991-10-30','https://st.kp.yandex.net/images/film_iphone/iphone360_9577.jpg','The Linguini Incident','Люси мечтает о лаврах великого Гудини, а работает официанткой в ресторане «Лингуини». Ее подруга, чудаковатая Вивиан трудится над созданием «бюстгальтера самообороны». Бармен из «Лингуини» Монти уже несколько раз звал Люси замуж, но та упорно отвечает ему отказом… Однажды эта странная троица решается на ограбление ненавистного ресторана…','Нет данных'),(9578,'Черная радуга',1989,103,0.0,5.8,176,'1989-11-28','https://st.kp.yandex.net/images/film_iphone/iphone360_9578.jpg','Black Rainbow','Женщина-медиум помогает людям общаться с их умершими возлюбленными. Но однажды, благодаря своему дару ясновидения, она оказывается свидетельницей жестокого убийства и узнает, кто будет следующей жертвой…','Нет данных'),(9579,'Голубая бездна',1988,132,0.0,7.8,14253,'1988-05-11','https://st.kp.yandex.net/images/film_iphone/iphone360_9579.jpg','Le grand bleu','Два друга — Энцо Молинари и Жак Майоль — вместе росли на одном из греческих островов. Проходят годы, мальчики уже выросли и снова встречаются после нескольких лет разлуки. Оба стали ныряльщиками на глубину без воздуха, и детские соревнования переросли в напряженную борьбу за титул чемпиона мира. Но каждый рекорд может быть побит…','FRF 80 000 000'),(9580,'После работы',1985,97,0.0,7.5,8672,'1985-09-11','https://st.kp.yandex.net/images/film_iphone/iphone360_9580.jpg','After Hours','Программист Пол Хэкет совершенно случайно знакомится в кафе с симпатичной девушкой Марси и скоро оказывается у неё в квартире. Вечеринка, мягко выражаясь, не задаётся с самого начала: новая подружка неожиданно закатывает истерику и намеревается покончить с собой. Хэкет решает, пока не поздно, спасаться бегством, но оказывается в центре криминального квартала, из которого никак не может выбраться.','$4 500 000'),(9581,'Авиатор',1985,96,0.0,6.2,178,'1985-03-15','https://st.kp.yandex.net/images/film_iphone/iphone360_9581.jpg','The Aviator','В 1920-х годах пилот почтовой службы и дочь богача совершают аварийную посадку на горе полной голодных волков…','Нет данных'),(9583,'Крошка, это ты!',1983,105,0.0,6.7,107,'1983-03-04','https://st.kp.yandex.net/images/film_iphone/iphone360_9583.jpg','Baby It\'s You','Умная, талантливая и хорошенькая старшеклассница Джилл Розен увлекается новичком, появившимся в школе. Это симпатичный молодой итальянец с экзотическим именем Шейх, страстно увлеченный шикарными авто, красивыми девушками и мечтающий стать вторым Фрэнком Синатрой. Поначалу Джилл неприятно поражает нахальная самоуверенность и развязность Шейха, буквально преследующего её, но шаг за шагом мачо добивается своей цели…','Нет данных'),(9584,'Горп',1980,86,0.0,4.9,83,'1982-05-20','https://st.kp.yandex.net/images/film_iphone/iphone360_9584.jpg','Gorp','Комедия о нахальных выходках компании юных официантов в летнем лагере.','Нет данных'),(9585,'Город страха',1994,95,0.0,6.3,107,'1994-03-09','https://st.kp.yandex.net/images/film_iphone/iphone360_9585.jpg','La cité de la peur','В Канне проходит очередной кинофестиваль. В восхитительном приморском местечке собрались кинематографисты из всех стран мира. Но в этом ужасном году каннская идиллия обагрится кровью киношников… В этот раз знаменитый курорт — превратитсяв город страха… Здесь орудует чудовищный маньяк, безжалостно истребляющий киномехаников.<br><br>Садист появляется в кинотеатре в зловещей маске сварщика, а затем расправляется со своими жертвами при помощи… чего бы Вы думали? Серпа и молота! Убийца полностью перевоплотился в ужасного героя дешевого фильма ужасов «Красный — мертв». Часы тикают, количество жертв растет… Теперь кто-то должен остановить убийцу!','Нет данных'),(9588,'Гарвардская тусовка',2001,99,0.0,5.0,323,'2001-05-10','https://st.kp.yandex.net/images/film_iphone/iphone360_9588.jpg','Harvard Man','Дочь босса мафии Синди Бандолини — очень красивая и сексуальная «девушка с характером». Она учится в Гарварде и умеет манипулировать любым мужчиной. Синди удается уговорить звезду университетской баскетбольной команды Алана Дженсена «сливать» игры, что поможет ей выиграть на тотализаторе миллионы долларов и завоевать уважение своего папаши.<br><br>Алан соглашается за вознаграждение в 100 тысяч долларов… и совершенно зря! Ему приходится спасаться сразу и от Синди, и от ФБР, и от бойцов «семьи» Бандолини. С окончательно съехавшими набекрень от страха мозгами Алан находит утешение в объятиях знойной и ненасытной в любви преподавательницы философии Чесни. Таких уроков не задавали еще ни одному студенту Гарварда…','$5 500 000'),(9591,'Тайная страсть Айн Рэнд',1999,104,0.0,6.4,187,'1999-01-27','https://st.kp.yandex.net/images/film_iphone/iphone360_9591.jpg','The Passion of Ayn Rand','Встреча прославленной писательницы со своим восторженным поклонником — студентом Натаниэлем Брендоном оказалась роковой для обоих. Разница в возрасте, разница в положении не стала преградой для их бурного романа. Жена Брендона — Барбара и муж Айн Рэнд — Фрэнк были вынуждены закрыть глаза на происходящее…','Нет данных'),(9596,'Шантаж',1997,116,0.0,5.4,272,'1997-04-11','https://st.kp.yandex.net/images/film_iphone/iphone360_9596.jpg','Keys to Tulsa','Рихтер Будрю вместе с семьей живет в Тулсе. У него была работа, интересная жизнь… Все в прошлом. Но… совершенно случайно на его бессмысленном жизненном пути попадается бывшая очень близкая подруга — Викки Энн Стовер, встреча с которой круто переворачивает жизнь Рихтера. А все потому, что муж Энн — Ронни — предлагает провернуть выгодное дельце — стопроцентный верняк. Он задумал ШАНТАЖ.','Нет данных'),(9597,'Забыть и вспомнить',1995,96,0.0,6.4,376,'1995-10-04','https://st.kp.yandex.net/images/film_iphone/iphone360_9597.jpg','Kicking and Screaming','Компания приятелей-студентов дружно проводит досуг: молодость берет свое и просто требует дать выход энергии и бурлящим гормонам. В этой привычной беззаботности сообщение Джейн о том, что она уезжает учиться в Прагу, становится неожиданностью для ее бойфренда Грувера.<br><br>Но постепенно после расставания его затягивает круговорот новых событий и романтических знакомств — жизнь продолжалась. Однако в глубине души уже зарождалось ощущение утраты той единственной, которую невозможно забыть.','Нет данных'),(9598,'Спи со мной',1994,86,0.0,5.9,427,'1994-09-10','https://st.kp.yandex.net/images/film_iphone/iphone360_9598.jpg','Sleep with Me','Джозеф очень любит Сару, и вскоре они женятся. Только после этого события Фрэнк, лучший друг Джозефа, понимает, что не может жить без Сары. Любовный треугольник, в котором друзья никак не хотят уступить друг другу.','Нет данных'),(9599,'Убить Зои',1993,96,0.0,6.5,1276,'1994-04-28','https://st.kp.yandex.net/images/film_iphone/iphone360_9599.jpg','Killing Zoe','Американец Зэд, спец по сейфам, приезжает в Париж по приглашению своего друга Эрика, которого он знал еще по Штатам. Сразу после прилета по наводке таксиста Зэд снимает проститутку по имени Зои. Они понравились друг другу, что впоследствии и спасло им жизнь…','$1 500 000'),(9600,'Танец на воде',1992,106,0.0,5.8,143,'1992-04-23','https://st.kp.yandex.net/images/film_iphone/iphone360_9600.jpg','The Waterdance','Молодой писатель сорвался с утеса во время скалолазания. Он сломал шею, выжил, но в результате чего попал парализованным в больницу. Там лежат пациенты разных национальностей и рас. История о том, как человек адаптируется к шумной и разной среде, приходит к пониманию, как следует жить дальше.','Нет данных'),(9601,'Деньги',1991,105,0.0,5.9,76,'1991-04-17','https://st.kp.yandex.net/images/film_iphone/iphone360_9601.jpg','Money','Молодой наследник миллионного состояния начинает поиски убийц своего отца. В путешествии по всему миру он пытается раскрутить тугой клубок интриг и преступлений. Но кроме денег есть на свете еще и любовь…','Нет данных'),(9603,'Сестра, сестра',1987,91,0.0,5.8,157,'1987-09-13','https://st.kp.yandex.net/images/film/9603.jpg','Sister, Sister','Сестры Люси и Шарлотта Боннард сдают комнаты в большом особняке, унаследованном от родителей. Старинный дом хранит множество секретов, которые лучше не пытаться разгадать. Молодой парень, снявший одну из комнат, понимает это на собственном опыте…','Нет данных'),(9604,'Чудеса своего рода',1987,95,0.0,7.1,1282,'1987-02-23','https://st.kp.yandex.net/images/film_iphone/iphone360_9604.jpg','Some Kind of Wonderful','Кит Нельсон мечтает о самой популярной девушке в школе и не замечает, что его лучшая подруга Уоттс в него влюблена. Уоттс решает помочь другу добиться красотки, и постепенно Кит понимает, кто ему на самом деле нужен.','Нет данных'),(9605,'Новые детишки',1985,89,0.0,6.0,178,'1985-01-18','https://st.kp.yandex.net/images/film_iphone/iphone360_9605.jpg','The New Kids','В автокатастрофе у Лорен и Эбби МакУильямс погибают родители. В эту трудную минуту им на помощь приходят их дядя Мартин и тётя Фэй, которые предлагают переехать жить к ним. Лорен и Эбби устраиваются в местную школу и помогают дяди и тёте по дому, которые также владеют бензоколонкой и парком развлечений. Казалось бы жизнь стала налаживаться, но в школе, где учатся Лорен и Эбби, орудует шайка подростков во главе с Эдди Дутрой, которая начала терроризировать не только их, но и дом их дяди. Лорен и Эбби не остаётся ничего другого, как вспомнить чему учил их отец…','Нет данных'),(9606,'Маска',1985,120,0.0,7.8,3574,'1985-03-08','https://st.kp.yandex.net/images/film_iphone/iphone360_9606.jpg','Mask','Рокки Деннис — шестнадцатилетний парень, страдающий редкой болезнью костей, превратившей его лицо в маску, чем-то похожую на львиную и вдвое больше обычного лица. Ко всему прочему, болезнь эта неизлечима. Но Рокки из той редкой породы людей, которые ставят на жизнь в любом положении. Рокки умен, наделен добрым, огромным сердцем, он не обозлен на мир, где при первом же взгляде, его ожидает насмешка или отвращение. Он прекрасно учится и легко добивается дружбы и уважения одноклассников. Живет он с матерью — хиппующей рокершей Расти, красивой, отвязной, любящей, пьющей, злоупотребляющей наркотиками, а остальные члены его семьи — это братья-рокеры из банды мотоциклистов, в которой выделяется обаятельный усатый красавец Гар, возможно, его отец.','Нет данных'),(9608,'Без тормозов',1984,96,0.0,5.7,113,'1984-09-28','https://st.kp.yandex.net/images/film_iphone/iphone360_9608.jpg','The Wild Life','Том Дрейк, лучший борец в школе, влюблен в Айлин. Однако Айлин относится к мужчинам как к существам низшего сорта, и все из-за похотливого босса девушки. Выпускник школы Билл Конрад неожиданно разрывает отношения со своей подружкой Анитой. В отместку она заводит роман с взрослым мужчиной…','Нет данных'),(9610,'Сладкий и гадкий',1999,95,0.0,7.2,4703,'1999-09-04','https://st.kp.yandex.net/images/film_iphone/iphone360_9610.jpg','Sweet and Lowdown','Рассказ о жизни легендарного гитариста Эммета Рэя, о его любовных подвигах, творческом кризисе и долгожданном успехе…','$29 750 000'),(9611,'Правда о кошках и собаках',1996,97,0.0,6.8,1175,'1996-04-26','https://st.kp.yandex.net/images/film_iphone/iphone360_9611.jpg','The Truth About Cats & Dogs','У героини этой комедии ветеринара Эбби собственное радио — шоу, на котором она в прямом эфире дает остроумные практические советы счастливым обладателям кошечек и собачек. Несмотря на то, что Эбби отлично разбирается в жизни четвероногих домашних любимцев, ее собственная жизнь не складывается.<br><br>Мужчины редко обращают внимание на маленькую Эбби, отдавая предпочтение ее шикарной соседке Ноэль. Однажды на радиопередачу «Правда о кошках и собаках» дозванивается молодой фотограф Брайан. Очарованный голосом Эбби, он назначает девушке свидание. Но застенчивая Эбби не решается отправиться на встречу и посылает вместо себя свою подругу Ноэль. Брайану придется изрядно попотеть, чтобы определить, кто же его избранница в действительности.','Нет данных'),(9612,'Месяц на озере',1995,92,0.0,6.6,288,'1995-09-11','https://st.kp.yandex.net/images/film_iphone/iphone360_9612.jpg','A Month by the Lake','1937-й год. Мир на грани Второй мировой войны, в воздухе разлито свинцовое тревожное ожидание, но скучающая знать опасности не замечает. В Италии, на вилле у озера Комо, собралось английское высшее общество и несколько американских гостей. Мисс Бентли, дама бальзаковского возраста, впервые после смерти отца отправляется на этот курорт, где встречает отставного полковника, богатого английского джентльмена приятной наружности. <br /><br />Их нежной дружбе угрожает появление молодой особы, на которую немедленно обращает внимание вышеупомянутый почтенный джентльмен. Еще больше усложняет интригу присутствие молодого привлекательного итальянца, который не прочь приударить за мисс Бентли. Ошибки и недоразумения, легкий флирт и страсть, оскорбленное самолюбие и тайные желания. Вот такой любовный четырехугольник сложился на фоне божественных красот озера Комо в Северной Италии. Всем им предстоит провести незабываемый, прекрасный апрель…','Нет данных'),(9613,'Приключения барона Мюнхгаузена',1988,126,0.0,7.4,4580,'1988-12-08','https://st.kp.yandex.net/images/film_iphone/iphone360_9613.jpg','The Adventures of Baron Munchausen','Единственный, кто знает всю правду о Мюнхгаузене — сам барон. Легендарный герой рассказывает историю своих невероятных приключений.<br><br>Но неужели он действительно летал на раскаленном пушечном ядре, сражался с трехголовым грифоном, путешествовал на Луну, видел обнаженную Венеру, выходящую из морской раковины, и в конце концов, столкнулся нос к носу с самой Смертью? В это невозможно поверить… но разве знаменитый Мюнхгаузен может врать?','$46 630 000'),(9614,'Поцелуй папочку на ночь',1987,84,0.0,5.3,144,'1987-10-29','https://st.kp.yandex.net/images/film_iphone/iphone360_9614.jpg','Kiss Daddy Goodnight','Красавица Лора ведет двойную жизнь. Она знакомится с богатыми мужчинами, ищущими развлечений; попадая к ним домой, подсыпает снотворное в выпивку, остальное — дело техники. Но однажды привычный круговорот событий меняется…','Нет данных'),(9615,'Джонни, будь хорошим',1988,82,0.0,5.8,564,'1988-03-25','https://st.kp.yandex.net/images/film_iphone/iphone360_9615.jpg','Johnny Be Good','Веселая молодежная комедия о подростке из средней школы, игроке в американский футбол, которого преследуют «вербовщики» из различных колледжей страны в надежде получить его в свои футбольные команды. Огромные соблазны манят и кружат голову Джонни, но ему надо определить — его ли это путь в жизни?..','$22 000 000'),(9617,'Крупная рыба',2003,125,0.0,7.9,143809,'2003-12-04','https://st.kp.yandex.net/images/film_iphone/iphone360_9617.jpg','Big Fish','В основу этой приключенческой ленты положен роман Дэниела Уоллеса «Большая рыба: роман мифических пропорций». Умирает отец, о жизни которого сын хочет узнать как можно больше, собирая истории о нем.<br><br>Сын пытается воссоздать ускользающую жизнь отца в серии легенд и мифов, которые тот придумывает на основе разрозненных фактов. Взлеты и падения в жизни человека в итоге предстают в неожиданном ракурсе.','$70 000 000'),(9618,'Проект Ларами',2002,97,0.0,6.1,300,'2002-01-10','https://st.kp.yandex.net/images/film_iphone/iphone360_9618.jpg','The Laramie Project','В октябре 1998 21-летний Мэтью Шепард был найден зверски избитым, привязанным к ограде и оставленным умирать в Ларами (штат Вайоминг). «Проект Ларами» — это портрет города, оказавшегося в лучах софитов, перед объективами телекамер.<br><br>Как этот маленький городок с философией «живи и давай жить другим» стал местом, в котором молодые люди совершили такое преступление? Ответ может быть найден в «Проекте Ларами» ошеломляющей, глубокой картине, описывающей общество, столкнувшееся с непостижимым событием и их последствиями.','Нет данных'),(9621,'Жизнь в забвении',1994,90,0.0,7.4,3049,'1995-01-20','https://st.kp.yandex.net/images/film_iphone/iphone360_9621.jpg','Living in Oblivion','Нелёгкое дело — съёмки фильма! Актёры забывают слова, сбивается фокус, ломается аппаратура, у оператора несварение желудка — со всем этим приходится бороться режиссёру фильма Нику. Тогда как мужскую половину съёмочной группы интересует только один вопрос: когда, наконец, будут снимать «обнажёнку»?','$500 000'),(9622,'Тот, кто влюблен',1994,102,0.0,5.7,228,'1994-09-15','https://st.kp.yandex.net/images/film_iphone/iphone360_9622.jpg','Somebody to Love','Молодая латиноамериканка Мерседес танцует в дешевом клубе в центре Лос-Анджелеса и мечтает о славе голливудской звезды. Она встречается с Гарри, женатым актером из разряда отставных киноидолов, и с презрением отвергает любовь юного иммигранта Эрнесто, напоминающего Мерседес о ее собственном незавидном существовании.<br><br>Эрнесто очень хочет произвести на нее впечатление и после случайной встречи с местным мафиозным боссом он пытается не упустить шанс заработать быстрые деньги. Узнав, что ради нее Эрнесто согласился выполнить контракт на убийство, Мерседес поняла всю силу его любви. Но не слишком ли поздно?','Нет данных'),(9623,'Эд и его покойная мамаша',1992,86,0.0,5.8,222,'1993-11-17','https://st.kp.yandex.net/images/film_iphone/iphone360_9623.jpg','Ed and His Dead Mother','Тихий и скромный молодой человек настолько любил свою покойную маму, что готов был на всё, лишь бы снова оказаться с той, которая так хорошо заботилась о нём. Поэтому когда ему предлагают за определенную сумму возвратить родительницу из царства мертвых, он соглашается, предварительно поторговавшись — как и полагается настоящему бизнесмену. Вернуть-то её вернули, но с мамочкой произошли ужасные изменения. Для того, чтобы «жить», ей нужна живая человеческая плоть. К этому сынок явно не готов.','$1 800 000'),(9626,'В супе',1992,93,0.0,7.6,1853,'1992-08-13','https://st.kp.yandex.net/images/film_iphone/iphone360_9626.jpg','In the Soup','Тихий сценарист, замученный неуверенностью в себе и безответной любовью к соседке, отчаивается найти продюсера для своего 500-страничного сценария, который кажется совсем не годящимся для экранизации, и подает в газету объявление о его продаже…','Нет данных'),(9629,'Ищейки с Бродвея',1989,93,0.0,6.3,221,'1989-05-15','https://st.kp.yandex.net/images/film_iphone/iphone360_9629.jpg','Bloodhounds of Broadway','Когда одного известного репортера колонки светской хроники спросили, какая из всех ночей на Бродвее запомнилась ему больше всего, он вспомнил, как праздновали наступление нового 1929 года… Его рассказ и лег в основу этого фильма. В ту ночь в Нью-Йорке шампанское было холодным, а девочки из шоу очень горячими!<br><br>Весь свет общества сосредоточился в двух бродвейских заведениях: ресторанчике у Минди и в клубе-кабаре. Именно в этих двух гламурных местах и происходят события, описанные в фильме. Есть такая пословица: как встретишь Новый год, так его и проведёшь. В эту новогоднюю ночь сердца всех главных героев будут соединяться и разбиваться, биться в радостном и тревожном волнении, а одно сердце остановится навсегда.','$4 000 000'),(9630,'Таинственный поезд',1989,110,0.0,7.6,8570,'1989-05-14','https://st.kp.yandex.net/images/film_iphone/iphone360_9630.jpg','Mystery Train','Картина состоит из трёх самостоятельных новелл, действие которых происходит в отеле «Аркадия», Мемфис, штат Теннеси. Герои первой — молодая японская парочка, совершившая паломничество на Родину короля рок-н-ролла.<br><br>Казалось бы, тривиальный туризм, но для Джармуша нет ничего более смешного и абсурдного, чем обыденность. Когда в последующих новеллах появляется призрак и начинается пальба, никто уже ничему не удивляется.','$2 800 000'),(9631,'Рабы Нью-Йорка',1989,124,0.0,5.6,61,'1989-03-17','https://st.kp.yandex.net/images/film_iphone/iphone360_9631.jpg','Slaves of New York','Прекрасная жизнь в Большом яблочном бедламе — богема, фэшн, женские пиджаки с накладными плечами, издыхающее диско и творчество везде, куда не бросишь взор. Элеанора мастерит шляпки из разного мусора, работает над своей субъективностью и любит Стэша, который пишет поп-артистские картины на основе полароидных снимков мультиков, которые крутят по телевизору. У них есть пёс и квартира — правда, квартира принадлежит только Стэшу, а Элеанор — его рабыня, привязанная к его мнению и квартире. А потом появляются и другие персонажи — Марли, Шерман, Дарья, Микел, Би, Мушка, Виктор, Чак Дейд Долджер — эксцентричные, нелепые и трогательные, хищные и коварные, талантливые и бездарные. Рабы Нью-Йорка, которые пытаются перестать ими быть.','Нет данных'),(9632,'Сердце полуночи',1988,89,0.0,5.9,150,'1988-11-10','https://st.kp.yandex.net/images/film_iphone/iphone360_9632.jpg','Heart of Midnight','Психически неуравновешенная Кэрол от недавно умершего дяди наследует ночной клуб «Полночь», постоянными клиентами которого являются странные люди. Она переезжает в него и собирается после ремонта сделать здесь танцевальный клуб. Кэрол нанимает бригаду рабочих, а сама тщетно пытается открыть запертые двери комнат, находящихся на втором этаже. Днем помещение клуба наполнено шумом и голосами рабочих, а по ночам, когда Кэрол остается в огромном здании одна, ее начинают преследовать странные звуки…','Нет данных'),(9633,'Роковой звонок',1988,96,0.0,5.4,101,'1988-05-20','https://st.kp.yandex.net/images/film_iphone/iphone360_9633.jpg','Call Me','Однажды в доме журналистки Анны раздаётся телефонный звонок. Звонящий говорит с ней настолько откровенно, что Анна решает, что это её бой-френд и соглашается прийти на свидание в бар, где неожиданно становится свидетельницей убийства.','Нет данных'),(9636,'Лунатик',1986,78,0.0,5.8,73,'1986-09-09','https://st.kp.yandex.net/images/film_iphone/iphone360_9636.jpg','Sleepwalk','Магический ночной Нью-Йорк 80-х: городские огни складываются в усыпляющий узор, обшарпанные стены исписаны граффити, звучит разноголосица языков, пустоватые улицы освещены сонными блеклыми фонарями. По этому городу, задержавшись допоздна на работе, часто возвращается домой Ники. Она воспитывает китайского мальчика, работает в фирме «Easy-type» и целый день смотрит в зелёный экран компьютера. Однажды её просят перевести с китайского древний манускрипт. Ники берётся за работу, постепенно замечая, что текст древних сказок и реальность начинают сплетаться','Нет данных'),(9637,'Прощальные взгляды',1986,90,0.0,6.2,144,'1986-02-19','https://st.kp.yandex.net/images/film_iphone/iphone360_9637.jpg','Parting Glances','Гей-семья, один из партнеров должен уехать в длительную командировку в Африку. Предотъездное время становится испытанием их любви друг к другу. Тот, который остается, знакомится с симпатичным парнем, но отвергает его попытки переспать, а тот, который уезжает, понимает, что командировка подстроена его начальником-геем, пытающимся таким образом остаться наедине с ним в Африке…','Нет данных'),(9641,'Приключения льва в волшебной стране Оз',2000,74,0.0,7.0,97,'2000-09-26','https://st.kp.yandex.net/images/film/9641.jpg','Lion of Oz','Молодой цирковой лев получил орден мужества и пустился в необычное, полное приключений путешествие в страну Оз. Там он встретил Злую Восточную ведьму, которая заставила его принести ей волшебный цветок Оз. Именно этого цветка не хватало злой ведьме, чтобы добиться абсолютного могущества. Молодой Лев отправился на поиски цветка и с помощью любящих и преданных друзей обрел нечто другое — храбрость.','Нет данных'),(9642,'Практикантка',1999,90,0.0,6.1,327,'2000-01-21','https://st.kp.yandex.net/images/film_iphone/iphone360_9642.jpg','The Intern','Калейдоскоп веселых историй об обычаях и нравах мира высокой моды, рассказанных от имени остроумной, очаровательной девушки по имени Джоселин, работающей практиканткой в известном журнале мод. Это бурные чувства и любовные треугольники, воздушные поцелуи и плевки в спину, капризные топ-модели и распутные фотографы…','Нет данных'),(9644,'Троянская штучка',1997,80,0.0,6.2,956,'1997-09-26','https://st.kp.yandex.net/images/film_iphone/iphone360_9644.jpg','Trojan War','С юным Кимбли случилась неприятность: отправляясь на свидание к любимой девушке, он забыл захватить с собой… презерватив. Со скоростью олимпийского спринтера он бросается на поиски.<br><br>И тут начинается комедийная одиссея, в ходе которой, после самых неожиданных встреч и приключений, он в конце концов находит нечто более ценное, чем презерватив. А именно — свою настоящую любовь…','$15 000 000'),(9645,'Неродившийся ребенок',1991,83,0.0,4.3,174,'1991-03-29','https://st.kp.yandex.net/images/film_iphone/iphone360_9645.jpg','The Unborn','Супруги Маршалл безутешны, так как не могут иметь детей. Доктор Мейерлинг, специалист по бесплодию, изобрел препарат, улучшающий жизнеспособность и иммунитет еще не родившихся детей, что дало надежду многим матерям. Он помогает Вирджинии зачать с помощью оригинальной методики. Радоваться, однако, нечему, потому что доктор затеял сумасшедший эксперимент, и плод, вынашиваемый миссис Маршалл, имеет мало общего с человеком. Ведь некоторые зародыши убивали своих матерей, будучи еще в утробе…','Нет данных'),(9652,'Беглец',1998,90,0.0,6.1,296,'1998-02-18','https://st.kp.yandex.net/images/film_iphone/iphone360_9652.jpg','Spoiler','Криогенная тюрьма в одном из секторов Бета Галактики — место для содержания особо опасных преступников. Система хорошо охраняет их, и нужно большое мужество, чтобы бросить вызов этой все подавляющей силе.<br><br>Роджер Мэйсон — жертва страшной судебной ошибки, совершенно невиновный человек, провел в ледяном ящике 70 лет за то, что не смирился и бежал при каждом удобном случае. Ни полиция, ни армия, ни охотники за головами — никто не мог остановить его. Но все, кого он знал, кого любил — успели состариться… включая и его собственную дочь.','Нет данных'),(9653,'Ночь пугала',1995,85,0.0,5.9,709,'1995-08-08','https://st.kp.yandex.net/images/film_iphone/iphone360_9653.jpg','Night of the Scarecrow','Дух злого колдуна, казненного сотню лет назад, вселяется в пугало. Соломенное чучело отправляется на поиски магической книги, с помощью которой можно восстановить тело чародея. А всех представителей рода человеческого, встречающихся на пути, пугало уничтожает. В жестокости и разнообразии ему не откажешь. Кто-то будет распят, кого-то растерзают и утащат под землю мерзкие щупальца, кому-то зашьют рот ростки зловещих растений.','$2 000 000');
INSERT INTO `movies` VALUES (9655,'Повелитель кукол 5: Последняя глава',1994,81,0.0,4.0,280,'1994-09-21','https://st.kp.yandex.net/images/film_iphone/iphone360_9655.jpg','Puppet Master 5','В отель «Bodega Bay» прибывает жадный и завистливый доктор Дженнингс, собирающийся украсть куклы и узнать секрет их реанимации. Он страстно мечтает разбогатеть, поэтому хочет продать этот секрет сторонникам войны. Египетский Бог Сутек тоже не прочь стать всемогущим, поэтому снова посылает на Землю Тотема, чтобы тот узнал секрет и убил нового «повелителя кукол» Рика. Оказавшись меж двумя огней, миниатюрные куклы во главе с «Обезглавливателем» должны сохранить в тайне секрет Тулона и спасти жизнь своему хранителю Рику.','Нет данных'),(9656,'Эдди Прэсли',1992,106,0.0,5.7,68,'1992-04-21','https://st.kp.yandex.net/images/film/9656.jpg','Eddie Presley','История неудачливого двойника Элвиса Пресли, решившего подготовить своё триумфальное возвращение на сцену в образе короля рок-н-ролла.','Нет данных'),(9670,'Закон мести',1999,103,0.0,5.3,211,'1999-02-19','https://st.kp.yandex.net/images/film_iphone/iphone360_9670.jpg','Out in Fifty','Семь лет, проведенные в тюрьме за непредумышленное убийство, отбили у РэймондаФрая всякое желание оказаться за решеткой снова. Но эти годы не смогли погасить жажду мести в груди жестокого и непредсказуемого полицейского Джека Брэккена, поклявшегося отомстить за смерть жены жизнью убийцы.<br><br>Поэтому когда Рэймонд влюбляется в потенциальную наследницу 18 — ти миллионного состояния, и ее родственники начинают загадочным образом гибнуть один за другим, Джек начинает беспощадное преследование наиболее вероятного подозреваемого. Рэймонд понимает, что попал в ловушку, из которой ему уже не выбраться…','Нет данных'),(9683,'Чудо-пляж',1992,88,0.0,6.1,191,'1992-09-30','https://st.kp.yandex.net/images/film_iphone/iphone360_9683.jpg','Miracle Beach','Скотти, выгнанный с работы, лишившийся жилья, заставший свою подружку в постели с другим, отвергнутый прекрасной девушкой, в которую влюбился с первого взгляда, сидит на пляже рядом с бомжом. Тот, разжалобившись, дарит ему старую бутылку и одеяло. Тем временем повелитель джинов выписывает командировку на Землю симпатичной подчиненной. Пленницей подаренной Скотти бутылки она и оказалась…','Нет данных'),(9684,'О мышах и людях',1992,115,0.0,7.8,4915,'1992-09-16','https://st.kp.yandex.net/images/film_iphone/iphone360_9684.jpg','Of Mice and Men','Экранизация одноимённой повести Джона Стейнбека о двух приятелях, которые в годы Великой депрессии бродили по Америке в поисках работы. Неглупый крепкий парень Джордж и слабоумный Ленни — удача редко улыбалась им, но Джордж не мог бросить Ленни, который наверняка бы моментально попал в какую-нибудь передрягу. И всё-таки трагический день в жизни обоих наступил. Через некоторое время после начала работы на ранчо Тайлера…','Нет данных'),(9687,'Запекшаяся кровь',1996,89,0.0,6.8,3355,'1996-09-06','https://st.kp.yandex.net/images/film_iphone/iphone360_9687.jpg','Curdled','Героиня этого фильма с детства была одержима тягой к смерти. Ее самым ярким детским впечатлением была кровь на белой скатерти — из окна выбросили человека, и мать выбежала на улицу и накрыла труп. Теперь она выросла и работает в фирме, занимающейся уборкой квартир после убийств.<br><br>Отличаясь болезненным любопытством, девушка собирает газетные вырезки о серийном убийце, получившем в прессе прозвище «убийца голубой крови». Однажды нашу уборщицу посылают отмывать кровь в доме, где он только что совершил очередное убийство. Одновременно туда приходит герой Болдуина, чтобы стереть улики… Короче говоря, там они и встретились.','$2 300 000'),(9688,'Дестини включает радио',1995,102,0.0,6.3,1369,'1995-04-26','https://st.kp.yandex.net/images/film_iphone/iphone360_9688.jpg','Destiny Turns on the Radio','Джулиан Годдард бежит из тюрьмы и сразу направляется в Лас-Вегас, где надеется найти свою любовь Люсиль и, возможно, друга Торо с деньгами, из-за которых он и сел в тюрьму. Но Люсиль живет с хозяином казино, а друг бормочет о Дьяволе, вместе с которым деньги исчезли в ночную грозу на дне пересохшего теперь бассейна.<br><br>Если бы Торо знал, что подвез Джулиана в Лас-Вегас именно тот человек, которого он считает Дьяволом! Правда Джулиану он представился как мистер Дестини — что переводится как мистер Судьба.','Нет данных'),(9691,'Бесславные ублюдки',2009,153,0.0,7.9,274141,'2009-05-20','https://st.kp.yandex.net/images/film_iphone/iphone360_9691.jpg','Inglourious Basterds','Вторая мировая война, в оккупированной немцами Франции группа американских солдат-евреев наводит страх на нацистов, жестоко убивая и скальпируя солдат.','$70 000 000'),(9693,'Железная обезьяна',1993,85,0.0,7.1,1022,'1993-09-03','https://st.kp.yandex.net/images/film_iphone/iphone360_9693.jpg','Siu nin Wong Fei Hung chi: Tit ma lau','XIX век, китайская деревня. В деревне живёт некто Ян, врач и целитель. Этот добрый доктор имеет привычку вместе со своей помощницей Орхидеей облачаться в черное, принимая обличье местного идола Железной обезьяны, грабить богатых и раздавать деньги бедным. <br><br>Один коррумпированный чиновник несколько раз подвергся ограблению Яна и Орхидеи, поэтому он обращается за помощью к путешествующему целителю. Он хочет, чтобы тот расследовал ограбления и прекратил их, а до тех пор он будет держать в заложниках сына целителя.','$11 000 000'),(9694,'Поцелуй убийцы',1954,67,0.0,6.6,2418,'1955-09-21','https://st.kp.yandex.net/images/film_iphone/iphone360_9694.jpg','Killer\'s Kiss','Боксер Дэйви Гордон заступился за танцовщицу Глорию Прис, когда на нее напал ее работодатель и любовник Винсент Рапалло. Это событие сближает их, и они становятся неразлучны друг с другом, тем самым вызывая негодование со стороны Рапалло. Он нанимает людей, чтобы они убили Дэйви. Но по ошибке убивают не Дэйви, а его приятеля. Пытаясь избежать мести Рапалло, Гордон и Глория принимают решение сбежать из города…','$75 000'),(9696,'Загадка Галиндеза',2003,124,0.0,6.1,69,'2003-09-08','https://st.kp.yandex.net/images/film_iphone/iphone360_9696.jpg','El misterio Galíndez','Молодая обаятельная девушка берется защитить диссертацию по не совсем обычной теме. Ее внимание привлекла история революционера и борца за права Басков — Иисуса Галиндеза.<br><br>После гражданской войны в Испании он был вынужден бежать в Соединенные штаты, после чего исчез при странных обстоятельствах. Постепенно расследуя это дело, девушка натыкается на все новые любопытные факты.<br><br>Неожиданно к изучению этой темы подключается полиция и дело перестает быть сугубо научным. События развиваются столь стремительно, что девушка замечает, что ей угрожает смертельная опасность.<br><br>Кто-то очень не хочет, чтобы она узнала всю правду и начинает безумную охоту за ней.','Нет данных'),(9697,'Бойня в Пуэрто Валларта',2003,117,0.0,5.5,113,'2004-02-21','https://st.kp.yandex.net/images/film/9697.jpg','Puerto Vallarta Squeeze','Прайс — наемный убийца, давно работает на ЦРУ, но когда он совершает не разрешенное начальством убийство, у его куратора не остается никакого другого выбора, как только начать на него охоту. Прайс решает уйти в Мексику и уговаривает писателя — неудачника и его жену отвезти его до границы…','Нет данных'),(9700,'Мечты о Джулии',2003,109,0.0,6.3,94,'2003-10-24','https://st.kp.yandex.net/images/film_iphone/iphone360_9700.jpg','Dreaming of Julia','Куба, маленький городок Ольгин, 1958 год — год окончания режима Ф. Батисты и победы революции. Одиннадцатилетний мальчик оказывается втянутым в водоворот событий, сопровождающих революционное движение, и должен принять трудные решения — продолжать тайную дружбу со взрослой американкой Джулией или быть с семьёй, переживающей сложные времена?','Нет данных'),(9702,'Стерва',2000,94,0.0,6.3,70,'2001-05-11','https://st.kp.yandex.net/images/film_iphone/iphone360_9702.jpg','Vipera','Сицилия, конец второй мировой войны. Сильно пьющий кузнец Леоне один воспитывает дочь-подростка Розетту. Жена-танцовщица бросила его, сбежав с адвокатом. Леоне называет её не иначе, как стерва, но все равно продолжает любить.<br><br>Однажды двенадцатилетнюю Розетту насилует фашистский прихвостень, добившийся немалого влияния в городке. Вскоре выясняется, что девочка забеременела. Сразу после родов младенца забирают, а Розетту отправляют в приют при монастыре. Спустя годы девушка начинает разыскивать сына, но вместо этого находит мать…','Нет данных'),(9703,'Мнения сторон',2001,108,0.0,7.1,520,'2001-09-13','https://st.kp.yandex.net/images/film/9703.jpg','Taking Sides','Берлин вскоре после Второй мировой войны. В рамках процесса денацификации американские оккупационные войска готовят процесс против известного дирижера Вильгельма Фуртвенглера, который был в фаворе у нацистских властей.<br><br>Вместе с тем, Фуртвенглер делал все возможное, чтобы помочь еврейским музыкантам, а некоторых спас от концлагеря. Американский майор Стив Арнольд должен проверить дело Фуртвенглера. Он опрашивает подозреваемого и многочисленных свидетелей событий. Мнения сторон расходятся, но каждый по-своему прав.','Нет данных'),(9704,'Принц центрального парка',2000,109,0.0,5.5,73,'2000-09-22','https://st.kp.yandex.net/images/film/9704.jpg','Prince of Central Park','После того как мать двенадцатилетнего JJ умирает, он остается на попечении приемной матери, от которой и убегает, прихватив с собой только электронный синтезатор. Он начинает жить в Центральном парке Нью-Йорка, создавая музыку, наслаждаясь его красотой и новой свободой, но и здесь есть свои правила. Его новым миром заправляет воинственный эксцентрик Опекун. Он знакомит JJ-я с одной грустной старой парой, которая потеряла их собственного сына, но есть один темный секрет, который может привести к непоправимым последствиям…','Нет данных'),(9705,'Присутствие духа',1999,98,0.0,5.6,320,'2000-07-24','https://st.kp.yandex.net/images/film_iphone/iphone360_9705.jpg','Presence of Mind','После смерти отца молодая женщина вынуждена устроиться гувернанткой в родовое имение, находящееся на острове. Хозяин нанял героиню для воспитания своих племянников — сирот Майлза и Флоры. Очарованная обаянием работодателя, новая гувернантка принимает его жесткие условия — взять полную ответственность на себя и не обращаться к нему ни при каких обстоятельствах.<br><br>Оказавшись узницей живописного острова, героиня оказывается в плену у тайн, окутавших замок. Дети, поначалу кажущиеся милыми, постепенно преподносят ей странные сюрпризы, а домоправительница Мадо Реми по непонятным причинам настроена против новой воспитательницы.<br><br>Девушке предстоит узнать жуткую тайну, связанную с предыдущей гувернанткой мисс Джессел, слугой Фоском, и их странным отношениями… с юными отпрысками. Теперь героине придется приложить немало усилий, чтобы сохранить присутствие духа, живя по соседству… с духами.','$3 000 000'),(9706,'Священный дым',1999,115,0.0,6.4,1146,'1999-09-04','https://st.kp.yandex.net/images/film_iphone/iphone360_9706.jpg','Holy Smoke','Молодая австралийка Рут Бэррон, побывавшая в Индии и очарованная этой страной, решила жить по ее законам и обычаям. Обеспокоенная семья, исчерпав все способы воздействия, нанимает американского эксперта по зомбированию Пи Джей Уотерса, чтобы вернуть ее к обычной жизни.<br><br>Уверенный в успехе, тот прибывает в Австралию. Но очень быстро понимает, что проигрывает сражение, что его стройная система бессильна там, где вспыхнуло пламя страсти…','Нет данных'),(9707,'Три сезона',1999,105,0.0,6.4,180,'1999-01-23','https://st.kp.yandex.net/images/film_iphone/iphone360_9707.jpg','Three Seasons','Фильм складывается из четырех историй, объединенных единым временем действия и местом — улицами Сайгона, и движимых пятеркой героев: собирательницей лотосов Кьен, велорикшей Хаи, проституткой Лан, десятилеткой-коробейником Вуди и бывшим американским солдатом Джеймсом Хагером. Шестой, и основной, герой, хотя не представлен особо, но естественным образом пропитывает каждый кадр — современный Вьетнам. Прибывшая из глубинки Кьен хранит патриархальные ценности; Лан рассчитывает купить за свое тело счастье в сегодняшнем дне; маленький трудолюбивый упрямец Вуди символизирует будущее страны; а велосипед Хай увязывает три времени, три сезона в единое пространство несгораемой саламандры Вьетнама…','Нет данных'),(9708,'Мой Дикий Запад',1998,87,0.0,6.1,151,'1998-12-18','https://st.kp.yandex.net/images/film_iphone/iphone360_9708.jpg','Il mio West','В небольшом городке на Диком Западе жизнь течет спокойно и неторопливо. Но когда в город приезжает знаменитый стрелок Джонни Лоуэн, у всех появляется недоброе предчувствие…','$10 000 000'),(9709,'Я – Элвис, ты – Мэрилин',1998,106,0.0,7.1,193,'1998-09-12','https://st.kp.yandex.net/images/film_iphone/iphone360_9709.jpg','Finding Graceland','Многие сейчас отдали бы все, чтобы увидеть живого Элвиса Пресли. В каком-то смысле Байрону Грумену повезло: однажды, по дороге в Мемфис, он встречает Элвиса, вполне живого, в розовом пиджаке, и даже подвозит его на машине.<br><br>Любому хватило бы уже этого. Но, оказывается, неожиданные знакомства еще не закончились, превратив поездку Грумена в удивительное и незабываемое приключение…','$10 000 000'),(9710,'Как удержаться на плаву',1996,92,0.0,6.9,1575,'1996-11-07','https://st.kp.yandex.net/images/film_iphone/iphone360_9710.jpg','Head Above Water','Очаровательная молодая женщина Натали планирует провести экзотический отпуск на безлюдном побережье со своим новым мужем Джорджем. К несчастью, Натали оказывается предметом вожделения еще двух мужчин, очутившихся на острове — её друга детства Лэнса и бывшего возлюбленного, Кента.<br /><br />Оставшись наедине с Кентом, Натали изо всех сил старается быть верной женой, ну а Кент, в свою очередь, прилагает все усилия, чтобы её соблазнить. Однако на следующее утро, Натали уже не до любовных утех; героиня и её ухажер оказываются вовлечены в бесконечную вереницу катастрофических неприятностей. Вот тут-то всё и начинается.','Нет данных'),(9711,'С унынием в лице',1995,83,0.0,6.9,659,'1995-02-12','https://st.kp.yandex.net/images/film_iphone/iphone360_9711.jpg','Blue in the Face','Мы видим Огги, философа по мироощушению, торгующего табаком. Он все там же и, наверняка все также снимает угол улиц, где находится его магазинчик. На этот раз вереница персонажей, проходящих через это место, многочисленней и разнообразней. Многие из них говорят о себе и о Бруклине прямо в камеру. Других мы узнаем по их диалогам, поступкам, рассказам, снятым достаточно документально. Нужно очень любить этот город, чтобы снять такое кино, не связанное сюжетом. Это картинки, сценки, кусочки из жизни — маленькие осколки мозаики, из которых наше воображение складывает общую картину, а память позволяет как будто увидеть эту картину издалека.','$2 000 000'),(9712,'Взгляд Одиссея',1995,176,0.0,7.3,556,'1995-05-24','https://st.kp.yandex.net/images/film_iphone/iphone360_9712.jpg','To vlemma tou Odyssea','После 35 лет отсутствия на родину в Грецию возвращается знаменитый кинорежиссер. Но по завершении шумной премьеры своего последнего творения он неожиданно отправляется в путешествие по Балканам с целью отыскать три киноролика режиссера Янакиса, которые предположительно могут являться первыми греческими фильмами.','Нет данных'),(9713,'Опасные игры',1993,108,0.0,6.6,493,'1993-09-10','https://st.kp.yandex.net/images/film_iphone/iphone360_9713.jpg','Snake Eyes','Изветный режиссер Эдди Израэль начинает съемки главного проекта своей жизни. Его новый фильм — о сложных отношениях супругов. Действительность постоянно перемешивается с сюжетом сценария, в котором имеется и криминальная линия. Тяжелая атмосфера на съемочной площадке, несхожесть характеров и темпераментов создает чудовищную смесь человеческих отношений, грозящих неминуемой развязкой…','Нет данных'),(9714,'Плохой лейтенант',1992,96,0.0,7.2,8736,'1992-05-14','https://st.kp.yandex.net/images/film_iphone/iphone360_9714.jpg','Bad Lieutenant','Фильм о трудах и заботах оперуполномоченного нью-йоркской полиции. Но плохой лейтенант — это самый настоящий подонок. Он продаёт изъятые у барыг наркотики, в служебное время регулярно предаётся разврату, отнимает награбленное у грабителей, активно употребляет наркотики сам, а ворованные денежки проигрывает в бейсбольном тотализаторе.<br><br>Настоящий, без прикрас, слуга закона: наркоман, игрок, вор, убийца. Полисмен. Однако даже у настоящего подонка нет-нет да и шевельнётся в самой глубине сгнившей души что-то человеческое. Так происходит и здесь, когда лейтенант с корыстными целями впрягается в расследование по делу изнасилованной католической монашки.','$1 000 000'),(9716,'Два злобных глаза',1989,120,0.0,6.6,1153,'1990-01-25','https://st.kp.yandex.net/images/film_iphone/iphone360_9716.jpg','Due occhi diabolici','В первой истории жена и ее любовник ожидают, что вечно больной муж вот-вот умрет. Но поскольку господин Вальдемар не хочет умирать, любовник жены помогает ему войти в коматозное состояние, из которого путь только в могилу… или стать зомби. <br><br>Во второй, напротив, муж очень не любил жену и замуровал ее в стене собственного дома. А заодно замуровал и ненавистную кошку жены.','$9 000 000'),(9719,'Дело назаретянина',1987,105,0.0,6.7,212,'1987-02-13','https://st.kp.yandex.net/images/film_iphone/iphone360_9719.jpg','L\'inchiesta','Император Тиберий отправляет своего советника по имени Таурус в Палестину, чтобы расследовать обстоятельства исчезновения тела Иисуса из Назарета, распятого тремя годами ранее.<br><br>По стране ползут слухи о воскрешении Иисуса из мертвых, и приезд императорского посланника вызывает панику у местных чиновников, особенно у римского наместника Понтия Пилата.','Нет данных'),(9720,'Специалист по съему',1987,81,0.0,6.3,893,'1987-09-18','https://st.kp.yandex.net/images/film_iphone/iphone360_9720.jpg','The Pick-up Artist','Учитель начальной школы Джек Джерико обожал знакомиться с представительницами прекрасной половины человечества и весело проводить время, считая себя большим «специалистом по съему» девушек. Обычно все заканчивалось хорошо.<br><br>Но неожиданная встреча с юной Ренди круто изменила его жизнь. Джек даже не подозревал, что влюбится в дочь игрока-алкоголика Флэша Дженсена, задолжавшего деньги бандиту, и впереди его ждут очень большие неприятности…','$15 000 000'),(9723,'Сложная интрига с женщинами, переулками и преступлениями',1985,109,0.0,5.7,110,'1985-12-14','https://st.kp.yandex.net/images/film_iphone/iphone360_9723.jpg','Un complicato intrigo di donne, vicoli e delitti','Действие фильма происходит в Неаполе. Бывшая проститутка, а ныне совладелица танцевальной студии Анунциата становится свидетельницей убийства торговца наркотиками в тот самый момент, когда он пытался её изнасиловать. Она не видела убийцу, т. к в момент убийства упала в обморок. Однако, семья убитого ей не верит и надеется узнать имя убийцы. В тот же день в соседних кварталах находят ещё несколько трупов. Все они — торговцы наркотиками, и все убиты одним и тем же способом. Капитан полиции, ведущий расследование, подозревает Анунциату, а она, в свою очередь, уверена, что убийца — её старый знакомый, гангстер Тони. Но на самом деле всё оказывается гораздо сложнее…','Нет данных'),(9724,'Рыцарь дракона',1985,90,0.0,5.1,100,'1985-12-20','https://st.kp.yandex.net/images/film_iphone/iphone360_9724.jpg','El caballero del dragón','Средневековый знахарь с репутацией колдуна, святой отец с поведением профессионального интригана, наемный солдат, охваченный жаждой быть произведенным в рыцари, старый граф — владелец небольшого города и его окрестностей, его единственная дочь — главные герои этой историко-фантастической сказки.','Нет данных'),(9727,'На виду',1983,100,0.0,5.8,124,'1983-04-22','https://st.kp.yandex.net/images/film_iphone/iphone360_9727.jpg','Exposed','Очаровательная Элизабет приезжает в Нью-Йорк, чтобы испытать судьбу. Первые неудачи оборачиваются счастливой случайностью — талантливый фотограф сумел разглядеть в ней будущую модель, и вскорости Элизабет уже взирает на мир с глянцевых обложек журналов мод.<br><br>Как-то раз в толпе светских тусовщиков она знакомиться с загадочным человеком по имени Даниэль Джелин. Между ними вспыхивает страстное чувство, но, узнав нового любовника ближе, Элизабет рискует стать частью опасной миссии Даниэля, цель которой — борьба с террористами, погубившими множество невинных, среди которых роковым образом оказалась его мать.','Нет данных'),(9728,'Убийца полицейских',1983,117,0.0,6.4,144,'1983-03-15','https://st.kp.yandex.net/images/film_iphone/iphone360_9728.jpg','l\'assassino dei poliziotti','Фред — властный, жестокий, коррумпированный полицейский из отдела по борьбе с наркотиками, ему поручено расследование убийства полицейских.','Нет данных'),(9729,'Ночь Варенны',1982,152,0.0,7.0,234,'1982-05-15','https://st.kp.yandex.net/images/film_iphone/iphone360_9729.jpg','La Nuit de Varennes','Париж, июнь 1791 года. Знаменитый писатель-вольнодумец Ретиф де ла Бретонн глубокой ночью замечает, как от королевского дворца отправляется таинственная карета. Заинтригованный Ретиф бросается в погоню. По пути к нему присоединяется стареющий обольститель женских сердец Джакомо Казанова. Как выясняется, карета пытается догнать другую, в которой сидят члены королевской семьи; они бегут к восточной границе. Так формируется странная компания: три писателя — Ретиф де ла Бретонн, Казанова и революционно настроенный американец Томас Пейн; фрейлина королевы; королевский парикмахер; буржуа-реакционер и его жена… Переодевание короля не помогло ему спасти свою жизнь. В ночь с 20 на 21 июня Людовик XVI и Мария-Антуанетта были арестованы в Варенне. Заключительная сцена фильма, в которой фрейлина и парикмахер благоговейно встают на колени перед королевским нарядом, символизирует конец монархии и начало «нового мира».','Нет данных'),(9730,'Сатурн 3',1980,105,0.0,5.3,522,'1980-02-15','https://st.kp.yandex.net/images/film_iphone/iphone360_9730.jpg','Saturn 3','На космической станции «Титан», расположенной под поверхностью третьего спутника Сатурна, работают двое ученых — Адам и Алекс. Их идиллию нарушает прибытие на станцию капитана Джеймса.<br><br>Он решил сделать из отдаленной станции полигон для испытания совершенного киборга нового поколения, который сделает его создателя самым могущественным человеком в Солнечной системе. Но первое же испытание киборга показывает, что Джеймс теряет контроль над своим творением, а в обладающем устрашающей мощью роботе заложена программа разрушения…','£10 000 000'),(9731,'Конвейер',1978,114,0.0,7.2,853,'1978-02-10','https://st.kp.yandex.net/images/film_iphone/iphone360_9731.jpg','Blue Collar','Жизнь у сборочного конвейера тосклива. Изо дня в день клеить ветровое стекло… Один автомобиль в минуту. 55 в час. 220000 в год. Зарплата неприлично маленькая. Профсоюз продажный. Жизнь — бесконечный перечень неоплаченных счетов. И вот трое рабочих задумывают провернуть дельце, чтобы вырваться на свободу из этого мрака.','Нет данных'),(9732,'Добро пожаловать в Лос-Анджелес',1976,106,0.0,5.4,70,'1976-11-12','https://st.kp.yandex.net/images/film_iphone/iphone360_9732.jpg','Welcome to L.A.','Поэт и автор песен Кэрролл Бабер и его отец Карл Барбер живут в Лос-Анджелесе. Кэрролл — непревзойденный бабник, который не может себя переделать, поэтому никак не женится. Сейчас в его жизни сразу несколько женщин одновременно — все такие разные, как можно выбрать одну?','Нет данных'),(9734,'Кто стучится в дверь ко мне?',1967,90,0.0,6.9,1230,'1967-11-15','https://st.kp.yandex.net/images/film_iphone/iphone360_9734.jpg','Who\'s That Knocking at My Door','Главный герой — типичный италоамериканец, в его жизни есть всё, что свойственно обитателям «злых улиц» Нью-Йорка: посиделки в барах, стычки, веселье и друзья. Но вскоре в его жизнь войдет местная девушка, ради которой он будет готов остепениться.','$75 000'),(9735,'Познакомьтесь с Уолли Спарксом',1996,105,0.0,6.9,806,'1997-01-16','https://st.kp.yandex.net/images/film_iphone/iphone360_9735.jpg','Meet Wally Sparks','Ведущие развлекательных телепрограмм Америки стараются всеми способами перещеголять друг друга. У любимца публики — Уолли Спаркса нет проблем: он доводит шутками людей до истерики. Но однажды заходит слишком далеко, «пройдясь» по губернатору. Шоу оказывается под угрозой. И Уолли бросается в бой — он не тот человек, которого можно остановить!','Нет данных'),(9736,'Дороже рубинов',1997,117,0.0,6.5,145,'1998-01-22','https://st.kp.yandex.net/images/film_iphone/iphone360_9736.jpg','A Price Above Rubies','Для Сони судьба повернулась так, как мечтали ее родители: она вышла замуж за умного и духовного человека, родила сына и ее жизнь текла размеренно и спокойно. В этой жизни женщина, которая руководит хозяйством и растит детей всегда имела высокую цену — больше, чем рубины… Но Соня начала делать карьеру, увлекшись ювелирным бизнесом. И дни наполнились задавленным до сих пор потаенным желаниями и страстями…','Нет данных'),(9739,'Самоволка',1990,108,0.0,7.2,14661,'1990-08-01','https://st.kp.yandex.net/images/film_iphone/iphone360_9739.jpg','Lionheart','Узнав, что его брат в Лос-Анджелесе серьезно ранен, Лайон Голтье дезертирует из французского иностранного легиона, базирующегося в отдаленном районе Северной Африки.<br><br>Скрываясь от двух боевиков-легионеров, которым дан приказ вернуть его любой ценой, Лайон против своего желания становится участником незаконных боев современных гладиаторов, дерущихся голыми руками для развлечения богатых. Ему нужны деньги, чтобы помочь семье своего брата.','$6 000 000'),(9740,'Голая мишень',1992,96,0.0,6.3,91,'1992-01-24','https://st.kp.yandex.net/images/film/9740.jpg','Los gusanos no llevan bufanda','История начинается с доставки в Мадрид портфеля, прикованного наручниками к запястью курьера. И когда получателя прямо в аэропорту убивают, безобидный и наивный служащий курьерской компании Адам становится следующей мишенью.<br><br>Лишившись волей случая одежды, он становится «голой мишенью» и переживает целую вереницу смешных и забавных приключений, в самом конце которых пытается укрыться в клубе мужского стриптиза, переодевшись монашкой.','Нет данных'),(9742,'На грани безумия',1989,90,0.0,5.5,235,'1989-04-14','https://st.kp.yandex.net/images/film_iphone/iphone360_9742.jpg','Edge of Sanity','Вольная экранизация повести Роберта Луиса Стивенсона «Доктор Джекилл и мистер Хайд». Режиссер, как почти все его предшественники, обращавшиеся к известной книге Стивенсона, поручил одному и тому же актеру двойную главную роль — и Энтони Перкинс сыграл то, что от него требовалось. <br><br>Самое любопытное, пожалуй, то, что патологическим извращенцем в его интерпретации стал не только Джек Хайд, убийца проституток, но и доктор Генри Джекилл, вполне респектабельный гражданин общества.','Нет данных'),(9744,'Психо 3',1986,93,0.0,5.4,1439,'1986-06-27','https://st.kp.yandex.net/images/film_iphone/iphone360_9744.jpg','Psycho III','Несчастного Нормана снова посещает его покойная матушка. А в это время в мотель как назло нагрянули постояльцы…','Нет данных'),(9745,'Захват в Северном море',1980,100,0.0,6.4,207,'1980-03-30','https://st.kp.yandex.net/images/film_iphone/iphone360_9745.jpg','North Sea Hijack','Безжалостный террорист Креймер захватил контроль над гигантской буровой установкой и удерживает в заложниках семьсот работников…','Нет данных'),(9746,'Две женщины',1979,110,0.0,6.1,118,'1979-05-16','https://st.kp.yandex.net/images/film/9746.jpg','Twee vrouwen','История лесбийской любви двух случайно встретившихся женщин Сильвии и Лоры, принадлежащих к разным поколениям. Амстердам 1979 год. Дама красива, богата, ценит искусство. Ее друзья — тоже. Сквозь лобовое стекло лимузина она с любопытством разглядывает бедняков и думает, что ее позабавила бы связь с другой женщиной. Простая девчонка, которую одним дождливым вечером она решит подбросить до дома, предложит провести ночь вместе. Дама усмехнется доступности пролетариата и попадет в капкан своей надуманной чувствительности.','Нет данных'),(9747,'Зима приносит смерть',1979,97,0.0,5.7,138,'1979-05-11','https://st.kp.yandex.net/images/film_iphone/iphone360_9747.jpg','Winter Kills','Младший брат убитого президента США пытается раскрыть дело.','Нет данных'),(9750,'Жизнь и времена судьи Роя Бина',1972,120,0.0,6.7,351,'1972-12-01','https://st.kp.yandex.net/images/film_iphone/iphone360_9750.jpg','The Life and Times of Judge Roy Bean','Авантюрист Рой Бин сам назначил себя судьей в районе реки Пекос, перестреляв сначала всякую шваль, ограбившую и избившую его самым подлым образом накануне. По мере того как идут годы и деревня превращается в городок, а городок в город, Бин встречает, судит, казнит и милует различных персонажей, женится, воспитывает дочь, а затем исчезает на много лет, чтобы однажды мистическим образом вернуться…','Нет данных'),(9751,'Враг за дверью',1971,97,0.0,6.5,174,'1971-07-28','https://st.kp.yandex.net/images/film_iphone/iphone360_9751.jpg','Quelqu\'un derrière la porte','Энтони Перкинс в роли зловещего нейрохирурга, который задумал чудовищное — он хочет руками своего пациента, потерявшего память, убить любовника своей жены. Но пациент, попавший в лапы этого доктора, совсем не прост. А память может сыграть с любым человеком самые «дикие шуточки»…','Нет данных'),(9752,'Сладкий яд',1968,89,0.0,6.5,344,'1968-07-19','https://st.kp.yandex.net/images/film_iphone/iphone360_9752.jpg','Pretty Poison','Недавно вышедший из психиатрической больницы молодой человек Дэннис Питт встречает в городе Уинслоу необыкновенно привлекательную школьницу Сью Энн Тепаник и влюбляется в нее с первого взгляда. Чтобы завоевать внимание девушки и произвести на нее впечатление, Дэннис представляется секретным агентом ЦРУ, главная миссия которого — спасти Землю от марсиан…','$1 800 000'),(9753,'Скандал',1967,105,0.0,6.2,150,'1967-03-31','https://st.kp.yandex.net/images/film_iphone/iphone360_9753.jpg','Le scandale','Кристина, основная владетельница фабрики шампанского, надеется выгодно продать дело. Но для этого ей требуется убедить психически неустойчивого, обедневшего аристократа и миноритарного совладельца Поля продать права на торговую марку. Она уговаривает свогео мужа Кристофера, бывшего жиголо, помочь ей в этом. И тут начинается убийства, а подозрение падает на Поля..','Нет данных'),(9755,'Очаровательная идиотка',1964,110,0.0,6.7,292,'1964-03-13','https://st.kp.yandex.net/images/film_iphone/iphone360_9755.jpg','Une ravissante idiote','Советскому шпиону поручено выкрасть в Лондоне важную документацию, которая находится у сэра Реджинальда. Он решает использовать для этого наивную портниху Пенелопу, поражающую всех своей невероятной глупостью. До чего же обманчиво бывает первое впечатление…','Нет данных'),(9756,'Меч и весы',1963,131,0.0,7.4,126,'1963-02-01','https://st.kp.yandex.net/images/film_iphone/iphone360_9756.jpg','Le glaive et la balance','На французском побережье найден убитым похищенный мальчик, за которого ранее требовался выкуп. Проследив за двумя подозреваемыми до старого маяка, полиция обнаруживает на маяке ещё одного человека. Все трое клянутся в своей непричастности к преступлению, и теперь только судебным присяжным предстоит решить, кто же из этих троих виновен.','Нет данных'),(9757,'Пять миль до полуночи',1962,109,0.0,7.1,299,'1962-12-12','https://st.kp.yandex.net/images/film_iphone/iphone360_9757.jpg','Le couteau dans la plaie','Муж Лизы Маклин неожиданно гибнет в авиационной катастрофе. Начав готовится к похоронам, Лиза обнаруживает, что он жив-здоров и хочет с ее помощью получить деньги от страховой компании за его гибель. Лиза соглашается спрятать мужа в их квартире, однако следующие несколько месяцев превращаются для нее в кошмар, так как страховая компания проводит собственное расследование.','Нет данных'),(9758,'Федра',1962,115,0.0,7.2,219,'1962-09-07','https://st.kp.yandex.net/images/film_iphone/iphone360_9758.jpg','Phaedra','В современной Греции отец Алексиса — чрезвычайно богатый судоходный магнат — женится на молоденькой девушке Федре. Когда Алексис встречает свою мачеху, межды ними вспыхивает страсть, и они начинают встречаться…','Нет данных'),(9760,'Зеленые поместья',1959,104,0.0,6.0,491,'1959-03-19','https://st.kp.yandex.net/images/film_iphone/iphone360_9760.jpg','Green Mansions','Абель, сын убитого правительственного чиновника, убегает в джунгли. Там он встречается с воинственными индейцами и с прелестной девушкой…','$3 000 000'),(9761,'Любовь под вязами',1958,111,0.0,7.1,442,'1958-03-12','https://st.kp.yandex.net/images/film_iphone/iphone360_9761.jpg','Desire Under the Elms','Новая Англия. 1840 год.<br>Старый хозяин Эфрам вернулся с молодой женой Анной, с которой они только что обвенчались, из города в свое поместье. Молодая хозяйка столь обворожительна и откровенна в своих желаниях, что сразу же влюбляет в себя Эбена — одного из сыновей мужа. Старик муж мечтает, что новая жена скоро родит ему наследника, но он и не подозревает что будущий сын не его, а молодого любовника.','Нет данных'),(9764,'Жестяная звезда',1957,93,0.0,6.8,212,'1957-10-23','https://st.kp.yandex.net/images/film_iphone/iphone360_9764.jpg','The Tin Star','Опытный «охотник за головами» Морг Хикман приезжает в город, в котором только что был убит шериф. Его временной заменой назначен молодой неопытный Бен. Он хочет остаться в этой должности, но для этого ему надо произвести впечатление на жителей города. Когда Бен узнает, что Морг в свое время был шерифом, то просит его обучить его. И хотя Морг считает, что быть шерифом не лучшее занятие в жизни, он все же соглашается передать свои навыки Бену, считая при этом, что главное для шерифа не умение обращаться с оружием, а умение обращаться с людьми…','Нет данных'),(9766,'Актриса',1953,90,0.0,6.5,115,'1953-09-25','https://st.kp.yandex.net/images/film_iphone/iphone360_9766.jpg','The Actress','Забавный и трогательный рассказ о том, как юная девица борется за то, чтобы стать актрисой, несмотря на сопротивление ее отца, которого она все еще побаивается. Отец живет прошлым и хотел бы дать больше своей семье, чем то, что можно предложить на его жалование клерка. Картина поставлена по автобиографической пьесе Рут Гордон «Много лет назад».','Нет данных'),(9767,'Телохранитель по найму',1995,96,0.0,5.9,261,'1995-07-15','https://st.kp.yandex.net/images/film_iphone/iphone360_9767.jpg','Separate Lives','Молодая врач — психолог нанимает телохранителя со странной просьбой — проследить за ней и снять на пленку все ее передвижения. Завеса загадочности пропадает, когда он узнает о том, что его подопечная страдает синдромом раздвоения личности и во время одного из приступов, возможно, совершила убийство. Теперь же девушка, заручившись поддержкой своего охранника, должна раскрыть тайну убийства и найти настоящего преступника…','Нет данных'),(9768,'Кровавое посвящение',1983,97,0.0,6.0,246,'1984-04-28','https://st.kp.yandex.net/images/film_iphone/iphone360_9768.jpg','The Initiation','Привлекательную молодую девушку Келли Фэйрчайлд преследует один и тот же сон. Не случайно темой ее курсовой работы стали «Ночные кошмары». Молодой преподаватель психологии Питер Адамс хочет помочь девушке: он погружает Келли в состояние гипноза, и тут выясняется такое…','Нет данных'),(9786,'5 опозоренных женщин',1960,115,0.0,6.6,78,'1960-03-15','https://st.kp.yandex.net/images/film_iphone/iphone360_9786.jpg','5 Branded Women','Югославия, 1943 год. Группа остриженных и изгнанных из города за связь с немецкими оккупантами женщин прибиваются в горах к отряду партизан. После проверки в деле командование принимает их в качестве бойцов. Однако позорное прошлое и чрезмерное внимание отдельных партизан мужского пола тяготеет над ними, приводя одну из пятерых на грань смерти.','Нет данных'),(9791,'Осенние листья',1956,107,0.0,6.9,243,'1956-08-01','https://st.kp.yandex.net/images/film_iphone/iphone360_9791.jpg','Autumn Leaves','Милли, нелепая непривлекательная женщина, знакомится с тихим и скромным Бертом Хэнсоном. Она жаждет любви, хватается за нее руками и ногами, а получает в результате шизофреника.','Нет данных'),(9795,'Чудовище с глубины 20000 морских саженей',1953,80,0.0,6.4,487,'1953-06-13','https://st.kp.yandex.net/images/film_iphone/iphone360_9795.jpg','The Beast from 20,000 Fathoms','В результате испытаний ядерного оружия в Арктике, просыпается к жизни плотоядный динозавр. Сомнения ученых исчезают, когда гигантский монстр устремляется к Нью-Йорку…','$210 000'),(9798,'Плохие девчонки из высокой долины',2005,84,0.0,5.4,179,'2005-03-22','https://st.kp.yandex.net/images/film/9798.jpg','Bad Girls from Valley High','Даниэль и ее богатые подруги Тиффани и Брук думают только о собственных удовольствиях. В прошлом году они совершили убийство одной из учениц, и теперь на них сходит какое-то проклятье — все три девушки начинают преждевременно стареть. Даниэль готова пожертвовать всем, лишь бы получить свою молодость обратно…','Нет данных'),(9799,'Хэллоуин: 20 лет спустя',1998,86,0.0,6.3,7033,'1998-07-27','https://st.kp.yandex.net/images/film_iphone/iphone360_9799.jpg','Halloween H20: 20 Years Later','Спустя 20 лет Лори Строуд опять вынуждена бороться со своим прошлым! Эти годы она жила под вымышленным именем вместе с сыном Джоном. Но Майкл Майерс внезапно вернулся в ее жизнь с местью. С местью не только к Лори. Ужас начался для всего города! Когда группа студентов отправляется на праздник Хэллоуин, они оказываются в кровавой реке. И снова Лори должна спасти всех от исчадья Ада.','$17 000 000'),(9801,'Туман',1980,89,0.0,6.6,4128,'1980-02-01','https://st.kp.yandex.net/images/film_iphone/iphone360_9801.jpg','The Fog','В маленьком рыбацком городке обитают духи погибших моряков. Ровно сто лет назад у скал разбилось судно с рыбаками, и вот теперь город окутывает плотный туман, который разрывают буйные призраки прошлого.','$1 000 000'),(9804,'Ночь Лепуса',1972,88,0.0,4.8,185,'1972-09-08','https://st.kp.yandex.net/images/film_iphone/iphone360_9804.jpg','Night of the Lepus','В США количество одичавших кроликов достигло критического уровня. Они стали делать набеги: пожирать урожай, уничтожать домашних животных и имущество людей.<br><br>Ученый Рой Беннет стал задумываться над вопросом: возможно ли уничтожить кроликов не причинив вреда остальному животному и растительному миру? Он провел эксперимент по испытанию новой сыворотки, и сам того не ведая, вывел новую породу кроликов-мутантов.','Нет данных'),(9806,'Любой ценой',1967,121,0.0,7.0,82,'1967-09-28','https://st.kp.yandex.net/images/film_iphone/iphone360_9806.jpg','Ad ogni costo','Ушедший на пенсию университетский профессор, долгие годы мечтавший ограбить бриллиантовую компанию в Бразилии, при помощи своего давнего друга, ныне криминального босса, собирает команду взломщиков. Под руководством бывшего военного они выезжают в Рио.','Нет данных'),(9810,'Харпер',1966,121,0.0,7.0,557,'1966-02-23','https://st.kp.yandex.net/images/film_iphone/iphone360_9810.jpg','Harper','Частного детектива из Лос-Анджелеса Лью Харпера нанимает циничная богатая дама для поисков своего пропавшего мужа. Расследование сталкивает детектива с самыми сомнительными персонажами — стареющая актриса, певица из ночного клуба, глава религиозной секты, контрабандисты.','$3 500 000'),(9814,'Кто была та леди?',1959,109,0.0,7.3,231,'1960-04-08','https://st.kp.yandex.net/images/film_iphone/iphone360_9814.jpg','Who Was That Lady?','Энн Уилсон застает своего мужа Дэвида — преподавателя химии Колумбийского университета, целующимся со студенткой. Чтобы спасти брак, Дэвид просит друга-писателя Майкла, сочиняющего сценарии для телешоу, придумать и для его поступка оправдательную легенду. Майк предлагает Дэвиду признаться жене в том, что он агент ФБР под прикрытием.','Нет данных'),(9816,'Моя сестра Эйлин',1955,108,0.0,6.7,110,'1955-09-22','https://st.kp.yandex.net/images/film_iphone/iphone360_9816.jpg','My Sister Eileen','Рут и ее красавица сестра Эйлин приезжают в «Гринвич Виллидж» в Нью-Йорке в поисках славы и удачи. Рут мечтает стать писательницей, а Эйлин — актрисой. Рут привлекает внимание издателя плейбоя Боба Бэйкера, когда тот решает опубликовать историю о ее сестре. Чтобы поддерживать к себе его интерес, Рут пытается убедить Боба в том, что она и Эйлин на самом деле один и тот же человек…','Нет данных'),(9818,'Полицейский-мошенник',1954,92,0.0,5.7,88,'1954-09-17','https://st.kp.yandex.net/images/film_iphone/iphone360_9818.jpg','Rogue Cop','У детектива Криса Келвана есть брат Эдди, который тоже работает в полиции. Он стал свидетелем того, как убийца сбежал с места преступления. Крис связывается с гангстером Бьюмонте, который готов заплатить 15000 долларов, если Эдди откажется от своих показаний.','Нет данных'),(9819,'Черный щит Фолуорта',1954,99,0.0,6.5,104,'1954-09-02','https://st.kp.yandex.net/images/film_iphone/iphone360_9819.jpg','The Black Shield of Falworth','Англия, XV век. Юноша Майлз и его сестра Мэг выросли в крестьянской семье, не зная своих родителей. От отца им осталось массивное золотое кольцо с гербом, на котором изображен черный щит. Понимая, что такая вещь не могла принадлежать простому человеку, Майлз решает во что бы то ни стало раскрыть тайну своего рождения…','Нет данных'),(9827,'Скарамуш',1952,115,0.0,7.3,449,'1952-05-08','https://st.kp.yandex.net/images/film_iphone/iphone360_9827.jpg','Scaramouche','Андре Моро — незаконный сын знатного аристократа, не знающий, кто его отец, теряет друга, написавшего листовку о свободе, равенстве, братстве. Его товарищ пал от руки лучшего дуэлянта Франции — маркиза Де Мэйна и умер у него на руках.<br><br>Моро поклялся, что убийца умрет от его руки такой же точно смертью. Но для этого весельчаку и сорванцу, плевавшему на политику и считавшему весь мир одним сумасшедшим домом, нужно было научиться фехтовать. И он научился…','$3 500 000'),(9830,'Праздничный роман',1949,87,0.0,7.3,192,'1949-11-23','https://st.kp.yandex.net/images/film_iphone/iphone360_9830.jpg','Holiday Affair','Мать одиночка Конни, растит шестилетнего сына и работает коммерческим шпионом — ходит по магазинам, покупает, меняет, ради изучения спроса. Однажды под рождество Конни покупает детскую железную дорогу с целью сдать ее на следующее утро. Симпатичный продавец, выслушав ее слезливую историю, оформляет ей возврат товара и теряет работу. Таким образом Конни и Стив знакомятся и проводят почти весь день вместе. Конни почти забыла, что ответила согласием своему жениху Карлу, выйти за него замуж на новый год, но до него остается еще целых пять дней. Стив же, прекрасно ладящий с детьми, находит в лице Тимми, сына Конни, своего самого большого друга.','Нет данных'),(9832,'Сага о Форсайтах',1949,113,0.0,6.9,178,'1949-11-03','https://st.kp.yandex.net/images/film_iphone/iphone360_9832.jpg','That Forsyte Woman','Лондон. 1886 год. В доме старого Джолиона семейное торжество, прием в честь помолвки мисс Джун Форсайт с мистером Филипом Босинни.<br><br>Так начинается фильм английского режиссера Комптона Беннетта, снятого по мотивам первой части великого романа Джона Голсуорси «Сага о Форсайтах», ставшего, как и сама книга — мировой классикой. «Сага о Форсайтах» — это сама жизнь, во всей своей трагичности, в радостях и потерях.','Нет данных'),(9834,'Маленькие женщины',1949,122,0.0,7.3,311,'1949-03-10','https://st.kp.yandex.net/images/film_iphone/iphone360_9834.jpg','Little Women','Гражданская война в США. Сестры Мэг, Джо, Бесс и Эмми Марч живут дружно, невзирая на внешние обстоятельства. Их отец находится на фронте, и семье, ведомой их любимой мамой, необходимо как-то свести концы с концами. Существенную помощь семейству оказывают их сосед мистер Лоуренс и его внук Лори…<br /><br />Это история о взрослении сестер Марч, об их первой любви, надеждах и разочарованиях, о формировании их жизненной позиции и начале самостоятельной жизни.','Нет данных'),(9841,'Маленький человек Тейт',1991,99,0.0,6.8,338,'1991-09-06','https://st.kp.yandex.net/images/film_iphone/iphone360_9841.jpg','Little Man Tate','Жил-был мальчик по имени Фред Тэйт. Он читал, рисовал, играл на пианино, сочинял стихи, считал в уме, мог назвать число, которое, если его умножить на кубический корень из… Короче, Фред был обыкновенным вундеркиндом. Его мама, конечно, души не чаяла в сыночке и считала его самым лучшим на свете и не таким, как все, но покажите маму, которая другого представления о собственном ребенке.<br><br>Диди никуда и никому не собиралась отдавать Фреда, но однажды решила согласиться на предложение Джейн Грирсон, руководительницы Института, профессора и автора многочисленных книг об одаренных детях. И Фред отправился сначала в путешествие со своими сверстниками, а затем — в колледж, где начал изучать точные науки наравне со взрослыми студентами. И даже давал им списывать…','$10 000 000'),(9842,'Обвиняемые',1988,111,0.0,7.2,3065,'1988-10-14','https://st.kp.yandex.net/images/film_iphone/iphone360_9842.jpg','The Accused','Героиня этого фильма, Сара Тобиас, рассказывает свою ужасную историю прокурору Кэтрин Мерфи. Сара была безжалостно изнасилована тремя мужчинами в баре. Однако преступников приговаривают лишь к небольшому сроку за хулиганство.<br><br>Такое решение суда было основано на заключении следствия, в котором утверждалось, что Сара сама спровоцировала обвиняемых на насилие. По просьбе девушки, Мерфи начинает заново расследовать обстоятельства этого странного дела. Теперь прокурору предстоит выяснить: что же в действительности произошло тем страшным вечером в баре?','$6 000 000'),(9843,'Украсть дом',1988,98,0.0,6.4,106,'1988-08-10','https://st.kp.yandex.net/images/film_iphone/iphone360_9843.jpg','Stealing Home','Баскетболист средних лет, Марк Хэрмон, возвращается в свой родной город, где начинает вспоминать события своей юности, связанные с его первой возлюбленной, покончившей жизнь самоубийством.','Нет данных'),(9844,'Чужой кровью',1984,131,0.0,6.4,1514,'1984-05-02','https://st.kp.yandex.net/images/film_iphone/iphone360_9844.jpg','Le sang des autres','Молодая героиня по имени Элен оказывается невольной участницей Сопротивления, поскольку в это антифашистское движение активно вовлечён Жан, её любимый, а с другой стороны, она не отвергает ухаживаний со стороны представителя немецкой администрации по фамилии Бергман. <br><br>Девушка не сразу осознаёт, что в сложившейся исторической ситуации многие обычные люди являются лишь марионетками в игре политиков и тех, кто развязал войну за передел сфер влияния в мире, что своеобразной разменной монетой в этом противостоянии властных интересов выступает жизнь целых народов, и всё здесь делается «чужой кровью», за счёт принесения в жертву «других», кем может стать практически каждый…','Нет данных'),(9846,'Кэрни',1980,107,0.0,6.8,125,'1980-05-23','https://st.kp.yandex.net/images/film_iphone/iphone360_9846.jpg','Carny','Фрэнки слегка безмозглый амбал в клетке, который безжалостно издевается над зрителями, а те пытаются загнать его под воду, кидая в него бейсбольными мячами. Он гуляет со сбежавшей из дома Донной. По мере того, как они продвигаются на Юг, Донна постепенно ассимилируются в банду отверженных и развивается уже любовный треугольник.','Нет данных'),(9847,'Лисы',1980,106,0.0,6.4,345,'1980-02-29','https://st.kp.yandex.net/images/film_iphone/iphone360_9847.jpg','Foxes','История взросления и обретения жизненного опыта четырьмя молодыми девушками, живущими в одной квартире в Лос-Анджелесе. Что составляет их жизнь? Конечно же, секс, любовь, наркотики, ссоры с родителями.','Нет данных'),(9848,'Усадьба Кэндлшу',1977,101,0.0,7.2,222,'1977-12-16','https://st.kp.yandex.net/images/film_iphone/iphone360_9848.jpg','Candleshoe','Молодая сирота Кейси и хитрый мошенник настроены найти клад. Но сначала они должны обхитрить владелицу усадьбы Кенделшу…','Нет данных'),(9849,'Пляжный домик',1977,106,0.0,5.2,127,'1977-10-28','https://st.kp.yandex.net/images/film/9849.jpg','Casotto','Летнее воскресенье в маленьком пляжном домике у побережья Рима. Множество людей и историй: женская баскетбольная команда; два помешанных на спорте солдата; двое мужчин со своими подружками; священник с большим секретом; пожилая пара со своей беременной внучкой; и помолвленная пара, собирающаяся заняться сексом в первый раз.','Нет данных'),(9851,'Чумовая пятница',1976,95,0.0,6.8,372,'1976-12-17','https://st.kp.yandex.net/images/film_iphone/iphone360_9851.jpg','Freaky Friday','Домохозяйка Эллен Эндрюс и ее дочь-подросток Аннабель никак не могут найти общий язык друг с другом, из-за чего постоянно ссорятся. Однажды в четверг, они загадывают одинаковое желание — оказаться на месте друг друга, которое исполнятся на следующий день, в пятницу.','Нет данных'),(9852,'Багси Мэлоун',1976,93,0.0,7.3,2003,'1976-07-22','https://st.kp.yandex.net/images/film_iphone/iphone360_9852.jpg','Bugsy Malone','Нью-Йорк, 1929 год, разгар сухого закона и гангстерских войн. Денди Дэн, заклятый враг Толстого Сэма, поклялся уничтожить его подпольный ночной клуб. Помочь Сэму может только Багси Мэлоун. Чтобы достать деньги для своей подружки, певицы Блаузи, мечтающей о карьере в Голливуде, Багси соглашается напасть на склад оружия Дэна.','Нет данных'),(9854,'Том Сойер',1973,103,0.0,6.6,207,'1973-03-14','https://st.kp.yandex.net/images/film_iphone/iphone360_9854.jpg','Tom Sawyer','Тому Сойеру и Геку Финну, двум мальчишкам-сорванцам из маленького американского городка, всегда есть чем заняться. Они рыбачат на реке Миссисипи, играют в пиратов или подшучивают над кем-то. Приезд в город красавицы Бекки Тэтчер нисколько не усмиряет их пыл, а только подливает масла в огонь. Когда Гек внезапно попадает в беду, Том Сойер оказывается единственным, кто может прийти ему на помощь в трудной ситуации. Ведь мальчишек связывает не только общее веселое детство, но и настоящая мужская дружба.','Нет данных'),(9855,'Наполеон и Саманта',1972,92,0.0,6.3,121,'1972-07-05','https://st.kp.yandex.net/images/film_iphone/iphone360_9855.jpg','Napoleon and Samantha','Кто в детстве не мечтал о собаке или даже о собственном льве? У 11-летнего Наполеона, что живет с дедушкой в маленьком американском городке, неожиданно появился друг — лев по кличке Мейджор.<br><br>Он очень добрый и любит молоко, а еще когда Наполеон со своей 10-летней подружкой Самантой отправляются в путешествие к другу Дэнни, что живет далеко за горами, то Мэйджер спасает их и от дикой рыси и от бурого медведя живущего в лесной чаще.','Нет данных'),(9857,'Витая в облаках',2001,117,0.0,6.7,175,'2002-02-01','https://st.kp.yandex.net/images/film_iphone/iphone360_9857.jpg','Kuutamolla','Любовь идеальна только в книгах и фильмах. Все это знают. Но Иирис, скромная 30-летняя продавщица в книжном магазине, отказывается в это верить и, вопреки мнению своих друзей, надеется найти идеальную любовь в мире кино, чтобы изменить собственную жизнь. Молодой многообещающий режиссёр Марко, казалось бы, отвечает требованиям Иирис. Но кто же всё-таки прав — циники или романтики? Какой ответ получит Иирис?','FIM 7 400 000'),(9861,'Дьявол и Дэниэл Уэбстер',2004,106,0.0,6.1,6060,'2004-04-23','https://st.kp.yandex.net/images/film_iphone/iphone360_9861.jpg','Shortcut to Happiness','Начинающий Нью-Йоркский писатель заключает сделку с Дьяволом с тем, чтобы добиться литературного успеха и стать автором бестселлеров в обмен на свою душу по истечении десяти лет.<br /><br />Года пролетают как часы, и вскоре преуспевающий писатель вынужден молить о помощи Дэниэла Уэбстера, искусного адвоката и главу самой преуспевающей издательской фирмы в Нью-Йорке, чтобы избавиться от заключённой сделки. Результатом этого станет захватывающая битва умов и речей на судебном процессе между Дьяволом и Дэниэлом Уэбстером, ставкой на котором будет душа писателя.','$35 000 000'),(9864,'Прожить жизнь с Пикассо',1996,125,0.0,7.1,1859,'1996-09-04','https://st.kp.yandex.net/images/film/9864.jpg','Surviving Picasso','Холст, краски, металл, керамика. Они были послушны воле этого выдающегося художника XX века. Но что известно о другой великой страсти легендарного Пабло Пикассо? Была ли любовь также подчинена его гению?','$16 000 000'),(9865,'Август',1996,94,0.0,6.5,361,'1996-02-16','https://st.kp.yandex.net/images/film_iphone/iphone360_9865.jpg','August','В один прекрасный летний день размеренная жизнь обитателей поместья нарушилась. Что-то случилось, и все, что раньше скрывалось, выплеснулось наружу, обнажая души и направляя течение судеб в новое русло.','Нет данных'),(9866,'Дорога на Вэлвилл',1994,118,0.0,6.7,1861,'1994-10-28','https://st.kp.yandex.net/images/film_iphone/iphone360_9866.jpg','The Road to Wellville','Герои фильма, муж и жена, приезжают в санаторий доктора Келлога, и им приходится пережить все мучения, связанные с его медицинскими постулатами, а именно: только вегетарианская пища и никакой сексуальной жизни, плюс бесконечные физические упражнения при помощи различных тренажеров.','$25 000 000'),(9867,'Страна теней',1993,131,0.0,7.6,1169,'1993-12-25','https://st.kp.yandex.net/images/film_iphone/iphone360_9867.jpg','Shadowlands','Фильм основан на реальных событиях. Действие разворачивается в Оксфорде в 1950-х годах. Фильм повествует об истории трагической любви Льюиса к Джой Грэшем и их короткой супружеской жизни, прерванной её смертью от рака.','$22 000 000'),(9868,'Невиновный',1993,119,0.0,6.3,215,'1993-09-16','https://st.kp.yandex.net/images/film_iphone/iphone360_9868.jpg','The Innocent','Наблюдая процесс разрушения Берлинской стены, британец Леонард Марнем вспоминает о своем драматическом романе с немкой Марией, который случился после Второй мировой войны. В ту пору он участвовал в секретной операции американской и британской спецслужб…','Нет данных'),(9869,'Эксперт',1992,85,0.0,6.1,208,'1992-01-23','https://st.kp.yandex.net/images/film/9869.jpg','Spotswood','Эррол Уоллес, специалист по оценке состояния промышленных предприятий и прогнозирования их будущего развития, приезжает в маленький городок Споттсвуд, где находится фабрика по производству мокасин.<br><br>После гигантских суперколоссов типа автомобильных корпораций он оказывается в маленьком цехе, где работники ходят в домашних тапочках и халатах.','Нет данных'),(9870,'Рокот неодобрения',1988,105,0.0,6.4,144,'1989-08-18','https://st.kp.yandex.net/images/film_iphone/iphone360_9870.jpg','A Chorus of Disapproval','По жанру — это веселая комедийная история о стеснительном, довольно нервном вдовце Гае Джонсе, который, приехав в тихий приморский городок, вступает в местное общество любителей оперы.','Нет данных'),(9871,'Чаринг Кросс Роуд, 84',1987,100,0.0,7.3,442,'1987-02-13','https://st.kp.yandex.net/images/film_iphone/iphone360_9871.jpg','84 Charing Cross Road','Действие фильма происходит в Лондоне и Нью-Йорке и начинается в 1949 году. Элен Ханфф — американская писательница, увлекающаяся коллекционированием старых книг. Она просматривает объявления о продаже старых изданий и однажды откликается на объявление о продаже раритетной книги в магазине, который находится в буквальном смысле за океаном, а именно в Лондоне. Так начинается двадцатилетний роман в письмах между американкой и британцем, заведующим книжным магазином.','Нет данных'),(9872,'Хороший отец',1986,90,0.0,6.3,123,'1986-08-29','https://st.kp.yandex.net/images/film_iphone/iphone360_9872.jpg','The Good Father','Немолодой отец, расставшись с супругой, не может часто видеть сына. Мужчина не может решить свои проблемы, но помогает другу, находящемуся в таком же положении.','Нет данных'),(9873,'Магия',1978,107,0.0,7.0,1040,'1978-11-08','https://st.kp.yandex.net/images/film_iphone/iphone360_9873.jpg','Magic','Корки Уинтерс — чревовещатель. Его выступления вместе с его марионеткой, так называемым «внутренним голосом» по имени Фэтс имеют большой успех у публики. Но Корки оставляет выступления и возвращается в родные края, где встречает подругу детства Пегги, вышедшую замуж. Корки соблазняет ее благодаря магическим заклинаниям. Он начинает вести размеренную жизнь и, как считает, обрёл душевное равновесие. Но его агент упорно преследует его и требует вернуться на театральную сцену…','$7 000 000'),(9874,'Международный приз «Вельвет»',1978,127,0.0,6.9,141,'1978-07-19','https://st.kp.yandex.net/images/film_iphone/iphone360_9874.jpg','International Velvet','Американская девочка Сара Браун, когда-то потерявшая своих родителей, приезжает в Англию погостить у своей тети Вельвет, которую она никогда раньше не видела. Вельвет, в детстве чем-то напоминавшая юную Сару, содержит в своем поместье целую конюшню ездовых лошадей, некоторые из которых периодически участвуют в соревнованиях.<br><br>Именно здесь, в глухой британской провинции, Сара начинает по-настоящему взрослеть, а также обретает новых друзей, среди которых есть и скаковая лошадь, с которой девочку связывают особенно теплые отношения.','Нет данных'),(9875,'Чужая дочь',1977,108,0.0,6.1,310,'1977-03-21','https://st.kp.yandex.net/images/film/9875.jpg','Audrey Rose','Все о чем мечтают Билл и Дженет Темпелтон, это спокойная, неторопливая жизнь со своей 11-летней дочерью Иви. Но их мечты в мгновение ока превращаются в прах: у Иви появляются видения о жутких событиях, которые с ней никогда не происходили, а их самих начинает маниакально преследовать странный незнакомец, пытающийся убедить их в том, что Иви не их дочь.<br><br>И когда бывшая счастливая пара думает, что ничего хуже этого произойти не может, они сталкиваются с ужасом, который не увидишь даже в самых страшных снах, — с силой из загробного мира, пытающейся уничтожить самое ценное, что есть в их жизни — их дочь.','Нет данных'),(9876,'Все создания, большие и малые',1975,92,0.0,6.8,93,'1975-02-04','https://st.kp.yandex.net/images/film_iphone/iphone360_9876.jpg','All Creatures Great and Small','История молодого помощника под руководством эксцентричного старшего ветеринара в сельской местности Англии, и его стеснительного ухаживания за дочерью местного фермера.','Нет данных'),(9877,'Девушка с Петровки',1974,103,0.0,6.0,212,'1974-08-22','https://st.kp.yandex.net/images/film/9877.jpg','The Girl from Petrovka','История любви американского журналиста Джо Мэррика и русской девушки с патриотическим именем Октябрина. Будущую пару познакомил общий друг Костя, с которым Джо вкушал запретные плоды московского «андеграунда».<br><br>Всё, за чем проводила время эта милая девушка — блошиный рынок, занятия балетом и музыкально-декадентские посиделки в компании мыслящих и дерзких. Однако в суровых глазах советского общества невинный досуг Октябрины выглядит гнусным тунеядством и, естественно, вызывает интерес КГБ…','Нет данных'),(9878,'Кукольный дом',1973,105,0.0,7.0,255,'1973-04-10','https://st.kp.yandex.net/images/film_iphone/iphone360_9878.jpg','A Doll\'s House','Экранизация пьесы Генрика Ибсена. Ради блага своих близких миссис Хэммерт совершила, мягко говоря, нехороший поступок. И родственники ее же осудили. Развернувшиеся события показывают молодой женщине, как призрачно ее счастье и благополучие…','Нет данных'),(9879,'Когда пробьет 8 склянок',1971,94,0.0,6.5,314,'1971-03-09','https://st.kp.yandex.net/images/film_iphone/iphone360_9879.jpg','When Eight Bells Toll','Исчез корабль, на котором находился особо ценный груз: немалое количество слитков золота. Очевидно, что в этом районе моря бандитствуют пираты. Кто они? Где их логово? Как найти на них управу? Для того, чтобы попытаться ответить на целую кучу вопросов, в опасный регион отправляется спецагент.','Нет данных'),(9880,'Зеркальная война',1970,108,0.0,6.3,176,'1970-01-02','https://st.kp.yandex.net/images/film_iphone/iphone360_9880.jpg','The Looking Glass War','Молодой поляк сбежал с корабля, чтобы попросить политического убежища в Англии. На парня сразу же насели спецслужбы и вот он уже едет в Восточную Германию, чтобы проверить истинность одного странного фотоснимка, запечатлевшего ракеты там, где их быть не должно. Он входит в игру. Игру без кавычек.<br><br>Профессиональным разведчикам и Запада, и Востока, как выясняется, нет дела до парня, фотоснимка, ракет и прочей политики. Их интересует только победа в игре: кто кого перехитрит? Шахматы, одним словом. А люди — пешки…','Нет данных'),(9881,'Белый автобус',1967,46,0.0,5.9,143,'1979-12-21','https://st.kp.yandex.net/images/film_iphone/iphone360_9881.jpg','The White Bus','История о девушке, которая уже сыта по горло работой в Лондоне. Она едет домой в Манчестер. Она стоит на пустынной автобусной остановке в середине уничтоженных террас. В это время прибывает белый автобус для туристов. Более того, это первый рейс. Мэр и другие сановники совершают тур по фабрикам, библиотекам и другим достопримечательностям. Героиня фильма к ним присоединяется…','Нет данных'),(9886,'Песня Карлы',1996,127,0.0,7.2,207,'1996-09-20','https://st.kp.yandex.net/images/film_iphone/iphone360_9886.jpg','Carla\'s Song','Действие фильма происходит в 1987 году — в период противостояния независимой Никарагуа и военизированных отрядов под руководством США. События начинают развиваться в Британии, где жизнь течёт мирно, люди заняты своими повседневными проблемами и заботами, а о войнах и революциях знают лишь по газетам, радио и телевизору. Но вдруг беспечный британец оказывается непосредственно в зоне боевых действий, и его реакция вполне естественна — вернутся назад, туда, где было спокойно и безопасно.','Нет данных'),(9887,'Ночной беглец',1995,93,0.0,6.2,342,'1995-01-19','https://st.kp.yandex.net/images/film_iphone/iphone360_9887.jpg','Night of the Running Man','Джерри Логан работал таксистом в Лас-Вегас до тех пор, пока однажды не обнаружил сумку с миллионом долларов на заднем сидении своего автомобиля.<br><br>Неудачник-пассажир, оставивший деньги, бежал от мафии. И, когда Джерри пытается покинуть страну с этими деньгами, он обнаруживает, что за ним по пятам следует безжалостный профессиональный убийца Дэвид Экхард.','Нет данных'),(9888,'Избиение младенцев',1993,104,0.0,5.6,157,'1993-06-01','https://st.kp.yandex.net/images/film_iphone/iphone360_9888.jpg','Slaughter of the Innocents','Маньяка-убийцу, который расправляется с маленькими детьми, возомнив себя словно Ноем, обязанным взять в свой ковчег «каждой твари по паре», ищет не только агент ФБР, но и его отпрыск-вундеркинд, довольно рано увлёкшийся расследованием запутанных дел.','Нет данных'),(9889,'Элитный отряд',1993,96,0.0,5.9,139,'1993-06-26','https://st.kp.yandex.net/images/film_iphone/iphone360_9889.jpg','Extreme Justice','Полицейский спецназ безжалостно уничтожает самых прожженных преступников нетрадиционными методами, не укладывающимися в рамки закона и нормальной полицейской практики. Его тактика беспощадна — случайные свидетели и потерпевшие считаются неизбежными жертвами — и весьма эффективна.<br /><br />Он становится фактически тайным эскадроном смерти полиции Лос-Анжелеса. Новый шеф департамента полиции не только подтверждает существование элитного отряда, но и обещает провести расследование его деятельности. За расследование также берется журналистка, состоящая в интимных отношениях с новичком отряда.','Нет данных'),(9891,'Беспредел',1988,98,0.0,6.2,326,'1988-03-11','https://st.kp.yandex.net/images/film/9891.jpg','Off Limits','Действие этого фильма происходит в 1968 году, в разгар войны в Сайгоне. От рук кровавого убийцы одна за другой погибают вьетнамские проститутки, у которых рождаются дети от американских солдат.<br><br>Двое офицеров военно — полицейского подразделения армии США, переодетые в гражданское, начинают опасную охоту за неуловимым и коварным преступником.','Нет данных'),(9893,'Смерть телохранителя',1987,87,0.0,5.9,212,'1987-09-04','https://st.kp.yandex.net/images/film_iphone/iphone360_9893.jpg','Man on Fire','Когда бывшего агента ЦРУ Кризи нанимают охранять дочь влиятельного итальянского бизнесмена он охотно берется за дело, зная, что богатый опыт оперативной работы выручит его в любой ситуации. Юная Сэм и ее суровый телохранитель становятся лучшими друзьями, однако внезапные и страшные события показывают, что девочке нужно не только его общество но и профессиональные навыки — неизвестная банда похищает Сэм, требуя за ее жизнь миллион долларов.<br><br>Не доверяя полиции, Кризи в одиночку отправляется на поиски злодеев. Он умеет жестоко и коварно расправляться с врагами, изощренная месть — его конек, но жизнь давно научила его, что даже самому опытному и бесстрашному профи однажды может изменить удача, бросив его в объятия смерти…','Нет данных'),(9894,'Река',1984,122,0.0,7.0,775,'1984-12-19','https://st.kp.yandex.net/images/film_iphone/iphone360_9894.jpg','The River','Фермеры Том и Мэй Гарви борются за свою землю с местными властями, которые планируют затопить ее для строительства гидроэлектростанции.','$18 000 000'),(9895,'Вызов',1982,113,0.0,6.2,185,'1982-07-23','https://st.kp.yandex.net/images/film_iphone/iphone360_9895.jpg','The Challenge','Американский боксер Рик оказывается втянутым в конфликт между двумя братьями-японцами Тору и Хидео из-за права обладания древними семейными мечами.','Нет данных'),(9902,'Измученные походом',1995,90,0.0,7.1,878,'1995-08-04','https://st.kp.yandex.net/images/film_iphone/iphone360_9902.jpg','Bushwhacked','Макс Грабельски, работающий курьером, однажды узнает, что хозяин ловко использовал его для своих темных «делишек». Но хуже всего другое — теперь он мертв. Опасаясь, что в убийстве заподозрят его, Макс решает скрыться.<br><br>А полиция уже идет по следу. И тогда он в качестве руководителя группы бойскаутов отправляется в путешествие по горам. Правда, парень понятия не имеет, как обращаться со своими новыми подопечными…','Нет данных'),(9903,'Шепоты в ночи',1992,103,0.0,6.0,170,'1992-08-07','https://st.kp.yandex.net/images/film_iphone/iphone360_9903.jpg','Whispers in the Dark','Энн Хекер, нью-йоркскому психиатру, часто грезится один и тот же сон, вызванный рассказом ее пациентки о своем любовнике. После того, как Энн знакомится с Дугом и страстно влюбляется в него, она обнаруживает, что он и есть возлюбленный ее подопечной, которая неожиданно умирает.<br><br>Подозрения терзают Энн, и ее жизнь превращается в навязчивый кошмар. Ситуация становится еще более запутанной и опасной, когда появляется зловещий художник, бывший пациент психиатра, в прошлом замешанный в серии сексуальных преступлений. Профессиональному и личному достоинству Энн брошен вызов, и сама ее жизнь оказывается под угрозой…','Нет данных'),(9904,'Домоуправ',1991,95,0.0,7.1,870,'1991-10-04','https://st.kp.yandex.net/images/film_iphone/iphone360_9904.jpg','The Super','Луи Критский получил в подарок от отца жилой дом. Один из 27 по 1 миллиону долларов каждый — часть его наследства. Отец просит сына только об одном — не исправлять ни единого повреждения и не чинить неисправности. И как назло, суд по жалобе одного из жильцов, выносит решение о наказании Луи за нежелание поддерживать порядок во вверенном ему доме.<br><br>Луи вынужден подчиниться судебному приговору — самому жить в доме, которые является его собственностью, без права ремонтировать что-либо в своей квартире, пока не будет отремонтирован весь дом.','$22 000 000'),(9905,'Сироты',1987,115,0.0,6.7,82,'1987-09-11','https://st.kp.yandex.net/images/film_iphone/iphone360_9905.jpg','Orphans','Криминальный авторитет похищается ради выкупа двумя отчаявшимися братьями-подростками. Они держат его в заброшенном жилище, однако со временем он становится для них человеком, заменяющим отца.','Нет данных'),(9906,'Неприличное везение',1987,99,0.0,7.3,1005,'1987-01-30','https://st.kp.yandex.net/images/film_iphone/iphone360_9906.jpg','Outrageous Fortune','Лорен и Сэнди — вечно соперничающие и ссорящиеся актрисы, чей талант состоит не столько в умении вдохновенно играть, сколько в умении притягивать к себе неприятности. Вершина их незадачливости: обе независимо друг от друга влюбились в одного и того же парня по имени Майкл, который к тому же оказался международным шпионом и однажды исчез при странных обстоятельствах.<br><br>Сам исчез, а вот свои проблемы с законом прихватить забыл! Надо ли говорить, что они достались по наследству Лорен и Сэнди, не ведающих, что стали объектом внимания спецслужб, катастрофически заблуждающихся по поводу вовлеченности наивных простушек в дела коварного Майкла…','Нет данных'),(9913,'Ваня с 42-й улицы',1994,119,0.0,7.4,633,'1994-09-10','https://st.kp.yandex.net/images/film_iphone/iphone360_9913.jpg','Vanya on 42nd Street','Актёры захудалого театра на 42-й улице Нью-Йорка репетируют классическую пьесу Чехова «Дядя Ваня». Пьеса идёт последовательно, действие за действием, с небольшими перерывами, чтобы заменить реквизит и передохнуть. Недостаток костюмов, настоящей бутафории и декораций вскоре забывается.','Нет данных'),(9914,'Модернисты',1988,126,0.0,7.1,582,'1988-04-15','https://st.kp.yandex.net/images/film_iphone/iphone360_9914.jpg','The Moderns','Артистический мир Парижа 20-х годов предстает перед зрителем как обобщающий образ, романтический мир, в котором живет группа американцев в самое интересное время новаторства и творческой активности. Ник Харт никак не может добиться признания как художник. Журналист Уазо, пишущий для «Трибун» о светских сплетнях, мечтает только о Голливуде.<br><br>Бертрам Стоун — элегантный, богатый торговец предметами искусства со склонностью к насилию. Его жена, Рэйчел, с которой у Ника есть прошлое и, как он надеется, будущее. Сам Эрнест Хемингуэй пишет за стойкой бара. Важны образы Либби, обедневшей галерейщицы, и Натали, покровительницы искусств, подбивающей Ника подделать несколько картин.','Нет данных'),(9916,'Обезьяна-убийца',1988,113,0.0,6.1,615,'1988-07-29','https://st.kp.yandex.net/images/film_iphone/iphone360_9916.jpg','Monkey Shines','Подающий надежды студент Аллан в результате несчастного случая оказывается прикован к инвалидному креслу. Чтобы помочь ему выйти из депрессии и снова обрести волю к жизни, его друг Джефри — гениальный ученый, работающий над повышением интеллекта у обезьян — решает подарить ему самку капуцина, плод своих экспериментов.<br><br>Чтобы обучить обезьяну уходу за больным, Джефри обращается к дрессировщице Мелани. Аллан и Элла, так он называет нового друга, прекрасно находят общий язык, и через некоторое время Элла начинает даже предвосхищать многие просьбы Аллана. Все идет хорошо, симпатия, возникшая между Мелани и Алланом, начинает развиваться в более сильное чувство. Но однажды открываются темные стороны обезьяны.','$7 000 000'),(9917,'День мертвецов',1985,96,0.0,6.9,5336,'1985-06-30','https://st.kp.yandex.net/images/film_iphone/iphone360_9917.jpg','Day of the Dead','Планета находится во власти нечисти. Только горстка людей осталась на Земле — и именно они должны сразиться с живыми мертвецами. Но как обуздать это порождение ада? Все попытки сделать это безуспешны. Более того, ученый — маньяк доктор Логан задался целью сделать из ужасных монстров солдат-зомби, бесстрашных и непобедимых. И оказалось, что живые ничуть не безопаснее мертвых. Сколько еще крови должно пролиться, прежде чем человечество остановит ужасное нашествие…','$3 500 000'),(9918,'Мартин',1976,95,0.0,6.6,904,'1977-05-18','https://st.kp.yandex.net/images/film_iphone/iphone360_9918.jpg','Martin','Подросток Мартин переезжает к родному дяде в другой город и ещё в поезде нападает на беззащитную девушку, чтобы поразвлечься и выпить её крови. На новом месте дядя Куда сразу устанавливает правила: никого не убивать в городе и не разговаривать с его внучкой. По всему дому развешан чеснок, но, как и распятия, это не отпугивает Мартина. Дядя уверен, что его племянник — носферату, проклятье семьи, а его внучка считает, что у парня небольшое нервное расстройство.','$80 000'),(9920,'Время ведьм',1972,104,0.0,5.0,301,'1973-04-18','https://st.kp.yandex.net/images/film/9920.jpg','Hungry Wives','С некоторых пор с Джоан Митчелл начало твориться нечто странное. Ее посещают кошмарные видения, и кажется, что это происходит наяву: отовсюду тянутся злобные руки, некто невидимый наблюдает из-за угла… В поисках спасения женщина обращается к черной магии…','$90 000'),(9921,'Безумцы',1973,103,0.0,5.8,923,'1973-03-16','https://st.kp.yandex.net/images/film_iphone/iphone360_9921.jpg','The Crazies','Близ американского городка под названием Эванс произошло падение самолёта, содержащего чрезвычайно опасный вирус, разработанный военными. Зараза попадает в водную систему города и люди один за другим «заболевают». Они начинают яростно набрасываться на своих родных и любимых, да и на нелюбимых тоже. Военные оперативно запирают город на карантин…','$275 000'),(9923,'Ночь живых мертвецов',1990,92,0.0,7.0,6365,'1990-10-19','https://st.kp.yandex.net/images/film_iphone/iphone360_9923.jpg','Night of the Living Dead','Брат и сестра приезжают навестить могилу своей матушки на кладбище в окрестностях Питтсбурга. Брат пугает сестру рассказами о зомби, не подозревая о том, что он весьма недалек от реальности. Внезапно на них набрасывается один из покойников; брата убивают, а Барбара убегает, обнаруживая по дороге фермерский дом. Через какое-то время к нему подъезжает Бен, в бензобаке машины которого кончился бензин. Они решают остаться в доме и готовиться к обороне. Позже выясняется, что в подвале дома прячутся еще несколько человек. Все вместе они должны забаррикадироваться и переждать страшную ночь — ведь зомби не станут сидеть на крыльце и ждать, пока люди выйдут сами — они будут пытаться прорваться внутрь — желание отведать человеческого мяса в них безумно сильно.','$4 200 000'),(9925,'Это случилось с Джейн',1959,94,0.0,6.8,110,'1959-05-24','https://st.kp.yandex.net/images/film_iphone/iphone360_9925.jpg','It Happened to Jane','Джейн Осгуд, хозяйка фирмы по рассылке живых омаров, волею случая оказывается втянутой в неравную борьбу с владельцем железнодорожной компании Гарри Мэлоуном. Неизвестно, чем бы закончилось дело, если бы не помощь друга детства Джорджа Денэма…','Нет данных'),(9928,'Любимая',1998,172,0.0,6.5,327,'1998-10-08','https://st.kp.yandex.net/images/film_iphone/iphone360_9928.jpg','Beloved','Чёрную рабыню навещает призрак погибшей дочери.','$80 000 000'),(9932,'Дьявол в голубом платье',1995,101,0.0,6.6,1391,'1995-09-16','https://st.kp.yandex.net/images/film_iphone/iphone360_9932.jpg','Devil in a Blue Dress','Оказывается, выжить на полях сражений гораздо легче, чем в послевоенном Лос — Анджелесе. Ветеран Второй мировой Изи Роулинс потерял работу и вскоре может лишиться и крыши над головой. Поэтому, когда ему предлагают выступить в роли частного детектива и найти таинственную красавицу, Изи сразу соглашается.<br><br>100 долларов за такое простое дело — более чем выгодная сделка. Однако умереть за 100 долларов не входило в его планы. Расследование приводит Роулинса в непредсказуемый мир большой политики, где человеческая жизнь не стоит ровным счетом ничего, — он и не мог предположить, что настоящая война начнется для него после войны.','$27 000 000'),(9935,'Майами Блюз',1989,97,0.0,6.4,763,'1990-04-20','https://st.kp.yandex.net/images/film_iphone/iphone360_9935.jpg','Miami Blues','Фред только что откинулся после очередной отсидки и прибыл в Майами — жить по-новому.','Нет данных'),(9936,'Дикая штучка',1986,114,0.0,6.8,902,'1986-11-07','https://st.kp.yandex.net/images/film_iphone/iphone360_9936.jpg','Something Wild','Девушка по имени Лулу «похищает» преуспевающего банкира Чарльза Дриггса, который не заплатил по счёту после обеда в кафе, и впутывает его в странные приключения. Вместе они отправляются в путешествие из Нью-Йорка в Пенсильванию, во время которого сдержанный и серьёзный Чарльз полностью попадает под обаяние независимой и дикой Лулу.','Нет данных'),(9943,'Не ищи смысла',1984,88,0.0,8.0,376,'1984-04-24','https://st.kp.yandex.net/images/film_iphone/iphone360_9943.jpg','Stop Making Sense','Фильм-концерт рок-группы The Talking Heads.','$1 200 000'),(9944,'Мелвин и Говард',1980,95,0.0,6.1,256,'1980-09-19','https://st.kp.yandex.net/images/film_iphone/iphone360_9944.jpg','Melvin and Howard','Простой рабочий по пути к себе домой, находит на обочине раненного старика и сажает к себе в машину. По пути они разговаривают и незнакомец представляется Говардом Хьюзом, а это известный миллиардер, авиатор, кинематографист и просто многогранная личность. Спаситель сначала не верит в честность спасенного и через некоторое время забывает тот случай на дороге, но последующие события заставляют вспомнить чудаковатого старца…','Нет данных'),(9947,'Черная мама, белая мама',1973,87,0.0,5.8,184,'1973-01-19','https://st.kp.yandex.net/images/film_iphone/iphone360_9947.jpg','Black Mama White Mama','Две заключенные (одна — революционерка, другая — бывшая девушка из гарема) не могут ужиться, их связывают цепью, чтобы безопаснее конвоировать. Однако они сбегают.','Нет данных'),(9948,'Золото Ули',1996,113,0.0,6.5,189,'1997-01-22','https://st.kp.yandex.net/images/film_iphone/iphone360_9948.jpg','Ulee\'s Gold','Однажды в доме бывшего вьетнамского ветерана Ули Джексона раздается звонок из тюрьмы. Его единственный сын, отбывающий срок за вооруженное ограбление, просит о помощи: его жена похищена подонками, с которыми он совершал преступление, и ее жизнь в опасности. И Ули решает рискнуть своей жизнью, чтобы спасти близких ему людей.','$2 700 000'),(9949,'Истинная любовь',1989,104,0.0,5.0,73,'1989-09-15','https://st.kp.yandex.net/images/film_iphone/iphone360_9949.jpg','True Love','Донна и Майкл собираются вступить в брак. Но сначала им предстоит спланировать прием гостей, получить смокинг, купить кольца и справиться со своими сомнениями. Майкл боится ответственности. Донна сомневается из-за незрелости Майкла.','Нет данных'),(9953,'Ванда Невада',1979,107,0.0,6.4,146,'1983-12-12','https://st.kp.yandex.net/images/film_iphone/iphone360_9953.jpg','Wanda Nevada','Рассказ о бродяге по имени Бодрей Демерилл, который выигрывает в покер молодую сиротку по имени Ванда и берет ее с собой в путешествие к Большому Каньону.','Нет данных'),(9955,'Федора',1978,114,0.0,7.3,623,'1978-05-30','https://st.kp.yandex.net/images/film_iphone/iphone360_9955.jpg','Fedora','«Федора умерла…. Легендарная кинозвезда погибла прошлой ночью в окресностях Парижа. Она или упала или бросилась под поезд. Итак, нет больше того легендарного лица, которое более сорока лет озаряло мировой экран…..» Именно с сюжета теленовостей начинается эта история. Итак, разорившийся продюсер Барри Дедвайлер, когда то в юности близко знавший Федору, прилетает на греческий остров Корфу с единственной целью, уговорить ее сняться в фильме «Прошлогодний снег», сценарий которого написан по мотивам романа Льва Толстого «Анна Каренина». <br><br>Hо не так то просто увидеть легендарную актрису. Встрече всячески препятствует загадочное окружение Федоры, парализованная графиня Собриански с сыном, косметолог доктор Вандо и преданное лицо графини мисс Бальфур. Да и сама вилла «Каллипсо», где живет Федора, огороженная колючей проволокой, с телефоном и коньяком, запертыми в шкафу, производит странное впечатление. После загадочной гибели знаменитости, продюсер напрямую обвиняет эту «веселую компанию»в том, что они довели Федору до самоубийства…','$6 727 000'),(9956,'Русские горы',1977,119,0.0,6.1,107,'1977-06-10','https://st.kp.yandex.net/images/film_iphone/iphone360_9956.jpg','Rollercoaster','Террорист, начинает превращать американские парки аттракционов в кровавые поля сражений. Сюжет разворачивается, напряжение возрастает — ответственныйза безопасность аттракционов инспектор Джордж Сигал пытается выследить преступника, одержимого бессмысленной жаждой разрушения. Террорист выбрал своей мишенью самый популярный в стране аттракцион «русские горы» и его посетителей.','Нет данных'),(9957,'Щупальца',1977,102,0.0,4.3,149,'1977-02-25','https://st.kp.yandex.net/images/film_iphone/iphone360_9957.jpg','Tentacoli','На побережье и в море начинают пропадать люди, чьи тела позже обнаруживают обглоданными до самых костей. Учёные в замешательстве, и лишь доктор Тёрнер выдвигает версию, что загрязнение воды промышленными отходами могло послужить причиной для жуткой мутации какого-нибудь морского обитателя.','Нет данных'),(9959,'Мидуэй',1976,132,0.0,6.7,400,'1976-06-18','https://st.kp.yandex.net/images/film_iphone/iphone360_9959.jpg','Midway','Вторая Мировая война. Крупнейшее сражение войск США и Японии у атолла Мидуэй.','Нет данных'),(9960,'Муссолини: Последний акт',1974,126,0.0,6.7,81,'1974-03-29','https://st.kp.yandex.net/images/film_iphone/iphone360_9960.jpg','Mussolini ultimo atto','Картина Карло Лидзани — это хроника пяти апрельских дней 1945 года. Комитетом национального освобождения Муссолини приговорен к смертной казни. Муссолини скрывается от своих преследователей как обычный вор. Он надеется попасть в руки сил Союзников, нежели столкнуться с местью жаждущик крови итальяских борцов за свободу. Но первыми его обнаруживают именно итальянцы…','Нет данных'),(9961,'Меня зовут Никто',1973,116,0.0,7.5,1649,'1973-12-13','https://st.kp.yandex.net/images/film_iphone/iphone360_9961.jpg','Il mio nome è Nessuno','Джек Борегар, старый и опытный стрелок с большой славой, хочет уехать в Европу и найти там покой. В это же время молодой стрелок, зовущий себя Никто и практически боготворящий Борегара, выступает против его поездки. Желая обеспечить своему кумиру вечную славу бойца и стрелка, он подстраивает выход на Борегара Дикой банды, состоящей из 150 человек.','DEM 8 000 000'),(9963,'Змей',1973,125,0.0,6.1,156,'1973-04-05','https://st.kp.yandex.net/images/film/9963.jpg','Le serpent','Юл Бриннер играет советского полковника КГБ Алексея Федоровича Власова, который решает изменить Родине и просит политического убежища у французских властей.<br><br>Собственная жена посылает его к чертовой бабушке и возвращается в Москву, а предателя долго и тщательно проверяют во французских спецслужбах. Однако Власов требует передать свое тело и душу американцам и, чтобы дело пошло побыстрее, сообщает, что у него есть конфиденциальная информация невероятной ценности…','Нет данных'),(9964,'Иногда великая идея...',1971,114,0.0,7.0,511,'1971-12-17','https://st.kp.yandex.net/images/film_iphone/iphone360_9964.jpg','Sometimes a Great Notion','В орегонских лесах, на берегу великой реки Ваконды-Ауги, в городке Ваконда жизнь подобна древнегреческой трагедии без права на ошибку. Посреди слякоти, и осени, и отчаянной гонки лесоповала, и обреченной забастовки клан Стэмперов, записных упрямцев, бродяг и одиночек, живет по своим законам, и нет такой силы, которая способна их сломить. Каждодневная борьба со стихией и непомерно тяжкий труд здесь обретают подлинно ветхозаветные масштабы. Обыкновенные люди вырастают до всесильных гигантов. История любви, работы, упорства и долга оборачивается величайшей притчей столетия. На этой земле полутонов во множество, однако не бывает полумер и ничего невозможно сделать вполсилы.','Нет данных'),(9965,'Жил-был обманщик',1970,126,0.0,6.8,171,'1970-09-19','https://st.kp.yandex.net/images/film_iphone/iphone360_9965.jpg','There Was a Crooked Man...','Мошенник Пэрис Питман попадает на десять лет в окружную тюрьму. Но находит способ сократить срок благодаря огромному богатству, спрятанному в укромном месте. Питман начинает манипулировать всеми, кто хоть как-то может помочь ему достичь своей цели — побега.','Нет данных'),(9966,'Слишком поздно, герой',1970,145,0.0,6.2,131,'1970-05-20','https://st.kp.yandex.net/images/film_iphone/iphone360_9966.jpg','Too Late the Hero','Вторая мировая война, 1942 год. Сообразительного солдата и американского лейтенанта, знающего японский язык, в составе боевого десанта посылают на тихоокеанский остров с заданием, сулящим верную смерть. Они должны уничтожить радиопередатчик в тылу врага. Это задание превращается в состязание умов между ними и японским офицером.','Нет данных'),(9967,'Твои, мои и наши',1968,111,0.0,7.1,280,'1968-04-24','https://st.kp.yandex.net/images/film_iphone/iphone360_9967.jpg','Yours, Mine and Ours','Овдовевший адмирал с десятком детей женится на вдове, у которой их восемь.','$2 500 000'),(9968,'Мадиган',1968,101,0.0,6.5,151,'1968-02-22','https://st.kp.yandex.net/images/film_iphone/iphone360_9968.jpg','Madigan','Генри Фонда создал образ человечного, но бесспорно сильного и волевого комиссара полиции: он отправляет Уидмарка на улицы города расследовать преступление, зная, что это задание может стать для детектива последним.','Нет данных'),(9969,'Большой куш для маленькой леди',1966,95,0.0,7.0,144,'1966-05-31','https://st.kp.yandex.net/images/film_iphone/iphone360_9969.jpg','A Big Hand for the Little Lady','Наивная парочка на пути в Калифорнию — хотят купить там ферму. Они случайно заезжают в городок, где проходит игра в покер между местными богачами. Ну и муж не может устоять — вступает в игру и ставит на кон все семейные деньги. Даже несмотря на то, что он плохо играет в покер. И надо же такому случиться, что в самый разгар игры с ним случается сердечный приступ. Жене приходиться занять его место за столом. Но есть одна маленькая проблема — она не умеет играть в покер.','Нет данных'),(9970,'Битва в Арденнах',1965,167,0.0,6.2,324,'1965-12-16','https://st.kp.yandex.net/images/film_iphone/iphone360_9970.jpg','Battle of the Bulge','Бельгия, последние месяцы Второй мировой войны. Немецкое командование готовит план контрнаступления. Вся надежда на секретную танковую дивизию, о которой союзнические войска пока еще ничего не знают. Руководить операцией назначен блестящий немецкий офицер — полковник Хесслер. Он понимает, что операция может быть провалена из-за банальной нехватки топлива, и принимает решение для начала захватить горючее у небольшого подразделения союзников.','Нет данных'),(9976,'Совет и согласие',1962,139,0.0,6.4,101,'1962-05-08','https://st.kp.yandex.net/images/film_iphone/iphone360_9976.jpg','Advise & Consent','Роберт Леффингуэлл кандидат на пост государственного секретаря. В Сенате по его персоне нет единодушия. Сторонники Леффингуэлла пытаются протолкнуть назначение, но и среди них нет согласия — молодой сенатор Брингэм Андерсон, чей голос чрезвычайно важен, не хочет поддержать лидера своей партии. Это приводит к тому, что сенатор Фред ван Аккерман, беспощадный, рвущийся к власти коллега, начинает шантажировать Андерсона. Он находит доказательства гомосексуализма Андерсона и угрожает их обнародовать в прессе, если тот не проголосует «правильно». Это неожиданно приводит к самым трагическим последствиям…','Нет данных'),(9978,'Шериф',1959,122,0.0,6.9,276,'1959-04-23','https://st.kp.yandex.net/images/film/9978.jpg','Warlock','Дикий запад. Небольшой городок Варлок постоянно терроризирует банда налетчиков. Им принадлежит власть над всеми… Закон здесь безвластен. Ни один шериф не смог продержаться на должности и недели, одни были убиты, другие бежали. Чтобы защитить себя владелец местного салуна Морган нанимает профессионального убийцу Курта Блайсдела, который должен навести порядок в его заведении.<br><br>Хладнокровный опытный стрелок, одетый как истинный джентльмен, Блайсдел, сразу понравился горожанам. Его быстрый кольт проучил много негодяев и вычистил от преступников не один городок на Диком западе. Но Блайсдел охраняет только заведение Моргана, и тогда горожане постановили, в городе должен быть официальный представитель власти — шериф.<br><br>Джонни Гэнонн — член банды, решает порвать с преступным миром. Он сознательно соглашается занять пустующий пост шерифа, противопоставив себя бывшим приятелям из шайки. Теперь он будет вершить правосудие. Жители Варлока поддержат его, и им вместе предстоит дать последний и решающий бой банде головорезов, на пыльных улицах города…','Нет данных'),(9980,'Война и мир',1956,208,0.0,6.7,2314,'1956-08-21','https://st.kp.yandex.net/images/film_iphone/iphone360_9980.jpg','War and Peace','Драма, номинированная на Оскар в 1957 году, рассказывает о международном конфликте, опасных приключениях, захватывающей интриге и трагической любви на фоне широкомасштабного вторжения Наполеона в Россию.','$6 000 000'),(9982,'Дэйзи Кеньон',1947,99,0.0,6.5,87,'1947-11-27','https://st.kp.yandex.net/images/film_iphone/iphone360_9982.jpg','Daisy Kenyon','Нью-Йорк, Гринич-Виллидж. Художница Дэйзи Кеньон, работающая в журнале моды, — любовница знаменитого адвоката Дэна О`Мары, женатого мужчины и отца двух детей. Она больше не хочет идти за него замуж и временами думает, что их любовь окончательно осталась в прошлом. Иногда она говорит об этом Дэну, но тот отказывается верить. Она знакомится с Питером — солдатом, до войны рисовавшим корабли. Питер с огромным трудом пытается обрести равновесие в гражданской жизни; его жена погибла пять лет назад. Он предлагает Дэйзи выйти за него замуж, и она соглашается, увидев в этом, в первую очередь, хороший повод порвать неустойчивые отношения с Дэном. Они проводят медовый месяц в коттедже на берегу моря. По ночам он часто видит кошмары, в которых к нему возвращаются воспоминания о военных днях и о погибшей жене.<br /><br />Дэйзи возвращается на работу в Нью-Йорк. Дэн отказывается признать свое поражение. Он приходит к Дэйзи домой и пытается вновь овладеть ею, пусть даже силой. Дэйзи бьет его по лицу. Вернувшись к себе, Дэн звонит ей и просит прощения: в его жизни есть только она. Его жена подслушивает разговор и решает немедленно развестись.','Нет данных'),(9983,'Беглец',1947,104,0.0,6.2,132,'1947-11-11','https://st.kp.yandex.net/images/film_iphone/iphone360_9983.jpg','The Fugitive','Фильм рассказывает, как власти одного из штатов Мексики, стремясь покончить с влиянием католической церкви, выслеживают последнего священника, обманом захватывают его и расстреливают.','Нет данных'),(9984,'Длинная ночь',1947,101,0.0,5.9,126,'1947-05-28','https://st.kp.yandex.net/images/film_iphone/iphone360_9984.jpg','The Long Night','Полиция окружает квартиру убийцы Джо Адамса, который отказывается сдаться, но и побег для него невозможен. Во время осады Джо размышляет об обстоятельствах, которые загнали его в эту ловушку.','Нет данных'),(9992,'Возвращение Фрэнка Джеймса',1940,92,0.0,6.4,188,'1940-08-08','https://st.kp.yandex.net/images/film_iphone/iphone360_9992.jpg','The Return of Frank James','Фрэнк клянется отомстить за предательское убийство брата. Но Фрэнку нужны деньги, и он идет на ограбление. Издатель ведущей газеты городка посылает журналистку Элинор Стоун добыть эксклюзивный материал…','Нет данных'),(9994,'Молодой мистер Линкольн',1939,100,0.0,7.1,383,'1939-05-30','https://st.kp.yandex.net/images/film_iphone/iphone360_9994.jpg','Young Mr. Lincoln','Эта картина рассказывает о десяти годах жизни молодого Авраама Линкольна, прежде чем он стал известен американцам, а впоследствии и всему миру. Его жизнь не баловала, всего он добивался сам. Переехав из штата Кентукки в город Спрингфилд штата Иллинойс, будущий президент США, начинает свою юридическую практику.<br><br>Здесь ему предстоит выступить адвокатом невинно обвиненных молодых людей и выиграть дело в суде, перенести смерть подруги Энн, встретить свою будущую жену Мери Тодд и решиться пойти в политику, чтобы в будущем стать шестнадцатым, а по значимости и величине Первым президентом США.','$1 500 000'),(9997,'Сумасшедшая мисс Ментон',1938,80,0.0,7.2,167,'1938-10-08','https://st.kp.yandex.net/images/film_iphone/iphone360_9997.jpg','The Mad Miss Manton','Богатая светская львица Мелса Ментон возвращается с костюмированной вечеринки в предутренние часы, когда видит выбегающего из соседнего пустующего особняка богатого банкира знакомого мужчину, который ее даже не замечает. Любопытство пересиливает и Мелса заходит в дом, где натыкается на труп. Девушка в ужасе сбегает, оставив свою накидку. Приехавшая через 10 минут полиция, видя как одета девушка, слушая ее путанную речь, и зная ее сумасбродную репутацию, мало ей верит, но что более важно — в доме не обнаружено трупа.<br /><br />Редактор газеты Питер Эймс считает, что это последний инцидент еще одна шутка из серии шалостей, на которые способна веселая девушка и ее подруги и пишет о них статью, полную сарказма. Взбешенная Мелса врывается в редакцию и объявляет о своем намерении подать в суд за клевету. Питер очарован взрывной энергией девушки и решает, что он на ней женится. А Мелса и ее подруги решают самостоятельно предпринять расследование и найти убийцу, для того чтобы защитить свою репутацию.','Нет данных'),(10000,'Иезавель',1938,104,0.0,7.3,988,'1938-03-10','https://st.kp.yandex.net/images/film_iphone/iphone360_10000.jpg','Jezebel','1852-й год. Новый Орлеан. Великосветская красавица Джули Марсден готовится выйти замуж за молодого политика и банкира Престона Дилларда. Однако, поругавшись с ним, Джулии назло своему жениху появляется в красном платье на ежегодном, престижном «Олимпийском» балу. Поскольку незамужние девушки в свет должны выходить только в белом, светское общество шокировано выходкой Джули. Престон расторгает помолвку и уезжает на Север. Спустя год, он возвращается в Нью-Орлеан с молодой женой. В городе бушует эпидемия желтой лихорадки, общество парализовано паникой и страхом, а у Джули появляется шанс доказать Престону свою любовь…','$1 250 000'),(10002,'Та самая женщина',1937,93,0.0,6.7,128,'1937-08-30','https://st.kp.yandex.net/images/film_iphone/iphone360_10002.jpg','That Certain Woman','Мэри работает секретарем успешного адвоката. Ее шеф проявляет не только доброе расположение к подчиненной, но буквально берет ее судьбу в свои руки и помогает Мэри выйти замуж за Джека, которого она давно любит. Но его отец разрушает брак. Спустя несколько лет Мэри и Джек снова встретятся: он — человек с изломанной судьбой, она — счастливая мать их сына…','Нет данных'),(10005,'Живем один раз',1937,86,0.0,7.1,537,'1937-01-23','https://st.kp.yandex.net/images/film_iphone/iphone360_10005.jpg','You Only Live Once','Эдди Тэйлор осужденный в третий раз за тяжкие преступления выходит из тюрьмы. Но общество не благосклонно к бывшему преступнику и отвергает его, парень не может найти работу и снять нормальное жилье. Жестоким ударом судьбы становится, сообщение об обнаружении шляпы с его инициалами на месте ограбления банка, где погибли шесть человек охраны. Полиция арестовывает невиновного Эдди, парню грозит пожизненное заключение, все улики против него. Герой решает бежать.','$575 000'),(10008,'Тропинка одинокой сосны',1936,102,0.0,6.6,90,'1936-02-19','https://st.kp.yandex.net/images/film_iphone/iphone360_10008.jpg','The Trail of the Lonesome Pine','Испокон веков враждуют два семейных клана в горах Кентукки. Никто уже и не помнит, что именно не поделили Толливеры и Фэлины, но жить они продолжают по законам кровной мести. В разгар одной из стычек в городок прибывает Джек Хэйл, инженер, приехавший строить железную дорогу. Волей судьбы он спасает одного из Толливеров — Дэйва. Прошло несколько лет. Предприятие железной дороги приносит большие доходы. Но и профессиональному делу мешает неприязнь семей:на лагерь рабочих нападает клан Фэллинов, в столкновении погибает один из Толливеров. Хэйл продолжает взывать к миру и благоразумию. Дэйв решает послушать его.','Нет данных'),(10012,'Вестерн Юнион',1941,95,0.0,6.3,163,'1941-01-31','https://st.kp.yandex.net/images/film_iphone/iphone360_10012.jpg','Western Union','События этой картины рассказывают о строительстве телеграфной линии «Вестерн Юнион» от Омахи, штат Небраска, до Солт-Лейк Сити, штат Юта. Рэндолф Скотт сыграл преступника, пытающегося исправиться и зарабатывать на хлеб честным путем…','Нет данных'),(10020,'Человек, который любил танцующую кошку',1973,114,0.0,6.3,75,'1973-06-28','https://st.kp.yandex.net/images/film_iphone/iphone360_10020.jpg','The Man Who Loved Cat Dancing','Танцующая Кошка — имя изнасилованной и убитой жены-индианки главного героя фильма Джея Гробарта. Во время ограбления поезда, он с напарниками захватывает, помимо добычи, случайную свидетельницу по имени Катерина, сбежавшую от своего жестокого мужа Крокера. После ограбления банда решает направиться в индейскую деревню, где до трагедии Джей жил с Танцующей Кошкой… Понемногу Джей и Катерина проникаются симпатией к друг другу. Но не всё так просто и легко. По их следу идёт охотник за головами, посланный мужем Катерины, чтобы вернуть её домой…','Нет данных'),(10022,'Освобождение Л. Б. Джонса',1970,102,0.0,6.5,117,'1970-03-18','https://st.kp.yandex.net/images/film_iphone/iphone360_10022.jpg','The Liberation of L.B. Jones','Афроамериканец со звучным именем Лорд Байрон Джонс, успешный бизнесмен из Самертона, хочет развестись с женой, которая изменяет ему с полицейским. Но главная беда не в том, что у него есть соперник, и не в том, что это — полицейский, а в том, что он — белый…','Нет данных'),(10023,'Золото Маккены',1968,128,0.0,7.7,10156,'1969-03-18','https://st.kp.yandex.net/images/film_iphone/iphone360_10023.jpg','Mackenna\'s Gold','Благодаря случайным обстоятельствам шериф Маккена узнаёт о том, где спрятано золото древнего индейского племени. В качестве «живой карты» он становится заложником бандита Колорадо, который мечтает найти каньон «дьявольское наваждение»… К группе головорезов примыкают всё новые и новые охотники за богатством, но далеко не всем суждено будет добраться до цели. Тем более — вернуться живыми, ведь на пути к заветной цели их ждёт неизвестность…','$7 000 000'),(10025,'Блеф Кугана',1968,93,0.0,6.5,963,'1968-10-02','https://st.kp.yandex.net/images/film_iphone/iphone360_10025.jpg','Coogan\'s Bluff','Аризонский шериф приезжает в Нью-Йорк, чтобы показать местным полицейским, как надо выслеживать разыскиваемого преступника.','Нет данных'),(10026,'Сова появляется днем',1967,112,0.0,7.2,452,'1968-02-17','https://st.kp.yandex.net/images/film_iphone/iphone360_10026.jpg','Il giorno della civetta','Действие фильма происходит в небольшом сицилийском городке. Капитан полиции, расследуя убийство руководителя строительной компании, обнаруживает, что все, кого он допрашивает, не хотят ничего говорить. Он приходит к выводу, что за убийством стоит местный депутат, он же — глава местной мафии…','Нет данных'),(10032,'Четыре всадника Апокалипсиса',1962,153,0.0,6.5,85,'1962-01-18','https://st.kp.yandex.net/images/film_iphone/iphone360_10032.jpg','The Four Horsemen of the Apocalypse','История о том, как представители знатного аргентинского рода Мадриего во время войны оказались в рядах разных воюющих сторон. Началось все в 1938-ом году, когда отпрыски семейства поехали в начинавшую бурлить Европу…','Нет данных'),(10033,'Исход',1960,208,0.0,6.5,328,'1960-12-15','https://st.kp.yandex.net/images/film_iphone/iphone360_10033.jpg','Exodus','Фильм рассказывает о создании и первых годах Израиля, войне за независимость, называемой во всем мире Палестинской.','$4 000 000'),(10036,'Девушка с вечеринки',1958,99,0.0,6.2,134,'1958-10-28','https://st.kp.yandex.net/images/film_iphone/iphone360_10036.jpg','Party Girl','Чикаго, 1930-е года. Адвокат, работающий на мафию, и танцовщица из ночного клуба, в равной степени тщеславные и потрепанные жизнью, делают все, чтобы завоевать симпатии друг друга.','Нет данных'),(10038,'Три лица Евы',1957,91,0.0,7.7,1415,'1957-09-18','https://st.kp.yandex.net/images/film_iphone/iphone360_10038.jpg','The Three Faces of Eve','Скромная домохозяйка и верная жена Ева Уайт страдает от сильных головных болей. Время от времени у нее случаются провалы в памяти. Мистер Уайт, заметив странное поведение жены, направляет ее к психиатру. Во время сеанса доктор Кертис Лютер видит, как у нее на глазах Ева превращается в совершенно другую женщину — наглую, самоуверенную и вульгарную. А чуть позже в пациентке просыпается еще один человек — умная, интеллигентная и уравновешенная особа. Лютер решает, во что бы то ни стало, помочь Еве обрести свое настоящее лицо…','Нет данных'),(10040,'Человек в сером фланелевом костюме',1956,153,0.0,7.4,218,'1956-04-12','https://st.kp.yandex.net/images/film_iphone/iphone360_10040.jpg','The Man in the Gray Flannel Suit','Это история Тома Рэта, молодого американца, получающего шанс стать большим человеком, но отказывающемся от него, понимая, что он человек семейный и ему спокойней работать каждый день с девяти до пяти. Семья для него значит больше, чем успех. Это также история человека, у которого есть совесть. В Риме во время войны у него была любовная связь, в результате которой появился ребенок. Том тяжело переживает военные годы — замерзая от холода, он убил ножом немца, чтобы раздобыть шинель, неудачно бросил гранату, убив лучшего друга…','Нет данных'),(10049,'Сирокко',1951,98,0.0,6.6,133,'1951-06-01','https://st.kp.yandex.net/images/film_iphone/iphone360_10049.jpg','Sirocco','Действие происходит в 1925 году в Дамаске, где идет война между сирийскими повстанцами и французскими войсками. Гарри Смит — аморальный американский торговец оружием, продает оружие арабским мятежникам в Дамаске, пытающимся свергнуть французский протекторат. Однажды в ресторане он знакомится с Виолеттой, подругой шефа французской разведки полковника Феру, который хочет встретится для переговоров с лидером сирийцев Эмиром Хассаном. Феру вынуждает Смита устроить ему встречу с Хассаном.','Нет данных'),(10051,'Воровское шоссе',1949,94,0.0,7.2,422,'1949-09-20','https://st.kp.yandex.net/images/film_iphone/iphone360_10051.jpg','Thieves\' Highway','Воровское Шоссе ярко изображает рискованный мир «мальчиков долгого пути», кто двигается ночью, чтобы доставить свои товары на рынки городов Америки.<br /><br />Ричард Конте в роли американского ветерана Ника Гаркоса, водителя-новичка, вынужденного работать на человека, ответственного за нанесение вреда его отцу — оператору рынка Майку Фиглии. Но когда Фиглиа прислушивается к его плану, Ник оказывается в сети предательства и горя.','Нет данных'),(10052,'Темное прошлое',1948,73,0.0,5.3,77,'1948-12-22','https://st.kp.yandex.net/images/film_iphone/iphone360_10052.jpg','The Dark Past','Преступники совершают побег из тюрьмы, прихватив в качестве заложников семью полицейского психиатра доктора Коллиза. Когда Коллинз узнаёт, что главарь банды страдает от повторяющегося из ночи в ночь кошмарного сна, он предлагает ему свою профессиональную помощь.','Нет данных'),(10055,'Бумеранг!',1947,88,0.0,6.9,278,'1947-01-26','https://st.kp.yandex.net/images/film_iphone/iphone360_10055.jpg','Boomerang!','После убийства священника был спешно арестован невинный безработный бродяга, но прокурор принимает решение докопаться до истины.','$1 140 000'),(10056,'Капитан из Кастильи',1947,140,0.0,6.8,78,'1947-12-25','https://st.kp.yandex.net/images/film_iphone/iphone360_10056.jpg','Captain from Castile','Испания XVI века. Аристократ Педро Де Варгас спасает отпреследования одного из беглых рабов, чем навлекает на себя гнев Диего Де Сильва, всесильного и могущественного инквизитора. Диего расправляется со всей семьей Де Варгаса, который с помощью друзей успевает покинуть Испанию и перебраться в Новый Свет.<br><br>В Америке экспедиционный корпус Эрнандо Кортеса огнем и мечом покоряет земли ацтеков. Де Варгас становится соратником Кортеса. Вскоре сюда же из Испании приезжает Диего Де Сильва, всегда и всюду ищущий еретиков.','Нет данных'),(10057,'Джонни О\\',1947,96,0.0,5.3,90,'1947-01-23','https://st.kp.yandex.net/images/film_iphone/iphone360_10057.jpg','Johnny O\'Clock','Профессиональный карточный игрок наживает проблемы с законом.','Нет данных'),(10058,'Анна и король Сиама',1946,128,0.0,6.6,295,'1946-06-20','https://st.kp.yandex.net/images/film_iphone/iphone360_10058.jpg','Anna and the King of Siam','В 1862 году молодая вдова англичанка Анна Леоновенс по приглашению короля Сиама Монгкута приехала в Бангкок, чтобы учить королевских детей. Анна с трудом привыкает к порядкам при дворе, однако постепенно Анна и Монгкут идут навстречу друг другу, и вскоре англичанка становится советником короля Сиама…','Нет данных'),(10066,'Золотой мальчик',1939,99,0.0,7.0,92,'1939-09-05','https://st.kp.yandex.net/images/film_iphone/iphone360_10066.jpg','Golden Boy','Джо Бонапарте, одаренный скрипач, из-за крайней бедности вынужден выступать на ринге. Он проявил себя талантливым боксером, хотя видно, что он бережет кулаки, опасаясь повредить руки музыканта и похоронить мечту, ради которой его отец-эмигрант многим пожертвовал. <br /><br />Том Муди, менеджер Джо, подговаривает свою подружку Лорну Мун убедить парня забыть о своих музыкальных стремлениях и возвратить его на ринг. Это приводит к трагедии…','Нет данных'),(10069,'Али-баба едет в город',1937,81,0.0,6.1,64,'1937-10-15','https://st.kp.yandex.net/images/film_iphone/iphone360_10069.jpg','Ali Baba Goes to Town','Аль Бабсон едет в город в надежде взять автограф у артистов, снимающихся в фильме «Арабские ночи». Попав на съемочную площадку, он в результате суматохи, которую сам же и вызвал, получает травму под копытами лошади, после чего попадает в медпункт, где ему дают обезболивающее лекарство. Не вняв увещеваниям медсестры, неугомонный принимает лекарство лошадиной дозой.<br><br>А так как студийный менеджер согласен допустить на съемки в качестве статиста, лишь бы не платить деньги за нанесенную травму, Аль вприпрыжку пустился на съемочную площадку, где его одевают в костюм и сажают в кувшин, в котором он должен изображать роль разбойника. В кувшине он благополучно засыпает и видит сон, что попадает он в Багдад и становится консультантом самого султана Абдуллы, поскольку его принимают за сына легендарного Али Бабы…','Нет данных'),(10074,'Рождественские каникулы',1989,97,0.0,7.2,10552,'1989-11-30','https://st.kp.yandex.net/images/film_iphone/iphone360_10074.jpg','National Lampoon\'s Christmas Vacation','В доме Гризвольдов празднуют Рождество. Время, когда дарят подарки, звучат гимны, радостно мерцают огоньки рождественской елки… Но погодите-ка: эта елка вовсе не мерцает. Она вся в огне! Рождество — прекрасное время для Кларка Гризвольда и его семьи.<br><br>Кларк — это стихийное бедствие, которое может обрушиться на вас в любой момент. Теперь Кларк хочет во что бы то ни стало устроить своей семье «самый веселый старомодный семейный праздник Рождества из всех. какие были, есть и будут».<br><br>Ну и ну! В это трудно поверить, пока вы не увидите все собственными глазами. 25 000 лампочек на крыше дома Гризвольдов. Взрывающийся индюк на столе… Вот это Рождество!','$27 000 000'),(10075,'Мой шофер',1986,97,0.0,5.9,86,'1986-01-24','https://st.kp.yandex.net/images/film_iphone/iphone360_10075.jpg','My Chauffeur','Очаровательная и самоуверенная Кейси Мидоуз приходит в крупнейшую автомобильную компанию Лос-Анджелеса с целью работать шофёром. Для коллег-мужчин — это повод для скепсиса и насмешек, для владельцев фирмы — неожиданный и решительный шаг. И Кейси с лихвой превосходит даже самые смелые ожидания. За короткий срок она становится всеобщей любимицей. Неудовольствие выказывает лишь сын её босса, холёный и надменный Баттл, который не упускает случая отпустить колкость в её адрес. Надолго ли?..','Нет данных'),(10079,'Тора! Тора! Тора!',1970,144,0.0,7.5,1877,'1970-09-23','https://st.kp.yandex.net/images/film_iphone/iphone360_10079.jpg','Tora! Tora! Tora!','Драма, посвященная событиям 7-го декабря 1941 года, когда японская армия нанесла сокрушительный удар по военно-морской базе США — Перл Харбор.','$25 000 000'),(10080,'Ремагенский мост',1969,112,0.0,6.9,264,'1969-06-25','https://st.kp.yandex.net/images/film_iphone/iphone360_10080.jpg','The Bridge at Remagen','В основе сюжета — взятие моста через Рейн в районе Ремагена во время второй мировой войны. Здесь столкнулись в жестоких, отчаянных боях силы немцев и американцев. Но фоне боевых действий прослеживается сочно выписанный образ крутого командира взвода американцев. По приказу командования он ведет своих ребят на опаснейшие задания…','Нет данных'),(10082,'Путешествие',1959,126,0.0,7.0,111,'1959-02-11','https://st.kp.yandex.net/images/film_iphone/iphone360_10082.jpg','The Journey','Будапешт 1956 год. Группа выходцев из западных стран пытается покинуть город, где стоят советские войска. Аэропорт закрыт, и они вынуждены добираться до границы на автобусе. А на границе их задерживает советский майор. Вояка тянет и не желает отпускать пассажиров, особенно беженку Диану.','Нет данных'),(10084,'Гора',1956,105,0.0,7.1,120,'1956-05-31','https://st.kp.yandex.net/images/film_iphone/iphone360_10084.jpg','The Mountain','Старый проводник Захари живет в горах вместе со своим младшим братом Крисом. Мать Криса умерла при родах, и Захари был вынужден в одиночку вырастить брата, который не испытывает ни малейшей благодарности к брату и думает только о том, как бы разбогатеть и уехать. В горах происходит авиакатастрофа, но добраться до места аварии спасателям не удаётся. Крис уговаривает опытного проводника Захари вдвоём добраться до места катастрофы, чтобы завладеть находящимися там ценностями…','Нет данных'),(10087,'Лёгкая добыча',1954,88,0.0,6.4,162,'1954-07-21','https://st.kp.yandex.net/images/film_iphone/iphone360_10087.jpg','Pushover','Из банка было украдено 210 000 долларов. Вскоре подруга одного из грабителей Лора Маклейн встречает Пола Шеридана. У них начинается бурный роман. Когда Лора узнает, что Пол — полицейский, то чтобы спасти себя, она пытается его подкупить. Пол становится легкой добычей. Но Полу не так легко получить деньги, ведь он является объектом слежки. Он погрязает в этом деле гораздо глубже, чем планировал.','Нет данных'),(10088,'Сломанное копье',1954,96,0.0,6.6,193,'1954-07-29','https://st.kp.yandex.net/images/film_iphone/iphone360_10088.jpg','Broken Lance','Отсидев три года в Аризонской тюрьме, ковбой Джо Деверо выходит на свободу. Он встречается своих трех сводных братьев — Бена, Майка и Денни, которые забросили сельскую жизнь, переехали в город и за время его отсутствия давно поделили семейные земли между собой. В кабинете губернатора городка братья пытаются уговорить Джо, чтобы он покинул штат, они даже готовы заплатить за то, чтобы он покинул пределы штата. Герой не торопится с ответом и, проигнорировав просьбу, решает разыскать свою мать индианку ушедшую жить в свое племя и разобраться самостоятельно, что же произошло в его отсутствие, и почему умер отец Мэтт Деверо. Приехав в родной, заброшенный среди степи дом Джо вспоминает события, приведшие его в тюрьму. Перед зрителем развернется история некогда благополучной семьи возглавляемой властным фермером, правящим своими четырьмя сыновьями и обширной империей по собственным безжалостным законам…','$2 000 000'),(10089,'Дипкурьер',1952,97,0.0,6.3,76,'1952-06-13','https://st.kp.yandex.net/images/film_iphone/iphone360_10089.jpg','Diplomatic Courier','Курьер оказывается участником шпионажа после того, как советские агенты убивают его друга.','Нет данных'),(10091,'Дом на 92-ой улице',1945,88,0.0,5.0,98,'1945-09-26','https://st.kp.yandex.net/images/film_iphone/iphone360_10091.jpg','The House on 92nd Street','Билл Дитрих становится двойным агентом для ФБР в нацистской агентурной сети.','Нет данных'),(10093,'Прощай, Колумбус',1969,102,0.0,6.0,66,'1969-04-03','https://st.kp.yandex.net/images/film_iphone/iphone360_10093.jpg','Goodbye, Columbus','В фильме рассказывается о различных жизненных проблемах второго и третьего поколения ассимилировавшихся американских евреев. Она — типичная еврейско-американская принцесса, её родители, сами добившиеся благосостояния тяжелым трудом, ни в чем ей не отказывают, поскольку она их никогда не разочаровывала. Он — более самостоятельный и независимый от своих родителей и вовсе не уверенный в том, что хочет чего-то добиваться.','Нет данных'),(10098,'Дни вина и роз',1962,112,0.0,7.8,1143,'1962-12-25','https://st.kp.yandex.net/images/film_iphone/iphone360_10098.jpg','Days of Wine and Roses','Джо Клэй — молодой преуспевающий клерк знакомится с очаровательной Кирстен Аронсон, вскоре они женятся, у них рождается дочь. Не дурак выпить, Джо постепенно приучает к этому и жену. Постепенно выпивка вытесняет все из их жизни — Джо теряет работу и допивается до белой горячки. Оказавшегося на краю пропасти Джо спасают собрания анонимных алкоголиков. Но Кирстен не хочет признать, что больна. Она вынуждает Джо опять начать пить…','Нет данных'),(10104,'Чужой среди нас',1992,110,0.0,6.1,278,'1992-07-17','https://st.kp.yandex.net/images/film_iphone/iphone360_10104.jpg','A Stranger Among Us','Женщина-полицейский, несущая службу в темных переулках Бруклина, втянута в жестокую схватку с профессиональным похитителем драгоценностей, который не остановится перед убийством.','Нет данных'),(10105,'На холостом ходу',1988,116,0.0,7.6,1215,'1988-09-07','https://st.kp.yandex.net/images/film_iphone/iphone360_10105.jpg','Running on Empty','17-летний Денни, старший сын в семье Энни и Артура Поуп. Вот уже 15 лет семейство Поупов живет под вымышленными именами. Когда-то, в бурные 60-е, родители Денни под воздействием больших перемен в обществе и политике стали активистами антивоенного движения и попали в «черные списки». С тех пор у них началась нелегальная жизнь. Но сыновья подросли, и кочевать с места на место становится все сложнее. К тому же в Денни вдруг проявляется врожденный талант пианиста, и он получает приглашение из престижной музыкальной школы. <br><br>Юноше необходим инструмент, который семья не может себе позволить. Ведь недалек тот день, когда снова придется сниматься с насиженного места. А у Денни — первая любовь. Он страдает, понимая, что его скрытность серьeзно осложняет отношения с Лорной. Молодому человеку предстоит нелегкий выбор: между обожаемой семьей и возможностью быть свободным, идти своим путем.','$3 000 000'),(10107,'Смертельная ловушка',1982,116,0.0,7.0,1083,'1982-03-19','https://st.kp.yandex.net/images/film_iphone/iphone360_10107.jpg','Deathtrap','Переживающий неудачи одну за другой драматург Брул решается на убийство. Он приглашает к себе талантливого студента Клиффорда, чтобы, убив, присвоить его пьесу. Кажется, план продуман до мелочей, но жизнь вносит в него решительные коррективы.','Нет данных'),(10109,'Эквус',1977,137,0.0,7.1,695,'1977-10-16','https://st.kp.yandex.net/images/film_iphone/iphone360_10109.jpg','Equus','Психиатр Мартин Дайсарт сталкивается со странным случаем — ослеплением шести лошадей металлическим шипом в конюшне Гэмпшира. Злодеяние было совершено 17-летним парнем по имени Алан Стрэнг. Дайсарт обнаруживает демонов внутри мальчика и сталкивается лицом к лицу со своими собственными.','Нет данных'),(10111,'Детская игра',1972,100,0.0,6.7,262,'1972-12-12','https://st.kp.yandex.net/images/film_iphone/iphone360_10111.jpg','Child\'s Play','В привилегированной школе для мальчиков появляется новый учитель физкультуры. Вскоре он втягивается во вражду между двумя его старшими коллегами. Постепенно он понимает, что в школе не так тихо и спокойно, как кажется.','Нет данных'),(10112,'Из Монтгомери в Мемфис',1970,185,0.0,5.4,74,'1970-03-24','https://st.kp.yandex.net/images/film_iphone/iphone360_10112.jpg','King: A Filmed Record... Montgomery to Memphis','Документальный фильм-биография Мартина Лютера Кинга, представляющий собой кадры кинохроники и записи Кинга, а также интервью знаменитостей, в том числе Марлона Брандо, Пола Ньюмана, Джоанн Вудворт, Руби Ди, Берта Ланкастера и многих других.','Нет данных'),(10114,'Свидание',1969,115,0.0,7.1,234,'1969-05-23','https://st.kp.yandex.net/images/film_iphone/iphone360_10114.jpg','The Appointment','Известный римский адвокат Федерико Фенди женат на красавице Карле. Однако у него есть основания предполагать, что Карла — элитная проститутка. Федерико прикладывает все усилия, чтобы установить истину…','Нет данных'),(10115,'Чайка',1968,141,0.0,6.9,169,'1968-12-23','https://st.kp.yandex.net/images/film_iphone/iphone360_10115.jpg','The Sea Gull','Русская провинция становится местом, где разворачиваются драмы нескольких человек. Стареющая актриса Аркадина приезжает с любовником, писателем Тригориным, в поместье своего больного брата Сорина. В Тригорина влюбляется юная Нина Заречная, уже давно и безответно любимая Константином Треплевым, сыном Аркадиной, который ставит финальную точку в этой трагедии…','Нет данных'),(10117,'Дело самоубийцы',1967,107,0.0,6.7,300,'1967-01-26','https://st.kp.yandex.net/images/film_iphone/iphone360_10117.jpg','The Deadly Affair','Агент секретной службы Чарльз Доббс проводит служебное расследование по анонимному письму, в котором говорится, что сотрудник Министерства иностранных дел Сэмюэль Феннан — шпион. После доверительного разговора с начальством Доббс узнает, что Феннан покончил с собой. Руководство устраивает версия самоубийства, а вот Доббса, особенно после посещения вдовы Эльзы Феннан, — нет. С помощью друзей Менделя и Билла он начинает собственное расследование.','Нет данных'),(10118,'Группа',1966,150,0.0,6.0,116,'1966-03-04','https://st.kp.yandex.net/images/film_iphone/iphone360_10118.jpg','The Group','В первых сценах фильма события происходят в 1933 году. Группа молодых девушек из женской аристократической частной школы готовится к выпуску и началу взрослой жизни. Фильм охватывает промежуток времени с момента выпускного вечера и до начала войны: у девушек по-разному складываются судьбы, они влюбляются, выходят замуж и ищут смысл жизни.','Нет данных'),(10119,'Холм',1965,123,0.0,8.0,1078,'1965-05-22','https://st.kp.yandex.net/images/film_iphone/iphone360_10119.jpg','The Hill','Действие ленты разворачивается в британском дисциплинарном лагере, затерявшемся в африканской пустыне во времена Второй мировой войны.','Нет данных'),(10120,'Ростовщик',1964,116,0.0,7.6,530,'1965-04-20','https://st.kp.yandex.net/images/film_iphone/iphone360_10120.jpg','The Pawnbroker','Еврейский ростовщик, жертва нацистского преследования, перестает доверять всем своим родным и единоверцам, и слишком поздно понимает, к какой трагедии привели его действия.','$500 000'),(10125,'Золотая молодежь',2003,106,0.0,6.9,3654,'2003-05-16','https://st.kp.yandex.net/images/film_iphone/iphone360_10125.jpg','Bright Young Things','Писатель Адам Саймс с трудом сводит концы с концами в своей жизни, попавшей на период между двумя мировыми войнами. Ему отчаянно необходимо поправить своё финансовое положение — и не только для того, чтобы сохранить крышу над головой, но и чтобы иметь возможность посвататься к своей возлюбленной Нине Блаунт. В своих проблемах влюблённая пара находит поддержку у друзей, Майлса, Агаты и Арчи, вместе известных как «Золотая молодёжь».','Нет данных'),(10126,'Последний занавес',2002,85,0.0,6.0,139,'2002-10-12','https://st.kp.yandex.net/images/film/10126.jpg','The Final Curtain','Вам предстоит перекопать тонны грязного белья и узнать, как на самом деле делаются ваши любимые телешоу! В этой комедии может случиться все что угодно, и когда будет опущен занавес… останется лишь один победитель. Но что бы ни произошло, шоу, как известно, должно продолжаться…','Нет данных'),(10127,'Полный беспредел',2002,106,0.0,7.5,609,'2002-06-26','https://st.kp.yandex.net/images/film_iphone/iphone360_10127.jpg','Global Heresy','Для лорда и леди Фоксли наступили нелегкие времена: они увязли в долгах, и теперь им придется сдать свой особняк внаем, став в нем покорными слугами. Эти чопорные англичане достойно вынесут любые испытания, но они еще не знают, что им придется принять в своих покоях самую крутую американскую рок-группу «Полный беспредел».<br><br>Эти юнцы не едят овсянку и не уважают старших, от их музыки трясутся стены и болит голова! Какие еще сюрпризы ждут самых гордых аристократов Британии с замашками королей?','$12 000 000'),(10128,'Молокаи. История отца Дэмиена',1999,109,0.0,7.3,94,'1999-03-17','https://st.kp.yandex.net/images/film_iphone/iphone360_10128.jpg','Molokai: The Story of Father Damien','Конец XIX в. На Гавайях свирепствует эпидемия проказы — неизлечимой болезни, одно название которой вызывает у людей панический ужас. <br /><br />Правительство прибегает к радикальному способу решения проблемы: всех больных сажают на корабль и отвозят на уединенный островок в океане. Здесь, окруженные неприступными скалами и водой, лишенные элементарной медицинской помощи, предоставленные своей судьбе, несчастные познали в полной мере глубину отчаяния и морального падения.<br /><br />Кажется, на всем свете до них есть дело только одному человеку. Бельгийский миссионер отец Демиен добровольно приезжает в Молокайскую колонию прокаженных. Очень скоро его миссия выходит из узких рамок служителя культа.','Нет данных'),(10130,'Фантомы',1998,96,0.0,5.9,2493,'1998-01-23','https://st.kp.yandex.net/images/film/10130.jpg','Phantoms','Некая страшная сила, дремлющая в недрах земли, однажды пробуждается ото сна. Это зловещее Нечто, способное уничтожить целые цивилизации, выбирает себе первую жертву — маленький миролюбивый городок Сноуфилд в штате Колорадо. В одночасье сотни его жителей умирают ужасной смертью, а горстка оставшихся в живых людей вступает в отчаянную схватку со злом.','Нет данных'),(10133,'Король Ральф',1991,97,0.0,6.7,4948,'1991-02-15','https://st.kp.yandex.net/images/film_iphone/iphone360_10133.jpg','King Ralph','К ужасу всей Великобритании, выясняется, что единственный наследник опустевшего престола — жирный любитель гамбургеров из Америки по фамилии Ральф, который совершенно не представляет, что это такое — быть настоящим королем.','Нет данных'),(10134,'Крылья славы',1990,116,0.0,7.4,524,'1990-03-23','https://st.kp.yandex.net/images/film_iphone/iphone360_10134.jpg','Wings of Fame','Из-за желания получить славу и отомстить Брайен убивает Сезара из револьвера, но тут же сам погибает. И вот они вместе предстают перед той самой рекой Стикс, а мрачный Харон перевозит их на своем судне в царство умерших…','Нет данных'),(10135,'В лунную ночь',1989,109,0.0,6.7,287,'1989-09-04','https://st.kp.yandex.net/images/film_iphone/iphone360_10135.jpg','In una notte di chiaro di luna','Американский репортер Джон Нот — человек действия, любитель свободы и приключений. Он пишет о военных и партизанских действиях. В Бейруте Джон знакомится с женщиной-фотографом Джоэль. У них начинается роман, больше похожий на приключение, но однажды Джоэль таинственным образом исчезает.<br><br>Спустя несколько лет Джон посвящает себя исследованию массового психоза, вызванного СПИДом. Он путешествует по всему миру: из Лондона в Рим, из Венеции в Нью-Йорк, выдавая себя за инфицированного. В здании газетного концерна в Париже происходит новая встреча Джона и Джоэль, и они решают, что больше не расстанутся никогда…','Нет данных'),(10136,'Супергёрл',1984,120,0.0,4.9,1247,'1984-07-19','https://st.kp.yandex.net/images/film_iphone/iphone360_10136.jpg','Supergirl','Кузина Супермена Кара-Эль отправляется на Землю, чтобы найти и вернуть на родную планету омегагидрон — мощный источник энергии, попавший в руки ведьмы Селены, которая решила использовать его для захвата мира.','$35 000 000'),(10139,'Приключения Шерлока Холмса: Знак четырех',1983,50,0.0,6.7,81,'1983-01-13','https://st.kp.yandex.net/images/film/10139.jpg','Sherlock Holmes and the Sign of Four','Расследование как всегда головоломного дела переносит нас из туманной Англии на несколько лет назад в колониальную Индию, на место завязки всех последующих событий. Возможно ли честно поделить добытые убийством и грабежом сокровища? Своим владельцам они несут проклятие.','Нет данных'),(10140,'Приключения Шерлока Холмса: Долина страха',1983,50,0.0,6.7,74,'1983-01-14','https://st.kp.yandex.net/images/film/10140.jpg','Sherlock Holmes and the Valley of Fear','Убийца сделал все, чтобы его жертва осталась неопознанной, а полиция пошла бы по ложному следу. Но, как всегда, вмешательство Шерлока Холмса ставит все на свои места. Убийца сам выходит из укрытия и поднимает мрачную завесу над своим прошлым в далекой Америке, откуда через многие годы тянулся к нему кровавый след…','Нет данных'),(10141,'Мой лучший год',1982,92,0.0,6.7,241,'1982-10-08','https://st.kp.yandex.net/images/film_iphone/iphone360_10141.jpg','My Favorite Year','Бенджи Стоун молодой писатель комедийного шоу. Беднягу назначают сопровождать гостя недели — Алана Суонна, угасшего актёра, знаменитого любителя женщин и пьяницу. Обязанностью Бенджи является не давать Суонну напиваться и делать всякие глупости.','Нет данных'),(10142,'Калигула',1979,156,0.0,6.0,11011,'1979-08-14','https://st.kp.yandex.net/images/film_iphone/iphone360_10142.jpg','Caligula','Рим, 1 век нашей эры. Правителем могущественной империи становится Гай Юлий Цезарь Август Германик, известный под прозвищем Калигула. Его имя станет нарицательным не из-за реформ и свершений, а благодаря расправам, порочным развлечениям и безнравственным связям. Недолгое правление Калигулы станет одной из самых кровавых страниц в истории Римской империи.','$17 500 000'),(10143,'Рассвет зулусов',1979,113,0.0,6.8,323,'1979-05-15','https://st.kp.yandex.net/images/film_iphone/iphone360_10143.jpg','Zulu Dawn','1879г., доблестные британские войска под предводительством лорда Челмсфорда продвигаются по Южной Африке, чтобы «раз и навсегда уладить зулусский вопрос». Король зулусов Кечвайо считает англичан своими союзниками, их вторжение на земли зулусов — полная неожиданность для африканцев.<br><br>И тогда зулусы нападают на крупное британское соединение в 1500 человек и разбивают его, кровопролитное сражение стоило жизни почти всем английским солдатам.','Нет данных'),(10147,'Бутон розы',1975,126,0.0,6.2,141,'1975-03-24','https://st.kp.yandex.net/images/film_iphone/iphone360_10147.jpg','Rosebud','Группа палестинских террористов захватывает яхту «Розовый бутон» и находившихся на ней пятерых дочерей миллионеров и требуют показать по телевидению пленку со своими требованиями. Секретный агент Мартин берётся выследить террористов…','Нет данных'),(10148,'Правящий класс',1972,154,0.0,7.6,489,'1972-05-10','https://st.kp.yandex.net/images/film_iphone/iphone360_10148.jpg','The Ruling Class','Удивительно глупым образом умирает член Палаты Лордов, оставив всё имущество своему сыну. К несчастью, его сын невменяем, так как считает, что он Иисус Христос. Другие, более адекватные, члены их семьи сговариваются завладеть его наследством, что приводит к изувечиванию и убийству.','Нет данных'),(10149,'Человек из Ла Манчи',1972,132,0.0,7.3,307,'1972-12-11','https://st.kp.yandex.net/images/film_iphone/iphone360_10149.jpg','Man of La Mancha','XVI век. Поэт, писатель и актёр Мигель де Сервантес брошен за долги в тюрьму, где он рассказывает другим заключённым историю дворянина Алонсо Кехано, который назвал себя странствующим рыцарем Дон Кихотом и пустившийся в дорогу навстречу опасностям ради благосклонности Прекрасной Дамы.','$12 000 000'),(10150,'Под сенью млечного леса',1971,87,0.0,6.2,110,'1971-08-26','https://st.kp.yandex.net/images/film_iphone/iphone360_10150.jpg','Under Milk Wood','Экранизация произведений знаменитого английского поэта Дилана Томаса. История о жизни приморской деревушки в Уэллсе и ее жителей, показанная с яркой наблюдательностью и бойким английским юмором.','Нет данных'),(10151,'Война Мерфи',1970,107,0.0,7.1,302,'1971-01-13','https://st.kp.yandex.net/images/film_iphone/iphone360_10151.jpg','Murphy\'s War','Хорошо поставленный, захватывающий боевик о войне, в котором наряду с батальными сценами дается психологический портрет английского моряка, который один остался в живых после того, как его судно оказалось потоплено немцами. Опираясь на помощь местного населения, после восстановления здоровья, он, одержимый местью, решает один напасть на немецкую армию, несмотря на то, что война уже закончилась…','Нет данных'),(10152,'Братская любовь',1970,112,0.0,6.5,79,'1970-04-22','https://st.kp.yandex.net/images/film_iphone/iphone360_10152.jpg','Country Dance','История состоятельного американца, склонного к излишнему употреблению алкоголя, и его сестры. Их отношения выходят за привычные рамки…','Нет данных'),(10155,'Ночь генералов',1966,148,0.0,7.3,551,'1967-01-29','https://st.kp.yandex.net/images/film_iphone/iphone360_10155.jpg','The Night of the Generals','В оккупированной нацистами Варшаве в 1942 году убивают проститутку. В ходе расследования убийства подозреваемыми становятся три известных генерала вермахта. Дело спускают на тормозах, а обвиняемых спешно переводят в Париж. Однако вскоре и здесь обнаруживают труп девушки легкого поведения. Майора Грау, взявшегося за это таинственное дело, вынуждают прекратить дальнейшее расследование. Проходит 20 лет, и уже в Гамбурге при схожих обстоятельствах убивают еще одну женщину.','Нет данных'),(10156,'Как украсть миллион',1966,123,0.0,8.2,69622,'1966-07-13','https://st.kp.yandex.net/images/film_iphone/iphone360_10156.jpg','How to Steal a Million','Действие происходит в Париже. Молодая девушка, дочь миллионера, втайне промышляющего подделкой произведений искусства, и преступник, должны выкрасть с выставки изобразительного искусства в музее один из «шедевров» отца девушки, чтобы спасти его от разоблачения.','$6 000 000'),(10157,'Кулик',1965,117,0.0,7.1,285,'1965-06-23','https://st.kp.yandex.net/images/film_iphone/iphone360_10157.jpg','The Sandpiper','Лаура Рейнолдс — художница, придерживается современных взглядов, ведет богемный образ жизни и самостоятельно воспитывает сына Дэнни. Однако Департамент охраны детства настаивает на том, чтобы Лаура прекратила свои педагогические эксперименты и отдала сына под опеку государства.<br><br>Молодая мать поступает по-своему. Вместо того чтобы отдать Дэнни в общественную школу, она устраивает сына в частную академию, которой управляет доктор Эдвард Хьюитт.<br><br>Вначале доктор потрясен взглядами Лауры на жизнь, свободную любовь и моральный кодекс, но проходит время и чем больше он узнает ее, тем сильнее разгорается в нем чувство любви к этой необыкновенной женщине.<br><br>Всепоглощающая страсть к Лауре превращает благопристойного семьянина и отца двух детей в безумного любовника, для которого вся прошлая жизнь забыта и зачеркнута.','$5 300 000'),(10158,'Что нового, кошечка?',1965,108,0.0,6.8,905,'1965-06-22','https://st.kp.yandex.net/images/film_iphone/iphone360_10158.jpg','What\'s New Pussycat','Патологический бабник Майкл всеми силами пытается сохранить верность своей девушке, но у него ничего не получается. От отчаяния он начинает ходить к психоаналитику. Но доктору самому нужна срочная психиатрическая помощь, как, впрочем, всем героям этой безумной истории.','Нет данных'),(10159,'Лорд Джим',1965,154,0.0,6.6,130,'1965-02-15','https://st.kp.yandex.net/images/film_iphone/iphone360_10159.jpg','Lord Jim','Офицер торгового флота Джим Берк в сильный шторм покидает корабль, не позаботившись о пассажирах. Их спасает французское судно. Джим оставляет службу, понимая, что опозорил мундир офицера. Мучаясь от угрызений совести, он ищет случая искупить свою вину. Судьба приводит его в Азию. Здесь он возглавляет борьбу туземцев против местного феодала и становится их героем.','Нет данных'),(10160,'День, когда ограбили английский банк',1960,85,0.0,6.8,76,'1960-05-17','https://st.kp.yandex.net/images/film_iphone/iphone360_10160.jpg','The Day They Robbed the Bank of England','Трое ирландских революционеров собираются украсть всё золото из подвалов банка Англии. Норгат, их главарь, находит слабое место в защите банка: забытую канализационную трубу прямо под подвалом.','Нет данных'),(10161,'Похищенный',1960,97,0.0,7.1,124,'1960-02-24','https://st.kp.yandex.net/images/film_iphone/iphone360_10161.jpg','Kidnapped','Молодой человек Дэвид Балфур отправляется с письмом в поместье к своему дяде, младшему брату умершего отца. Юноша должен вступить во владение наследством. Но жестокий и коварный дядя вовсе не спешит расставаться со своими владениями.<br><br>Он придумывает хитрый план. Племянника похищают пираты, чтобы потом продать на аукционе рабов в Южной Каролине. Но судьба благосклонна к Дэвиду. Она посылает ему спасение в лице лучшего воина Шотландии благородный рыцаря Элана Стюарта, попавшего на тот же корабль.','Нет данных'),(10162,'Невинные дикари',1960,110,0.0,6.8,87,'1960-03-15','https://st.kp.yandex.net/images/film_iphone/iphone360_10162.jpg','The Savage Innocents','Фильм о безнадежной попытке сохранить еще не тронутую цивилизацией жизнь.','Нет данных'),(10167,'Поймет лишь одинокий',1991,104,0.0,6.8,1321,'1991-05-24','https://st.kp.yandex.net/images/film_iphone/iphone360_10167.jpg','Only the Lonely','Чикагскому полицейскому Дэнни Мулдуну минуло уже 38 лет, а он продолжает оставаться неженатым. Старый холостяк живет со своей мамой Розой и трогательно о ней заботится. Но однажды в местном Ирландском баре он знакомится с хорошенькой Терезой Луной. Дэнни влюбляется в девушку с первого взгляда. И она отвечает взаимностью. Только капризная мать Дэнни омрачает счастливые дни, выражая явное неудовольствие: её совсем не устраивает перспектива стать свекровью…','Нет данных'),(10168,'Месть',1989,124,0.0,7.3,6511,'1990-02-16','https://st.kp.yandex.net/images/film_iphone/iphone360_10168.jpg','Revenge','Джей Кокрэн, летчик ВВС США, уволившись из армии, принимает приглашение старого приятеля Тибурона Мендеса, мексиканского латифундиста, политика и, вероятно, крупного мафиози.<br><br>Приехав в гости в Мексику, где, впрочем, Кокрэн приобрел небольшую хижину в уединенном горном уголке, и встретив молодую и красивую Мирию, жену Мендеса, он, забыв об опасности, отдается вспыхнувшему страстному чувству.','Нет данных'),(10169,'Страдивари',1988,110,0.0,7.1,132,'1988-09-28','https://st.kp.yandex.net/images/film_iphone/iphone360_10169.jpg','Stradivari','Северная Италия XVII века — значимый фон этой беллетризованной биографии, сделанной по всем правилам жанра. Антонио Страдивари, с детства заболевший скрипкой, лучший ученик Николо Амати, гордость Кремоны, прожил на удивление благополучную жизнь. Даже после смерти первой жены он не мучился сверх общественных приличий и женился вторым браком, таким же счастливым, как первый.<br><br>И дети умницы, и ученики не отстают, и король Испании жалует награды, не говоря уже о местной знати. До романтизма с его обязательной личностной драмой еще далеко, рационализм уже наступает, но все еще цветет эпоха пышного гедонистического барокко. Жить в довольстве и согласии с собой было тогда принято. Так же, как много позднее — копаться в собственных травмах и призывать в помощь вдохновению темные силы…','Нет данных'),(10174,'Лев пустыни',1980,173,0.0,7.2,337,'1980-12-19','https://st.kp.yandex.net/images/film_iphone/iphone360_10174.jpg','Lion of the Desert','Фильм рассказывает об Омаре Мухтаре, вожде бедуинов, которые героически боролись против оккупации Ливии Муссолини.','$35 000 000'),(10176,'Греческий магнат',1978,107,0.0,6.5,102,'1978-05-12','https://st.kp.yandex.net/images/film_iphone/iphone360_10176.jpg','The Greek Tycoon','Фильм основан на реальной истории любви греческого магната (Онассиса) и блестящей молодой вдовы американского президента (Жаклин Кеннеди). Судостроительный магнат Тео Томасис становится вторым мужем Лиз Кессиди, вдовы американского президента Джона Кессиди.<br><br>Она — первая леди Америки, он — бывший крестьянин, ставший мультимиллионером. У него есть все: остров, деньги, яхта, женщины… Он заставляет ее вновь вернуться к полноценной жизни после пережитого горя и делает все, чтобы она согласилась стать его женой. Суждено ли им обрести счастье вместе?','Нет данных'),(10177,'Послание',1976,177,0.0,7.4,1022,'1976-07-30','https://st.kp.yandex.net/images/film_iphone/iphone360_10177.jpg','The Message','В фильме показан период, когда Мухаммед стал пророком Аллаха. Жизнь Пророка показана с первых лет в Мекке, в которой мусульмане преследовались, затем показано массовое бегство в Медину и торжественное возвращение мусульман в Мекку. В фильме отражены многие переломные события, такие, как битва при Бадре и битва при Ухуде. Большинство историй рассказывают свидетели: дядя Мухаммеда Хамза ибн Абд аль-Мутталиб, владыка Мекки Абу Суфьян и его жена Хинд бинт Утба.','$10 000 000'),(10179,'Блеф',1976,110,0.0,8.2,90101,'1976-04-15','https://st.kp.yandex.net/images/film_iphone/iphone360_10179.jpg','Bluff storia di truffe e di imbroglioni','Белль Дюк имеет старые счеты с Филиппом Бэнгом, который отбывает свой срок за решёткой. Для того чтобы поквитаться с Филиппом, Белль Дюк вступает в сговор с другим аферистом по имени Феликс, чтобы тот организовал побег Филиппа Бенга из тюрьмы.<br><br>Побег удаётся, но парочка заодно обманывает и Белль Дюк, исчезнув прямо из-под её носа. Выясняется, что и Филипп Бэнг, в свою очередь, не прочь отомстить Белль Дюк. Для этого он задумывает грандиозную мистификацию, сродни покерному блефу…','Нет данных'),(10180,'Наследство Феррамонти',1976,120,0.0,6.9,151,'1976-05-25','https://st.kp.yandex.net/images/film_iphone/iphone360_10180.jpg','L\'eredità Ferramonti','Престарелый Грегорио Феррамонте, хозяин большой пекарни, пока что не решил, кому из детей оставить свое имущество и деньги.<br><br>Ирена — жена его младшего сына — решает воспользоваться этим обстоятельством. Она становится любовницей Грегорио, и вскоре он делает ее единственной наследницей…','Нет данных'),(10181,'Марсельский контракт',1974,89,0.0,6.2,185,'1974-09-04','https://st.kp.yandex.net/images/film_iphone/iphone360_10181.jpg','The Marseille Contract','Когда агент спецслужбы Вентура не сумел разобраться с наркобароном Бризаром законным путем, он заключил договор с киллером. Последствия такого «сотрудничества» непредсказуемы…','$2 000 000'),(10182,'На той стороне 110-й улицы',1972,102,0.0,6.8,262,'1972-12-19','https://st.kp.yandex.net/images/film_iphone/iphone360_10182.jpg','Across 110th Street','Мелкие чернокожие преступники отважились на нахальное преступление: они украли у итальянского гангстера 300 тысяч долларов и теперь находятся в бегах. За дело берутся двое полицейских — коррумпированный коп и его молодой чернокожий напарник. Остается только один вопрос, кто первым доберется до воришек: служители закона или мафия.','Нет данных'),(10187,'Революция в минуту',1970,92,0.0,6.4,78,'1970-09-16','https://st.kp.yandex.net/images/film_iphone/iphone360_10187.jpg','R.P.M.','Студенческий бунт — процесс сложный и плохо управляемый. Пако Перес, либеральный профессор, преподающий в колледже, пользуется авторитетом среди студентов. И когда из-за нападок радикалов ректор университета покидает свой пост, Перес занимает его место. Однако после того как выясняется, что Перес не может выполнить требования активистов так быстро, как им бы этого хотелось, вновь разгорается конфликт…','Нет данных'),(10189,'Тайна Санта-Виттории',1969,139,0.0,7.2,392,'1969-10-29','https://st.kp.yandex.net/images/film_iphone/iphone360_10189.jpg','The Secret of Santa Vittoria','Санта-Виттория — маленький итальянский городок, жители которого пытаются радоваться жизни вопреки всем невзгодам. Недотепа Итало Бомболини неожиданно становится мэром, но его прогоняет из дома собственная жена. Итальянский фашизм пал, но вот-вот в город войдут немецкие оккупанты, и местным придётся очень постараться, чтобы сохранить от вражеских посягательств самое дорогое, что есть в их жизни — кровь знойной Италии, великолепное красное вино.','Нет данных'),(10190,'Маг',1968,117,0.0,5.4,498,'1968-10-04','https://st.kp.yandex.net/images/film_iphone/iphone360_10190.jpg','The Magus','Английский учитель приезжает на один из тихих и спокойных греческих островов, дабы занять пост в местной школе. Он узнает, что его предшественник покончил с собой при весьма таинственных обстоятельствах. Спустя некоторое время, он знакомится со странным человеком по имени Кончис, и оказывается втянут в захватывающую мистическую игру, которая с каждым днем становится все опаснее.','Нет данных'),(10191,'Башмаки рыбака',1968,162,0.0,6.8,96,'1968-11-14','https://st.kp.yandex.net/images/film_iphone/iphone360_10191.jpg','The Shoes of the Fisherman','Оказавшийся на свободе после 20 лет, проведённых в сибирских лагерях, львовский архиепископ Кирилл Лакота приглашается в Ватикан, где ему присваивается титул кардинала. Вскоре после смерти понтифика Лакота становится новым Римским Папой, но как раз в это время, наблюдая за кризисными явлениями, происходящими в обществе, он сталкивается с кризисом собственных религиозных убеждений.','Нет данных'),(10192,'Битва в Сан-Себастьяне',1968,111,0.0,6.9,120,'1968-03-20','https://st.kp.yandex.net/images/film_iphone/iphone360_10192.jpg','La bataille de San Sebastian','Мексика. 1746 год. Беглого преступника Леона Аластрея, переодетого монахом, в деревне Сан-Себастьян ошибочно принимают за священника. Сами жители деревни страдают из-за нападений индейского племени яки, которых возглавлял метис Текло, и появление священника считают знаком свыше. Сначала Леон отказывается принять на себя роль спасителя, но в итоге вынужден пересмотреть своё решение.','Нет данных'),(10198,'Грек Зорба',1964,142,0.0,7.8,1293,'1964-12-14','https://st.kp.yandex.net/images/film_iphone/iphone360_10198.jpg','Alexis Zorbas','Молодой англичанин Бэзил получает в наследство участок земли и шахту на острове Крит, где сталкивается с жестокими нравами местных жителей, и только дружба с жизнерадостным и находчивым греком Зорбой позволяет ему преодолеть возникшие проблемы.','$783 000'),(10200,'Разбойник Варавва',1961,144,0.0,7.1,382,'1961-12-23','https://st.kp.yandex.net/images/film_iphone/iphone360_10200.jpg','Barabbas','Библейская легенда о воре и убийце Варавве, которого помиловал Понтий Пилат. Была такая традиция в древней Иудее, когда зрители, присутствующие на массовых казнях, которые являлись своеобразным шоу, проходившими при гигантском стечении публики, могли по своему произволу выбрать одного понравившегося им преступника и освободить его от смерти. В тот раз люди выбрали Варавву…','Нет данных'),(10202,'Чертовка в розовом трико',1960,100,0.0,5.9,137,'1960-01-01','https://st.kp.yandex.net/images/film_iphone/iphone360_10202.jpg','Heller in Pink Tights','Том Хэйли — владелец небольшого передвижного театра, мечтает наконец-то осесть в одном месте, но ему приходится все время скрываться от кредиторов, ведь Анджела, ведущая актриса, очень любит красивые наряды, на которые не всегда есть деньги. Прибыв в очередной городок на гастроли, Анджела занимает деньги у местного богача, проигрывает себя в карты, влюбляет в себя всех мужчин, и Тому ничего не остается делать, как в очередной раз пуститься в бега вместе со всей театральной труппой…','Нет данных'),(10203,'Последний поезд из Ган Хилл',1959,95,0.0,7.2,269,'1959-07-09','https://st.kp.yandex.net/images/film_iphone/iphone360_10203.jpg','Last Train from Gun Hill','Жена Мэтта Моргана изнасилована и убита. Убийцы оставляют за собой седло, которое Морган опознает, как принадлежащее его старому другу Крэйгу Белдену, крупному фермеру из Ган-Хилла. Белден сочувствует, пока не выясняется, что один из убийц — его собственный сын Рик, которого он, естественно, отказывается передать в руки правосудия. Морган намерен выкрасть Рика и убраться вместе с ним на последнем 9-часовом поезде; но в городе он оказывается в западне, один на один с Белденом и его людьми, ищущими Моргана, чтобы убить.','Нет данных'),(10204,'Дикий ветер',1957,114,0.0,7.2,136,'1957-12-11','https://st.kp.yandex.net/images/film_iphone/iphone360_10204.jpg','Wild Is the Wind','Фильм рассказывает историю хозяина ранчо, после смерти жены женившегося на ее итальянской сестре, вскоре влюбившейся в его молодого помощника.','Нет данных'),(10208,'Собор Парижской Богоматери',1956,105,0.0,7.6,2553,'1956-12-19','https://st.kp.yandex.net/images/film_iphone/iphone360_10208.jpg','Notre-Dame de Paris','Классическая экранизация романа Виктора Гюго отличается прежде всего декорациями и скрупулезным воссозданием эпохи царствования Людовика ХI, пышными костюмами и проникновенной игрой Джины Лоллобриджиды в роли Эсмеральды в апогее своей красоты и славы, Энтони Куинна в роли Квазимодо и Алена Кюни в роли Клода Фролло, влюбленного в Эсмеральду безумной и безнадежной любовью.','Нет данных'),(10210,'Жажда жизни',1956,122,0.0,7.7,1343,'1956-09-15','https://st.kp.yandex.net/images/film_iphone/iphone360_10210.jpg','Lust for Life','После смерти отца Ван Гог перебрался в Париж, примкнул к художникам-импрессионистам. Однажды Ван Гог познакомился с художником Полем Гогеном. Время проходило в работе и творческих спорах, переходящих в ссоры. Ван Гог все чаще переживал приступы безумия: во время одного из них он отрезал себе ухо…','Нет данных'),(10214,'Аттила завоеватель',1954,80,0.0,6.1,155,'1954-12-27','https://st.kp.yandex.net/images/film_iphone/iphone360_10214.jpg','Attila','Древние пророчества гласили, что однажды появится человек, который сможет объединить племена свирепых воинов и бросить вызов непобедимой Римской империи, которая веками правила античным миром. Имя этого человека стало легендарным и навсегда вошло в историю человечества: Аттила — бесстрашный повелитель гуннов. Нам предстоит стать свидетелями противостояния двух самых могущественных людей своего времени и их армий: непокорного Аттилы и прославленного римского полководца Флавия…','Нет данных'),(10215,'Приключения Одиссея',1954,91,0.0,7.0,866,'1954-10-06','https://st.kp.yandex.net/images/film_iphone/iphone360_10215.jpg','Ulisse','Классическая история Гомера о подвигах и приключениях древнегреческого героя Одиссея во время его возвращения домой к жене Пенелопе после Троянской войны.<br><br>Какие только испытания не выпали на долю Одиссея — его пытались охмурить прелестные и возбужденные одинокие женщины, захватить в плен и порвать на куски громадные и безобразные циклопы, отравить коварные и беспощадные правители маленьких прибрежных средиземноморских государств.<br><br>Но упрямый и бесстрашный Одиссей неумолимо и непреклонно «рвался на Запад», домой, к теплой и верной своей жене Пенелопе…','$500 000'),(10223,'Семинолы',1953,87,0.0,6.4,70,'1953-03-20','https://st.kp.yandex.net/images/film_iphone/iphone360_10223.jpg','Seminole','В 1830 г. президент США Эндрю Джексон подписал Закон о выселении индейцев, согласно которому аборигены были насильственно переселены в специально созданные для них Индейские территории (ныне восток штата Оклахома). Небольшая часть племени семинолов, от 300 до 500 человек, осталась на юге Флориды и оказывала ожесточённое сопротивление армии США, потерявшей в боях около 1500 солдат. Действие фильма происходит в 1838 году, во время 2-ой Cеминольской войны. В центре сюжета судьба и трагедия вождя семинолов Оцеолы…','Нет данных'),(10224,'Против всех врагов',1952,84,0.0,6.2,78,'1952-12-24','https://st.kp.yandex.net/images/film_iphone/iphone360_10224.jpg','Against All Flags','Бесстрашный британский офицер получает задание проникнуть в крепость пиратов на Мадагаскаре. Просочившись в крепость с помощью хитрости и выполнив свою миссию, он вдобавок ещё успевает отбить красавицу Морин у главаря пиратов!','Нет данных'),(10225,'Мир в его руках',1952,104,0.0,6.8,129,'1952-06-18','https://st.kp.yandex.net/images/film_iphone/iphone360_10225.jpg','The World in His Arms','1850 год. Джонатан Кларк — капитан судна, противозаконно добывающий тюленей, возвращается на берег после удачного лова и вместе со своим экипажем поселяется в отеле.<br><br>В это время там остановилась и Марина Селиванова — русская графиня приехала ради брака по договоренности с князем Семеном. Графиня надеется найти в порте Ситки своего дядю, генерал-губернатора Ивана Ворошилова и уговорить его расторгнуть помолвку.<br><br>Неожиданно графиня узнает, что у Кларка есть корабль с экипажем. Красавица просит его доставить ее к дяде. Джонатан и Марина влюбляются до безумия друг в друга и после ночной прогулки и страстных объятий при луне готовы венчаться уже утром.<br><br>Однако, князь Семен приезжает в гавань Сан-Франциско и на корабле похищает графиню. Он идет курсом на Аляску и обещает убить Ворошилова, если тот не выполнит свои предыдущие брачные обязательства.<br><br>Кларк узнает, что графиня исчезла и напивается до беспамятства, устраивает дикую драку с Портаге и остается без дела. Для того чтобы достать деньги, Джонатан заключает с португальцем пари.<br><br>Назначается гонка до порта Ситки. Победитель забирает весь улов и корабль проигравшего. Стороны ударяют по рукам, и гонка начинается.','Нет данных'),(10231,'Синдбад-мореход',1947,116,0.0,6.6,225,'1947-01-13','https://st.kp.yandex.net/images/film_iphone/iphone360_10231.jpg','Sinbad, the Sailor','Картина рассказывает о поиске Синбадом загадочного острова Дерюбар, где спрятан клад великого Александра Македонского. В поисках сокровищ ему помогает красавица Ширин, которую отважный герой похитил из гарема эмира Даибула. Эмир, узнав об этом, бросился в погоню за влюбленными с целью вернуть беглянку, но его планам не суждено осуществится. Храбрый Синбад выйдет победителем из этой истории, ведь у восточной сказки всегда должен быть счастливый финал…','$2 459 000'),(10232,'Калифорния',1947,97,0.0,6.1,84,'1947-01-14','https://st.kp.yandex.net/images/film/10232.jpg','California','Калифорния 1848 год, пик южной золотой лихорадки, глобальное переселение американцев в южные штаты в потеках лучшей жизни и золота, В это время большинство штатов вступили между собой в федеральный союз, но Калифорния игнорирует все предложения соседей потому, что продажная местная правящая верхушка держится за власть, хотя большинство разноплеменного населения штата согласно со вступлением в состав федерации.<br> <br>Всем штатом, по сути, правит один человек — деспотичный Капитан Коффин, скупивший почти всю местную недвижимость и земли. Он жаждет сделать Калифорнию своей частной империей. Этому деспоту противостоят крепкий парень в широкополой шляпе, настоящий первопроходец Джонатан Трамбо и его любимая женщина красавица и певица Лили, которые не остановятся ни перед чем, ради демократии и свободы своей новой Родины…','Нет данных'),(10236,'Баффало Билл',1944,90,0.0,6.6,99,'1944-04-13','https://st.kp.yandex.net/images/film_iphone/iphone360_10236.jpg','Buffalo Bill','Американская кавалерия сражается с племенем шайеннов. Прославленный скаут и друг индейцев Буффало Билл становится героем в схватке со своим бывшим краснокожим другом.','Нет данных'),(10240,'Черный лебедь',1942,85,0.0,6.5,304,'1942-12-04','https://st.kp.yandex.net/images/film_iphone/iphone360_10240.jpg','The Black Swan','Начинается фильм с того, что легендарный головорез Генри Морган получает амнистию и направляется на Ямайку новым губернатором. Желая удержать своих бывших подельников от продолжения бесчинств и безобразий, Морган неожиданно встречает сопротивление в лице двух негодяев.<br><br>Герой Тайрона Пауэра тем временем влюбляется в дочку предыдущего губернатора, но она отвергает его прямолинейные ухаживания. Хотя похищение и пленение прекрасной девушки на борту боевого корабля мало помогает делу любви, все резко меняется, когда при нападении Сэндерса и Куинна главному персонажу фильма приходиться драться за женщину, которую он любит…','Нет данных'),(10243,'Они умерли на своих постах',1941,140,0.0,6.6,194,'1941-11-20','https://st.kp.yandex.net/images/film/10243.jpg','They Died with Their Boots On','Этот фильм о Джордже Армстронге Кастере, который был яркой личностью, лихим солдатом, прожившим интересную жизнь. Его неуязвимость в битвах стала в народе именем нарицательным. «Удача Кастера» такое выражение означает в США постоянное везение.<br /><br />Одиннадцать раз во время гражданской войны под Кастером была убита лошадь, а он не получил ни единой царапины. После войны, Кастер отправился на запад сражаться с индейцами, как боевой командир во главе 7-го Кавалеристского полка. Он был безрассуден и смел, но только 25-го Июня 1876 года удача отвернулась от него. На территории Монтаны, его полк был окружен племенами Сиу и Шайен.<br /><br />Кастеру был отдан приказ атаковать и, несмотря на бессмысленность битвы и неминуемое поражение, командир повел людей в бой, хотя как человек он понимал, что идет на смерть. Вскоре его маленький отряд из 225 человек был зажат в 10 раз превосходящей по численности конницей индейцев. Кастер и его люди стойко оборонялись, но индейцы, под предводительством вождей «Бешеный Конь» и «Безрассудный», атаковали с неистовой силой. Кастер и его солдаты, были жестоко убиты.<br /><br />«Последняя битва Кастера», стала величайшим поражением армии США в войне против индейцев.','$2 200 000'),(10245,'Кровь и песок',1941,125,0.0,7.0,252,'1941-05-22','https://st.kp.yandex.net/images/film_iphone/iphone360_10245.jpg','Blood and Sand','Эта мелодрама рассказывает о Хуане, бесстрашном, наивном и молодом тореадоре, променявшем подлинную любовь жены, на фальшивые объятия коварной соблазнительницы, дамы из высшего общества.','Нет данных'),(10249,'Завоевать город',1940,98,0.0,7.6,255,'1940-09-21','https://st.kp.yandex.net/images/film_iphone/iphone360_10249.jpg','City for Conquest','Бывший чемпион по боксу Данни Кенни уходит на покой. Он собирается вложить все свои сбережения в мечту своего брата — написание симфонической оды городу, в котором они оба живут — Нью-Йорку. Но все складывается не так как хотелось…','Нет данных'),(10261,'Дочь Шанхая',1937,62,0.0,5.5,60,'1937-12-17','https://st.kp.yandex.net/images/film_iphone/iphone360_10261.jpg','Daughter of Shanghai','Лан Юн Лиин и правительственный агент борются с иностранными контрабандистами.','Нет данных'),(10268,'Млечный путь',1936,89,0.0,6.3,84,'1936-02-07','https://st.kp.yandex.net/images/film_iphone/iphone360_10268.jpg','The Milky Way','Барли работает развозчиком молока. Однажды его лошади стало плохо, и чтобы раздобыть денег на её лечение, Барли вынужден временно стать боксёром.','Нет данных'),(10270,'Мсье Ибрагим и цветы Корана',2003,96,0.0,7.2,445,'2003-08-29','https://st.kp.yandex.net/images/film_iphone/iphone360_10270.jpg','Monsieur Ibrahim et les fleurs du Coran','В одном из рабочих кварталов начинается дружба еврейского мальчика Момо и пожилого мусульманина Ибрагима. Момо — сирота при живом отце, все глубже погружающемся в разрушительную депрессию. Его единственные друзья — уличные женщины, хоть немного заботящиеся о заброшенном ребенке. Иногда Момо ходит за покупками в бакалейную лавку, тесную и темную, тихий владелец которой Ибрагим, человек экзотической внешности, видит и знает явно больше, чем кажется на первый взгляд. После того, как отец окончательно оставляет Момо, Ибрагим становится единственным взрослым в жизни мальчика. Вместе они отправляются в поездку, которая изменит жизнь обоих.','Нет данных'),(10272,'Надзиратель',2001,93,0.0,6.3,329,'2001-08-10','https://st.kp.yandex.net/images/film_iphone/iphone360_10272.jpg','The Parole Officer','Стив Гарден — самый бестолковый служитель закона в мире! После позорного увольнения с поста надзирателя нашего «доблестного» стража порядка ждет новое назначение — в полицию Манчестера. В один из первых дней службы Стив становится свидетелем жестокого убийства. И, что самое страшное, — преступление хладнокровно совершил ведущий инспектор полиции. Как быть? К счастью, чувство справедливости офицера Гардена одерживает победу над его несовершенствами. Стив решает усадить злодея за решетку. Но для того, чтобы самый уважаемый сыщик города и коррумпированный бандит в одном флаконе предстал перед судом, нужны весомые доказательства. И Гарден находит их. Главной уликой является кассета, на которой с камер слежения записалось жуткое убийство. Эту улику прячут в отлично охраняемом сейфе престижного банка. Герой решает выкрасть кассету и обращается за помощью к своим бывшим подопечным — «завязавшим» грабителям…','$6 000 000'),(10273,'13-й воин',1999,102,0.0,7.5,39435,'1999-08-13','https://st.kp.yandex.net/images/film_iphone/iphone360_10273.jpg','The 13th Warrior','Поэт Ахмед ибн Фахдлан в наказание за любовь стал посланником цивилизованного Востока на варварский Север к викингам. Воины готовятся к походу против племени Пожирателей Трупов. Только тринадцать воинов могут одолеть врага, и один из смельчаков должен быть чужестранцем. Бывший поэт, а ныне тринадцатый воин, берёт оружие и отправляется воевать.','$160 000 000'),(10277,'Правосудие бессильно',1991,113,0.0,6.0,163,'1992-04-14','https://st.kp.yandex.net/images/film_iphone/iphone360_10277.jpg','Beyond Justice','Жила-была состоятельная красивая молодая дама. Была она президентом гигантской и могущественной корпорации и был у нее 13-летний сын, с отцом которого она развелась, сохранив при этом, однако, хорошие отношения.<br><br>Вот почему она испытала страх не тогда, когда отец отвез мальчика в Марокко, чтобы показать ему родные места, а тогда, когда богатейший эмир (дед ее сына) похитил мальчика. И оказалось, что ей не к кому обратиться за помощью, кроме как к наемнику, способному выполнить любое задание.','Нет данных'),(10279,'Улица Паради, дом 588',1991,130,0.0,8.7,646,'1992-01-15','https://st.kp.yandex.net/images/film_iphone/iphone360_10279.jpg','588 rue Paradis','Продолжение фильма «Мать» («Mayrig»), рассказывающего о судьбе одной армянской семьи, вынужденной бежать во Францию во время геноцида.<br><br>События переносят нас в современность. Прошло много лет, сын вырос и стал известным театральным режиссером, он женат на француженке, его дети не знают армянского языка. Но вот, ставя спектакль по истории своей семьи, он заново переживает все то, о чем забыл, попав в круговорот собственной жизни, и эти воспоминания заставляют его многое в ней изменить.','Нет данных'),(10282,'Мать',1991,139,0.0,8.8,2794,'1991-11-27','https://st.kp.yandex.net/images/film_iphone/iphone360_10282.jpg','Mayrig','В 1921 году семья армян, спасаясь от геноцида, приезжает в Марсель. Через воспоминания шестилетнего ребенка представлена история семьи, объединенной любовью и нежностью. В фильме рассказывается о судьбе семьи Закарян. Азат Закарян высаживается в порту Марселя со своей семьей: отцом, матерью и двумя тетушками. <br><br>Армяне, преследуемые турками, они знают, как тяжело приспособиться к новой жизни и трудным работам. Но несмотря на все тяготы, семья остается крепко сплоченной. Взрослые многого лишают себя, ради того, чтобы в будущем Азат получил образование и стал инженером.','Нет данных'),(10286,'Бесы',1987,116,0.0,6.5,480,'1988-02-24','https://st.kp.yandex.net/images/film_iphone/iphone360_10286.jpg','Les possédés','Бесы — революционеры, а Россия — болезнь, из которой исходят демоны. Чтобы повязать весь кружок кровью, в предательстве обвиняется Шатов, и его убивают сразу после того, как его жена родила ребенка от Ставрогина, тогда, когда он мог стать счастливым, уйдя от всего этого бреда.','Нет данных'),(10290,'О, божественный пес!',1980,103,0.0,6.9,374,'1980-07-11','https://st.kp.yandex.net/images/film_iphone/iphone360_10290.jpg','Oh Heavenly Dog','Мы любим поговорить о переселении душ. А вот частному детективу Браунингу пришлось умереть, воскреснуть и расследовать собственное убийство. Началось все со странного заказа на выяснение обстоятельств смерти девушки. Браунинг отправился в Лондоне, где и получил удар ножом в спину. На том свете детективу поручают раскрыть собственное убийство.<br><br>Однако, есть одно условие — спуститься на землю он может только в образе собаки. Так Браунинг и становится пушистым, добродушным псом миленькой корреспондентки Джеки. Как можно искать убийцу, когда так хочется приударить за хозяйкой?','Нет данных'),(10291,'Балтиморская пуля',1980,103,0.0,5.9,65,'1980-04-01','https://st.kp.yandex.net/images/film_iphone/iphone360_10291.jpg','The Baltimore Bullet','Джеймс Кобурн в роли ветерана — бильярдиста и трепача Ника Кейси демонстрирует неувядаемое чувство юмора и превосходную технику игры на бильярде.<br><br>Смогут ли Ник по кличке «Балтиморская пуля» и его протеже Билли победить в матче Дикона — богатого альфонса, который живет в роскоши, окруженный прекрасными дамами? Сыграна может быть только одна партия. Ставка — 20 тысяч долларов.','Нет данных'),(10292,'Узы крови',1979,117,0.0,5.7,441,'1979-06-29','https://st.kp.yandex.net/images/film_iphone/iphone360_10292.jpg','Bloodline','Элизабет Рофф — наследница фармацевтической гигантской империи, оставленной ей отцом, погибшим при весьма загадочных обстоятельствах. Она уверена — это убийство, и следующей жертвой обречена стать она сама. Но — кому выгодно убрать ее с дороги? Любому из многочисленных родственников, отчаянно нуждающихся в деньгах… А еще — вышедшему из низов удачливому бизнесмену, которого Элизабет любит — и который на первый взгляд платит ей взаимностью…','$12 000 000'),(10293,'Ашанти',1979,118,0.0,6.0,158,'1979-02-21','https://st.kp.yandex.net/images/film_iphone/iphone360_10293.jpg','Ashanti','Чернокожую жену белого врача-миссионера похитили работорговцы, чтобы продать шейху. Доктор вместе с бесстрашным и грозным бедуином, у которого тоже украли жену, отправляется на поиски.','Нет данных'),(10294,'Розовая пантера наносит ответный удар',1976,103,0.0,6.9,785,'1976-12-15','https://st.kp.yandex.net/images/film_iphone/iphone360_10294.jpg','The Pink Panther Strikes Again','Инспектор полиции Клузо своим непрофессионализмом довел коллегу до сумасшествия. Тот сбежал из больницы, захватил в заложники главного психиатра, взорвал здание ООН и даже пытался собрать атомную бомбу. И все это только для того, чтобы убить Клузо…','$6 000 000'),(10296,'Финиковая косточка',1974,125,0.0,6.2,96,'1974-07-11','https://st.kp.yandex.net/images/film_iphone/iphone360_10296.jpg','The Tamarind Seed','Во время отдыха на Карибах, британская шпионка влюбляется в своего русского коллегу, подумывающего о том, чтобы переманить ее на свою сторону. Но после сам решает «перебежать». В качестве аванса он предлагает разоблачить высокопоставленного британца, работающего на русских.','Нет данных'),(10297,'Таинственный остров',1972,96,0.0,6.3,431,'1973-09-27','https://st.kp.yandex.net/images/film/10297.jpg','La isla misteriosa','1865 год разгар Гражданской войны в Америке. Несколько северян спасаются от плена южан на воздушном шаре. Но судьба готовит путешественникам новые испытания, они попадают на необитаемый остров. Выжить в этих непростых условиях им помогает не только трудолюбие и знания, но и помощь таинственного доброжелателя.','Нет данных'),(10299,'Ограбление',1971,120,0.0,7.1,430,'1971-10-27','https://st.kp.yandex.net/images/film_iphone/iphone360_10299.jpg','Le casse','Обаятельный вор, которому всегда везет, крадет дорогой изумруд. Его преследует плут-полицейский, который также не прочь завладеть камнем. Соперники готовы бороться за славу и богатство до последнего вздоха…','Нет данных'),(10301,'Война крестоносцев',1971,128,0.0,7.0,256,'1971-01-28','https://st.kp.yandex.net/images/film_iphone/iphone360_10301.jpg','The Last Valley','«Война крестоносцев» — удивительная история о полной лишений жизни народа Австрии 17 века на фоне 30-летней войны. Странствующий учитель Вогел попадает в мирную деревню, на которой еще не лежит след будущей войны. Когда армия безжалостных наемников под предводительством «капитана» также обнаруживает этот оазис, жители деревни попадают в бездну горя насилия.','$11 000 000'),(10303,'Майерлинг',1968,135,0.0,7.0,438,'1968-10-22','https://st.kp.yandex.net/images/film_iphone/iphone360_10303.jpg','Mayerling','Наследник австро-венгерского трона кронпринц Рудольф — яркая и сложная личность. Женщины, балы, приемы — за беспечным фасадом кроется тяжкий груз ответственности и неопределенности. В любой момент он может стать императором, а его судьба принадлежит Империи. Рудольф несчастлив в браке.<br><br>Многие дамы хотели бы оказаться рядом с ним, но только баронесса Вечера смогла зажечь в нем настоящее чувство. Их яркая, сумасшедшая любовь была заранее обречена. Влюбленные ушли из жизни в мрачном замке Майерлинг.','$5 000 000'),(10304,'Смешная девчонка',1968,155,0.0,8.0,5861,'1968-09-18','https://st.kp.yandex.net/images/film_iphone/iphone360_10304.jpg','Funny Girl','На пути к славе и успеху Фанни Брайс пришлось пройти от гадкого утенка до прекрасного лебедя. На сцене она — звезда, охапки роз падают к ногам, зал взрывается овациями.<br><br>Но за эти упоительные, волшебные секунды ей приходится расплачиваться горькими, одинокими ночами, полными слез и ревности.','$14 100 000'),(10305,'Жила-была...',1967,115,0.0,6.2,140,'1967-10-19','https://st.kp.yandex.net/images/film_iphone/iphone360_10305.jpg','C\'era una volta','Однажды красивая, но крайне взбалмошная неаполитанская крестьянка Изабелла встретила капризного испанского принца Родриго Ферранте. Король Испании приказал, чтобы Родриго выбрал себе жену среди семи итальянских принцесс, но он уже был сражен красотой скромной крестьянки. Не зная об этом, Изабелла с помощью ведьм и святых решает завоевать сердце своего принца…','Нет данных'),(10306,'Чингиз Хан',1965,120,0.0,5.3,200,'1965-04-15','https://st.kp.yandex.net/images/film_iphone/iphone360_10306.jpg','Genghis Khan','Фильм по легенде о Чингисхане рассказывает о повелителе монголов, начиная с детства после гибели его отца, и заканчивается его смертью, когда ему удается осуществить свою мечту, объединив всев монголов в одну нацию.','Нет данных'),(10315,'Борьба в долине',1953,105,0.0,5.8,138,'1956-03-26','https://st.kp.yandex.net/images/film_iphone/iphone360_10315.jpg','Siraa Fil-Wadi','Египет. 50-е годы. Окончив сельскохозяйственный институт, Ахмад вернулся домой, мечтая помочь полунищим односельчанам вырастить богатый урожай. Опасаясь конкуренции с их стороны, паша и его племянник Рияд-бей решают залить водой полв феллахов и открываютплотину.<br><br>Чтобы замести следы преступления, Рияд-бей убивает шейха деревни, обвинив в его гибели отца Ахмада. Юноше, пытающемуся найти виновника трагедии, помогает дочь паши Амаль — их детская дружба давно переросла в любовь. Стремясь спасти дочь, скрывшуюся с Ахмедом в развалинах храма, паша называет имя преступника.','Нет данных'),(10318,'Затерянный мир',1960,97,0.0,6.3,117,'1960-07-13','https://st.kp.yandex.net/images/film_iphone/iphone360_10318.jpg','The Lost World','В начале XX века знаменитый профессор Челленджер делает потрясающее открытие — на удаленном плато в джунглях Амазонки существует удивительный и прекрасный мир, в котором до сих пор обитают динозавры. Миллионы лет эволюции его не коснулись — он остался в первозданном виде. Чтобы переубедить скептиков, группа искателей приключений — сам Челленджер, его чудаковатый коллега профессор Саммерли, девушка Агнес из миссионерского посёлка, бесстрашный охотник лорд Джон Рокстон и молодой репортер Эдвард Мэлоун — отправляются в захватывающее, полное опасностей путешествие на поиски этого удивительного доисторического мира.','Нет данных'),(10323,'Где живет опасность',1950,82,0.0,6.2,142,'1950-11-16','https://st.kp.yandex.net/images/film_iphone/iphone360_10323.jpg','Where Danger Lives','Молодой доктор влюбляется в отчаявшуюся женщину, становится вовлечённым в убийство её мужа и улетает с возлюбленной в Мексику.','Нет данных'),(10325,'Страстная дружба',1949,95,0.0,6.7,97,'1949-01-26','https://st.kp.yandex.net/images/film_iphone/iphone360_10325.jpg','The Passionate Friends','Мэри прилетает на отдых в Швейцарию раньше своего мужа и ночью в отеле вспоминает о своей первой любви, от которой отказалась ради брака с банкиром. Утром она встретит этого человека, которого не видела 9 лет, ведь по стечению обстоятельств он остановился в соседнем номере.','Нет данных'),(10327,'Вне подозрений',1947,103,0.0,6.3,151,'1947-10-03','https://st.kp.yandex.net/images/film_iphone/iphone360_10327.jpg','The Unsuspected','Была убита девочка. Женщина не может вспомнить мужчину, который утверждает, что он ее муж. Ее дядя ведет шоу на радио о тайне убийства «Вне подозрений». Кто убил эту девочку? Зачем? И кто этот загадочный муж?','Нет данных'),(10330,'Цезарь и Клеопатра',1945,129,0.0,7.1,900,'1945-12-11','https://st.kp.yandex.net/images/film_iphone/iphone360_10330.jpg','Caesar and Cleopatra','Исторические данные свидетельствуют о том, что, прибыв в Египет, Юлий Цезарь сделал шестнадцатилетнюю Клеопатру своей любовницей и единовластной царицей Египта. О том же и картина — о взаимоотношениях стареющего Цезаря и юной Клеопатры.','£1 278 000'),(10333,'Мистер Скеффингтон',1944,146,0.0,7.3,153,'1944-05-25','https://st.kp.yandex.net/images/film/10333.jpg','Mr. Skeffington','Джоб Скеффингтон информирует Фанни Треллис о том, что ее брат Триппи присвоил себе значительную сумму денег, принадлежащих банку Скеффингтона. Чтобы спасти брата, Фанни выходит замуж за Джоба. Но брат, разозлившись на нее, отправляется на Первую мировую войну, где погибает. Фанни разводится и отсылает свою дочь к Джобу, чтобы та жила с ним в Европе. <br><br>После этого Фанни постоянно встречается с разными мужчинами. Но с началом Второй мировой войны к ней возвращается дочь. После дифтерии Фанни теряет свою красоту, а ее дочь сбегает с ее последним любовником. В это время в Америку возвращается Джоб, нищий и слепой…','Нет данных'),(10334,'Путь в Марсель',1944,109,0.0,6.5,111,'1944-02-16','https://st.kp.yandex.net/images/film_iphone/iphone360_10334.jpg','Passage to Marseille','Англия, разгар Второй мировой войны. Военный корреспондент прибывает в расположение эскадрильи «Свободная Франция» расположенной на побережье Великобритании и замаскированной под сельскохозяйственную ферму.<br><br>Здесь он знакомится с капитаном Фрейкинетом руководителем авиабазы, который поведал ему впечатляющую историю офицера Жана Матрака — одного из лучших авиационных стрелков — бомбардировщиков, прошедшего нелегкий путь, подвергшегося суровым испытаниям и с честью их преодолевшим, во имя свободы любимой Франции…','Нет данных'),(10335,'Призрак оперы',1943,92,0.0,6.5,384,'1943-08-12','https://st.kp.yandex.net/images/film_iphone/iphone360_10335.jpg','Phantom of the Opera','Скромный и тихий скрипач средних лет Эрик Клодин отказывает себе во всем и тратит все сбережения на тайное спонсирование уроков пения юной Кристин Дюбуа, к которой питает тайную страсть. Та об этом не подозревает и не обращает никакого внимания на музыканта, у неё уже есть два поклонника — оперный тенор Анатоль Гаррон и Рауль Д`Обер, инспектор Сюртэ.<br><br>Доведенный до отчаяния Эрик совершает убийство музыкального издателя, но в результате его лицо становится обезображенным кислотой. Теперь цель его жизни — уничтожить всех, кто окружает Кристин…','$1 500 000'),(10336,'Вперед, путешественник',1942,117,0.0,7.6,759,'1942-10-22','https://st.kp.yandex.net/images/film_iphone/iphone360_10336.jpg','Now, Voyager','Шарлота Вэйл — поздний ребенок в семье, и как все поздние дети несет постоянную печать чрезмерной опеки; мать — Миссис Генри Уиндл Вэйл держала ее постоянно под контролем с детских лет. Прошли годы и этот контроль превратил Шарлоту в отрешенную и испуганную женщину, единственное, что приносило ей успокоение — резьба по кости. <br><br>Супруга одного из братьев Шарлоты — Лиза пригласила в дом своей свекрови психиатра, который, посмотрев на затворницу, поставил ей диагноз: «нервный срыв» и предложил ей посетить свой санаторий отдохнуть и подлечить нервы. Несколько недель проведенные в санатории «Каскад» вернули Шарлоте надежду, а когда ее еще и отправили на теплоходе в круиз к берегам южной Америки, она обрела уверенность и впервые за многие годы бывшая покорная дочь смогла заявить матери, что имеет право на личную жизнь. <br><br>На борту лайнера она знакомится с женатым господином Джерри Дарренсом. Шарлота влюбилась в него с первого взгляда и Джерри ответил ей взаимностью. Этим двум людям предстоит пройти непростой жизненный путь, прежде чем они смогут стать по настоящему свободными и счастливыми…','Нет данных'),(10337,'Полнолуние',1942,94,0.0,6.9,196,'1942-04-29','https://st.kp.yandex.net/images/film_iphone/iphone360_10337.jpg','Moontide','Докера Бобо терзают страшные мысли — а не убил ли он того человека, с которым столкнулся сегодня на набережной. И тем же вечером он спасает очаровательную девушку, которая хотела утопиться…','Нет данных'),(10338,'Кингс Роу',1942,127,0.0,6.2,157,'1942-02-02','https://st.kp.yandex.net/images/film_iphone/iphone360_10338.jpg','Kings Row','Начало ХХ века. Юные Паррис и Дрейк, потерявшие своих родителей — верные друзья. Паррис мечтает стать доктором и учится у отца своей любимой Кэсси. Дрейк же планирует стать бизнесменом, когда получит наследство, а пока гуляет с девчонками. Они постепенно взрослеют…','Нет данных'),(10345,'Хуарес',1939,125,0.0,6.7,92,'1939-04-24','https://st.kp.yandex.net/images/film_iphone/iphone360_10345.jpg','Juarez','Биографическая мелодрама о жизни Бенито Хуареса, национального героя Мексики.<br><br>1864 год. Когда Мексика почти выходит из под контроля Франции, Император Наполеон III посылает армию, чтобы свергнуть мексиканского президента Бенито Хуареса и взять под свой контроль страну, посадив своего ставленника на трон. Максимилиан Габсбург, Эрцгерцог Австрии, назначен Императором Мексики, не понимая, что французы подстроили результат плебисцита, чтобы одобрить имперское правление.','Нет данных'),(10347,'Четыре дочери',1938,90,0.0,5.3,102,'1938-08-09','https://st.kp.yandex.net/images/film_iphone/iphone360_10347.jpg','Four Daughters','Музыкант Адам Лемп и его четыре в равной степени музыкально одаренные дочери — Эмма, Энн, Кэй, и Тэа — счастливо живут под одной крышей. У каждой из девушек есть небезразличный ей молодой человек. Однако, приезд циничного и грубого молодого композитора по имени Микки Борден переворачивает жизнь их семейства с ног на голову, что влечет за собой разного рода трагические последствия на романтической почве.','Нет данных'),(10351,'Принц и нищий',1937,118,0.0,6.9,112,'1937-04-30','https://st.kp.yandex.net/images/film_iphone/iphone360_10351.jpg','The Prince and the Pauper','Наследник английского престола Эдуард и нищий мальчик Том Кенти — сын пьяницы из беднейшего квартала Лондона, его однолетка, по капризу природы похожий на принца как брат-близнец, на короткое время сменяют друг друга. Нищий становится повелителем Англии, а монарх вкушает горечь и унижение, уготованные беднякам в его королевстве.<br> <br>Явившись в неведомый ему до того мир нищеты и лишений, маленький принц тотчас же заступается за невинно обиженных, а нищий Том Кенти в королевском дворце с той же зоркостью и непосредственностью детской души рушит хитросплетения несправедливых законов…','Нет данных'),(10353,'Антони-неудачник',1936,141,0.0,5.6,169,'1936-07-29','https://st.kp.yandex.net/images/film_iphone/iphone360_10353.jpg','Anthony Adverse','Марч играет заглавную роль, незаконнорожденного ребенка, чей отец был убит на дуэли. Его воспитал в монастыре добрый священник. Усыновленный добрым торговцем из Шотландии, подросший мальчик вскоре влюбляется в девушку, которая мечтает петь в опере. Хотя они и поженились, им приходится расстаться, так как роковая записка была унесена порывом ветра. Энтони сходит с ума от отчаяния в течение нескольких лет, следя за интересами своего отчима в Африке. Когда он возвращается в Европу, отчим его уже в могиле, жена стала оперной дивой с романтической связью с Наполеоном, а на его наследство зарится подлый Дон Луис, который когда-то убил его настоящего отца.','Нет данных'),(10363,'Битва за Англию',1969,132,0.0,6.8,465,'1969-09-15','https://st.kp.yandex.net/images/film_iphone/iphone360_10363.jpg','Battle of Britain','Разгар Второй мировой. Германия торопится закончить победный марш по Европе. Осталась непокоренной лишь Англия и для десантной операции Рейху необходимо полное господство над Королевским Воздушным Флотом. Завязывается величайшая воздушная битва в истории.<br><br>Дни, недели и месяцы, по всему побережью «Спитфайры» и «Мессершмитты» крутят стремительную огненную карусель вокруг немецких бомбардировщиков, которые размеренными волнами день за днем накатываются на замершие города. Королевство превратилось в огромное бомбоубежище, над которым непрерывно идут жестокие схватки. Страна из последних сил строит и бросает в бой новые и новые самолеты, чтобы остановить эти смертельные стаи…','$17 000 000'),(10365,'Шаровая молния',1965,130,0.0,7.3,13077,'1965-12-09','https://st.kp.yandex.net/images/film_iphone/iphone360_10365.jpg','Thunderball','Четвертый фильм о Джеймсе Бонде, агенте английской секретной службы. Террористы из организации «Спектр» захватывают бомбардировщик с двумя атомными бомбами на борту и угрожают взорвать их, если британское правительство не доставит им алмазов на 100 миллионов фунтов стерлингов.','$9 000 000'),(10366,'Проклятие гробницы мумии',1964,78,0.0,5.3,141,'1964-10-18','https://st.kp.yandex.net/images/film_iphone/iphone360_10366.jpg','The Curse of the Mummy\'s Tomb','Египет. 1900 год. Археологи Аннетт Дюбуа и Джон Грей находят гробницу фараона, убитого три тысячи лет назад своим братом — колдуном. По просьбе американского предпринимателя Александра Кинга они привозят мумифицированное тело фараона в Англию, где оно исчезает с выставки. После чего мумия начинает одного за другим убивать членов экспедиции…','Нет данных'),(10370,'Ясон и аргонавты',1963,104,0.0,7.0,1343,'1963-06-19','https://st.kp.yandex.net/images/film_iphone/iphone360_10370.jpg','Jason and the Argonauts','Сюжет построен на основе знаменитого древнегреческого мифа о герое Ясоне, отправившимся «со товарищи», прозванными аргонавтами в честь их корабля «Арго», на поиски Золотого Руна.','$1 000 000'),(10372,'В поисках потерпевших кораблекрушение',1962,98,0.0,6.1,112,'1962-11-14','https://st.kp.yandex.net/images/film_iphone/iphone360_10372.jpg','In Search of the Castaways','Землетрясение, наводнение, вулкан, аллигаторы, ягуар и кровожадные людоеды-маори. Все это могло стать непреодолимым препятствием для кого угодно, но только не для профессора Паганеля, который вместе с двумя детьми капитана Гранта, лордом Гленарваном и его сыном рыщет по всему Южному полушарию в поисках пропавшего без вести капитана Гранта и его судна…','Нет данных'),(10375,'Цирк ужасов',1960,92,0.0,5.4,132,'1960-08-11','https://st.kp.yandex.net/images/film_iphone/iphone360_10375.jpg','Circus of Horrors','Спасаясь от последствий неудачно проведённой операции, английский пластический хирург бежит во Францию, где со временем становится управляющим цирка. О своей основной профессии он тоже не забывает — одна за другой его пациентки превращаются в красоток и начинают принимать участие в цирковом шоу. Однако мотивы доктора далеко не благородные.','Нет данных'),(10376,'Потопить «Бисмарк»',1960,97,0.0,6.7,219,'1960-02-11','https://st.kp.yandex.net/images/film_iphone/iphone360_10376.jpg','Sink the Bismarck!','В 1941 году линкор «Бисмарк», гордость немецкого флота, был спущен на воду и отправился в свой первый боевой поход. Спустя несколько дней он настиг и уничтожил мощный английский крейсер «Худ» со всем его экипажем. Уинстон Черчилль отдал приказ командующему военно-морскими операциями капитану Джонатану Шепарду найти «Бисмарка» и потопить его любой ценой…','Нет данных'),(10379,'Соломон и Шеба',1959,139,0.0,6.8,271,'1959-10-27','https://st.kp.yandex.net/images/film_iphone/iphone360_10379.jpg','Solomon and Sheba','Этот библейский эпос, поставленный режиссером Кингом Вайдером является кинематографическим осмыслением плотских грехов и языческих богопреклонений. Картина, снятая в Испании, запечатлела подвиги незабвенных персонажей. Юл Бриннер олицетворяет здесь сильного и идеалистического Соломона. А чувственная Джина Лоллобриджида — великолепна в роли величественной и соблазнительной Царицы.','$5 000 000'),(10388,'Последний раз, когда я видел Париж',1954,116,0.0,7.2,428,'1954-11-18','https://st.kp.yandex.net/images/film_iphone/iphone360_10388.jpg','The Last Time I Saw Paris','В послевоенном Париже встречаются военный журналист Чарльз Уиллс и американка, живущая во Франции. Очаровательная Хелен влюбляется в Чарльза. Они поженились, и у них рождается дочь Вики. Однако им недолго суждено быть вместе…','Нет данных'),(10390,'Оружие ярости',1953,83,0.0,6.3,72,'1953-10-09','https://st.kp.yandex.net/images/film_iphone/iphone360_10390.jpg','Gun Fury','Простая поездка в дилижансе для мисс Гоман и её жениха Билла обернулась полной опасностей и приключенийи ездой по прерии в сопровождении двух бандитов, имеющих свои виды на ценный багаж и на саму мисс Гоман. Три трупа — не повод чтобы начинать войну, рассуждают местные пастухи, но Билли так не считает. Он выручает любимую и возвращает золото штата, совершив при этом немало героических подвигов.','Нет данных'),(10393,'Скандальная хроника',1952,82,0.0,5.6,91,'1952-01-16','https://st.kp.yandex.net/images/film_iphone/iphone360_10393.jpg','Scandal Sheet','Деятельность некогда уважаемой, а теперь низкопробной жёлтой газеты направлена на удовлетворение низменных вкусов толпы ради поднятия тиражей. Её циничный и безжалостный главный редактор уверенно двигается к заветной цели, пока на его пути не встаёт бывшая жена.','Нет данных'),(10395,'Улица Грин Долфин',1947,141,0.0,5.4,113,'1947-10-15','https://st.kp.yandex.net/images/film_iphone/iphone360_10395.jpg','Green Dolphin Street','Софи любит Эдмунда, но родители заставляют её выйти замуж за богатого Октавия, после чего Эдмунд покидает город. Спустя годы Эдмунд возвращается со своим сыном Уильямом. Дочь Софи Маргарита и Уильям влюбляются друг в друга. Сестра Маргариты Марианна тоже любит Уильяма, а плотник Тимоти тайно влюблен в Марианну. Тимоти убивает в драке человека, и Эдмунд помогает ему сбежать в Новую Зеландию. Случайно дезертировавший из флота Уильям также позорно сбегает в Новую Зеландию, где вместе с Тимоти начинает прибыльный бизнес. Однажды ночью Уильям пишет Октавию письмо с предложением руки и сердца его дочери, но, будучи пьяным, он путает имена сестер.','Нет данных'),(10400,'Человеческая комедия',1943,117,0.0,5.7,125,'1943-03-02','https://st.kp.yandex.net/images/film_iphone/iphone360_10400.jpg','The Human Comedy','Подросток Гомер Маколей остается дома в маленьком городке Итака, чтобы поддержать семью, в то время как его старший брат Марк готовится к войне.','Нет данных'),(10409,'Юнцы на Бродвее',1941,118,0.0,6.8,73,'1941-12-31','https://st.kp.yandex.net/images/film_iphone/iphone360_10409.jpg','Babes on Broadway','Томми Уильямс, певец из дешевого ресторанчика, страстно мечтает попасть на бродвейские подмостки. Встреча с певичкой Пенни дарит ему шанс.','Нет данных'),(10411,'Тень тонкого человека',1941,97,0.0,6.8,145,'1941-11-21','https://st.kp.yandex.net/images/film_iphone/iphone360_10411.jpg','Shadow of the Thin Man','На этот раз Ник и Нора в поисках приятного времяпровождения приезжают на ипподром и узнают об убийстве жокея, который недавно был обвинен в сдаче гонки. Дело ведет давний знакомый Ника, лейтенант Абрамс, и поэтому Нику трудно остаться в стороне. Вдобавок майор Скалли, отвечающий за расследование игорных преступлений, просит Ника помочь в этом деле и сообщает, что жокея убили представители игорного синдиката…','Нет данных'),(10417,'Одинокая звезда',1952,94,0.0,6.2,71,'1952-01-31','https://st.kp.yandex.net/images/film_iphone/iphone360_10417.jpg','Lone Star','Элизабет Пенья, Мириам Колон. В 50-е годы шерифом округа Рио, расположенном на границе с Мексикой, был Чарли Уэйд, человек чрезвычайно властный и жестокий. После того как однажды Уэйд навсегда покинул город, его место занял Бадди Диддс — бывший помощник Уэйда. Новый шериф стал спасителем Рио, настоящим героем, изменившим жизнь простых людей к лучшему. Проходит 30 лет. Бадди Диддса уже нет в живых, и пост шерифа занимает его сын Сэм. Проводя очередное расследование, связанное с обнаруженным в поле скелетом, Сэм узнает «другую» правду об отце-герое и реальные причины пропажи Чарли Уэйда.','Нет данных'),(10424,'Долина решимости',1945,119,0.0,7.5,211,'1945-05-03','https://st.kp.yandex.net/images/film_iphone/iphone360_10424.jpg','The Valley of Decision','Драма по роману Марсии Девенпорт. Питтсбург, 1873 год. Мэри Рафферти, девушка из бедной рабочей семьи, устраивается в качестве прислуги в дом Уильяма Скотта — владельца сталелитейного завода. Между Мэри и сыном мистера Скотта Полом возникает сильное чувство.','$2 160 000'),(10429,'Парень по имени Джо',1943,120,0.0,6.1,87,'1943-12-24','https://st.kp.yandex.net/images/film_iphone/iphone360_10429.jpg','A Guy Named Joe','Вторая мировая война. Пилот бомбардировщика майор Пит Сэндидж погибает во время боевого вылета. Неожиданно он обнаруживает себя в потустороннем мире, способным следить за происходящими на земле событиями, но, не имея возможности вмешиваться в них. Он становится ангелом-хранителем для молодого пилота ВВС капитана Теда Рэндалла. Но вскоре Сэндидж замечает, что Рэндалл влюбляется в его бывшую невесту Доринду. Что делать Сэндиджу: прекратить оберегать Рэндалла или дать ему возможность обрести человеческое счастье с Дориндой?','Нет данных'),(10446,'Летчик-испытатель',1938,119,0.0,7.1,254,'1938-04-16','https://st.kp.yandex.net/images/film_iphone/iphone360_10446.jpg','Test Pilot','Джим Лэйн — летчик-испытатель, который жить не может без полетов. Его можно назвать счастливчиком: у него есть верный друг, механик Ганнер, и любимая девушка Энн, согласившаяся стать его женой. Испытания ожидают Джима не только в небе, но и на земле.','Нет данных'),(10447,'Янки в Оксфорде',1938,102,0.0,6.4,134,'1938-02-18','https://st.kp.yandex.net/images/film_iphone/iphone360_10447.jpg','A Yank at Oxford','Любимчик молодежи Ли Шеридан, благодаря своим спортивным достижениям, получает стипендию для обучения в вымышленном колледже Кардиналов в Оксфорде. Еще в поезде Ли знакомится с тремя учениками этого колледжа и горделиво рассказывает о своих спортивных успехах, чем приводит в негодование молодых людей своим хвастовством. Их предводитель Пол Бомонт подбивает друзей сыграть злую шутку с новичком, и они советуют ему выйти на остановку раньше, которая оказалась на приличном расстоянии от Университета.<br><br>Этим дело не кончилось. В самом кампусе они устраивают Ли торжественный прием, желая разыграть новичка и Ли сначала принимает все за чистую монету, а когда понимает, что его просто разыграли, он решает друзьям ответить тем же. В общем, развертывается целая война между Ли и Полом, который является капитаном спортивной команды Кардиналов.','Нет данных'),(10450,'Дама с камелиями',1936,109,0.0,7.6,1308,'1936-12-12','https://st.kp.yandex.net/images/film_iphone/iphone360_10450.jpg','Camille','Веселая, циничная, любящая шампанское и драгоценности, мужчин и развлечения, Маргарита Готье знакомится в театре с молодым дворянином Арманом Дювалем и известным светским львом бароном де Варвилем.<br><br>Арман красив, беден и идеализирует Маргариту, барон же знает ей цену, немолод, некрасив, но очень богат и готов оплачивать все ее прихоти в обмен на радости совместной жизни. Каждый по-своему любит ее…<br><br>Маргарита делает нелегкий выбор в пользу бедности. Но планам на счастливую семейную жизнь не суждено сбыться — отец Армана в панике умоляет Маргариту оставить сына, не губить карьеру юноши. Влюбленная женщина должна совершить подвиг во имя любви…','$1 486 000'),(10451,'Дьявольская кукла',1936,78,0.0,6.9,363,'1936-07-10','https://st.kp.yandex.net/images/film_iphone/iphone360_10451.jpg','The Devil-Doll','Пол Лавонд попадает в тюрьму по ложному обвинению в мошенничестве, но сбегает оттуда вместе со своим сокамерником Марселем. В его доме Лавонд узнаёт о секрете, позволяющем уменьшать живые существа до размеров кукол и управлять ими. После смерти Марселя Лавонд решает продолжить его исследования и использовать их для мести тем, кто засадил его за решётку.','Нет данных'),(10457,'Знак вампира',1935,60,0.0,5.9,392,'1935-04-26','https://st.kp.yandex.net/images/film/10457.jpg','Mark of the Vampire','Румынский барон Карел, вскоре после того как его посетил друг Отто фон Цинден, найден мертвым, и полностью обескровленным с двумя ранками на шее. Врач подтверждает слухи, распространяемые местными жителями: здесь есть вампиры. Приехавший из Праги инспектор Нойман не верит в эти бредни и обращается за помощью к специалисту по вампирам профессору Зелену за помощью.','$305 177'),(10458,'Маленький полковник',1935,81,0.0,7.3,107,'1935-02-22','https://st.kp.yandex.net/images/film_iphone/iphone360_10458.jpg','The Little Colonel','Эта история началась в Лойдсбурге, Штат Кентукки, в 1870-х, полковник Ллойд, яростный конфедерат, отговаривает свою дочь от тайного побега с офицером Джеком Шерманом, который боролся на стороне северных штатов. К сожалению слова отца, не возымели успеха, и тогда он предупредил свою строптивую дочь, что он больше никогда не будет с ней разговаривать, когда она снова вернётся в родной дом. Проходит несколько лет и по окончании войны Элизабет возвращается в родной город с маленькой дочерью. <br><br>Они поселились неподалёку от дома отца-полковника, который, узнав, что дочь беглянка вернулась, стал обходить их дом стороной. Так бы наверно и жили как кошка с собакой, обиженный отец с дочерью, если бы не маленькая белокурая внучка, которая делает всё, чтобы помирить маму с дедушкой.','Нет данных'),(10459,'Дэвид Копперфилд',1935,130,0.0,6.4,235,'1935-01-18','https://st.kp.yandex.net/images/film_iphone/iphone360_10459.jpg','The Personal History, Adventures, Experience, & Observation of David Copperfield the Younger','Жизнь Дэвида Копперфилда с раннего детства наполнена болью и потерями. Ещё до его рождения умирает отец — Дэвид-старший. Мама мальчика через несколько лет вторично выходит замуж, но неудачно — её новый муж относится к ней неуважительно, и всячески издевается над Дэвидом. А вскоре он остаётся сиротой — его мать умирает во время родов. Скитания и предательство, трудности и лишения — всего было предостаточно в жизни Дэвида, однако ему удалось обрести своё счастье, пусть и спустя долгие годы.','Нет данных'),(10470,'Распутин и императрица',1932,121,0.0,5.8,102,'1932-12-23','https://st.kp.yandex.net/images/film_iphone/iphone360_10470.jpg','Rasputin and the Empress','Когда медицина не помогает больному царевичу Алексею, в дом приглашают эксцентричного монаха Распутина, прослывшего целителем. Таинственным образом ему удаётся облегчить страдания наследника престола. Царская семья покорно сносит все выходки Распутина, слушает его советы, а тем временем амбициозный мошенник тайно вершит политику.','Нет данных'),(10474,'Мата Хари',1931,89,0.0,6.8,403,'1931-12-26','https://st.kp.yandex.net/images/film_iphone/iphone360_10474.jpg','Mata Hari','Желающие узнать правду об экзотической танцовщице, казненной по обвинению в шпионаже в пользу немцев 15 октября 1917 г. в ходе первой мировой войны — этот фильм не для вас. Реальная Мата Хари в тот момент была женщиной средних лет, не самой красивой, многие годы занимавшейся шпионажем сразу для нескольких стран. Путь к информации она прокладывала всеми путями, в том числе и тем, что известен всем.','$558 000'),(10477,'Вольная душа',1931,93,0.0,6.7,165,'1931-06-02','https://st.kp.yandex.net/images/film_iphone/iphone360_10477.jpg','A Free Soul','Стивен Эш, известный адвокат по уголовным делам, проживает в Сан-Франциско и обожает свою, воспитанную в свободомыслии от условностей общества, дочь Джейн. Однажды, Стивен, вольнодумец и откровенный пьяница, кто пьет слишком сильно и ненавидит каждого члена своей напыщенной семьи, блестяще выигрывает процесс, защищая перед судом присяжных от обвинения в убийстве явного гангстера Эйса Уилфонга. <br><br>Вечером, сильно выпившего адвоката, Эйс доставляет в дом родственников на день рождения матери. Вся семья в шоке по двум причинам: от вида Стивена и присутствия Эйса. Одна только Джейн в знак протеста уходит с Эйсом из дома, когда члены семьи высокомерно просят его покинуть дом, хотя на семейном торжестве присутствует ее жених Дуайт Уинтроп. Между Эйсом и Джейн вспыхивает бурный роман и Эйс просит руки у ее отца, от которого получает нелицеприятную отповедь, что они «разного поля ягоды».<br><br>Вечером отец и дочь заключают соглашение попробовать отказаться от своих пагубных увлечений и на три месяца покидают цивилизацию. Но стоило только Стивену попасть в город, он смертельно напивается и пропадает. А Джейн, выставленная за дверь семьей, встречается с Эйсом, который пытается ее силой принудить к браку. Но девушка обладает силой духа и хочет противостоять гангстеру…','Нет данных'),(10478,'Свободный и легкий',1930,92,0.0,6.1,84,'1930-03-22','https://st.kp.yandex.net/images/film_iphone/iphone360_10478.jpg','Free and Easy','Герой, менеджер победительницы конкурса красоты маленького городка Гофер-сити штата Канзас, приезжает вместе с ней и ее напористой истеричной мамашей в Голливуд. Но вместо красотки звездами становятся ее мать и ее менеджер.','Нет данных'),(10481,'Запад Занзибара',1928,65,0.0,7.1,116,'1928-11-24','https://st.kp.yandex.net/images/film_iphone/iphone360_10481.jpg','West of Zanzibar','Крэйн калечит фокусника Фросо и сбегает с его женой в Африку. У Фросо отнимаются ноги, а неверная жена возвращается, но умирает в церкви, оставив маленькую дочь — от Крэйна. Фросо решает отомстить за себя и едет в тропическую Африку. Там он оседает в бассейне реки Конго, к западу от Занзибара, где торгует слоновьей костью Крэйн.','Нет данных'),(10486,'Сэди Томпсон',1928,97,0.0,6.6,166,'1928-01-07','https://st.kp.yandex.net/images/film_iphone/iphone360_10486.jpg','Sadie Thompson','Сэди Томпсон приезжает в Паго-Паго в попытке начать новую жизнь, однако радикально настроенный проповедник Альфред Девидсон выступает ярым противником образа жизни, который ведет девушка, и пытается любой ценой изгнать ее обратно в Сан-Франциско…','Нет данных'),(10491,'Соблазнительница',1926,117,0.0,7.3,117,'1926-10-03','https://st.kp.yandex.net/images/film_iphone/iphone360_10491.jpg','The Temptress','Париж. Двадцатые годы прошлого века. В круговороте карнавала встретились двое Елена и Мануэль и полюбили друг друга, Эта встреча стала роковой для молодого человека, ведь он познал, как и многие другие, адскую страсть и колдовскую любовь роковой соблазнительницы, став жертвой ее чар, от которых его теперь никто не освободит.<br><br>Этой женщине достаточно одного взгляда чтобы свести с ума самого стойкого мужчину. К ее ногам бросались миллионные состояния, от ее любви сходили с ума, вызывали на дуэли и кончали жизнь самоубийством. Пройдут годы. Но время неумолимо даже к самой красивой женщине в мире — она увянет на холодных улицах Парижа в квартале красных фонарей.','Нет данных'),(10536,'Похождения Элейн',1914,14,0.0,4.9,69,'1914-12-29','https://st.kp.yandex.net/images/film/10536.jpg','The Exploits of Elaine','Многосерийный фильм расказывает о приключениях дочери американского миллиардера Элен Додж.','Нет данных'),(10567,'Дом тьмы',1913,17,0.0,6.1,88,'1913-05-10','https://st.kp.yandex.net/images/film/10567.jpg','The House of Darkness','Фильм рассказывает о благотворном влиянии музыки на расстроенный ум человека. Действие начинается в лечебнице для душевнобольных, где один из пациентов, подверженный постоянным приступам агрессии, в конечном итоге, избив санитаров и завладев пистолетом, сбегает за пределы больницы. Блуждая в окрестностях, он совершенно случайно натыкается на дом своего врача психиатра. <br><br>Проникнув в дом, сумасшедший застает за фортепьяно жену доктора. Ведя себя с ней крайне агрессивно, он заставляет ее сыграть для него. Заслышав музыку, безумный успокаивается и сдается подоспевшей полиции и санитарам. Пораженный случайным открытием своей жены, доктор начинает применять музыку как дополнительную терапию для пациентов своей больницы и получает отличные результаты — все пациенты исцеляются…','Нет данных'),(10572,'Резня',1912,30,0.0,6.2,85,'1912-12-19','https://st.kp.yandex.net/images/film/10572.jpg','The Massacre','Молодая семья отправляется на Дикий Запад в поисках лучшей жизни вместе с караваном переселенцев. Незадолго до этого отряд американских солдат нападает на индейскую деревню, убив почти всех ее жителей, в том числе, семью вождя. Вождь решает во что бы то ни стало отомстить за своих жену и ребенка. Как раз в это время на его территорию заходит караван с белыми переселенцами.','Нет данных'),(10583,'Мушкетеры Свиной аллеи',1912,17,0.0,6.6,278,'1912-10-31','https://st.kp.yandex.net/images/film_iphone/iphone360_10583.jpg','The Musketeers of Pig Alley','Герой картины — бедный музыкант — ограблен гангстерами. Понимая, что без этих денег семье не протянуть, музыкант отправляется на поиски своих обидчиков. Тем временем его молодая супруга совершенно случайно становится причиной стычки вожаков двух гангстерских банд. <br><br>Преступники устраивают разборку, а оказавшийся поблизости музыкант неожиданно узнает в одном из преступников своего былого обидчика. Молодой человек, воспользовавшись случаем, отбирает у гангстера деньги и убегает домой. Но по иронии судьбы к нему в квартиру врывается, спасаясь от погони, тот самый гангстер, что грабил его и приставал к его жене.','Нет данных'),(10584,'Любительница румян',1912,12,0.0,5.6,76,'1912-10-24','https://st.kp.yandex.net/images/film/10584.jpg','The Painted Lady','Молодая девушка живет с отцом, который держит ее в строгости, запрещая даже пользоваться косметикой. Жизнь девушки печальна и уныла, она совершенно непопулярна у юношей. И вот, однажды, за ней начинает ухаживать очаровательный молодой человек. Девушка влюбляется, однако возлюбленный оказывается жуликом, который хочет проникнуть в дом и украсть все деньги ее отца.','Нет данных'),(10588,'Друзья',1912,17,0.0,5.7,77,'1912-09-23','https://st.kp.yandex.net/images/film/10588.jpg','Friends','История из жизни американских старателей. На золотом прииске живет девушка Дора. Ее возлюбленный, Дэнди Ждек, надолго отлучается на север, где он должен заработать много денег. В это время в город приезжает Гризли Фэллон, странствующий старатель. Дора и Гризли влюбляются друг в друга и, в скором времени, обручаются. Все бы ничего, да есть одно «но». Фэллон и Дэнди Джек — старые, закадычные друзья…','Нет данных'),(10589,'Невидимый враг',1912,17,0.0,6.4,132,'1912-09-09','https://st.kp.yandex.net/images/film/10589.jpg','An Unseen Enemy','Доктор умирает. У него остались две дочери и сын. Сын кладет деньги, полученные им в качестве наследства в домашний сейф. Все это видит их горничная. Она решает украсть деньги и зовет для этого в сообщники своего давнего дружка.','Нет данных'),(10590,'Сердце скряги',1911,18,0.0,6.6,88,'1911-11-20','https://st.kp.yandex.net/images/film_iphone/iphone360_10590.jpg','The Miser\'s Heart','Мать Кэти заболевает и просит девочку пойти погулять, чтобы та не мешала ее сну. Девочка гуляет по дому и прокрадывается в квартиру пожилого мужчины, который слывет скрягой. В это же время воры, прослышавшие о деньгах, лежащих у скряги в сейфе, влезают его квартиру, связывают хозяина квартиры и требуют назвать код от сейфа под угрозой смерти. Скряга, по-видимому, скорее готов расстаться с жизнью, чем с деньгами. Но тут воры находят в углу комнаты малютку Кэти. Теперь они угрожают убить ее, если старый скупердяй не назовет им код от сейфа.','Нет данных'),(10615,'Очистить территорию',1956,114,0.0,5.9,67,'1956-08-16','https://st.kp.yandex.net/images/film_iphone/iphone360_10615.jpg','Away All Boats','Конец 1943 года, война с японцами в Тихом океане продолжается. На только что отремонтированный военный транспортный корабль «Белинда» вступил новый экипаж. Но большинство офицеров команды не имеет опыта ни ведения войны, ни плавания в далеких походах.<br><br>Однако у капитана Джеба Хокса в команду назначен офицер, который когда-то был капитаном торгового судна, чтобы стать военным моряком он пожертвовал для этого своим званием. Именно на него Хокс возлагает всю надежду в самые опасные моменты сражений.','Нет данных'),(10621,'99 Ривер стрит',1953,83,0.0,5.6,81,'1953-08-21','https://st.kp.yandex.net/images/film_iphone/iphone360_10621.jpg','99 River Street','Проиграв чемпионат в супертяжелом весе, Эрни Дрисколл решает забросить бокс и подается в водители такси. Жена Эрни, Паулина, осуждает супруга за низкий социальный статус и в итоге заводит интрижку с состоятельным Виктором Роулинзом. Богатый кавалер оказывается профессиональным вором и убивает Паулину, после того как она обнаруживает краденые бриллианты. Обвиняемый в убийстве жены Эрни должен во что бы то ни стало найти преступника…','Нет данных'),(10622,'Необузданные',1952,113,0.0,7.1,169,'1952-10-01','https://st.kp.yandex.net/images/film_iphone/iphone360_10622.jpg','The Lusty Men','Бывшая звезда родео Джефф МакКлауд получает тяжелую травму на выступлении и вынужден завершить карьеру. Без определенной цели, просто по зову сердца, он возвращается туда, где прошло его детство, в родной дом который он хотел однажды выкупить. Но немалые деньги, выигранные им за 18 лет в родео, растрачены. Копить, смотреть в будущее — не в его характере. Живущий по соседству ковбой Уэс Мерритт, женатый уже третий год, наслышан о его подвигах и устраивает его на ранчо, где работает сам. Уэс и его жена Луиза планируют купить собственное ранчо, но для этого им нужно копить деньги еще много лет. Уэса манят быстрые выигрыши в родео, и он просит Джеффа ввести его в этот спорт…','Нет данных'),(10623,'Снайпер',1952,88,0.0,6.4,111,'1952-05-09','https://st.kp.yandex.net/images/film_iphone/iphone360_10623.jpg','The Sniper','Полиция пытается влезть в голову опасного преступника, убивающего молодых женщин.','Нет данных'),(10625,'Детективная история',1951,103,0.0,7.2,503,'1951-10-19','https://st.kp.yandex.net/images/film_iphone/iphone360_10625.jpg','Detective Story','Детектив МакЛеод жесток и бескомпромиссен со всеми нарушителями закона. Он избивает множество подозреваемых, чтобы выбить признание, если на них не находится достаточно улик. Занимающийся нелегальной врачебной практикой врач Шнейдер давно на подозрении у МакЛеода, и, несмотря на отсутствие свидетелей против него, детектив мечтает упечь доктора за решетку.','Нет данных'),(10627,'Маленькая прибыль отца',1951,82,0.0,7.0,243,'1951-04-05','https://st.kp.yandex.net/images/film_iphone/iphone360_10627.jpg','Father\'s Little Dividend','Фильм рассказывает, что же происходит в семье адвоката Стэнли Т. Бэнкса недавно выдавшего замуж дочурку Кей. На этот раз Бэнкс, еще не до конца смирившийся с изменением статуса дочери, узнает новую шокирующую новость — он вот-вот станет дедушкой.<br><br>В отличие от окружающих, Стэнли не склонен считать это событие радостным, но приходится смириться и находить нечто хорошее в нарушении отлаженного, комфортного образа жизни. Дальнейшие события предсказать нетрудно, но очень уж они трогательно поданы.','Нет данных'),(10628,'Медный каньон',1950,84,0.0,6.3,83,'1950-10-23','https://st.kp.yandex.net/images/film_iphone/iphone360_10628.jpg','Copper Canyon','Группу рабочих медного рудника, терроризируют местные бандиты под предводительством помощника шерифа Лейна Тревиса. Рабочие наедятся на помощь актера Донни Картера, в прошлом известного полковника Десмонда. Но они ошибаются: шоу Джонни прибывает в городок и Джонни начинает ухаживать за прекрасной мошенницей Лизой Розель, которая, уверены рабочие, является центром их неприятностей.','Нет данных'),(10636,'Злоключения Полины',1947,96,0.0,6.8,109,'1947-07-04','https://st.kp.yandex.net/images/film_iphone/iphone360_10636.jpg','The Perils of Pauline','Молодая и жизнерадостная Пёрл Уайт ни минуты не может прожить без музыки, пения и танцев. Работая с утра до вечера в швейном ателье, она мечтает о театральных подмостках. Однажды ей выпадает шанс реализовать свои мечты: клиентка ателье, актриса Джулия Гиббс, приводит ее в театр, а затем и на съемки киносериала «Злоключения Полины»…','Нет данных'),(10641,'Каждому свое',1946,122,0.0,7.3,152,'1946-03-12','https://st.kp.yandex.net/images/film_iphone/iphone360_10641.jpg','To Each His Own','Мисс Норрис отправляется ночью дежурить на пост ПВО; ее напарником в эту ночь будет лорд Дэшем, также посвятивший себя этой неблагодарной работе, когда большинство думают лишь о новогоднем ужине. Осматривая крышу здания, Дэшем срывается и падает; он мог бы разбиться насмерть, но мисс Норрис не теряется и спасает ему жизнь. Чтобы успокоить нервы, он выпивает с ней по стаканчику. Оба они — люди одинокие, давно перешагнули рубеж зрелости. Каждый хранит верность некоей, давно уже мертвой части прошлого, которая не отпускает их и по сей день. Жена и сын лорда Дэшема погибли от эпидемии во время Первой мировой войны. Мисс Норрис же предпочитает не распространяться о тайне своей жизни. Дэшем хочет пригласить ее на ужин, однако, узнав от знакомого офицера, что в Лондон на несколько дней отпуска едет молодой солдат по имени Грегори Пирсен, она бежит на вокзал, но его поезд задерживается на неопределенное время. Она ждет его всю ночь и восстанавливает в памяти прошлое…','Нет данных'),(11003,'От судьбы не уйдешь',2000,90,0.0,6.4,192,'2000-02-11','https://st.kp.yandex.net/images/film_iphone/iphone360_11003.jpg','It Had to Be You','Анна и Чарли даже не подозревают о существовании друг друга. У нее есть жених, у него — невеста, даты их свадеб уже назначены и приглашения гостям разосланы. Впереди ждут приятные хлопоты, покупки, подарки… <br><br>И вот в салоне для новобрачных Чарли случайно встретил Анну, и между молодыми людьми проскочила искорка взаимной симпатии, из которой вскоре разгорелся нешуточный костер!<br><br>Но как теперь им быть со своими чувствами и что сказать друзьям и родственникам?','$10 000 000'),(11008,'Любовь и деньги',1981,90,0.0,5.7,115,'1981-08-28','https://st.kp.yandex.net/images/film/11008.jpg','Love & Money','Простой банковский клерк Байрон Левин, живущий скучной жизнью с подругой-книгоманкой и впадающим в маразм дедушкой, однажды попадает в поле зрения жутковатого миллиардера и убежденного транснационалиста Фредерика Стокхайнца, который готов пойти на что угодно, лишь бы заручиться поддержкой Байрона в одном щекотливом вопросе, а именно — отстоять его интересы в глазах университетского товарища Левина — социал-националиста и диктатора из Коста Сальвы.','Нет данных'),(11013,'Поцелуй',2003,90,0.0,6.8,77,'2003-09-14','https://st.kp.yandex.net/images/film_iphone/iphone360_11013.jpg','The Kiss','Редактор книжного издательства получает повышение по службе и обнаруживает в кабинете своего предшественника незаконченную рукопись под названием «Поцелуй». Поняв, что перед ней потенциальный бестселлер, она решает разыскать автора, который изменит ее жизнь и поможет найти свою потерянную любовь.','Нет данных'),(11015,'Кукла',2001,91,0.0,6.7,1239,'2002-02-21','https://st.kp.yandex.net/images/film_iphone/iphone360_11015.jpg','Dummy','Скромный клерк Стивен живет со своими эксцентричными родителями и сварливой сестрой, не надеясь обрести счастье. И уж тем более он не предполагает, что его наивное желание стать чревовещателем перевернет его жизнь с ног на голову.<br><br>Виртуозно манипулируя куклой, Стивен рассказывает миру о своих страхах и чувствах, попадая в самые невероятные и смешные ситуации. И вскоре он замечает, что мир не так уж и плох, как кажется. Все восхищаются талантливым парнем. Но будет ли Стивен таким же смелым и находчивым без своего нового друга?','Нет данных'),(11016,'Отзвуки эха',1999,102,0.0,6.9,6979,'1999-07-28','https://st.kp.yandex.net/images/film_iphone/iphone360_11016.jpg','Stir of Echoes','До этого дня Том Вицки не верил в гипноз и теории о скрытых резервах подсознания. Но однажды ему представился шанс испытать это на себе. После того, как Тома в шутку загипнотизировали на вечеринке, его жизнь превратилась в клубок странных противоречий и ужасных событий, которые нужно было пережить, чтобы вырваться из когтей окружающего кошмара.','$12 000 000'),(11017,'В погоне за Эми',1996,113,0.0,7.0,13344,'1997-01-23','https://st.kp.yandex.net/images/film_iphone/iphone360_11017.jpg','Chasing Amy','Молодой художник теряет голову и ощущение реальности, когда безумно влюбляется в восхитительную красотку, чьи любовные похождения, в том числе и лесбийские, трудно сосчитать. Его лучший друг, он же партнер, очень завистлив и подбрасывает ему всякие доказательства темного прошлого этой легкомысленной особы. Однако влюбленный художник ничего не желает слушать и не перестает думать и мечтать о неугомонной Алисе Джонс…','$250 000'),(11024,'Романтическое преступление',2002,97,0.0,4.8,227,'2002-02-05','https://st.kp.yandex.net/images/film_iphone/iphone360_11024.jpg','Life Without Dick','Иногда сюжет любовной истории больше напоминает триллер, чем романтическую сказку. Коллин оказывается участницей более чем странного любовного треугольника. С одной стороны — ее друг Дик, с другой — киллер, нанятый его убить. Вопреки всякой логике девушка начинает проявлять повышенный интерес к неотразимому убийце.<br><br>Единственный недостаток ее нового избранника — в том, что, будучи, киллером, он не хочет лишать жизни. Но заказ должен быть выполнен, и тогда Коллин решает сделать своему новому другу неожиданный свадебный подарок.','Нет данных'),(11026,'Дикая банда',2002,96,0.0,6.4,877,'2002-05-03','https://st.kp.yandex.net/images/film_iphone/iphone360_11026.jpg','Deuces Wild','Бруклин, лето 1958-го года. Уличная банда, заправляемая братьями Леоном и Бобби, делает все, чтобы наркотики не проникли в их район.<br><br>Когда-то их любимый брат скончался от передозировки, и сегодня они объявили жестокую войну наркоторговцам. Но есть другая банда, которая хочет сама контролировать улицы Бруклина…','$10 000 000'),(11034,'Парк Сансет',1996,99,0.0,6.7,124,'1996-04-23','https://st.kp.yandex.net/images/film_iphone/iphone360_11034.jpg','Sunset Park','Спортивная мелодрама рассказывает о немолодой уже учительнице, решившей пойти тренировать школьную баскетбольную команду, чтобы подработать к пенсии и открыть свой ресторанчик. Чего она не ожидала, так это того, что привяжется к чернокожим, совсем не идеальным ребятам, выучит правила баскетбола и даже выведет свою команду в финал. Затрагиваются проблемы бедных цветных.','Нет данных'),(11036,'Голландский мастер',1993,28,0.0,5.3,114,'1996-01-12','https://st.kp.yandex.net/images/film_iphone/iphone360_11036.jpg','The Dutch Master','Тереза отличалась от своих коллег в музее. Пока все женщине с наслаждением обсуждали обнаженных мужчин на полотнах, Тереза уходила в залы голландской живописи. Там была одна картина, перед которой девушка могла сидеть часами. И однажды герой этого полотна, молодой мужчина, ожил и спустился к Терезе.','Нет данных'),(11037,'Счастливый случай',1994,101,0.0,7.3,6087,'1994-07-16','https://st.kp.yandex.net/images/film_iphone/iphone360_11037.jpg','It Could Happen to You','Самая большая неудача в жизни полицейского Чарли Лэнга — это его жена, которая с утра до вечера может говорить и думать только о деньгах. У него самого их не хватает даже на чаевые очаровательной официантке. В кармане — только лотерейный билет, купленный по совету мудрой супруги.<br><br>Не задумываясь, Чарли обещает девушке половину своего выигрыша. И вот четыре миллиона долларов сваливаются ему на голову. Первую половину суммы уже успешно тратит его жена, окончательно поглупевшая от такого счастья. Теперь Чарли богат, но он не забыл, что еще должен заплатить чаевые… в два миллиона долларов.','Нет данных'),(11039,'Кто этот тип?',1993,85,0.0,5.8,122,'1993-04-23','https://st.kp.yandex.net/images/film_iphone/iphone360_11039.jpg','Who\'s the Man?','Эд Лавер и Доктор Дре — два неудачливых парикмахера. Возможно, они должны найти другую работу, и они идут служить в полицию. Большая ошибка, поскольку их сержант Купер достаёт их на каждом шагу. Несмотря на это, они обнаруживают главное преступление, и начинают раскрывать его их собственным необычным способом…','Нет данных'),(11040,'Флоддеры в Америке!',1992,120,0.0,5.9,77,'1992-07-03','https://st.kp.yandex.net/images/film_iphone/iphone360_11040.jpg','Flodder in Amerika!','Семью Джонсонов, признанную лучшей семьей года, пригласили на год в Голландию, а муниципалитет уже знакомого нам городка решил таким образом избавиться от семейки Флоддер, отправив их по обмену в Америку. Там приключения начинаются с того, что их принимают за группу врачей из России, хотя непринужденное хамство этих незакомплексованных ребят началось еще в Голландии…','Нет данных'),(11042,'Черные розы',1988,90,0.0,4.3,68,'1988-11-01','https://st.kp.yandex.net/images/film_iphone/iphone360_11042.jpg','Black Roses','В небольшой провинциальный городок приезжает с гастролями известнейшая металлическая группа сатанинского направления. Почему эта группа выбрала этот городок, да еще бесплатно дает концерты день за днем, скоро становится ясно. Оказывается, их певец Дэмиен на самом деле чуть ли не сам Дъявол. До этого хорошие и добрые подростки превращаются в убийц и подонков. В борьбу с нечистой силой вступает местный учитель литературы…','Нет данных'),(11056,'Бурый кролик',2003,93,0.0,5.6,2665,'2003-05-21','https://st.kp.yandex.net/images/film_iphone/iphone360_11056.jpg','The Brown Bunny','Профессиональный мотогонщик Бад Клэй едет из Нью-Гемпшира в Калифорнию на очередную гонку. По пути он встречает женщин, которые могли бы скрасить его одиночество, но по-настоящему спасти и утешить Бада может лишь одна девушка из его прошлого…','$10 000 000'),(11057,'Марсианская одиссея',2001,95,0.0,5.9,988,'2001-09-24','https://st.kp.yandex.net/images/film_iphone/iphone360_11057.jpg','Stranded','Аварийная посадка на поверхности Марса прерывает сенсационную экспедицию, призванную раскрыть удивительные тайны красной планеты. Оказавшись в разбитом корабле среди бескрайней каменной пустыни, астронавты понимают, что теперь они могут надеяться только на своё мужество и изобретательность.<br><br>В отчаянной попытке выжить и не сойти с ума, марсианские пленники отправляются на разведку к странному объекту в гигантском ущелье. Они еще не знают, что впереди их ждет поразительное открытие, о котором не могли мечтать даже самые смелые фантасты.','$4 000 000'),(11058,'Что ни день, то неприятности',2001,97,0.0,5.7,1413,'2001-05-13','https://st.kp.yandex.net/images/film_iphone/iphone360_11058.jpg','Trouble Every Day','Молодожёны Шейн и Джун Браун приезжают в Париж на медовый месяц. Но мысли Шейна далеки от романтики, ибо он стал жертвой безрассудных экспериментов французского доктора Лео Семено, изучавшего особенности полового влечения у людей, в результате которых Шейн теперь хочет съесть свою жену. Он надеется найти учёного, но судьба сталкивает его с Корой, женой Лео, поражённой той же страшной болезнью.','Нет данных'),(11061,'Ненетт и Бони',1996,103,0.0,6.6,191,'1996-08-12','https://st.kp.yandex.net/images/film_iphone/iphone360_11061.jpg','Nénette et Boni','19-летний Бони работает шеф-поваром пиццы в порту Марселя. После смерти матери он не хочет иметь ничего общего со своим отцом, Феликсом, который воспитывает его 15-летнюю сестру, Ненетт. Когда Ненетт сбегает из дома и появляется на пороге квартиры брата — его одинокой крепости, унаследованной от матери — жизнь Бони меняется. Брату и сестре, быстро ставшим родственными душами, предстоит найти друг в друге ту защиту, которая им обоим необходима…','Нет данных'),(11062,'Анджела',1995,99,0.0,6.4,98,'1996-01-26','https://st.kp.yandex.net/images/film/11062.jpg','Angela','История 10-летней Анжелы и ее младшей сестры Элли, живущих со своими не очень благополучными родителями. Однажды ночью, сразу после переезда в новый дом, после воскресного похода в церковь, Анжела рассказывает Элли, проспавшей всю проповедь, про то, что низвергнутые с неба ангелы Люцифера живут среди людей, вынюхивая их грехи, и забирают к себе в ад самых плохих. <br><br>А хорошие ангелы могут показать дорогу на небо. Наблюдая за своей депрессивной матерью, зацикленной на чем-то своем, и подслушав ее слова, что она больше не любит девочек, Анжела тоже фиксируется на своей истории про ангелов. Вместе с сестрой они играют в обряды очищения, напоминающие сеансы магии, а когда остаются без присмотра, то отправляются на поиски знаков, указывающих дорогу на небо.','Нет данных'),(11064,'Аризонская мечта',1991,142,0.0,7.8,27980,'1993-01-06','https://st.kp.yandex.net/images/film_iphone/iphone360_11064.jpg','Arizona Dream','Дядя Лео привык добиваться своего. А хочет он, чтобы племянник Аксель стал шафером на его свадьбе и работал в его фирме по продаже «кадиллаков». Аксель же ничего не хочет.<br><br>Он предпочитает проводить время в компании своей возлюбленной, местной сумасшедшей Элен, и ее падчерицы Грейс, и вместе с ними предаваться мечтам. Влюбленная Элен мечтает летать как птица. Отвергнутая Грейс мечтает перевоплотиться в черепаху.<br><br>Аксель мечтает о заснеженных просторах Аляски, где охотники-эскимосы ловят стрелозубых палтусов. Мечтает даже дядя Лео: построить бы целую гору из «кадиллаков» и забраться бы по ней на Луну…','$19 000 000'),(11070,'Ритм большого города',1981,72,0.0,7.4,230,'2000-10-05','https://st.kp.yandex.net/images/film_iphone/iphone360_11070.jpg','New York Beat Movie','Фильм описывает один день из жизни молодого художника Жана Мишеля Баскья, которому нужно раздобыть денег, чтобы скорее решить жилищный вопрос, пока его не выселили. Он блуждает по центру города с картиной наперевес, желая её продать. По пути он сталкивается со своими друзьями и, наконец, продаёт картину некоей богатой женщине. <br><br>Остаток дня он забывает о проблеме выселения и транжирит деньги на вечеринках, перемещаясь от клуба к клубу в поисках одной красивой девушки, которую встретил ранее и с которой планирует провести ночь. Ведь, у него ещё есть место для ночлега…','Нет данных'),(11074,'Уличный охотник',1990,95,0.0,4.7,70,'1990-11-02','https://st.kp.yandex.net/images/film_iphone/iphone360_11074.jpg','Street Hunter','Решительно настроенный доставить в руки правосудия главаря жестокой уличной банды, боевиков которой натаскивает ветеран вьетнамской войны, охотник за наградами, бывший полицейский Логан Блейд попадает между двух огней, так как местный мафиози хочет сам убить главаря, чтобы отомстить за смерть своего сына. У Логана есть только 24 часа, чтобы предотвратить войну гангстеров в самом центре Манхэттена, а помогает ему только зверски натренированный пес с острыми зубами.','Нет данных'),(11075,'Коктейль',1988,99,0.0,7.1,8329,'1988-07-29','https://st.kp.yandex.net/images/film_iphone/iphone360_11075.jpg','Cocktail','Молодой, самоуверенный и амбициозный Брайан Фланаган всегда мечтал сделать карьеру, которая дала бы ему власть, развлечения и быстрые деньги. Однако когда выясняется, что крупные фирмы вовсе не спешат брать его на работу, холодная реальность опустевшего кошелька заставляет его согласиться на работу бармена.<br><br>Растворившись в соблазнительном мире легких денег и секса, Брайан становится настоящей звездой ночного Манхэттена. Все меняется, когда он влюбляется в независимую и уверенную в себе Джордан, которая совсем не похожа на его смазливых клиенток. Наконец он отыскал женщину, которая знает, что такое настоящая любовь, а самое главное, кто же такой на самом деле Брайан Фланаган.','$20 000 000'),(11076,'Мое путешествие по Италии',1999,246,0.0,7.8,474,'1999-09-11','https://st.kp.yandex.net/images/film_iphone/iphone360_11076.jpg','Il mio viaggio in Italia','Обзор творчества величайших итальянских режиссеров и рассказ о том, как фильмы выдающихся соотечественников повлияли на творчество самого Скорсезе. В этом масштабном документальном проекте подробно представлены основные вехи развития итальянского кино: от неореализма послевоенной Италии к новой драме периода экономического бума, а позднее — к сюрреалистской фантазии.','Нет данных'),(11077,'Кундун',1997,134,0.0,7.4,3350,'1997-12-25','https://st.kp.yandex.net/images/film_iphone/iphone360_11077.jpg','Kundun','Повествование о жизни и трагической судьбе четырнадцатого Далай-Ламы, одного из величайших религиозных деятелей нашей эпохи и духовного наставника буддистов всего мира. Хроника его детства и юности, наполненной тревогами за будущее древней нации, решительными попытками отстоять право Тибета на политическую и религиозную независимость.','$28 000 000'),(11078,'Эпоха невинности',1993,139,0.0,6.9,5919,'1993-08-31','https://st.kp.yandex.net/images/film_iphone/iphone360_11078.jpg','The Age of Innocence','Романтическая история показывает великолепие и лицемерие высшего света конца 70-х годов 19-го века. Ньюлэнд Арчер — преуспевающий адвокат, в глубине души желающий настоящей страсти в своем обыденном существовании. Помолвка с милой и благовоспитанной Мэй Уэлланд обещает ему благодушную и спокойную жизнь.<br><br>Но когда кузина Мэй возвращается в Нью-Йорк после публичного скандала, Ньюлэнд попадает в сети ее тайной власти и невыразимой красоты. Теперь он вынужден сделать выбор между миром, который он знает, и миром, о котором он мог только мечтать.','$34 000 000'),(11080,'Американский парень',1978,55,0.0,6.4,112,'1991-04-19','https://st.kp.yandex.net/images/film_iphone/iphone360_11080.jpg','American Boy: A Profile of - Steven Prince','Мартин Скорсезе ведёт беседу со своим другом Стивеном Принцем. Принц делится воспоминаниями о своём детстве, родственниках, наркотиках и насилии.','Нет данных'),(11081,'Итало-американец',1974,49,0.0,6.5,123,'1991-04-16','https://st.kp.yandex.net/images/film_iphone/iphone360_11081.jpg','Italianamerican','Семья Скорсезе рассказывает о своем опыте итальянских иммигрантов в Нью-Йорке во время ужина в их квартире на Элизабет-стрит.','Нет данных'),(11082,'Берта по прозвищу «Товарный вагон»',1972,88,0.0,6.2,1007,'1972-06-14','https://st.kp.yandex.net/images/film_iphone/iphone360_11082.jpg','Boxcar Bertha','США, годы Великой депрессии. Тяжелые времена вынуждают профсоюзного активиста Билла Шелли стать во главе банды грабителей поездов. Так он получает прозвище Дылда и любовь Берты Томпсон, девушки из маленького городка в Арканзасе с воровским прозвищем Товарный Вагон.','$600 000'),(11084,'Бритье по-крупному',1967,5,0.0,6.5,621,'1970-08-03','https://st.kp.yandex.net/images/film_iphone/iphone360_11084.jpg','The Big Shave','Данный короткометражный фильм критикует вторжение Американского правительства во Вьетнамский конфликт.','Нет данных'),(11088,'Полночный джаз',1986,133,0.0,7.3,542,'1986-09-12','https://st.kp.yandex.net/images/film_iphone/iphone360_11088.jpg','\'Round Midnight','Ночной джаз-клуб, Париж, 1959 год. Пожилой джентльмен нетвердой походкой приближается к сцене, дрожащими руками касается саксофона, он пьян. Но вот он начинает играть, публика замирает, даже бармен за стойкой пританцовывает в ритме джаза; волшебные звуки становятся слышны на парижской ночной улице.<br><br>Там, на улице под дождем — молодой человек, который не может пройти мимо клуба, он также очарован, он влюблен в игру старого саксофониста. На короткое время судьба свяжет этих двух людей, хотя мэтру джаза жизни осталось совсем немного.','Нет данных'),(11096,'Магия',1995,104,0.0,6.2,577,'1995-08-30','https://st.kp.yandex.net/images/film_iphone/iphone360_11096.jpg','Rough Magic','Красавица Майра, работающая ассистенткой мага-иллюзиониста, собирается выйти замуж за сказочно богатого кандидата в президенты. Но перед самой свадьбой сбегает в Мексику. Незадачливый жених нанимает для ее поисков частного детектива Алека, который, найдя Майру, неожиданно для себя влюбляется в нее.<br><br>А к Майре тем временем «подкатывает» жуликоватый доктор Док. Обнаружив у нее некоторые магические способности, он уговаривает Майру принять участие в поисках древнего зелья индейцев-майя, которое принесет им сказочное богатство. Отправившись втроем в джунгли южной Мексики, Майра, Алекс и Док стараются перехитрить и друг друга, и многочисленных местных жуликов и колдунов…','Нет данных'),(11097,'Военная комната',1993,96,0.0,5.5,70,'1993-09-14','https://st.kp.yandex.net/images/film_iphone/iphone360_11097.jpg','The War Room','История правления Билла Клинтона. История о людях, которые стояли за президентом, которые вели его политику.','Нет данных'),(11102,'Вудсток',1970,215,0.0,8.0,2171,'1970-03-26','https://st.kp.yandex.net/images/film_iphone/iphone360_11102.jpg','Woodstock','Фильм о легендарном фестивале рок-музыки под открытым небом в Вудстоке в 1969 году.','$600 000'),(11103,'Театр',2004,104,0.0,7.3,3121,'2004-09-03','https://st.kp.yandex.net/images/film_iphone/iphone360_11103.jpg','Being Julia','Актриса Джулия Ламберт находится в полном расцвете сил, но её успешная театральная карьера и удачный брак перестают приносить ей удовлетворение. У неё появляется молодой поклонник Том Феннел. Жизнь сразу обретает новые краски. Но вскоре любовник предпринимает попытку отодвинуть Джулию на второй план. И Джулия разрабатывает блестящий план мести.','$18 000 000'),(11104,'Любовный роман',1994,108,0.0,6.7,438,'1994-10-13','https://st.kp.yandex.net/images/film_iphone/iphone360_11104.jpg','Love Affair','Они обручены, но не друг с другом. Итак, Майк и Терри решаются испытать свою внезапно вспыхнувшую любовь. Они не будут общаться друг с другом в течение трех месяцев, после чего, если их любовь все еще сильна, встретятся на крыше небоскреба «Эмпайр Стэйт Билдинг».<br><br>Но судьба подвергает их любовь более суровому испытанию, чем любое из тех, на которые решились бы Майк и Терри…','$60 000 000'),(11105,'Вальмон',1989,140,0.0,7.7,8823,'1989-11-13','https://st.kp.yandex.net/images/film_iphone/iphone360_11105.jpg','Valmont','Маркиза де Мертей — гениальный «кукловод» интимных отношений в высшем свете. Блестящий Вальмон — герой донжуанского списка соблазненных и покинутых. Острейший аромат далекой эпохи распространяют куртуазное обольщение, измены, дуэли, убийства.','$33 000 000'),(11106,'На лоне природы',1988,91,0.0,6.5,898,'1988-06-17','https://st.kp.yandex.net/images/film_iphone/iphone360_11106.jpg','The Great Outdoors','Чет Рипли отправляется отдохнуть с женой Конни и двумя сыновьями на природу, в местечко, где он когда-то отдыхал со своим отцом. Он хочет побыть наедине с природой, провести время тихо, спокойно, пообщаться с детьми… Но тут неожиданно приезжает сестра жены Кэйт с богатым, самодовольным и отвратительным мужем и двумя дочерьми — двойняшками и спокойный отдых летит коту под хвост…','$24 000 000'),(11108,'Тишина становится тобой',2005,88,0.0,6.5,662,'2005-12-13','https://st.kp.yandex.net/images/film/11108.jpg','Silence Becomes You','Две сестры проживают отшельницами в отдаленном замке. У них есть план — они должны заманить мужчину и забеременеть от него, проблема только в том, что они не должны в него влюбиться.','$6 000 000'),(11109,'Подземелье драконов',2000,107,0.0,5.8,6398,'2000-12-08','https://st.kp.yandex.net/images/film_iphone/iphone360_11109.jpg','Dungeons & Dragons','Савина, молодая императрица Измира, хочет процветания для своих подданных, но злой представитель всесильной касты магов, колдун Профион, хочет сместить ее и завладеть Скипетром Золотых Драконов.<br><br>Чтобы спасти королевство, Савина нанимает двух воров, которые должны пройти все ловушки, победить много нечисти и найти магический Амулет Красных Драконов…','$45 000 000'),(11110,'Плохие девчонки',2000,96,0.0,4.4,124,'2000-03-05','https://st.kp.yandex.net/images/film/11110.jpg','The Smokers','Трое 17-летних подружек Джефферсон, Карен и Лиза просто обожают, покуривая «травку», вести неприличные разговоры о парнях и о том, как делают «это». Они сыты по горло жизнью в замкнутом мирке закрытой школы-пансионата и мечтают внести в нее немного разнообразия.<br><br>Умирая от скуки и сгорая от желаний, подружки ищут настоящей любви, но находят лишь очередные приключения на свою голову. Расстроенные и рассерженные тем, как с ними обращаются лица мужского пола, они решают вступить на тропу войны за свободный и равноправный секс.<br><br>По предложению Линкольн, младшей сестры Джефферсон, необузданные девчонки натягивают на головы лыжные маски, вооружаются револьвером 44-го калибра и идут насиловать парней…','Нет данных'),(11111,'Аляска',1996,109,0.0,7.1,706,'1996-08-14','https://st.kp.yandex.net/images/film_iphone/iphone360_11111.jpg','Alaska','Пилот частной авиалинии терпит катастрофу на Аляске. На его поиски отправляются его 13-летняя дочь и 15-летний сын. В поисках ребятам активно помогает медвежонок Кабби.','$23 000 000'),(11112,'Фокус-покус',1993,96,0.0,7.2,18135,'1993-07-16','https://st.kp.yandex.net/images/film_iphone/iphone360_11112.jpg','Hocus Pocus','Согласно легенде, если невинная девушка в ночь Хэллоуина зажжет свечу в доме сестер Сандерсон, то ведьмы встанут из могил и съедят всех детей в городе, чтобы самим стать вечно молодыми.<br><br>Поскольку коварным сестрицам суждено воскреснуть через 300 лет после казни за колдовство, им придется привыкать к современным нравам. Например, зачем летать на метле, если есть пылесос? Делая всякие магические гадости, сестрицы Сандерсон так увлекаются этим занятием, что забывают о своем хитром противнике — черном коте…','$28 000 000'),(11115,'Бессмертные души',2001,84,0.0,5.4,1392,'2001-09-06','https://st.kp.yandex.net/images/film_iphone/iphone360_11115.jpg','Soul Survivors','После страшной автокатастрофы молодую девушку мучают кошмары. Ей кажется, что друг, с которым она была в машине, погиб. Но миры живых и мертвых иногда пересекаются.','$17 000 000'),(11116,'Парень с Белой реки',1999,99,0.0,5.8,316,'1999-11-12','https://st.kp.yandex.net/images/film_iphone/iphone360_11116.jpg','The White River Kid','Наглые шулеры и прохвосты Брат Эдгар и Моралес Питтман странствуют по Америке, успешно облапошивая обывателей под видом святош, пока не оказываются заложниками отчаянного Парня С Белой Реки. Незадачливым мошенникам предстоит отвезти этого маньяка-убийцу в родной город его эксцентричной невесты.<br><br>Друзья уже готовы расстаться с жизнью, но им следует благодарить судьбу, ведь в конце пути их ждет редкостная золотая жила — веселая компания непуганых обывателей и милых простаков, на которых можно отлично заработать!','Нет данных'),(11118,'Травма',2004,90,0.0,5.6,550,'2004-01-19','https://st.kp.yandex.net/images/film_iphone/iphone360_11118.jpg','Trauma','Очнувшись в больнице после автокатастрофы, Бен узнаёт, что его жена Элиза мертва. В дни, когда все говорят о жестоком убийстве поп-звезды Лорен, он пытается совладать со своим личным горем.<br><br>Но безумные события не оставляют Бена в покое: ему кажется, что он повсюду видит свою жену, а полиция подозревает его в убийстве Лорен. Слова медиума о том, что Элиза жива, ставят Бена, и без того ведущего странную жизнь, на грань помешательства.<br><br>Теперь он готов любой ценой выяснить, что происходит вокруг него, не предполагая, что правда о происшедшем и о нем самом будет безжалостнее его самых шокирующих видений и страхов…','Нет данных'),(11119,'Неудачник',2000,98,0.0,6.2,1166,'2000-07-20','https://st.kp.yandex.net/images/film_iphone/iphone360_11119.jpg','Loser','Что значит всегда чувствовать себя не в своей тарелке? Это значит быть неудачником.<br><br>Пол приезжает в большой город, чтобы учиться в университете и сразу понимает, что он не такой как все: он не так одевается, не так разговаривает, не знает как вести себя с девушками. Звание неудачника ему присвоено пожизненно.<br><br>Ну, как тут можно рассчитывать на внимание самой красивой девушки университета? Но, как оказывается, они одного поля ягодки.','$20 000 000'),(11121,'Голоса',2000,104,0.0,6.1,76,'2000-01-22','https://st.kp.yandex.net/images/film/11121.jpg','Other Voices','Фил и Анна — прекрасная молодая пара. Они живут в престижном районе Манхэттена, но их благополучие — лишь видимость. Супруги подозревают друг друга в неверности и с маниакальным упорством ищут самые незначительные улики, доказывающие их подозрения. Фил обращается к своему лучшему другу, адвокату Джону.<br><br>Наняв с его помощью частного сыщика Джордана, не брезгующего никакими средствами, Фил рассчитывает добыть доказательства измены жены. Тем временем Анна ищет утешения в сеансах психотерапии доктора Гловер.<br><br>В конфликт втягивается все больше друзей и знакомых, каждый из которых стремится «устранить проблему». Жизнь супругов и их близких погружается в нескончаемый хаос безумия…','Нет данных'),(11122,'Последний танец',1996,103,0.0,6.9,866,'1996-04-24','https://st.kp.yandex.net/images/film/11122.jpg','Last Dance','Между молодым адвокатом и его первой подзащитной, приговоренной к смертной казни, возникает и крепнет дружба. Но срок приведения приговора в исполнение — все ближе и ближе…','Нет данных'),(11124,'Мамины дети',1993,96,0.0,6.3,227,'1994-03-18','https://st.kp.yandex.net/images/film_iphone/iphone360_11124.jpg','Mother\'s Boys','Три года назад Джуд Мэдиган оставила своего мужа и троих сыновей без каких-либо объяснений. Теперь она появилась вновь и хочет вернуть прошлое обратно. Ее не волнует, что у Роберта другая женщина и любовь угасла давно. Ведь есть много способов изменить чужую жизнь. Пусть диких и беспощадных. Но она использует их все!','$8 000 000'),(11125,'Готова на всё',1993,107,0.0,7.0,4632,'1993-09-29','https://st.kp.yandex.net/images/film_iphone/iphone360_11125.jpg','Malice','Энди Сафиан преподает в колледже и счастлив в браке с красавицей-женой Трейси. Но случай сводит их с преуспевающим хирургом Джедом, который постепенно вовлекает их в в запутанный узел интриг и предательства.','Нет данных'),(11126,'Опоздавшие к обеду',1991,99,0.0,6.0,100,'1991-09-20','https://st.kp.yandex.net/images/film_iphone/iphone360_11126.jpg','Late for Dinner','История о двух близких родственниках, которых в 1962 году заморозили криогеном и которые, проснувшись в современном Лос-Анджелесе, обнаружили, как изменился мир… После чего им сразу же захотелось вернуться в свой родной Санта-Фе тридцатилетней давности.','Нет данных'),(11130,'10 причин моей ненависти',1999,97,0.0,7.8,87109,'1999-03-31','https://st.kp.yandex.net/images/film_iphone/iphone360_11130.jpg','10 Things I Hate About You','Строгий отец поставил условие: Бьянка пойдет на свидание, если ее сестра Кэт тоже согласится встретиться с парнем. Но Кэт — синий чулок и отчаянная мужененавистница. Бьянка пытается найти для сестры такого же зануду, как она.','$30 000 000'),(11142,'Высшая лига 3',1998,100,0.0,5.4,232,'1998-04-17','https://st.kp.yandex.net/images/film_iphone/iphone360_11142.jpg','Major League: Back to the Minors','Наш старый знакомый, Роджер Дорн, нанял Гаса, чтобы тот «поднял» захудалую команду «Базз» из Южной Каролины, которая принадлежит Дорну.<br><br>Бывалый ветеран Кантрелл принимает вызов и решает сделать из компании неудачников — компанию чемпионов! Ведь, как известно, «игра не окончена, пока не запоёт толстуха»!','Нет данных'),(11145,'Голосок',1998,97,0.0,6.6,673,'1998-09-18','https://st.kp.yandex.net/images/film_iphone/iphone360_11145.jpg','Little Voice','Надо сказать, мать с дочерью уживались с большим трудом. Мари не закрывала рот ни на минуту, временами доводя до отчаяния свою молчаливую и застенчивую дочь по прозвищу Голосок. Та постоянно слушала пластинки, изводя мать, и пыталась подражать мастерам вокала. Может, когда-нибудь дошло бы и до рукоприкладства, не появись однажды в городе старинный дружок Мари — Рэй Сэй. По-крупному ему не везло никогда, но на этот раз он почуял удачу, разглядев в девушке талант, и резво взялся за дело, не забывая о собственном интересе.','Нет данных'),(11147,'Зеркало треснуло',1980,105,0.0,7.0,879,'1980-12-19','https://st.kp.yandex.net/images/film_iphone/iphone360_11147.jpg','The Mirror Crack\'d','Известная американская кинозвезда Марина Грегг поселилась в тихом Сент-Мэри-Мид и устроила приём для местных жителей. На этом приёме Хезер, давняя поклонница Марины выпивает коктейль, который предназначался её кумиру, и умирает. Мисс Марпл выясняет, кому понадобилось убивать простую деревенскую женщину?','Нет данных'),(11148,'Прекрасный жиголо – несчастный жиголо',1978,105,0.0,7.1,325,'1978-11-16','https://st.kp.yandex.net/images/film_iphone/iphone360_11148.jpg','Schöner Gigolo, armer Gigolo','Пауль, участник первой мировой войны, пытаясь найти работу в Берлине в 20-е годы, становится танцором, а точнее — жиголо, который обслуживает стареющих женщин.','Нет данных'),(11149,'Белый бизон',1977,97,0.0,6.4,289,'1977-05-12','https://st.kp.yandex.net/images/film_iphone/iphone360_11149.jpg','The White Buffalo','Джеймс Отис, много лет назад убил миротворца, добивавшегося прекращения вражды между американцами и индейцами. Тогда же он столкнулся с огромным белым бизоном, который был величиной со слона и уничтожал всё на своем пути. С тех пор Джеймсу снится поединок с бизоном и каждый раз он просыпается в холодном поту. Приехав в маленьких городок, он всё ещё надеется встретиться с этим диковинным животным и в один день эта встреча всё же состоится…','Нет данных'),(11154,'Поцелуй меня, глупенький',1964,125,0.0,7.0,338,'1964-12-16','https://st.kp.yandex.net/images/film_iphone/iphone360_11154.jpg','Kiss Me, Stupid','В городке с двусмысленным названием Климакс живут учитель музыки Орвилл, который по воскресеньям играет на органе в местной церкви, а всю неделю ревнует свою красавицу-жену Зельду даже к телеграфному столбу, и владелец автосервиса Барни. Они уже давно пишут эстрадные песни и безуспешно рассылают их агентам знаменитых певцов.<br> <br>И вот в один прекрасный день на бензоколонке Барни останавливается звезда эстрады и телевидения Дино. Друзья решают продать ему свои песни. Узнав, что Дино большой охотник до женского пола, хитроумные авторы придумывают дерзкий план — добиться благосклонности певца, а для этого подсунуть ему проститутку Полли, выдав ее за жену Орвилла…','$3 500 000'),(11155,'Бремя страстей человеческих',1964,100,0.0,6.3,242,'1964-07-04','https://st.kp.yandex.net/images/film_iphone/iphone360_11155.jpg','Of Human Bondage','Филип Кэри, хромой сирота, рано лишившийся родительской заботы и ласки. Его судьба прослеживается от несчастливого детства, через тернии студенческих лет, до становления и возмужания. Филип мучительно ищет свое призвание и пытается понять — в чем же состоит смысл жизни. Ему предстоит испытать немало разочарований и расстаться со многими иллюзиями, прежде чем он сумеет найти свой ответ на этот вопрос…','Нет данных'),(11157,'Тридцать три несчастья',1962,120,0.0,7.3,498,'1962-04-13','https://st.kp.yandex.net/images/film_iphone/iphone360_11157.jpg','The Notorious Landlady','Переехав из Америки в Великобританию, дипломат Уильям Гридли снимает жилье у очаровательной миссис Хардвик и вскоре понимает, что влюбился в нее. Вот только наивный американец не в курсе одного странного обстоятельства: у госпожи Хардвик пропал муж, и теперь ее подозревают в убийстве. Узнав об этих досужих домыслах, он обращается за помощью к своему боссу, американскому послу в Лондоне, и готовится дать отпор настырным полисменам.','Нет данных'),(11158,'Мы незнакомы, когда встречаемся',1960,117,0.0,6.7,115,'1960-06-29','https://st.kp.yandex.net/images/film_iphone/iphone360_11158.jpg','Strangers When We Meet','Архитектор Ларри Коу мечтает работать над нестандартными, творческими проектами, но его прагматичная жена Ева вынуждает его взяться за стабильную и однообразную работу. Молодая соседка Мэгги, живущая в браке без любви, верит в Ларри и помогает ему воплотить свои мечты. У них завязывается роман, о котором в итоге узнаёт их сосед Феликс, положивший глаз на Еву.','Нет данных'),(11160,'Приятель Джои',1957,111,0.0,7.0,278,'1957-10-25','https://st.kp.yandex.net/images/film_iphone/iphone360_11160.jpg','Pal Joey','Шикарная комедия с Фрэнком Синатрой в роли отчаянного ловеласа Джои, любителя блондинок и брюнеток, толстых и худых, молодых и не очень. Скрываясь от очередного обманутого мужа в маленьком городе, он становится постановщиком ревю и соблазняет и спонсора постановки Веру Симпсон и главную звезду Линду.','Нет данных'),(11163,'Человек с золотой рукой',1955,119,0.0,7.3,631,'1955-12-15','https://st.kp.yandex.net/images/film_iphone/iphone360_11163.jpg','The Man with the Golden Arm','Фрэнки Макине, маэстро карточной игры, возвращается домой из наркологического реабилитационного центра, в котором он лечился. Он мечтает начать новую жизнь, бросить игру и стать джазовым барабанщиком. Но его прикованная к инвалидной коляске жена Зош, требует, чтобы все осталось по-старому.<br /><br />Его бывший хозяин шантажом заставляет его вновь сесть за карты, а наркодилер соблазняет бесплатным уколом. И только его бывшая любовница Молли поддерживает в нем надежду на перемены и веру в себя. Обиду, злость, ревность, наркотические ломки предстоит пережить Фрэнки, чтобы приблизиться к своей мечте.','Нет данных'),(11164,'Пикник',1955,113,0.0,6.6,377,'1956-02-11','https://st.kp.yandex.net/images/film_iphone/iphone360_11164.jpg','Picnic','Легкомысленный бродяга Хэл Картер, красивый и мускулистый парень, заезжает в маленький городок проведать своего приятеля Алана Бенсона, сына главного богача города. Случай сводит его с Мадж Оуэне, местной королевой красоты и подружкой Алана, а также с ее сестрой Милли…','Нет данных'),(11167,'Фи',1954,88,0.0,6.8,109,'1954-11-10','https://st.kp.yandex.net/images/film_iphone/iphone360_11167.jpg','Phffft','После восьми лет брака, Роберт и Нина разводятся. Он завязывает дружбу со своим распутничающим приятелем Чарли Нельсоном, в то время как она обращается к своей вмешивающейся матери. И начинают назначать свидания другим людям, и при этом они игнорируют друг друга всякий раз, когда они случайно встречаются, но очевидно, что прошлое не мертво. Тогда однажды ночью они находят друг друга вновь, понимая, что не могут друг без друга…..','Нет данных'),(11172,'Когда кончилось время',1980,109,0.0,5.7,184,'1980-03-28','https://st.kp.yandex.net/images/film_iphone/iphone360_11172.jpg','When Time Ran Out...','Боб владеет красивейшим островом в океане. На острове выстроен комфортабельный отель, туристы любят это местечко. Главной достопримечательностью этого райского уголка является древний вулкан, извергавший из себя лаву только два раза за всю историю — в 9 веке и в 1902 году.<br><br>Склоны окрестных гор покрыты дивным лесом, а у подножья — божественный океан. Друг и компаньон Боба Хэнк Андерсон нашел на острове месторождение нефти. Боб в восторге — наконец-то, он станет миллионером, но Хэнк не разделяет оптимизма друга. Хэнку не нравится поведение кратера вулкана в последнее время, да и все сейсмические приборы отмечают рост давления.<br><br>Хэнк решает самолично спуститься в специальном аппарате в кратер вулкана, чтобы удостовериться так ли это…','$20 000 000'),(11173,'Бегство к Афине',1978,125,0.0,6.1,147,'1979-02-16','https://st.kp.yandex.net/images/film_iphone/iphone360_11173.jpg','Escape to Athena','Действие фильма происходит во время Второй мировой войны в 1944 году на одном из греческих островов, окупированном нацистами. Американские и английские военнопленные под руководством своего лидера Зено осуществляют побег. При этом они спасают не только свои жизни, но и древнегреческие предметы искусства.','Нет данных'),(11176,'Рождественская елка',1969,110,0.0,7.0,102,'1969-09-25','https://st.kp.yandex.net/images/film_iphone/iphone360_11176.jpg','L\'arbre de Noël','Миллионер Лорен Сегур недавно овдовел. Его десятилетний сын Паскаль хочет отправиться на каникулы вместе с отцом на Корсику. Лорен не в восторге от этой затеи, ему по душе жаркие страны.<br><br>Но желание сына — закон. Он не мог предугадать, какой трагедией обернется эта поездка к морю.','Нет данных'),(11177,'Бригада дьявола',1968,130,0.0,6.6,88,'1968-05-15','https://st.kp.yandex.net/images/film_iphone/iphone360_11177.jpg','The Devil\'s Brigade','Во врeмя Второй мировой войны союзники cоздaют дecaнтную бригaду для выcaдки в Hорвeгию. Комaндовaниe этой aмeрикaнcко-кaнaдcкой бригaды довeряeт конторcкой крыce полковнику Робeрту Т. Фрeдeрику. Полковник умeло иcпользуeт противоcтояниe и трeниe мeжду aмeрикaнцaми и кaнaдцaми для cоздaния диcциплинировaнной боeвой cилы. Hо тeпeрь, когдa люди Фрeдeрикa готовы дрaтьcя, Фрeдeрик получaeт извecтиe, что миccия в Hорвeгии отмeняeтcя. Поcлe обрaщeния в Вaшингтон для получeния другого нaзнaчeния, бригaду нaпрaвляют нa пaтрули около нeмeцкиx линий в южной Итaлии. Бригaдa зaxвaтывaeт зaнятую нeмцaми дeрeвню и тогдa им дaeтcя по-нacтоящeму нeвозможнaя зaдaчa…','Нет данных'),(11178,'Альварес Келли',1966,116,0.0,6.2,61,'1966-10-06','https://st.kp.yandex.net/images/film_iphone/iphone360_11178.jpg','Alvarez Kelly','На фоне красочных событий Гражданской войны в США разворачивается действие этого классического вестерна в котором полковник южан задумывает угнать двухсоттысячное стадо скота, принадлежащего Альваресу Келли, ведущему торговлю с Северянами.','Нет данных'),(11180,'Париж, когда там жара',1964,110,0.0,7.1,2292,'1964-03-16','https://st.kp.yandex.net/images/film_iphone/iphone360_11180.jpg','Paris - When It Sizzles','Габриэль устраивается секретарем к эксцентричному писателю, живущему в центре Парижа и терзаемому муками творчества над детективным романом. Помогая ему в работе над книгой, она влюбляется, и теперь муки творчества охватывают их обоих…','$4 000 000'),(11182,'Фальшивый предатель',1962,140,0.0,7.1,102,'1962-04-17','https://st.kp.yandex.net/images/film_iphone/iphone360_11182.jpg','The Counterfeit Traitor','Эрик Эриксон, шведский бизнесмен, вынужден согласиться работать на разведку Союзников во время своих деловых поездок в нацистскую Германию.','Нет данных'),(11184,'Мир Сьюзи Вонг',1960,126,0.0,7.1,75,'1960-11-10','https://st.kp.yandex.net/images/film_iphone/iphone360_11184.jpg','The World of Suzie Wong','Американский архитектор Роберт Ломэкс приезжает в Гонконг на один год для занятий живописью. Он устал работать в офисе и хочет попробовать зарабатывать себе на жизнь в качестве художника. Будучи ограничен в средствах, он снимает номер в Ван Чай, самом бедном районе Гонконга. В баре отеля он знакомится с Сьюзи Вонг и другими девушками, которые нелегально занимаются проституцией при отеле. Роберт не намерен отвлекаться от работы и не снимает себе девушек, поэтому у них устанавливаются дружеские отношения. Потом он просит Сьюзи Вонг позировать для него и постепенно влюбляется в нее.','Нет данных'),(11185,'Ключ',1958,134,0.0,7.3,182,'1958-05-28','https://st.kp.yandex.net/images/film_iphone/iphone360_11185.jpg','The Key','В 1940 — 1941 годах, когда Британия в одиночку несла тягу Второй мировой войны, морские катера-буксировщики службы спасения играли важную роль для атлантических конвоев, обеспечивая стране дорогу жизни. <br><br>Катера-буксировщики были плохо вооружены и почти беззащитны против атак авиации, подводных лодок — каждый выход в море на этих спасательных суденышках был равносилен самоубийству. Капитан Дэвид Росс возглавляет один из буксиров и получает ключ от каюты, в которой находится прекрасная леди Стелла…','Нет данных'),(11188,'Любовь — самая великолепная вещь на свете',1955,102,0.0,6.4,270,'1955-08-18','https://st.kp.yandex.net/images/film_iphone/iphone360_11188.jpg','Love Is a Many-Splendored Thing','Доктор Хан Суин и журналист Марк Элиот встретились в Гонгконге. Но она вдова, а он женат. Она из Китая, он из Америки. Однако никакие преграды не мешают им полюбить друг друга. Но будут ли они вместе?','Нет данных'),(11189,'Самурай: Путь воина',1954,93,0.0,7.4,587,'1954-09-26','https://st.kp.yandex.net/images/film_iphone/iphone360_11189.jpg','Miyamoto Musashi','Примкнув к великой армии, Миямото получает боевое крещение в великой битве при Сэкигахаре, но вскоре вновь становится непредсказуемым одиночкой, чей буйный нрав вселяет страх в каждого встречного. Лишь мудрому буддийскому монаху удается превратить жестокого ронина Мусаси в отважного самурая на службе у сил добра. Отныне никто не сравнится с ним в боевой доблести и чистоте духа.','Нет данных'),(11190,'Сабрина',1954,113,0.0,8.0,14878,'1954-09-03','https://st.kp.yandex.net/images/film_iphone/iphone360_11190.jpg','Sabrina','В роскошной усадьбе на западном берегу Лонг-Айленда обитало семейство миллионеров Лэрраби. Отец, мать и два сына. Старший — Лайнус — умный, младший — Дэвид — красивый. В Дэвида была безответно влюблена юная дочь шофера семьи Сабрина. Чтобы «излечить» дочь от любовной лихорадки, отец отправляет её в Париж в школу поваров. Через несколько лет домой возвращается изысканная утонченная красавица. Её чувства не прошли, но теперь уже и Дэвид покорен ею. Семейные планы расширения бизнеса за счет удачной женитьбы непутёвого сына под угрозой… Старший брат готов мужественно принять удар на себя и поухаживать за навязчивой девчонкой…','$2 238 813'),(11191,'Номер для директоров',1954,104,0.0,7.1,170,'1954-02-23','https://st.kp.yandex.net/images/film_iphone/iphone360_11191.jpg','Executive Suite','После смерти президента гигантской мебельной фирмы среди администраторов, управленцев и менеджеров начинаются интриги, борьба за власть. Очень многие хотят занять освободившееся руководящее место. Выбирать кандидата будет дочь основателя производственной фирмы и, одновременно, любовница скончавшегося главы компании. Ее решение, как и позиция основного держателя акций, определят, в чью пользу качнутся весы.','Нет данных'),(11192,'Побег из Форта Браво',1953,99,0.0,6.1,128,'1953-12-04','https://st.kp.yandex.net/images/film_iphone/iphone360_11192.jpg','Escape from Fort Bravo','Во время Гражданской войны Форт Браво был лагерем для военнопленных из армии южан. Его изолированное положение и недружелюбные жители делали бегство почти невозможным, но любого, кто все же пытается сбежать, возвращает назад капитан Роупер. Группа заключенных разрабатывает план побега с участием южной красавицы, которой поручено отвлечь капитана. План срабатывает, но для бежавших это только начало приключений…','Нет данных'),(11194,'Синяя луна',1953,99,0.0,5.9,133,'1953-06-03','https://st.kp.yandex.net/images/film_iphone/iphone360_11194.jpg','The Moon Is Blue','Два состоятельных кутилы увлекаются одной и той же девушкой, однако она осаживает их, заявляя, что планирует расстаться с девственностью только после свадьбы. Оба мужчины пытаются найти способ добиться желаемого, не доводя дело до свадьбы.','Нет данных'),(11199,'Рожденная вчера',1950,103,0.0,6.6,446,'1950-12-25','https://st.kp.yandex.net/images/film_iphone/iphone360_11199.jpg','Born Yesterday','Магнат-миллионер нанимает преподавателя по этикету для своей любовницы.','Нет данных'),(11200,'Станция Юнион',1950,81,0.0,6.0,118,'1950-09-01','https://st.kp.yandex.net/images/film_iphone/iphone360_11200.jpg','Union Station','Наблюдательная женщина замечает вооруженного пассажира в вагоне поезда, но ее звонок в полицию приводит к похищению слепой дочери миллионера безжалостным бандитом.','Нет данных'),(11205,'Человек из Колорадо',1948,100,0.0,6.3,63,'1949-01-07','https://st.kp.yandex.net/images/film_iphone/iphone360_11205.jpg','The Man from Colorado','Двое друзей вернулись домой после Гражданской войны. У одного из них психологическая травма из-за событий на войне. Он начинает вести себя неустойчиво и ожесточенно. Друг пытается найти способ помочь ему.','Нет данных'),(11214,'Техас',1941,93,0.0,6.5,64,'1941-10-09','https://st.kp.yandex.net/images/film_iphone/iphone360_11214.jpg','Texas','Двое бывших конфедератов путешествуют из Канзаса в Техас по железной дороге в поисках приключений и удачи. По прибытии в Техас, друзья оказываются по разные стороны закона…','Нет данных'),(11215,'Мне нужны крылья',1941,135,0.0,5.7,123,'1941-03-26','https://st.kp.yandex.net/images/film_iphone/iphone360_11215.jpg','I Wanted Wings','1940 год. Джефф, богатый наследник из Нью-Йорка, поступает на службу в ВВС США. В армии он обзаводится новыми друзьями: это Аль, бывший на гражданке простым автомехаником, и футболист Том. Однажды Джефф знакомится с соблазнительной блондинкой Салли, певицей из ночного клуба. Он не знает, что она была любовницей Аля. Пользуясь этим, Салли решает прибрать Джеффа к рукам…','Нет данных'),(11216,'Аризона',1940,125,0.0,6.3,72,'1940-11-15','https://st.kp.yandex.net/images/film_iphone/iphone360_11216.jpg','Arizona','Фиби Титус, единственная американка строящегося городка Таксон, приглянулась молодому красавчику Питеру Манси, который держит путь в Калифорнию. Героиня предлагает парню работу в грузовой компании, чтобы удержать его рядом. Но он все же уезжает, обещая вернуться. Тем временем успешный бизнес девушки привлекает внимание конкурентов, Уорда и Картерета, и они всячески стараются насолить девушке, притворившись ее друзьями. Когда ложь открывается, дело доходит до перестрелки. Восторжествует ли справедливость?','Нет данных'),(11217,'Наш город',1940,90,0.0,5.3,99,'1940-05-24','https://st.kp.yandex.net/images/film_iphone/iphone360_11217.jpg','Our Town','В начале 20-го столетия маленький городок Нью-Хэмпшир существует практически без каких-либо перемен. Люди вырастают, заводят семьи, живут и умирают. Каждое утро по домам развозят молоко и газеты, и никто уже не запирает входные двери.','Нет данных'),(11220,'Любовница Нерона',1956,88,0.0,5.9,96,'1956-09-13','https://st.kp.yandex.net/images/film_iphone/iphone360_11220.jpg','Mio figlio Nerone','Император Нерон большой любитель музыки и песен, хочет посвятить себя искусству и заботиться о красивой молодой жене. Но амбициозная Агриппина толкает своего сына Нерона к возобновлению войны в Британии. Справиться со всем этим помогает Нерону Сенека.','Нет данных'),(11226,'Сегодня ночью или никогда',1931,80,0.0,5.8,81,'1931-12-17','https://st.kp.yandex.net/images/film_iphone/iphone360_11226.jpg','Tonight or Never','Молодая оперная певица обнаруживает, что карьера заглохла из-за ее холодных и бесстрастных выступлений, пока она не заводит роман с красивым поклонником.','Нет данных'),(11229,'Королева Келли',1929,75,0.0,6.8,212,'1929-01-01','https://st.kp.yandex.net/images/film_iphone/iphone360_11229.jpg','Queen Kelly','Королева Регина собирается замуж за офицера, принца Вольфрама. А он влюбляется в юную воспитанницу монастыря Патрисию Келли, похищает ее и привозит во дворец. Но королева Регина изгоняет девушку…','$800 000'),(11252,'Похождения Анатоля',1921,117,0.0,5.7,67,'1921-09-25','https://st.kp.yandex.net/images/film_iphone/iphone360_11252.jpg','The Affairs of Anatol','Социалисту Анатолю Спенсеру его отношения с женой Вивиан начинают казаться устаревшими и тусклыми, и он пускается навстречу новым любовным приключениям. Так он оказывается в объятиях своей бывшей любовницы Эмили Диксон и даже снимает для нее отдельные апартаменты, — как оказывается, лишь для того, чтобы вскоре узнать, что она ему изменяет направо и налево. Потом героя фильма грабят, обманывают, и он оказывается до того измотан этой свободной жизнью, что решает вернуться к жене… И узнает, что Вивиан уже встречается с его лучшим другом Максом.','Нет данных'),(11254,'Пища для размышлений',1920,78,0.0,5.1,100,'1920-10-17','https://st.kp.yandex.net/images/film_iphone/iphone360_11254.jpg','Something to Think About','Состоятельный калека Маркли спонсирует образование дочери кузнеца Рут. Когда она возвращается в их маленький городок, он просит ее руки, но она сбегает с местным рабочим Джимом Дирком, который впоследствии погибает.','Нет данных'),(11255,'Зачем менять жену?',1920,90,0.0,6.0,97,'1920-02-29','https://st.kp.yandex.net/images/film_iphone/iphone360_11255.jpg','Why Change Your Wife?','Респектабельная и весьма чопорная жена — Бет, считает своим долгом перевоспитать мужа, отчитывая его за курение, вино и пристрастие к современной музыке. Роберт любит жену и даже пытается привнести романтику в их брак. Но когда вдруг появляется другая женщина, которая дарит все запретные наслаждения, Роберт подается искушению. В результате — развод! Бет наконец понимает, что выглядит как серая мышка и совсем не знала очевидного — того что нужно мужчинам для счастья. И вот теперь появляется красивая женщина-вамп, в невероятно-откровенном купальнике. Бывшие супруги неминуемо обречены встретиться и чувства вспыхивают вновь. Предстоит схватка соперниц(двух жен) и нравоучительный финал.','Нет данных'),(11256,'Мужское и женское',1919,116,0.0,6.7,272,'1919-11-23','https://st.kp.yandex.net/images/film_iphone/iphone360_11256.jpg','Male and Female','Лорд Брокельхарст, его нелюбимая невеста лэди Мэри, дворецкий Кричтон и кухарка Твини находились на яхте лорда Лоэма, которая потерпела кораблекрушение. Все они оказываются на необитаемом острове. С течением времени классовые различия стираются.','Нет данных'),(11258,'Не меняй своего мужа',1919,71,0.0,6.4,93,'1919-01-26','https://st.kp.yandex.net/images/film_iphone/iphone360_11258.jpg','Don\'t Change Your Husband','У Лейлы нарастает неприязнь к мужу, крупному производителю клея, жуткому неряхе, поедающему лук.','Нет данных'),(11287,'Аэропорт 1975',1974,107,0.0,6.2,329,'1974-10-18','https://st.kp.yandex.net/images/film_iphone/iphone360_11287.jpg','Airport 1975','Небольшой частный самолет, неожиданно потерявший управление, на полном ходу врезается в «Боинг» Колумбийских авиалиний, выполняющий рейс N 409 Вашингтон — Лос-Анджелес. Второй пилот и бортинженер авиалайнера погибают, а капитан корабля теряет зрение.<br><br>Радиосвязь с землей утеряна. Стюардесса Нэнси Прайор, пытающаяся успокоить пассажиров, понимает, что только счастливый случай может спасти несущийся над бездной самолет…','$3 000 000'),(11299,'Дворцы Монтесумы',1950,113,0.0,6.1,74,'1951-01-04','https://st.kp.yandex.net/images/film_iphone/iphone360_11299.jpg','Halls of Montezuma','Группа морских пехотинцев, под командованием лейтенанта Андерсона, под шквальным огнем Японской артиллерии и авиации, высаживается на безымянный остров, с целью уничтожения оборонительных укреплений врага. Для обеспечения быстроты операции им необходимо взять в плен и допросить японских солдат, они должны выведать схему запутанных военных коммуникаций острова. Шаг за шагом герои прорываются к своей цели, получая ранения и теряя однополчан…','Нет данных'),(11300,'Город тьмы',1950,98,0.0,6.4,228,'1950-10-06','https://st.kp.yandex.net/images/film_iphone/iphone360_11300.jpg','Dark City','Дэнни Хили проиграл букмекеру — теперь ему и его друзьям срочно нужны деньги. И они находят способ как их получить. Дэнни знакомится с простым парнем Артуром Винантом, которого он втягивает в карточную игру. В итоге Артур проигрывает в покер 5 000 долларов. Оказывается, что деньги были не его, и он заканчивает жизнь самоубийством. Но выясняется, что у Артура был брат, который теперь хочет отомстить каждому, кто участвовал в той злополучной игре.','Нет данных'),(11302,'Он бродил по ночам',1948,79,0.0,6.4,188,'1948-11-24','https://st.kp.yandex.net/images/film_iphone/iphone360_11302.jpg','He Walked by Night','Сюжет представляет прямолинейный рассказ, снятый в полудокументальной манере, о психопате и гениальном убийце, которого пытаются поймать полицейские детективы.','Нет данных'),(11303,'Бессмысленный триумф',1948,83,0.0,5.7,95,'1948-08-18','https://st.kp.yandex.net/images/film_iphone/iphone360_11303.jpg','Hollow Triumph','Джон Мюллер, которого преследует ограбленый им крупный игрок, решает примерить на себя новую жизнь, что приводит к весьма забавным последствиям.','Нет данных'),(11305,'Смешное происшествие по дороге на Форум',1966,99,0.0,6.1,148,'1966-10-16','https://st.kp.yandex.net/images/film_iphone/iphone360_11305.jpg','A Funny Thing Happened on the Way to the Forum','Пседолус — самый ленивый раб Рима, хочет купить себе право на свободу. Случайно он узнает, что молодой хозяин влюблен в прекрасную девственницу из дома крупного работорговца, чья «специализация» — красивые женщины. Пседолус заключает пари — он доставит девушку взамен на свою свободу…','Нет данных'),(11307,'Фильм',1965,20,0.0,7.5,414,'1965-09-04','https://st.kp.yandex.net/images/film/11307.jpg','Film','Весь «Фильм» мы видим одну спину и руки старичка-героя — он крадётся, прячется, избегает отражений, будь то зеркала, стёкла или глаза людей и животных; ведь отразиться — значит познать самого себя, после чего возможна только смерть.','Нет данных'),(11309,'Как справиться с диким бикини',1965,93,0.0,5.2,72,'1965-07-14','https://st.kp.yandex.net/images/film_iphone/iphone360_11309.jpg','How to Stuff a Wild Bikini','Френки несёт службу на американской военно-морской базе на отдаленном острове в Тихом океане и переживает, что оставил свою любимую на пляже в Калифорнии. Он обращается к местному колдуну, и тот создает бикини, надев которое, девушка станет объектом всеобщего внимания, и на подругу Френки никто не посмотрит.','Нет данных'),(11310,'Железнодорожник',1965,24,0.0,7.1,182,'1965-06-20','https://st.kp.yandex.net/images/film/11310.jpg','The Railrodder','Пожилой англичанин отправляется в железнодорожное путешествие по Канаде.','Нет данных'),(11316,'Старым добрым летом',1949,102,0.0,7.0,542,'1949-07-29','https://st.kp.yandex.net/images/film/11316.jpg','In the Good Old Summertime','Добрый старый Чикаго, на рубеже девятнадцатого и двадцатого веков. На углу одной из тихих улиц расположился уютный магазинчик музыкальных инструментов Оберкугена. Небольшим штатом магазинчика уже много лет руководит сам господин Отто Оберкуген. Старший управляющий и главный продавец Эндрю Дэлби Ларкин — симпатичный молодой человек, влюблен в девушку, с которой ведет длительную переписку.<br><br>Этот парень никогда не видел свою возлюбленную и не знает ее настоящего имени, ему знаком только ее почтовый номер 237, их роман завязался через газетное объявление об анонимном общении. В один прекрасный день девушка по имени Вероника Фишер устраивается продавцом нот и инструментов, и буквально с первых минут резко повышает уровень продаж, реализовав странного вида арфу и этот факт, довольно-таки, сильно задевает Эндрю. Между молодыми людьми начинается взаимная неприязнь, они просто начинают ненавидеть друг друга…<br><br>Неизвестно, чем бы закончился этот конфликт, если бы однажды под рождество Эндрю не узнал, что Вероника и есть та девушка, кому он писал свои добрые и нежные письма…','Нет данных'),(11329,'Его бывшая оставляет след',1940,18,0.0,5.7,63,'1940-12-13','https://st.kp.yandex.net/images/film/11329.jpg','His Ex Marks the Spot','Из-за роковых стечений обстоятельств, Бастер вынужден временно пожить под одной крышей со своей бывшей женой и ее новым ухажером.','Нет данных'),(11331,'Ее по-прежнему преследует негодяй',1940,66,0.0,5.6,59,'1940-10-11','https://st.kp.yandex.net/images/film/11331.jpg','The Villain Still Pursued Her','Миссис Уилсон и ее дочь Мэри ждут встречи с молодым хозяином дома, в котором они живут по закладной. Встреча оказалась счастливой для молодых: Мэри и Эдвард полюбили друг друга, поженились и у них родилась дочка. Но пристрастие Эдварда к алкоголю чуть было не погубило их счастье…','Нет данных'),(11332,'Привидение заговорило',1940,18,0.0,5.9,67,'1940-09-20','https://st.kp.yandex.net/images/film/11332.jpg','The Spook Speaks','Нанимаясь посторожить дом уезжающего на гастроли фокусника, Бастер не знал, чем это может обернуться.','Нет данных'),(11333,'Новолуние',1940,105,0.0,4.5,85,'1940-06-28','https://st.kp.yandex.net/images/film_iphone/iphone360_11333.jpg','New Moon','История начинается во времена французской революции. Молодой герцог отправляется в путешествие в Новый Орлеан и во время странствия он встречает красавицу Марианну. Молодые люди с первого взгляда полюбили друг друга.<br><br>В районе карибских островов на корабль нападают пираты и пленяют всех пассажиров. Начинаются настоящие приключения. Молодость, любовь и верные друзья помогают героям выйти из сложившейся ситуации победителями.','Нет данных'),(11334,'Укрощение сетки для волос',1940,20,0.0,5.9,72,'1940-06-28','https://st.kp.yandex.net/images/film/11334.jpg','The Taming of the Snood','Бастер открыл небольшой шляпный магазинчик. Однажды к нему приходит необычная покупательница.','Нет данных'),(11337,'Сплошное удовольствие',1940,20,0.0,5.8,68,'1940-01-19','https://st.kp.yandex.net/images/film/11337.jpg','Nothing But Pleasure','Бастер с женой отправились в Детройт, чтобы купить новую машину. Поездка обещает быть сплошным удовольствием…','Нет данных'),(11338,'Плетясь по Джорджии',1939,19,0.0,6.4,74,'1939-08-11','https://st.kp.yandex.net/images/film/11338.jpg','Mooching Through Georgia','В пансионате для ветеранов войны (между Севером и Югом) разговорились два престарелых солдата. Оказывается, они раньше встречались.','Нет данных'),(11339,'Чума с Запада',1939,18,0.0,6.4,85,'1939-06-16','https://st.kp.yandex.net/images/film/11339.jpg','Pest from the West','Миллионер из Америки, путешествуя на своей яхте, причаливает к берегам Мексики. Там он влюбляется в местную девушку.','Нет данных'),(11356,'Алле-оп!',1934,21,0.0,6.7,70,'1934-05-25','https://st.kp.yandex.net/images/film_iphone/iphone360_11356.jpg','Allez Oop!','Скромный часовщик Бастер однажды пошел в цирк с одним из своих клиентов — очаровательной молодой девушкой. Ей, однако, дюже приглянулся один из циркачей, но ревнивый Бастер не унывает. Теперь он намеревается обыграть циркача на его же поле…','Нет данных'),(11357,'Призрачное золото',1934,20,0.0,6.2,69,'1934-03-16','https://st.kp.yandex.net/images/film/11357.jpg','The Gold Ghost','После того, как Бастера бросает жена, он решает бросить все и отправиться на запад, где вскоре обнаруживает заброшенный городок, в котором сам себя же и назначает шерифом.','Нет данных'),(11358,'Что?! Нет пива?',1933,65,0.0,6.7,165,'1933-02-10','https://st.kp.yandex.net/images/film_iphone/iphone360_11358.jpg','What - No Beer?','Незадолго до отмены в Америке «сухого закона» двое друзей решили открыть собственную пивоварню. Это привело к конфликту как с полицией, так и с местными гангстерами.','Нет данных'),(11360,'Разговаривай свободнее',1932,82,0.0,6.1,82,'1932-08-13','https://st.kp.yandex.net/images/film_iphone/iphone360_11360.jpg','Speak Easily','Наивный профессор Пост получает в наследство огромную сумму денег и решает, что теперь может насладиться жизнью сполна. Он влюбляется в танцовщицу, выступающую во второразрядном шоу. Думая произвести на нее впечатление, он покупает шоу и намеревается поставить его на Бродвее…','Нет данных'),(11361,'Влюбленный водопроводчик',1931,73,0.0,6.7,102,'1932-02-06','https://st.kp.yandex.net/images/film_iphone/iphone360_11361.jpg','The Passionate Plumber','Элмер Таттл, парижский водопроводчик, чинит душ в доме богатой дамы. Чтобы разорвать отношения с женатым мужчиной, в которого она влюблена, эта дама нанимает Элмера сыграть роль ее любовника.','Нет данных'),(11365,'Тротуары Нью-Йорка',1931,74,0.0,6.0,86,'1931-09-26','https://st.kp.yandex.net/images/film_iphone/iphone360_11365.jpg','Sidewalks of New York','Богатый домовладелец, пытаясь произвести впечатление на девушку из бедного района, решает помочь детям бедняков. Он строит для них спортзал, огрганизует спектакли и т. п. Но мальчишки вовсе не хотят такой помощи.','Нет данных'),(11370,'Пехотинцы',1930,79,0.0,6.0,78,'1930-08-30','https://st.kp.yandex.net/images/film_iphone/iphone360_11370.jpg','Doughboys','Элмер Стайвcент влюблен в красавицу Мэри. Когда он в очередной раз подъезжает на своем Роллс-ройсе и приглашает Мэри на свидание, она, в очередной раз, ему отказывает. Тем временем шофер Стайвcента записывается в армию. Элмер собирается нанять нового шофера, но вместо бюро по найму по ошибке приходит на призывной пункт. Его отправляют «добровольцем» на Первую мировую войну…','Нет данных'),(11371,'Голливудское ревю',1929,130,0.0,5.4,116,'1929-06-20','https://st.kp.yandex.net/images/film_iphone/iphone360_11371.jpg','The Hollywood Revue of 1929','Фильм, посвященный главным звездам студии Metro-Goldwyn-Mayer.','Нет данных'),(11372,'Брак назло',1929,76,0.0,7.1,254,'1929-03-24','https://st.kp.yandex.net/images/film/11372.jpg','Spite Marriage','Элмер очень беден и работает в химчистке. Он безумно любит звезду сцены Трилби Дрю. На каждое ее выступление он надевает чужой смокинг и мчится в театр. Когда партнер Трилби по спектаклю обручается, она в отместку выходит замуж за Элмера, предполагая, что Элмер — миллионер. Но она ясно все еще любит своего партнера…','Нет данных'),(11373,'Кинооператор',1928,69,0.0,8.1,1934,'1928-09-10','https://st.kp.yandex.net/images/film_iphone/iphone360_11373.jpg','The Cameraman','Бастер, мелкий уличный фотограф, становится оператором-документалистом, пытаясь добиться любви Салли, и после множества приключений превращается в профессионала.<br><br>Результаты его первых проб, показанных на экране, таковы: «… лошади скачут задом наперед, опрокидывая барьеры, которые сами собой встают на место; красавицы наяды выпрыгивают из вод на трамплин; броненосец добирается до моря по нью-йоркским улицам, пугая людей, соперничающих в скорости с автобусами».','Нет данных'),(11374,'Колледж',1927,66,0.0,7.1,394,'1927-07-30','https://st.kp.yandex.net/images/film_iphone/iphone360_11374.jpg','College','Это комедия о прилежном студенте Рональде, которому его любимая девушка поставила условие: или ты станешь более спортивным, или я к тебе никогда не подойду!','Нет данных'),(11375,'Вояка Батлер',1926,77,0.0,7.3,318,'1926-08-02','https://st.kp.yandex.net/images/film_iphone/iphone360_11375.jpg','Battling Butler','Отец Альфреда хочет сделать из сына настоящего мужчину и посылает его на охоту и рыбалку. Тот ничего не ловит и ни в кого не попадает, зато влюбляется в девушку с гор. Ее отец и братья высмеивают его, но тут им сообщают, что это Альфред «Боец» Батлер, чемпион…','Нет данных'),(11376,'На Запад',1925,76,0.0,7.2,350,'1925-10-25','https://st.kp.yandex.net/images/film_iphone/iphone360_11376.jpg','Go West','Молодой человек не может найти работу в своём родном городке и поэтому решается ехать на запад. Денег нет, он добирается на товарняках и по дороге выпадает из вагона. И оказывается на ранчо, где живут ковбои. Он решает пожить ковбойской жизнью.','Нет данных'),(11378,'Семь шансов',1925,56,0.0,7.5,773,'1925-03-15','https://st.kp.yandex.net/images/film_iphone/iphone360_11378.jpg','Seven Chances','Мужчина узнаёт, что он получит наследство, если женится. Сегодня в семь вечера.','Нет данных'),(11379,'Навигатор',1924,59,0.0,7.6,957,'1924-10-13','https://st.kp.yandex.net/images/film_iphone/iphone360_11379.jpg','The Navigator','Робкий, нерасторопный миллионер оказывается в открытом море, на корабле, покинутом командой. По странной случайности на корабль попала также любимая миллионера, сердца и руки которой он уже давно и безуспешно добивается.','$220 000'),(11380,'Шерлок младший',1924,49,0.0,8.1,3653,'1924-04-19','https://st.kp.yandex.net/images/film_iphone/iphone360_11380.jpg','Sherlock Jr.','Б. Китон — киномеханик, который мечтает быть знаменитым детективом, как Шерлок Холмс. Влюбленный в прекрасную девушку, он дарит ей шоколад и кольцо, но другой поклонник также соревнуется за ее внимание. Киномеханик безуспешно пытается выследить своего соперника, коварного типа, который украл часы из дома девушки и, заложив их, купил ей огромную коробку конфет.<br><br>Ложно обвиненный в преступлении семьей девушки, убитый горем, Китон засыпает на работе во время демонстрации фильма. Ему снится, что он «входит» в экран и взаимодействует с персонажами фильма — теперь разыгрывающими ситуацию с украденными драгоценностями. Китон здесь выступает как детектив — «Шерлок младший», который, расследуя преступление, попадает во множество комедийных ситуаций.','Нет данных'),(11381,'Три эпохи',1923,63,0.0,7.3,742,'1923-06-25','https://st.kp.yandex.net/images/film_iphone/iphone360_11381.jpg','Three Ages','Злоключения Бастера в трех различных исторических периодах.','Нет данных'),(11382,'Любовное гнездышко',1923,23,0.0,6.9,370,'1924-06-06','https://st.kp.yandex.net/images/film/11382.jpg','The Love Nest','Герой Китона прощается с Виржинией и всеми женщинами и уплывает на своей яхте «Амур». Когда у него заканчивается еда и вода, он попадает на борт «Любовного гнездышка», которым управляет очень придирчивый капитан. Матрос, который пролил кофе на руку капитана, был выброшен за борт. Так поступают со всеми, кто разозлит капитана','Нет данных'),(11383,'Шаронавт',1922,22,0.0,6.6,325,'1923-01-22','https://st.kp.yandex.net/images/film_iphone/iphone360_11383.jpg','The Balloonatic','Молодой мужчина и девушка попадают в череду приключений в попытке доказать друг другу свои способности по выживанию. Воздушный шар, на котором мужчина приземлился в дикой местности, оказался полезным, когда герои на каноэ чуть было не попали в водопад.','Нет данных'),(11384,'Сны наяву',1922,28,0.0,7.0,342,'1924-04-20','https://st.kp.yandex.net/images/film_iphone/iphone360_11384.jpg','Day Dreams','Герой Бастера пробует себя в самых разных профессиях, от помощника ветеринара до актера, и в одной из мастерски поставленных сцен убегает от целой толпы нью-йоркских полицейских.','Нет данных'),(11385,'Электрический дом',1922,23,0.0,7.0,406,'1922-10-16','https://st.kp.yandex.net/images/film_iphone/iphone360_11385.jpg','The Electric House','Ботаник Бастер по ошибке получает диплом инженера-электрика. Его нанимают обустроить новый дом. Он прилаживает в доме массу всяких диковинных устройств. Тут объявляется настоящий обладатель диплома инженера и начинает переделывать все то, что напридумывал Бастер…','Нет данных'),(11386,'Морозный Север',1922,17,0.0,6.6,332,'1922-08-28','https://st.kp.yandex.net/images/film_iphone/iphone360_11386.jpg','The Frozen North','Герой оказывается на Крайнем Севере, где его ожидает масса приключений, среди которых ограбление игорного дома и убийство любовника своей жены, если, конечно, герой не ошибся…','Нет данных'),(11387,'Кузнец',1922,21,0.0,6.9,327,'1922-07-21','https://st.kp.yandex.net/images/film/11387.jpg','The Blacksmith','Герой Китона подковывает коней и чинит машины, что приводит к разнообразным последствиям.','Нет данных'),(11388,'Родственники жены',1922,24,0.0,7.0,447,'1922-05-06','https://st.kp.yandex.net/images/film_iphone/iphone360_11388.jpg','My Wife\'s Relations','Герой, случайно попадает в загс и ему приходится жениться на первой встречной, которая стояла рядом. Его будущая жена, это очень темпераментная и боевая женщина, к тому же, у которой есть огромное мужское семейство. Прихватив нового муженька, она привела его жить к себе домой. Придя и увидев кучу мужчин, наш герой опешил. Первые слова, которые он услышал, были недружелюбны и означали, что он и недели у них не протянет. Но не тут то было.','Нет данных'),(11389,'Полицейские',1922,18,0.0,7.4,768,'1922-03-11','https://st.kp.yandex.net/images/film_iphone/iphone360_11389.jpg','Cops','Фильм-погоня, лучшая короткометражка Бастера Китона. Главный герой попадает из одного неприятного приключения в другое, удирая от доброй сотни полисменов.','Нет данных'),(11390,'Бледнолицый',1922,20,0.0,7.1,421,'1923-05-20','https://st.kp.yandex.net/images/film/11390.jpg','The Paleface','Злые нефтебароны дали индейцам всего один день для того, чтобы они ушли со своей земли. Вождь индейцев приказывает своим солдатам убить первого попавшегося бледнолицего. Первым попавшимся оказался герой Бастера Китона. После многих приключений он становится членом племени и помогает бороться с нефтебаронами…','Нет данных'),(11391,'Лодка',1921,27,0.0,6.9,382,'1921-11-10','https://st.kp.yandex.net/images/film_iphone/iphone360_11391.jpg','The Boat','Когда Бастер заканчивает делать лодку под названием Дамфино, оказывается, что она слишком велика по сравнению с дверным проемом подвала. Когда он выезжает с лодкой на буксире, стена дома разрушается. В гавани он спускает лодку только для того, чтоб она потонула под его весом. Все остальное время он и его семья восстанавливают лодку.','Нет данных'),(11392,'Театр',1921,23,0.0,7.4,456,'1921-10-06','https://st.kp.yandex.net/images/film_iphone/iphone360_11392.jpg','The Play House','В этой картине Бастер Китон играет сразу всех членов труппы, зрителей и недисциплинированную обезьянку (появляясь в одной из сцен одновременно в девяти ролях).','Нет данных'),(11393,'Козел отпущения',1921,23,0.0,7.7,637,'1921-05-15','https://st.kp.yandex.net/images/film_iphone/iphone360_11393.jpg','The Goat','Бродяга Бастер, шляясь по городу в поисках еды, вследствие ряда несчастных случаев, совпадений и абсурдных недоразумений, принят за опасного преступника по кличке «Снайпер Дэн».','Нет данных'),(11394,'Особый знак',1921,20,0.0,7.4,442,'1921-04-18','https://st.kp.yandex.net/images/film_iphone/iphone360_11394.jpg','The «High Sign»','Герой Бастера Китона сходит с поезда неподалеку от парка развлечений. Он устраивается на работу в тир, который, как позже выясняется, принадлежит кровожадным бандитам. Они поручают нашему герою убить бизнесмена, но он, наоборот, защищает бизнесмена и его дочь, оснастив их дом множеством хитроумных устройств.','Нет данных'),(11395,'Невезенье',1921,23,0.0,7.0,394,'1921-03-14','https://st.kp.yandex.net/images/film_iphone/iphone360_11395.jpg','Hard Luck','Потеряв работу, Бастер совершает несколько неудачных попыток самоубийства. Наконец он решает «отравиться» алкоголем…','Нет данных'),(11396,'Дом с привидениями',1921,21,0.0,7.3,530,'1921-01-30','https://st.kp.yandex.net/images/film_iphone/iphone360_11396.jpg','The Haunted House','Банда местом своих сходок выбрала дом, пользующийся дурной славой, и эту славу поддерживала. Наш герой работает в банке и ради дочери начальника бесстрашно проходит все испытания.','Нет данных'),(11397,'Соседи',1920,18,0.0,7.6,532,'1920-12-22','https://st.kp.yandex.net/images/film_iphone/iphone360_11397.jpg','Neighbors','История Ромео и Джульетты, обыгранная в двух разделённых забором многоквартирных домах, где живут враждующие семьи Бастера и Вирджинии.','Нет данных'),(11398,'Пугало',1920,19,0.0,7.9,784,'1920-11-07','https://st.kp.yandex.net/images/film_iphone/iphone360_11398.jpg','The Scarecrow','Сельскохозяйственные рабочие Китон и Робертс живут в одном коттедже, полном разнообразных механических приспособлений, которые облегчают жизнь. Они сражаются за сердце дочери фермера. Китон переодевается чучелом и этим доставляет своему сопернику и фермеру массу проблем…','Нет данных'),(11399,'Заключенный №13',1920,19,0.0,7.3,572,'1920-10-27','https://st.kp.yandex.net/images/film_iphone/iphone360_11399.jpg','Convict 13','Молодой гольфист попадает в тюрьму, где предотвращает побег других заключенных.','Нет данных'),(11400,'Балда',1920,77,0.0,6.1,190,'1920-09-20','https://st.kp.yandex.net/images/film_iphone/iphone360_11400.jpg','The Saphead','Ник Ван Олстен владелец серебряного прииска Генриетта, очень богатый человек. У него есть сын, Берти, очень наивный и избалованный. И есть дочь Рози, которая замужем за теневым инвестором Марком. Марк разрушает свадебные планы Берти, заставляя его признать свою незаконную дочь. Марк так же почти разрушает семейный бизнес, распродавая серебро Генриетты по низкой цене. Всё рушится и только Берти может спасти ситуацию.','Нет данных'),(11402,'Одна неделя',1920,25,0.0,7.8,1059,'1920-09-01','https://st.kp.yandex.net/images/film_iphone/iphone360_11402.jpg','One Week','Бастер и Сибил только что поженились. Среди подарков, которые им подарили, был передвижной дом, который можно собрать за неделю. Но соперник Бастера в борьбе за сердце Сибил подменил номера на элементах конструкции дома. Теперь собрать его будет очень нелегко…','Нет данных'),(11403,'Гараж',1920,25,0.0,6.1,223,'1920-01-11','https://st.kp.yandex.net/images/film_iphone/iphone360_11403.jpg','The Garage','Двое мужчин работают автомобильным механиком и пожарным на пожарной станции. Им оставили для ремонта автомобиль, но они вместо этого разбирают его. <br /><br />Во второй части фильма, Роско и Китон были вызваны на пожар, но это оказывается ложной тревогой. Когда они возвращаются, то находят свою собственную пожарную станцию ​​в огне.','Нет данных'),(11404,'Деревенщина',1919,27,0.0,5.9,170,'1919-10-26','https://st.kp.yandex.net/images/film/11404.jpg','The Hayseed','Бастер управляет магазином, а Роско доставляет почту и заодно проводит время, играя в прятки с Молли. Констебль, который также интересуется Молли, крадет 300 долларов, но Бастер это замечает.','Нет данных'),(11405,'За кулисами',1919,26,0.0,6.6,155,'1919-09-07','https://st.kp.yandex.net/images/film/11405.jpg','Back Stage','Роско и Бастер работают в театре водевиля. Герои со своей командой сценработников нападают на силача из шоу, чтобы проучить его за издевательство над помощницей, поэтому он отказывается выходить на сцену. В результате всю команду ставят выступать вместо него.','Нет данных'),(11406,'Повар',1918,22,0.0,6.8,200,'1918-09-15','https://st.kp.yandex.net/images/film_iphone/iphone360_11406.jpg','The Cook','Повара создают хаос в прибрежном курортном отеле.','Нет данных'),(11407,'Спокойной ночи, сестричка!',1918,26,0.0,6.3,151,'1918-06-30','https://st.kp.yandex.net/images/film/11407.jpg','Good Night, Nurse!','Жена Роско пытается положить его в лечебницу для избавления от алкоголизма. Там его встречает забрызганный кровью доктор с тесаком и едва одетая пациентка. Роско съедает градусник, и его срочно кладут на операцию.','Нет данных'),(11408,'Самогон',1918,23,0.0,5.8,122,'1918-05-12','https://st.kp.yandex.net/images/film/11408.jpg','Moonshine','Казалось бы, вражда между двумя кланами бутлегеров окончена победой одного из кланов, но горцев настигает новая беда в лице прибывшего в их края правительственного агента и его помощника. Агенты переворачивают все вверх дном в поисках тайного убежища, в котором горцы готовят нелегальный алкоголь, но попадают в серьезные неприятности, из которых спастись им поможет только небольшая магия кино.','Нет данных'),(11409,'Коридорный',1918,33,0.0,6.6,179,'1918-03-18','https://st.kp.yandex.net/images/film/11409.jpg','The Bell Boy','В отеле «Голова лося» коридорные в лобби издеваются друг над другом и над гостями. Лифт работает на силе упрямого коня. Притворное ограбление превращается в настоящее. А еще будет погоня на угнанном трамвае.','Нет данных'),(11410,'Странный Дикий Запад',1918,25,0.0,6.6,199,'1918-01-20','https://st.kp.yandex.net/images/film_iphone/iphone360_11410.jpg','Out West','Главный герой фильма Фатти решает перебраться из прерий в город, для чего пробирается зайцем в поезд, откуда его вышвыривают охранники, которых он умудрился ещё и объесть. Очутившись в пустыне, Фатти подвергается нападению индейцев, удирая от которых, он наконец-то попадает в небольшой городок на Диком Западе, где тут же находит подвернувшуюся ему работу — на освободившееся место убитого только что бармена. Бастер Китон играет шерифа этого городка, где стрельба, драки и убийства являются обыденным явлением, а в салуне даже посреди зала в полу имеется люк для размещения падающих тел.','Нет данных'),(11412,'Кони-Айленд',1917,25,0.0,6.5,140,'1917-10-29','https://st.kp.yandex.net/images/film_iphone/iphone360_11412.jpg','Coney Island','День развлечений в Кони Айленде. Фатти, сбежав от ворчливой супруги, пустился во флирт, к тому же очутился в женском одеянии.','Нет данных'),(11413,'О, Доктор!',1917,23,0.0,6.3,177,'1917-09-30','https://st.kp.yandex.net/images/film/11413.jpg','Oh Doctor!','Доктор Холпок, его жена и сын присутствуют на лошадиных скачках. Доктор флиртует с другой женщиной. В итоге доктор и парень незнакомки проигрывают все деньги, поставленные на одну и ту же лошадь, тем самым, разочаровывая обеих женщин. Холпок пытается придумать как получить новых пациентов, а другой мужчина — как вернуть часть денег за счет доктора.','Нет данных'),(11414,'Его брачная ночь',1917,19,0.0,6.3,202,'1917-08-20','https://st.kp.yandex.net/images/film/11414.jpg','His Wedding Night','Клерк, лихо заправляющий делами аптеки и заправки, встречается с симпатичной девушкой Эллис, дело постепенно идет к свадьбе, но внезапно появляются конкуренты, стремящиеся отбить Эллис. Посыльный доставляет свадебное платье для примерки, но по ошибке надевает его сам, теперь все принимают его за Элис.','Нет данных'),(11415,'Дом грубых манер',1917,19,0.0,6.1,241,'1917-06-25','https://st.kp.yandex.net/images/film_iphone/iphone360_11415.jpg','The Rough House','История о Роско, его жене и его же приемной матери, которые отдыхают на курорте, где бедному садовнику приходится тушить устроенный Роско пожар, курьеру драться с поваром, а копу расхлебывать всю эту кашу. Что втройне смешнее, если учесть, что садовник, курьер и коп — это одно и то же, вечно бесстрастное лицо Бастера Китона.','Нет данных'),(11416,'Помощник мясника',1917,30,0.0,6.4,236,'1917-04-23','https://st.kp.yandex.net/images/film_iphone/iphone360_11416.jpg','The Butcher Boy','В фильме рассказывается о соперничестве между толстым (Фатти) и тонким (Слим) за любовь хорошенькой Аманды, дочери владельца сельского магазина.','Нет данных'),(11419,'Голливудская кавалькада',1939,97,0.0,6.3,85,'1939-10-13','https://st.kp.yandex.net/images/film_iphone/iphone360_11419.jpg','Hollywood Cavalcade','В 1913 году работник киностудии Майкл Коннорс увидел в постановке на Бродвее Молли Адэр. Очарованный ее красотой и талантом, он уговаривает ее оставить театр и уехать с ним в Калифорнию, где в то время начинает развиваться киноиндустрия. Став сценаристом и режиссером фильмов с Молли в главной роли, он делает из нее звезду…','Нет данных'),(11428,'Возьми меня с собой на бейсбол',1949,93,0.0,7.3,129,'1949-03-09','https://st.kp.yandex.net/images/film_iphone/iphone360_11428.jpg','Take Me Out to the Ball Game','Эдди и Деннис — профессиональные игроки в бейсбол, но в глубине души они — онферансье водевиля. Неприятности в их размеренной жизни и карьере начинаются когда, в очередной раз, выходя на бейсбольное поле, друзья узнают, что у их команды новый владелец по имени — К. С. Хиггинс.<br><br>Удивлению и возмущению парней нет предела, но главный сюрприз ждет команду впереди: оказывается Хиггинс — это красивая женщина! Сражение полов начинается. В итоге после курьезных историй изапутанных любовных интриг главные герои находят свою половину. Эдди обретает любовь красавицы Хиггинс, а весельчак Деннис Рьян открывает своё сердце девушке поимени Шерли Делвин, которая знает толк в бейсболе.','Нет данных'),(11434,'Первая полоса',1974,105,0.0,7.2,675,'1974-12-18','https://st.kp.yandex.net/images/film_iphone/iphone360_11434.jpg','The Front Page','Фильм о чокнутых и диких чикагских газетчиках 20-х годов. Хилди Джонсон главный репортер в Чикагской газете. Он намерен уйти с работы, чтобы жениться. Его главный редактор Уолтер Бернс, имеет другие планы и не намерен его отпускать.','$4 000 000'),(11435,'Аванти!',1972,138,0.0,7.4,835,'1972-12-17','https://st.kp.yandex.net/images/film_iphone/iphone360_11435.jpg','Avanti!','Миллионер из Балтимора узнает, что его отец умер в Италии. Приехав в красивый итальянский курорт за телом покойного отца и по воле судьбы познакомившись с забавной леди, он из «сухого» бизнесмена превращается в романтика.','$2 750 000'),(11436,'Азарт удачи',1966,125,0.0,7.5,792,'1966-10-19','https://st.kp.yandex.net/images/film/11436.jpg','The Fortune Cookie','Во время спортивного матча телевизионный оператор Гарри Хинкл случайно получает небольшую травму от звезды Бум Бума Джексона. Сам пострадавший никаких претензий к Бум Буму не имеет, но зато их имеют бывшая жена Гарри, сразу решившая «восстановить» брак, и его зять Вилли — проныра-адвокат. Они остро чувствуют запах наживы и разрабатывают план грандиозной аферы, цель которой — получить как можно больше денег за мнимые увечья «дорогого» Гарри.','$3 705 000'),(11437,'Один, два, три',1961,115,0.0,7.6,986,'1961-12-15','https://st.kp.yandex.net/images/film_iphone/iphone360_11437.jpg','One, Two, Three','МакНамара — глава отделения компании «Кока-Кола» в Германии — ответственный работник и настоящий карьерист. Однажды на его голову сваливается Скарлетт, дочь большого американского начальника, и МакНамара нянчится с ней, надеясь, что это поможет ему получить вожделенное назначение. Но дело принимает скверный оборот, когда девушка влюбляется в коммуниста из Восточного Берлина и объявляет, что собирается за него замуж.','$3 000 000'),(11438,'Зуд седьмого года',1955,105,0.0,7.4,6185,'1955-06-01','https://st.kp.yandex.net/images/film_iphone/iphone360_11438.jpg','The Seven Year Itch','Книгоиздатель Ричард Шерман женат уже семь лет. Его жена и сын в очередной раз уезжают за город на каникулы. Недолго длится одиночество Ричарда, неожиданно на его балкон падает огромный горшок с томатами, и виной этому соседка с верхнего этажа, белокурая рекламная модель.<br><br>Ричард предлагает красотке зайти к нему в гости и что-нибудь выпить. Шикарная блондинка в глубоком декольте, не давая соседу опомниться, появляется в его квартире с бутылкой шампанского в руке…<br><br>С этой минуты богатое воображение героя рисует не только сказочные картины завоевания сердца соблазнительной красавицы, но и унизительные сцены разоблачения женой его неверности…','$1 800 000'),(11440,'Песня рождена',1948,113,0.0,6.6,92,'1948-10-19','https://st.kp.yandex.net/images/film_iphone/iphone360_11440.jpg','A Song Is Born','Семь почтенных профессоров музыки вот уже в течение девяти лет работают над музыкальной энциклопедией, не ведая, что за пределами их затхлого мира музыка давным-давно изменилась. Чтобы познакомиться с новыми течениями в современной музыке один из них, профессор Фризби отправляется в «опасное» путешествие по ночным клубам, где, в частности, знакомится с певицей Хани Суонсон. Приглашение профессора принять участие в «круглом столе» Хани использует для того, чтобы скрыться от полиции, разыскивающей её как подружку гангстера, подозреваемого в убийстве.','Нет данных'),(11441,'Зарубежный роман',1948,116,0.0,7.2,618,'1948-06-30','https://st.kp.yandex.net/images/film_iphone/iphone360_11441.jpg','A Foreign Affair','Комиссия конгресса, прибывшая проверять моральный дух и поведение военнослужащих, неизменно попадает в комические ситуации.','$1 500 000'),(11442,'Пять гробниц по пути в Каир',1943,96,0.0,6.9,379,'1943-05-26','https://st.kp.yandex.net/images/film/11442.jpg','Five Graves to Cairo','Вторая мировая война. Британский солдат Джон Брэмбл волею судьбы оказывается один в маленьком городке, расположенном среди песков Сахары. В город входят германские оккупационные войска. Чтобы избежать плена он выдает себя за погибшего работника маленького отеля «Императрица Британии», который принадлежит Фариду.<br><br>Он постепенно входит в доверие к домоправительнице-француженке Муше, глубоко презирающей британцев за то, что они бросили французские войска под Дюнкерком. Позже отель становится штабом генерала Роммеля. Брэмбл узнает, что, выдав себя за слугу, он подвергается еще большей опасности, так как покойный был агентом, работавшим на нацистов.<br><br>Сумев все-таки убедить немцев, что он работает на них, Брэмбл получает задание следовать в Каир и готовить вторжение германских войск.','$855 000'),(11443,'Майор и малютка',1942,100,0.0,7.6,514,'1942-09-16','https://st.kp.yandex.net/images/film_iphone/iphone360_11443.jpg','The Major and the Minor','Сюзан Эпплгэйт, устав от года проведенного в Нью-Йорке и безуспешного поиска работы, возвращается домой в Айову. К несчастью, у нее не хватает денег на билет, и она вынуждена выдать себя за 12-летнюю девочку, чтобы купить билет за полцены. В поезде, вычисленная контролерами, она прячется в купе майора Филипа Кирби, который близорук и верит ей. Влюбившись в майора Сюзан следует за ним в военную школу, однако, дальнейшее осложняется появлением его невесты и тем, что близорукий майор все еще считает Сюзан — 12-летней «Сю-Сю»…','$928 000'),(11444,'Воскресни, любовь моя',1940,110,0.0,6.1,133,'1940-10-16','https://st.kp.yandex.net/images/film_iphone/iphone360_11444.jpg','Arise, My Love','Картина рассказывает об удивительных приключениях лихого пилота и жизнерадостного репортера в начале Второй мировой войны.','Нет данных'),(11446,'Полночь. Сердцу не прикажешь',1939,94,0.0,7.0,253,'1939-03-17','https://st.kp.yandex.net/images/film_iphone/iphone360_11446.jpg','Midnight','Певичка Ив Пибоди прибывает в Париж без единого су в кармане. На вокзале она знакомится с таксистом, венгром Тибором Черни. Чувствуя, что она начинает невольно симпатизировать Тибору, и, стремясь избежать серьезных отношений, Ив сбегает от него и случайно попадает на вечеринку. Там она знакомится с Хелен Фламмарион и ее поклонником Жаком Пико.<br><br>Ив, сама того не желая, помогает зародиться в голове мужа Хелен, Жоржа, коварному плану. Он решает использовать Ив для того, чтобы вернуть супругу, которую он безмерно любит, в лоно семьи и проучить Пико, представив Ив баронессой, чтобы иметь возможность пригласить ее погостить к ним в загородный дом.<br><br>А там, глядишь, Пико начнет ухаживать за «баронессой» и у его жены наконец-то откроются глаза. Ив принимает его предложение. Тем временем ее разыскивает безумно влюбленный в нее Тибор и к этому поиску подключает всех своих коллег таксистов. Вскоре он узнает, что она вовлечена в авантюру и выдает себя за баронессу…','Нет данных'),(11447,'Тот самый возраст',1938,95,0.0,7.0,126,'1938-10-07','https://st.kp.yandex.net/images/film_iphone/iphone360_11447.jpg','That Certain Age','Журналист Винсент Буллитт возвращается с гражданской войны в Испании после ранения. Его босс — газетный магнат Фаллитрон — предлагает ему отдохнуть и подлечиться у себя на загородной вилле, а заодно написать несколько статей о войне в Европе.<br><br>Юная дочь босса с друзьями в это время готовит театральную постановку в домике для гостей, который некстати занимает приехавший отдохнуть журналист. Молодёжь возмущена неожиданным вторжением, ведь все репетиции отменяются. Ребята решают выжить гостя из дома и придумывают массу способов для осуществления своего плана. Но от ненависти до любви один шаг, и юная леди влюбляется в Винсента, который намного её старше.','Нет данных'),(11477,'Погоня за украденной боеголовкой',2000,89,0.0,3.4,74,'2000-08-14','https://st.kp.yandex.net/images/film/11477.jpg','Militia','Агент специального бюро Итан Картер получает задание повышенной важности. При помощи бывшего торговца оружием Уильяма Фейна ему надо вернуть украденную боеголовку с биологическим оружием. Опасность задания усугубляется тем, что Фейн вынужден помогать Картеру под давлением шантажа, и может в любой момент предать спецагента.','Нет данных'),(11478,'Страх над городом',2000,100,0.0,5.5,98,'2000-03-05','https://st.kp.yandex.net/images/film_iphone/iphone360_11478.jpg','The Spreading Ground','Огромный мегаполис скован сетями страха — за одни сутки убиты пять невинных детей. Пока лучшие детективы полицейского управления Делонгпре и МакГиверн безуспешно ведут поиски маньяка, мэр города, циничная и расчетливая женщина, не намерена дожидаться результатов расследования.<br><br>Опасаясь, что скандал и шумиха сорвут начатое ею возведение суперсовременного стадиона, она тайно заключает сделку с ирландской мафией, чтобы любой ценой найти и уничтожить безумца. Вознаграждение от мэра — миллионный подряд на строительство.<br><br>Теперь охота за убийцей идет по обе стороны закона, но будет ли злодей пойман до того, как совершится новое преступление? <br />','Нет данных'),(11480,'Первые 9 1/2 недель',1998,100,0.0,4.3,178,'1998-11-03','https://st.kp.yandex.net/images/film_iphone/iphone360_11480.jpg','The First 9 1/2 Weeks','Банковский клерк Мэт Вейд приезжает в Новый Орлеан, чтобы открыть счет на 500000000$ для Франсуа Дюбуа — жестокого калеки, обладающего баснословным состоянием. Мэт попадает в логово Дюбуа — паутину, сотканную из обмана и плотских утех. В притоне где процветают безнравственность и разврат, он встречает Эмили, молодую прекрасную жену миллионера.<br><br>Один взгляд — и охваченные страстью молодые люди забывают обо всем. Рискуя жизнью, влюбленные идут на встречу своим безумным желаниям. Дюбуа разъярен и полон решимости отомстить за измену жены. Он искусно подставляет Мэта, навешивая на него обвинение в убийстве. Вынужденный скрываться, обессиленный, находящийся на грани помешательства Вейд планирует побег.<br><br> Идя наперекор здравому смыслу, он возвращается в поместье Дюбуа за своей возлюбленной и открывает ужасающую правду, не оставляющую и тени надежды.','Нет данных'),(11482,'Буги Бой',1998,104,0.0,5.8,439,'1998-02-12','https://st.kp.yandex.net/images/film_iphone/iphone360_11482.jpg','Boogie Boy','Секс, наркотики, рок-н-ролл — не все нравится Джэсси в этом мифе. На этом пути люди часто становились пылью на ветру жизни. Когда — то он доверял им. Друг предает ради щепотки кокаина. Женщина любит за деньги.<br><br>Джесси Пэйдж понял: ничто не угрожает тебе, только когда ты сам выбрал цель и направление. Сила воли, скорость реакции и бешеный ритм жизни — амулеты, которые всегда спасут тебя.','$5 000 000'),(11483,'Под огнем',1997,86,0.0,5.5,533,'1998-05-12','https://st.kp.yandex.net/images/film_iphone/iphone360_11483.jpg','Point Blank','Герой со стариком-отцом узнают, что брат, приговоренный к «вышке», бежит из тюремного автобуса с другими преступниками и захватывает заложников в большом торговом комплексе. Гибнут невинные люди.<br><br>Герой, бывший спецназовец и супергерой, по просьбе отца и повинуясь голосу крови, едет на место событий, чтобы вызволить брата из беды. Тот, попав в руки закона за убийство каких-то мафиози и владельца казино, оказывается подставленным злодеями. Рурк проникает в здание раньше, чем начинают свой штурм агенты ФБР…','Нет данных'),(11485,'Лэсси',1994,94,0.0,7.2,1986,'1994-07-22','https://st.kp.yandex.net/images/film_iphone/iphone360_11485.jpg','Lassie','Семья Тернеров по дороге домой из Балтимора подбирает симпатичную собаку колли. Дети называют ее Лесси. И вскоре необыкновенно умная и находчивая Лесси становится полноправным членом семьи, настоящим помощником по хозяйству и преданным другом для детей.','Нет данных'),(11486,'Конвоиры',1994,101,0.0,6.8,4259,'1994-04-22','https://st.kp.yandex.net/images/film_iphone/iphone360_11486.jpg','Chasers','Офицер берегового патруля военно-морских сил Рок Рилли думал, что его уже ничем не удивишь. Его свежеиспеченному напарнику Эдди Дивейну тоже все осточертело, и он подумывает об увольнении из армии.<br><br>Но удивляться им все-таки пришлось, они почувствовали себя настоящими юнцами, когда повстречались с лейтенантом ВМС Тони Джонсон, красивой и вздорной особой, которая и была тем заключенным, кого они должны были доставить на базу.<br><br>Доставка должна проходить согласно заведенному порядку. Однако Тони намерена во что бы то ни стало вырваться на свободу…','Нет данных'),(11489,'Котяра',1989,90,0.0,5.9,146,'1989-10-20','https://st.kp.yandex.net/images/film_iphone/iphone360_11489.jpg','Cat Chaser','В 1965-том году Американский десантник Джордж Моран был среди 42-х тысяч солдат военного контингента США, который вопреки уставу ООН вторгся на территорию Доминиканской республики с целью укрепления «проамериканского» диктаторского режима Кабраля. Едва ли кто-то еще помнит позорную страницу Американской истории.<br><br>Но через 23-три года эту «заварушку» не забыли: Джордж Моран — владелец маленького прибрежного отеля в Палм-Бич и бывший генерал Андреас Дебоя, нашедший убежище в США. А связывает их одно обстоятельство — любовь к женщине.','Нет данных'),(11494,'Девушка из долины',1983,99,0.0,6.2,737,'1983-04-29','https://st.kp.yandex.net/images/film_iphone/iphone360_11494.jpg','Valley Girl','«Девушку из Голливудской долины» звали Джули. То есть Джульетта. У нее были первоклассные родители. И однажды Джули отправилась на вечеринку, куда заявились Фред и Рэнди, два парня с «Голливудских холмов», случайно прослышавшие о тусовке.<br><br>Здесь Рэнди познакомился с Джули и уговорит ее посмотреть реальный мир — настоящий ночной Голливуд.','$350 000'),(11506,'Виртуоз',2002,91,0.0,5.4,257,'2002-10-06','https://st.kp.yandex.net/images/film_iphone/iphone360_11506.jpg','The Piano Player','Алекс Лэйни, лишившийся родителей в раннем детстве, за всю свою жизнь перепробовал множество занятий, связанных с криминалом. Теперь Алекс использует свой богатый опыт в мирных целях — он телохранитель.<br><br>Его новый клиент — человек, который должен дать показания в суде против мафии. Но пока Алекс не подозревает, что ему придется рисковать жизнью, защищая убийцу своих собственных родителей. Он сделает всё, чтобы главный свидетель и его семья не пострадали. А потом… Кто знает что будет потом?','$10 000 000'),(11508,'Часовой механизм',2001,92,0.0,5.2,2153,'2001-06-23','https://st.kp.yandex.net/images/film_iphone/iphone360_11508.jpg','Ticker','Когда Сан-Франциско сотрясает серия мощнейших взрывов, детектив Рэй Нэттлс выходит на след безжалостного террориста Алекса Свана, намеревающегося разрушить важнейшие здания в городе, погубив десятки тысяч жизней. Не раскрывая причин своих поступков, Сван устраивает для полицейских хитроумные смертоносные ловушки, постоянно ускользая от преследования.<br><br>Не в силах в одиночку поймать разбушевавшегося маньяка, Нэттлс обращается за помощью к опытному саперу Глассу, вместе с которым они настигают убийцу, только тогда понимая, что он — всего лишь марионетка в руках более опасного и поистине безумного злодея.','$25 000 000'),(11510,'Вор всегда вор',2000,101,0.0,6.2,190,'2000-04-06','https://st.kp.yandex.net/images/film_iphone/iphone360_11510.jpg','Luck of the Draw','Попав под ожесточенную перестрелку между бандой Джани Понти и федеральными агентами, бывший заключенный Джек стал по воле случая обладателем чемоданчика с клише для стодолларовых банкнот. Узнав о пропаже стоимостью не меньше чем в миллион долларов, Понти приказывает начальнику своей охраны Карло найти и убить вора.<br><br>Теперь Джек, если хочет разбогатеть и остаться в живых, должен опасаться не только итальянской мафии и коррумпированных федералов, загадочного киллера по кличке Убийца и криминального авторитета Макнилли, но и своего дружка Зиппо и любимой девушки Ребекки…','$5 000 000'),(11513,'Сын Иисуса',1999,107,0.0,5.9,146,'1999-09-05','https://st.kp.yandex.net/images/film_iphone/iphone360_11513.jpg','Jesus\' Son','Блуждающий в своей хаотической жизни от одной неудачи к другой, FH горит сердечным желанием помочь всем вокруг себя, но постоянно терпит фиаско. И вот, путешествуя от полей Айовы через быстроменяющийся Чикаго к солнечному Фениксу, он обнаруживает, что маленькие радости от случайных встреч и есть то, к чему он бессознательно стремился и искал.','Нет данных'),(11514,'Меткий стрелок',1999,88,0.0,5.9,91,'1999-04-15','https://st.kp.yandex.net/images/film/11514.jpg','Straight Shooter','Дочь бывшего легионера умерла от рака, вызванного радиацией. Его жена, не выдержав удара, повесилась. Безутешный отец становится безудержным убийцей руководителей местной атомной электростанции. Запаниковавшие будущие жертвы вызывают на подмогу Фрэнка Гектора — бывшего боевого инструктора неуловимого мстителя.','Нет данных'),(11515,'Амнезия',1997,98,0.0,5.5,244,'1997-06-11','https://st.kp.yandex.net/images/film_iphone/iphone360_11515.jpg','The Blackout','Преуспевающий актер начинает подозревать себя в совершенном убийстве. Его преследуют навязчивые картины…<br><br>Возможно, что потеря памяти была естественной реакцией опаленного содеянным разума. Возможно, что часть воспоминаний была потеряна из-за чрезмерного увлечения алкоголем и наркотиками. Но возможно, что подозрение может быть страшнее ожиданий. Стоит ли восстанавливать потерянное?','Нет данных'),(11516,'Увлекшийся',1995,109,0.0,6.2,176,'1996-01-24','https://st.kp.yandex.net/images/film_iphone/iphone360_11516.jpg','Carried Away','Действие картины разворачивается на фоне великолепного пейзажа Северной Америки. Влечение немолодого человека к 17-летней красавице переворачивает с ног на голову его спокойную и размеренную жизнь. Это, казалось бы, невинное увлечение молодой девушкой незаметно превращается в большую, страстную любовь.','Нет данных'),(11517,'Придорожное заведение',1992,95,0.0,7.1,4269,'1993-05-14','https://st.kp.yandex.net/images/film_iphone/iphone360_11517.jpg','Red Rock West','Майкл — бывший морской пехотинец. В его карманах пусто, а единственный шанс найти работу — заехать в придорожный бар Red rock west. В то же самое утро местный шериф Уэйн поджидает наёмного убийцу из Техаса, нанятого для устранения жены.','$8 000 000'),(11518,'Полночная жара',1992,90,0.0,5.6,194,'1992-07-02','https://st.kp.yandex.net/images/film_iphone/iphone360_11518.jpg','Sunset Heat','Вернувшись в Лос-Анджелес после долгого отсутствия, фотожурналист Эрик «попадает в переплет». Он останавливается в Малибу в доме своего друга Дэнни, который ввязался в мафиозные дела, украв у гангстеров миллион долларов.<br><br>Взбешенный бандитский босс Карл Мэдсен, вместе с которым до отъезда из Лос-Анджелеса Эрик торговал наркотиками, отдает приказ убить Дэнни, берет в заложницы возлюбленную Эрика и дает ему 24 часа, чтобы найти и вернуть похищенные деньги.','Нет данных'),(11520,'Красный, как кровь',1989,91,0.0,5.0,166,'1989-08-18','https://st.kp.yandex.net/images/film_iphone/iphone360_11520.jpg','Blood Red','Себастьян — глава клана Колоджеро с 1890 года — сицилиец, эмигрировавший в американский штат Северная Калифорния. В этом клане каждый уважающий себя мужчина непременно вносит свой вклад в развитие семейного дела — огромного виноградника.<br><br>Местная «большая шишка», владелец железной дороги Уильям Берриган, требует от Себастьяна сокращения территории фермы для проведения новых транспортных путей. Однако патриарх не собирается уступать «злодею», потому что он посвятил свою жизнь винодельному бизнесу и собирался передать эти земли сыновьям. Берриган, в свою очередь, нанимает головорезов, чтобы заставить Себастьяна подчиниться. И вместо «быстрых разборок» начинается проклятая война, в которой ни одна из сторон не в силах победить.','Нет данных'),(11521,'Прямо в ад',1987,86,0.0,6.2,342,'1987-06-26','https://st.kp.yandex.net/images/film_iphone/iphone360_11521.jpg','Straight to Hell','Банда наемных убийц проваливает задание и скрывается от заказчика в маленьком городке посреди пустыни, предварительно ограбив банк и закопав добычу. Но залечь на дно в городе, которым правит клан помешанных на кофе невротиков, оказывается не так просто.','$1 000 000'),(11523,'Черная вдова',1987,98,0.0,6.5,588,'1987-02-06','https://st.kp.yandex.net/images/film_iphone/iphone360_11523.jpg','Black Widow','Сексуальность, изящество и красота позволяют Катрин легко завоевывать сердца богатых мужчин и выходить за них замуж, а тонкий холодный ум, изобретательность, изворотливость — убивать их, оставаясь безнаказанной. Прекрасная черная вдова не сомневается в своей безопасности, пока на ее след не выходит детектив Алекс Барнс.','Нет данных'),(11525,'Команда из штата Индиана',1986,114,0.0,6.9,936,'1986-11-10','https://st.kp.yandex.net/images/film_iphone/iphone360_11525.jpg','Hoosiers','Индиана, 1954 год. Тренер с независимым характером вместе с местным алкоголиком ведет школьную баскетбольную команду к первенству штата.','Нет данных'),(11526,'Техасская резня бензопилой 2',1986,100,0.0,4.8,3411,'1986-08-22','https://st.kp.yandex.net/images/film_iphone/iphone360_11526.jpg','The Texas Chainsaw Massacre 2','Двое подростков, колесящих по дорогам штата, звонят на радио и начинают прикалываться, но в этот момент их настигает всесокрушающая бензопила в руках Кожаного лица. Шокированная молодая ведущая слышит в эфире их крики, а позже к ней обращается шериф с просьбой помочь в поимке убийц.','$4 700 000'),(11528,'Мой научный проект',1985,94,0.0,5.7,162,'1985-08-09','https://st.kp.yandex.net/images/film/11528.jpg','My Science Project','Майкл Харлан — юный лоботряс, которому поручено сделать в школе научный доклад. И герой не находит ничего лучшего, как в поисках какой-нибудь диковины, способной стать темой его выступления, забраться на заброшенную свалку министерства обороны. Что ж, кто ищет, тот всегда найдет. Особенно, когда речь идет о неприятностях.<br><br>Майкл набредает на странную штуку, оказывающуюся… инопланетной машиной времени! Только идиоты в погонах могли выкинуть такое сокровище. И только такой незадачливый чудик, как Майкл, мог ненароком запустить этот фантастический агрегат. Перед ним и его однокашниками открывается настолько же заманчивая, насколько и опасная перспектива многочисленных приключений в коридорах времени…','Нет данных'),(11532,'Уик-энд Остермана',1983,103,0.0,6.1,491,'1983-10-21','https://st.kp.yandex.net/images/film_iphone/iphone360_11532.jpg','The Osterman Weekend','Четыре преуспевающих американских семейства — тележурналиста Джона Таннера, адвоката Ричарда Тримейна, финансиста Джо Кардоуна и голливудского сценариста Берни Остермана — иногда собираются вместе на уик-энды, приятно проводя время. Однажды перед одним из таких уик-эндов Таннера вызывают в Вашингтон, где сотрудник ЦРУ Лоуренс Фоссет сообщает ему, что те, кого он считал своими друзьями, а именно Тримейны, Кардоуны и Остерманы, являются членами советской агентурной группы «Омега». Фоссет принуждает журналиста принять участие в операции по разоблачению вражеских агентов, и для Таннера начинается самый кошмарный уик-энд.','Нет данных'),(11535,'Как гром среди ясного неба',1980,94,0.0,6.9,227,'1981-01-30','https://st.kp.yandex.net/images/film_iphone/iphone360_11535.jpg','Out of the Blue','История 16-летней девочки-сорванца по имени Сиби, чья мама проститутка, а отец отбывает 5 лет в тюрьме за то, что въехал на фуре в школьный автобус. Сиби слушает панк, курит травку и время от времени посещает школу. Однако, дело осложняется, когда «на свободу с чистой совестью» выходит её отец-алкоголик.','CAD 2 200 000'),(11538,'Гибель мадам Леман',1978,105,0.0,6.3,90,'1978-08-30','https://st.kp.yandex.net/images/film_iphone/iphone360_11538.jpg','L\'ordre et la sécurité du monde','Документы девушки, отправившейся на поезде в Цюрих, перепутали с документами другого пассажира, Лукаса Рихтера. Такое незначительное, на первый взгляд, событие вовлекает девушку в водоворот смертельно опасных событий, связанных с противостоянием двух могущественных держав…','Нет данных'),(11540,'Американский друг',1977,125,0.0,7.4,2015,'1977-05-26','https://st.kp.yandex.net/images/film_iphone/iphone360_11540.jpg','Der amerikanische Freund','Рамочник из Гамбурга Джонатан Циммерманн случайно знакомится с Томом Рипли, который торгует поддельными произведениями искусства, и связан с мафией. Судьба Циммерманна определена, когда он высокомерно отказывается пожать руку Рипли. Уязвленный Рипли, узнав, что у Циммерманна лейкемия, путем хитроумной комбинации убеждает его, что дни его сочтены. Сообщник Рипли предлагает Циммерману стать наемным убийцей, посулив за это большие деньги его семье, которая вскоре останется без кормильца. Джонатан, понимая, что обречен (медицинские анализы фальсифицируются), соглашается, и становится пешкой в большой игре Рипли…','DEM 3 000 000'),(11541,'Бешеный пес Морган',1976,102,0.0,5.9,107,'1976-07-09','https://st.kp.yandex.net/images/film_iphone/iphone360_11541.jpg','Mad Dog Morgan','Фильм о знаменитом австралийском разбойнике Дэниэле Моргане, промышлявшем в прошлом веке в провинции Виктория. За его голову было обещано крупное вознаграждение.<br><br>Но благородный разбойник пользовался симпатией у местного населения, что делало его неуловимым. Даже смерть Моргана стала вызовом властям.','Нет данных'),(11544,'Последний фильм',1971,108,0.0,5.9,177,'1971-08-29','https://st.kp.yandex.net/images/film_iphone/iphone360_11544.jpg','The Last Movie','После гибели актера на съемках в Перу один из членов съемочной группы решает уйти из профессии и жить в деревне. Вскоре он узнает, что ее жители начинают убивать друг друга, разыгрывая сцены убийств из фильма и не понимая, что суть кинематографа — обман.','Нет данных'),(11548,'Кровавая королева',1966,78,0.0,5.1,139,'1966-03-02','https://st.kp.yandex.net/images/film_iphone/iphone360_11548.jpg','Queen of Blood','Войдя в контакт с инопланетянами, группа ученых узнает об их скором прибытии на Землю. Однако в пути инопланетный корабль терпит крушение, и на место аварии отправляется спасательная экспедиция. Обнаружив выжившую инопланетянку, астронавты забирают её на борт, где вскоре находят обескровленное тело одного из членов команды.','Нет данных'),(11556,'Гигант',1956,201,0.0,7.5,2329,'1956-10-10','https://st.kp.yandex.net/images/film_iphone/iphone360_11556.jpg','Giant','Техасский фермер Бик Бенедикт отправляется в Мэрилэнд за призовым жеребцом. Там он встречает женщину своей мечты Лесли и женится на ней. Молодая пара возвращается на свое ранчо, где Лесли предстоит приспособиться к жизни в изменившихся условиях.<br><br>Новая хозяйка ранчо разбивает сердце Джетта Ринка, нефтяного магната. Разгорается, и без того острое, соперничество между двумя техасскими семьями.','$5 400 000'),(11559,'Уиллард',2003,100,0.0,6.3,2072,'2003-03-14','https://st.kp.yandex.net/images/film_iphone/iphone360_11559.jpg','Willard','Застенчивый молодой человек по имени Уиллард является объектом насмешек со стороны его коллег по работе. Он совершенно не приспособлен к жизни и не умеет налаживать взаимоотношения. Его единственными настоящими друзьями являются две крысы, Бен и Сократ, которые постоянно путешествуют с ним, и, пожалуй, новая симпатичная сотрудница офиса.<br><br>Личные и производственные неприятности приводят Уилларда на грань нервного срыва, а преднамеренное убийство Сократа, совершенное сотрудниками прямо на его рабочем месте, превращает его жизнь в сплошную жажду мести.<br><br>Уиллард внезапно обнаруживает, что при помощи оставшегося в живых Бена он может управлять легионами его злобных и прожорливых собратьев. По городу прокатывается волна странных и ужасных убийств.','$20 000 000'),(11564,'Лавина',1999,96,0.0,5.4,183,'1999-07-28','https://st.kp.yandex.net/images/film_iphone/iphone360_11564.jpg','Avalanche','Чудовищная снежная лавина, поглощая и уничтожая все на своем пути, обрушивается на замкнутый в кольце гор город. Разрушается мир, создававшийся многими поколениями, обрываются жизни, ломаются судьбы, снег окрашивается в цвет крови погребенных заживо людей.<br><br>При виде несущейся со скоростью локомотива бурлящей стены кажется, что на спасение нет ни одного шанса. И только отвага и мужество помогут героям фильма остаться вживых и вырваться из сковавшего город снежного плена…','Нет данных'),(11565,'Застенчивый пистолет',1998,100,0.0,5.7,100,'1998-03-06','https://st.kp.yandex.net/images/film_iphone/iphone360_11565.jpg','Gunshy','Нью-Йоркский журналист Джейк Бриджес при необычных обстоятельствах знакомится с мелким гангстером Фрэнки. Джейк соглашается стать «проводником» Фрэнки в мире большой литературы, а тот берется познакомить Джейка с изнанкой уличной жизни.','Нет данных'),(11566,'Посланник',1997,98,0.0,5.0,157,'1998-01-23','https://st.kp.yandex.net/images/film_iphone/iphone360_11566.jpg','The Sender','С раннего детства дочь офицера ВМФ Дагласа Грейсона дружила с Ангелом. Прекрасное инопланетное существо наделило ребенка даром телепортации и умением путешествовать в межпланетном пространстве.<br><br>Военные похищают девочку, чтобы использовать ее уникальные способности в своих целях, и для освобождения ребенка отцу приходится… призвать на помощь инопланетян. Впечатляющая развязка происходит в легендарной «зоне 51», где со всех секретов спадает покров тайны и некуда спрятаться от разгневанного отца и его инопланетных друзей.','Нет данных'),(11567,'Префонтейн',1997,106,0.0,7.7,3497,'1997-01-24','https://st.kp.yandex.net/images/film_iphone/iphone360_11567.jpg','Prefontaine','История драматической жизни легендарного Стива Префонтейна, спортсмена, которому не было равных на беговой дорожке. Для него не существовало нерушимых границ и недостижимых рекордов. Но солнце олимпийского золота жестоко к тем, кто подлетает к нему слишком близко.<br><br>На пути к победе Префонтейну пришлось пережить горечь поражений, способных остановить любого, но только не его. Великое и трагическое — две стороны золотой медали, и Стиву Префонтейну суждено было стать самой трагической великой звездой мирового спорта.','$8 000 000'),(11568,'Лучшие из лучших 3',1995,90,0.0,5.7,1397,'1995-05-17','https://st.kp.yandex.net/images/film_iphone/iphone360_11568.jpg','Best of the Best 3: No Turning Back','Тихая «заштатная» Индиана. 17-летний Оуэн возвращается домой после бурных, но безуспешных поисков работы. Его мать требует от сына денег, не желая вдаваться в запутанные перипетии его судьбы.<br><br>Но унизительная семейная жизнь для него хуже удавки. Он бежит от нее навстречу опасным приключениям, непредсказуемым ловушкам и попадает в неонацистский лагерь. А здесь без приемов каратэ любого ждет смерть.','Нет данных'),(11569,'Покидая Лас-Вегас',1995,112,0.0,7.5,14242,'1995-09-15','https://st.kp.yandex.net/images/film_iphone/iphone360_11569.jpg','Leaving Las Vegas','Если вся жизнь кажется кошмаром. Если затяжной запой окончательно разрушил карьеру в серьезной фирме. Может быть, есть смысл уничтожить все, что связывало тебя с прошлой жизнью и начать новую? В блестящем и грешном Лас-Вегасе.<br><br>Где среди блеска ночной жизни одинокая «ночная бабочка» может оказаться внимательнее и сердечнее любого психоаналитика. Потому что она захочет спасти несчастного пропойцу от него самого… Сможет ли эта странная любовь помочь обоим? Или — погубить обоих?','$4 000 000'),(11571,'Любовь – это оружие',1994,107,0.0,6.2,112,'1994-11-30','https://st.kp.yandex.net/images/film/11571.jpg','Love Is a Gun','Полицейский фотограф — должность не из самых приятных. Однако вовсе не из-за переживаний на работе (фотограф однажды взял пистолет и приставил себе к виску), а из-за того, что ввязался в любовную интрижку. Как бы узнать, кто ведет двойную (и двойную ли?) игру — жена или любовница?','Нет данных'),(11572,'Исполнение приказа',1994,97,0.0,5.1,94,'1994-02-17','https://st.kp.yandex.net/images/film_iphone/iphone360_11572.jpg','Chain of Command','Лихо закрученная политическая интрига грозит вылиться в крупную международную катастрофу. Любой ее участник — потенциальный мертвец. В числе втянутых в смертельный круговорот событий — бывший «зеленый берет» и сотруднк ЦРУ Меррилл Росс.<br><br>Он — настоящий герой, надежный и бескомпромиссный, но даже такие оказываются подставленными в игре, где настоящие «тузы» всегда остаются в тени.','Нет данных'),(11574,'Мальчишка',1990,91,0.0,6.7,117,'1990-11-02','https://st.kp.yandex.net/images/film_iphone/iphone360_11574.jpg','Kid','Молодой человек (Кид) возвращается в небольшой городок, где были убиты его родители, когда он ещё был мальчиком. Он существует для мести. Местные жители Кейт и Луи по-дружески относятся к его раздражению на некоторые слухи среди местных людей.','Нет данных'),(11575,'Перемена личности',1991,93,0.0,5.9,126,'1991-08-23','https://st.kp.yandex.net/images/film/11575.jpg','True Identity','Чернокожий актер Майлс Поуп случайно узнает страшную тайну босса мафии. Чтобы спастись от неминуемой гибели, он прибегает к помощи гениального визажиста, который превращает его в белого.<br><br>Вслед за сменой личности Майлс меняет и работу, устраиваясь киллером к тому же боссу, чьи люди преследуют его по пятам. Новоиспеченный наемный убийца сразу получает самое необычное задание в истории профессии — убить самого себя.','Нет данных'),(11576,'Глубокое погружение',1990,82,0.0,5.5,642,'1990-03-09','https://st.kp.yandex.net/images/film_iphone/iphone360_11576.jpg','The Rift','После того, как затонула подводная лодка «Сирена-1», на её поиски отправляется другая подлодка под названием «Сирена-2». Снарядиться в экспедицию на ней уговаривают проектировщика первой субмарины, Вика Хэйеса. Экипаж с большим трудом погружается в подводную расщелину, слегка поцарапав корпус, и вскоре сталкивается с тем, что на огромной глубине существует жизнь, причём жизнь вовсе недружелюбная. Вслед за серией погружений обнаруживаются плотоядные морские водоросли, а ещё чуть позже — масса зловредных и охочих до человеческой плоти организмов, которые стали результатом генетических экспериментов над животными на «Сирене-1»…','$1 300 000'),(11577,'Внутренний страх 2',1991,89,0.0,3.5,102,'1991-01-18','https://st.kp.yandex.net/images/film/11577.jpg','The Terror Within II','После чудовищной биологической катастрофы на Земле осталось очень мало людей. Да и те, кому удалось выжить, превратились в жутких мутантов… Герои фильма ведут ожесточенную борьбу за выживание. Для спасения им необходима вакцина, над созданием которой в горной лаборатории трудятся чудом выжившие ученые.','Нет данных'),(11579,'Флетч жив',1989,91,0.0,7.3,1966,'1989-03-17','https://st.kp.yandex.net/images/film_iphone/iphone360_11579.jpg','Fletch Lives','Журналист-хамелеон отправляется на запущенную плантацию, доставшуюся ему в наследство от родной тетушки. Флетч служит настоящим магнитом для всевозможных проблем. Сразу после прибытия новоиспеченного плантатора в новые владения начинаются неприятности.<br><br>Сначала отдает богу душу безобидный юрист, затем живущий по соседству адвокат советует репортеру уехать из городка, а обаятельная дамочка, торгующая недвижимостью, делает Флетчу предложение, от которого невозможно отказаться!<br><br>Проницательный Флетч начинает распутывать безумную головоломку местных интриг, прибегнув к помощи своего «убойного» арсенала потрясающих перевоплощений!','Нет данных'),(11580,'Осада базы «Глория»',1989,99,0.0,6.4,224,'1989-01-27','https://st.kp.yandex.net/images/film_iphone/iphone360_11580.jpg','The Siege of Firebase Gloria','Отряд Американских солдат патрулирует территорию и попадают на базу «Глория» в джунглях где царит полный разброд и брожение — командир базы в стельку пьяный, солдаты долбят дурь и постреливают по джунглям, командир отряда берет командование на себя, они с большими потерями отбивают мощную атаку гуков…','Нет данных'),(11581,'Парни из роты С',1978,125,0.0,6.9,220,'1978-02-02','https://st.kp.yandex.net/images/film_iphone/iphone360_11581.jpg','The Boys in Company C','Жизнь пяти американских морских пехотинцев, начиная с их тренировок в учебном лагере для новобранцев в 1967 году и заканчивая войной во Вьетнаме в 1968 году. Их жизни быстро превратились в адский кошмар. Внутренне сломленные из-за бессмысленной войны, напуганные беспринципностью союзника Южного Вьетнама и в постоянной опасности из-за собственного командира молодые люди нашли возможный выход из этой ситуации. Им сказали, что если они нарочно проиграют в футбол команде Южного Вьетнама, то они смогут провести остаток войны, играя показательные игры за линией фронта.','Нет данных'),(11582,'Хлеб и розы',2000,110,0.0,6.5,462,'2000-05-10','https://st.kp.yandex.net/images/film_iphone/iphone360_11582.jpg','Bread and Roses','Майя перебралась из Мексики в Лос-Анджелес к старшей сестре. Но по эту сторону границы нелегальную иммигрантку встретила отнюдь не сладкая жизнь. Вместе с сестрой она работает за копейки, каждый день, опасаясь высылки из страны.<br><br>Кажется, что страх и бесправие — неизменный фон их будущей жизни. Но девушки встречают Сэма Шапиро — молодого парня, который вовлекает их в борьбу за свои права. Неужели эти несправедливые порядки можно изменить?','Нет данных'),(11583,'Кислород',1999,92,0.0,6.8,936,'1999-11-12','https://st.kp.yandex.net/images/film_iphone/iphone360_11583.jpg','Oxygen','Похищена богатая светская дама. Её муж получает шокирующее послание: если в течение суток похитителю не будет выплачен щедрый выкуп, его жертва задохнется, похороненная заживо где-то в лесах штата Нью-Йорк.<br><br>Теперь только от решительности опытного следователя Мэдлайн Фостер зависит жизнь несчастной женщины, но успеет ли она добраться до маньяка, уготовившего своим преследователям чудовищный сюрприз?','Нет данных'),(11584,'Свадьба гробовщика',1997,89,0.0,6.4,246,'1998-02-10','https://st.kp.yandex.net/images/film_iphone/iphone360_11584.jpg','The Undertaker\'s Wedding','В небольшом городе, где воевали между собой две гангстерские группировки, всегда не хватало работы для гробовщика Марио. Но убийство зачинщика всех кровопролитий Рокко Стратичелла довела Марио до безработицы. Виной всему стала Мария Статичелла.<br><br>Она прикончила мужа, застукав его в постели с невестой гробовщика. Оставшемуся ни у дел Марио ничего не остается, как выяснить отношения с убийцей Марией…','Нет данных'),(11585,'Милый Джерси',1995,108,0.0,6.2,74,'1995-04-09','https://st.kp.yandex.net/images/film_iphone/iphone360_11585.jpg','Nothing to Lose','Рэй — продавец обуви, но мечтает о большем. Он хочет когда-нибудь открыть собственный магазин и жениться на бывшей однокласснице, в которую давно влюблен. Однажды Рэй принимает решение воплотить мечты в жизнь и, заняв крупную сумму денег, пытается сорвать большой куш в азартной игре…','Нет данных'),(11586,'Ангелы у кромки поля',1994,102,0.0,6.1,384,'1994-07-10','https://st.kp.yandex.net/images/film_iphone/iphone360_11586.jpg','Angels in the Outfield','Отец мальчика-подростка уезжает в неизвестном направлении, а на вопрос «Когда же мы будем жить семьей?» отвечает — «Когда твои Ангелы выиграют». «Ангелы» — это бейсбольная команда, за которую болел его сын. Мальчишка поверил в это и молился о победе своих кумиров, которые были не самой лучшей командой. И чудо произошло при помощи эксцентричного ангела Кристофера Ллойда.','$24 000 000'),(11587,'К чертям собачьим',1991,105,0.0,6.6,92,'1991-04-24','https://st.kp.yandex.net/images/film_iphone/iphone360_11587.jpg','The Boy Who Cried Bitch','Психически больной двенадцатилетний мальчик превращает жизнь своей семьи в кошмар…','Нет данных'),(11590,'Рыцари крестового похода',2001,147,0.0,5.5,91,'2001-04-06','https://st.kp.yandex.net/images/film_iphone/iphone360_11590.jpg','I cavalieri che fecero l\'impresa','1271 год. Несколько «рыцарей» различных сословий объединились в поездке в Грецию, чтобы вернуть Священный Саван Христа (Туринская плащаница) и передать его и в руки короля Франции.','Нет данных'),(11593,'Абсолютная реальность',1997,100,0.0,5.2,122,'1997-04-04','https://st.kp.yandex.net/images/film/11593.jpg','Total Reality','Из далёкого будущего в 1998 год отправляются предводители повстанческой армии, чтобы ликвидировать нечистоплотного политика, действия которого угрожают вселенской катастрофой…','Нет данных'),(11595,'Синдром Стендаля',1996,120,0.0,6.5,1390,'1996-01-26','https://st.kp.yandex.net/images/film_iphone/iphone360_11595.jpg','La sindrome di Stendhal','«Синдром Стендаля» — это специфическая особенность психики, когда человек очень остро воспринимает картины, как бы переносясь в изображенную на холсте реальность. Граница между реальностью и фантазией для таких людей стирается.<br><br>Главная героиня Анна становится жертвой маньяка, и это событие наносит непоправимый урон ее психике. Даже после того, как она расправляется с убийцей, ей кажется, что он всё ещё жив и преследует её. В доказательство её теории появляются всё новые трупы…','$3 800 000'),(11596,'Шагая в темноте',1995,105,0.0,6.8,99,'1996-04-27','https://st.kp.yandex.net/images/film/11596.jpg','Marciando nel buio','Главному герою фильма, Саро, молодому парню из Албании, всего 20 лет, и он поступает на военную службу в военно-воздушные силы Италии. Там он узнает, что многие военнослужащие занимаются проституцией, чтобы заработать денег. Его сержант — гомосексуалист, по вечерам после службы приторговывающий своим телом на плешке. Сержант влюбляется в Саро. Молодые люди рады быть вместе, но однажды капитан подразделения насилует парня. Саро после некоторых колебаний возбуждает против него дело, но капитан уверен в том, что Саро не сможет ничего доказать и считает, что выйдет сухим из воды, ведь на его стороне все армейские власти, которые не хотят раздувать скандал…','Нет данных'),(11600,'Королева Марго',1994,159,0.0,7.6,4774,'1994-05-13','https://st.kp.yandex.net/images/film_iphone/iphone360_11600.jpg','La Reine Margot','Август 1572 года. Францию раздирает религиозная война. Чтобы восстановить мир в стране, прекрасная и гордая принцесса Марго, сестра католического короля Карла IX, должна выйти замуж за протестанта Генриха Наваррского. А после свадьбы произошла кровавая резня Варфоломеевской ночи, организованная жестокой и коварной Екатериной Медичи. <br><br>Погибли тысячи протестантов, а один из них, тяжело раненный дворянин по имени Ла Моль, в отчаянной попытке спасти свою жизнь постучался в дверь Марго.','DEM 42 000 000'),(11603,'Сталинград',1992,134,0.0,7.5,7297,'1993-01-21','https://st.kp.yandex.net/images/film_iphone/iphone360_11603.jpg','Stalingrad','Зима 1942 года. Шестая армия вермахта сражается в разрушенном до основания Сталинграде. Взвод элитных немецких солдат, в первой же битве потерявший больше половины личного состава, ведет отчаянную борьбу за выживание.<br><br>Свист пуль и рев «катюш», голод и холод доводят их до грани безумия. Уже почти ничего не удерживает солдат на тонкой линии между жизнью и смертью. После всего, что они видели, после утраты всех идеалов призыв фюрера «стоять до конца» приобретает для них совсем другое, гораздо более страшное значение…','DEM 20 000 000'),(11613,'Марлен Дитрих: Белокурая бестия',2001,100,0.0,7.7,89,'2001-12-27','https://st.kp.yandex.net/images/film_iphone/iphone360_11613.jpg','Marlene Dietrich: Her Own Song','Почему Марлен Дитрих променяла блеск Голливуда на окопы Второй Мировой войны? Что стояло за ее решением спеть перед союзниками нацистский шлягер «Лили Марлен»?<br><br>Внук Марлен Дитрих, Дэвид Рива с помощью ранее не публиковавшихся материалов семейного архива приоткрывает любовные, актерские и политические тайны Марлен Дитрих.','Нет данных'),(11614,'Месть',2002,100,0.0,5.8,161,'2002-09-30','https://st.kp.yandex.net/images/film_iphone/iphone360_11614.jpg','Zemsta','Пан Раптусевич и стряпчий Мильчек давно находятся в состоянии полувражды, а племянница Раптусевича Клара и сын Мильчека Вацлав любят друг друга и мечтают пожениться. Тут-то и появляется Иосиф Папкин, готовый на все, лишь бы доказать свою полезность!','PLN 6 700 000'),(11616,'Коварство славы',1994,92,0.0,6.6,213,'1994-05-18','https://st.kp.yandex.net/images/film_iphone/iphone360_11616.jpg','Grosse fatigue','Легко ли жить, имея двойника? Это может не только облегчить тебе жизнь, но и окончательно разрушить привычный мир, тем более, если двойник присвоит себе и Вашу жизнь, и Ваше имя…','Нет данных'),(11617,'Простая формальность',1993,107,0.0,7.8,7234,'1994-05-15','https://st.kp.yandex.net/images/film_iphone/iphone360_11617.jpg','Una pura formalità','Той ночью разразилась страшная гроза. Пытаясь спрятаться, он бежал по улицам, не зная куда, как вдруг путь ему преградили трое. Вскоре он был арестован. За что? В чем его преступление?','Нет данных'),(11619,'Жилец',1976,126,0.0,7.8,11965,'1976-05-24','https://st.kp.yandex.net/images/film_iphone/iphone360_11619.jpg','Le locataire','Скромный конторский служащий Трелковский решает сменить место проживания и переехать на новое место. Он снимает квартиру в обветшалом здании с недружелюбными соседями. От консьержки он узнает, что предыдущая квартирантка, Симона, покончила с собой, выбросившись из окна. Со временем Трелковский начинает всё больше и больше думать о ней, стараясь узнать как можно больше подробностей. Вскоре он начинает винить соседей в её гибели.','Нет данных'),(11621,'Что?',1972,112,0.0,6.3,1293,'1972-12-07','https://st.kp.yandex.net/images/film_iphone/iphone360_11621.jpg','Che?','Наивность и впечатлительность американских туристов давно сделала их героями анекдотов в большинстве стран Европы. Хорошенькая любопытная американка, путешествующая по всему миру, добирается до Италии.<br><br>Страсть к приключениям доводит ее до того, что она, без вещей и документов, находит ночлег в роскошном пансионате на берегу Средиземного моря. Здесь никого не удивляет необычная гостья — все заняты своими делами и решением каких-то абсурдных проблем.<br><br>Роковой стареющий красавец Алекс проявляет заботу о девушке, что прибавляет немало откровенных страниц в ее дневнике. Но никак не ясности обо всем происходящем!','Нет данных'),(11622,'Бал вампиров',1967,108,0.0,7.6,8668,'1967-11-13','https://st.kp.yandex.net/images/film_iphone/iphone360_11622.jpg','Dance of the Vampires','Профессор Абронзиус и его неопытный ассистент Альфред отправляются в Трансильванию охотиться на вампиров. Они останавливаются на постоялом дворе в заснеженных Карпатах, и Альфред знакомится с дочерью хозяина — прекрасной Сарой. Это знакомство было недолгим: коварный вампир похищает рыжеволосую красавицу и уносит её в свой мрачный замок в горах.','$2 000 000'),(11623,'Толстый и худой',1961,15,0.0,6.4,454,'1967-10-27','https://st.kp.yandex.net/images/film_iphone/iphone360_11623.jpg','Le gros et le maigre','История взаимоотношений хозяина (Толстый) и слуги (Худой). Чередуя наказания и поблажки, хозяин удерживает слугу от мыслей о бегстве в город, виднеющийся вдали.','Нет данных'),(11624,'Самсон',1961,117,0.0,6.7,96,'1961-09-11','https://st.kp.yandex.net/images/film_iphone/iphone360_11624.jpg','Samson','Польша, 1930-е. Еврейский первокурсник Якуб Голд, явившись на первое занятие в политехническом институте, стал объектом издевательства студентов-антисемитов. При этом, от случайно брошенного камня погиб студент. В убийстве, естественно, обвинили еврея, и Якуб получил 10 лет заключения. Двери тюрьмы в 1939-м открыла война. После поражения Польши Голд попал в Варшавское гетто, где работал в погребальной команде, но вскоре бежал. В 1943 году, после начала восстания в гетто Якуб отправился туда, чтобы разделить общую еврейскую судьбу. По дороге он был избит и попал в подпольную группу. История юноши всё время перекликается с историей библейского Самсона: как и богатыря, юношу удерживают от решительных действий женщины. Момент истины для героя фильма наступил, когда группа гитлеровцев ворвалась в помещение явки подпольщиков…','Нет данных'),(11625,'До свидания, до завтра',1959,91,0.0,6.8,68,'1960-05-25','https://st.kp.yandex.net/images/film_iphone/iphone360_11625.jpg','Do widzenia do jutra...','Актёр гданьского студенческого театра «Тик-Так» Яцек случайно знакомится с Маргерит, красивой дочкой французского консула, и влюбляется в неё. Девушка бывает в Польше только на каникулах и во время праздников. Яцек знакомит свою возлюбленную с Гданьском и с актёрами молодежного театра. Встречи Маргерит и Яцека полны нежности и романтики, но вскоре молодые люди понимают, что им, людям из разных социальных систем, вряд ли суждено быть вместе.','Нет данных'),(11626,'Невинные чародеи',1960,87,0.0,7.4,245,'1960-12-17','https://st.kp.yandex.net/images/film_iphone/iphone360_11626.jpg','Niewinni czarodzieje','Молодой доктор работает в боксёрском клубе, отдавая свободные вечера игре в джазовом оркестре. После выступления он вместе с другом идёт в кафе, где тот хочет познакомиться с понравившейся ему незнакомкой. Помогая приятелю, доктор первым знакомится с девушкой и приглашает её к себе домой. Там они представляются друг другу вымышленными именами Базиля и Пелагеи. По обоюдному договору, они намерены провести вечер по готовому сценарию: немного алкоголя, первый поцелуй, недолгая интеллектуальная беседа и общая постель. Начатая ими циничная игра постепенно переходит в искреннее романтичное чувство…','Нет данных'),(11627,'Косоглазое счастье',1959,115,0.0,7.1,323,'1960-04-04','https://st.kp.yandex.net/images/film_iphone/iphone360_11627.jpg','Zezowate szczescie','Сатирическая комедия с элементами драматического и философского повествования о неудачливом приспособленце (судьба которого прослеживается на протяжении 20 лет), который стремится любой ценой понравиться и угодить сменяющим друг друга властям. По разным причинам ему это не удается…','Нет данных'),(11629,'Лётна',1959,90,0.0,6.6,131,'1959-09-27','https://st.kp.yandex.net/images/film/11629.jpg','Lotna','Элегическая картина о последних уланах польской армии в сентябре 1939 г. Лётна («Летучая») — имя белой лошади, из-за которой среди улан идет соперничество. Каждый очередной владелец ее погибает, но тем не менее следующий претендент на нее с нетерпением ждет смерти предшественника, чтобы самому иметь возможность быть ее хозяином и «лететь» на ней навстречу немецким танкам.','Нет данных'),(11630,'Двое со шкафом',1958,15,0.0,6.8,646,'1959-06-01','https://st.kp.yandex.net/images/film_iphone/iphone360_11630.jpg','Dwaj ludzie z szafa','Двое мужчин выходят из моря на пляж, таща при этом здоровенный шкаф. Войдя в город, они понимают, что не только не могут пристроиться вместе со своим деревянным попутчиком, но горожане даже избегают их и гонят.','Нет данных'),(11634,'Поколение',1954,91,0.0,6.7,307,'1955-01-26','https://st.kp.yandex.net/images/film_iphone/iphone360_11634.jpg','Pokolenie','Фильм повествует о самом начале восстания в польской столице, на фоне начавшейся трагедии варшавского гетто. Об антифашистском сопротивлении, о молодых варшавских подпольщиках…','Нет данных'),(11638,'Пираты',1986,121,0.0,6.9,2209,'1986-05-08','https://st.kp.yandex.net/images/film_iphone/iphone360_11638.jpg','Pirates','Два пирата: старый морской волк Рэд и юнга Жан-Батист по прозвищу Лягушонок оказались на плоту посреди океана. Их подбирает испанский корабль, на борту которого находится сокровище — золотой трон вождя. Пираты не могут упустить редкий случай разбогатеть, и конечно же, подбивают команду к бунту.<br><br>Не обошлось и без любви: молодой Жан-Батист влюбляется в случайно оказавшуюся на борту племянницу испанского губернатора.','$40 000 000'),(11639,'Тэсс',1979,186,0.0,7.3,3101,'1979-10-25','https://st.kp.yandex.net/images/film_iphone/iphone360_11639.jpg','Tess','Юная красавица-крестьянка Тэсс неожиданно узнаёт, что в её жилах течёт благородная кровь норманнских рыцарей. По воле родителей девушка уезжает жить к новообретённым состоятельным родственникам. Там она сталкивается с обольстительным кузеном Алеком, который не прочь воспользоваться невинностью Тэсс.','$12 000 000'),(11640,'Макбет',1971,140,0.0,7.7,1636,'1971-12-01','https://st.kp.yandex.net/images/film_iphone/iphone360_11640.jpg','The Tragedy of Macbeth','История о безжалостном шотландском лорде, который решил занять трон при помощи интрижек жены и трех ведьм.','Нет данных'),(11641,'Самые прекрасные мошенничества в мире',1964,108,0.0,6.2,205,'1964-08-14','https://st.kp.yandex.net/images/film_iphone/iphone360_11641.jpg','Les plus belles escroqueries du monde','Фильм состоит из нескольких сегментов, каждый из которых снимала определённая съёмочная группа. В центре каждой истории случай некой аферы/махинации. Действие всех историй развивается в разных городах — в Париже, Амстердаме, Токио, Неаполе.','Нет данных'),(11642,'Млекопитающие',1962,10,0.0,5.7,408,'1966-06-06','https://st.kp.yandex.net/images/film/11642.jpg','Ssaki','Два человека по очереди везут друг друга на санках. При этом они постоянно прибегают к разным хитростям, чтобы заставить товарища тащить себя, например, изображают травмы. Увлекшись этим, они теряют санки и это «горе» заставляет их примириться. Однако ненадолго: вскоре один из них вновь начинает притворяться больным и залезает на спину попутчику. Все начинается сначала.','Нет данных'),(11643,'Нож в воде',1962,94,0.0,7.5,3784,'1962-03-09','https://st.kp.yandex.net/images/film_iphone/iphone360_11643.jpg','Nóz w wodzie','Обеспеченная пара из Варшавы — Анджей и Кристина — по дороге на Мазурские озера, где они собираются провести уик-энд, подбирают молодого автостопщика. Хозяин яхты приглашает его провести с ними день на озерах. Анджей пытается использовать любую возможность и любой предлог, чтобы показать свое превосходство, опыт, зрелость. Напряжение нарастает, доходит до физического столкновения.','Нет данных'),(11644,'Лампа',1959,8,0.0,5.9,491,'2007-09-19','https://st.kp.yandex.net/images/film/11644.jpg','Lampa','Кукольный мастер заменяет старую лампу на электрическое освещение. В ту же ночь кукольная мастерская сгорает в результате короткого замыкания.','Нет данных'),(11656,'Что-то должно случиться',1962,37,0.0,7.5,908,'2001-06-01','https://st.kp.yandex.net/images/film/11656.jpg','Something\'s Got to Give','Спустя почти 5 лет после своего исчезновения в дом к Нику Ардену возвращается его жена. Ник к тому времени женился и расчитывал получить страховку, но случилось неожиданное…','Нет данных'),(11657,'Принц и танцовщица',1957,115,0.0,7.2,2494,'1957-06-13','https://st.kp.yandex.net/images/film_iphone/iphone360_11657.jpg','The Prince and the Showgirl','Начало прошлого века, Лондон. На коронацию нового короля прибыли многочисленные гости, среди них принц-регент королевства Карпатия Чарльз. Чтобы развлечься, он инкогнито посещает кабаре «Коконатс», где за кулисами знакомится с хорошенькими хористками. Одна из них, Элси, хотя и не обучена хорошим манерам, но может многому научить высокомерного принца…','Нет данных'),(11658,'Автобусная остановка',1956,96,0.0,6.9,1576,'1956-08-31','https://st.kp.yandex.net/images/film_iphone/iphone360_11658.jpg','Bus Stop','В кафе «Синий Дракон» разбитной ковбой Бо, приехавший в город участвовать в родео, решительно и грубо требует от героини фильма внимания и благосклонности. Шери даже вынуждена сесть на автобус, чтобы бежать из города, но Бо отправляется следом.<br><br>Автобус заносит снегом и пассажиры вынуждены провести ночь в кафе, где происходит драка между водителем автобуса, защищающим пассажирку, и ковбоем, преследующим эту женщину. Бо терпит постыдное поражение, он унижен. На следующий день, когда буря закончилась, Бо начинает понимать, что ничего не добьется, если будет действовать как скотина.','$2 200 000'),(11659,'Нет такого бизнеса, как шоу-бизнес',1954,117,0.0,6.6,757,'1954-12-16','https://st.kp.yandex.net/images/film_iphone/iphone360_11659.jpg','There\'s No Business Like Show Business','Супружеская чета Терри и Молли Донахью с успехом выступала в мюзикле и воспитывала сыновей Стива, Тима и очаровательную дочку Кэтти. И все шло гладко, пока любимые чада не «подкинули» родителям неожиданные сюрпризы! Стив засобирался в священники, Кэтти заболела мечтами о замужестве, а Тим встретил настоящую любовь — Викторию — начинающую певицу, мечтающую о профессиональной сцене. Однако сердца Виктории оказалось не так-то легко добиться. Но не было бы счастья, да несчастье помогло…','Нет данных'),(11660,'Река не течет вспять',1954,91,0.0,6.9,1215,'1954-04-29','https://st.kp.yandex.net/images/film_iphone/iphone360_11660.jpg','River of No Return','Мэтт Колдер, возвратившись из тюрьмы, где он отсидел за убийство одного негодяя, находит своего шестилетнего сына Марка в лагере американских переселенцев «дикого запада», где его приютила певица местного кабаре Кей. Мэтт забирает сына в свой новый дом у излучины горной реки, и решает начать новую жизнь среди бескрайних просторов северной Америки.<br><br>В это время Гарри, нечистый на руку дружок Кей, выигрывает в карты золотоносный участок в Консел Сити и предлагает девушке бросить все и умчаться с ним на плоту по реке, чтобы как можно быстрее застолбить золотую жилу, которую он получил обманом. Бурные воды горной реки вынуждают парочку сделать остановку рядом с хижиной Мэтта и сына. Гарри, узнав от фермера, что река небезопасна своими бурными порогами и водопадами, решает украсть лошадь и ружье у Мэтта. Кей принимает решение остаться с фермером и ждать, когда вернется Гарри. Не прошло и дня, как на оставшихся в доме у реки нападает племя индейцев и сжигает их дом.<br><br>Мэтт с сыном и Кей успевают уплыть от разъяренных апачей на плоту. Им предстоит нелегкий путь вниз по реке, через пороги и непроходимые леса, кишащие дикими животными, а на их след уже вышли кровожадные индейцы…','Нет данных'),(11661,'Как выйти замуж за миллионера',1953,95,0.0,7.7,7913,'1953-11-04','https://st.kp.yandex.net/images/film_iphone/iphone360_11661.jpg','How to Marry a Millionaire','Нью-Йорк слезам не верит. Традиционная ситуация: три модели ищут мужей-миллионеров. Для осуществления своих планов девушки снимают шикарную квартиру в элитном районе и начинают осуществлять задуманное. Проходят три месяца — из квартиры продана последняя мебель, а на горизонте — ни одной подходящей партии. К финалу картины страсти накаляются, у двух подруг возникает дилемма: деньги или любовь? Лишь у третьей, на первый взгляд, все складывается хорошо. Но это лишь — на первый взгляд.','Нет данных'),(11662,'Джентльмены предпочитают блондинок',1953,91,0.0,7.8,13474,'1953-07-01','https://st.kp.yandex.net/images/film_iphone/iphone360_11662.jpg','Gentlemen Prefer Blondes','Шоу-герлз Лорелей и Дороти отправляются на гастроли в Париж. За ними тайно следит частный детектив, нанятый отцом миллионером, чтобы доказать сыну, что Лорелей любит его подарки.','Нет данных'),(11663,'Ниагара',1952,92,0.0,7.2,3074,'1953-01-21','https://st.kp.yandex.net/images/film_iphone/iphone360_11663.jpg','Niagara','Молодожёны Полли и Рэй Катлеры приезжают в коттедж возле водопада и знакомятся с ещё одной супружеской парой, Джорджем и Роуз Лумисами.<br><br>Роуз с самого начала всем доверительно сообщает, что её муж значительно старше её, что его мучает депрессия и его только что выпустили из психиатрической лечебницы.<br><br>Позже Полли видит, как Роуз целуется с молодым человеком, и узнаёт, что парочка собирается убить Джорджа…','$1 250 000'),(11664,'Вождь краснокожих и другие',1952,117,0.0,7.7,632,'1952-08-07','https://st.kp.yandex.net/images/film_iphone/iphone360_11664.jpg','O. Henry\'s Full House','Фильм создан по пяти новеллам великого американского писателя сатирика О. Генри. В картине экранизированы рассказы, написанные в период с 1902 по 1910 год: «Фараон и хорал», «Трубный Глас», «Последний Лист», «Вождь краснокожих», «Дары волхвов».','Нет данных'),(11665,'Можешь не стучать',1952,76,0.0,7.2,1211,'1952-07-18','https://st.kp.yandex.net/images/film_iphone/iphone360_11665.jpg','Don\'t Bother to Knock','Героиня входит в нью-йоркский отель в качестве сиделки, вызванной приглядеть за ребенком. А вообще-то ее только что выпустили из психиатрической больницы, куда она попала после того, как узнала, что ее любимый погиб…','Нет данных'),(11666,'Мы не женаты',1952,86,0.0,7.2,740,'1952-07-11','https://st.kp.yandex.net/images/film_iphone/iphone360_11666.jpg','We\'re Not Married!','Юридическая ошибка объединила в комедийный сюжет пять супружеских пар. Их брачные контракты не зарегистрированы документально и по своей сути они жили в браке тридцать месяцев неофициально.<br><br>Каждая из пар по-своему отреагировала на правительственное письмо, известившее их о том, что они не женаты.','Нет данных'),(11668,'Давай сделаем это легально',1951,77,0.0,7.2,558,'1951-10-31','https://st.kp.yandex.net/images/film_iphone/iphone360_11668.jpg','Let\'s Make It Legal','После 20 лет супружеской жизни Мириам и Хью Халсоуорт решают поставить жирную точку на их браке. Окончательно развод должен вступить в силу в полночь. Но как раз днем, накануне этого знаменательного события, в городе появляется Виктор МакФэрланд, бывший ухажер Мириам, готовый вновь вступить в бой за сердце давней возлюбленной…','Нет данных'),(11669,'Любовное гнездышко',1951,84,0.0,6.9,506,'1951-10-10','https://st.kp.yandex.net/images/film_iphone/iphone360_11669.jpg','Love Nest','Вернувшись из армии к любимой жене, журналист и писатель Джим Скотт обнаружил, что жена решила приобрести полуподвальное помещение, чтобы создать в нем уютное «любовное гнездышко». Но все оказывается не так просто!<br><br>На молодоженов сваливаются заботы и проблемы связанные с ремонтом внутреннего убранства бывшего подвала, который использовался для хранения угля.<br><br>Зато в новом доме молодых окружают очень милые соседи, а особенно хороша белокурая Роберта, которая охотно строит глазки Скотту. Тем временем пока идет благоустройство «гнездышка» Чарли Паперсон — профессиональный брачный аферист вовлекает всех жителей дома в свои аферы…','Нет данных'),(11670,'Моложе себя и не почувствуешь',1951,77,0.0,6.8,315,'1951-06-15','https://st.kp.yandex.net/images/film_iphone/iphone360_11670.jpg','As Young as You Feel','65-летний Джон Ходжес отправлен в отставку. Судьба складывается так, что позже он приезжает на свой старый завод с инспекцией. Президент Мак-Кинли, отправивший в отставку Ходжеса, нервничает так, что даже его красивая секретарша Гарриета не может успокоить его. Ситуация осложняется тем, что жена Мак-Кинли, Люсиль, увлечена Джоном Ходжесом…','Нет данных'),(11671,'В родном городе',1951,61,0.0,5.9,200,'1951-05-18','https://st.kp.yandex.net/images/film_iphone/iphone360_11671.jpg','Home Town Story','Блейк Уомборн проиграл сенатские выборы сыну владельца местной фабрики МакФарленда. А через некоторое время произошла трагедия: сестра Блейка провалилась в заброшенную шахту. Спасение девочки, в котором не последнюю роль сыграл МакФарленд, помогло Блейку излечиться от обиды.','Нет данных'),(11673,'Билет в Томагавк',1950,90,0.0,6.9,153,'1950-04-18','https://st.kp.yandex.net/images/film_iphone/iphone360_11673.jpg','A Ticket to Tomahawk','1876 год. Доусон хочет задержать поезд, следующий в Томагавк, штат Колорадо, чтобы не позволить ему обогнать его дилижанс. Среди пассажиров поезда Джонни, отвечающий за то, чтобы поездка прошла успешно и была завершена вовремя. Также в поезде едут актрисы, девушки-певицы из группы мадам Аделаиды…','Нет данных'),(11674,'Леди из кордебалета',1948,61,0.0,7.3,408,'1948-12-30','https://st.kp.yandex.net/images/film_iphone/iphone360_11674.jpg','Ladies of the Chorus','Мюзикл Леди из кордебалета — это романтическая лента о любви юной принцессы бурлеска Пегги Мартин, которая выступает в шоу вместе со своей матерью. Восходящая звезда шоу приобретает фантастическую популярность и завоевывает сердца зрителей. <br /><br />Однажды, посмотрев выступление Пегги, в нее влюбляется Рэнди Кэрролл — приятный, элегантный молодой человек из уважаемой семьи. Он покоряет Пегги и полон желания на ней жениться. Однако, когда девушка решает познакомить Рэнди со своей матерью, которая всячески пытается контролировать жизнь дочери и просто не может не быть в курсе ее любовных переживаний, Рэнди понимает, что все не так просто. Зрелая, но привлекательная Мэй — мать Пегги — делится с Рэнди своей историей любви. Когда-то ей также сделали предложение, однако родители жениха перестали быть благосколонными к Мэй после того, как узнали, что она — королева бурлеска, танцовщица и певица, девушка, чья работа не вызывала уважения в высших слоях общества. <br /><br />Смотря на вещи практично и без излишних иллюзий, Мэй убеждена, что мир не изменился с тех пор, и ее дочери не удастся жить как-то иначе. Впрочем, она очень хорошо относится к Рэнди и не собирается препятствовать свадьбе, если Рэнди сразу скажет своей семье, кто такая Пегги Мартин. Удастся ли молодому человеку убедить Мэй в том, что у ее дочери счастливое будущее?','Нет данных'),(11678,'Мэрилин Монро: За пределами легенды',1987,60,0.0,7.1,86,'2000-03-25','https://st.kp.yandex.net/images/film/11678.jpg','Marilyn Monroe: Beyond the Legend','«Одна из самых известных звезд Голливуда умерла в возрасте 36 лет… Мэрилин Монро найдена мертвой…» Эти образы напоминают о темной стороне ее жизни: порочные связи, падения, одинокая смерть. Но была и другая сторона, которая открывает нам совсем иную женщину. Ее звали Мэрилин Монро. Ее жизнь стала легендой.','Нет данных'),(11686,'Кодекс силы',1997,97,0.0,5.7,97,'1997-03-30','https://st.kp.yandex.net/images/film_iphone/iphone360_11686.jpg','Hardball','Спецагент по поимке беглецов перешел дорогу боссам местной мафии, и они заказали его убийство. Опаснейшие столкновения, преследования, захват заложников, множество взрывов, и в финале этой кровавой битвы только один останется в живых.','Нет данных'),(11687,'Мумия жива',1993,97,0.0,4.5,94,'1994-03-31','https://st.kp.yandex.net/images/film/11687.jpg','The Mummy Lives','Богатый эксцентричный любитель археологии лорд Макстой в пустыне Египта раскапывает могилу, которая оказывается последним пристанищем верховного жреца Азиру. В незапамятные времена он посмел влюбиться в священную наложницу бога Зота по имени Кия, и за это был похоронен заживо. Теперь Азиру возвращается к жизни и отправляется на поиски реинкарнации своей возлюбленной, попутно мстя археологам, считая их расхитителями гробниц. Вскоре люди вокруг лорда Макстоя начинают таинственным образом погибать…','Нет данных'),(11695,'Ничтожество',1985,110,0.0,6.6,356,'1985-05-11','https://st.kp.yandex.net/images/film_iphone/iphone360_11695.jpg','Insignificance','Действие фильма происходит в комнате нью-йоркского отеля жаркой ночью 1953 года. Встречаются знаменитости, имена которых не приводятся из юридических соображений, но легко угадываются.<br><br>Это белокурая киноактриса, очень похожая на Мерилин Монро, математик — вылитый Альберт Эйнштейн, сенатор Маккарти и знаменитый бейсболист — ревнивый и несчастный муж актрисы. Разгар холодной войны. Речь пойдет о теории относительности, о времени и пространстве, о бремени славы, одиночестве, человеческой глупости и подлости, ответственности создателей ядерной бомбы за свое детище.','Нет данных'),(11698,'Маленькая мисс Маркер',1980,103,0.0,7.4,238,'1980-03-21','https://st.kp.yandex.net/images/film_iphone/iphone360_11698.jpg','Little Miss Marker','Когда видавший виды букмекер получил в залог от игрока его маленькую дочь, он не мог даже подумать, что обаятельная девчушка способна в корне изменить его жизнь…','Нет данных'),(11701,'Маниту',1977,99,0.0,5.9,119,'1978-04-15','https://st.kp.yandex.net/images/film_iphone/iphone360_11701.jpg','The Manitou','Женщина обращается к врачам с просьбой о помощи: на ее спине стремительно растет странное опухолевидное образование, которое оказывается… человеческим зародышем. По ходу дела выясняется, что телом нашей героини решил воспользоваться для своего очередного возрождения некий древний и могущественный индейский шаман.','Нет данных'),(11703,'Секстет',1977,91,0.0,4.9,77,'1977-09-16','https://st.kp.yandex.net/images/film_iphone/iphone360_11703.jpg','Sextette','Свою первую брачную ночь единственная и неповторимая Марло должна провести в отеле, где проходили все ее предыдущие брачные ночи. Одновременно в отеле проходит международный саммит. Один из присутствующих, бывший муж актрисы Алексей, русский, готов подписать договор только в том случае, если Марло проведет ночь с ним. Судьба мира в ее руках.<br><br>Кассета, на которую Марло записывала свои откровения о бывших мужьях, теряется. Встретившись с Алексеем, Марло видит кассету в куске торта, заказанного русским. Она отказывается от торта, и Алексей выбрасывает его в окно. Торт съедает собачка, а кассету она несет на поле, где тренируется американская сборная, остановившаяся в отеле. Марло отправляется на поиски кассеты, грозящей мировой катастрофой.','Нет данных'),(11704,'Казанова и Компания',1977,104,0.0,4.2,100,'1977-03-01','https://st.kp.yandex.net/images/film_iphone/iphone360_11704.jpg','Casanova & Co.','Для заключения торгового договора в Венецию приезжает калиф Шираза с любимой женой, которая ставит условием сделки организацию ей рандеву со знаменитым дамским угодником Джакомо Казановой. В это же время томящийся в тюрьме Казанова совершает побег. Власти Венеции в панике — важный договор под угрозой срыва! Пользуясь суматохой сбегает из-под стражи и мелкий мошенник Джакомино, молодой двойник Казановы. И начинаются приключения. ..','Нет данных'),(11710,'Ты не сможешь победить их всех',1970,97,0.0,6.2,108,'1970-07-24','https://st.kp.yandex.net/images/film_iphone/iphone360_11710.jpg','You Can\'t Win \'Em All','В 1922 году, в Эгейском море встретились два крупных авантюриста — Эдам Дайер и Джош Кори. Надо заметить, что в это время и в Турции, и в Греции шли междуусобные войны. Вот и подрядились два веселых циника перевозить оружие для тех, кто больше заплатит. Двое бывших американских солдат Адам и Джош присоединяются к банде турецких наёмников, которые сопровождают трех дочерей местного правителя. Путешественники везут с собой золото, и об этом узнает злодей Элси. Побывав в переделках, выйдя из них хоть и без денег, но с сохраненными головами, Эдам и Джош вновь полны честолюбивых планов: на американском военном корабле они отправляются в Новый Свет.','Нет данных'),(11711,'Бросок в Монте-Карло',1969,125,0.0,6.6,183,'1969-05-28','https://st.kp.yandex.net/images/film_iphone/iphone360_11711.jpg','Monte Carlo or Bust!','Для участия в международном автопробеге гонщики съезжаются на север Шотландии, в Стокгольм, Афины, Рагузу и Лиссабон. Их задача — добраться до города Шамбери, а оттуда проделать путь до Монте-Карло и закончить автопробег гонкой по его улицам. Среди участников — Катберт Уэйр-Армитедж, узнавший после гибели своего отца, что ему досталась только половина акций унаследованного автомобильного завода. <br><br>Вторую же половину отец проиграл в карты американцу Честеру Скофилду. Чтобы вернуть акции, Уэйр-Армитедж предлагает Скофилду участвовать в автопробеге до Монте-Карло на разрабатываемых каждым автомобилях. Победитель получит все. В то же время из тюрьмы бежит Вилли Шикель — самый быстрый шофер преступного мира. Ему устраивают побег, чтобы он доставил в Монте-Карло драгоценности, спрятанные в одной из автопокрышек…','Нет данных'),(11713,'Не гони волну',1967,97,0.0,6.0,180,'1967-06-09','https://st.kp.yandex.net/images/film_iphone/iphone360_11713.jpg','Don\'t Make Waves','Легкомысленный турист Карло Коффилд путешествует по Южной Калифорнии. На шоссе он знакомится с красавицей Лаурой, которая приглашает его на свою виллу. Однако там Карло ждет небольшое разочарование: его новая знакомая уже встречается с местным богачом. На следующий день, едва не утонув в океане, незадачливый турист оказывается спасен ныряльщицей Малибу. Не долго думая, Карло принимает решение обосноваться на время в Калифорнии. Осталось только решить кто именно из девушек ранил его сердце: Лаура или Малибу?','Нет данных'),(11717,'Боинг-Боинг',1965,103,0.0,7.2,353,'1965-12-22','https://st.kp.yandex.net/images/film_iphone/iphone360_11717.jpg','Boeing, Boeing','Американский журналист Бернард Лоуренс работает в Париже и встречается одновременно с тремя стюардессами. Так как девушки работают на различных авиалиниях и каждая из них бывает дома раз в три дня, они не подозревают о неверности своего возлюбленного. Все идет хорошо до тех пор, пока у девушек не меняется расписание полетов, позволяющее бывать дома чаще. Кроме того, в Париж прибывает конкурент Бернарда Роберт Тростник.','Нет данных'),(11719,'Список Эдриана Мессенджера',1963,98,0.0,7.0,341,'1963-05-23','https://st.kp.yandex.net/images/film_iphone/iphone360_11719.jpg','The List of Adrian Messenger','Энтони Гетрин, британский полковник в отставке, получает от своего друга Адриана Мессенджера список из 10 имен с просьбой узнать их местонахождение. Когда самолет Мессенджера взрывается, Гетрин начинает наводить справки о лицах из списка и узнает, что у всех была сходная судьба, что убийца, мастер изменения внешности, для каждой жертвы полностью видоизменял себя. Все жертвы были военнопленными в Бирме во время Второй мировой войны и все знали, кто среди них был предателем.','$3 000 000'),(11721,'Тарас Бульба',1962,122,0.0,5.7,664,'1962-11-21','https://st.kp.yandex.net/images/film_iphone/iphone360_11721.jpg','Taras Bulba','Польский принц Григорий предал казаков, и объявил казацкие чубы вне закона. Полковник казачьих войск Тарас Бульба распустил на время свое войско, но не отказался от своей цели — сделать степи свободными. Двое сыновей у Тараса, Остап и Андрей. Он научил их стрелять и скакать верхом, пить и куролесить по-казацки. <br><br>А грамоте учиться отправил их в Киев, чтобы среди врагов узнали они, как думают и воюют поляки. Прилежно изучал Андрей чужую науку, был во всем достоин своего отца, пока однажды не встретился взором с молодой и прекрасной полячкой. Дочь градоначальника Наталья также милостиво посматривает на Андрея. Но разве могут они быть счастливы, если ее родня не считает казаков за людей, а его народ мечтает лишь о том, чтобы уничтожить поляков?..','$7 000 000'),(11722,'Великий самозванец',1960,113,0.0,7.1,213,'1960-12-22','https://st.kp.yandex.net/images/film_iphone/iphone360_11722.jpg','The Great Impostor','Получив самую высокую оценку на экзамене в школу офицеров, Фердинанд Демара не был принят из-за отсутствия диплома о среднем образовании. Ловкий мошенник с детства, он подделывает документы и начинает жить чужой жизнью.','Нет данных'),(11725,'Трапеция',1956,105,0.0,7.2,243,'1956-05-30','https://st.kp.yandex.net/images/film_iphone/iphone360_11725.jpg','Trapeze','Молодой человек приезжает в Париж учиться тройному сальто у одного из немногих акробатов, способных его исполнить. Вместе они начинают готовить номер. Но тут появляется акробатка, очаровавшая юношу, но полюбившая того, кто гораздо старше.','$4 000 000'),(11747,'Крест – накрест',1949,88,0.0,6.8,314,'1949-01-19','https://st.kp.yandex.net/images/film_iphone/iphone360_11747.jpg','Criss Cross','Через год после развода Стив Томпсон возвращается в Лос-Анджелес, надеясь начать с Анной все сначала. Кажется, и Анна не прочь вернуться к бывшему мужу, но ее нынешний дружок, гангстер Слим Данди, не собирается ее отпускать. Чтобы получить Анну, Стив готов на все, даже на то, чтобы самому стать гангстером — грабить и убивать.','Нет данных'),(11748,'Странная парочка 2',1998,97,0.0,7.5,588,'1998-04-10','https://st.kp.yandex.net/images/film_iphone/iphone360_11748.jpg','The Odd Couple II','Оскар и Феликс — полные противоположности: один может запросто надеть разные ботинки, другой — даже стрелки на брюках заглаживает по линейке. Раньше они сидели за одной партой, а теперь ходят по разным сторонам улицы.<br><br>Но все-таки им придеться снова встретиться, и даже стать настоящими родственниками. Ведь дочка одного собралась замуж за сына другого. А до места свадьбы — тысяча километров и одна машина на двоих…','Нет данных'),(11750,'Зигзаг неудачи',1996,88,0.0,5.8,108,'1996-04-12','https://st.kp.yandex.net/images/film_iphone/iphone360_11750.jpg','Getting Away with Murder','Добропорядочный профессор Джек Ламберт, узнает, что его сосед вовсе не милый старикан Миллер, а бывший нацистский преступник по кличке «Зверь», приговоренный латвийским судом к смертной казни. Возмущенный тем, что палач не просто разгуливает на свободе, но и спокойно уезжает в Эквадор, он берет правосудие в свои руки и накачивает из шприца выращиваемые фашистом яблочки…','Нет данных'),(11751,'Макароны',1985,105,0.0,7.0,162,'1985-10-24','https://st.kp.yandex.net/images/film_iphone/iphone360_11751.jpg','Maccheroni','В Неаполь приезжает бизнесмен из Америки и к нему неожиданно приходит старый друг, с которым они встречались сорок лет назад, когда герой освобождал Неаполь от фашистов. Во время войны у героя Лемонна был флирт с сестрой своего друга, Марией, и на протяжении всех этих лет она помнила его. Ее брат, чтобы поддержать сестру, на протяжении 40 лет писал за друга письма на английском.','Нет данных'),(11753,'Чествование',1980,121,0.0,7.9,370,'1980-12-15','https://st.kp.yandex.net/images/film_iphone/iphone360_11753.jpg','Tribute','Скотти Темплтон узнает, что смертельно болен. К нему приезжают бывшая жена Мэгги и сын Джад. Все по-разному реагируют на диагноз. Но важнее всего, как к этому отнесся сам Темплтон: он хочет уйти весело, так, как прожил всю жизнь. И действительно, так ли все ужасно?','$8 400 000'),(11754,'Китайский синдром',1979,122,0.0,7.3,1709,'1979-03-06','https://st.kp.yandex.net/images/film_iphone/iphone360_11754.jpg','The China Syndrome','Во время съемок телерепортажа на атомной электростанции происходит серьезная авария. Журналистам удается снять все происходившее в это время. Они всеми силами пытаются дать в эфир этот материал, однако на пути встают влиятельные люди, заинтересованные представить аварию всего лишь мелкими неполадками.','Нет данных'),(11758,'Спасите тигра',1973,100,0.0,7.0,277,'1973-02-14','https://st.kp.yandex.net/images/film_iphone/iphone360_11758.jpg','Save the Tiger','Владелец швейной фабрики, находясь на грани банкротства и не зная, как свести концы с концами, решает нанять «специалиста» по поджогам, который поможет получить страховку…','Нет данных'),(11759,'Война полов',1972,110,0.0,6.1,77,'1972-06-01','https://st.kp.yandex.net/images/film_iphone/iphone360_11759.jpg','The War Between Men and Women','Слепнущий художник и женщина знакомятся у офтальмолога. Он ворчун, не любит женщин, детей и собак, она прекрасно знает об этом — ведь она продаёт его книги. Он привык к одиночеству и даже предпочитал его, а у неё трое детей, собака, бывший муж. С этого всё и начинается…','Нет данных'),(11760,'Котч',1971,113,0.0,6.6,69,'1971-09-17','https://st.kp.yandex.net/images/film_iphone/iphone360_11760.jpg','Kotch','Уолтер Маттау играет пожилого вдовца Джозефа Котчера, живущего со своим сыном Джералдом, невесткой Уилмой и внуком Данканом. Теплые отношения Джозефа и внука ужасно нервируют Уилму. Она нанимает для сына няню, Эрику, и вынуждает мужа отправить Джозефа в дом для престарелых. Однако Котч отказывается, отправляется путешествовать и начинает помогать Эрике, которая вынуждена уйти с работы, так как узнает о своей беременности…','Нет данных'),(11761,'Апрельские безумства',1969,95,0.0,6.2,108,'1969-05-28','https://st.kp.yandex.net/images/film_iphone/iphone360_11761.jpg','The April Fools','Говард Брубейкер женат на Филлис, которая его совершено не любит. Кэтрин, красавица француженка, жена его босса Теда Гюнтера — ловеласа, который безразличен к своей очаровательной жене. На домашней вечеринке у Теда двое, по сути, одиноких людей, разочарованных в своих семейных отношениях случайно встречаются. Говард спонтанно предлагает Кэтрин угостить ее выпивкой, она неожиданно для себя и для него тоже, сразу соглашается. Они проводят весь остаток ночи вдвоем и понимают, что это их шанс изменить свою жизнь. Они договариваются оставить своих супругов и улететь вместе в Париж. Но хватит ли у них мужества так кардинально изменить свою жизнь?','Нет данных'),(11763,'Странная парочка',1967,105,0.0,7.6,1795,'1968-05-02','https://st.kp.yandex.net/images/film_iphone/iphone360_11763.jpg','The Odd Couple','Феликса Ангера выставила из дома жена. Бедняга думал покончить жизнь самоубийством, но пришел в дом холостяка Оскара Мэдисона, где по пятницам друзья всегда играли в покер. Опасаясь за друга, Оскар предложил Феликсу пожить у него, тот согласился.<br /><br />Дальнейшие события наглядно показывают, почему жена выгнала мужа после 12 лет совместной жизни, имея двух детей. Феликс превратил холостяцкую квартиру Оскара в музей, постоянно наводя чистоту и не разрешая сорить и наводить беспорядок, стал семейным тираном. Такой занудный чистюля и сварливый брюзга, что и мужская дружба не выдержала.','Нет данных'),(11764,'Как пришить свою женушку',1964,119,0.0,7.1,470,'1965-01-26','https://st.kp.yandex.net/images/film_iphone/iphone360_11764.jpg','How to Murder Your Wife','Художник-аниматор Стэнли Форд, автор популярных комиксов о суперагенте, не знает ни забот, ни печалей и вовсю наслаждается жизнью холостяка. Все приключения своего нарисованного героя, прежде чем перенести их на бумагу, он предварительно испытывает на себе. Захватывающие погони, перестрелки, любовные похождения, светские рауты. И вот после очередной вечеринки он просыпается женатым на итальянке, ни слова не понимающей по-английски. Привычная и во всех отношениях приятная жизнь Стэнли начинает рушиться. Вскоре у него в голове рождается сюжет очередного комикса под названием «Как пришить свою жёнушку».','Нет данных'),(11766,'Под деревом любви',1963,110,0.0,7.1,165,'1963-10-23','https://st.kp.yandex.net/images/film_iphone/iphone360_11766.jpg','Under the Yum Yum Tree','Фабула: История о молодой влюбленной паре, которая желает проверить свою совместимость характеров, живя вместе, но при этом имея только платонические отношения. Настоящим проверяющим их отношений становится домовладелец-бабник, который надеется совратить свою новую квартиросъемщицу…','Нет данных'),(11767,'Самый дурацкий корабль в армии',1960,99,0.0,6.4,137,'1960-12-25','https://st.kp.yandex.net/images/film_iphone/iphone360_11767.jpg','The Wackiest Ship in the Army','Бывший яхтсмен, а ныне лейтенант американской армии, поверив радужным обещаниям, отправляется командовать «Самым дурацким кораблем в армии» — грудой металлолома с командой матросов-недотеп. И уж конечно, ни капитан, ни команда не знают, что на их корабль возложена сверхсекретная миссия по спасению союзников, оказавшихся на японской территории…','Нет данных'),(11769,'Отчаянный ковбой',1958,92,0.0,6.8,104,'1958-01-07','https://st.kp.yandex.net/images/film_iphone/iphone360_11769.jpg','Cowboy','Эта история человека, Франка Харриса, чьи романтические мечты об образе жизни ковбоя развеяны, когда он сопровождает своего босса, Тома Риса, при перегоне рогатого скота.<br><br>Однако во время пути, Харрис обнаруживает, что трагедия, насилие и смерть — это часть жизни ковбоя. Если ты не стал ковбоем — ты не стал мужчиной.','Нет данных'),(11774,'Это должно случиться с вами',1954,86,0.0,7.2,169,'1954-01-15','https://st.kp.yandex.net/images/film_iphone/iphone360_11774.jpg','It Should Happen to You','Бедная девушка Глэдис приехала из глубинки в Нью-Йорк за славой. Во время прогулки по парку она знакомится с Питом, парнем-кинолюбителем. Вдруг Глэдис замечает пустой рекламный щит и начинает мечтать. Из последних накоплений она арендует этот щит для размещения своего имени. Это приводит к тому, что ее имя появляется еще в нескольких местах. В результате такой деятельности ее персоной начинают интересоваться телевизионщики. И тут наступает звездный час Глэдис — она становится знаменитостью. Сияющая в лучах славы Глэдис не замечает, как теряет своего любящего друга…','Нет данных'),(11778,'Потасовка в Панаме',1966,100,0.0,6.5,125,'1966-03-02','https://st.kp.yandex.net/images/film_iphone/iphone360_11778.jpg','Du rififi à Paname','Мсье Поль по прозвищу Паоло Алмаз — респектабельный владелец ночного клуба в центре французской столицы и один из самых знаменитых контрабандистов мира. Полициям разных стран никак не удается доказать причастность мсье Поля к самым громким преступлениям.<br><br>Под видом журналиста «Гарольд Трибьюн» в Париж прилетает специальный агент Американского Казначейства Томпсон с заданием войти в доверие к контрабандистам. Любовь к проститутке Лили — по «легенде» — и вызывает у сластолюбивого американца серьезные финансовые затруднения. К кому запутавшийся молодой иностранец может обратиться в чужой стране? Конечно, к мсье Полю, который всегда ищет перспективных и легко контролируемых людей для реализации своих масштабных проектов.<br><br>Транспортировка тридцати килограммов золота в Токио станет дебютом спецагента в -роли контрабандиста. Постепенно находчивый американец войдет в круг ближайших сподвижников Паоло. И когда начнется жестокая война мафиозных кланов, Томпсон должен будет сделать непростой выбор ипринять чью-то сторону.','Нет данных'),(11783,'Черная вдова',1954,95,0.0,6.7,127,'1954-10-27','https://st.kp.yandex.net/images/film_iphone/iphone360_11783.jpg','Black Widow','Нэнни, совсем еще юная девушка, приезжает в Нью-Йорк, чтобы добиться успеха, и становится жертвой убийства. В события оказываются втянутыми Лотти, актриса, вечно сующая свой нос в чужие дела; Питер, продюсер, и Брюс, детектив, ведущий расследование.','Нет данных'),(11789,'Красный свет',1949,83,0.0,5.4,80,'1949-09-30','https://st.kp.yandex.net/images/film_iphone/iphone360_11789.jpg','Red Light','Отбывающий срок за растрату во время работы в компании Torno Freight Co. Ник Черни получает шанс вернуться в под крыло Джонни Торно с помощью пастыря Джесс…','Нет данных'),(11794,'Ноктюрн',1946,87,0.0,5.5,87,'1946-11-09','https://st.kp.yandex.net/images/film_iphone/iphone360_11794.jpg','Nocturne','Полицейский детектив Джо Уорнер расследует убийство композитора Кейт Винсент. Улики указывают на самоубийство, ставшее в итоге официальной версией произошедшего…','Нет данных'),(11797,'Джонни Эйнджел',1945,79,0.0,5.4,89,'1945-10-25','https://st.kp.yandex.net/images/film_iphone/iphone360_11797.jpg','Johnny Angel','Джонни Эйнджел решает узнать, кто украл корабль с золотом и убил его капитана, отца Джонни. Во время поисков он встречает Полет, чей отец также стал жертвой бандитов.','Нет данных'),(11802,'Мужская сила',1941,104,0.0,6.8,93,'1941-08-09','https://st.kp.yandex.net/images/film_iphone/iphone360_11802.jpg','Manpower','Работник электростанции Джонни Маршалл помогает своему коллеге встретить дочь, выпущенную из тюрьмы. Ему достаточно взгляда, чтобы понять — эта женщина приносит только несчастья. Однако с Фэй знакомится его лучший друг Хэнк, который делает ей предложение, и попытка Джонни расстроить свадьбу проваливается. А когда Фэй признается ему в любви, он хочет самоустраниться — но поздно.','Нет данных'),(11804,'Каждое утро я умираю',1939,92,0.0,7.3,220,'1939-07-22','https://st.kp.yandex.net/images/film_iphone/iphone360_11804.jpg','Each Dawn I Die','Заключенный в тюрьму за убийство после написания статьи о коррупции, репортер Френк Росс уверен, что сможет доказать свою невиновность и выйти на свободу. Но не так работает система тюрьмы «Роки Пойнт».<br><br>Охрана жестока, работа на мельнице джута нескончаема, а силы, с которыми Росс боролся на свободе, намерены надолго удержать его за решеткой. Вера Френка поколебалась, и он начинает сдаваться…','Нет данных'),(11806,'Ты и я',1938,94,0.0,6.4,96,'1938-05-29','https://st.kp.yandex.net/images/film_iphone/iphone360_11806.jpg','You and Me','Джо, условно-досрочно выпущенный из тюрьмы, устраивается на работу в магазин мистера Морриса. Там он проявляет себя хорошим работником и знакомится с очаровательной Хелен. Вскоре они женятся, однако возлюбленная Джо, в отличие от него, не спешит делиться с мужем своим прошлым, скрывающим немало неприятных секретов. Когда она неожиданно бросает Джо, он, опечаленный и разъярённый, решает вновь сколотить банду и ограбить магазин…','Нет данных'),(11821,'Ночь за ночью',1932,73,0.0,6.5,92,'1932-10-29','https://st.kp.yandex.net/images/film_iphone/iphone360_11821.jpg','Night After Night','Когда-то Джо Антон был бедным третьесортным боксером. Потом стал рэкетиром. Теперь он богат и владеет ночным клубом в Нью-Йорке. У него есть девушка, верные товарищи и… опасные конкуренты. Но чего-то в его жизни не хватает. В один пустой и безликий вечер в ночном клубе Джо появляется прекрасная незнакомка. Она одинока и печальна. Что забыла она в этом злачном месте? И почему Джо не может выбросить ее из головы?','Нет данных'),(11830,'Такси!',1932,69,0.0,6.2,77,'1932-01-23','https://st.kp.yandex.net/images/film_iphone/iphone360_11830.jpg','Taxi!','Действие фильма рассказывает о временах войны, развязанной таксомоторными компаниями против независимых извозчиков. Сью остается одна, когда ее пожилого отца сажают в тюрьму за убийство водителя грузовика, который по наущению таксомоторной компании намеренно разбивает его такси. В тюрьме отец умирает, а Сью приглашают на собрание водителей, на котором Мэтт призывает друзей к активному сопротивлению…','Нет данных'),(11835,'Чужие деньги',1991,103,0.0,6.8,1173,'1991-10-18','https://st.kp.yandex.net/images/film_iphone/iphone360_11835.jpg','Other People\'s Money','Акула Уолл-стрита Лоуренс Гарфилд по прозвищу Ларри-Ликвидатор, известен благодаря тем компаниям, которые он развалил. Он занимается исключительно собственным обогащением за счет других. Его очередная цель — корпорация, которой владеет восьмидесятилетний патриарх Йоргенсон. Чтобы не дать противостоять коварному Гарфилду, старик нанимает не менее коварную юристку.','Нет данных'),(11836,'Старый гринго',1989,119,0.0,5.8,81,'1989-09-08','https://st.kp.yandex.net/images/film_iphone/iphone360_11836.jpg','Old Gringo','Мексика, 1913 год. Юная американка, приехавшая в Мексику в поисках приключений, влюбляется сразу в двух: в молодого генерала из армии Панчо Вильи и в известного американского писателя, приехавшего сюда умирать.','Нет данных'),(11838,'Морские волки: Последняя атака калькуттской легкой кавалерии',1980,120,0.0,6.2,114,'1980-07-03','https://st.kp.yandex.net/images/film_iphone/iphone360_11838.jpg','The Sea Wolves','У них было меньше всего шансов стать героями Второй мировой. Ведь они — убеленные сединами ветераны Калькуттской легкой кавалерии. Эти добровольцы не были в бою со времен Бурской войны. Но у них есть шанс изменить ситуацию, когда они отложат в сторону свои клюшки для гольфа и отставят стаканы с джином, чтобы стать «Морскими волками».','Нет данных'),(11839,'Мальчики из Бразилии',1978,123,0.0,6.5,490,'1978-10-04','https://st.kp.yandex.net/images/film_iphone/iphone360_11839.jpg','The Boys from Brazil','В джунглях Южной Америки нацистский преступник врач Йозеф Менгеле собирается создать при помощи клонирования целую армию. А клонировать он собирается не кого-нибудь, а самого Гитлера. Но для начала ему необходимо убить некоего Эзра Либермана, который известен как охотник за военными преступниками.','$12 000 000'),(11840,'МакАртур',1977,130,0.0,6.3,128,'1977-06-30','https://st.kp.yandex.net/images/film_iphone/iphone360_11840.jpg','MacArthur','История Генерала армии Дугласа МакАртура, Верховного командующего союзническими войсками во время Второй мировой войны, а таже Командующего войсками ООН во время корейской войны. Фильм начинается в 1942, после падения Филлипин, и охватывает всю замечательную карьеру МакАртура — военной легенды США, включая и дни принудительной отставки генерала президентом Труманом.','Нет данных'),(11841,'Омен',1976,111,0.0,7.7,29890,'1976-06-25','https://st.kp.yandex.net/images/film_iphone/iphone360_11841.jpg','The Omen','Он был рождён в 6 часов 6 июня. Как предсказано в Книге откровений, настанет конец света, последнее противостояние сил добра и зла, и началом его будет рождение сына Сатаны в облике человеческом.<br><br>У жены американского дипломата Роберта Торна рождается мёртвый ребенок, но мужчина неспособен сообщить ей трагическую новость, поэтому усыновляет младенца с родимым пятном в виде трёх шестерок. Когда мальчик подрастает, вокруг него начинают происходить трагические события.','$2 800 000'),(11842,'Билли-две шляпы',1974,99,0.0,6.2,105,'1974-03-07','https://st.kp.yandex.net/images/film_iphone/iphone360_11842.jpg','Billy Two Hats','Два молодых человека, один из которых шотландец, а другой — выходец из индейского народа по кличке Билли-две шляпы, совершают мелкое ограбление, которое заканчивается непреднамеренным убийством. Парни пытаются убежать с места преступления, в результате шотландца ранят из ружья. Молодой индеец Билли не оставляет друга в беде, он привязывает носилки к их лошадям и увозит раненого. Героям приходится сделать остановку в доме ранчера, у которого есть молодая жена…','Нет данных'),(11843,'Отстрел',1971,95,0.0,6.8,147,'1971-07-02','https://st.kp.yandex.net/images/film_iphone/iphone360_11843.jpg','Shoot Out','Клэй Ломакс только что выпущен из тюрьмы Канзас-Сити, где отбывал 7-летний срок за ограбление. Он мог бы выйти раньше, если бы сдал подельника. Но нет — Клэй не из таких. Тем более он знает, кто выстрелил ему в спину в тот злосчастный день налета на банк и желает решить вопрос своими методами.<br /><br />Ожидая вернуть от своей бывшей любовницы отданные ей на хранение деньги, получает лишь уведомление о ее смерти и 6-летнюю девочку, предположительно его дочь… Теперь девочка (вне зависимости от того осознает сам Клэй этот факт или нет) как раз тот последний шанс, что может удержать его от возвращения на прежние круги разбоя и насилия.','Нет данных'),(11845,'Отрезанные от мира',1969,134,0.0,5.9,615,'1969-11-10','https://st.kp.yandex.net/images/film_iphone/iphone360_11845.jpg','Marooned','После завершения миссии в космосе корабль с тремя космонавтами на борту вышел на земную орбиту, чтобы вернуться. Но двигатель дал сбой и командир Джим Пруе, ученый Клайтон Стоун и пилот Базз Ллойд оказались в безвыходном положении в открытом космосе. Чарлз Кейт, шеф космической программы и старший космонавт Тед Догерти составляют невероятный план спасения, а весь мир с волнением ждет…','$8 000 000'),(11847,'Арабеска',1966,105,0.0,6.8,506,'1966-05-05','https://st.kp.yandex.net/images/film_iphone/iphone360_11847.jpg','Arabesque','Американский профессор, специализирующийся на иероглифах, приезжает в Оксфорд, чтобы расшифровать секретное сообщение, содержание которого интересует и шпионов, и нефтяных шейхов и ряд лидеров Ближнего Востока. Ему помогает сексапильная любовница нефтяного магната с политическими амбициями.','$4 800 000'),(11848,'Мираж',1965,108,0.0,7.2,433,'1965-05-26','https://st.kp.yandex.net/images/film_iphone/iphone360_11848.jpg','Mirage','В офисе крупной компании происходят странные события: один человек выпадает из окна, другой — талантливый ученый — теряет память. Для расследования ученый нанимает детектива, но сам становится мишенью для преступников…','Нет данных'),(11849,'Мыс страха',1962,106,0.0,7.6,1705,'1962-04-12','https://st.kp.yandex.net/images/film_iphone/iphone360_11849.jpg','Cape Fear','Адвокат Сэм Боуден — юрист в небольшом городке. Более восьми лет назад Сэм выступил свидетелем по делу Макса Кэйди, обвинявшегося в изнасиловании. Наихудший кошмар Боудена осуществляется, когда осужденный Кэйди выходит из тюрьмы, движимый одним только маниакальным желанием — отомстить адвокату и его семье, превратить их жизнь в настоящий ад.<br /><br />Несмотря на помощь местного шефа полиции и частного детектива, адвокат юридически бессилен против психопата. Поняв, что он не может защитить свою жену Пегги и дочь Нэнси, Сэм готовит ловушку для Кэйди.','Нет данных'),(11850,'Возлюбленный язычник',1959,123,0.0,7.1,106,'1959-11-17','https://st.kp.yandex.net/images/film_iphone/iphone360_11850.jpg','Beloved Infidel','Фильм об острой, агрессивной журналистке, которая влюбляется в человека, который умнее ее на многие километры, и общаясь с ним, приобретает новую человеческую позицию.','Нет данных'),(11851,'Бравадос',1958,98,0.0,7.0,269,'1958-06-25','https://st.kp.yandex.net/images/film_iphone/iphone360_11851.jpg','The Bravados','Дикий американский Запад: дикие времена, дикие нравы. Джим Дуглас ищет тех четверых, что изнасиловали и убили его жену. Он узнает, что в соседнем городке их арестовали и должны казнить. После того, как убийцам удалось сбежать, Дуглас решает взять правосудие в свои руки. Однако постепенно он убеждается в справедливости древней истины: убивая другого, ты уничтожаешь частичку самого себя…','Нет данных'),(11852,'Модельерша',1957,118,0.0,6.9,504,'1957-05-16','https://st.kp.yandex.net/images/film_iphone/iphone360_11852.jpg','Designing Woman','Когда Майк Хаген и Марилла Браун женятся после бурного романа на восточном побережье и возвращаются в Нью-Йорк, то обнаруживают, что между ними почти ничего общего. Она — модельер, живущая в шикарной квартире и её друзья — актёры, художники и богема. Он — спортивный обозреватель, обожающий бокс и скачки. Они любят друг друга и пытаются найти компромисс. Неизвестно, что из этого вышло бы, если бы не бандиты…','Нет данных'),(11853,'Лиловая равнина',1954,97,0.0,6.5,73,'1954-09-14','https://st.kp.yandex.net/images/film_iphone/iphone360_11853.jpg','The Purple Plain','Пилот, переживший гибель любимой, долгое время ищет смерти в бою, подвергая опасности своих коллег. В надежде помочь ему обрести новый смысл жизни, доктор знакомит его с бирманской девушкой.','Нет данных'),(11855,'Банковский билет в миллион фунтов стерлингов',1953,84,0.0,7.9,2477,'1954-01-07','https://st.kp.yandex.net/images/film_iphone/iphone360_11855.jpg','The Million Pound Note','Июнь 1903 года. Адамс, безработный американский моряк, оказывается в Лондоне. Оборванный и голодный, он бесцельно бродит по улицам города, и в этот момент судьба сталкивает его с двумя братьями-миллионерами, которые делают ему необычное предложение.<br><br>Они вручают ему банкнот в миллион фунтов стерлингов на следующих условиях: если этот банкнот не будет разменян Адамсом в течение месяца, то он получает любую работу.<br><br>Таковы условия пари, заключенного между братьями. С этой минуты у Адамса начинается новая жизнь. Теперь он «эксцентричный миллионер», под его банкнот открыты кредиты всех магазинов и банков Лондона.','Нет данных'),(11856,'Снега Килиманджаро',1952,114,0.0,6.8,687,'1952-09-17','https://st.kp.yandex.net/images/film/11856.jpg','The Snows of Kilimanjaro','Созерцая великую Африканскую вершину, писатель Гарри Смит окружен своими воспоминаниями о прожитой жизни, ведь он понимает, что он ранен в ногу и его рана смертельна. Гангрена.<br><br>Перед глазами героя проходят образы прошлых лет, возвращая его то к воспоминаниям о войне, то в знойную Испанию, где он встретил свою истинную любовь Синтию Грин. После ее трагической гибели он потерял интерес к жизни.<br><br>В поисках сюжетов для своих книг, он путешествует по миру в сопровождении своей жены Элен. И вот он пришел к подножию Килиманджаро.<br><br>Африканская саванна встретила его грандиозными ландшафтами с безмятежно пасущимися стадами животных. Но размышления героя, стоящего на пороге смерти, о вечном: — всегда ли он делал добро людям? Не был ли он с ними жесток? Был ли в его жизни смысл? Не зря ли он существовал на земле?','Нет данных'),(11857,'Давид и Бадшиба',1951,116,0.0,6.7,129,'1951-08-10','https://st.kp.yandex.net/images/film/11857.jpg','David and Bathsheba','Вернувшись домой после битвы, Давид обращает внимание на чужую жену Вирсавию и влюбляется в неё.','Нет данных'),(11858,'Вертикальный взлет',1949,132,0.0,6.9,396,'1949-12-21','https://st.kp.yandex.net/images/film_iphone/iphone360_11858.jpg','Twelve O\'Clock High','1942 год, Англия. Группа американских бомбардировщиков расположена на военной базе в местечке Арчбери, куда прибывает бригадный генерал Фрэнк Сэвэйдж. Его личное участие в вылетах эскадрильи, целью которых были бомбардировки наземных объектов нацистов, поднимает упавший было моральный и боевой дух его подчиненных.','Нет данных'),(11859,'Большой грешник',1949,110,0.0,7.0,140,'1949-06-29','https://st.kp.yandex.net/images/film_iphone/iphone360_11859.jpg','The Great Sinner','В поезде русский писатель Федор знакомится с красавицей Полиной и теряет голову от любви. Она рассказвает ему о своих несчастьях, и влюбленный Федор решается на отчаянный шаг — он идет в казино, чтобы выиграть деньги и помочь Полине. Он завоевал её любовь, но стал жертвой азарта. Ему уже не нужна Полина, ему нужна только игра…','Нет данных'),(11860,'Желтое небо',1948,98,0.0,6.8,209,'1948-12-25','https://st.kp.yandex.net/images/film_iphone/iphone360_11860.jpg','Yellow Sky','Два года прошло со дня окончания Гражданской войны между Севером и Югом, но израсформированных рядов ветеранов многие не вернулись к праведному труду, а стали сколачивать банды и грабить мирное население. Один из таких «Лихих» отрядов, сделав очередной налет и сорвав куш, уходит от преследования федеральных войск в выжженную солнцем и продуваемую всеми ветрами пустыню.<br><br>В поисках воды и пищи, на грани жизни и смерти, они натыкаются на заброшенный город со странным названием «Желтое небо». В этом опустошенном мире гангстеры обнаруживают больного старика- старателя и его удивительно красивую внучку Констанс Мэй. Придя в себя от погони, получившие воду и кров, бандиты начинают осматриваться и понимают, что эти двое остались неспроста среди пыльных стен мертвого города. Всему виной золото, найденное дедом.<br><br>Решив отобрать золото, шайка готова на все, но их планом не суждено сбыться. Лидер банды Джеймс Доусон влюбился в красавицу-внучку и не даст теперь в обиду свою девушку, даже если вся банда направит оружие против него…','Нет данных'),(11862,'Олененок',1946,128,0.0,6.8,314,'1946-12-18','https://st.kp.yandex.net/images/film/11862.jpg','The Yearling','После гражданской войны Севера и Юга, первопроходец Пенни Бакстер строит небольшой дом вместе с женой Орри и одиннадцатилетним сыном Джоди на плодородных почвах Флориды. Джоди — любознательный мальчик, он целые дни проводит в лесу, наблюдая за незнакомым ему животным миром. Каждый день, возвращаясь с прогулки, ребенок просит отца и мать разрешить ему завести домашнего питомца: енота или медвежонка, опоссума или малышку пантеру. Мать отказывает мальчику в его просьбах, она недавно схоронила трех детей, и новое живое существо не приемлет ее душа.<br /><br />Однажды, во время охоты, Пенни был укушен гремучей змеей и для прекращения действия яда он вынужден был убить самку оленя, вырезать ее печень и приложить к укусу. Действие яда ослаблено, но в лесу остался маленький олененок, который обязательно погибнет без матери и Джоди просит родителей позволить оставить ему питомца. Родители соглашаются, мальчик счастлив, но, пройдет всего один год, и он поймет, что приручить дикое животное невозможно…','$4 000 000'),(11863,'Ключи от царства небесного',1944,137,0.0,7.4,233,'1944-12-15','https://st.kp.yandex.net/images/film/11863.jpg','The Keys of the Kingdom','Действие этой картины начинается в Шотландии, затем переносится в Китай и снова на родину, охватывая более половины столетия. По сюжету к старому, хромому и бедному священнику отцу Френсису Чизхолму приходит монсеньор и волею случая начинает читать его дневники. Сначала мы узнаем о безответной любви молодости, затем о рождении бескорыстной преданности, отказе себе во всем и самоистязаниях и наконец, беззаветном исполнении миссии молодого священника, посланного в Китай.<br> <br>Сильный духом герой аскетично живет в далекой провинции Чек-Kay и пытается наладить отношения с местным населением. Здесь он спасает жизнь сына и наследника богатого мандарина. Его миссия нести европейскую культуру и религию китайскому народу дает свои результаты, но начинается гражданская война, и прекрасный Холм Зеленого Нефрита оказывается на линии огня между армией и китайскими бандитами. Много тягот и лишений выпало на жизнь героя картины, но именно через страдания и боль он понял смысл своего предназначения…','$3 000 000'),(11864,'Дни славы',1944,86,0.0,6.7,122,'1944-06-08','https://st.kp.yandex.net/images/film/11864.jpg','Days of Glory','Фильм рассказывает о партизанской борьбе с нацистами на территории России.','Нет данных'),(11867,'Сеанс дождливым вечером',1964,121,0.0,6.9,282,'1964-06-04','https://st.kp.yandex.net/images/film_iphone/iphone360_11867.jpg','Seance on a Wet Afternoon','Майра Сэвэдж, медиум-самозванка, придумывает план как стать знаменитой. Она уговаривает мужа, Билли, похитить дочь богатых людей, потребовать выкуп, а потом «найти» ее. План сработал, за исключением того, что Билли начинал понимать, что она не собирается оставлять ребенка в живых…','£143 000'),(11869,'Элис',1990,102,0.0,6.7,1113,'1990-12-25','https://st.kp.yandex.net/images/film_iphone/iphone360_11869.jpg','Alice','Богатая, скучающая, помешанная на магазинах жительница Манхэттена мечтает познакомиться с Матерью Терезой. Эгоистичный муж постоянно ей изменяет. Но тут жизнь внезапно и навсегда меняется, когда она попадает к доброму и таинственному человеку с Востока, обладающему чудодейственными способностями вплоть до гипноза.','$12 000 000'),(11871,'Серебряные медведи',1977,113,0.0,6.4,122,'1977-06-03','https://st.kp.yandex.net/images/film_iphone/iphone360_11871.jpg','Silver Bears','Крутой эксперт по финансам Док получает задание мафии, содержащей казино в Лас-Вегасе, купить банк в Швейцарии для отмывки денег. По ходу дела Докане раз подставляют, в том числе подсовывают вместо банка комнатушку в мерзком районе Лугано.<br><br>Превратности фортуны скрашивает знакомство с Дэбби — юной женой банкира из Сан — Франциско, которую развлечения интересуют гораздо больше, чем финансы. Лихие повороты сюжета заносят Дока в Иран, где он открывает серебряные копи и заваливает мировой рынок этим металлом по демпинговым ценам, что, в свою очередь, приводит к новой череде подставок и интриг.','Нет данных'),(11873,'Разбивающий сердца',1972,106,0.0,6.3,286,'1972-12-17','https://st.kp.yandex.net/images/film_iphone/iphone360_11873.jpg','The Heartbreak Kid','На третий день своего медового месяца в Майами нью-йоркский еврей Ленни встречает стройную блондинку Келли. Эта встреча окончательно убеждает его в мысли, что женитьба была ошибкой, после чего Ленни решает завоевать Келли…','Нет данных'),(11876,'Особь 2',1998,93,0.0,5.2,3821,'1998-04-10','https://st.kp.yandex.net/images/film_iphone/iphone360_11876.jpg','Species II','Ученые — астронавты возвращаются на Землю после успешной экспедиции на Марс. Однако с различными пробами на корабль проникает нечто ужасное, что угрожает жизни землян. Один из участников полета превращается в неземную тварь и жаждет наплодить себе подобных. Ему необходимо встретиться с другой особью, которую изучают в лаборатории. Этого не должно произойти…<br><br>Великолепные спецэффекты дают ощущение реальности происходящего и поражают воображение. Высококлассная работа выполнена той же командой художников, которая делала первый фильм.','Нет данных'),(11878,'Смерть и компас',1992,86,0.0,6.5,99,'1992-08-05','https://st.kp.yandex.net/images/film_iphone/iphone360_11878.jpg','Death and the Compass','В городе кошмара, населенном одними негодяями и полицейскими, детектив-мистик находит ключ к поимке зловещего преступника.','Нет данных'),(11880,'Рожденная свободной',1995,100,0.0,6.5,81,'1995-03-31','https://st.kp.yandex.net/images/film_iphone/iphone360_11880.jpg','Born to Be Wild','Обезьяны, как и всякие живые существа, как и мы, способны чувствовать, радоваться и огорчаться и отличать хорошее от дурного. А порой и быть куда лучше некоторых из людей… Необычная судьба связала содержащуюся в неволе гориллу по кличке Кэти с подростком Риком, убиравшим ее клетку. Отношения начались с взаимного недоверия, порой досады, а потом неожиданно переросли в настоящую дружбу. Эти двое поняли друг друга.<br><br>Кэти усмотрела в мальчике то, чего не заметила и не ценила его мать, а Рик искренне и не без взаимности привязался к своему новому мохнатому другу. Однако так случилось, что Кати затребовал ее законный хозяин, для того, чтобы показывать в шутовском балагана праздной толпе. Чтобы избежать издевательств над зверем Рик устраивает Кэти побег, а затем сопровождает ее в нелегком и далеком путешествии. Цель друзей — попасть в Канаду, в глухие и малодоступные ласа, где Кэти смогла бы жить по-настоящему свободной…','Нет данных'),(11881,'Нервотрепка',1991,95,0.0,6.1,95,'1993-09-03','https://st.kp.yandex.net/images/film/11881.jpg','Nervous Ticks','Служащий авиакомпании Йорк пытается опередить время — ему необходимо скорее сдать смену, собрать багаж, захватить подругу Нэнси (по совместительству чужую жену), вернуться в аэропорт и успеть на самолет в Рио. И навсе про все у него лишь 90 минут.<br><br>Выбегая из аэропорта, он звонит на свою любимую радиопередачу, чтобы принять участие в конкурсе с призом в 100 000 долларов. На подступах к дому знакомый передает ему серебристый чемоданчик, за которым гоняются и полиция, и «темные» лица с «пушками».<br><br>А заехав за Нэнси, Йорк выясняет, что ее муж все про них узнал. Однако Йорку с помощью чемоданчика удается притвориться электриком. И в это время по радио объявляют результаты конкурса, и он оказывается победителем!<br><br>Ему остается лишь назвать себя, но тут опять заходит муж. И на этом приключения только начинаются…','Нет данных'),(11882,'Кикбоксер 2: Дорога назад',1990,89,0.0,5.6,2102,'1991-02-01','https://st.kp.yandex.net/images/film_iphone/iphone360_11882.jpg','Kickboxer 2: The Road Back','Дэвид Слоан — младший брат кикбоксеров Курта и Эрика Слоанов, героев первой части фильма. Дэвид преподает боевые искусства, но выходить на ринг за деньги отказывается.<br><br>Однако столкнувшись с финансовыми трудностями, ему приходится провести бой с лучшим учеником жестокой школы Масиа … и выиграть! Став чемпионом, он собирается уйти из этого спорта, окончательно в нем разочаровавшись. Но оказывается, что завязать с боями без правил так же сложно, как уйти из мафии — мало шансов остаться в живых.','Нет данных'),(11883,'Солнечный кризис',1990,112,0.0,4.7,118,'1990-07-14','https://st.kp.yandex.net/images/film_iphone/iphone360_11883.jpg','Solar Crisis','Из-за сильного потепления на Земле критическая ситуация: ресурсы на исходе, растительность почти исчезла. В борьбе за выживание грабежи и разбой стали привычным делом.<br><br>Чтобы снизить солнечную активность, к светилу отправляется космический корабль со сверхмощной бомбой для реализации проекта «Встречный пожар». Но в составе экипажа улетает диверсант — искусственный человек «Делайла».','Нет данных'),(11884,'Уокер',1987,94,0.0,6.8,176,'1987-12-04','https://st.kp.yandex.net/images/film_iphone/iphone360_11884.jpg','Walker','Биографический фильм о полковнике Уильяме Уокере Норвелле, военнононачальнике и авантюристе, задумавшем группой в 45 бойцов в 1853 году `освободить`мексиканский штат Сонора и создать свою непризнанную республику. А позднее, будучи командующим Первого Американского батальона пехоты осуществить агрессивное вторжение в Никарагуа (1855)…','Нет данных'),(11887,'Опасный Джонни',1984,90,0.0,6.7,374,'1984-12-21','https://st.kp.yandex.net/images/film_iphone/iphone360_11887.jpg','Johnny Dangerously','Нью-Йорк, 1910 год. Юный разносчик газет Джонни Келли принимает нелегкое решение: чтобы иметь возможность оплачивать счета за лечение матери, он начинает работать на гангстера Джоско Данди.<br><br>Будучи честным по натуре, Джонни сильно терзается и не раз пытается покончить с ненавистным бизнесом. Но обстоятельства всегда оборачиваются против, вынуждая возвращаться на преступную тропу. Время идет, и он сам становится боссом мафии, неуловимым и всесильным…','$9 000 000'),(11889,'Там, где бродит бизон',1980,96,0.0,7.3,4177,'1980-04-25','https://st.kp.yandex.net/images/film/11889.jpg','Where the Buffalo Roam','История о приключениях «безбашенного» журналиста Хантера Томпсона и его поверенного Оскара Акоста, которого все зовут Ласлоу. Томпсон пытается описывать турнир «Супер Боул» и президентские выборы 1972-го года в своем обычном состоянии под воздействием наркотиков и алкоголя, но ему постоянно мешает его еще более странный друг Ласлоу.','Нет данных'),(11890,'Пленники Посейдона',1979,114,0.0,5.7,273,'1979-05-18','https://st.kp.yandex.net/images/film_iphone/iphone360_11890.jpg','Beyond the Poseidon Adventure','Роскошный океанский лайнер за несколько секунд переворачивается гигантской волной. Спасатели вступают в конфликт со злодеем, стремящимся получить права на огромный корабль. Злодей, маскируясь под скромного медика, хочет найти смертельный, но бесценный груз плутония…','$10 000 000'),(11891,'Жесткач',1978,109,0.0,6.9,562,'1979-02-09','https://st.kp.yandex.net/images/film_iphone/iphone360_11891.jpg','Hardcore','Отправившись в школьную поездку, единственная дочь-подросток из кальвинистской семьи пропадает без следа. Полиция бессильна, отец убит горем. Проходит время, и в руки нанятого частного детектива попадает порнофильм, где девушка занимается сексом с двумя парнями. Теперь, чтобы найти беглянку, её отцу придётся лично столкнуться с бурно цветущей секс-индустрией Америки 1970-х годов.','Нет данных'),(11892,'Кулак',1978,145,0.0,7.1,2040,'1978-04-13','https://st.kp.yandex.net/images/film_iphone/iphone360_11892.jpg','F.I.S.T','30-е годы. Америка охвачена экономической депрессией. Мафия и коррупция процветают. Заводы и фабрики терпят огромные убытки. Увольняют массы людей, улицы переполнены недовольными. Полно желающих сотрудничать с организованной преступностью. Но Джонни Ковак не такой. Имея связи с преступным миром, он делает выбор в пользу закона, вступает в профсоюз, чтобы доказать свое справедливое право на честный труд. У Джонни великолепный дар убеждать, он собирает под знаменем профсоюза людей. Но в скором времени убеждается — идя по пути закона, нет шансов добиться своих прав. Игнорируя угрозы, он принимает решение выступать против капитализма методом оружия.','$11 000 000'),(11895,'Джо',1970,107,0.0,6.8,405,'1970-07-15','https://st.kp.yandex.net/images/film_iphone/iphone360_11895.jpg','Joe','Чтобы вы сделали, если бы вам в лицо нагло ухмылялся грязный хиппи-наркоман, сожитель вашей единственной дочери, посадивший ее на иглу и колеса, отчего она сейчас оказалась на больничной койке? Что подсказал бы ваш гнев, боль и совесть? Наш герой, богатый отец семейства из белых воротничков поступил так, как ему подсказали его чувства. После всего он зашел в бар выпить и случайно познакомился там с простым работягой Джо, который оттягивался после трудового дня, громко разглагольствуя, что черномазые, голубые, хиппи, наркоманы, безработные всех мастей не достойны жить и оскверняют Америку. Во что вылилось это знакомство?','$106 000'),(11898,'Мать',1996,104,0.0,6.1,88,'1996-09-07','https://st.kp.yandex.net/images/film_iphone/iphone360_11898.jpg','Mother','Джон Гендерсон, писатель-фантаст средних лет, приезжает жить к матери после двух неудачных попыток создать семью. Погруженный в себя, главный герой возвращается домой, чтобы узнать, почему мать так и не оценила его по достоинству. Джон надеется, что, узнав причину и наладив отношения с матерью, он научится уживаться и с другими женщинами.<br /><br />Но вскоре он понимает, что сам никогда не ценил ее по-настоящему. Постепенно происходят изменения в их отношениях, оказывающие влияние не только на писателя, но и на его младшего брата Джеффа. В основе этой глубокой истории — мудрость, связанная с горьковатым юмором.','Нет данных'),(11899,'Скаут',1994,101,0.0,6.1,168,'1994-09-30','https://st.kp.yandex.net/images/film_iphone/iphone360_11899.jpg','The Scout','Когда Эла Перколо, скаута бейсбольной лиги, отправили в наказание в рандеву по Мексике, он и не подозревал, что здесь ему удастся найти самого лучшего игрока в своей карьере. Стив Небраска — самородок, способный вытворять чудеса на поляне, подписывает с Элом контракт и в лучах славы они возвращаются в Нью-Йорк, где Стива ждет медосмотр, а Эла неожиданные результаты этого медосмотра…','Нет данных'),(11900,'Потерянные в Америке',1985,91,0.0,6.2,187,'1985-03-15','https://st.kp.yandex.net/images/film_iphone/iphone360_11900.jpg','Lost in America','В тридцать лет муж и жена решают оставить работу, жить свободно и путешествовать по Америке в доме на колесах.','Нет данных'),(11901,'Неверно твоя',1984,96,0.0,6.8,181,'1984-02-10','https://st.kp.yandex.net/images/film_iphone/iphone360_11901.jpg','Unfaithfully Yours','Знаменитый дирижер симфонического оркестра Клод Истман женится на итальянской кинозвезде. Даниэла намного моложе его и значительно выше ростом, но искренне любит своего обаятельного и талантливого супруга. Клод же, будучи безумно ревнивым, постоянно подозревает ее в связи с Максимилианом Стейном, красавцем-музыкантом из своего оркестра.<br><br>Терзаемый постоянными муками ревности, Клод рисует в своем воображении план убийства жены, в ходе которого подозрение должно упасть на мнимого любовника…','Нет данных'),(11902,'Современный роман',1981,93,0.0,6.0,96,'1981-03-13','https://st.kp.yandex.net/images/film_iphone/iphone360_11902.jpg','Modern Romance','Молодой человек то сходится, то расходится со своей девушкой. Каждый раз после расставания он мучается от депрессии и пытается бороться с этим душевным недугом самыми разными способами: бегает трусцой, запасается витаминами, изливает душу приятелю, с головой уходит в работу. Но забыть её не может…','Нет данных'),(11903,'Реальная жизнь',1979,99,0.0,6.1,139,'1979-03-02','https://st.kp.yandex.net/images/film_iphone/iphone360_11903.jpg','Real Life','Дебютный фильм Альберта Брукса, представляющий собой едкую сатиру на такой известный феномен как «Реалити-ТВ». Шутки для фильма взяты из шоу «Субботним вечером в прямом эфире».','Нет данных'),(11904,'Скорбь',1997,114,0.0,6.6,768,'1997-08-28','https://st.kp.yandex.net/images/film_iphone/iphone360_11904.jpg','Affliction','Все, что имеет полицейский Уэйд Уайтхауз в свои 45 лет — это бывшая жена, старый отец-алкоголик, любовница-официантка, потрепанный вагончик для жилья и дикая зубная боль.<br><br>Его будущее кажется беспросветным, пока однажды в их небольшом городке Лоуфорд, штат Нью-Гемпшир, не происходит подозрительный несчастный случай. Событие встряхнуло Уэйда, а после смерти матери он понял, что надо что-то менять в этой жизни…','$6 000 000'),(11905,'Чуткий сон',1992,103,0.0,6.6,497,'1992-03-13','https://st.kp.yandex.net/images/film/11905.jpg','Light Sleeper','Джон Летур — немолодой наркодилер, который работает на гламурную пару, планирующую со временем вложить свой капитал в косметический бизнес. Сам Летур мечтает бросить свое дело. К этому его подталкивает и полицейское расследование убийства его клиентки. Возвращаясь с очередной встречи, он внезапно сталкивается со своей бывшей девушкой. Возможно, судьба даст ему еще один шанс…','$5 000 000'),(11906,'Дневной свет',1987,107,0.0,7.1,155,'1987-02-06','https://st.kp.yandex.net/images/film_iphone/iphone360_11906.jpg','Light of Day','Рок-н-ролльная драма, в которой крутая рокерша, она же мать-одиночка, бунтует против своей очень религиозной мамаши, а посредине еще встревает очень «ответственный» брат.','Нет данных'),(11907,'Американский жиголо',1980,117,0.0,6.6,2198,'1980-02-01','https://st.kp.yandex.net/images/film_iphone/iphone360_11907.jpg','American Gigolo','Второго такого не найти! Джулиан Кэй — единственный и неповторимый! Он легко изъясняется на шести языках. Он — изысканный, начитанный собеседник. Он — чувственен и интеллигентен. Он безмерно элегантен и немыслимо привлекателен. Ни одна женщина не в силах устоять перед его чарами. Что, в сущности, и требуется Джулиану для его повседневной работы, так как он — профессиональный соблазнитель.<br><br>Причем — самый высокооплачиваемый в Голливуде. Его сердце защищено ледяным панцирем от лишних нежных чувств, которые внезапно могут возникнуть на службе или вне ее — работе не должно мешать ничто! Казалось бы, в жизни прекрасного жиголо все будет прекрасно. Но вот одну из клиенток Джулиана находят мертвой, а самого его начинают подозревать в убийстве.','$4 800 000'),(11908,'Гремящий гром',1977,95,0.0,6.7,797,'1977-10-14','https://st.kp.yandex.net/images/film_iphone/iphone360_11908.jpg','Rolling Thunder','Когда майор Чарлз Рейни возвращается из Вьетнама в родной Техас, его встречают как героя. Он и его друг Джонни Воден восемь лет мучились в плену. Чарли получил кадиллак с открытым верхом, пару тысяч долларов и новость, что его жена теперь с другим. Взорвался Чарли после того, как бандиты отняли у него наградные, убили сына и изуродовали руку. Ребята явно не на того нарвались. Имея стальной крюк вместо руки, он вместе со своим другом Джонни загружает в свою машину целый арсенал, и они начинают методически уничтожать убийц.','Нет данных'),(11909,'Наваждение',1976,98,0.0,6.6,783,'1976-08-01','https://st.kp.yandex.net/images/film/11909.jpg','Obsession','Жизнь бизнесмена Майкла Куртленда теряет всякий смысл, когда его жена Элизабет и восьмилетняя дочь погибают во время спасательной операции по освобождению заложников. Правда, их тела так и не были найдены. <br><br>Спустя шестнадцать лет Майкл приезжает в Италию, где встречает молодую женщину Сандру, как две капли воды похожую на его погибшую жену. Но вскоре он начинает замечать в поведении женщины странности…','$1 400 000'),(11910,'Якудза',1974,112,0.0,7.0,506,'1974-12-21','https://st.kp.yandex.net/images/film_iphone/iphone360_11910.jpg','The Yakuza','Якудза — это мафия, родившаяся 350 лет назад в Японии, стране, где восходит солнце. О якудзе известно только то, что проникший в ее тайны — обречен. На след якудза вышел американский сыщик, занимающийся делом о похищении дочери миллионера…','Нет данных'),(11911,'Изгоняющий дьявола: Начало',2004,114,0.0,5.6,3958,'2004-08-18','https://st.kp.yandex.net/images/film_iphone/iphone360_11911.jpg','Exorcist: The Beginning','После Второй мировой войны отец Меррин, отягощённый воспоминаниями об ужасах войны и усомнившийся в своём призвании, решил сложить сан и покинуть Европу. Вспомнив о своём дипломе археолога, Меррин присоединился к экспедиции, занимающейся раскопками в отдалённом районе Африки. <br><br>Экспедиция обнаруживает прекрасную церковь в византийском стиле, погребённую под землёй. Под церковью Меррин находит ещё более древний склеп, оказавшийся обителью Князя тьмы, столетия дожидавшегося возможности вырваться на волю…','$80 000 000'),(11913,'Бриллианты',1999,91,0.0,6.3,180,'1999-09-06','https://st.kp.yandex.net/images/film_iphone/iphone360_11913.jpg','Diamonds','Стареющий чемпион по боксу Гарри Агенски живет забытый всеми, больше всего боясь умереть нищим в каком-нибудь доме для престарелых. Неожиданный визит сына и внука дает ему шанс покончить со своими страхами.<br><br>Гарри уговаривает своих гостей отвезти его в Рино, где он много лет назад спрятал свой гонорар за поединок — 13 бриллиантов. Не особо веря историям хитрого деда, компания отправляется в путь, не предполагая, какие приключения ждут их впереди…','Нет данных'),(11914,'Жадность',1994,113,0.0,7.6,5195,'1994-03-04','https://st.kp.yandex.net/images/film_iphone/iphone360_11914.jpg','Greedy','Жадность часто толкает на неблаговидные поступки в погоне за вожделенными деньгами. Это отлично понимает старый лукавый миллионер Джо МакТиг. У него нет своих детей и прямых наследников. Зато, есть куча дальних и близких родственников, стаей кружащихся вокруг него в надежде отхватить лакомый кусок от дядюшкиного наследства.<br><br>Старик играет с ними, как кошка с мышками. Он нанимает молоденькую симпатичную сиделку Молли Ричардсон и явно к ней благоволит. В стане родственников смятение. Молли — прямая и явная угроза их планам. Надо действовать!','Нет данных'),(11916,'Бегство Эдди Мэйкона',1983,95,0.0,5.8,92,'1983-03-25','https://st.kp.yandex.net/images/film_iphone/iphone360_11916.jpg','Eddie Macon\'s Run','Несправедливо осужденный Эдди Макон совершает побег из тюрьмы и пытается переправиться в Мексику, преследуемый по пятам полицейским.','Нет данных'),(11917,'Мужчина с заснеженной реки',1982,102,0.0,6.9,187,'1982-03-25','https://st.kp.yandex.net/images/film_iphone/iphone360_11917.jpg','The Man from Snowy River','После смерти отца 18-летний Джим Крэйг покидает свою тихую ферму в горах Австралии и отправляется на заработки. Трудолюбивый и упорный, он не хочет расставаться с фермой, а для ее содержания нужны большие деньги.<br><br>Джим поступает на работу к жестокому землевладельцу и торговцу скотом Харрисону и влюбляется в его дочь, красавицу Джессику. А вскоре становится втянутым в 20-летнюю вражду за право владения землей между своим боссом и его братом-близнецом Спером…','$3 500 000'),(11918,'Домашние фильмы',1979,90,0.0,6.2,149,'1979-08-28','https://st.kp.yandex.net/images/film_iphone/iphone360_11918.jpg','Home Movies','Кит Гордон — талантливый молодой режиссер, который снимает кино о событиях в семье пэров. Его учитель, Маэстро, тоже все время снимает жизнь и пытается учить Гордона своим методам.','Нет данных'),(11919,'Холокост 2000',1977,106,0.0,6.0,103,'1977-11-25','https://st.kp.yandex.net/images/film_iphone/iphone360_11919.jpg','Holocaust 2000','Идеалистически настроенный президент крупной атомной корпорации Роберт Кейн терпит поражение в борьбе с собственным сыном Энджелом за право руководить предприятием. Энджел стремится быстрее осуществить варварский проект, ибо он — пришедший на землю Антихрист.','Нет данных'),(11920,'Отряд',1975,92,0.0,6.4,95,'1975-06-04','https://st.kp.yandex.net/images/film_iphone/iphone360_11920.jpg','Posse','Циничный, самоуверенный судебный исполнитель преследует преступника. Это нужно ему для удовлетворения своих политических амбиций. С собственной командой представителей закона, которых он собирается бросить, став сенатором от Техаса, он манипулирует трусливым городком. Но жители в конце поворачиваются к нему спиной.','Нет данных'),(11925,'Перестрелка',1971,89,0.0,6.7,129,'1971-08-25','https://st.kp.yandex.net/images/film_iphone/iphone360_11925.jpg','A Gunfight','Вестерн-драма о двух стареющих ганфайтерах, которыми манипулирует с виду мирное и спокойное общество, на самом деле жаждущее кровопролития.','Нет данных'),(11927,'Опасный свет на краю земли',1971,120,0.0,6.7,259,'1971-07-16','https://st.kp.yandex.net/images/film/11927.jpg','The Light at the Edge of the World','1865 год. Новый маяк на мысе Горн подвергся нападению пиратов. Они убивают двух смотрителей, но третьему удается бежать. Оставшись один, он не пытается укрыться от захватчиков, а объявляет им настоящую войну. Теперь судьба многих кораблей зависит только от исхода поединка героя-одиночки и предводителя банды отчаянных головорезов…  ','Нет данных'),(11929,'Путь на Запад',1967,122,0.0,6.7,153,'1967-05-24','https://st.kp.yandex.net/images/film_iphone/iphone360_11929.jpg','The Way West','Середина XIX века. Уильям Тэдлок ведет переселенцев на запад Америки, чтобы создать там новое поселение. Тэдлок — строгий предводитель, который одинаково требователен как к себе, так и к остальным участникам похода. По дороге путешественникам приходится пережить множество несчастий, а после убийства индейского мальчика испытать на себе всю силу правосудия.','Нет данных'),(11930,'Герои Телемарка',1965,125,0.0,6.3,117,'1965-11-23','https://st.kp.yandex.net/images/film_iphone/iphone360_11930.jpg','The Heroes of Telemark','Оккупированная немецкими войсками Норвегия. Профессор физики доктор Рольф Петерсен и лидер местного подполья Кнут Страут пытаются сообщить британской разведке о планах нацистов по производству атомной бомбы. Завод в Телемарке является центральным звеном в дьявольской игре. Союзники решают отправить отряд специального назначения с целью разрушить планы врага.','Нет данных'),(11931,'Семь дней в мае',1964,118,0.0,7.2,377,'1964-02-12','https://st.kp.yandex.net/images/film_iphone/iphone360_11931.jpg','Seven Days in May','Популярность Президента США Лимена падает, этим решает воспользоваться генерал ВВС Джеймс Скотт: с помощью военного переворота он решает устранить «слабого» руководителя страны.<br><br>О заговоре случайно узнает ближайший помощник Скотта полковник Кейси, и перед ним встает трудный выбор: спасти страну и президента — значит, предать своего командира.','$2 200 000'),(11932,'За любовь или за деньги',1963,108,0.0,6.4,78,'1963-08-07','https://st.kp.yandex.net/images/film_iphone/iphone360_11932.jpg','For Love or Money','Адвокат Дек Джентри получает весьма необычное задание от своей самой важной клиентки. Хлоя Брашер, состоятельная вдова, владелица сети отелей, просит Дека найти мужей для ее трех дочерей на выданье. Первая дочь, Кейт, очень умна, вторая, Джен, ведет богемный образ жизни, а третья дочь, Бонни, помешана на здоровой пище. Несмотря на протесты Дека, Хлоя настаивает на своем, и адвокату приходится заняться сватовством. С горем пополам Дек «отдает в надежные руки» двух сестер — Бонни и Джен. Но Кейт оказывается крепким орешком! Деку никак не удается ее пристроить. Отчаявшись, Дек идет ва-банк: он ставит на карту свою холостяцкую свободу и делает предложение Кейт…','Нет данных'),(11935,'Последний закат',1961,112,0.0,6.9,299,'1961-06-07','https://st.kp.yandex.net/images/film_iphone/iphone360_11935.jpg','The Last Sunset','Среди ковбоев, перегоняющих скот, скрываются убийца и преследующий его шериф. Противники многое узнают друг о друге во время долгого и опасного путешествия, но развязка все же жестока и неизбежна. Интересный психологический сценарий известного драматурга Далтона Трамбо, куда он, правда, намешивает все: от индейцев до кровосмесительства.','Нет данных'),(11936,'Ученик дьявола',1959,83,0.0,6.9,116,'1959-08-20','https://st.kp.yandex.net/images/film_iphone/iphone360_11936.jpg','The Devil\'s Disciple','Маленький городок в Новой Англии во время американской войны за независимость. Ричард Даджион, революционный американский пуританин, ошибочно принят за местного священника Энтони Андерсона и арестован англичанами. Представ перед британским командующим генералом Бергойном, Ричард проявляет готовность умереть за свои принципы.','Нет данных'),(11938,'Человек без звезды',1955,89,0.0,6.5,109,'1955-03-24','https://st.kp.yandex.net/images/film_iphone/iphone360_11938.jpg','Man Without a Star','Сюжет — чистый вестерн: борьба за открытые ранчо против окруженных заборами.','Нет данных'),(11939,'20000 лье под водой',1954,127,0.0,7.2,1709,'1954-12-23','https://st.kp.yandex.net/images/film_iphone/iphone360_11939.jpg','20,000 Leagues Under the Sea','На календаре 1868 год и весь Сан-Франциско взбудоражен поступающими сообщениями о плавающем под водой огромном чудовище, которое может сожрать любое судно, если оно к нему приближается. Многие плавания отменены, и правительство вынуждено послать военный корабль исследовать и очистить море от «чудищ».<br><br>Корабль этот был потоплен неизвестным «существом», и только троим чудом удалось спастись: профессональному гарпунисту, профессору из Морского музея в Париже и его помощнику. Их вытаскивают из воды на эту чуду-юду, которое оказывается подводной лодкой Капитана Немо, ученого, изобретателя и радикального борца за мир. Он топит корабли с благородной целью покончить с войной на бескрайних водах мирового океана…','$5 000 000'),(11940,'Акт любви',1953,95,0.0,7.1,134,'1953-12-17','https://st.kp.yandex.net/images/film_iphone/iphone360_11940.jpg','Un acte d\'amour','История любви американца и француженки, которая началась в освобожденном от фашистов Париже в 1944 году. Спустя два года после войны американец Роберт Тейлор приезжает в приморский городок на юге Франции. Он мысленно возвращается в 1944 год, вспоминая Париж после освобождения. Там он встретил девушку по имени Лиза и влюбился в нее.','Нет данных'),(11943,'Большие деревья',1951,89,0.0,6.1,222,'1952-02-05','https://st.kp.yandex.net/images/film/11943.jpg','The Big Trees','Джим Фаллон честно зарабатывает на торговле лесом. Лес также находится в сфере интересов общины квакеров, члены которой хотят помешать его бизнесу, используя любые средства. Проблемы возникают одна за другой и жестокое столкновение неизбежно. Предстоит решающая схватка с врагами, в которой герой победит, ведь рядом с ним верные друзья и любимая девушка.','Нет данных'),(11944,'Большое небо',1952,140,0.0,6.3,194,'1952-07-29','https://st.kp.yandex.net/images/film_iphone/iphone360_11944.jpg','The Big Sky','Джим Дикинс — пионер, ведущий торговлю с индейцами. С группой товарищей он совершает опасное путешествие вверх по реке Миссури, чтобы приобрести меха у дружественного племени индейцев — Черноногих. Проблема в том, что им нужно пройти через враждебные территории и они сильно недооценили трудности пути. Из большого числа людей, которые начинали путешествие, в живых теперь остались единицы.','Нет данных'),(11945,'Красные пески',1951,88,0.0,6.1,74,'1951-05-16','https://st.kp.yandex.net/images/film_iphone/iphone360_11945.jpg','Along the Great Divide','Событием в жизни маршала Лена Меррика явилась смерть его отца. Когда-то он отказался сопровождать с отцом двоих бандитов, те освободились от наручников и убили отца. Теперь история повторяется. Меррик с двумя помощниками пресекает попытку самосуда над человеком, обвиненным в убийстве. Чтобы осуществить над ним справедливый суд, его надо доставить в Санта Рома, а для этого пересечь каменистую пустыню с полным набором сопутствующих такому переходу лишений. Да, к тому же, отбиваясь от преследователей, тех самых, которые хотели повесить беднягу. Никакие доводы не действуют на Меррика, он решает доставить подозреваемого любой ценой, а все потому, что когда-то не помог отцу. Вот вам и объяснение такой настойчивости. В конечном итоге, подозреваемый окажется не виновен, тем самым Меррик как бы искупает свою вину, а все повествование выстраивается в единую логическую цепь…','Нет данных'),(11947,'Трубач',1950,112,0.0,7.2,176,'1950-02-09','https://st.kp.yandex.net/images/film_iphone/iphone360_11947.jpg','Young Man with a Horn','Рик Мортан с детства увлекался джазовой музыкой. Еще подростком он скопил деньги на свою первую трубу и начал брать уроки у известного чернокожего музыканта Арта Хэззарда. Прошли годы и постепенно пришел успех. В двадцать лет он приглашен в танцевальный оркестр, где познакомился с пианистом Смоуки Уиллогби и певицей Джо Джордан. Обыденная игра на танцах не соответствует творческим порывам героя и окончательно разочаровавшись в такой работе, он и его новый друг Смоуки увольняются и отправляются в свободное плавание. Они начинают играть свой собственный джаз в дешевых барах и получать от этого истинное удовольствие. Вскоре парни попадают в Нью-Йорк, где они находят Джо, поющую в престижном оркестре. Здесь же Рик встречает своего учителя Арта, который приглашает его в оркестр Фила Моррисона «Страна чудес»…','Нет данных'),(11948,'Моя дорогая секретарша',1948,94,0.0,6.4,152,'1948-11-05','https://st.kp.yandex.net/images/film_iphone/iphone360_11948.jpg','My Dear Secretary','Героиня фильма — начинающая писательница Стефания Гэйлорд. Она получила предложение стать секретарем известного и преуспевающего прозаика Оуэна Уотербери. Вскоре Оуэн влюбился в Стефанию и они поженились. Все бы хорошо, но…','Нет данных'),(11950,'Я всегда одинок',1947,97,0.0,6.0,142,'1947-12-31','https://st.kp.yandex.net/images/film_iphone/iphone360_11950.jpg','I Walk Alone','Фрэнки Мэдисон выходит из тюрьмы и встречается с бывшими партнёрами. За время его отсидки старые друзья заметно разбогатели и не спешат вводить старого друга в курс своих дел.','Нет данных'),(11952,'Странная любовь Марты Айверс',1946,116,0.0,7.2,525,'1946-06-13','https://st.kp.yandex.net/images/film/11952.jpg','The Strange Love of Martha Ivers','Героиня фильма Марта Айверс собирается убежать с возлюбленным, но случайно убивает свою тетку. Побег не состоялся, возлюбленный исчез, а Марта унаследовала огромное фамильное состояние…','Нет данных'),(11953,'Поллианна',1960,134,0.0,7.7,380,'1960-05-19','https://st.kp.yandex.net/images/film_iphone/iphone360_11953.jpg','Pollyanna','После смерти родителей девочку Поллианну забрала к себе ее тетя, известная своим суровым нравом и безраздельно властвующая в маленьком американском городке. Попав в мир строгих правил и запретов, оказавшись одна в чужом городе, в чужом доме, среди чужих людей, Поллианна не отчаивается. Ей помогает «Игра в радость», когда-то придуманная ее отцом. Все просто: в любой ситуации, при любых обстоятельствах надо найти что-то хорошее, то, чему можно порадоваться… и поделиться этой радостью с другими.<br /><br />Поначалу Полианна раздражает своим оптимизмом не только свою тетю, но и других жителей унылого города. Но «Игра в радость», которую дарит окружающим Поллианна, оказывается необычайно заразительной… и переворачивает жизнь всего сообщества…','Нет данных'),(11959,'По широкой Миссури',1951,78,0.0,6.4,114,'1951-10-12','https://st.kp.yandex.net/images/film_iphone/iphone360_11959.jpg','Across the Wide Missouri','У подножия Скалистых гор, расположенных вдоль реки Миссури, раз в году собирались охотники-горцы для продажи своей добычи. Они поддерживали дружеские отношения с коренным населением — индейцами племени «чернопятых». Один из горцев получает в жены аборигенку Камию, заплатив за нее солидный выкуп. Вождь племени недоволен, но поделать ничего не может, так как дед Камии, почитаемый всеми шаман, принял ее нового мужа.','Нет данных'),(11961,'Порадовать женщину',1950,91,0.0,6.5,80,'1950-10-13','https://st.kp.yandex.net/images/film_iphone/iphone360_11961.jpg','To Please a Lady','Регина — популярная журналистка, обозреватель и радио-ведущая, которая пишет язвительные и резкие статьи на злободневные темы. Ее боятся, потому что она может разрушить и карьеру, и бизнес любого человека, которого она считает недостойным.<br><br>Ее последней жертвой стал Майк — водитель болида, участвующий в гонках. Она пытается взять у него интервью перед гонками, но он отказывается, а поскольку он стал участником нескольких аварий, произошедших на трассе, она посчитала возможным для себя взяться за эту тему и, походя, уничтожить его карьеру.','Нет данных'),(11963,'Мои сны твои',1949,101,0.0,6.6,89,'1949-04-15','https://st.kp.yandex.net/images/film_iphone/iphone360_11963.jpg','My Dream Is Yours','Тщеславный певец Гарри Митчелл отказывается продлять контракт с радиостанцией. Агент Даг Блейк решает найти нового человека на замену. В Нью-Йорке он встречает Марту Гибсон — мать-одиночку с удивительным голосом. Он устраивает для нее переезд в Голливуд, но не может продвинуть ее перед спонсором программы. Он использует все возможности, чтобы сделать Марту звездой. И чем больше они работают вместе, тем больше Даг влюбляется в нее.','Нет данных'),(11964,'Рекламисты',1947,115,0.0,6.8,169,'1947-07-17','https://st.kp.yandex.net/images/film_iphone/iphone360_11964.jpg','The Hucksters','Рекламный бизнес — это не только громкие слова и красивые картинки, это еще жесткие отношения и большие деньги. Вот именно за деньгами и пришел в этот бизнес Виктор Норман — ветеран Второй мировой войны.<br><br>Ему везет — он получает хорошую должность и приличный оклад, но скоро понимает, что на широкой ниве корпоративного рекламирования этические, а тем более, человеческие ценности отсутствуют. На какие только уловки не идет наш герой, чтобы заполучить средства на проведение рекламы мыла «Бьюти».<br><br>Парню удается добиться почти невозможного, согласия от вдовы генерала стать лицом мыльной — рекламной компании, но его главный козырь впереди. Виктор понимает, что, являясь мастером своего дела, он может вытрясти из рекламодателя любые деньги…','Нет данных'),(11966,'Я буду твоей',1947,93,0.0,7.4,119,'1947-02-02','https://st.kp.yandex.net/images/film_iphone/iphone360_11966.jpg','I\'ll Be Yours','Симпатичная девушка Люси приезжает в Нью-Йорк из провинциального городка Коблескил в поисках счастья и лучшей жизни. Праздная жизнь многомиллионного города увлекает её. И надо же такому случиться, чтобы самый настоящий миллионер и биржевой магнат Уичсберг увлекся провинциалкой и стал оказывать настойчивые знаки внимания.<br><br>Все бы ничего, да вот только возраст биржевого магната уже предпенсионный — около шестидесяти лет. Для того чтобы отвязаться от навязчивого ухажера, девушка выдумывает себе ревнивого мужа. По случайному стечению обстоятельств им «оказывается» молодой юрист Джорж. Молодой человек тоже влюблен в красавицу Люси, но когда он узнает о розыгрыше и своей невольной роли…','Нет данных'),(11974,'Ты никогда не была восхитительнее',1942,97,0.0,7.6,370,'1942-11-19','https://st.kp.yandex.net/images/film_iphone/iphone360_11974.jpg','You Were Never Lovelier','В семействе Акунио дочери выходят замуж по старшинству, очередь за Марией. А та ждет прекрасного принца и не замечает никого. Любящий отец решил разбудить её чувства необычным способом: сам еженедельно пишет дочери анонимные любовные письма и отправляет вместе с букетами орхидей. О, ужас! Дочь неверно понимает источник ухаживаний и влюбляется в нищего танцора. Папаша в ярости.','Нет данных'),(11975,'Рокси Харт',1942,75,0.0,6.3,117,'1942-02-20','https://st.kp.yandex.net/images/film_iphone/iphone360_11975.jpg','Roxie Hart','Амбициозная красотка Рокси Харт, мечтающая о славе и успехе, признается в совершении убийства, чтобы дать толчок своей карьере в шоу-бизнесе.','Нет данных'),(11984,'Дверь на сцену',1937,92,0.0,7.2,404,'1937-10-06','https://st.kp.yandex.net/images/film/11984.jpg','Stage Door','Джинджер Роджерс и Энн Миллер зарабатывают громкими стихами. Люси Бол отваживается на свидание с полным предрассудков лесным бароном.<br><br>Ив Арденн не может вспомнить Гамлета, но ведь человек встречает так много людей в большом городе. А Кэтрин Хепберн становится звездой Бродвея благодаря пьесе, в которой ее словами являются «лилии опять в цвету».','$952 000'),(11985,'Сто мужчин и одна девушка',1937,84,0.0,6.9,326,'1937-09-05','https://st.kp.yandex.net/images/film/11985.jpg','One Hundred Men and a Girl','Патриция (Дина Дурбин) — дочь безработного музыканта. Её отец (Адолф Менжу) когда-то играл в известном и популярном симфоническом оркестре, но пришли тяжелые времена, и он потерял работу и остался без средств. Патриция решает помочь. Она собирает оркестр из безработных музыкантов. Девушка находит мецената, который соглашается субсидировать оркестр, при условии, что она сможет уговорить знаменитого Леопольда Стоковски, стать руководителем нового коллектива. Патриция сумела убедить Стоковски, что работа с оркестром из ста мужчин и одной девушки это то, что нужно великому американскому дирижеру…','$762 000'),(11987,'Звезда родилась',1937,111,0.0,7.1,599,'1937-04-20','https://st.kp.yandex.net/images/film_iphone/iphone360_11987.jpg','A Star Is Born','Норман Майн — киноактёр, чей пик славы уже ушёл в прошлое, но которого всё ещё уважает его продюсер и глава студии. Все, кроме самого актёра, знают, что он теряет былую популярность, а фильмы с его участием приносят всё меньше и меньше прибыли. На голливудской вечеринке, где он, как обычно, слишком много пьёт, актёр увлекается официанткой Вики Лестор и предлагает девушке сделать из неё звезду.<br><br>Вики с детства мечтает стать актрисой. Актёр с трудом убеждает главу студии сделать для своей пассии кинопробу. Босс, распознав, что героиня талантлива, решает сделать из неё звезду экрана. Проходят дни, Норман и Вики женятся, её карьера складывается удачно, а его уже никто не хочет брать на работу. Так произошло рождение новой звезды, зажжённой любовью угасающего таланта…','$1 173 639'),(12001,'Ранняя слава',1933,74,0.0,6.9,277,'1933-08-16','https://st.kp.yandex.net/images/film_iphone/iphone360_12001.jpg','Morning Glory','Ева Лавлейс, желающая стать актрисой, приехала в Нью-Йорк из маленького городка штата Вермонт, имея при себе только письмо от Бернарда Шоу, в котором он пророчит ей большое будущее. Она пытается попасть на нью-йоркскую сцену театра и при этом настроена решительно и оптимистично.','Нет данных'),(12010,'Первая полоса',1931,101,0.0,5.9,169,'1931-03-19','https://st.kp.yandex.net/images/film_iphone/iphone360_12010.jpg','The Front Page','Репортер Хилди Джонсон планирует перебраться в Нью-Йорк на более высокооплачиваемую работу. Он попадает в пресс-центр городской тюрьмы, где группа газетных репортеров праздно ждет оглашение приговора над преступником-коммунистом, обвиняемом в убийстве. Когда тот сбегает, в пресс-центре начинается настоящий переполох. Политика, система правосудия, коммунистическая истерия, любовь и брак — такие острые темы высмеивают авторы в этой картине.','Нет данных'),(12059,'Шейх',1921,80,0.0,6.4,238,'1921-10-30','https://st.kp.yandex.net/images/film_iphone/iphone360_12059.jpg','The Sheik','В песках Сахары есть оазис — город Бискра, где богатые арабы выбирают себе невест и наложниц. Сюда прибыл и шейх Ахмед Бен Хасан — глава процветающего клана. Когда он увидел красавицу-англичанку Диану Мэйо, строптивую и своенравную девушку, то с первого взгляда влюбился в нее и решил, что она станет его женой. Диана высокомерно не замечает красивого поклонника. Но однажды она отправилась в путешествие по пустыне в сопровождении одних арабов, и шейх похитил ее…','Нет данных'),(12061,'Три мушкетера',1921,119,0.0,6.4,139,'1921-08-28','https://st.kp.yandex.net/images/film_iphone/iphone360_12061.jpg','The Three Musketeers','В облике мушкетера Дуглас Файрбенкс восстанавливает утраченный мужской идеал. «Мушкетерская сторона ослепительна, но и линия истомы и пресыщения вызывают восторг», — писал в те годы молодой идеолог французского «авангардного» кино Луи Деллюк.','Нет данных'),(12069,'Дикий и дремучий',1917,72,0.0,6.2,97,'1917-06-24','https://st.kp.yandex.net/images/film_iphone/iphone360_12069.jpg','Wild and Woolly','Молодой и богатый житель восточного побережья всегда мечтал жить на «диком западе» и собирается переехать в город на западе страны. Он не знает, что дикие времена там давно прошли, и сейчас это обычный цивилизованный город. Горожане, не желая упускать богатого жителя, умудряются изменить город так, чтобы он соответствовал мечтам молодого богача.','Нет данных'),(12083,'Лолита',1962,152,0.0,7.1,12076,'1962-06-13','https://st.kp.yandex.net/images/film_iphone/iphone360_12083.jpg','Lolita','Эмигрант из Европы Гумберт Гумберт, недавно приехавший в Рамсдэйл, Нью-Хэмпшир, в смятении чувств разработал хитроумный план. Он собирается жениться на Шарлотте Хэйз. Таким образом он всегда сможет находиться рядом со своей возлюбленной — прелестной дочерью Шарлотты!','$2 000 000'),(12084,'Моряки',1953,29,0.0,5.5,459,'1953-10-15','https://st.kp.yandex.net/images/film_iphone/iphone360_12084.jpg','The Seafarers','Этот документальный фильм повествует о выгодах вступления в Международный Профсоюз Моряков.','Нет данных'),(12085,'Страх и вожделение',1952,62,0.0,6.1,1598,'1953-03-31','https://st.kp.yandex.net/images/film_iphone/iphone360_12085.jpg','Fear and Desire','Четыре солдата, пойманные в ловушку позади вражеских линий, должны противостоять своим страхам и желаниям…','$33 000'),(12086,'Летящий падре',1951,8,0.0,5.9,909,'1951-03-23','https://st.kp.yandex.net/images/film/12086.jpg','Flying Padre','Фильм рассказывает о двух днях жизни Отца Фреда Стадмюллера.','Нет данных'),(12087,'День боя',1951,16,0.0,6.1,879,'1951-03-30','https://st.kp.yandex.net/images/film_iphone/iphone360_12087.jpg','Day of the Fight','Главному герою фильма, Уолтеру Картиру, боксеру в среднем весе, предстоит сразиться на ринге.','Нет данных'),(12089,'Король футбола',1999,98,0.0,5.3,155,'1999-02-01','https://st.kp.yandex.net/images/film/12089.jpg','Soccer Dog: The Movie','История приключений пса Линкольна и его лучшего друга Клея. Круглый сирота, Клей, по совету приемных родителей, записывается в детскую футбольную команду, но все равно чувствует себя одиноким — до знакомства с бездомным псом Линкольном. Они становятся лучшими друзьями.<br><br>Линкольн тоже любит футбол и так хорошо играет, что однажды тренер решает выпустить его на поле вместо травмированного игрока. Благодаря Линкольну, команда выигрывает матч за матчем и выходит в финал. Весь город — без ума от новой звезды футбола. Но фанаты Линкольна и не подозревают о грозящей псу опасности: злой Собаколов собирается изловить его и снять с него шкуру. Спасти Линкольна могут только Клей и его приемный отец.','$500 000'),(12090,'Мистер и миссис Смит',2005,120,0.0,7.5,198689,'2005-06-07','https://st.kp.yandex.net/images/film_iphone/iphone360_12090.jpg','Mr. & Mrs. Smith','Джон и Джейн женаты не так давно, но уже устали от брака. Им кажется, что они знают друг о друге всё. Но есть кое-что, что каждый предпочитает держать при себе: оба они — наёмные убийцы, которые тайно путешествуют по миру, выполняя опасные миссии. Эти отдельные тайные приключения становятся их общей судьбой в тот момент, когда Джейн получает заказ на Джона, а Джон — на Джейн.','$110 000 000'),(12091,'Темная сторона солнца',1988,101,0.0,7.2,3686,'1988-12-21','https://st.kp.yandex.net/images/film_iphone/iphone360_12091.jpg','The Dark Side of the Sun','Рик Клейтон с рождения поражен страшным недугом. Его кожа не переносит света — как солнечного, так и электрического. С ног до головы облаченный в защитное кожаное одеяние, он даже не знает своего лица.<br /><br />Но молодая американская актриса, почти случайно оказавшаяся в небольшом городке на Адриатическом побережье, покоряет сердце живого призрака и вырывает его из вечной тьмы. Любовь толкает его на безрассудство: Рик решает познать всю радость, которую дарит людям солнечный свет. За короткие три дня ему предстоит прожить свою жизнь полно и ярко и потерять последнюю надежду на выздоровление.','Нет данных'),(12092,'Услуга',1991,97,0.0,5.7,535,'1994-04-29','https://st.kp.yandex.net/images/film_iphone/iphone360_12092.jpg','The Favor','Замужняя женщина Кэти предается мечтам о том, как было бы хорошо переспать со своим старым приятелем, бывшим первым красавцем в школе, Томом. В итоге, она просит сделать это свою подругу Эмили, чтобы та потом рассказала ей, насколько он хорош. Взаимоотношения подруг осложняются, когда оказывается, что Том действительно хорош, а Эмили беременна. Теперь только надо выяснить от кого: Тома или своего парня Элиота.','$13 000 000'),(12093,'Калифорния',1993,118,0.0,7.0,7469,'1993-09-03','https://st.kp.yandex.net/images/film_iphone/iphone360_12093.jpg','Kalifornia','Журналист и его любовница-фотограф, изучают поведение убийц-маньяков, собирая материалы для книги. В особенности их интересуют места, где совершаются преступления. Они отправляются в экспедицию на автомобиле и ненароком подсаживают в машину еще одну парочку.<br><br>Уж лучше бы они этого не делали — ведь угрюмый заросший детина, сопровождаемый писклявой дурехой, — сумасшедший психопат каких поискать. Незадачливые криминологи на своей шкуре опробуют «поведение» изучаемого контингента.','$9 000 000'),(12097,'Сокращая класс',1988,91,0.0,5.3,1109,'1989-03-24','https://st.kp.yandex.net/images/film_iphone/iphone360_12097.jpg','Cutting Class','В средней школе происходит серия загадочных убийств. Подозрения падают на Брайна, только недавно вышедшего из психиатрической лечебницы, в которую он был помещен после загадочной смерти его отца. Так кто же все-таки убийца? Брайан? Или кто-то просто прикрывается его выходом из больницы?','Нет данных'),(12098,'Меньше нуля',1987,98,0.0,7.3,1981,'1987-11-06','https://st.kp.yandex.net/images/film_iphone/iphone360_12098.jpg','Less Than Zero','Вернувшись в свой родной городок после нескольких лет отсутствия, Клей обнаруживает, что дела идут совсем плохо. Его бывшая девушка, Блэр, когда-то изменившая ему с его лучшим другом Джулианом, умоляет Клея о помощи: Джулиан связался с бандитами, стал торговать наркотиками, он все ниже скатывается по наклонной плоскости, а, кроме Клея, просить поддержки просто не у кого…','Нет данных'),(12101,'Женские сплетни',1999,97,0.0,7.1,255,'1999-09-17','https://st.kp.yandex.net/images/film_iphone/iphone360_12101.jpg','Women Talking Dirty','Известная художница Эллен приглашает свою лучшую подругу Кору на вечеринку, устроенную по поводу только что состоявшегося развода Эллен с мужем. Обе женщины ощущают потребность найти общий язык друг с другом. И им есть о чем поговорить: о возлюбленных, о детях, о долгах, и даже о водке…','$5 000 000'),(12102,'Теория полета',1998,101,0.0,7.0,272,'1998-09-11','https://st.kp.yandex.net/images/film_iphone/iphone360_12102.jpg','The Theory of Flight','Одержимый полетами, Ричард однажды приземляется по ту сторону закона и оказывается в службе сервиса, где знакомится с безнадежно больной Джейн Хэтчард.<br><br>Еще более решительная, чем Ричард, молодая женщина озадачивает его неожиданной просьбой: помочь ей испытать настоящую любовную страсть. Обоюдное желание разрешить проблему выводит их на слишком извилистый путь: ведь каждый из них хочет достичь результата своим способом.','Нет данных'),(12103,'Мстители: Игра для двоих',1998,86,0.0,7.0,720,'1998-06-09','https://st.kp.yandex.net/images/film_iphone/iphone360_12103.jpg','The Revengers\' Comedies','Одной ненастной ночью на лондонском мосту столкнулись два самоубийцы. Генри Белл — несчастный служащий, жизнь которого оказалась в руинах после того, как нахальный коллега беззастенчиво занял его место в фирме. Кэрен Найтли — эксцентричная аристократка, которую покинул любовник, решивший вернуться к законной супруге.<br><br>Два промокших и несчастных человека: Генри, оставшийся без работы и дома, и Кэрен, сердце которой разбито вдребезги. Встреча двух неудачников оказалась роковой. Посчитав уход из жизни слишком легким путем, они решают отомстить своим обидчикам…','Нет данных'),(12105,'Цветы любви',1997,101,0.0,6.8,257,'1997-09-08','https://st.kp.yandex.net/images/film_iphone/iphone360_12105.jpg','Keep the Aspidistra Flying','Гордон был одним из самых многообещающих сотрудников рекламного агентства в Лондоне. Но однажды, прочитав хвалебную рецензию на книгу своих стихов, он решил стать свободным художником. Однако «богемная жизнь» поэта оказалась совсем не такой, какой представлял ее себе Гордон.<br><br>Этот новый образ существования — испытание в любви и верности его красивой и умной возлюбленной, Розмари. Она уговаривает Гордона остепениться и вернуться в оставленный им респектабельный и уютный мир.','Нет данных'),(12107,'Музей Маргариты',1995,114,0.0,6.1,98,'1995-09-13','https://st.kp.yandex.net/images/film_iphone/iphone360_12107.jpg','Margaret\'s Museum','В городке, где половина мужчин умирает на угольных шахтах, Маргарет Макнейли счастлива быть незамужней. До тех пор, пока не встречает Нила Карри — красивого и честного, играющего на волынке паренька-посудомойщика с гаэльским акцентом. Но сколько ни старайся — смерть не обмануть.','Нет данных'),(12108,'Куда боятся ступить ангелы',1991,116,0.0,6.4,236,'1991-06-21','https://st.kp.yandex.net/images/film_iphone/iphone360_12108.jpg','Where Angels Fear to Tread','Молодая вдова Лилия Херритон едет в Италию, чтобы набраться сил. Через достаточно короткое время ее английские родственники получают известие о предстоящей помолвке Лилии с неким итальянцем Джино Карелла. Большего покушения на исконно британские порядки семейный клан Херритонов и представить себе не мог…','Нет данных'),(12109,'Франциск',1989,150,0.0,7.2,1363,'1989-03-22','https://st.kp.yandex.net/images/film_iphone/iphone360_12109.jpg','Francesco','Экранизация сюжета о святом Франциске Асизском. Его биография в свое время тоже считалась скандальной поразила весь христианский мир. Сын богатых родителей, Франциск (в итальянской интерпретации Франческо) бросил богатство и родителей и ушел в пустыню, убивать плоть и молиться… Зачем?..','DEM 22 000 000'),(12110,'Всё как надо',1989,102,0.0,5.9,90,'1989-05-05','https://st.kp.yandex.net/images/film_iphone/iphone360_12110.jpg','Getting It Right','Гэвину 31 год, но он всё ещё живёт с родителями. Он очень застенчив и не даже не может предположить, что им увлекутся такие женщины, как настоящая леди Минерва Мандей и сексуально озабоченная миллионерша Джоан. Но Гэвин предпочтёт им не очень красивую парикмахершу…','Нет данных'),(12111,'Маска',1988,90,0.0,7.0,123,'1988-05-20','https://st.kp.yandex.net/images/film/12111.jpg','La maschera','Семнадцатый век. Пресыщенный аристократ Леонардо влюбляется в молодую актрису с красивым именем Айрис. Он пытается соблазнить девушку, но она отвергает его.<br><br>Позднее, когда Айрис оставляет театр и уезжает из города, Леонардо бросается вслед за возлюбленной в надежде добиться ее любви. Так начинается долгое путешествие, которое изменит жизнь обоих.','Нет данных'),(12114,'Экстремальное свидание',2005,91,0.0,6.4,514,'2005-06-23','https://st.kp.yandex.net/images/film_iphone/iphone360_12114.jpg','Extreme Dating','Четверо друзей-приятелей мечтают о настоящей любви. Но все их усилия отыскать своих избранниц остаются безуспешными, пока один из них не находит себе невесту во время горнолыжной прогулки благодаря… несчастному случаю, произошедшему с ним во время спуска с горы. Остальные быстро смекают, что чрезвычайные обстоятельства очень способствуют возникновению взаимной симпатии.<br><br>После нескольких неудачных попыток организовать друг для друга экстремальные свидания они, наконец, разрабатывают хитроумный план — нанимают двух головорезов, которые согласились разыграть «похищение» одного из них вместе с понравившейся ему красоткой. Во время вынужденного плена и счастливого спасения между «узниками» должны возникнуть романтические отношения…<br><br>Но с самого начала все пошло наперекосяк — нанятые похитители решили изменить правила игры. И теперь надо забыть о романтике и на полном серьёзе спасать похищенных неудачников. Но даже самые невероятные приключения не помеха для настоящей любви!','$2 500 000'),(12118,'Женщина без правил',1999,111,0.0,6.5,319,'1999-09-09','https://st.kp.yandex.net/images/film_iphone/iphone360_12118.jpg','Crazy in Alabama','Люсиль мечтает о карьере телезвезды, но из далекого штата Алабама не видны огни Галактики. Тогда она решается на серьезный шаг: оставляет мужа и дом и отправляется на фабрику грез. Вот только никто не знает, какой ценой Люсиль удалось избавиться от прежней жизни.<br><br>А таинственное содержимое шляпной коробки, путешествующей с ней по всей стране, несомненно, заинтересует первого же встречного полицейского.','$15 000 000'),(12119,'Пистолет в сумочке Бетти Лу',1992,89,0.0,5.8,243,'1992-08-21','https://st.kp.yandex.net/images/film_iphone/iphone360_12119.jpg','The Gun in Betty Lou\'s Handbag','В тихой библиотеке среди книжной пыли может порой подняться настоящий ураган. Бетти Лу обожает своего мужа, но он не уделяет ей достаточно времени. Когда в городе убивают известного мафиози, Бетти находит в реке пистолет — орудие преступления и выдает себя за таинственного киллера. Своим странным поступком она сразу завоевывает себе внимание не только собственного мужа, но и всех жителей города.','$13 000 000'),(12123,'Погоня с Дьяволом',1999,138,0.0,6.3,498,'1999-09-09','https://st.kp.yandex.net/images/film_iphone/iphone360_12123.jpg','Ride with the Devil','Соединенные Штаты, 1861 год. Война и хаос. Джейк Роудел и Джек Булл Чайлз появились в банде по одной единственной причине: из-за убийства отца Джека.<br><br>Объединенные жаждой отмщения, они решают вести кровавую войну с юнионистами. И вскоре неопытные юнцы становятся отчаянными налетчиками. Много раз лишь чудо спасает их.<br><br>Но однажды судьба совершает смертельный поворот и разлучает их навсегда. Злой рок нависает над Джейком и, кажется, что ему от него не уйти!','$38 000 000'),(12125,'Мать Тьма',1996,114,0.0,6.9,310,'1996-08-14','https://st.kp.yandex.net/images/film_iphone/iphone360_12125.jpg','Mother Night','Экранизация романа Курта Воннегута 1962 года. В центре картины — судьба американца, который был шпионом союзников в нацистской Германии во время второй мировой войны. После войны его судили как нацистского преступника.<br><br>Прошли годы, и теперь он пытается доказать свою невиновность всему миру и самому себе.','$6 000 000'),(12127,'Ток-радио',1988,110,0.0,7.5,987,'1988-12-23','https://st.kp.yandex.net/images/film_iphone/iphone360_12127.jpg','Talk Radio','Бэрри Чэмплен каждую ночь приходит в радиостудию в Далласе, чтобы вести беседы с самыми разными людьми, звонящими в прямой эфир. В этих разговорах нет никаких ограничений, запретных тем, поскольку его передача вообще называется «Шок-радио». Сам Чэмплен говорит, что это — обычная работа, такое же шоу, как и все остальные. Однако выясняется, что слова могут спровоцировать убийство.','$4 000 000'),(12128,'Камера',1996,113,0.0,6.7,656,'1996-10-02','https://st.kp.yandex.net/images/film_iphone/iphone360_12128.jpg','The Chamber','В апреле 1967 года в одном из южных штатов расисты взорвали контору еврея. Погибли двое детей. Затем действие переносится в Чикаго 1996 года.<br /><br />Молодой адвокат должен защищать человека, виновного в этом преступлении. Его ждет смертный приговор…','$50 000 000'),(12130,'Бэзил',1998,113,0.0,7.3,1613,'1998-06-09','https://st.kp.yandex.net/images/film_iphone/iphone360_12130.jpg','Basil','Бэзил — открытый и неопытный еще человек из высшего общества страстно влюблен в прекрасную Джулию Шервин. И именно в этот момент ему предстоит познать горечь предательства.<br><br>Бэзил обнаруживает, что стал жертвой зловещего плана мести. Он выслеживает своего мучителя и в жестокой схватке решает свою судьбу…','$10 000 000'),(12131,'Лолита',1997,137,0.0,7.6,37660,'1997-09-25','https://st.kp.yandex.net/images/film_iphone/iphone360_12131.jpg','Lolita','Преподаватель французской литературы Гумберт — европеец англо-швейцарского происхождения — приезжает в маленький американский городок в Новой Англии. Он хорошо воспитан, образован, остроумен и пользуется успехом у женщин. Но его душа больна воспоминаниями о первой любви. И встретив 12-летнюю Лолиту, Гумберт надеется вновь обрести потерянный рай…','$62 000 000'),(12134,'Этакий крутой ублюдок',1996,100,0.0,5.7,291,'1996-02-16','https://st.kp.yandex.net/images/film_iphone/iphone360_12134.jpg','One Tough Bastard','В день рождения дочери на семью сержанта Джона Норта было совершено нападение. Джон очнулся через два месяца в больнице и узнал о том, что жена и дочь зверски убиты. Не слишком доверяя полиции и ФБР, Норт начинает собственное расследование для того, чтобы самостоятельно свершить правосудие.<br><br>Ключ к поискам — татуировка на шее убийцы в виде летучей мыши — вампира, а приманкой для преступников служит новейшее экспериментальное оружие, в торговле которым замешаны и мафия и агенты ФБР.','Нет данных'),(12135,'Чрезмерное насилие 2: Стенка на стенку',1995,88,0.0,5.6,132,'1995-08-29','https://st.kp.yandex.net/images/film_iphone/iphone360_12135.jpg','Excessive Force II: Force on Force','Ветераны спецотряда, выполнявшие самые сложные задания во время боевых действий, решили, уйдя в отставку, организовать тайную компанию наемных убийц. Обезвредить их может только их бывшая коллега Лайдл, служившая вместе с ними, но оставшаяся в армии.<br><br>Для этого у нее есть и личные мотивы — еще в армии, когда она отказалась присоединиться к будущим «бизнесменам», их лидер и ее любовник Харли хладнокровно выстрелил в голову своей любовницы, полагая, что навсегда покончил с ней.<br><br>Но нашелся врач, который поставил Харли на ноги, и она снова стала бойцом форта Орт в Калифорнии…','Нет данных'),(12136,'Тусовщики из супермаркета',1995,94,0.0,7.1,16996,'1995-10-20','https://st.kp.yandex.net/images/film_iphone/iphone360_12136.jpg','Mallrats','Молодые ребята приходят в этот супермаркет не работать, не купить что-нибудь — они просто тусуются. Они ссорятся и мирятся со своими подружками, выясняют отношения, чешут языки, обсуждая друг друга и общих знакомых — перед зрителем вырисовывается жизнь нескольких человек, хотя все действие практически ограничено одним помещением.<br><br>Это тот период, когда человек уже закончил школу, но еще не вошел во взрослую жизнь — бывшие одноклассники держатся вместе, но скоро уже придется взрослеть и брать на себя ответственность. А пока они шалят по инерции.','$6 100 000'),(12137,'ЦРУ: Операция «Алекса 2»',1993,90,0.0,4.9,120,'1993-12-06','https://st.kp.yandex.net/images/film/12137.jpg','CIA II: Target Alexa','Террористы атакуют секретный объект ЦРУ, им все не дает покоя секретная микросхема, с помощью которой можно провести контроль и сопровождение всего ядерного арсенала, обладатель которой может стать хозяином мира. Агент ЦРУ Макс Грейвен вновь обращается за помощью к Алексе, которая крадет эту злосчастную микросхему.','Нет данных'),(12138,'Прямое попадание',1994,89,0.0,5.2,67,'1994-03-31','https://st.kp.yandex.net/images/film_iphone/iphone360_12138.jpg','Direct Hit','Профессиональный убийца, работающий на ЦРУ, выполняет последнее задание, после которого ему была обещана отставка. Но босс нарушает слово и заставляет его выполнить еще одно задание — убить девушку. Когда киллер узнает, что высокопоставленный чиновник хочет избавиться от нее только лишь из личных соображений, а ставка в этой грязной игре — ее дочь, он встает на защиту несчастной, пуская в ход весь свой богатый опыт.','Нет данных'),(12139,'Огненное кольцо 3: Удар льва',1994,90,0.0,5.3,113,'1994-12-27','https://st.kp.yandex.net/images/film_iphone/iphone360_12139.jpg','Lion Strike','Доктор Джонни Ву оказывается вовлеченным в международный картель мафии, когда они похищают его сына.','Нет данных'),(12140,'Нулевой допуск',1994,88,0.0,6.0,297,'1994-06-09','https://st.kp.yandex.net/images/film_iphone/iphone360_12140.jpg','Zero Tolerance','Герой Роберта Патрика — агент ФБР Джефф Дуглас. Это «очень крутой» парень, который расправляется с пятью главарями нарокмафии из картеля «Белая рука» и их бесчисленными охранниками. Джефф ведет в одиночку эту войну, так как должен отомстить преступникам, убившим его семью.','Нет данных'),(12141,'Ночной незнакомец',1994,91,0.0,5.3,82,'1994-11-23','https://st.kp.yandex.net/images/film/12141.jpg','Stranger by Night','Детектив Бобби после длительного расследования обезвредил серийного убийцу, жертвами которого были только женщины. Но совершено новое убийство с тем же «фирменным почерком», и все улики указывают на Бобби. Он и сам не уверен в своей невиновности: из-за пережитой в детстве психической травмы он страдает припадками беспричинной ярости, после которых не может вспомнить, где был и что делал.<br><br>С помощью психотерапевта Энн Бобби пытается докопаться до истины. И приходит к выводу, что тот, кто его подставляет, должен хорошо знать самые интимные подробности его жизни. Так же хорошо, как и Энн. Но убийца вряд ли может быть женщиной. ..','Нет данных'),(12143,'Уличный рыцарь',1993,91,0.0,6.0,120,'1993-03-12','https://st.kp.yandex.net/images/film_iphone/iphone360_12143.jpg','Street Knight','В войну между лордами (латиноамериканцами) и бритвами (чернокожие) вмешиваются неизвестные профессионалы, стравливают молодежные группировки, чтобы запугать своим террором весь город и взять в свои руки реальную власть.','Нет данных'),(12144,'Лучшие из лучших 2',1993,101,0.0,6.8,3384,'1993-03-05','https://st.kp.yandex.net/images/film_iphone/iphone360_12144.jpg','Best of the Best II','Чтобы стать чемпионами, члены американской команды по каратэ должны, преодолеть личные препятствия, проблемы.<br><br>Алекс, Томми и Трэвис попадают в трагические ситуации, и только преданность друг другу — своего рода семейственность — позволяют им стать триумфаторами Лас-Вегаса. Однако жестокое убийство одного из друзей побуждает оставшихся проявить боеспособность не только в спорте.','Нет данных'),(12146,'Школьная тусовка',1992,98,0.0,6.7,180,'1992-06-05','https://st.kp.yandex.net/images/film_iphone/iphone360_12146.jpg','Class Act','Дункан — отличник-гений, Блэйд — неуч-хулиган. Но благодаря беспорядку в школьной документации, парни однажды меняются местами. В результате первого определяют в класс для проблемных подростков, а второго — для продвинутых прилежных учеников.','$7 500 000'),(12147,'Клетка',1989,100,0.0,5.3,156,'1989-09-01','https://st.kp.yandex.net/images/film/12147.jpg','Cage','Когда-то Билли Томас и Скотт Монро плечом к плечу сражались во Вьетнаме. Не раз им приходилось смотреть смерти в лицо. Но тогда сразу можно было понять, кто враг, а кто друг. Теперь же, в мирной жизни, друзьям выпало вступить в новый бой. Они попадают в мир, о существовании которого знали лишь понаслышке, мир Большой Мафии и таинственных китайских триад.<br><br>Мир подпольных боев без правил. У этой мафии лишь один закон: если ты не сними, ты должен быть уничтожен. Билли приходится выйти на Арену Смерти, чтобы уничтожить ее. Но кто сказал, что его враги имеют представление о честном поединке?','Нет данных'),(12148,'Кинджайт: Запретные темы',1988,97,0.0,5.7,172,'1989-02-03','https://st.kp.yandex.net/images/film/12148.jpg','Kinjite: Forbidden Subjects','Была похищена девочка, и стареющий коп из отдела нравов начинает подозревает сутенера, делом которого занимается уже давно. Его дочь сама недавно подверглась приставаниям со стороны выходца из Японии, и оказывается, что похищенная девочка тоже японка… Сможет ли он, плюнув на расовые предрассудки и личную неприязнь честно выполнить свой долг?','Нет данных'),(12149,'Хэллоуин 4: Возвращение Майкла Майерса',1988,88,0.0,5.5,3714,'1988-10-21','https://st.kp.yandex.net/images/film_iphone/iphone360_12149.jpg','Halloween 4: The Return of Michael Myers','Черное одеяние, белая мертвенная маска, нечеловеческая сила — это Майкл Майерс! Самый неистребимый монстр всех времен и народов возвращается, совершив побег при транспортировке из одной психиатрической клиники в другую. В ночь кануна всех святых он снова объявляется в родном городе, истребляя всех на своем пути к главной жертве — маленькой племяннице Джеми…','$5 000 000'),(12150,'Пришельцы с Марса',1986,99,0.0,5.7,392,'1986-06-06','https://st.kp.yandex.net/images/film_iphone/iphone360_12150.jpg','Invaders from Mars','Вторгнувшись на Землю, марсиане обосновываются в американской глубинке и подчиняют себе людей, превращая их в послушные машины. Противостоит им обыкновенный мальчишка, который хочет спасти своих родителей.','$12 000 000'),(12152,'Несмотря ни на что',1984,128,0.0,6.0,467,'1984-03-02','https://st.kp.yandex.net/images/film_iphone/iphone360_12152.jpg','Against All Odds','Профессиональный игрок лос-анджелесской футбольной команды Терри Броган остался без работы — возрастной ценз! Вслед за работой испарились и деньги. Случайная встреча с бывшим приятелем Джейком Уизом, владельцем ночного клуба, была, словно подарок судьбы.<br><br>Джейк предложил бывшему футболисту «временную работу» за весьма щедрое вознаграждение. Нужно всего лишь отыскать сумасбродную подружку Уиза, Джесси, удравшую в Мексику. И Терри отправился на поиски беглянки…','$13 000 000'),(12155,'Неистребимый шпион',1996,81,0.0,6.6,5654,'1996-05-24','https://st.kp.yandex.net/images/film_iphone/iphone360_12155.jpg','Spy Hard','Секретный агент ВД — 40 должен расстроить коварный план суперврага генерала Ранкора — сумасшедшего психопата, потерявшего руки во время взрыва — но он вооружен и очень опасен!<br><br>Миссия суперагента — спасти мир от разрушения, вызволить дочь своей погибшей много лет назад подруги, и, конечно же, внедриться в ряды террористов вместе со своей сексуальной напарницей.','$18 000 000'),(12156,'Кэндимэн 2: Прощание с плотью',1995,94,0.0,5.8,1223,'1995-03-17','https://st.kp.yandex.net/images/film_iphone/iphone360_12156.jpg','Candyman: Farewell to the Flesh','Новый Орлеан. Произнеси пять раз его имя, и он появится. Железный крюк вместо руки да пчелы, летающие вокруг него. Когда — то, сразу после окончания гражданской войны в США, чернокожий раб Дэниел Робитайл пострадал за свою любовь к белой девушке Кэролайн. Отец возлюбленной вместе с другими богатыми землевладельцами отрезали кисть руки раба, обмазали тело медом и оставили того умирать в чистом поле под палящим солнцем и роящими над ним злыми пчелами. Смерть была медленной и мучительной. Именно отсюда пошло его прозвище — Кэндимен. В наше время девушка Энни, прямой потомок Кэролайн, неосторожно произносит магическое заклинание, и Кэндимен появляется. Вместе с ним появляются и многочисленные трупы…','Нет данных'),(12157,'Фантастическая четверка',1994,90,0.0,3.8,761,'1994-05-31','https://st.kp.yandex.net/images/film_iphone/iphone360_12157.jpg','The Fantastic Four','В результате неудачного эксперимента погибает друг Рида Ричардса — Виктор. Десять лет спустя Ричардс собирает команду из четырех человек, чтобы полететь в космос и повторить эксперимент. На этот раз он намерен добиться успеха, чтобы смерть друга не была напрасной. Но в их планы вмешиваются другие силы, в результате чего герои получают необычайные способности.','$1 500 000'),(12158,'Вольный охотник',1993,86,0.0,6.2,235,'1993-05-05','https://st.kp.yandex.net/images/film_iphone/iphone360_12158.jpg','Bounty Tracker','Банда профессиональных убийц, руководимая Эриком Гауссом, начинает уничтожать свидетелей и улики после того, как один из свидетелей стал давать показания против босса мафии Луи Саразена.<br><br>Среди их жертв оказывается Пол Дамон, сотрудник фирмы, отмывающей мафиозные деньги. Его брат Джонни-охотник за преступниками, объявленными в розыск — приезжает в Лос-Анджелес и оказывается в самой гуще событий. Теперь в поисках негодяев у него есть и личный мотив…','Нет данных'),(12160,'Ножницы',1990,102,0.0,6.9,2461,'1991-03-22','https://st.kp.yandex.net/images/film_iphone/iphone360_12160.jpg','Scissors','Молодая женщина Энджи Андерсон становится жертвой психопата, который нападает на неё в лифте. Энджи остаётся живой, но глубочайшая эмоциональная травма изменяет её отношение к миру и со временем не проходит, а трансформируется в паранойю. Её психоаналитик пытается помочь Энджи вернуться к нормальной жизни.<br><br>Вскоре после нападения Энджи знакомится со своими соседями, братьями-близнецами Алексом и Коулом Морганами. Один из братьев хранит страшный секрет, а второй влюбляется в Энджи. Знакомство с братьями окажется для нее роковым.<br><br>Она получает приглашение в таинственную квартиру. Когда она приходит в это место, то с ужасом обнаруживает, что оказалась запертой в дьявольской ловушке, заполненной всеми её подсознательными страхами.','Нет данных'),(12162,'Канун разрушений',1990,99,0.0,5.4,208,'1991-01-18','https://st.kp.yandex.net/images/film_iphone/iphone360_12162.jpg','Eve of Destruction','Гениальная ученая-изобретательница Ева Симмонс создает по абсолютному собственному подобию робота-андроида Еву Восьмую. Вживленная ей психика подвержена влиянию детских травм и сексуальных комплексов создательницы. Во время испытания выходит из-под контроля секретная боевая программа.<br><br>Одержимая идеей устранения негативных факторов прошлой жизни, Ева Восьмая сметает на своем пути любые видимые преграды. Для ее перехвата Симмонс вызывает эксперта по борьбе с терроризмом Джима Маккуэйда.','Нет данных'),(12163,'Восход «Черной луны»',1986,100,0.0,6.1,1424,'1986-01-10','https://st.kp.yandex.net/images/film_iphone/iphone360_12163.jpg','Black Moon Rising','История начинается с угона сверхмощного автомобиля с реактивным двигателем «Черная луна» и становится более запутанной, когда к разборкам между специалистами по незаконной транспортировке, гангстерами и агентами правительственных спецслужб подключается расследование ФБР.','Нет данных'),(12190,'Столик на одного',1999,110,0.0,6.3,138,'1999-07-27','https://st.kp.yandex.net/images/film_iphone/iphone360_12190.jpg','A Table for One','Семейная жизнь Руфи напоминала действующий вулкан. Она то угрожающе затихала, то взрывалась бурной любовью. Руфь подозревала своего мужа в частых изменах.<br><br>Когда Мэтт уезжал на работу, у нее было много времени, чтобы накопившаяся злоба подсказывала все новые и новые способы его убийства. Одним из которых был взведенный самострел, закрепленный под крышкой обеденного стола.<br><br>Оставалось только сделать выбор. Но однажды у них появился новый сосед — Том Бернард. И все изменилось, кроме намерения убить…','Нет данных'),(12191,'Молли',1999,102,0.0,6.6,331,'1999-08-16','https://st.kp.yandex.net/images/film_iphone/iphone360_12191.jpg','Molly','С рождения больная аутизмом, 28 летняя Молли — беззаботная девушка с безудержным интересом к жизни. Ее брат Бак, 32 летний молодой человек стремительно продвигающийся по служебной лестнице, практически не поддерживал связь со своей сестрой все эти годы. До тех пор пока не закрылось учреждение которое о ней заботилось. Он решает забрать ее к себе и с этого момента он не может оставить ее ни на минуту. Дерзкая, непосредственная как ребенок и очень энергичная Молли превращает упорядоченную жизнь брата в хаос. Бак уже на пределе. И тут Молли предлагают сделать экспериментальную нейрохирургическую операцию, которая может полностью ее вылечить.. но стоит ли так рисковать?','$21 000 000'),(12192,'Жестокие игры',1999,97,0.0,7.9,121020,'1999-03-05','https://st.kp.yandex.net/images/film_iphone/iphone360_12192.jpg','Cruel Intentions','Себастьян знает сладкий привкус легких побед. В его руках — чужие тайны и ключи от неприступных спален. Катрин устала от простых интриг и банальных признаний. Тогда современный Казанова и скучающая красавица придумывают себе новое развлечение. В их жестокой игре не хватает только жертвы…','$10 500 000'),(12197,'Короли Догтауна',2005,107,0.0,7.7,14464,'2005-06-03','https://st.kp.yandex.net/images/film_iphone/iphone360_12197.jpg','Lords of Dogtown','70-ые годы. Молодые калифорнийские серферы перебираются на улицы Догтауна — квартала, расположенного в местечке под названием Венеция, где изобретают революционный стиль катания на скейтбордах.<br><br>Демонстрируя настоящие чудеса в пустых плавательных бассейнах, эти лихие ребята положили начало новому экстремальному виду спорта, ставшему новым направлением в поп-культуре и символом целого поколения. Однако обрушившаяся на них внезапная слава разрушает их взаимоотношения, а увлечение серфингом превращается в большой бизнес…','$25 000 000'),(12198,'Игра',1997,129,0.0,8.3,253069,'1997-09-03','https://st.kp.yandex.net/images/film_iphone/iphone360_12198.jpg','The Game','Николас Ван Ортон — само воплощение успеха. Он преуспевает, он невозмутим и спокоен, привык держать любую ситуацию под контролем. На день рождения Николас получает необычный подарок — билет для участия в «Игре».<br><br>Ему обещают, что игра вернет яркие чувства, позволит ощутить вкус и остроту жизни. Вступив в игру, Николас начинает осознавать, что это игра всерьез, игра не на жизнь, а на смерть.','$50 000 000'),(12205,'Бесконечная история',1984,94,0.0,7.9,26233,'1984-04-06','https://st.kp.yandex.net/images/film_iphone/iphone360_12205.jpg','Die unendliche Geschichte','Убегая от школьных хулиганов, 10-летний Бастиан спрятался в старой книжной лавке, где нашел таинственную книгу, изукрашенную орнаментом. Открыв ее, Бастиан попал в призрачный фантастический мир бегающих улиток, летающих собак, бескрылых Драконов Удачи, проказливых эльфов и ходячей каменоломни по имени Камнекус.<br><br>Но волшебной стране Фантазии и ее правительнице, Девочке-Императрице, угрожает страшная напасть под названием Ничто, порожденная «несбывшимися мечтами». Спасти Фантазию могут лишь юный воин Атрейю и сила воображения необыкновенного мечтателя Бастиана…','$27 000 000'),(12209,'Просветление гарантируется',2000,109,0.0,7.4,722,'2000-01-20','https://st.kp.yandex.net/images/film_iphone/iphone360_12209.jpg','Erleuchtung garantiert','Двое братьев отправляются в Японию, в Дзенский монастырь неподалеку от Токио. От одного из братьев только что ушла жена с детьми, у второго тоже полно проблем. По пути в монастырь братья теряют все вещи, деньги. Раз выйдя из гостиницы в центре Токио, уже никогда не могут найти пути обратно и вынуждены ночевать на улице, просить подаяние. Именно так и должна выглядеть дорога в Монастырь: все лишнее, принадлежащее миру, необходимо оставить за воротами храма и… А дальше?','Нет данных'),(12217,'Приключения знаменитого Кота-сыщика',1994,82,0.0,7.7,1946,'1994-11-03','https://st.kp.yandex.net/images/film_iphone/iphone360_12217.jpg','Felidae','Франсис — не простой кот, он — величайший в мире кот-сыщик. Когда его хозяин переезжает на новое место, кот явно не в восторге, на новом месте явно что-то не так: зловещая атмосфера и серия загадочных убийств кошек.<br><br>Франсис приступает к расследованию, и ему необходимо всегда на шаг опережать убийцу, кем бы тот ни был, человеком или котом-монстром — чтобы самому не стать следующей жертвой. Поиски продолжаются, несмотря на попытки воспрепятствовать со стороны враждебного Конга, «крестного отца» округи.<br><br>Но Франсис уже идет по следу и близок к разгадке головоломного заговора котов, возомнивших себя высшей расой и пытающихся вывести путем биологических экспериментов новую кошачью суперпороду, которая поможет им овладеть миром. Этот заговор необходимо остановить любой ценой…','Нет данных'),(12226,'Огонь, лёд и динамит',1990,106,0.0,6.8,171,'1990-10-18','https://st.kp.yandex.net/images/film_iphone/iphone360_12226.jpg','Feuer, Eis & Dynamit','Дела корпорации сэра Джорджа идут не лучшим образом. И все из-за его любви к природе на проекты по охране которой тратятся огромные деньги. Он решает исправить положение единственным способом — завещать все свое состояние фонду Мегатон который проведет совершенно безумные 3-дневные гонки на горных лыжах, велосипедах, байдарках, машинах и коньках по самым крутым трассам. В гонках могут участвовать все кому должен денег сэр Джордж. Победитель получает все — 135 миллионов долларов.','DEM 21 500 000'),(12237,'Вдребезги',1991,98,0.0,6.8,1214,'1991-09-25','https://st.kp.yandex.net/images/film_iphone/iphone360_12237.jpg','Shattered','Преуспевающий архитектор Ден Меррик приходит в себя после страшной автомобильной аварии. Вместо лица-кровавая маска и полная потеря памяти. Жена Джудит и друзья помогают ему восстановить прошлое. Меррик подозревает что-то нечистое и втайне от супруги нанимает частного сыщика, который помогает ему докопаться до истины. Истина откроет много тайн…','$22 000 000'),(12238,'Последствия',1977,100,0.0,7.3,138,'1977-10-29','https://st.kp.yandex.net/images/film_iphone/iphone360_12238.jpg','Die Konsequenz','30-летний профессиональный актёр Мартин попадает в тюрьму за сексуальную связь с 15-летним подростком. На зоне он принимает участие в постановке пьесы и знакомится с Томасом, 16-летним сыном охранника тюрьмы, которому выпала возможность поучаствовать в этой пьесе вместе с заключёнными. Они влюбляются друг в друга, и решают после освобождения Мартина связать свои судьбы, но консервативное общество не принимает их, родители Томаса, не желая признавать гомосексуальность своего сына, отдают его в исправительную школу, где ему ломают психику.','Нет данных'),(12244,'Нокдаун',2005,138,0.0,8.2,118092,'2005-05-23','https://st.kp.yandex.net/images/film_iphone/iphone360_12244.jpg','Cinderella Man','Потерпев несколько поражений кряду, подававший надежды боксёр-тяжеловес Джим Брэддок вынужден бросить спорт. Во времена Великой депрессии Брэддок берётся за любую работу, чтобы прокормить свою жену Мэй и детей. При этом он всё ещё надеется вернуться на ринг. И однажды ему предоставляется такой шанс. В последнюю минуту Джим заменяет другого боксёра и выходит на поединок с претендентом на титул чемпиона мира…','$88 000 000'),(12245,'Тайна Аляски',1999,119,0.0,7.2,2315,'1999-10-01','https://st.kp.yandex.net/images/film/12245.jpg','Mystery, Alaska','Небольшой городок, затерянный среди белого безмолвия далекой Аляски, был обречен остаться лишь на карте, а не в истории. Внезапно он оказался в центре всеобщего внимания, когда местная хоккейная команда приняла вызов фаворита НХЛ, знаменитых `New York Rangers`!<br><br>Взгляды любителей спорта прикованы к маленькому пруду на краю земли, где скоро должен состояться матч века. И исход этого ледового побоища далеко не так очевиден, ведь неизвестно, на что способны таинственные обитатели Аляски.','$28 000 000'),(12246,'На грани разрыва',1997,90,0.0,6.4,673,'1997-10-09','https://st.kp.yandex.net/images/film_iphone/iphone360_12246.jpg','Breaking Up','Стив и Моника влюбились друг в друга бесповоротно, да так, что он — бросил курить, а она — перестала следить за своим весом. Но жизнь вдвоем заставляет их отношения балансировать на грани разрыва, когда невозможно ни уйти, ни остаться…','Нет данных'),(12247,'Небеса в огне',1997,96,0.0,6.0,523,'1997-09-04','https://st.kp.yandex.net/images/film_iphone/iphone360_12247.jpg','Heaven\'s Burning','Японскую невесту по имени Мидори похищают во время медового месяца в качестве заложницы при ограблении банка в Сиднее. Как свидетельницу (она увидела грабителей без масок), ее ждет верная смерть, но ее спасает Колин, водитель машины «ухода».<br><br>Защищая Мидори, Колин убивает младшего брата главаря банды, вызывая на себя гнев и месть Махуда и его крутого отца Бурджана. Защищая хрупкую женщину, уходя от погони гангстеров и мужа, Колин и Мидори несутся через всю страну и в пути страстно влюбляются друг в друга…','Нет данных'),(12248,'Чего мы стоим в жизни',1994,100,0.0,7.1,569,'1994-07-12','https://st.kp.yandex.net/images/film_iphone/iphone360_12248.jpg','The Sum of Us','Овдовевший Гарри Митчелл и его сын Джефф живут в скромном домике в небольшом австралийском городке. Джефф — гей, и Гарри принимает и одобряет его жизненный стиль. Джефф и Гарри одиноки, у нас разный подход к поиску партнера: Гарри ищет жену через агенство, а Джефф знакомится с парнем в местном гей-баре.','AUD 3 465 000'),(12249,'Мгновения любви',1993,120,0.0,7.0,444,'1996-04-19','https://st.kp.yandex.net/images/film_iphone/iphone360_12249.jpg','For the Moment','1942 год, Канада. Вдали от бушующей Европы, охваченной пожаром Второй Мировой войны, проходят военную подготовку 250 000 мужчин и женщин со всего мира. Среди них — отчаянные пилоты Лаклан и Джонни, которым за кротчайший срок надо научиться выстоять в бою с опытными пилотами противника!<br><br>Но в этом чужом краю они обретают не только мужество для решающих битв с врагом, но и новый смысл жизни, наполненной надеждами и романтикой. В это тревожное лето с привкусом страсти и смерти молодые герои сделают всё, чтобы завоевать сердца своих верных подруг и, пережив незабываемые мгновения любви, взмыть в бездонное небо, навстречу багровому зареву фронта.','Нет данных'),(12250,'Серебряный ветер',1993,93,0.0,7.0,679,'1993-09-16','https://st.kp.yandex.net/images/film_iphone/iphone360_12250.jpg','The Silver Brumby','В далеких лесах Австралийских Альп живет необыкновенный герой — Таура, Серебряный Брамби, прекрасный и быстрый как ветер жеребец, рожденный свободным и не знающий, что такое седло. Он — король всех диких лошадей Каскадных гор.<br><br>Ему не страшны любые стихии и опасности. Все почитают мудрого и гордого Тауру, даже его злейший враг — укротитель диких лошадей по прозвищу «Человек». Многие годы «Человек» безуспешно охотится на неуловимого Серебряного Брамби, пытаясь захватить свой самый ценный трофей, накинуть на Тауру узду и поставить к себе в стойло.<br><br>Но лишь маленькой девочке Инди удается подружиться с Серебряным Брамби, которого, как утверждает легенда, невозможно приручить…','Нет данных'),(12251,'Любовь в ритме лимбо',1993,95,0.0,6.4,102,'1993-05-20','https://st.kp.yandex.net/images/film_iphone/iphone360_12251.jpg','Love in Limbo','Австралия конца 50-х. Кенни Риддл как раз в том возрасте, когда думают только об одном. Его выгоняют из школы за продажу рисунков «обнаженной натуры», и его мать, портниха, решает отправить его на попечение дяди Берта, менеджера на фабрике по пошиву одежды. Здесь он знакомится с Барри и Артуром, юным девственником из сторогой семьи баптистов из Уэльса.','Нет данных'),(12252,'Скины',1992,94,0.0,7.0,18992,'1992-09-16','https://st.kp.yandex.net/images/film_iphone/iphone360_12252.jpg','Romper Stomper','Неонацистская группа молодежи терроризирует азиатское население Мельбурна, и в беспрерывный поток насилия вписана любовная история. На страшных, лысых мордах прорезаются человеческие черты, покрытые татуировками куски мяса образуют человеческие тела.<br><br>Азиаты покупают клуб, который немедленно с дикой ненавистью «разносят» белые, и дело здесь, кажется, не просто в цвете кожи. Азиаты в огромном количестве налетают со всех сторон, как из-под земли, и одерживают победу.<br><br>Это война, война за выживание нации против нации на одной территории. Новенькая в банде становится между двумя друзьями. Потрясающая драма ненависти, насилия, отчаяния и любви талантливо поднимает тему на уровень искусства.','Нет данных'),(12253,'Молоты над наковальней',1993,97,0.0,6.9,114,'1994-07-22','https://st.kp.yandex.net/images/film/12253.jpg','Hammers Over the Anvil','Действие разворачивается в маленьком австралийском городке, а рассказ ведет мальчик — жертва полиомиелита, Алан Маршалл. Будучи инвалидом, он тем не менее мечтает стать великолепным наездником, как его герой, Ист Дрисколл. Ист — объездчик лошадей, живет в одиночестве, несмотря на то, что «каждая женщина в городе мечтала о нем». Приезд в город замужней Грэйс МакКалистер ведет к страстной любви между ней и Истом и безответной любви для юного Алана.','Нет данных'),(12254,'Перекресток',1990,92,0.0,6.7,95,'1990-10-18','https://st.kp.yandex.net/images/film_iphone/iphone360_12254.jpg','The Crossing','История о любовном треугольнике. Один единственный день навсегда изменит их жизнь. Сэм, подающий большие надежды студент, изучающий искусство, неожиданно возвращается в родной городок. Встреча с Мег, бывшей подругой, которую он когда-то бросил, возрождает их чувство. Однако она теперь с Джонни, некогда лучшим другом Сэма. Мег предстоит сделать нелегкий выбор.','Нет данных'),(12255,'Кровавая клятва',1990,108,0.0,6.1,96,'1990-07-26','https://st.kp.yandex.net/images/film_iphone/iphone360_12255.jpg','Blood Oath','В декабре 1945 года на индонезийском острове Амбон было обнаружено захоронение трёхсот убитых австралийцев. В чудовищной расправе подозревается японский вице-адмирал барон Такахаши.<br><br>Капитан Роберт Купер назначен австралийским военным трибуналом вести расследование этого случая. У него нелёгкая задача — ведь все потенциальные свидетели либо мертвы, либо репатриированы.','Нет данных'),(12258,'Игры дьявола',2007,111,0.0,6.7,5884,'2007-09-07','https://st.kp.yandex.net/images/film_iphone/iphone360_12258.jpg','Before the Devil Knows You\'re Dead','Два брата замыслили идеальное, как им кажется, преступление. В теории они должны получить огромную сумму денег, обойдясь при этом без оружия, жестокости и кровопролития. Более того, вероятность неудачи сведена к нулю. Однако хитроумный план идет прахом, когда соучастник героев самовольно меняет правила игры и подвергает себя и подельников неоправданному риску. Преступники теряют контроль над ситуацией, а череда последующих событий, увы, никого не оставляет в безопасности.','$18 000 000'),(12261,'Холостяк',1999,101,0.0,6.6,3152,'1999-11-03','https://st.kp.yandex.net/images/film_iphone/iphone360_12261.jpg','The Bachelor','Многие хотят жениться на красивой. А вот некоторые не хотят жениться совсем, ценя свободу дороже всего на свете! Джимми Шеннон был из таких. И хотя ряды его холостяцкой компании пустеют день ото дня, Джимми продолжает радоваться жизни с очередной подружкой!<br><br>Энн была особенная, но о свадьбе не могло быть и речи! И все же настает роковой день, когда Джимми приходится идти к алтарю. Ради наследства. И выясняется, что сделать это не так просто!','$51 000 000'),(12267,'Исследователи',1985,109,0.0,6.0,709,'1985-07-12','https://st.kp.yandex.net/images/film_iphone/iphone360_12267.jpg','Explorers','Подростков Бена и Вольфганга объединяет любовь к космосу и изобретательству. Движимые необычным сном, они со своим новым знакомым создают из найденных на свалке деталей небольшой космический корабль, управляемый и защищаемый силовым полем. Однако во время их первого полета кто-то извне внезапно перехватывает управление кораблем. Как выясняется, наши герои — не единственные в этой Вселенной, кто мечтает вступить в контакт с другими цивилизациями.','$25 000 000'),(12268,'О, Боже! Ты дьявол',1984,97,0.0,5.5,80,'1984-11-09','https://st.kp.yandex.net/images/film_iphone/iphone360_12268.jpg','Oh, God! You Devil','Дьявол, представившийся Гарри Тофетом, предлагает безработному музыканту Билли Шелтону контракт, по которому обязуется его сделать суперзвездой, естественно, предмет контракта — бессмертная душа Билли. Музыкант все же подписывает контракт, и теперь сделка есть сделка до поры до времени, пока в это дело не вмешивается сам Бог…','Нет данных'),(12269,'Танк',1984,113,0.0,6.2,335,'1984-03-16','https://st.kp.yandex.net/images/film_iphone/iphone360_12269.jpg','Tank','После того, как его сына посадили за решетку за преступление, которого тот не совершал, американский сержант решает взять дело в свои руки. Он попадает в заголовки всех газет, когда отправляется к шерифу на собственном танке.','Нет данных'),(12272,'Я мечтала об Африке',2000,114,0.0,6.5,595,'2000-05-05','https://st.kp.yandex.net/images/film_iphone/iphone360_12272.jpg','I Dreamed of Africa','Куки кардинально меняет свою жизнь, переезжая с новым мужем в Африку. Но сказочный континент подозрительно относится к незваным гостям. В то время как Куки пытается построить новый дом и семью на чужом материке, дикая фортуна наносит ей удар за ударом. Ведь под злым солнцем Африки так трудно обрести счастье. И еще трудней выжить.','$50 000 000'),(12274,'Надин',1987,78,0.0,6.2,468,'1987-05-27','https://st.kp.yandex.net/images/film_iphone/iphone360_12274.jpg','Nadine','Надин и Вернон собираются разводиться. Однако, обнаружив у себя чужие документы и став невольной свидетельницей убийства, Надин обращается за помощью к своему «почти бывшему» мужу, и их любовь разгорается с новой силой…','$12 000 000'),(12276,'9 1/2 недель',1985,117,0.0,7.4,35256,'1986-02-14','https://st.kp.yandex.net/images/film_iphone/iphone360_12276.jpg','Nine 1/2 Weeks','Когда Элизабет встречает Джона, ее уравновешенность улетучивается в одно мгновение. Изощренный соблазнитель втягивает ее в эффектную любовную игру, которая заставляет ее отказаться от прежних жизненных принципов. Их свидания — это утоление голода, это мед, стекающий по ее груди, это клубника, которую он губами вынимает у нее изо рта.<br><br>Их постель — это металлическая лестница в подворотне, где они занимаются любовью. И сама их любовь — это дождь, льющийся из разверзшихся небес, это землетрясение, это всесокрушающий ураган.<br><br>Их любовь — это трагическая невозможность жить вместе, потому что вместо вопроса «что я могу сделать для тебя?» оба задаются вопросом «на что ты готов пойти ради меня?»…','$17 000 000'),(12277,'Мужчина, который любил женщин',1983,110,0.0,5.8,232,'1983-12-16','https://st.kp.yandex.net/images/film_iphone/iphone360_12277.jpg','The Man Who Loved Women','Скульптор Дэвид Фоулер в расцвете лет не в силах отказать ни одной женщине. Более того: он бегает за каждой юбкой, за каждой парой симпатичных ног, за каждым призывным или даже ничего не обещающим взглядом. О его похождениях рассказывает психоаналитик Марианна, к которой тот обратился за помощью и … неизбежно влюбился.','$19 000 000'),(12278,'Золотая жила',1982,101,0.0,5.9,166,'1982-09-23','https://st.kp.yandex.net/images/film_iphone/iphone360_12278.jpg','Mother Lode','В этой жизни слишком много хороших вещей, чтобы не хотеть стать богатым. Пилот-авантюрист Жан Дюпре и его очаровательная подруга Андреа отправляются в глухие дебри Британской Колумбии на поиски заброшенной шахты, где по их информации, может находиться неразработанная золотоносная жила. Однако полет на небольшом биплане не оказался легкой и быстрой прогулкой за богатством — потерявший управление самолет падает в лесное озеро, а чудом выжившие при падении золотоискатели остаются один на один с дикой природой…','Нет данных'),(12280,'История одного похищения',2000,81,0.0,6.4,552,'2000-05-12','https://st.kp.yandex.net/images/film_iphone/iphone360_12280.jpg','Screwed','Шоферу Вилларду Филлмору крупно не повезло в жизни. Его босс, мисс Крок, адское создание, постоянно придирается к бедному Вилларду. Обуреваемый жаждой справедливой мести, Виллард заручается поддержкой своего лучшего друга Расти и решает похитить любимую собачку мисс Крок.<br><br>Требуемый выкуп должен утешить бедного шофера. Но жертве покушения удается сбежать, и у мисс Крок зарождаются нехорошие подозрения.<br><br>Друзья обращаются за помощью к безумному агенту похоронного бюро Гроверу Кливеру. Чем больше сообщников, тем больше неприятностей. Цель одна — не проколоться…','$10 000 000'),(12281,'Джек-медведь',1993,95,0.0,7.0,352,'1993-04-02','https://st.kp.yandex.net/images/film_iphone/iphone360_12281.jpg','Jack the Bear','Жизнь телеведущего шоу ужасов Джона Лири была радостной и счастливой до того страшного дня, когда его жена разбилась в автокатастрофе. После ее гибели Джон остается один с двумя сыновьями. Хозяйственные заботы и служебные неурядицы постепенно подрывают его дух, и бедняга начинает пить.<br><br>Неприятности нарастают как снежный ком: Джеку грозит увольнение, а родители жены хотят забрать мальчиков себе. Но все проблемы меркнут, когда сумасшедший сосед-нацист похищает его младшего сына Дилана.','Нет данных'),(12282,'Алюминиевые человечки',1987,108,0.0,6.7,402,'1987-02-18','https://st.kp.yandex.net/images/film_iphone/iphone360_12282.jpg','Tin Men','Бил «ББ» Бабовский и Эрнест Тилли могли никогда не встретиться в этой жизни. Но судьба распорядилась иначе: благодаря автомобильной аварии их пути пересекаются. Но этого мало.<br><br>Оказывается, что они — конкуренты, производители отделочных материалов из алюминия. Этого всего оказалось вполне достаточно, чтобы между ними началась настоящая война.','$11 000 000'),(12283,'Безжалостные люди',1986,90,0.0,7.7,9245,'1986-06-27','https://st.kp.yandex.net/images/film_iphone/iphone360_12283.jpg','Ruthless People','Самой заветной мечтой Сэма Стоуна было избавиться от своей сварливой женушки. И вот его день настал: жену похитили с целью получить кругленькую сумму.<br><br>Естественно, что у Сэма даже в мыслях нет расставаться со своими кровными в обмен на «любимую» супругу. Но он еще не подозревает, что его жена обладает способностью наладить дружеские отношения даже с бандитами.','Нет данных'),(12284,'Жемчужина Нила',1985,106,0.0,7.3,15362,'1985-12-04','https://st.kp.yandex.net/images/film_iphone/iphone360_12284.jpg','The Jewel of the Nile','Герои предыдущей части Джэк и Джоан живут спокойной, размеренной жизнью богатых бездельников. У них есть все, что могут позволить деньги: яхта, виллы, прислуга. Но им скучно.<br><br>Скучно друг с другом, и этим обществом. Чтобы развлечь себя, Джоан принимает приглашение арабского шейха посетить его восточную резиденцию. Но сказка обернулась кошмаром: арабский красавец похищает Джоан и требует выкуп — «жемчужину».<br><br>Джэк, заручившись поддержкой своего нового партнера Ральфа, принимает непростое решение — спасти Джоан. Но есть одно осложнение, Джэку хочет отомстить старый напарник.','$25 000 000'),(12285,'Роман с камнем',1984,106,0.0,7.8,32270,'1984-03-24','https://st.kp.yandex.net/images/film_iphone/iphone360_12285.jpg','Romancing the Stone','Джоан Уайлдер, автор популярных женских романов, находит в своем почтовом ящике пакет, присланный из Колумбии ее сестрой. Телефонный звонок подтверждает самые страшные опасения — сестра похищена, и похитители требуют вернуть пакет.<br><br>Забыв обо всем на свете, Джоан летит на помощь сестре и теряется в первые часы после прилета. Ее пытаются убить, и только вмешательство Джека Колтона, американского наемника, спасет девушку от гибели.<br><br>Вместе их ждут экстремальные приключения в джунглях, поиск сокровищ и, конечно, романтическая любовная история.','$10 000 000'),(12286,'Обезьянник',1981,87,0.0,6.3,94,'1981-04-10','https://st.kp.yandex.net/images/film/12286.jpg','Going Ape!','Фостер получает в наследство от своего отца 5 миллионов, цирк и трех орангутангов. Но есть одно условие — если хотя бы одна из обезьян умрет или заболеет, то он не получит пяти миллионов и они отойдут к президенту Зоологического фонда.','Нет данных'),(12288,'Величайший любовник в мире',1977,89,0.0,6.3,121,'1977-12-18','https://st.kp.yandex.net/images/film_iphone/iphone360_12288.jpg','The World\'s Greatest Lover','Действие происходит в Голливуде 1920-х годов. Герой Уайлдера, булочник Руди Хикмэн, принимает участие в конкурсе, среди участников которого сам Рудольф Валентино. И хотя Руди совсем не актёр, но как это обычно бывает в комедиях положений, ему отчаянно везёт.','Нет данных'),(12293,'Леди Свобода',1971,109,0.0,6.1,83,'1971-12-23','https://st.kp.yandex.net/images/film_iphone/iphone360_12293.jpg','La mortadella','Мадлена и Майкл познакомились в Италии, когда вместе работали на мясокомбинате и принимали участие в забастовке рабочих. Однако их связь была обречена, ведь в Италии разводы запрещены, и женатый Майкл никак не мог расторгнуть свой брак. Спустя четыре года Мадлена отправляется в США, взяв в подарок любимому «мортаделлу», особый сорт колбасы. Но в аэропорту ее задерживают, так как в Америку запрещен ввоз мяса. Итальянка не готова так просто сдаться, но ее ждет еще немало открытий, касающихся странной жизни в Новом Свете и самого Майкла.','Нет данных'),(12294,'Бананы',1971,78,0.0,7.1,3317,'1971-04-28','https://st.kp.yandex.net/images/film_iphone/iphone360_12294.jpg','Bananas','Нью-Йоркец Филдинг Меллиш по уши влюблен в политическую активистку Нэнси, которая в упор его не видит, так как с головой погружена в революцию в одной из «банановых» республик под названием Сан-Маркос.<br><br>Вырядившись в форму а-ля Фидель Кастро и нацепив фальшивую рыжую бороду, Меллиш включается в революционную борьбу и по стечению самых нелепых обстоятельств становится президентом Сан-Маркос.<br><br>Затем он возвращается в Штаты, его разоблачают как жулика, судят за подрывную деятельность и, ко всеобщему удовольствию, он женится на Нэнси.','$2 000 000'),(12302,'Забвение',1999,126,0.0,6.7,195,'1999-05-22','https://st.kp.yandex.net/images/film_iphone/iphone360_12302.jpg','Limbo','Фильм рассказывает о людях, жизни которых пересекаются на грани цивилизации — на заброшенном островке дикой Аляски. Это точно не рай, и слишком холодно, чтобы быть адом…','$10 000 000'),(12308,'Затерянные в Йонкерсе',1993,114,0.0,7.0,92,'1993-05-14','https://st.kp.yandex.net/images/film_iphone/iphone360_12308.jpg','Lost in Yonkers','США, городок Йонкерс близ Нью-Йорка. Идет вторая мировая война. Папа привозит двух сыновей Якова и Артура к бабушке: жена его умерла, а по работе ему придется много разъезжать. Бабушка, еврейка из Германии, которую даже собственный сын, гангстер Лу, называет «железной бабой», действительно очень строга, и внуки ее боятся и ненавидят. Она терроризирует свою дочь, дурочку, влюбленную в такого же дебильного билетера из кинотеатра, внуков, всех, до кого она может добраться. <br><br>Но что-то подсказывает, что не такая уж она и злая. Просто жизнь, очевидно, у нее не сладкая. У дяди Лу крупные неприятности с мафией, и он скрывается в доме бабушки. Он подружился с мальчиками, у которых есть только одна мечта — достать девять тысяч долларов, чтобы отец мог расплатиться с врачами, лечившими их покойную мать…','Нет данных'),(12311,'Восемь выходят из игры',1988,119,0.0,6.7,392,'1988-09-02','https://st.kp.yandex.net/images/film_iphone/iphone360_12311.jpg','Eight Men Out','В 1919 году чикагская бейсбольная команда White Sox проигрывает чемпионат. Два года спустя обнаруживается, что сделано это было нечестным путём и на команду подают иск. В процессе расследования раскрывается механизм давления на бейсбольных игроков.','$6 000 000'),(12312,'Брат с другой планеты',1984,108,0.0,6.3,145,'1984-07-10','https://st.kp.yandex.net/images/film_iphone/iphone360_12312.jpg','The Brother from Another Planet','Беглый раб с чужой планеты совершает вынужденную посадку на Земле. Не замечая в нем ничего необычного, люди принимают его за чернокожего бомжа, и вскоре молчаливый пришелец находит пристанище в Гарлеме, где устраивается на работу в салон игровых автоматов…','Нет данных'),(12313,'Ледяной человек',1984,100,0.0,6.1,185,'1984-03-31','https://st.kp.yandex.net/images/film_iphone/iphone360_12313.jpg','Iceman','Научная экспедиция обнаруживает тело доисторического человека, который, как выясняется в последствии, оказался живым. Это событие будоражит весь научный мир. Однако тщеславие некоторых ученых, пытающихся прославиться за счет невероятного открытия приобретает угрожающий характер. На защиту долгожителя встает один из молодых специалистов, тем самым, ставя под угрозу свою будущую карьеру…','Нет данных'),(12317,'Я не Раппопорт',1996,135,0.0,6.4,65,'1996-12-24','https://st.kp.yandex.net/images/film_iphone/iphone360_12317.jpg','I\'m Not Rappaport','Нату Мойеру восемьдесят один год, и он очень любит поговорить. Нат — заядлый спорщик и непревзойденный оратор. Большую часть времени он проводит в нью-йоркском Центральном Парке. Здесь, сидя на лавочке, он ведет захватывающие беседы со своим приятелем, Мииджем Картером, подслеповатым и приземленным управдомом. Возвышенный бунтарь Нат и саркастичный реалист Мидж вместе составляют прекрасную и ни на что не похожую пару. Два обворожительных старика постоянно ввязываются во всевозможные приключения и забавные ситуации. Они дают отпор случайным грабителям, оказывают помощь опустившейся наркоманке и даже раскуривают косячок марихуаны.','Нет данных'),(12319,'Афера 2',1983,102,0.0,5.6,275,'1983-02-18','https://st.kp.yandex.net/images/film_iphone/iphone360_12319.jpg','The Sting II','Для банды обаятельных и харизматичных мошенников времен Великой Депрессии под предводительством Фарго Гондорффа афера — это не только способ неплохо заработать, но и поиграть в увлекательную игру в кошки-мышки со своими злейшими врагами Дойлом Лоннегэном и Гасом Макалински. Эти бедолаги, почитающие себя акулами криминального мира, ещё даже представить себе не могут, как легко они попадутся в хитроумную ловушку Фарго…','Нет данных'),(12320,'Избранные',1981,108,0.0,7.3,79,'1982-04-30','https://st.kp.yandex.net/images/film_iphone/iphone360_12320.jpg','The Chosen','Экранизация частично автобиографического романа американского еврейского писателя Хаима Потока, который рассказал о дружбе двух подростков, живущих в Бруклине в годы второй мировой войны. Оба они — евреи, но один из них, Ройвен, — сын профессора-сиониста, а у другого, Дэнни, отец — раввин-хасид, который воспитывает детей согласно строгим традициям и с определённой дистанции, и ему не очень нравится, с кем водится сын.','Нет данных'),(12321,'Веселые ребята',1975,111,0.0,6.6,247,'1975-11-06','https://st.kp.yandex.net/images/film_iphone/iphone360_12321.jpg','The Sunshine Boys','В эпоху водевилей Льюис и Кларк были знаменитыми комедиантами. Но после того, как они покинули сцену, они не разговаривали друг с другом целых 20 лет. Племянник Вилли Бен, продюсер нового шоу, надеется добиться воссоединения знаменитого дуэта. Однако, для этого ему придется очень постараться…','Нет данных'),(12322,'Молчаливое бегство',1972,89,0.0,6.3,1417,'1972-03-10','https://st.kp.yandex.net/images/film_iphone/iphone360_12322.jpg','Silent Running','Дело происходит на космической станции, где самоотверженные учёные из последних сил пытаются сохранить последние образцы земной флоры. Но это практически невозможно…','$1 000 000'),(12328,'Неукротимые сердца',2000,116,0.0,6.1,1000,'2000-12-25','https://st.kp.yandex.net/images/film_iphone/iphone360_12328.jpg','All the Pretty Horses','Двое молодых ковбоев — Джон Грэди Коул и Лэйси Роулинс — покидают родной Техас ради поиска приключений и новых друзей в Мексике. И, конечно, с легкостью находят и то, и другое в этом красивом и суровом краю.<br><br>Там, в прериях, где пасутся стада прекрасных диких мустангов, Коул безоглядно влюбляется в дочь богатого ранчеро. Но связь гринго и мексиканки — это табу.<br><br>Не в силах обуздать свою страсть, Коул навлекает на себя, свою любовь и своих друзей смертельную опасность…','$57 000 000'),(12329,'Срочное погружение',2000,95,0.0,3.4,93,'2000-08-24','https://st.kp.yandex.net/images/film/12329.jpg','Submerged','Группа международных террористов захватила оборудование, обеспечивающее управление сверхсекретным военным спутником. Но оно — всего лишь груда металла без головного микрочипа.<br><br>Руководитель проекта лично в сопровождении охраны перевозит спецрейсом из Лос-Анджелеса на Гавайи кейс с микрочипом. Но подставной пилот обрушивает самолет в глубины океана, и группа террористов в аквалангах завладевает заветным кейсом, оставляя выживших в катастрофе пассажиров замурованными в подводном капкане.<br><br>Отряду особого назначения «Морские котики» предстоит непростая задача — спасти людей, погребенных в водной могиле, а также найти и обезвредить террористов, пока они не успели использовать мощнейшее оружие в своих целях.','Нет данных'),(12330,'Ослепленный желаниями',2000,93,0.0,7.3,39564,'2000-10-17','https://st.kp.yandex.net/images/film_iphone/iphone360_12330.jpg','Bedazzled','В этот раз Дьявол принимает обличие распутной красотки. Неудачник-программист — лучший объект для вербовки. Объект продажи — бессмертная душа. Цена — 7 желаний. Но выполняя любое желание продажной души, дьявол не даёт насладиться результатом. В одно мгновение жизнь программиста превращается в настоящий ад.','$48 000 000'),(12331,'Свобода удара',1998,93,0.0,4.5,65,'1998-04-07','https://st.kp.yandex.net/images/film_iphone/iphone360_12331.jpg','Freedom Strike','После окончания двухлетней войны в Персидском заливе лидеры арабских стран решили подписать мирный договор. Однако переговоры сорваны террористами.<br><br>Международные силы быстрого реагирования под кодовым именем «Свобода удара» во главе с Томом Диксоном получают задание внедриться в среду противников мирного договора, освободить заложников и нейтрализовать силы врага. Задание осложнено одним обстоятельством: на карту поставлена жизнь всего человечества.','Нет данных'),(12332,'Цель №1',1997,92,0.0,5.6,275,'1997-06-24','https://st.kp.yandex.net/images/film_iphone/iphone360_12332.jpg','Executive Target','Вы хотите знать, сколько стоит президент США? Ответ на этот интригующий вопрос даст Вам Ник Джеймс, который вынужден участвовать в захвате заложника N 1 Соединенных Штатов Америки. Попав в ловко расставленные сети преступников, Ник должен совершить ограбление банка.<br><br>В случае отказа бандиты обещают убить его жену. После удачного ограбления, не желая отпускать Ника, они вновь шантажируют его, заставляя участвовать в самом скандальном преступлении века. Обманутый Ник понимает, что теперь его свобода крепко связана со свободой президента.','Нет данных'),(12333,'Ворон 2: Город ангелов',1996,84,0.0,5.9,4999,'1996-08-30','https://st.kp.yandex.net/images/film_iphone/iphone360_12333.jpg','The Crow: City of Angels','Свидетель жестокой расправы Эш Корвен, сам становится жертвой. Восставший из мертвых, он вступает в борьбу с силами зла в Лос-Анджелесе. Вместе с художницей, которой он снился во сне, Эш начинает мстить своим убийцам!','$13 000 000'),(12334,'Близко к сердцу',1996,124,0.0,7.2,1435,'1996-03-01','https://st.kp.yandex.net/images/film_iphone/iphone360_12334.jpg','Up Close & Personal','Стареющий мэтр тележурналистики Уоррен Джастис с первого взгляда проникается симпатией к Сэлли, поставившей перед собой задачу стать телезвездой, со второго — открывает в ней талант телеведущей.<br><br>В конце концов Сэлли набирает такую скорость на пути к успеху, что по всем статьям обгоняет своего телеучителя, и теперь ему приходится, переключив скорость, мчаться навстречу опасности, чтобы утвердить свое человеческое достоинство и профессиональное реноме…','$60 000 000'),(12335,'Голографический человек',1995,101,0.0,5.1,306,'1995-04-08','https://st.kp.yandex.net/images/film_iphone/iphone360_12335.jpg','Hologram Man','Действие фильма происходит в США в Лос-Анджелесе в отдалённом будущем. Городом управляет некая «Калифорнийская корпорация», во главе которой стоит Эдвард Джеймсон. Корпорация фактически захватила город, узурпировав права граждан.<br><br>Противостоит корпорации Норман Гэллагер по прозвищу Слэш. В чём-то Норман прав, но он поступает как террорист — убивает часть сотрудников корпорации, губернатора Хэмптона, а также одного из полицейских — Веса Стриклэнда. Поймать же Нормана удаётся полицейскому-новичку Декоде, для которого убитый Вес был лучшим другом и напарником.<br><br>Норман Гэллагер получает тюремный срок, но не в простой тюрьме, а в голографической. В этой тюрьме находится мозг Гэллагера и его гологоафический образ. На бывшего террориста пытаются воздействовать и перевоспитать его. Программа биоперсонального улучшения рассчитана на 5 лет. Через это время бывшего террориста должны выпустить, перепрограммировав его мозг. Но друзьям Нормана удаётся похитить его образ и мозг из голографической тюрьмы до конца срока, когда его ещё не успели перепрограммировать.<br><br>Теперь Слэш снова на свободе, кроме того он обладает сверхспособностями — ведь он нематериальная голограмма и может проходить через стены и огонь, а пули и гранотомёты не причиняют ему никакого вреда. Слэш хочет отомстить тому, кто его арестовал — Декоде. В перестрелке ему фактически удаётся убить полицейского, но ему помогает его подруга Натали, которая тоже делает его голограммой. И теперь Декода обладает теми же способностями, что и Слэш. Он может сразиться с голографическим преступником один на один, нейтрализовать и остановить его.','Нет данных'),(12336,'Жестокая правда',1994,100,0.0,5.2,90,'1994-08-25','https://st.kp.yandex.net/images/film/12336.jpg','The Hard Truth','Сексапильная и обаятельная Лиза станет для двух крутых мужчин «Роковой женщиной». Работая пресс-атташе в одной крупной компании, она задумывает ограбление. Подыскав себе любовника полицейского, она как бы ненавязчиво предложила ему выступить компаньоном. У полицейского много было темперамента, но мало мозгов. Отслужив честно 12 лет в полиции он совсем даже не сколотил состояния. А тут такое простое и выгодное дело.','Нет данных'),(12337,'Смертельный змей',1994,90,0.0,5.8,162,'1994-05-01','https://st.kp.yandex.net/images/film_iphone/iphone360_12337.jpg','Bad Blood','Бывший полицейский, большой специалист по кунфу и стрельбе, отсидевший в тюрьме за уничтожение улик против своего младшего брата, снова вынужден заняться семейными проблемами. На этот раз братишка, отмывающий деньги для наркомафии, стащил у своих работодателей пять миллионов.<br><br>Естественно, его обещали убить вместе с отцом. Старший брат, обожающий отца и все еще привязанный к младшенькому (хотя тот в свое время и устроил ему подлянку), приходит на помощь и учиняет для мафиози маленький Вьетнам, убивая человек триста.','Нет данных'),(12338,'Армейские приключения',1994,92,0.0,6.5,865,'1994-08-12','https://st.kp.yandex.net/images/film_iphone/iphone360_12338.jpg','In the Army Now','Закадычные друзья Боунз и Джек вовсе не думали становиться героями. Они записались в резервисты американской армии, чтобы заработать денег и открыть собственный магазин. Но тихой службы в тылу не получилось. Свободный мир опять в опасности, и вот уже бравые вояки отправляются сражаться в Африку.<br><br>Это совсем не входило в планы Боунза и Джека, которых по уровню героизма в крови обогнал бы и кролик. Но тут, по иронии судьбы, дело обернулось так, что именно этому эксцентричному дуэту предстоит внести основной вклад в победу.','Нет данных'),(12340,'Чужие среди нас',1988,93,0.0,7.2,18350,'1988-11-04','https://st.kp.yandex.net/images/film_iphone/iphone360_12340.jpg','They Live','Однажды простой рабочий-строитель Нейда, которому не очень везёт в жизни, находит необычные солнечные очки. Надев их, он получает возможность увидеть мир таким, какой он есть.<br><br>Реальность пугает! Оказывается, правительство и средства массовой информации бомбардируют людей скрытыми сообщениями, воздействующими на уровне подсознания: «Спите!», «Не давайте волю воображению», «Подчиняйтесь властям».<br><br>А что еще страшнее, Нейда увидел истинное обличье многих политиков и важных членов общества! Они и не люди вовсе, а безобразные и злые инопланетяне с планеты Андромеда. Их миссия на Земле — проводить массовую кампанию по подчинению землян своей воле и держать людей в неведении…<br><br>Нейда должен найти людей, которые, как и он, знают об истинном положении вещей (кто еще мог изготовить эти чудесные очки?), и присоединиться к их движению сопротивления, чтобы бороться!','$4 000 000'),(12341,'Слияние двух лун',1988,104,0.0,6.2,3811,'1988-04-29','https://st.kp.yandex.net/images/film_iphone/iphone360_12341.jpg','Two Moon Junction','Жизнь юной и обворожительной Эйприл похожа на прекрасную сказку — знатные родители, шикарный дом, бабушка-миллионерша и респектабельный жених из богатой аристократической семьи. В высшем обществе они считаются идеальной парой.<br><br>Но за две недели до свадьбы Эйприл, беспокойная и чувственная натура, влюбляется в загадочного мускулистого красавца Перри, работающего в приехавшем в город передвижном парке аттракционов, и они с головой окунаются в омут всепоглощающей страсти.','Нет данных'),(12343,'Свидание с ангелом',1987,105,0.0,6.8,302,'1987-11-20','https://st.kp.yandex.net/images/film_iphone/iphone360_12343.jpg','Date with an Angel','Талантливый молодой музыкант Джим собирается жениться на девушке из богатой семьи. Вместе с ее отцом он будет продавать дорогостоящую косметику и начнет новую жизнь, став богатым и удачливым. Но в один прекрасный день в его бассейн падает ангел в облике красивой женщины, сексуальной, озорной, любящей чипсы и гамбургеры.<br><br>Она не говорит на земных языках, но можно слышать ее мысли. Отныне вся жизнь Джима переворачивается вверх дном: забыв про свою невесту, он влюбляется в посланца небес, его друзья мечтают использовать красавицу-ангела для наживы, одержимая ревностью невеста хочет ее извести, ну а будущий тесть намерен с ее помощью спасти от банкротства свою фабрику по производству косметики …','$8 000 000'),(12344,'Окно спальни',1987,112,0.0,7.0,1723,'1987-01-16','https://st.kp.yandex.net/images/film_iphone/iphone360_12344.jpg','The Bedroom Window','Очаровательная любовница Терри Ламберта — жена его босса Сильвия. Однажды ночью она выглядывает из окна спальни Терри и становится свидетельницей нападения на молодую женщину. Чтобы не скомпрометировать Сильвию Терри соглашается выступить вместо нее свидетелем, но неожиданно становится в глазах полиции главным подозреваемым.<br><br>Его обвиняют в серии жестоких убийств. Для Терри остается единственный путь к спасению — предпринять собственное расследование в попытке найти настоящего убийцу. А единственный человек, который готов помочь Терри — Дениз, та самая жертва нападения, которое произошло под окном его спальни…','Нет данных'),(12345,'Ночь страха',1985,106,0.0,6.8,4904,'1985-08-02','https://st.kp.yandex.net/images/film_iphone/iphone360_12345.jpg','Fright Night','Юный поклонник ужастиков, Чарли, обнаруживает, что его сосед — вампир. Хуже того: соседу не нравится, что кто-то знает его тайну, поэтому жизнь Чарли под вопросом. Полностью отчаявшись, Чарли обращается за помощью к Питеру Винсенту, ведущему программы «Ночь страха», который якобы знает о вампирах все…','$9 000 000'),(12347,'Пограничная полоса',1980,99,0.0,6.2,130,'1980-10-31','https://st.kp.yandex.net/images/film_iphone/iphone360_12347.jpg','Borderline','На Мексиканской границе справедливость отстаивают с оружием в руках. Офицер Джеб Мейнард — начальник пограничного поста в 20 км от Сан-Диего. Джеб отличается обостренным чувством справедливости, и поэтому подчиненные в шутку называют его «последним ковбоем».<br><br>Через границу с Мексикой в Америку непрерывным потоком переправляются наркотики и нелегальные иммигранты. За торговцами «живым товаром» стоят очень влиятельные люди и слишком большие деньги. Контрабандисты готовы уничтожить любого, кто осмелится встать ни их пути.<br><br>И, когда во время обычной проверки на границе погибает патрульный Джексон — лучший друг Джеба, Джеб решает отомстить за смерть друга и навести порядок на своем участке границы.','Нет данных'),(12349,'Остров',1980,109,0.0,5.8,459,'1980-06-13','https://st.kp.yandex.net/images/film_iphone/iphone360_12349.jpg','The Island','Репортер Блэйр Мэйнард упрашивает своего издателя отправить его в окрестности Флориды, где таинственным образом исчезают суда. Но кто бы мог подумать, что обычное журналистское расследование обернется самым сенсационным открытием века?!<br /><br />Выясняется, что причиной страшных исчезновений яхт оказывается не пресловутый Бермудский Треугольник, а… настоящие пираты! Карибский бассейн всегда был знаменитой «пиратской вотчиной», но представить себе, что где-то на бескрайних просторах моря обитает община пиратов, понятия не имеющая, что на дворе двадцатое столетие, было просто невозможно! Но, к сожалению, это оказалось невероятной правдой.<br /><br />Лодка журналиста была взята «на абордаж», а ее пассажиры, Блэйр и его сын Джастин, стали добычей букканиров из семнадцатого века! Теперь посмотрим: сможет ли изнеженный цивилизацией газетчик противостоять свирепым пиратам?!','$22 000 000'),(12353,'Все решается в среду',1978,120,0.0,7.0,330,'1978-05-26','https://st.kp.yandex.net/images/film_iphone/iphone360_12353.jpg','Big Wednesday','Красочная история отношений и взросления трех друзей-серфенгистов протяженностью в 12 лет.','$11 000 000'),(12356,'Лодка «Счастливая леди»',1975,118,0.0,6.2,131,'1975-12-25','https://st.kp.yandex.net/images/film_iphone/iphone360_12356.jpg','Lucky Lady','Тихуана, Мексика во времена «сухого закона». Молодая американка Клэр после смерти мужа становится хозяйкой ночного заведения «Американский клуб «Гарри». Она каждый вечер поет на сцене, пытаясь привлечь клиентов, но дела идут плохо. Поэтому Клэр вместе со своим компаньоном Уокером занимается незаконным бизнесом — переправкой мексиканцев через границу в Америку. Вскоре к ним присоединяется Кибби, знакомый Уокера. В результате оба мужчины влюбляются в Клэр, а она не может выбрать между ними.','Нет данных'),(12357,'Битва за планету обезьян',1973,86,0.0,6.0,2980,'1973-06-15','https://st.kp.yandex.net/images/film_iphone/iphone360_12357.jpg','Battle for the Planet of the Apes','Все новые и новые опасности приносит как людям, так и обезьянам будущее. На карту поставлена сама возможность существования этих биологических видов. И уже всем становится понятно, что только совместные усилия и выход на новый уровень взаимодействия дадут шанс планете в надвигающейся череде катастроф…','$1 800 000'),(12358,'Мой криминальный дядюшка',2002,85,0.0,5.6,341,'2002-09-13','https://st.kp.yandex.net/images/film_iphone/iphone360_12358.jpg','Stealing Harvard','Дафф и Джон — лучшие друзья, но крайне отличаются друг от друга. Дафф — вечно неуспевающий ученик, всю жизнь оказывающий плохое влияние на Джона. Джон — прагматичный, трудолюбивый парень, который лишь хочет жениться на своей давней подруге Илейн. Илейн и Джон поклялись жениться, когда накопят 30,000 $ на дом их мечты. После стольких лет усилий, молодые могут пойти под венец и купить собственный дом.<br><br>Неожиданно поступает звонок от сестры Джона — Петти с невероятными новостями о том, что его племянницу Норин приняли в Северный Университет. Колокола свадьбы умолкают, когда Петти напоминает Джону о его обещании оплатить обучение племянницы в размере как раз таки 30 тысяч долларов. Более того, обучение должно быть оплачено в течение двух недель. Неспособный рассказать о случившемся своей подружке, Джон обращается к своему другу Дафу, чтобы тот помог ему достать необходимую сумму за 2 недели…','$25 000 000'),(12359,'Контрольный выстрел',2001,104,0.0,6.2,82,'2001-08-17','https://st.kp.yandex.net/images/film/12359.jpg','Double Bang','После гибели своего напарника нью-йоркский полицейский Билли Бреннан поклялся любой ценой отомстить его убийцам — даже если ради этого ему придется преступить закон.<br><br>Полицейские, наркоторговцы, киллеры, «крутые парни» и просто случайные свидетели — все крутятся на стремительно разгоняющейся «смертоносной карусели». Идет большая игра, у которой есть лишь одно и очень простое правило: проигравший умирает первым.','Нет данных'),(12360,'Музыка из другой комнаты',1998,104,0.0,7.0,1969,'1998-04-24','https://st.kp.yandex.net/images/film_iphone/iphone360_12360.jpg','Music from Another Room','Пятилетний Дэнни, видя новорожденную Анну, говорит, что женится на ней, и 25 лет спустя, вновь встретив ее, считает, что это не что иное, как судьба. Но ему придется убедить в этом Анну, уже помолвленную с другим…','Нет данных'),(12362,'Ворон',1994,102,0.0,7.9,76626,'1994-05-10','https://st.kp.yandex.net/images/film_iphone/iphone360_12362.jpg','The Crow','Это была мрачная и страшная ночь. Ночь жуткого праздника Хэллоуин. Банда насильников и убийц, ворвавшись в дом молодой пары, жестоко расправилась с рок-музыкантом Эриком и его невестой Шелли.<br><br>Спустя год Эрик Дрэйвен выбирается из могилы и отправляется на поиски убийц. Человек ли он? Или Ворон, жаждущий возмездия?','$15 000 000'),(12364,'Аллигатор 2: Мутация',1991,92,0.0,4.1,326,'1991-03-28','https://st.kp.yandex.net/images/film_iphone/iphone360_12364.jpg','Alligator II: The Mutation','Злой и плохой бизнесмен, наживающийся на чужом здоровье владелец производства ядовитых химикатов, все отходы своих предприятий сливает в городское озеро, куда, кстати, выведены и стоки городской канализации. Местные рыбаки временами забредают сюда в поисках добычи, и вторая серия «Аллигатора» начинается именно в тот момент, когда парочка любителей ночной рыбной ловли повстречалась с облюбовавшим себе новое пристанище гигантским и очень зубастым крокодилом.','$3 000 000'),(12365,'Ордер на смерть',1990,89,0.0,6.5,4996,'1990-09-14','https://st.kp.yandex.net/images/film_iphone/iphone360_12365.jpg','Death Warrant','Офицер Луис Берк, «нечистый на руку» полицейский детектив, отправляется под видом осужденного в тюрьму «Харрисон», чтобы раскрыть серию убийств заключенных. В стенах тюрьмы он сталкивается с жестокостью сокамерников, с коррумпированными охранниками, со смертью и предательством всех мастей. <br /><br />Когда Берк узнает шокирующую тайну тюрьмы, он должен совершить дерзкий побег — его последний шанс вырваться из лап сотен осужденных головорезов, возглавляемых его кровным врагом — «Заговорённым».','Нет данных'),(12370,'Глаз тигра',1986,92,0.0,6.1,248,'1986-11-28','https://st.kp.yandex.net/images/film_iphone/iphone360_12370.jpg','Eye of the Tiger','Отслужив во Вьетнаме, Бак Мэтьюс работал прорабом на стройке в своем небольшом городишке в Техасе. Однажды после ссоры в баре, защищая свою жизнь, случайно убил бандита и оказался в тюрьме.<br><br>В заключении спас жизнь одному из очень влиятельных мексиканских гангстеров Джемми, с которым вместе и вышел на свободу. Мексиканец очень хотел отблагодарить Бака и даже предложил ему поехать с ним в Мексику…','Нет данных'),(12373,'Голубой гром',1982,105,0.0,6.8,2483,'1983-02-05','https://st.kp.yandex.net/images/film_iphone/iphone360_12373.jpg','Blue Thunder','«Голубой гром» — это чудо-вертолет, оснащенный супертехникой. Он разработан для того, чтобы надежно оградить Лос-Анджелес от террористов. Но пилот Мёрфи узнает нечто такое, что ему знать вовсе не следовало.<br><br>И вот уже вертолётчику самому приходится защищаться, и единственный путь к спасению — разоблачить высокопоставленных заговорщиков и их наймитов.','$22 000 000'),(12378,'Под откос',2002,89,0.0,4.9,2276,'2002-08-28','https://st.kp.yandex.net/images/film_iphone/iphone360_12378.jpg','Derailed','Новое спецзадание по плечу гениальному оперативнику НАТО Жаку Кристофу. Он должен сопроводить из Словакии в Германию неуловимую воровку Галину, но он не подозревает, что эта рутинная работа станет самой опасной в его карьере.<br><br>Уйдя от погони на узких улочках Братиславы, отчаянные шпионы садятся в поезд до Мюнхена и становятся заложниками банды террористов, чей вожак Мэйсон хочет любой ценой завладеть секретным грузом Галины — новым опаснейшим вирусом оспы. Вскоре Жак понимает, что от его решительных действий зависит не только жизнь пассажиров экспресса, но и судьба всего мира, который охватит страшная эпидемия, если он не обезвредит маньяка, жаждущего власти над миром.','$20 000 000'),(12386,'Первый ребенок страны',1996,101,0.0,6.1,305,'1996-08-30','https://st.kp.yandex.net/images/film_iphone/iphone360_12386.jpg','First Kid','Чернокожий телохранитель Сэм Симмс получает сверхважное задание. он назначен ответственным за жизнь первого ребенка страны — сына президента.<br><br>Большой, нелепый, но добродушнейший охранник, обожающий «неуставные» цветастые галстуки, и с виду заносчивый, но несчастный из-за своего одиночества мальчишка мало-помалу становятся друзьями. Сэм учит сына президента боксировать и помогает ему завести друзей среди ровесников…','Нет данных'),(12388,'Части тела',1992,98,0.0,5.5,179,'1992-03-20','https://st.kp.yandex.net/images/film_iphone/iphone360_12388.jpg','Body Puzzle','Трейси Грант — красивая обеспеченная женщина, судьба к которой явно не благоволит. При очень странных обстоятельствах погибает её брат, затем умирает муж Эйб. Долгие месяцы к ней по почте идут письма и фотографии неприличного содержания. Однажды Трейси обнаруживает в своём холодильнике останки выкопанного из могилы тела супруга и отрезанное человеческое ухо.','Нет данных'),(12389,'Секта',1991,116,0.0,6.5,413,'1991-03-01','https://st.kp.yandex.net/images/film_iphone/iphone360_12389.jpg','La setta','В жизни обыкновенной школьной учительницы Марион появляется пожилой человек. Он выглядит уверенным, серьезным, спокойным. Но вскоре становится понятно, что его планы не так чисты, как можно было подумать сначала. Оказывается, он намерен оплодотворить Марион Антихристом, а сам он является главой секты поклонников Сатаны…','$2 000 000'),(12391,'Домино',1988,97,0.0,4.7,120,'1988-11-11','https://st.kp.yandex.net/images/film_iphone/iphone360_12391.jpg','Domino','Домино — это имя красивой и довольно молодой ещё женщины, которая когда-то была актрисой, а теперь пытается стать режиссёром. Внешне холодная, она, однако, страдает от отсутствия любви и физического удовлетворения. Самое печальное, что она и сама не может никого полюбить и при этом не понимает, почему. Однако у неё есть загадочный тайный поклонник…','Нет данных'),(12392,'Собор',1988,98,0.0,6.3,922,'1989-03-10','https://st.kp.yandex.net/images/film_iphone/iphone360_12392.jpg','La chiesa','Средние века. Тевтонские рыцари уничтожают деревню и убивают всех ее жителей, считающихся ведьмами и колдунами. Чтобы зло не могло распространиться по земле, рыцари хоронят их останки в огромном готическом соборе…<br><br>Наши дни. В церковь прибывает новый библиотекарь Эван, где знакомится с девушкой Лизой, проводящей реставрационные работы. Вскоре они обнаруживают древний пергамент, в котором написано, что в подземелье существует неизвестное захоронение. Естественно, они ломают фундамент церкви и зло, хранившееся в подземелье несколько веков, вырывается наружу. Тела невинно убиенных людей поднимаются из могилы, и начинается кровавая эпопея. Во главе оказавшихся в церкви людей становится священник, отец Гус…','$3 500 000'),(12397,'Я и моя сестра',1987,110,0.0,6.5,84,'1987-12-19','https://st.kp.yandex.net/images/film_iphone/iphone360_12397.jpg','Io e mia sorella','Карло — музыкант, исполняющий классическую музыку в оркестре. Он женат на капризной виолончелистке Сирене. Сестра Карло, Сильвия, убежденная бездельница, которая нигде не работает длительное время. Когда умирает мать Карло, Сильвия приезжает к нему и полностью нарушает обыденную размеренную жизнь семьи Карло. Сильвия ввязывается в авантюру и следом за собой втягивает в нее своего брата, который не знает, что у Сильвии начался роман с одним из лучших адвокатов Милана, которому далеко за шестьдесят. Престарелый любовник готов бросить свою семью ради Сильвии, тогда как последняя, напротив, его любви не желает…','Нет данных'),(12398,'Шкура',1981,130,0.0,6.5,272,'1981-08-27','https://st.kp.yandex.net/images/film_iphone/iphone360_12398.jpg','La pelle','Действие фильма происходит в Италии в конце Второй мировой войны, после высадки там американских войск.','Нет данных'),(12399,'Неаполитанский детектив',1979,114,0.0,6.3,188,'1979-04-12','https://st.kp.yandex.net/images/film_iphone/iphone360_12399.jpg','Giallo napoletano','Скромный музыкант Рафэ, оказавшись случайным свидетелем убийства, решает переквалифицироваться в частного сыщика. В ходе расследования он встречается со странными людьми и постоянно попадает в нелепые и смешные ситуации.','Нет данных'),(12402,'Лучшие планы',1999,92,0.0,6.4,785,'1999-05-14','https://st.kp.yandex.net/images/film_iphone/iphone360_12402.jpg','Best Laid Plans','В маленьком приморском городке Тропико все было тихо, пока Ник не оказался перед выбором: либо найти через два дня круглую сумму, либо умереть. Герой и его подружка Лисса должны что-то предпринять, чтобы срочно достать деньги.<br /><br />Простой, на первый взгляд, выход из создавшегося положения предложил бывший одноклассник Ника Брайс, но когда дошло до дела, все оказалось не так просто…','$7 000 000'),(12413,'Человек-схема 2',1994,98,0.0,4.6,74,'1994-10-26','https://st.kp.yandex.net/images/film_iphone/iphone360_12413.jpg','Plughead Rewired: Circuitry Man II','Будущее под гнетом экологической катастрофы. В научно-исследовательской лаборатории оживляют Пробкоголового…','Нет данных'),(12417,'Человек-схема',1990,93,0.0,5.2,151,'1990-05-25','https://st.kp.yandex.net/images/film_iphone/iphone360_12417.jpg','Circuitry Man','Отравленный воздух, подземные города и животные-мутанты составляют мир фильма. Мир ближайшего будущего, в котором компьютерные программы становятся наркотиком по выбору молодого поколения программируемых людей, а война ведется в электронных системах противников…','Нет данных'),(12418,'Телефон дьявола',1988,105,0.0,5.1,276,'1988-12-09','https://st.kp.yandex.net/images/film_iphone/iphone360_12418.jpg','976-EVIL','Юный Хоакс — обычный подросток с кучей проблем, которого смело можно назвать полным неудачником. Но все меняется, когда ему на глаза попадается реклама с предложением позвонить по телефону 976-ЗЛО и получить некие необычные услуги. <br><br>Герой набирает номер не подозревая, что обращается за помощью прямехонько в преисподнюю! И там готовы поставить на службу Хоаксу все силы ада… Но услуги платные. И вы знаете какова цена. А вот герой, похоже, забыл, чем расплачиваются те, кто водится с нечистой силой…','Нет данных'),(12419,'Удачное наследство',1988,83,0.0,6.4,299,'1988-08-26','https://st.kp.yandex.net/images/film_iphone/iphone360_12419.jpg','Hot to Trot','Посредственный брокер Фред Чэни получает счастливое наследство — коня по кличке Дон. Что за умница этот Дон! Он и говорить умеет, и читать, и сидеть, и пить кока-колу из соломинки. Такого толкового жеребца даже в цирке не сыщешь.<br><br>Но это еще не всё — Дон умеет играть на бирже, он прирожденный брокер! Работая в одной упряжке на рынке ценных бумаг, конь и его хозяин зарабатывают все деньги Чикаго. И на яблоки хватит коню, и на конфеты для любимой девушки Фреда. Вот что значит, поставить на счастливую лошадку!','Нет данных'),(12420,'Текс',1982,103,0.0,6.8,116,'1982-07-30','https://st.kp.yandex.net/images/film_iphone/iphone360_12420.jpg','Tex','Юные братья, растущие без отца, должны научиться брать на себя ответственность в жизни и улаживать разногласия, укрепляя таким образом отношения друг с другом. Текса воспитывает старший брат — их мать умерла, а отец куда-то исчез.','Нет данных'),(12421,'Четверо друзей',1981,114,0.0,6.7,102,'1981-12-11','https://st.kp.yandex.net/images/film_iphone/iphone360_12421.jpg','Four Friends','США, 60-е годы. Шесть лет назад Данило Прозор приехал вместе с матерью в Восточный Чикаго из Югославии. Здесь живет и работает отец, с которым они были разлучены со времен Второй мировой войны. Теперь Данило — студент Университета Рузвельта. У него трое отличных друзей: атлет Том Дональдсон, толстячок Дэвид Левин и красавица Джорджия Майлз. Все трое друзей влюблены в Джорджию, и пока она экспериментирует с выбором, судьба относит друзей всё дальше друг от друга…','Нет данных'),(12422,'Сосите кегли',1979,96,0.0,4.2,112,'1979-09-24','https://st.kp.yandex.net/images/film_iphone/iphone360_12422.jpg','Squeeze Play','Бейсболл только для мужчин? Наши героини — девушки бейсболистов — решают доказать обратное. И вот появляется самая зажигательная, самая убойная и самая привлекательная бейсболльная команда.','Нет данных'),(12423,'Ангелы здесь не живут',2000,88,0.0,3.0,190,'2002-04-02','https://st.kp.yandex.net/images/film_iphone/iphone360_12423.jpg','Angels Don\'t Sleep Here','У Майкла много лет назад пропал без вести его брат-близнец Джесси. Его загадочное исчезновение не дает Майклу покоя — он возвращается в родной город и устраивается на работу судебным патологоанатомом. Майкл уверен, что, благодаря полученным знаниям в области судебной медицины и доступу к базе данных местной полиции, ему удастся отыскать следы брата и узнать, что же с ним произошло.<br><br>Однако вскоре Майкл оказывается втянутым в грязную историю: его обвиняют в убийстве одного из местных жителей, поскольку на месте преступления полиция обнаруживает следы крови, по составу полностью идентичной крови Майкла. Чтобы избежать тюрьмы, Майклу надо срочно выяснить — жив ли его брат, и причастен ли он к этому преступлению.','$3 500 000'),(12427,'Паршивая овца',1996,87,0.0,6.7,551,'1996-02-02','https://st.kp.yandex.net/images/film_iphone/iphone360_12427.jpg','Black Sheep','Эл Доннели обладает всеми качествами, необходимыми для того, чтобы сделать карьеру в большой политике. Он прекрасный оратор, легко зажигающий аудиторию. Эл хорош собой и быстро завоевывает расположение окружающих. Вполне вероятно, что в борьбе за губернаторское кресло Элу Доннели не будет равных. Но что гложет этого блестящего кандидата, что подрывает его уверенность в себе?<br><br>Есть в безупречной репутации Эла Доннели одно слабое звено — это его чокнутый брат Майкл. Эл Доннели находит надежный способ обезвредить паршивую овцу. Он приставляет к невменяемому Майклу человека из своей команды, Стива Доддса, и приказывает ему не сводить глаз с трудного брата. Теперь, когда ахиллесова пята надежно скрыта, Эл Доннели вновь обретает уверенность в себе. Его оппонентам не к чему придраться; но вот Стиву Доддсу не повезло…','Нет данных'),(12428,'Доктор Мордрид',1992,75,0.0,5.5,197,'1992-09-24','https://st.kp.yandex.net/images/film_iphone/iphone360_12428.jpg','Doctor Mordrid','На долю доброго земного чародея Мордрид выпала задача защитить планету от злого волшебника Кабала, с которым они в своё время вместе обучались магии.','Нет данных'),(12431,'Рядом с Раем',2002,96,0.0,6.6,183,'2002-08-30','https://st.kp.yandex.net/images/film_iphone/iphone360_12431.jpg','Au plus près du paradis','Фанэтт до сих пор помнит студенческую юность, когда она впервые влюбилась в прекрасного Филиппа. Накануне поездки в Нью-Йорк, где ей предстоит закончить свою новую книгу, Фанэтт получает таинственную записку, в которой Филипп назначает ей свидание на крыше Эмпайр Стэйт Билдинг.<br><br>Через мгновение строки послания смывает дождь. Что это — сон или реальность? Невероятное событие превращает зрелую женщину во влюбленную студентку, которая, забыв обо всём, устремляется навстречу своей судьбе и незабываемым романтическим приключениям…','Нет данных'),(12433,'Шелкопряд',1969,107,0.0,6.8,130,'1969-08-28','https://st.kp.yandex.net/images/film_iphone/iphone360_12433.jpg','The Gypsy Moths','Группа летчиков съезжается на показательное выступление в Канзас. Они останавливаются у Элизабет, тети самого младшего из команды. Один из летчиков, Броуди проводит ночи в стриптиз клубе, а другой заводит роман с Элизабет.','Нет данных'),(12434,'Пруденс и пилюля',1968,92,0.0,6.2,66,'1968-05-23','https://st.kp.yandex.net/images/film_iphone/iphone360_12434.jpg','Prudence and the Pill','Пруденс и её муж давно живут врозь, но в одном доме. Кто-то подменил её противозачаточные таблетки аспирином. Это мог быть кто угодно: юная племянница, горничная, шофер или любовник. Но скорее всего злобный муж хочет, чтобы беременность неверной Пруденс стала поводом для бракоразводного процесса.','Нет данных'),(12435,'Глаз дьявола',1967,96,0.0,6.2,179,'1967-04-24','https://st.kp.yandex.net/images/film_iphone/iphone360_12435.jpg','Eye of the Devil','Удручённый очередным плохим сезоном, маркиз-винодел Филипп де Монфако отправляется лично осмотреть свои виноградники. Своих детей и жену он оставляет в Лондоне, но вскоре те решают последовать за ним. Приехав в фамильный замок, они начинают подозревать, что с главой семейства да и со всеми местными обитателями что-то неладно.','Нет данных'),(12436,'Свадьба на скалах',1965,109,0.0,7.2,131,'1965-09-16','https://st.kp.yandex.net/images/film_iphone/iphone360_12436.jpg','Marriage on the Rocks','Брак героев на грани распада. Чтобы развестись по облегченной процедуре, они отправляются в Мексику.','Нет данных'),(12437,'Ночь игуаны',1964,125,0.0,7.7,674,'1964-06-10','https://st.kp.yandex.net/images/film_iphone/iphone360_12437.jpg','The Night of the Iguana','Запутавшийся и уставший от собственной жизни бывший священник Лоуренс пытается найти хоть капельку спокойствия на берегу моря. Однако оказывается, что люди вокруг нуждаются в любви и внимании ничуть не меньше, чем он сам.','$3 000 000'),(12438,'Меловой сад',1964,106,0.0,7.1,130,'1964-04-02','https://st.kp.yandex.net/images/film_iphone/iphone360_12438.jpg','The Chalk Garden','Эксцентричная старая дама нанимает гувернантку для своей буйной 16-летней внучки Лорел. Девочка обожает избавляться от гувернанток, раскрывая их секреты своей бабушке, но справится ли она со скелетами в ее шкафу своей таинственной новой воспитательницы? И захочет ли Лорел вернуться к своей «блудной» матери?','Нет данных'),(12440,'За отдельными столиками',1958,100,0.0,7.0,428,'1958-12-18','https://st.kp.yandex.net/images/film_iphone/iphone360_12440.jpg','Separate Tables','В ресторане маленького отеля столики рассчитаны только на одну персону. Заправляет отелем Мисс Пэт Купер, дама, старающаяся создать комфортные условия для гостей. Её постояльцев объединяет одно — одиночество. Жизнь отеля идёт своим чередом, пока там не появляется стареющая светская львица Энн Шэнклэнд.','Нет данных'),(12441,'Здравствуй, грусть',1958,94,0.0,7.3,1062,'1958-01-15','https://st.kp.yandex.net/images/film_iphone/iphone360_12441.jpg','Bonjour tristesse','Семнадцатилетняя Сесиль, ее отец Раймон и его подружка Эльза живут на уединенной вилле у Средиземного моря. Однажды Раймон объявляет, что к ним на несколько дней приедет погостить его старая знакомая Анна Ларсен. Сесиль удивлена: что может связывать легкомысленного отца и сдержанную Анну? Вскоре ее удивление перерастает в возмущение, потому что Раймон и Анна сообщают, что собираются пожениться.','Нет данных'),(12442,'Бог знает, мистер Аллисон',1957,108,0.0,7.3,315,'1957-03-13','https://st.kp.yandex.net/images/film_iphone/iphone360_12442.jpg','Heaven Knows, Mr. Allison','Морской пехотинец и монашенка на маленьком атолле в Тихом океане прячутся от японцев, пытаясь скрыть свои чувства друг от друга.','$3 000 000'),(12443,'Чай и симпатия',1956,122,0.0,7.2,220,'1956-09-27','https://st.kp.yandex.net/images/film_iphone/iphone360_12443.jpg','Tea and Sympathy','Том Ли — нежный и чувствительный 17-летний мальчик. Его мать давно оставила семью, а суровый отец хочет, что бы сын «был больше похож на мужчину». В закрытой школе для мальчиков Том, любящий театр, поэзию, музыку и не проявляющий интереса к бейсболу и девушкам, подвергается насмешкам и преследованиям со стороны одноклассников. Жена школьного учителя, Лаура, несчастлива в браке — её муж предпочитает обществу жены компанию учеников, а она не может забыть свою первую любовь — юношу, погибшего на войне. Видя, как страдает Том, Лаура пытается помочь ему. Вначале ей кажется, что всё, что она может ему предложить — это «чай и симпатия», но в итоге он получает от неё гораздо, гораздо больше.','Нет данных'),(12444,'Малышка Бесс',1953,112,0.0,7.0,132,'1953-05-21','https://st.kp.yandex.net/images/film_iphone/iphone360_12444.jpg','Young Bess','Эта картина повествует о жизни Елизаветы Первой, прежде чем она стала королевой Англии.','Нет данных'),(12445,'Узник крепости Зенда',1952,96,0.0,6.6,77,'1952-11-04','https://st.kp.yandex.net/images/film_iphone/iphone360_12445.jpg','The Prisoner of Zenda','Для того чтобы сохранить власть в одном маленьком европейском государстве, в котором в виду болезни наследника престол может наследовать другая династия, сторонники старого режима находят двойника наследного принца в Англии, к тому же далекого родственника угасающей династии.<br><br>«Фальшивый принц» как две капли воды похож на больного наследника. Коронация проходит на высшем уровне, символы власти вручены и теперь он король. Мантия так самозванцу идет, что даже близкие родственники не могут сомневаться, что перед ними не король. Самая красивая девушка королевства делает ему знаки внимания и уже не за горами свадьба. Однако, нашелся «злодей», который разгадал замысел заговорщиков и раскрыл обман.<br><br>Лжекороль заточен в темницу, но история на этом не заканчивается, ведь любовь должна победить, влюбленные встретиться, а злодеи и завистники должны быть наказаны. Как это произойдет, можно узнать, только посмотрев фильм до конца…','Нет данных'),(12446,'Камо грядеши?',1951,171,0.0,7.4,1238,'1951-11-08','https://st.kp.yandex.net/images/film_iphone/iphone360_12446.jpg','Quo Vadis','Римская империя I века н. э. Военные победы. Кровавые зрелища в амфитеатрах. Гонения на новую веру. Запретная любовь патриция к пленнице-христианке. Пожар в Вечном городе (дело рук одержимого манией величия Нерона). Приговор императору, вынесенный разгневанным народом.','$7 623 000'),(12447,'Копи царя Соломона',1950,103,0.0,6.8,401,'1950-11-09','https://st.kp.yandex.net/images/film_iphone/iphone360_12447.jpg','King Solomon\'s Mines','Занимательные приключения белого охотника, ведущего отряд через Африку в поисках пропавшего мужа леди. Он пропал, когда отправился на поиски легендарных алмазных копей царя Соломона. Великолепные съемки в живописных уголках черного континента, много действия — удовольствие для всех и сейчас. Поставлен фильм по мотивам романа Хенри Райдера Хаггарда…','Нет данных'),(12450,'Черный нарцисс',1947,100,0.0,6.8,1311,'1947-04-24','https://st.kp.yandex.net/images/film/12450.jpg','Black Narcissus','Уставшие от неопределенностей и мирских страстей пять католических монахинь-миссионеров во главе с сестрой Клодаг приезжают в далекое Гималайское селение, чтобы основать там школу.<br><br>Однако крах в отношениях с местным белым поселенцем мистером Дином, суровый климат, растущая тяга к дому и, наконец, слабеющая вера вскоре приводят женщин к пониманию того, что им остается либо покинуть это место, либо умереть.','£280 000'),(12452,'Совершенные незнакомцы',1945,102,0.0,5.4,98,'1945-10-15','https://st.kp.yandex.net/images/film_iphone/iphone360_12452.jpg','Perfect Strangers','Роберт и Катрин отпраздновали скромную свадьбу перед тем, как Вторая мировая война разделила их на три года. Служба в флоте меняет их обоих, и они понимают, как сильно им претила прежняя мирная жизнь вместе. Оба боятся неизбежного воссоединения, и каждый решил попросить развода, но действительно ли их браку пришел конец?','Нет данных'),(12457,'Майор Барбара',1941,131,0.0,6.1,107,'1941-03-20','https://st.kp.yandex.net/images/film_iphone/iphone360_12457.jpg','Major Barbara','Молодой идеалистке, посвятившей свою жизнь Армии спасения, приходит в голову мысль, что она сохранит больше жизней, если станет директором отцовского оружейного завода.','Нет данных'),(12470,'Рожденные неприкаянными',1967,113,0.0,5.9,201,'1967-07-12','https://st.kp.yandex.net/images/film_iphone/iphone360_12470.jpg','The Born Losers','Банда рокеров терроризирует маленький американский городок. За городом у них есть дом для оргий, где они насиловали молоденьких девочек и кололись наркотиками. Жители городка боятся их, но бывший «зеленоберетчик» Билли Джек по прозвищу «Индеец» не испугался бандюг…','$360 000'),(12474,'Джентльмены женятся на брюнетках',1955,99,0.0,5.9,142,'1955-09-22','https://st.kp.yandex.net/images/film_iphone/iphone360_12474.jpg','Gentlemen Marry Brunettes','Две шоу-герлз Бродвея, сестры Джонс, устают от суеты Нью-Йорка и решают попытать счастье в Париже, куда незамедлительно отправляются в надежде стать знаменитыми. Отбоя от потенциальных женихов у брюнеток нет, и обе хотят найти свою вторую половинку.','Нет данных'),(12480,'Бледнолицый',1948,91,0.0,6.1,186,'1948-12-24','https://st.kp.yandex.net/images/film_iphone/iphone360_12480.jpg','The Paleface','Кто-то на Диком Западе продает оружие индейцам. Для того, чтобы найти преступников, правительство, в обмен на помилование, отправляет в опасное путешествие Каламити Джейн и секретного агента под прикрытием, которые должны изображать из себя мужа и жену. Когда агента убивают, Джейн приходится срочно найти себе нового «мужа» — дантиста «Безболезненного» Питера Поттера, неудачника и труса, который хочет оставить варварский запад далеко позади и вернуться на восток. Когда на караван фургонов нападают индейцы, свою меткую стрельбу Джейн приписывает Поттеру, который мгновенно становится героем в глазах горожан, прикрытием Джейн, и приманкой для индейцев и торговцев оружием.','Нет данных'),(12482,'Вне закона',1943,116,0.0,5.9,233,'1943-02-05','https://st.kp.yandex.net/images/film_iphone/iphone360_12482.jpg','The Outlaw','Док Холлидей идёт по следам человека, укравшего его любимую лошадь. Они приводят его в городок Линкольн штата Нью-Мексико, где шерифом только что избран старинный друг Дока Пэт Гарретт. Хозяин местного бара даёт им наводку, и они находят лошадь. А с ней и Билли Кида, которому она приглянулась. Но вопреки принципам Док не стремится расквитаться с молодым парнем, и дальше они следуют вместе, беспрестанно ссорясь из-за лошади и своей горячности. После вынужденного убийства, совершённого Билли, шериф хочет его арестовать, но Док отказывается помогать и встаёт на сторону нового приятеля. Однако Гарретту случайно удаётся подстрелить Билли, и Холлидей укрывает его в хижине своей девушки, индианки-полукровки Рио…','Нет данных'),(12485,'Судьба-охотник',1964,106,0.0,6.6,63,'1964-09-30','https://st.kp.yandex.net/images/film_iphone/iphone360_12485.jpg','Fate Is the Hunter','Через пять минут после взлета в аэропорту Лос-Анджелеса разбивается авиалайнер с пятьюдесятью тремя пассажирами на борту. Выживает одна стюардесса. Сразу же появляется множество версий причин авиакатастрофы: от техногенных до возможной диверсии. Позиция самого авиаперевозчика — пилот Джек Сэвидж был пьян. Однако такая «официальная» версия совсем не устраивает Сэма МакБейна. В военное время МакБейн был вторым пилотом у Сэвиджа, а теперь сменил штурвал самолета на руководящую работу в авиакомпании. Несмотря на то, что в последнее время у них с Сэвиджом были непростые отношения, МакБейн решает доказать всем, что Джек не виновен,…. в ущерб собственному повышению по службе.','Нет данных'),(12491,'Девушка в цементе',1968,93,0.0,6.4,218,'1968-11-20','https://st.kp.yandex.net/images/film_iphone/iphone360_12491.jpg','Lady in Cement','Частный детектив Тони Ром бороздит океан на своей яхте. Яхту он выиграл, так как азартные игры — важная часть его жизни. Заработок Тони очень нужен, и он берется за расследование гибели молодой женщины. Как обычно, полицейские вмешиваются и осложняют дело.','Нет данных'),(12492,'Тони Роум',1967,110,0.0,6.8,217,'1967-11-10','https://st.kp.yandex.net/images/film_iphone/iphone360_12492.jpg','Tony Rome','Частный детектив Тони Роум — в прошлом самый крутой полицейский в Майами. Ему неведом страх, он не отступает перед трудностями и беспощаден к преступникам. Для него главное — закон и справедливость. Однажды Роум сталкивается с непростым делом — богатый бизнесмен просит его найти брошь с бриллиантами, которую его дочь потеряла при весьма странных обстоятельствах. Занимаясь поисками драгоценных камней, сыщик все больше погружается в тайны семейства и оказывается в самом эпицентре опасных событий. Но он не намерен отступать, пока не доведет дело до конца…','Нет данных'),(12496,'Четверо из Техаса',1963,124,0.0,6.1,159,'1963-12-18','https://st.kp.yandex.net/images/film_iphone/iphone360_12496.jpg','4 for Texas','Двое удалых парней отправляются в Техас, чтобы открыть игорный дом. «Солдатам удачи» придется побороться со свирепым гангстером. Многие позарятся на их денежки. Да и до них самих найдутся охотницы…','Нет данных'),(12497,'Новый вид любви',1963,110,0.0,6.7,248,'1963-10-10','https://st.kp.yandex.net/images/film_iphone/iphone360_12497.jpg','A New Kind of Love','Веселая комедия о забавных ситуациях в которые попадает менеджер магазина готового платья, Саманта. Отправившись в командировку в Париж она постоянно сталкивается с таким же командировочным, журналистом. Отчаянный бабник и гуляка, встретивший Саманту, изменившуюся в ходе посещения салонов красоты он принимает ее за девушку по вызову и решает взять у нее интервью..','Нет данных'),(12500,'Никогда не было так мало',1959,125,0.0,6.3,116,'1959-12-07','https://st.kp.yandex.net/images/film_iphone/iphone360_12500.jpg','Never So Few','Бирма. Вторая Мировая война. Том Рейнольдс, командующий небольшим британско-американским соединением. Основная часть его сил составлена из местных войск кэхинов. Рейнолльдса с небольшим отрядом посылают против японских позиций возле китайской границы. Там несколько его солдат попадают в засаду Националистической Китайской группы. <br><br>После проведенной боевой операции офицер прибывает на базу для отдыха. Рейнольдс знакомится с красавицей Карлой Весари. Она любовница таинственного человека Никко Регаса. Полюбив Рейнольдса она хочет оставить скучную жизнь в Бирме c Никко Регаса и уехать в Индианополис с Рейнольдсом и не скрывает этого…','Нет данных'),(12504,'Нежный капкан',1955,111,0.0,6.3,118,'1955-11-04','https://st.kp.yandex.net/images/film_iphone/iphone360_12504.jpg','The Tender Trap','Чарли Ридер — успешный театральный агент. Не менее успешен он и в отношениях с девушками. Его многочисленные подружки приходят и уходят, готовят и убирают для него. Однажды на прослушивании он встречает актрису и певицу Джули Гиллис — девушку, которая живет строго по плану. Согласну плану, она должна выйти замуж, бросить сцену и воспитывать детей уже к 22 годам. После несколький свиданий, Джули сообщает Чарли, что она не выйдет за него замуж, если он не прекратит встречи со всеми своими девушками. Это неожиданное заявление очаровывает Чарли и он начинает влюбляться в Джули.<br><br>Однажды к нему приезжает его старый друг Джо, женатый и с тремя детьми. Джо влюбляется в Сильвию, девушку Чарли. Сильвии скоро стукнет 33 и она по-прежнему надеется выйти замуж за Чарли. Она с волнением ждет предложения руки и сердца, но ее ждет неприятный сюрприз…','Нет данных'),(12505,'Это молодое сердце',1954,117,0.0,7.0,223,'1955-01-20','https://st.kp.yandex.net/images/film/12505.jpg','Young at Heart','Лори — одна из трех дочерей музыканта Грегори Туттла. Все они умны, красивы, воспитаны и давно хотят замуж. Лори и Эми договариваются о совместной свадьбе. Найдя подходящих женихов, они начинают приготовления к свадьбам.<br><br>В это время Алекс, жених Лори, для своего нового проекта приглашает Барни Слоана, музыканта и аранжировщика, чтобы написать музыку. Барни поселяется в доме Грегори Туттла и постепенно знакомится со всей семьей. Он пессимист и считает себя неудачником. Особенно он откровенен с Лори, они много говорят на разные темы.<br><br>Приходит день свадьбы, и Лори неожиданно понимает, что Алекс, с которым она помолвлена, не ее мужчина, только меланхоличный Барни мил ее сердцу…','Нет данных'),(12506,'Внезапный',1954,75,0.0,6.4,199,'1954-09-17','https://st.kp.yandex.net/images/film_iphone/iphone360_12506.jpg','Suddenly','В маленьком американском городке тихо и скучно течет жизнь, вопреки названию. Но экстраординарное событие, которое должно произойти в этом городе, все ставит с ног на голову. Президент США собирается пересесть из поезда в автомобиль в городе Внезапный, и на нем продолжить свое путешествие. Этим фактом хочет воспользоваться группа наемных киллеров, чтобы убить его…','Нет данных'),(12507,'Три монеты в фонтане',1954,102,0.0,6.2,225,'1954-05-20','https://st.kp.yandex.net/images/film_iphone/iphone360_12507.jpg','Three Coins in the Fountain','Три американки работают в Риме. Одна уже давно влюблена в своего босса, сладкоречивого писателя, который в ответ «ни в зуб ногой». Другая, нарушая строгие правила, крутит роман с итальянцем. Третья, новенькая, встречает настоящего принца и буквально теряет голову. Каждая из них надеется отыскать счастье в Риме, они бросают монетки в фонтан Треви, и… как поёт в фильме Синатра — три монетки в фонтане, каждая на счастье, но кому повезёт?','Нет данных'),(12509,'Пока плывут облака',1946,132,0.0,6.6,147,'1946-12-05','https://st.kp.yandex.net/images/film_iphone/iphone360_12509.jpg','Till the Clouds Roll By','Фильм создан на основе автобиографии легендарного американского композитора Джерома Керна, роль которого сыграл звезда Голливуда Роберт Уолкер.','Нет данных'),(12510,'Поднять якоря',1945,119,0.0,7.7,448,'1945-07-19','https://st.kp.yandex.net/images/film_iphone/iphone360_12510.jpg','Anchors Aweigh','1945 год американский флот возвращается домой. На борту авианосца два бравых матроса награждены прогулкой в город. Парни решают «покутить на всю катушку».<br><br>Джозеф Броди, и Кларенс Дулиттл уверенны, что их вояжу ничто не станет помехой, но не тут то было. Прямо с первых минут их планы начинают рушиться как карточный домик, а виной тому семилетний ребенок, который бежал из дома тетки ради службы на флоте.<br><br>Он был пойман полицией и доставлен в участок. Полицейские не в силах совладать с беглецом и зовут на помощь моряков, которые моментально налаживают контакт с парнишкой и соглашаются помочь полиции — сопроводить «гуляку» домой к тетушке.<br><br>Герои даже и не предполагают, что тётей окажется весьма миловидная брюнетка двадцати лет, ради которой они совершат много смешных и глупых поступков…','Нет данных'),(12513,'Везунчик',2007,124,0.0,6.6,4550,'2007-05-01','https://st.kp.yandex.net/images/film_iphone/iphone360_12513.jpg','Lucky You','Действие фильма разворачивается в мире профессионального покера. Главный герой ленты — игрок Хак Чивер, который не жалеет сил для победы и не боится рисковать. В личной жизни он, напротив, ведет себя разумно и осторожно, избегая эмоциональных порывов и каких-либо обязательств.<br><br>Когда же Хак берется выиграть чемпионат мира по покеру 2003 года, а заодно и очаровать молодую певицу из Бейкерсфилда Билли Оффер, он встречает на своем пути только одно препятствие — в лице своего отца, легендарного игрока в покер, бросившего мать Хака много лет назад. В итоге отец и сын становятся соперниками не только в жизни, но и за карточным столом.<br><br>По мере приближения финальной схватки Хак приходит к осознанию одной простой истины: чтобы одерживать победы и в жизни, и в игре, необходимо соединить свои человеческие достоинства с талантом игрока…','$55 000 000'),(12514,'Рука, качающая колыбель',1992,110,0.0,7.4,7000,'1992-01-10','https://st.kp.yandex.net/images/film_iphone/iphone360_12514.jpg','The Hand That Rocks the Cradle','Муж Пэйтон Фландерс, обвиненный в сексуальных домогательствах к своим пациенткам, кончает жизнь самоубийством. Потрясение с этим связанное приводит к преждевременным родам, и ребенок Пэйтон рождается мертвым.<br><br>Кто-то должен заплатить за это, и Пэйтон устраивается сиделкой в дом женщины, которая первой выдвинула обвинения против ее мужа.','$11 700 000'),(12515,'Дурное влияние',1990,99,0.0,6.6,662,'1990-03-09','https://st.kp.yandex.net/images/film_iphone/iphone360_12515.jpg','Bad Influence','Майкл, молодой слабохарактерный администратор, замечает в баре привлекательного мужчину, который вскоре исчезает. Той же ночью, Майкл встречает этого незнакомца на пирсе. Тот представляется Алексом, и оба они проводят время в нелегальном клубе. Под влиянием нового друга Майкл становится на скользкую тропу преступлений. Пытаясь выбраться из порочного круга, он навлекает на себя страшную месть опасного социопата.','Нет данных'),(12516,'Теряя это',1983,100,0.0,5.6,434,'1983-04-08','https://st.kp.yandex.net/images/film_iphone/iphone360_12516.jpg','Losin\' It','Герои этой молодежной комедии, четверо школьных друзей отправляются в злачные места Тихуаны (Мексика) в поисках приключений, участвуя в соглашении «потерять девственность до наступления следующего дня». В их компании оказывается молодая женщина, преследующая цель «получения быстрого развода от своего мужа».','$7 000 000'),(12519,'Молчаливый партнер',1978,106,0.0,7.2,352,'1978-09-07','https://st.kp.yandex.net/images/film_iphone/iphone360_12519.jpg','The Silent Partner','Банковскому служащему Майлсу Каллену удалось ловко воспользоваться ситуацией во время попытки ограбления, но в результате его судьба начинает зависеть от неадекватных действий преступника-психопата Хэрри Райкла, который готов на всё, чтобы вернуть назад немалые деньги.','CAD 2 500 000'),(12520,'Белая собака',1982,90,0.0,6.7,405,'1982-07-07','https://st.kp.yandex.net/images/film_iphone/iphone360_12520.jpg','White Dog','Голливудская старлетка Джули подбирает на дороге бездомную собаку. Животное кажется вполне дружелюбным, но вскоре выявляется одна особенность его характера — пёс люто ненавидит негров. Опасаясь, что из-за этого собаку могут усыпить, Джули решает отдать её на перевоспитание в питомник. Хозяин питомника считает, что избавиться от собачьего «расизма» невозможно, но главный тренер Кис всё-таки соглашается взяться за это дело. Учитывая, что Кис сам является негром, каждое занятие с собакой превращается для него в настоящую игру со смертью.','$8 000 000'),(12521,'Пожиратель грехов',2003,102,0.0,6.6,4699,'2003-09-05','https://st.kp.yandex.net/images/film_iphone/iphone360_12521.jpg','The Order','Тайный мистический орден направляет Алекса Бернье в Рим для расследования серии странных и очень похожих убийств. Простой поначалу сюжет раскручивается в хитросплетенную интригу загадочных мистических событий, приводя к разгадке величайшей тайны, скрываемой церковью от всего мира.<br><br>Встреча лицом к лицу с таинственным человеком, существование которого так тщательно скрывалось в течение долгих столетий, дает Алексу способности и знания, способные изменить жизнь человечества, но обладание которыми гораздо страшнее самой смерти.','$38 000 000'),(12522,'Расплата',1999,101,0.0,7.7,24053,'1999-02-05','https://st.kp.yandex.net/images/film_iphone/iphone360_12522.jpg','Payback','Член преступного могущественного синдиката должен заплатить своим боссам 130 тыс. долларов. Поэтому он приглашает Портера на дело. Вместе с ним и его женой они грабят автомобиль, в котором азиаты перевозят «грязные» деньги.<br><br>Но жене Портера подлый мафиози подсовывает фотографию мужа в объятиях проститутки, и супруга всаживает в благоверного пулю за пулей. Сочтя его мертвым, они забирают деньги и уезжают. Однако Портер не умер и через пять месяцев вернулся, чтобы расплатиться — вернуть свои деньги и отомстить.','$90 000 000'),(12523,'Почтальон',1997,177,0.0,7.2,17092,'1997-12-12','https://st.kp.yandex.net/images/film_iphone/iphone360_12523.jpg','The Postman','Фильм снят по книге Дэвида Брина. Действие происходит в будущем. После глобальной войны и эпидемии выжившие остатки людей селятся разрозненными группами на территории бывших Соединенных Штатов Америки.<br><br>Герой Кевина Костнера предпочитает жить одиночкой. Он скитается вместе со своим дрессированным мулом из селения в селение, давая представления из Шекспира. Правит всем тиран — генерал Бетлехем. Его армия собирает дань и рекрутов со всех, кто пытается жить мирно.<br><br>Героя фильма насильно взяли в армию генерала, но он бежал и нашел в джипе скелет почтальона, надел его форму и взял сумку с письмами. Придя в один из лагерей, он представился почтальоном новых возрожденных Соединенных Штатов Америки.<br>Люди поверили ему, также в городке он нашел свою любовь… Десятки последователей почтальона стали доставлять письма, что привело к вооруженному столкновению сил генерала с новой армией Свободы.','$80 000 000'),(12529,'Отмороженный профессор',1961,92,0.0,6.6,129,'1961-03-16','https://st.kp.yandex.net/images/film_iphone/iphone360_12529.jpg','The Absent Minded Professor','Профессор живет в маленьком городке, он увлекается химией — изобретает озорное вещество, «плюющее» на законы тяготения.<br><br>Он называет его «флаббером», летающей резиной, использовать его можно в разных целях. Если намазать им спортивную обувь, баскетболисты совершенно безнадежной команды колледжа обретут удивительную прыгучесть, победят соперников.','Нет данных'),(12537,'Всегда есть завтра',1955,84,0.0,7.1,146,'1955-07-10','https://st.kp.yandex.net/images/film_iphone/iphone360_12537.jpg','There\'s Always Tomorrow','Клиффорд, рабочий на фабрике игрушек, впадает в депрессию — жена перестала замечать его, а дети считают отца ничтожеством. Но все меняется, когда в его жизни появляется Норма.','Нет данных'),(12559,'Так хочет леди',1942,92,0.0,7.1,73,'1942-02-12','https://st.kp.yandex.net/images/film_iphone/iphone360_12559.jpg','The Lady Is Willing','Эксцентричная звезда сцены Лиза Мэдден случайно находит брошенного младенца и решает взять его домой. Но органы опеки не дают ей разрешения на усыновление, так как у Лизы нет мужа. Тогда она делает предложение педиатру Кори МакБейну: она помогает ему в его исследованиях о кроликах, взамен он на ней женится. Вскоре брак по расчёту начал превращаться в брак по любви. Но тут появляется бывшая жена Кори, она приходит к нему попросить денег. Лиза начинает что-то подозревать и вместе с подкидышем уезжает из Нью-Йорка. Через некоторое время ребенок заболевает, и МакБейн, узнав об этом, отправляется к Лизе и малышу…','Нет данных'),(12562,'Пикирующий бомбардировщик',1941,132,0.0,6.4,80,'1941-08-12','https://st.kp.yandex.net/images/film/12562.jpg','Dive Bomber','Фильм снят в канун Второй мировой войны. Он рассказывает о работе военно-морских медиков и летчиков США, связанной с решением проблем аэронавигационной медицины. Их усилия впоследствии спасли жизни многим пилотам, поднимавшим свои боевые машины с палуб авианосцев и взлетных полос военно-морских баз.','Нет данных'),(12567,'Запомни ночь',1940,94,0.0,6.4,410,'1940-01-01','https://st.kp.yandex.net/images/film_iphone/iphone360_12567.jpg','Remember the Night','Накануне Рождества Ли Лиандер поймали за кражей в магазине. Это её третье преступление. Её дело ведет Джон Сарджент. Он просит суд отложить разбирательство дела, так как трудно добиться обвинительного приговора накануне Рождества. Но Джон сочувствует Ли, освобождает её под залог, а в итоге забирает домой к матери на Рождество. В окружении любящей семьи (особенно по сравнению с семьей Ли) Ли и Джон влюбляются в друг друга. Это создает новую проблему: как им вести себя на предстоящем суде?','Нет данных'),(12581,'Элис Эдамс',1935,99,0.0,6.7,239,'1935-08-15','https://st.kp.yandex.net/images/film_iphone/iphone360_12581.jpg','Alice Adams','Это рассказ о молоденькой девушке из небольшого городка штата Индиана, которая выросла в небогатой семье, но пытается шагнуть на более высокую социальную ступень. Единственное средство, которое поможет ей обрести вожделенный статус, брак с богатым человеком.','Нет данных'),(12589,'Приходящий по ночам',1964,86,0.0,6.1,134,'1964-12-30','https://st.kp.yandex.net/images/film_iphone/iphone360_12589.jpg','The Night Walker','Жене слепого, и потому жутко ревнивого учёного во сне является молодой любовник. Однажды муж погибает при взрыве, и сладкие сны женщины обращаются в кошмар — теперь не только молодой красавец приходит к ней во сне, но и покойный обгоревший муж.','Нет данных'),(12590,'Разнорабочий',1964,101,0.0,6.2,104,'1964-11-11','https://st.kp.yandex.net/images/film_iphone/iphone360_12590.jpg','Roustabout','Байкер и музыкант Чарли Роджерс решает приударить за местной красавицей, после чего её разгневанный отец спихивает его мотоцикл с дороги в канаву. На время починки своего железного коня, Чарли устраивается на работу в странствующую актёрскую труппу.','Нет данных'),(12591,'Прогулка по беспутному кварталу',1962,114,0.0,7.2,208,'1962-02-21','https://st.kp.yandex.net/images/film_iphone/iphone360_12591.jpg','Walk on the Wild Side','1930-е годы. Дав Линкорн отправляется в Новый Орлеан на поиски своей возлюбленной, которая уже три года не отвечает на его письма. Найдя Хэлли в одном из публичных домов, Дав пытается уговорить ее бросить работу и вернуться к нему. Но хозяйка борделя Джо даже и не думает расставаться с Хэлли…','Нет данных'),(12592,'Сорок ружей',1957,79,0.0,7.0,294,'1957-10-31','https://st.kp.yandex.net/images/film_iphone/iphone360_12592.jpg','Forty Guns','Джессика Драммонд — мощная и беспощадная хозяйка ранчо в Аризоне, заправляющая всем округом Кочиз. В ее владения въезжают Бэрри Салливэн и двое его братьев. Бэрри славился меткостью стрельбы, а до этого работал на генерального прокурора США. Он приехал в Тумстоун по официальному делу, что означало конфликт с нашей «ранчершой», у которой даже шериф был под каблуком. Далее развивается предсказуемая любовь, но мирной жизни не получается из-за брата Барбары, хулиганистого задиры с пальцем на курке.','Нет данных'),(12594,'Преступление страсти',1957,86,0.0,5.9,141,'1957-01-09','https://st.kp.yandex.net/images/film_iphone/iphone360_12594.jpg','Crime of Passion','Кэти Фергюсон ведет колонку в одной из газет Сан-Франциско. Однажды в редакцию газеты заходит лейтенант полиции Билл Дойл. Он видит Кэти, и… уже очень скоро они становятся мужем и женой. Кэти решает оставить работу и заняться домом, но ее не устраивает то, что у Билла нет никаких амбиций, и он не стремится получить повышение по службе. Кэти решает «продвинуть» мужа, даже если для этого понадобится совершить преступление…','Нет данных'),(12600,'Свидетель убийства',1954,83,0.0,6.2,169,'1954-04-15','https://st.kp.yandex.net/images/film_iphone/iphone360_12600.jpg','Witness to Murder','Окружающие начинают сомневаться в душевном здоровье женщины, утверждающей, что, выглянув из окна своей квартиры, она стала свидетельницей убийства.','Нет данных'),(12601,'Опасность',1953,69,0.0,6.3,162,'1953-03-30','https://st.kp.yandex.net/images/film_iphone/iphone360_12601.jpg','Jeopardy','Семья Стилвинов приезжает на каникулы на безлюдный пляж в Мексику. На причале нога Дуга Стилвина застревает между досок. Все попытки освободить Дуга оказываются неудачными, тогда Хелен Стилвин уезжает на машине в поисках помощи. Но её похищает бандит, убегающий от полиции. Сможет ли Хелен вернуться к мужу до того, как он утонет в приливе?','Нет данных'),(12602,'Все, чего я желаю',1953,80,0.0,7.0,75,'1953-06-25','https://st.kp.yandex.net/images/film_iphone/iphone360_12602.jpg','All I Desire','Наоми Мердок давным-давно бросила детей и мужа и покинула родной город. Сделать это ее заставила роковая страсть к другому мужчине — сознавая, что тайна скоро станет достоянием общественности, Наоми без объяснений оставляет семью. Возвращается она по просьбе дочери, которая заканчивает школу и мечтает, чтобы мать увидела ее первое серьезное выступление на сцене. Наоми приезжает, и драматическая ситуация, ставшая когда-то причиной ее бегства, повторяется.','Нет данных'),(12604,'Фурии',1950,109,0.0,6.9,131,'1950-07-21','https://st.kp.yandex.net/images/film_iphone/iphone360_12604.jpg','The Furies','Смутьянка-наследница конфликтует со своим вдовствующим отцом-тираном, воображающим себя Наполеоном на своём ранчо. Их отношения принимают уродливый характер, когда отец приводит в дом новую жену.','Нет данных'),(12605,'Не её мужчина',1950,98,0.0,7.3,195,'1950-02-21','https://st.kp.yandex.net/images/film_iphone/iphone360_12605.jpg','No Man of Her Own','Беременная Хелен Фергюсон, нищая и брошенная ее другом Стивом Морли, выдает себя за Патрис Харкнесс, погибшую вместе с мужем в железнодорожной катастрофе. Богатые родственники со стороны супруга никогда не видели Патрис, и поэтому они принимают самозванку и ее новорожденного сына. Однако Стив находит Хелен и начинает шантажировать ее…','Нет данных'),(12606,'Дело Тельмы Джордон',1950,100,0.0,6.6,229,'1950-01-05','https://st.kp.yandex.net/images/film_iphone/iphone360_12606.jpg','The File on Thelma Jordon','Однажды в офисе помощника окружного прокурора Клива Маршалла появляется Тельма Джордон и рассказывает историю о бродягах и грабителях. Клив женат, но не может противостоять обаянию Тельмы. Между ними завязывается роман. Когда богатую тетушку Тельмы находят убитой, Клив помогает ей, при этом неоднократно нарушая закон. Тельму оправдывают, но ее прошлое настигает ее…','Нет данных'),(12607,'Ист-Сайд, Вест-Сайд',1949,108,0.0,7.3,167,'1949-12-22','https://st.kp.yandex.net/images/film_iphone/iphone360_12607.jpg','East Side, West Side','Брэндон и Джесси Бурн были женаты долгие годы. Несколько лет назад у Брэндона был роман с Изабель Лоррисон. Теперь она вернулась в Нью-Йорк, намереваясь возобновить их отношения. В то же время за Джесси начинает ухаживать Марк…','Нет данных'),(12608,'Извините, ошиблись номером',1948,89,0.0,7.7,1287,'1948-09-01','https://st.kp.yandex.net/images/film/12608.jpg','Sorry, Wrong Number','Сюжет построен вокруг богатой женщины-инвалида, которая случайно услышала по телефону отрывок разговора о планировании убийства женщины, со временем понимая, что речь в разговоре шла о ней.','Нет данных'),(12610,'Другая любовь',1947,95,0.0,6.7,131,'1947-03-27','https://st.kp.yandex.net/images/film_iphone/iphone360_12610.jpg','The Other Love','По неопубликованному рассказу Э. М. Ремарка «По ту сторону». В санаторий, расположенный высоко в горах, приезжает известная пианистка Карен Данкен. Она еще не знает, что тяжело больна, а главный врач санатория Тони Стэнтон не спешит раскрывать ей истинное состояние ее здоровья. Карен с оптимизмом строит планы на будущее…','Нет данных'),(12611,'Ложная тревога',1947,83,0.0,6.5,111,'1947-07-18','https://st.kp.yandex.net/images/film_iphone/iphone360_12611.jpg','Cry Wolf','Приехав на похороны своего мужа в его семейное имение, Сандра знакомится с дядей и сестрой покойного — Джулией. С первых же минут пребывания Сандра понимает, что в доме творятся очень странные вещи, в основе которых лежит граничащее с истерией поведение Джулии. Дальнейшие события развиваются с мистической стремительностью: живые — начинают выбрасываться из окон, ранее умершие — вдруг оказываются живыми. Правда и неправда несколько раз меняются местами в сознании Сандры. Есть ли в этом доме хоть кто-нибудь, кому можно доверять?','Нет данных'),(12612,'Две миссис Кэрролл',1947,99,0.0,7.2,332,'1947-03-04','https://st.kp.yandex.net/images/film_iphone/iphone360_12612.jpg','The Two Mrs. Carrolls','Во время каникул в Шотландии, Салли Мортон влюбляется в перспективного живописца Джеффри Кэрролл, но узнав, что он женат и имеет взрослую дочь прекращает начавшиеся отношения. Проходят два года, жена художника скоропостижно умирает, Джеффри женится на Салли, их жизнь счастлива и безмятежна.<br><br>Однако молодая супруга начинает неожиданно болеть, лечащий врач утверждает, что этот недуг на нервной почве, но Салли терзают сомнения. От падчерицы она узнает, что предыдущая жена художника Джеффри Беа была отнюдь не инвалидом и умерла подозрительно быстро, от тех же симптомов, что мучают Салли.<br><br>Последним фактом, подтвердившим ее подозрения, становится увиденный Салли портрет усопшей первой жены художника, написанный им перед ее смертью и названный «Ангел Смерти». Она понимает, что стала следующей жертвой…','Нет данных'),(12614,'Рождество в Коннектикуте',1945,102,0.0,6.7,569,'1945-07-27','https://st.kp.yandex.net/images/film_iphone/iphone360_12614.jpg','Christmas in Connecticut','Журналист Элизабет Лейн является одним из самых известных в стране авторов рецептов. В своих статьях она описывает себя как трудолюбивую фермершу, заботливую мать и изумительного повара. Но все это ложь. На самом деле она незамужняя жительница Нью-Йорка, не способная даже сварить яйца. А рецептами с ней делится хороший друг Феликс. Владелец журнала, в котором она работает, пригласил героя-моряка отметить Рождество у неё на ферме. Мисс Лейн понимает, что её карьере придет конец, если правда выйдет наружу, но что она может сделать?','Нет данных'),(12615,'Плоть и фантазия',1943,94,0.0,7.0,122,'1943-10-29','https://st.kp.yandex.net/images/film/12615.jpg','Flesh and Fantasy','Однажды Докс пришел к своему другу Дэвису и поведал о своей встрече с предсказателем. После рассказа Докс, взяв с полки увесистый том, прочитал ему три странные истории о необычных предсказаниях, которые стали поворотными в судьбах людей.<br> <br>Первая история, некрасивой девушки Генриетты, безответно влюбленной в молодого красивого студента Майкла. В преддверье карнавала Генриетта случайно оказывается в театральной лавке среди костюмов и реквизита, таинственный продавец предлагает девушке надеть маску, которая украсит и возможно изменить ее жизнь.<br> <br>Вторая история. Скептически настроенный адвокат Маршалл Тайлер просит погадать ему по руке ясновидящего Поджерса. Взглянув на руку медиум говорит, что Маршал скоро женится, но взглянув внимательней на ладонь прекращает рассказ и отказывается продолжать. Вскоре первое предсказание сбывается. Удивленный этим обстоятельством, Тайлер обеспокоен, что же еще увидел в его руке ясновидящий. В конце концов, под давлением Тайлера, Поджерс признается, что он увидел убийство….','Нет данных'),(12621,'Стелла Даллас',1937,106,0.0,7.0,279,'1937-08-05','https://st.kp.yandex.net/images/film_iphone/iphone360_12621.jpg','Stella Dallas','Юная Стелла Мартин, дочь фабричного рабочего, влюблена в Стивена Далласа — выходца из когда-то богатого рода, служащего на фабрике мелким начальником. Стивен бросает свою давнюю возлюбленную Хелен, так как боится, что недостаточно богат и высокопоставлен для неё. Стелла нечаянно сталкивается с ним, когда приходит на фабрику, чтобы отнести обед брату Чарли, и Стивен увлекается ею.','Нет данных'),(12630,'Женщина в красном',1935,68,0.0,6.6,74,'1935-02-16','https://st.kp.yandex.net/images/film_iphone/iphone360_12630.jpg','The Woman in Red','Шелби Баррет работает у богатой вдовы Нико в качестве наездницы, выступая на состязаниях на ее лошадях. Ею очарован Джонни Уайт, сын обедневшей, но знатной фамилии Лог-Айленда, который зарабатывает игрой в поло и приезжает чтобы играть на поле Нико. Нико цепко держится за Джонни, но, несмотря на все ее усилия, Шелби и Джонни решили пожениться. Мстительная Нико затаила злобу. Чтобы не зависеть от снобистской семьи Джонни, молодые решают завести свой бизнес и заняться тем делом, которое они любят — подготовкой лошадей к соревнованиям. Чтобы организовать бизнес Шелби ожидает денежной помощи от деда, но когда он не в состоянии предоставить деньги, она обращается к хорошему другу и бизнесмену Фэрчайлду, который одалживает ей деньги.<br /><br />Однако вскоре на горизонте появляется Нико и начинает коварные женские интриги против Шелби. Когда однажды Шелби оказывается на судне Фэрчайлда в качестве приглашенной на обед, где у него должны состояться деловые переговоры, она оказывается свидетельницей несчастного случая, в результате которого погибает девушка, в пьяном виде упавшая за борт. На суде Фэрчайлда обвиняют в умышленном убийстве, и его может спасти только таинственная «женщина в красном», которой и была Шелби. Чтобы не втягивать ее в скандал, Фэрчайлд отказывается назвать свидетельницу, но ее с причала видела Нико и она с мстительной елейностью начинает травить Шелби…','Нет данных'),(12636,'Закупочная цена',1932,68,0.0,6.3,65,'1932-07-23','https://st.kp.yandex.net/images/film_iphone/iphone360_12636.jpg','The Purchase Price','Убегая от гламурной и полной бурлеска жизни, Джоан Гордон решается на авантюру. Она отправляется вместо своей служанки к ее жениху-фермеру, с которым та заочно познакомилась через брачное агентство. Приехав на ферму, Джоан тут же вступает в брак с фермером Джимом. Сможет ли молодая пара преодолеть житейские невзгоды? Их, между прочим, немало: не заладившиеся с самого начала отношения, докучливые и беспардонные соседи, невыплаченный кредит за ферму. А тут еще бывший парень Джоан, который ее разыскал и предлагает вернуться к красивой жизни…','Нет данных'),(12637,'Такой большой!',1932,81,0.0,6.7,73,'1932-04-29','https://st.kp.yandex.net/images/film_iphone/iphone360_12637.jpg','So Big!','Рассказ о женщине, которая через всю жизнь пронесла слова своего отца о том, что жизнь — это удивительное и захватывающее приключение, полное радости и печали. А жизненные невзгоды и трудности она пропускала через свое сердце и превращала их в благодать для дорогих и близких ей людей.','Нет данных'),(12639,'Ночная сиделка',1931,72,0.0,6.7,189,'1931-07-16','https://st.kp.yandex.net/images/film_iphone/iphone360_12639.jpg','Night Nurse','Лора Харт учится на курсах медицинских сестер, твердо решив целиком посвятить себя этому делу. Однажды ночью в больницу привозят бутлегера по имени Морти. Лора и ее сокурсница Мэлони устанавливают, что Морти получил огнестрельное ранение, и, поддавшись на его уговоры, соглашаются не сообщать об этом в полицию. Морти клянется Лоре в дружбе и присылает бутылку спиртного в подарок.','Нет данных'),(12647,'Зеленый сойлент',1973,97,0.0,6.7,2108,'1973-04-18','https://st.kp.yandex.net/images/film_iphone/iphone360_12647.jpg','Soylent Green','2022 год. Земля перенаселена, в одном только Нью-Йорке проживает более 40 миллионов человек. Загрязнение окружающей среды привело к парниковому эффекту, в результате чего исчезли большая часть водных ресурсов, животные и растительность. Дабы хоть как-то накормить людей, корпорация «Сойлент» производит некий питательный продукт в виде разноцветных брикетов. Расследование неожиданного убийства члена правления корпорации приводит полицейского детектива Торна на фабрику, где он узнаёт страшную тайну «зелёного сойлента»…','Нет данных'),(12653,'Пекинская блондинка',1967,87,0.0,5.6,77,'1967-08-25','https://st.kp.yandex.net/images/film_iphone/iphone360_12653.jpg','La blonde de Pékin','На скамейке парка обнаружена лежащая без сознания молодая блондинка. Китайский иероглиф, вытатуированный на ее ягодице, наводит спецслужбы разных стран на мысль о том, что женщина — бежавшая из Китая любовница крупного китайского ученого. Агенты ЦРУ и КГБ пытаются заполучить загадочную блондинку, тогда как китайская разведка пытается убить ее, чтобы избежать утечки информации.','Нет данных'),(12654,'Цинциннати Кид',1965,102,0.0,7.5,1061,'1965-10-15','https://st.kp.yandex.net/images/film_iphone/iphone360_12654.jpg','The Cincinnati Kid','Цинциннати Кид — лучший игрок в Новом Орлеане в стад покер. Однажды от карточного дилера Шутера он узнаёт, что в город приехал знаменитый Лэнси Говард — лучший карточный игрок. Кид решает сразиться с ним, чтобы победить, ему удаётся договориться об игре, делаются ставки, и игра начинается…','Нет данных'),(12655,'Гнев',1964,96,0.0,6.2,146,'1964-10-07','https://st.kp.yandex.net/images/film_iphone/iphone360_12655.jpg','The Outrage','1870 год. Джентльмен-южанин из хорошей семьи, который путешествует по Западу со своей женой, попадают в лапы к мексиканскому бандиту, который убивает мужчину и насилует его жену.<br /><br />Рассказывается эта история как увиденная тремя главными героями, а затем с точки зрения незаинтересованного свидетеля.','Нет данных'),(12656,'Приз',1963,134,0.0,7.2,284,'1963-12-25','https://st.kp.yandex.net/images/film_iphone/iphone360_12656.jpg','The Prize','Место действия фильма — Стокгольм, куда съезжаются лауреаты Нобелевской Премии для получения наград. Лауреат литературной премии Эндрю Крейг, бабник и выпивоха, ввязывается в криминальную историю с участием международных террористов, похитивших лауреата премии по физике доктора Макса Штратмана.','Нет данных'),(12657,'Ночной кошмар',1956,89,0.0,5.2,68,'1956-05-11','https://st.kp.yandex.net/images/film_iphone/iphone360_12657.jpg','Nightmare','Музыкант был загипнотизирован для совершения преступления. Когда он просыпается, то пытается узнать правду с помощью своего шурина, который является полицейским.','Нет данных'),(12665,'Дом посторонних',1949,101,0.0,7.2,235,'1949-06-30','https://st.kp.yandex.net/images/film_iphone/iphone360_12665.jpg','House of Strangers','Макса Монетти обуревает жажда мести родному брату, который предал их отца Джино. Однако воспоминания прошлого, в частности мысли о его отношениях с Ирен Беннет, приводят Макса к убеждению, что его отец сам виновен в сложных отношениях с семьей, после чего его он решает наладить отношения с братом.','Нет данных'),(12666,'У ночи тысячи глаз',1948,81,0.0,6.9,205,'1948-08-20','https://st.kp.yandex.net/images/film_iphone/iphone360_12666.jpg','Night Has a Thousand Eyes','Псевдо-экстрасенс Джон Тритон неожиданно открывает у себя способность к предвидению.','Нет данных'),(12668,'Красный дом',1947,100,0.0,6.0,150,'1947-03-16','https://st.kp.yandex.net/images/film_iphone/iphone360_12668.jpg','The Red House','Пит и Эллен с младенчества воспитывали Мэг как родную дочь. Теперь, уже подросток, Мэг убеждает своего друга Ната приехать помочь по хозяйству на ферме, так как Пит на деревянной ноге не может работать как раньше. Нат хочет ходить к дому короткой дорогой через лес, но Пит, сильно волнуясь, предупреждает его о криках в ночи и ужасах, связанных с красным домом. Любопытные Мэг и Нат игнорируют предупреждение и начинают исследование. Мэг влюбляется в Ната, но у его девушки Тибби свои планы на него. Между тем, герои все ближе к реальной опасности и темной тайне красного дома.','Нет данных'),(12673,'Морской волк',1941,100,0.0,7.1,126,'1941-03-21','https://st.kp.yandex.net/images/film_iphone/iphone360_12673.jpg','The Sea Wolf','Капитан Ларсен носил прозвище Волк но явно считал себя и Богом и Дьяволом на своем рыболовном судне «Призрак». На борт «Призрака» однажды был поднят из воды молодой человек по имени Хэмфри Ван Вейден уцелевший после одного довольно странного кораблекрушения. Хэмфри не один раз стал свидетелем жестокости капитана Ларсена прежде чем пришел к мысли о необходимости бунта. Хотя бы ради того чтобы остаться в живых…','Нет данных'),(12679,'Удивительный доктор Клайттерхаус',1938,87,0.0,7.1,164,'1938-07-20','https://st.kp.yandex.net/images/film_iphone/iphone360_12679.jpg','The Amazing Dr. Clitterhouse','По мнению доктора Клиттерхауса, уважаемого врача с Парк-авеню, лучший способ изучить поведение преступника — стать преступником самому. Он начинает с того, что обворовывает нескольких своих знакомых, тщательно измеряя при этом свое давление, температуру и пульс. Однако результаты не удовлетворяют Клиттерхауса, и он принимает решение познакомиться с криминальным миром поближе.','Нет данных'),(12680,'Простенькое дело об убийстве',1938,85,0.0,6.1,108,'1938-02-26','https://st.kp.yandex.net/images/film_iphone/iphone360_12680.jpg','A Slight Case of Murder','Сухой закон официально отменен. А это значит, что торговец контрабандными спиртными напитками Реми Марко должен внести в свою работу кое-какие изменения. Теперь вся эта операция с торговлей спиртным называется не преступление, а бизнес. Рабочие теперь не просто олухи, а партнеры. И не обращайтесь теперь к Марко иначе, чем «сэр»…','Нет данных'),(12682,'Варварское побережье',1935,91,0.0,6.7,131,'1935-10-13','https://st.kp.yandex.net/images/film/12682.jpg','Barbary Coast','Мэри прибывает в Сан-Франциско и узнает, что ее жених убит из-за проигрыша в карты. Она увлекается молодым золотоискателем, но у нее возникает много трудностей из-за совершенных ранее ошибок в выборе друзей.','Нет данных'),(12683,'Весь город говорит',1935,93,0.0,7.0,88,'1935-02-22','https://st.kp.yandex.net/images/film_iphone/iphone360_12683.jpg','The Whole Town\'s Talking','Артур Фергюсон Джонс — спокойный, ничем не выделяющийся человек, ведущий размеренный образ жизни. Однажды, мало того, что его чуть не увольняют с работы из-за опоздания, так ещё в дополнение его арестовывают по ошибке, перепутав с опасным преступником Мэннионом. Сходство Джонса и Мэнниона настолько поразительно, что полиция даёт Артуру специальный пропуск, чтобы избежать подобной ошибки в будущем. В это время настоящий гангстер видит в сложившейся ситуации возможность избежать наказания за свои преступления. Надо только завладеть желанным пропуском…','Нет данных'),(12692,'Пять последних звезд',1931,89,0.0,6.0,149,'1931-09-10','https://st.kp.yandex.net/images/film_iphone/iphone360_12692.jpg','Five Star Final','О бесчеловечности и безнравственности желтой прессы, погубившей в погоне за сенсацией нормальную, счастливую семью.','Нет данных'),(12693,'Умные деньги',1931,81,0.0,6.8,124,'1931-07-11','https://st.kp.yandex.net/images/film_iphone/iphone360_12693.jpg','Smart Money','Робинсон играет парикмахера, обладающего невероятным везением в азартных играх. При поддержке друзей он отправляется испытать удачу в большом городе, и в итоге проходит тернистый путь от провинциала из крошечного городка до «крупного босса в крупном городе», став царём азартного мира. Но такие выскочки мешают жить добропорядочным высокопоставленным гражданам, и окружной прокурор решает любыми средствами избавиться от парикмахера, у которого есть одна слабость — блондинки…','Нет данных'),(12694,'Маленький Цезарь',1930,79,0.0,6.7,710,'1931-01-09','https://st.kp.yandex.net/images/film_iphone/iphone360_12694.jpg','Little Caesar','Мелкий преступник Цезарь Энрико Банделло, известный как Рико, и его друг Джо Массара переезжают в Чикаго в поисках удачи. Они присоединяются к банде Сэма Веттори, но Джо, мечтающий стать танцором, больше заинтересован в славе и женщинах. Он знакомится с Ольгой и отходит от дел банды. Тем временем Рико быстро встаёт во главе организации Сэма и занимает место в верхах чикагского преступного синдиката. Одновременно в нём растёт уверенность, что однажды Джо предаст его…','Нет данных'),(12707,'Объезд',1945,67,0.0,7.2,994,'1945-11-16','https://st.kp.yandex.net/images/film_iphone/iphone360_12707.jpg','Detour','Эл Робертс отправляется автостопом в Лос-Анджелес к своей девушке. Внезапно он обнаруживает, что мужчина подвозивший его, мертв. Он решает спрятать тело и выдать себя за владельца машины. На заправке он знакомится с Верой, которая раскрывает обман и принимается шантажировать Эла.','$30 000'),(12721,'Увидимся',1944,85,0.0,6.7,78,'1945-01-05','https://st.kp.yandex.net/images/film_iphone/iphone360_12721.jpg','I\'ll Be Seeing You','Мэри Маршалл, отбывающая шестилетний срок за случайное убийство, получает рождественский отпуск из тюрьмы, чтобы посетить родственников в маленьком городке среднего Запада. В поезде она встречает сержанта Зака Моргана, которые едет в отпуск из военного госпиталя. Хотя его физические раны зажили, он страдает посттравматическим расстройством после контузии. Пара притягиваются друг к другу в теплой атмосфере рождественских праздников. Дружба переходит в любовь, но Мэри боится рассказать ему о своем прошлом и что она должна вскоре вернуться в тюрьму, чтобы отбыть оставшуюся части наказания…','Нет данных'),(12724,'Тридцать секунд над Токио',1944,138,0.0,6.6,193,'1944-11-15','https://st.kp.yandex.net/images/film_iphone/iphone360_12724.jpg','Thirty Seconds Over Tokyo','Драматическая история рейда американских ВВС на Японию в годы Второй мировой войны.','Нет данных'),(12730,'Слава герою-победителю',1944,101,0.0,5.7,69,'1944-08-09','https://st.kp.yandex.net/images/film_iphone/iphone360_12730.jpg','Hail the Conquering Hero','Из-за сенной лихорадки Першинг Трусмит был демобилизован из морских сил, но он не хочет возвращаться в свой родной город, чувствуя себя неудачником. В минуты грусти он встречает группу морских пехотинцев, которые убеждают его вернуться домой с выдуманной историей о том, что он был ранен в бою и отмечен наградой. Они даже находят для него военную форму с медалями. Когда он возвращается в родной город, его бурно приветствуют, собираются увековечить его подвиг в виде статуи, пишут о нем героические поэмы и заставляют баллотироваться в мэры. Никто не обращает внимания на все его попытки рассказать правду.','Нет данных'),(12739,'Чудо в Морганс-Крик',1943,98,0.0,5.8,432,'1943-12-24','https://st.kp.yandex.net/images/film_iphone/iphone360_12739.jpg','The Miracle of Morgan\'s Creek','После проводов отряда, девушка из провинции наутро оказывается замужем и беременной и не помнит, кто является её мужем.','Нет данных'),(12747,'Это армия',1943,121,0.0,5.2,112,'1943-07-29','https://st.kp.yandex.net/images/film_iphone/iphone360_12747.jpg','This Is the Army','Во время второй мировой войны танцор Джерри Джонс организует показ концерта армейской самодеятельности Yip Yip Yaphank на Бродвее. Раненный в войну, он становится продюсером. Его сын Джонни Джонс, который был перед войной его помощником, получает приказ поставить новое армейское шоу, названное «This Is the Army» («Это Армия»). Но в личной жизни у него есть проблемы, потому что он отказывается жениться на своей невесте, пока война не закончена.','Нет данных'),(12772,'Кабак',1941,105,0.0,7.0,102,'1941-10-01','https://st.kp.yandex.net/images/film_iphone/iphone360_12772.jpg','Honky Tonk','Мошенник Кэнди Джонсон приезжает в провинциальный городишко под названием Желтый Ручей. По дороге он влюбляется в молодую красотку Элизабет Коттон, однако вскоре узнаёт, что она — дочь такого же мошенника, Франка Моргана, который является мировым судьей городка, в который они приехали. Выиграв денег в казино, Джонсон собирается открыть салун…','Нет данных'),(12777,'Нью-орлеанская возлюбленная',1941,79,0.0,6.8,168,'1941-04-24','https://st.kp.yandex.net/images/film_iphone/iphone360_12777.jpg','The Flame of New Orleans','1841 год. Новый Орлеан. Красавица, певица и международная авантюристка Клэр Леду, она же Лили, готовится выйти замуж за богатого банкира Чарльза Жиро. Но в «свободное» от будущего супруга время, она встречается с бедным, но красивым морским капитаном Робертом Латуром и не видит никакого вреда в этом развлечении.<br><br>При всем этом она окружает себя интригами и заговорами, в которые становятся вовлеченными многие ее знакомые и не знакомые сограждане, ведь ее конечная цель- это не романтические встречи, а реальные деньги богатых кавалеров…','Нет данных'),(12782,'Даже по-аргентински',1940,89,0.0,6.1,91,'1940-10-11','https://st.kp.yandex.net/images/film_iphone/iphone360_12782.jpg','Down Argentine Way','Молодой отпрыск богатого аргентинского конезаводчика Риккардо приезжает в Нью-Йорк, чтобы продать некоторых призовых лошадей из конюшни своего отца. Отец Дон Диего Кинтана, в виде напутствия, дал жесткое указание не продавать лошадей семье Кроуфорд, чей представитель его когда-то обманул. И надо же было такому случиться, что Риккардо знакомится и влюбляется как раз в представительницу этой самой семьи Гленду, которая к тому же очень хочет приобрести одну из скаковых лошадей. Узнав, что девушка выходит из злополучной семьи, Риккардо отказывается продавать лошадь и поспешно возвращается домой…','Нет данных'),(12789,'Другой тонкий человек',1939,103,0.0,6.9,167,'1939-11-17','https://st.kp.yandex.net/images/film_iphone/iphone360_12789.jpg','Another Thin Man','Третий фильм из серии приключений Ника и Норы. В этот раз они (вместе с терьером Аста и их годовалым сыном Никки — младшим) вновь отправляются в Нью-Йорк, чтобы спокойно провести отпуск. Их приглашает загород на уик-енд полковник МакФэй, богатый промышленник, которому срочно требуются услуги Ника. Полковнику угрожает некий Фил Черч, и, когда полковника все-таки убивают, Черч становится главным подозреваемым. Однако Ник уверен, что все не так просто, как кажется…','Нет данных'),(12810,'Давайте потанцуем',1937,109,0.0,7.7,389,'1937-04-29','https://st.kp.yandex.net/images/film_iphone/iphone360_12810.jpg','Shall We Dance','Танцовщик Пит Питере — гениальный мастер своего жанра. Его импресарио и продюсер Джеффри, чтобы заинтриговать публику, выдаёт его за русского по фамилии Петров. Однако «Петрова» все время тянет танцевать что-то «несерьезное», в основном степ.<br><br>К тому же он неравнодушен к танцовщице и актрисе Линде Кин, которая успешно выступает с танцевальными номерами. И он решает, что девушка должна танцевать только с ним. Чтобы познакомиться и завоевать сердце красавицы, танцор идет на различные ухищрения, порой очень комичные…','$991 000'),(12817,'Сладкая парочка',2002,92,0.0,7.2,643,'2002-04-15','https://st.kp.yandex.net/images/film/12817.jpg','Changing Hearts','Это история о любви и взаимоотношениях, которые встретили хорошая по нраву Амбер Коннорс и властная, раздражительная, стареющая Бетти Миллер, когда они обе узнали о своей страшной болезни. Бетти теряет всякую волю к жизни, как вдруг Джонни Пинкли, обаятельный романтик, решается завоевать ее сердце, а Амбер влюбляется в Джейсона — лихого, беспокойного молодого человека.','Нет данных'),(12819,'Афера Томаса Крауна',1999,109,0.0,7.7,33924,'1999-07-27','https://st.kp.yandex.net/images/film_iphone/iphone360_12819.jpg','The Thomas Crown Affair','Миллиардер Томас Краун, пресыщенный финансист, похищает из крупного музея картину Моне стоимостью в 100 млн. долларов. Кэтрин Бэннинг — следователь страховой компании, должна поймать его…','$48 000 000'),(12822,'Появляется Данстон',1996,88,0.0,6.9,888,'1996-01-07','https://st.kp.yandex.net/images/film_iphone/iphone360_12822.jpg','Dunston Checks In','Роскошный отель стоит на ушах: готовится праздник. Грандиозный карнавал должен пройти без сучка без задоринки. Тогда управляющий получит долгожданный отпуск, Маджестик Хоутел — еще больше богатеньких постояльцев, а его корыстная хозяйка — дополнительный барыш. Тут-то и появляется экстравагантный господин с орангутаном Данстоном.<br><br>Если б знать, что новый постоялец зарабатывает воровством, а симпатяга Данстон умеет очень ловко обшаривать карманы и дамские сумочки. Но до некоторых пор все выглядит вполне пристойно… Пока Данстону вдруг не надоедает работать и он, сбежав от хозяина, не заводит дружбу с детьми управляющего. Вместе они с удовольствием пускают все вокруг себя кувырком, превратив респектабельное заведение в цирковое училище.','Нет данных'),(12826,'Жгучая тайна',1988,106,0.0,6.9,177,'1988-12-22','https://st.kp.yandex.net/images/film_iphone/iphone360_12826.jpg','Burning Secret','Действие картины происходит между двумя мировыми войнами. Героиня Фэй Данауэй — блистательная жена дипломата, привозит своего сына, страдающего от астмы, на австрийский горный курорт и там встречает эксцентричного, очаровательного барона, который сначала заводит дружбу с ее сыном, а затем разжигает в ней скрытую до времени жажду любви и страсти. О сыне, естественно, забывается.','Нет данных'),(12827,'Пьянь',1987,100,0.0,7.4,10497,'1987-09-02','https://st.kp.yandex.net/images/film_iphone/iphone360_12827.jpg','Barfly','Генри Чинаски — писатель и поэт-алкоголик, проводящий свою жизнь в барах Лос-Анджелеса. Он принимает участие в уличных драках, на него делают ставки, но выпивку и гамбургер он предпочитает зарабатывать «нетрадиционными» способами.<br /><br />Однажды на другом конце стойки он видит увядающую красавицу Ванду и незамедлительно влюбляется в неё. Ванда тоже алкоголичка, но, в отличие от безработного Генри, её содержит некий бизнесмен. У Генри и Ванды разрастается «роман», но вскоре появляется главный редактор литературного журнала Тулли Соренсон, которая готова опубликовать рассказы Чинаски. При личном знакомстве Генри и Тулли выясняется, что последняя — красивая богатая молодая девушка, которая влюблена в его творчество, равно как в него самого…','$3 000 000'),(12828,'Дорогая мамочка',1981,129,0.0,5.8,339,'1981-09-16','https://st.kp.yandex.net/images/film_iphone/iphone360_12828.jpg','Mommie Dearest','Звезда кино сороковых годов Джоан Кроуфорд находится в зените своей славы. Наслаждаясь богатством и популярностью, женщина решает, что ей просто необходимо взять на воспитание приемного ребенка. Любовник, который является успешным юристом, готовит все документы, и вскоре Джоан становится официальным опекуном милой девочки по имени Кристина. Казалось бы, для малышки такой исход событий является настоящим воплощением мечты, ведь теперь ее мама — популярная и богатая звезда кинематографа. Но в реальности все оказывается несколько иначе. Голливудская красавица очень нервозна, эмоционально нестабильна, а, кроме того, просто помешана на чистоте. Сложностей добавляет также алкоголизм Джоаны и постоянная смена любовников.','$5 000 000'),(12829,'Три дня Кондора',1975,117,0.0,7.6,7059,'1975-09-24','https://st.kp.yandex.net/images/film_iphone/iphone360_12829.jpg','Three Days of the Condor','Работающий в одном из замаскированных отделов ЦРУ в Нью-Йорке парень по имени Джо Тэрнер занимается анализом бульварно-детективной литературы, в которой выискивает интересующие Ведомство «оригинальные приёмы».<br /><br />В последний предрождественский рабочий день Тэрнер, вернувшись после обеденного перерыва, с ужасом обнаруживает в конторе трупы своих 6-х коллег. Он звонит по «аварийному» телефону в дежурную часть ЦРУ. Начальство назначает ему встречу. Но она оказывается ловушкой. Тэрнеру остаётся лишь одно: на свой страх и риск выяснить причины устроенной на него охоты.','Нет данных'),(12830,'Оклахома, как она есть',1973,108,0.0,6.8,320,'1973-07-03','https://st.kp.yandex.net/images/film_iphone/iphone360_12830.jpg','Oklahoma Crude','Героиня отстаивает права на земельный участок, где открыта нефть, вступая в борьбу с могущественным трестом.','Нет данных'),(12831,'Дом под деревьями',1971,96,0.0,6.5,156,'1971-06-09','https://st.kp.yandex.net/images/film_iphone/iphone360_12831.jpg','La maison sous les arbres','Джилл разочарованно узнаёт, что её приятель-компьютерщик Филипп внезапно решает уволиться из крупной промышленной корпорации. При этом он не желает ставить её в известность о причинах принятия такого решения. Так или иначе Джилл готова смириться с этим, но когда её дети похищаются неизвестными, у неё не остаётся другого выхода, кроме как разобраться, в какую историю умудрился попасть Филипп.','Нет данных'),(12832,'Док',1971,96,0.0,6.1,193,'1971-08-04','https://st.kp.yandex.net/images/film_iphone/iphone360_12832.jpg','«Doc»','История о знаменитых героях Дикого Запада. В городке Тумстоун, штат Аризона, железной рукой порядок наводит грозный шериф Уайтт Эрп. С помощью друга, блестящего стрелка Дока Холлидэя, и своих братьев Эрп поддерживает в городе мир и покой.','Нет данных'),(12835,'Влюбленные',1968,88,0.0,7.1,332,'1968-12-19','https://st.kp.yandex.net/images/film_iphone/iphone360_12835.jpg','Amanti','Джулии осталось жить всего 10 дней, и она решает провести это время на своей итальянской вилле, смотря телевизор. Там она видит интервью с итальянским инженером Валерио. Она вспоминает, что встречалась с ним раньше. Джулия приглашает его к себе на виллу. Они влюбляются друг в друга и решают провести несколько дней вместе.','Нет данных'),(12836,'Афера Томаса Крауна',1968,102,0.0,7.3,2893,'1968-06-19','https://st.kp.yandex.net/images/film_iphone/iphone360_12836.jpg','The Thomas Crown Affair','Бостонский миллионер Томас Краун разрабатывает план гениального ограбления банка, считая, что всё сойдёт ему с рук. Уставший быть частью истеблишмента, он надеется провернуть дельце и улететь в Рио. Эрвин Вивер — один из банды грабителей, которые ни разу не встречались с Крауном, организовавшим ограбление без единой зацепки. Краун кладёт три миллиона украденных долларов на счёт в Швейцарском банке, расплачивается с грабителями и ждёт, когда страховая компания выплатит банку страховку. Эдди Мэлоун — смекалистый детектив — помогает страховому следователю Вики Андерсон в поисках гения, стоящего за организацией ограбления.','$4 300 000'),(12837,'Поторопи закат',1967,146,0.0,6.2,104,'1967-02-06','https://st.kp.yandex.net/images/film_iphone/iphone360_12837.jpg','Hurry Sundown','После Второй мировой войны владельцы консервного завода ведут переговоры относительно покупки большого и необработанного земельного участка в штате Джорджия. Главная часть земли принадлежит Джули Энн Уоррен. Вопрос владения землей и ее использования, опасность прихода новых хозяев, все это вызывает серьезные конфликты и открывает самые разные стороны характеров действующих лиц.','Нет данных'),(12839,'Нараспашку',1995,73,0.0,6.7,115,'1995-08-11','https://st.kp.yandex.net/images/film_iphone/iphone360_12839.jpg','Unzipped','Знаменитые супермодели — Наоми Кэмпбелл, Синди Круофорд, Линда Эвангелиста — персонажи сногсшибательной ленты, демонстрирующей блеск подиума и взнервленность кулис — атмосферу незабываемого, поистине революционного нью-йоркского показа моделей 1994 года.<br><br>В центре — фигура выдающегося модельера Исаака Мизрахи. Для поклонников высокой моды — пиршество глаз, для всех остальных — уникальная возможность проникнуть в реальный и очень замкнутый мир «от кутюр» познакомиться с большим художником, который продолжает творить в мире, где правят деньги.','Нет данных'),(12840,'У подножия вулкана',1984,112,0.0,6.7,164,'1984-05-18','https://st.kp.yandex.net/images/film_iphone/iphone360_12840.jpg','Under the Volcano','Действие происходит в 1938 году в мексиканской деревне во время праздника дня Мертвых — в этот день, по преданию, души усопших вырываются из ада. Джеффри Фермин, бывший британский консул, приехал повеселиться и запил. Праздник бушует, а Джеффри похож на зомби, шатающегося на улицах. Его бывшая жена Ивонн с помощью Хью, брата Джеффри, пытается вывезти его из Мексики на ферму в Штатах, надеясь, что там он сможет остановиться от запоя. Но Джеффри удается ускользнуть и он попадает в грязный бар при публичном доме, где напивается до полного беспамятства…','Нет данных'),(12841,'Победа',1981,109,0.0,6.6,1554,'1981-07-07','https://st.kp.yandex.net/images/film_iphone/iphone360_12841.jpg','Victory','Вторая мировая война. В лагере для военнопленных бывший известный футболист Колби создает команду из заключенных. И добивается разрешения на проведение матча между сборной Германии и военнопленными. К нему в команду напросился офицер-канадец Хэтч — плохой футболист, он одержим мыслью о побеге. Ему удается бежать и связаться с бойцами французского Сопротивления. И вот наступает день матча…','$10 000 000'),(12843,'Последняя пуля',1978,103,0.0,6.2,188,'1979-01-26','https://st.kp.yandex.net/images/film_iphone/iphone360_12843.jpg','Love and Bullets','Чарли Конджерс — полицейский в штатском из Финикса, штат Аризона. Недавно город посетил с визитом преступный магнат из Нью-Йорка Джо Бомпоза, взяв под свой контроль торговлю наркотиками, рэкет, проституцию и другие виды противозаконной деятельности.<br><br>А его личный адвокат с окладом в миллион долларов Луис Монк так ловко находит лазейки в законе, что местная полиция никак не может арестовать гангстера.<br><br>Когда один из полицейских в отместку за смерть своей подруги решил убить Бомпозу, Чарли отговорил его, сказав, что полиция должна действовать только законным путем. Но Бомпоза перестраховался, и полицейский был взорван в собственном автомобиле…','Нет данных'),(12844,'Человек Макинтоша',1973,98,0.0,6.5,203,'1973-07-25','https://st.kp.yandex.net/images/film_iphone/iphone360_12844.jpg','The MacKintosh Man','Британский агент Джозеф Риардон принят на работу для операции настолько секретной, что никто, кроме господина Макинтоша и его секретаря, госпожи Смит, не знают правду. Цель операции — проникнуть в таинственную агентурную сеть. Риардорн организует ограбление почтальона и позволяет быть пойманным и приговоренным к 20 годам в тюрьме Челмсфорда, где он знакомится со Слэйдом, печально известным предателем, отбывающим пожизненное заключение…','Нет данных'),(12845,'Жирный город',1972,100,0.0,6.9,543,'1972-05-12','https://st.kp.yandex.net/images/film_iphone/iphone360_12845.jpg','Fat City','Мрачный мир профессионального бокса. Боксеры Эрни и Талли находятся на поворотном моменте жизни. Талли — обычный парень из народа, он уже прошел пик своей удачи, конец звездной карьеры не за горами. Эрни же только начинает добывать первые победы.','Нет данных'),(12846,'Последняя гонка',1971,95,0.0,6.6,85,'1971-07-07','https://st.kp.yandex.net/images/film_iphone/iphone360_12846.jpg','The Last Run','Гарри Гармс, некогда связанный с преступным миром Чикаго, живет один в португальской рыбацкой деревушке. После 9 лет бездействия он решает выполнить последний контракт, чтобы самому себе доказать, что он еще на это способен. Он должен сопроводить из Испании во Францию человека по имени Поль Рикар, сбежавшего из тюрьмы…','Нет данных'),(12847,'Фрейд: Тайная страсть',1962,120,0.0,7.6,446,'1962-12-12','https://st.kp.yandex.net/images/film_iphone/iphone360_12847.jpg','Freud','Трижды за свою историю человечеству приходилось кардинально менять взгляд на самого себя. После Коперника и Дарвина, грандиозный и принципиальный переворот в умах произвел австрийский врач-невропатолог Зигмунд Фрейд, посвятивший жизнь поискам истинной причины душевных недугов и способам их преодоления.<br><br>Картина рассказывает о первых годах самостоятельной работы Фрейда в области лечения неврозов. В этот период молодому врачу пришлось нелегко, в связи с тем, что его старшие ученые коллеги категорически не принимали нового метода лечения — гипноза. Фрейд решился официально встать в оппозицию медицинским авторитетам, рискуя потерять работу, средства к существованию и возможность проводить свои исследования.<br><br>Он продолжал лечить своих частных пациентов при помощи гипноза, но уже вскоре отказался от него, приближаясь к сенсационному открытию — молодой врач на практике понял, в чем корень зла, суть человеческой природы и истинная причина душевных болезней…<br><br>Сначала это открытие испугало самого Фрейда… Но истина и долг врача заставили его переступить границу стереотипных представлений о приличиях 19 века ради выздоровления юной и, казалось бы, безнадежной пациентки по имени Сесиль…','$4 000 000'),(12848,'Непрощенная',1960,121,0.0,6.8,1003,'1960-04-06','https://st.kp.yandex.net/images/film_iphone/iphone360_12848.jpg','The Unforgiven','Штат Техас, 50-е годы XIX века. Глава семьи Захария погиб много лет назад от рук индейцев, защищая свой дом и семью. Мать одна воспитала трёх своих сыновей и девочку Рэйчел, чьи родители были убиты индейцами в те лихие дни. Неожиданно индейцы выясняют, что в девушке течёт кровь племени Кайова, и приходят забрать свою соплеменницу.<br><br>Испугавшись кровопролития, никто не приходит на помощь осаждённой семье. Братьям с матерью и сестрой приходится одним отражать нападение многочисленного и безжалостного отряда краснокожих. Боевые сцены и захватывающий дух финал никого не оставят равнодушными.','$5 000 000'),(12849,'Прощай, оружие!',1957,152,0.0,6.4,325,'1957-12-14','https://st.kp.yandex.net/images/film_iphone/iphone360_12849.jpg','A Farewell to Arms','История любви солдата и медсестры во время Первой мировой войны.','$4 353 000'),(12850,'Посрами дьявола',1953,89,0.0,6.1,377,'1953-11-24','https://st.kp.yandex.net/images/film_iphone/iphone360_12850.jpg','Beat the Devil','Пять отчаянных итальянских аферистов отправляются в рискованное, но потенциально прибыльное путешествие с целью захвата земли в Восточной Африке, где, как они считают, содержится огромное количество урана. Их утлый пароходик отправляется из Палермо и держит путь к берегам Африки, но по пути происходит непредвиденная катастрофа: взрывается паровой котел и семь оставшихся в живых путешественников добираются до берега и попадают в плен к арабам.','$1 000 000'),(12851,'Алый знак доблести',1951,69,0.0,6.5,181,'1951-09-27','https://st.kp.yandex.net/images/film_iphone/iphone360_12851.jpg','The Red Badge of Courage','Почти подростком Генри Флеминг вступает в армию северян и с нетерпением ждет приказа, который пошлет его в бой. Когда наконец приказ об участии его подразделения в предстоящей битве приходит, оказывается, что Генри хвастун. Столкнувшись с неприятелем лицом к лицу, он в страхе бежит, но побеждает свой страх позже и возвращается в отряд для следующего сражения.','$1 640 000'),(12853,'Да будет свет',1980,58,0.0,5.9,81,'1980-12-16','https://st.kp.yandex.net/images/film/12853.jpg','Let There Be Light','Государственная больница Эджвуд (англ. Edgewood State Hospital), Лонг-Айленд, Нью-Йорк, 1944 — 1946 г. г. Жизнь семидесяти пяти американских солдат, проходящих психологическую реабилитацию, от их поступления в психиатрическую клинику до окончательного выздоровления.','Нет данных'),(12855,'В этом наша жизнь',1942,97,0.0,7.0,179,'1942-05-08','https://st.kp.yandex.net/images/film_iphone/iphone360_12855.jpg','In This Our Life','Молодая женщина по имени Стэнли бросает своего жениха Крейга и сбегает с мужем своей сестры Питером. Беглецы женятся и переезжают в Балтимор. Однако скверный характер Стэнли доводит Питера до алкоголизма и в конечном счете до самоубийства. Стэнли возвращается в родной город и решает вновь завязать роман с бывшим женихом, однако выясняется, что он собирается жениться на ее сестре…','Нет данных'),(12857,'Черный котел',1985,80,0.0,6.9,5818,'1985-07-24','https://st.kp.yandex.net/images/film_iphone/iphone360_12857.jpg','The Black Cauldron','Главный герой — Таран, мальчик-свинопас, мечтающий стать великим воином и защитником родного Придейна. Его антагонист — злой и могущественный Рогатый король, вознамерившийся завладеть Чёрным котлом и с помощью заключённой в нём силы воскресить армию нежити и покорить мир. Однако найти Чёрный котёл — непростая задача. Его местонахождение может указать волшебная свинка Хен Вен, живущая у старого волшебника Даллбена. Узнав о намерениях Рогатого короля, Даллбен поручает Тарану отвести свинку в надёжное место. По дороге Таран теряет Хен Вен, и начинаются его приключения.','$44 000 000'),(12860,'Бермудский треугольник',1978,112,0.0,6.2,375,'1978-02-10','https://st.kp.yandex.net/images/film_iphone/iphone360_12860.jpg','The Bermuda Triangle','Люди, самолеты, корабли бесследно исчезают во времени и пространстве. В центре трагических событий, разыгравшихся посреди океана на небольшой яхте, оказывается группа подводных археологов. Сначала на палубе находят чайку с перерезанным горлом… Разгадка странных событий, которые начинают происходить с экипажем прогулочной яхты в районе Бермудов, заключается в кукле, найденной в океане.','Нет данных'),(12862,'Ветер и лев',1975,119,0.0,6.5,256,'1975-05-22','https://st.kp.yandex.net/images/film_iphone/iphone360_12862.jpg','The Wind and the Lion','Начало 1900-х. Американка Эден и двое ее детей были похищены в Морокко лидером арабских мятежников Ахмедом Раисули. Конфликт мог привести к военному вмешательству, однако вскоре отношения Эден и Раисули сильно изменились. Спустя некоторое время, после освобождения Эден, мятежник сам стал пленником немецких захватчиков. С помощью Эден и благодаря содействию президента Теодора Рузвельта Раисули удалось бежать…','$4 000 000'),(12863,'Человек диких прерий',1971,104,0.0,6.8,290,'1971-11-24','https://st.kp.yandex.net/images/film_iphone/iphone360_12863.jpg','Man in the Wilderness','Фильм о проводнике группы пионеров, изучавших северо-запад Соединенных Штатов в 1820 году. Проводник был ранен медведем и оставлен компаньонами умирать. Он смог достаточно оправиться, чтобы выследить своих прежних товарищей…','Нет данных'),(12866,'Майра Брекинридж',1970,94,0.0,5.5,107,'1970-06-22','https://st.kp.yandex.net/images/film_iphone/iphone360_12866.jpg','Myra Breckinridge','Майрон Брекинридж, уехав в Европу, поменял пол и под именем Майры Брекинридж вернулся в Штаты. В Голливуде сексапильная Майра начала учиться в актерской школе. Она не скрывала своей неприязни к мужчинам и объявила, что никто и никогда не будет обладать Майрой Брекинридж…','Нет данных'),(12872,'Три незнакомца',1946,92,0.0,6.9,97,'1946-01-28','https://st.kp.yandex.net/images/film_iphone/iphone360_12872.jpg','Three Strangers','В канун китайского Нового года три незнакомца, вверяясь китайскому идолу Кван Инь, загадали одно и то же желание — это был билет на победителя в скачках. Сразу после этого они расстались и вплоть до дня, когда должны были состояться бега, жизни их текли независимо. Это были жизни покинутой женщины, растратчика и преступника…','Нет данных'),(12873,'Темные воды',1944,90,0.0,5.2,96,'1944-11-21','https://st.kp.yandex.net/images/film_iphone/iphone360_12873.jpg','Dark Waters','Лесли Кельвин, единственная выжившая после крушения подводной лодки, отправляется к своим родственникам, чтобы восстановить свои эмоциональные силы. К несчастью, она сталкивается с мошенником мистером Сидни, который намеревается убить ее и похитить семейные ценности.','Нет данных'),(12877,'Убийства на улице Морг',1932,61,0.0,6.4,488,'1932-02-21','https://st.kp.yandex.net/images/film_iphone/iphone360_12877.jpg','Murders in the Rue Morgue','Париж, 19-й век. Безумный ученый доктор Миракл, одержимый идеей доказать миру теорию происхождения видов, cтавит опыты по скрещиванию человека с обезьяной. Для этого он похищает женщин и вводит им внутривенно кровь гориллы. Жертвы, однако, вскоре умирают. И вот подошла очередь возлюбленной студента-медика Андрэ Дюпена…','$190 000'),(12894,'Безжалостная попутчица',1997,95,0.0,5.6,98,'1997-01-10','https://st.kp.yandex.net/images/film/12894.jpg','Red-Blooded American Girl II','Пара маньяков путешествует по дорогам в поисках извращенных сексуальных удовольствий, психологических манипуляций и смертельных погонь.','Нет данных'),(12903,'Кровавый пляж',1980,92,0.0,4.3,91,'1981-01-23','https://st.kp.yandex.net/images/film_iphone/iphone360_12903.jpg','Blood Beach','На одном из курортных пляжей неведомая сила затягивает людей в песок. Поспешность и невежество, которые проявляют городские власти, чтобы замять скандал, приводит к еще более серьезным последствиям. Под пляжным песком скрываются кровожадные существа, которые могут слопать невинную собачку или зазевавшуюся девушку.','Нет данных'),(12908,'Заговор «Параллакс»',1974,102,0.0,6.7,663,'1974-06-19','https://st.kp.yandex.net/images/film_iphone/iphone360_12908.jpg','The Parallax View','Репортер Джо Фрэйди случайно оказался одним из свидетелей убийства политического деятеля. Когда остальные семь очевидцев преступления один за другим умирают при загадочных обстоятельствах, наш герой начинает сомневаться в истинности официальной версии, гласящей, что убийство — дело рук одиночки-психопата.<br><br>Джо начинает мерещиться целая группировка высококлассных натренированных киллеров. Но все ночные кошмары Фрейди бледнеют перед жуткой истиной, до которой ему предстоит докопаться.','Нет данных'),(12909,'Новые центурионы',1972,103,0.0,7.1,531,'1972-08-03','https://st.kp.yandex.net/images/film_iphone/iphone360_12909.jpg','The New Centurions','Новичок Рой Фехлер приходит в полицию и принимается за работу с рвением, приводящим к развалу собственной семьи. В напарники ему достается опытный и принципиальный коп — настоящий матерый волк. Каждый раз, выезжая на дежурство, они балансируют на грани жизни и смерти, строго придерживаясь в своей деятельности главного лозунга: «Защищать и служить».','Нет данных'),(12910,'Вилья в седле',1968,125,0.0,6.9,124,'1968-05-29','https://st.kp.yandex.net/images/film_iphone/iphone360_12910.jpg','Villa Rides','Панчо Вилья и его правая рука Фьерро сражаются бок о бок с мексиканскими правительственными войсками на стороне «истинного» президента Мадеро. Один из офицеров Вильи, корыстолюбивый Хуэрто, прибегнув к хитрости, убивает президента Мадеро и занимает место лидера Мексики. Но вскоре в сторону Мехико выдвигается пятидесятитысячная армия, во главе которой идет Панчо Вилья, требующий справедливости.','Нет данных'),(12911,'Гробница Лигейи',1964,81,0.0,6.4,534,'1965-01-20','https://st.kp.yandex.net/images/film_iphone/iphone360_12911.jpg','The Tomb of Ligeia','Верден Фелл, ученый — египтолог, женится вторично после смерти своей горячо любимой жены Лигейи, увлекавшейся оккультизмом. Последними словами Лигейи были «Смерти себя не предаю». И вот, по прошествии некоторого времени, Фелл начинает замечать что у его новой жены начинают проявляться черты Лигейи…','Нет данных'),(12912,'Последняя женщина на Земле',1960,71,0.0,4.3,77,'1960-08-05','https://st.kp.yandex.net/images/film_iphone/iphone360_12912.jpg','Last Woman on Earth','Замужняя пара Эвелин и Гарольд, а также их друг Мартин отправляются в море на прогулку. Они решают нырнуть с аквалангом и полюбоваться морской природой. После непродолжительного морского приключения они поднимаются на поверхность и видят, что капитан их яхты мёртв. Сняв маску, Гарольд едва не погибает. Причина всего этого — отсутствие кислорода в воздухе: растения перестали его выделять.<br><br>С трудом Гарольд, Мартин и Эвелин добираются до ближайшего острова и выясняют, что все мертвы. Радио и телевидение не работает, рация не отвечает, а улицы и кафе усеяны трупами. Таким образом, эти трое — единственные выжившие на Земле люди. Они обустраиваются в одном из особняков и решают жить вместе. Постепенно Мартин начинает оказывать знаки внимания жене Гарольда…','Нет данных'),(12914,'Существо из моря с привидениями',1961,63,0.0,3.9,81,'2005-11-17','https://st.kp.yandex.net/images/film_iphone/iphone360_12914.jpg','Creature from the Haunted Sea','Бандит Рензо переправляет в безопасное место группу людей, скрывающихся от кубинских революционеров. Решив лишний раз напугать беглецов, Рензо рассказывает им истории о мифическом морском монстре, нападающем на корабли, но вскоре сам убеждается, что все эти истории — не просто страшные сказки.','Нет данных'),(12915,'Тем тяжелее падение',1956,109,0.0,7.5,517,'1956-05-08','https://st.kp.yandex.net/images/film_iphone/iphone360_12915.jpg','The Harder They Fall','Спортивный журналист Эдди Виллис вращается в мире профессионального бокса и становится, как сейчас говорят, «пиарщиком» начинающего боксера. Проработав 17 лет в газете и не заработав ничего на «черный» день, он соглашается вести грязную «раскрутку» бездарного, слабого боксера внушительной внешности и роста.<br><br>«Бокс — это балет, шоу, на котором делают деньги», — так говорит ему полукриминальный промоутер Род Стайгер, — но ведь в балете не убивают в раздевалке танцоров, отказывающихся танцевать. Только сейчас Эдди понимает всю подноготную этого безжалостного мира, где менеджеры жестоко и без всяких сантиментов манипулируют своими боксерами. Хватит ли у него силы воли восстать против хорошо отлаженной машины криминального бизнеса?','Нет данных'),(12916,'Мы не ангелы',1955,106,0.0,7.0,538,'1955-07-07','https://st.kp.yandex.net/images/film_iphone/iphone360_12916.jpg','We\'re No Angels','Легкая, развлекательная комедия. Трое заключенных с Острова Дъявола изображают Санта-Клауса в семье, которую они пришли ограбить.<br><br>Вся троица отсиживала пожизненные сроки, и терять им нечего: Джозеф за фальшивомонетчество, а двое других — за убийство. Семейство же они застают переживающим трудности, которые никак не подходят к Рождеству.','$1 685 000'),(12917,'Босоногая графиня',1954,128,0.0,6.7,880,'1954-09-29','https://st.kp.yandex.net/images/film_iphone/iphone360_12917.jpg','The Barefoot Contessa','Испанская танцовщица Мария Варгас грациозна и талантлива, она родилась для того, чтобы стать звездой. В ночном кабаке в Мадриде, где она танцевала босоногой, ее заприметил режиссер Гарри и вскоре Мария добивается головокружительного успеха на голливудской фабрике грез. Непременный атрибут звездной жизни — череда любовников: известный гитарист, латиноамериканский миллионер…<br><br>Появляется и законный супруг — итальянский граф Винченцо, шофер которого вскоре занимает место очередного любовника Марии… Остается совсем немного времени до трагической развязки, но… Босоногая графиня никогда не будет танцевать под чужую музыку!','Нет данных'),(12918,'Арена боя',1953,90,0.0,5.9,72,'1953-03-06','https://st.kp.yandex.net/images/film_iphone/iphone360_12918.jpg','Battle Circus','Во время корейской войны молодая медсестра прибывает на фронт в небольшой полевой госпиталь. Рут страстно влюбляется в хирурга, майора Джеда. История их любви разворачивается прямо посреди военных действий, на линии фронта. Джед колеблется, но Рут с головой окунается в свои чувства, несмотря на все трудности военного времени. Атаки врагов, сложные погодные условия, многочисленные жертвы — кажется, не до романтики, но любовь живет вопреки всем трудностям и обстоятельствам.','Нет данных'),(12919,'Криминальная полоса в прессе США',1952,87,0.0,7.1,184,'1952-03-14','https://st.kp.yandex.net/images/film_iphone/iphone360_12919.jpg','Deadline - U.S.A.','Эд Хатчисон, принципиальный и несговорчивый редактор Нью-Йоркской газеты «День», обнаруживает, что наследники покойного владельца продают неспокойную газету своему коммерческому конкуренту. Сначала он рассматривает нависшую безработицу как возможность вернуть свою жену Нору, с которой он в разводе уже два года. Но когда его репортер, расследуя деятельность рэкетира Ренци, оказывается, ужасно избит, Хатчисон начинает бескомпромиссный крестовый поход против гангстера, в надежде, что Ренци может быть причастен к убийству молодой женщины…и все это за три выпуска до закрытия газеты «День».','Нет данных'),(12920,'Насаждающий закон',1951,87,0.0,7.6,561,'1951-01-25','https://st.kp.yandex.net/images/film_iphone/iphone360_12920.jpg','The Enforcer','Герою Хамфри Богарта противостоит неуловимый синдикат убийц, поставивший преступления на конвейер. Все они были убиты по приказу Альберта Мендозы, создавшего совершенно новый вид бизнеса — убийство по заказу.','Нет данных'),(12922,'Токийский Джо',1949,88,0.0,6.3,99,'1949-10-26','https://st.kp.yandex.net/images/film_iphone/iphone360_12922.jpg','Tokyo Joe','В надежде наладить прежнюю жизнь после Второй мировой войны, полковник Джо Баррет возвращается в Токио — здесь в довоенное время он управлял кабаре «Токийский Джо» и был женат на русской эмигрантке Трине. Будучи полностью уверенным в её гибели, Джо внезапно узнаёт, что на самом деле она жива, и более того — состоит в браке с американским дипломатом. Решительно вознамерившись вернуть Трину себе, он оказывается крепко втянут в шантаж и мятежный заговор.','Нет данных'),(12923,'Стучись в любую дверь',1949,100,0.0,7.1,335,'1949-02-22','https://st.kp.yandex.net/images/film_iphone/iphone360_12923.jpg','Knock on Any Door','Ник Романо — хулиган, живущий в квартале для бедняков. Его обвиняют в убийстве полицейского, и за это молодому человеку грозит смертная казнь. Единственный, кто соглашается ему помочь, — адвокат Эндрю Мортон, который в юности сам пережил подобную ситуацию. Сможет ли он убедить суд, что Ник не прирожденный убийца, а всего лишь жертва обстоятельств?','$900 000'),(12924,'Война в Северной Атлантике',1943,126,0.0,6.3,96,'1943-05-21','https://st.kp.yandex.net/images/film_iphone/iphone360_12924.jpg','Action in the North Atlantic','Американский танкер потоплен торпедой от немецкой подлодки. Выжившие члены экипажа, проведя несколько дней в открытом море, спасены и возвращаются на берег в ожидании нового назначения. Капитан Стив Джарвис отправляется домой к жене; его помощник Джо Росси знакомится с певицей в баре и женится на ней. Оба попадают на борт корабля «Морская ведьма», следующий в Мурманск в составе конвоя союзников…..','Нет данных'),(12925,'Черная полоса',1947,106,0.0,7.6,1169,'1947-09-05','https://st.kp.yandex.net/images/film_iphone/iphone360_12925.jpg','Dark Passage','Винсенту Перри, заключенному пожизненно в Сан-Квентин за убийство жены, спустя 10 лет удается бежать. На пустынном шоссе его подсаживает Ирен Дженсен, которая предлагает ему помощь и укрытие.<br><br>Полиция идет по пятам, и Винсент делает пластическую операцию, чтобы получить передышку и начать поиски подлинного убийцы. Только тогда он будет в безопасности и сможет постараться забыть о вычеркнутых из жизни 10 годах. Но убийца сам находит его и отсчет жертв продолжается…','Нет данных'),(12926,'Рассчитаемся после смерти',1947,100,0.0,7.5,701,'1947-01-02','https://st.kp.yandex.net/images/film_iphone/iphone360_12926.jpg','Dead Reckoning','Отважные парашютисты-десантники Рип Мердок и Джонни Дрейк возвращаются с фронта, Конгресс США представил их к наградам, и на вокзале их встречают журналисты, собирающиеся опубликовать материал о героях войны. Завидев репортеров, Джонни неожиданно в панике бежит, Рип начинает его поиски и попадает в такой переплет, по сравнению с которым война — прогулка.<br><br>Следы друга приводят Рипа в маленький городок Галф Сити, откуда Джонни бежал 2 года назад после обвинения в убийстве некоего Чендлера, и куда, похоже, вновь вернулся сейчас. Что же заставило его так рисковать, ведь полиция до сих пор мечтает усадить его за решетку: то ли желание найти настоящего убийцу и снять с себя подозрения, то ли страсть к вдове погибшего — сногсшибательной красотке Корэл Чендлер?<br><br> Оказавшись в Галф Сити, Рип оказывается в самом эпицентре череды убийств и, преследуемый и полицией и гангстерами, вынужден яростно сражаться за свою жизнь…','Нет данных'),(12927,'Конфликт',1945,86,0.0,7.0,287,'1945-06-15','https://st.kp.yandex.net/images/film_iphone/iphone360_12927.jpg','Conflict','Ричард Мейсен получил незначительные повреждения в автомобильной аварии, но делает вид тяжело пострадавшего, чтобы не сопровождать свою жену Кэтрин во время похода в горы. Однако, он таки убивает ее на заброшенной горной тропе. Или не он?','Нет данных'),(12928,'Важная шишка',1942,82,0.0,6.8,88,'1942-06-13','https://st.kp.yandex.net/images/film_iphone/iphone360_12928.jpg','The Big Shot','«Крутой» парень Дюк Бёрн выходит на свободу после третьего срока и двадцати лет тюрьмы, полный растерянности и страха. Четвертое задержание для него — это пожизненный срок. Он готов начать жизнь заново, но прошлое вновь затягивает его…','Нет данных'),(12929,'На протяжении всей ночи',1942,107,0.0,6.7,137,'1942-01-10','https://st.kp.yandex.net/images/film_iphone/iphone360_12929.jpg','All Through the Night','Гловс Донахью — нью-йоркский спортивный промоутер. В течение многих лет каждое его утро начинается с чизкейка, приготовленного в пекарне Миллера. Но однажды устоявшийся распорядок был нарушен: владельца пекарни, Миллера, убивают. Он видел, как певица из ночного клуба Леда Гамильтон покидает пекарню. По просьбе своей матери Гловс начинает своё расследование. А когда партнер босса певицы Марти Джо также оказывается убит, Леда и ее аккомпаниатор Пепи исчезают. Вскоре выясняется, что за убийством Миллера стоит крупная подпольная организация, в планах которой — захват страны. Так Гловс выходит на банду тайных нацистов.','Нет данных'),(12932,'Вирджиния-Сити',1940,121,0.0,6.4,91,'1940-03-16','https://st.kp.yandex.net/images/film_iphone/iphone360_12932.jpg','Virginia City','1864 год, Гражданская война в США подходит к концу. Сторонники южных штатов решают использовать последний шанс. В помощь своей истекающей кровью армии, они решают доставить $5 миллионов в золотых слитках из Вирджиния-Сити.<br /><br />Везти золото через вражеские штаты поручено капитану Ирби, у которого есть хитроумный план. Помешать этому пытается Керри Брэдфорд, капитан военной разведки союзной армии. Но о золоте узнал и главарь местной банды Маррелл. Три стороны сцепились в смертельной схватке…','Нет данных'),(12933,'Возвращение доктора X',1939,62,0.0,5.8,156,'1939-11-23','https://st.kp.yandex.net/images/film_iphone/iphone360_12933.jpg','The Return of Doctor X','Журналист Уолтер, придя к знаменитой актрисе взять интервью, обнаружил ее мертвой и вызвал полицию. Прибыв на место происшествия, полиция не находит труп, а на следующий день актриса заявляется в полицию и Уолтер выглядит чрезвычайно глупо. Решив, что он не смог ошибиться Уолтер начинает следить за актрисой и знакомится с ее доктором. <br><br>Доктору Фрэнсису Флэгу, специалисту и исследователю в области заболевания крови, оказывает помощь неизвестно откуда взявшийся в последние месяцы сотрудник, по имени Маршалл Квисн. При взгляде на него поражала необычайная бледность лица, прямо-таки безжизненная, и широкая проседь волос. И еще он кого-то смутно напоминает. Но кого? <br><br>Вскоре выясняется, что помощник является доктором Морисом Ксавье, тем самым Ксавье, которого признали виновным в убийстве ребенка в ходе эксперимента, и который был казнен на электрическом стуле. Но как же он «вернулся» к жизни?','Нет данных'),(12934,'Ревущие двадцатые, или Судьба солдата в Америке',1939,106,0.0,8.0,1616,'1939-10-28','https://st.kp.yandex.net/images/film_iphone/iphone360_12934.jpg','The Roaring Twenties','Шли «ревущие 20-е» годы, время, когда спор решали пулями, а автоматные очереди все чаще нарушали тишину улиц. Вернувшиеся в Чикаго по окончании Первой мировой войны, Джордж и Эдди начинают сколачивать свои капиталы, торгуя контрабандным спиртным и организовав крупную банду.<br><br>Их рэкет процветает, пока «здоровая» конкуренция не вмешивается в их дружбу. Выясняется, что уложить всех вокруг себя гораздо проще, чем договориться…','Нет данных'),(12935,'Победить темноту',1939,104,0.0,7.1,497,'1939-04-20','https://st.kp.yandex.net/images/film_iphone/iphone360_12935.jpg','Dark Victory','Молодая красавица Джудит Трэйхерн находится в центре внимания окружающих, когда доктор Фредерик Стил ставит ей страшный диагноз — опухоль мозга. После операции между Джудит и Фредериком начинается роман. Но вскоре выясняется, что болезнь вернулась и на этот раз ничто уже не поможет…','Нет данных'),(12936,'Парень из Оклахомы',1939,85,0.0,6.2,82,'1939-03-03','https://st.kp.yandex.net/images/film_iphone/iphone360_12936.jpg','The Oklahoma Kid','Банда Маккорда совершает грабёж, чтобы заплатить индейцам за их землю, а преступник, известный как «Оклахомский парень» — Джим Кинкэйд — получает эти деньги от Маккорда. Маккорд хочет использовать полученную землю для строительства нового города, но отказывается от задуманного, когда ему предлагают контролировать азартные игры.','Нет данных'),(12938,'Ангелы с грязными лицами',1938,97,0.0,7.8,2668,'1938-11-26','https://st.kp.yandex.net/images/film_iphone/iphone360_12938.jpg','Angels with Dirty Faces','Два друга детства вместе совершили кражу. Рокки попался, взял всю вину на себя, сел в тюрьму и стал профессиональным преступником, а Джером подался в священники. Выйдя из тюрьмы в очередной раз, Рокки отправился к Джиму Фрезеру, своему адвокату-партнеру, распоряжавшемуся все это время их общими деньгами, а тот вместо доли натравил на него убийц…','Нет данных'),(12944,'Тупик',1937,93,0.0,7.1,767,'1937-08-24','https://st.kp.yandex.net/images/film_iphone/iphone360_12944.jpg','Dead End','Десять лет не был в родном городе Мартин по прозвищу Детское личико. За это время он стал солидным гангстером с соответствующим послужным списком (ограбления, убийства) и характерными внешними приметами (дорогой прикид, пачки долларов и пистолет в кармане).<br><br>Его малая родина — это нью-йоркские трущобы, где мечта людей вырваться из бедности так и остается мечтой, где любой подросток без колебаний готов пойти по жизни неверной дорогой гангстера. Мать прогоняет блудного сына, бывшая подружка тоже не рада встрече с ним. Если бы только этим ограничились «неприятности» Мартина. Как известно, возвращаться — очень плохая примета…','$300 000'),(12945,'Великий О’Мэлли',1937,71,0.0,6.9,73,'1937-02-13','https://st.kp.yandex.net/images/film_iphone/iphone360_12945.jpg','The Great O\'Malley','Джеймс О’Мэлли проходит путь от супер-правильного полицейского, дотошно следующего букве закона, до человека, способного сопереживать проблемам окружающих. А помогает ему в этом маленькая дочка недавно арестованного им парня…','Нет данных'),(12946,'Черный легион',1937,83,0.0,6.4,197,'1937-01-17','https://st.kp.yandex.net/images/film_iphone/iphone360_12946.jpg','Black Legion','Фильм рассказывает о реально существовавшем «Черном Легионе», который был ответвлением Ку-клукс-клана и действовал в Соединенных Штатах Америки в 1930-х годах. Фрэнк Тейлор, работник завода в Детройте, присоединяется к «проамериканской» группировке, выступавшей против иностранцев и иммигрантов, занимавших рабочие места и обвиняя именно их в растущей безработице.<br /><br />Растущие потребности его семьи, давление со стороны Легиона, в ряды которого он вступил, все более амбициозные планы по поводу работы и повышения в должности, все ведет Фрэнка на путь преступления. Сначала Легион помогает ему занять место мастера, спалив ферму и силой посадив в поезд предыдущего талантливого работника, назначенного мастером, который был из числа иммигрантов. Но когда Тейлор попытался выйти из состава Легиона, ему пригрозили расправой с семьей…','Нет данных'),(12949,'Окаменевший лес',1936,82,0.0,7.3,605,'1936-01-31','https://st.kp.yandex.net/images/film_iphone/iphone360_12949.jpg','The Petrified Forest','Элан Скуайр — писатель-идеалист, уставший от грубой жестокости жизни, без цента в кармане идет по шоссе в пустыне Аризоны. Остановившись в ресторане на старой бензоколонке ворчливого Джейсона Мэйпла, Элан знакомится и влюбляется в Габриэллу, дочь Мэйпла.<br><br>Девушка мечтает учиться в Париже. Когда на бензозаправку подъезжают супруги Чизхолм, Габриэлла уговаривает их взять Элана с собой в Калифорнию. Но им не удалось далеко уехать: безжалостный гангстер Дьюк Мэнти и его сообщники, совершившие убийства в Оклахоме, берут всех в заложники.<br><br>Писатель называет гангстера «последним великим апостолом грубого индивидуализма» и заключает с ним договор, — просит, чтобы тот застрелил его перед отъездом…','$500 000'),(12950,'Полночь. Смертельный приговор',1934,76,0.0,6.2,101,'1934-03-07','https://st.kp.yandex.net/images/film_iphone/iphone360_12950.jpg','Midnight','Старшина присяжных в суде Эдвард Уэлдон выносит смертный приговор Этель Сакстон, убившей своего возлюбленного после того, как он сообщил ей о разрыве отношений. Никто и ничто не может поколебать уверенности присяжного в правильности принятого решения. Но в ночь накануне приведения в исполнение приговора его собственная дочь Стелла совершает подобное убийство.','Нет данных'),(12951,'Трое в паре',1932,63,0.0,6.6,130,'1932-10-28','https://st.kp.yandex.net/images/film_iphone/iphone360_12951.jpg','Three on a Match','Три школьные подружки подросли и стали представительницами разных социальных слоев населения. «Правильная» — выучилась на труженицу-стенографистку. «Оторванная» — прошла перевоспитание в исправительном учреждении. «Красотка» Вивьен вышла замуж за богача, купается в роскоши и растит сына. Однако, из-за отсутствия трудностей в жизни, Вивьен вдруг «срывается с катушек» и сбегает от мужа с каким-то проходимцем, прихватывая и ребенка заодно. В результате Вивьен очень стремительно скатывается вниз по социальной лестнице и подвергает опасности не только свой трещащий по швам брак, но и жизнь собственного ребенка.','Нет данных'),(12956,'Плохая сестра',1931,68,0.0,6.2,120,'1931-03-29','https://st.kp.yandex.net/images/film_iphone/iphone360_12956.jpg','The Bad Sister','Красавица-капризуля младшенькая, которой все сходит с рук и молчальница-неудачница старшая, которой ничего не сходит с рук, поскольку она молчит и ни о чем не просит. За хорошенькой сестрой ухаживают два завидных кавалера, один занят страховым бизнесом, а второй врач. <br><br>А старшая — молчаливо влюблена во врача. Только дневнику она доверила свою тайну, да еще неугомонный братик, совсем еще ребенок, но отчаянный бесенок, что-то подозревает и вечно всюду сует свой любопытный нос. Но вот в городе появляется аферист (но никто об этом не знает — на лбу же у него не написано) и мгновенно в его сети попадает красавица…','Нет данных'),(12959,'Вверх по реке',1930,92,0.0,6.5,131,'1930-10-10','https://st.kp.yandex.net/images/film_iphone/iphone360_12959.jpg','Up the River','Двое осужденных Сент Луис и Дэннимора Дэн помогают другому осужденному по имени Стив, который влюбился в осужденную из женской части тюрьмы Джуди. В конце концов, и Стив, и Джуди освобождены из тюрьмы. Они женятся и уезжают в родной город Стива, где никто не догадывается о его преступном прошлом.<br><br>Не долго, однако, пара наслаждалась счастливой и мирной жизнью, поскольку их семейное счастье оказалось в руках шантажиста и нечестного продавца Фросби, который знал раньше Джуди…','Нет данных'),(12962,'Комедия ужасов',1963,84,0.0,6.8,578,'1963-12-25','https://st.kp.yandex.net/images/film_iphone/iphone360_12962.jpg','The Comedy of Terrors','Владельца похоронного бюро, у которого долгое время не было «клиентов», вынуждают заплатить арендную плату за год. Чтобы достать деньги, он начинает убивать людей, и дела у его конторы начинают идти лучше.','Нет данных'),(12964,'Истории ужасов',1962,89,0.0,7.0,615,'1962-07-04','https://st.kp.yandex.net/images/film_iphone/iphone360_12964.jpg','Tales of Terror','Фильм состоит из трёх историй.<br><br>Первая повествует о затворнике-аристократе, потерявшем интерес к жизни после смерти во время родов любимой жены Мореллы. И вот к нему приезжает совсем взрослая дочь, которую он выслал из дома из ненависти. Однако единению отца и дочери может помешать призрак Мореллы, которая жаждет мести.<br><br>Героем второй новеллы является Монтрезор, тратящий все семейные сбережения на вино и развлечения. Однажды он приводит домой случайного знакомого — утончённого дегустатора вин Фортунато Лукрези, который сразу засматривается на симпатичную жену Монтрезора. Теперь супруга всё чаще снабжает последнего деньгами, чтобы в его отсутствие развлекаться с любовником, но их роману не суждено продлиться долго…<br><br>Третий рассказ — о смертельно больном Вальдемаре, согласившемся отдать своё тело под псевдонаучный эксперимент хитрого гипнотизёра. Последний же лишь мечтает о прекрасной жене Вальдемара и готов пойти на преступление ради осуществления своих коварных замыслов.','Нет данных'),(12965,'Путешествие на дно моря',1961,105,0.0,5.5,140,'1961-07-12','https://st.kp.yandex.net/images/film_iphone/iphone360_12965.jpg','Voyage to the Bottom of the Sea','Вся планета объята страшным пожаром, вызванным внезапным «сумасшествием» пояса радиации Ван Аллена. Мужественный адмирал Нельсон, командир атомной подводной лодки, придумывает хитроумный план спасения человечества.<br><br>Он направляет подлодку в район Марианской впадины, чтобы запустить на орбиту ракету «Полярис» и взорвать очумевший «пояс». Эта миссия настолько опасна, что экипаж корабля готов поднять бунт против командира.','Нет данных'),(12970,'Шелковые чулки',1957,117,0.0,6.8,247,'1957-07-18','https://st.kp.yandex.net/images/film_iphone/iphone360_12970.jpg','Silk Stockings','Стив Кэнфилд, голливудский кинопродюсер, приезжает в Париж снимать кино и знакомится с советским композитором Петром Ильичем Боровым. Он уговаривает русского остаться во Франции, чтобы написать музыку для его кинофильма.<br><br>В Москве узнают о композиторе-изменнике Родины. Чекист Василий Маркович посылает трех оперативников вернуть перебежчика, но троица, Бранков, Бибинский и Иванов, оказавшись за кордоном, с наслаждение начинает предаваться радостям жизни на Западе.<br><br>КГБ поручает самому стойкому агенту и примерной коммунистке Ниночке, вернуть всех беглецов. Стив, влюбляется в комиссаршу и предлагает ей руку и сердце, но Ниночка холодна и вместе с коллегами возвращается в СССР. Проходят дни, партия и правительство вновь посылают в Париж представлять советскую киноиндустрию Бранкова, Бибинского и Иванова, а они там становятся партнерами Стива. Ниночку опять командируют во Францию «за заблудшими овцами», но на этот раз непреступная комиссар ша влюбляется в Кэнфилда.','$1 853 463'),(12976,'Зверь с пятью пальцами',1946,88,0.0,5.6,122,'1946-12-25','https://st.kp.yandex.net/images/film_iphone/iphone360_12976.jpg','The Beast with Five Fingers','В небольшой итальянской деревушке живёт великий пианист Фрэнсис Инграм, но он прикован к инвалидной коляске. Однажды ночью он погибает по недосмотру своей медсестры-сиделки Джулии. После этого начинают происходить странные события.','Нет данных'),(12977,'Вердикт',1946,86,0.0,6.9,121,'1946-11-06','https://st.kp.yandex.net/images/film_iphone/iphone360_12977.jpg','The Verdict','Инспектора Скотланд Ярда Гродмана увольняют с работы после 30 лет службы, так как по его вине обвинили и казнили невиновного человека. На его должность назначают инспектора Бакли, который обещает впредь не допускать подобных ошибок. Однако, вскоре происходит очередное убийство и полиция просит помощи у Гродмана. Тот решает помочь бывшим коллегам, но делает это необычным способом.','Нет данных'),(12978,'Погоня',1946,86,0.0,5.9,150,'1946-11-17','https://st.kp.yandex.net/images/film_iphone/iphone360_12978.jpg','The Chase','Чак Скотт получает работу в качестве шофера у парня с тяжелым характером Эдди Романа; но увлечение Чака боязливой женой Эдди становится кошмаром.','Нет данных'),(12979,'Чёрный ангел',1946,81,0.0,6.3,211,'1946-08-02','https://st.kp.yandex.net/images/film_iphone/iphone360_12979.jpg','Black Angel','Кирк Беннетт ошибочно обвинен в убийстве популярной певицы. Мартин Блэр, бывший муж покойной, решает помочь жене приговоренного, жаждущей доказать невиновность своего супруга. Но все становится намного сложнее, когда Мартин влюбляется в нее…','Нет данных'),(12982,'Конспираторы',1944,101,0.0,6.3,77,'1944-10-11','https://st.kp.yandex.net/images/film_iphone/iphone360_12982.jpg','The Conspirators','Участник Сопротивления, голландец Винсент Ван Дер Лин, оказывается в Лиссабоне, на пути из оккупированной Европы в Лондон, где намеревается продолжать борьбу. Здесь он встречает красивую и весьма загадочную женщину Ирэн, влюбляется в нее и решает, что война может немного подождать. Но выясняется, что Винсент — ключевая фигура в сложной игре, которую ведут, с одной стороны, немецкие агенты в нейтральной Португалии, с другой члены общеевропейского Сопротивления, возглавляемые эпатажным Рикардо Квинтанилла. На пути истинной любви не все гладко, поскольку Винсент и Ирен подозревают друг друга в связях с гестапо. Кроме того, у Ирен очень неподходящий муж — атташе в немецком посольстве в Лиссабоне. У Квинтаниллы свои трудности — он совершенно уверен, что среди его людей есть предатель. А вскоре начинаются проблемы и у Винсента — его арестовывает лиссабонская полиция за убийство, жертва которого член организации Квинтаниллы, и тотальная подозрительность охватывает всех.','Нет данных'),(12983,'Маска Димитриоса',1944,95,0.0,6.6,180,'1944-06-23','https://st.kp.yandex.net/images/film_iphone/iphone360_12983.jpg','The Mask of Dimitrios','Лейден, голландский писатель детективных романов, проводящий отпуск в Стамбуле. На приеме он знакомится с одним из своих наиболее рьяных поклонников, полковником Хаки, главой тайной полиции, который сообщает ему, что тело известного преступника Димитриоса Макропулоса было выброшено на берег близлежащего пляжа. Преступник был зарезан. Лейдена поражает одержимость Хаки Макропулосом, человеком, который считал «убийство, предательство и обман» естественным образом жизни. Посетив морг и осмотрев тело, Лейден принимает решение написать роман об этом страшном человеке и начинает изучать его прошлое. И ему приходится столкнуться с умным и сложно спланированным варевом из шантажа, соблазнений, шпионских интриг, убийств и самоубийства.','Нет данных'),(12984,'Верная нимфа',1943,112,0.0,6.9,82,'1943-06-23','https://st.kp.yandex.net/images/film_iphone/iphone360_12984.jpg','The Constant Nymph','Четырнадцатилетняя Тесса безнадежно влюблена в красивого композитора Льюиса Додда, друга семьи. Льюис обожает Тессу, но никогда не проявлял никаких романтических чувств к ней. Когда отец Тессы умирает, Льюис принимает на себя опеку над Тессой и её сёстрами. Вскоре он женится на двоюродной сестре Тессы Флоранс. Флоранс отправляет Тессу и её сестру Полу в школу, но девочки убегают из школы и Тесса приезжает к Флоранс и Льюису. Флоранс вскоре начинает ревновать мужа к Тессе.','Нет данных'),(12986,'Невидимый агент',1942,81,0.0,5.4,189,'1942-07-31','https://st.kp.yandex.net/images/film_iphone/iphone360_12986.jpg','Invisible Agent','Во время второй мировой войны внук Джека Гриффина, самого первого человека-невидимки, использует формулу своего деда, чтобы тайно проникнуть в фашистский штаб и украсть секретные военные планы Гитлера.','Нет данных'),(12990,'Незнакомец на третьем этаже',1940,64,0.0,6.9,345,'1940-08-16','https://st.kp.yandex.net/images/film_iphone/iphone360_12990.jpg','Stranger on the Third Floor','Репортёр Майк Уорд — главный свидетель по делу об убийстве. Он видел обвиняемого Бриггса стоящим возле тела убитого в кафе, и это ключевое свидетельства для признания вины Бриггса. Джейн, невеста Уорда, сомневается в несомненности его показаний, и эти сомнения начинают преследовать репортёра.','$171 200'),(12993,'Странный груз',1940,113,0.0,7.2,194,'1940-03-01','https://st.kp.yandex.net/images/film_iphone/iphone360_12993.jpg','Strange Cargo','Группа заключенных бежит из тюрьмы. Их путь лежит через непроходимые джунгли. Спасителем оказывается неведомо откуда взявшийся странник…','Нет данных'),(13005,'Преступление и наказание',1935,88,0.0,6.2,96,'1935-11-21','https://st.kp.yandex.net/images/film_iphone/iphone360_13005.jpg','Crime and Punishment','Родерик Раскольников — вчерашний студент, недавно блестяще окончивший курс криминологии, теперь же — начинающий писатель, озлобленный нищим существованием. Он не способен помочь своей семье материально, и это очень сильного его мучает. Однажды Родерик встречает Соню — молодую девушку, вынужденную стать проституткой из-за долгов в ломбарде. Раскольников решает избавить мир от зла в лице владелицы ломбарда.','Нет данных'),(13006,'Безумная любовь',1935,68,0.0,7.0,377,'1935-07-12','https://st.kp.yandex.net/images/film_iphone/iphone360_13006.jpg','Mad Love','В Париже, великий хирург д-р Гоголь безумно влюбляется в театральную актрису Ивон Орлак и к своему ужасу узнает, что она состоит в браке со знаменитым пианистом Стивеном Орлаком. Но пианист попадает в железнодорожную катастрофу, в результате которой ему раздробило руки и Ивон, преодолевая свой страх, кидается к доктору, умоляя спасти руки мужа, который не сможет жить без музыки. Гоголь решает пришить ему руки только что обезглавленного преступника, убийцы Роло. Операция прошла успешно, но она имела ужасные побочные эффекты…','$257 502'),(13020,'Путь фламинго',1949,94,0.0,6.4,83,'1949-04-28','https://st.kp.yandex.net/images/film_iphone/iphone360_13020.jpg','Flamingo Road','Танцовщица Лэйн Беллами приезжает в маленький городок, в котором правит коррумпированный политик Титус Семпл. Женщина начинает встречаться с заместителем шерифа Филдингом Карлайлом — человеком слабым и полностью зависящим от Семпла, который сразу же невзлюбил Лэйн и желает выгнать её из города. Она испытывает затруднения при нахождении работы и арестована по сфабрикованному обвинению в нарушении морали. <br /><br />Упрямая женщина не собирается сдаваться. После выхода из тюрьмы Лэйн устраивается на работу в придорожной закусочной, где встречает политика Дэна Рейнольдса, за которого выходит замуж. Они поселяются в престижном районе Фламинго-роуд. Однажды в их доме появляется Филдинг Карлайл…','Нет данных'),(13021,'Безжалостный',1948,104,0.0,5.0,70,'1948-04-16','https://st.kp.yandex.net/images/film_iphone/iphone360_13021.jpg','Ruthless','Гораций Вендиг являет себя миру в облике богатого филантропа. Фактически история его подъема из несчастного распавшегося дома показывает, что это далеко не случайность…','Нет данных'),(13029,'Драговик',1946,103,0.0,6.8,181,'1946-04-10','https://st.kp.yandex.net/images/film_iphone/iphone360_13029.jpg','Dragonwyck','Коннектикут, 1844 год. Дочь простого фермера Миранда Уэллс получает приглашение от дальнего родственника Николаса Ван Райна поселиться в его особняке Драговик и быть гувернанткой для его дочери Катрин. Ожидая многого от Драговика, Миранда вскоре замечает за его хозяином некоторые странности. Николас Ван Райн практически не видится со своей дочерью; фермеры на его земле бунтуют против него; слуги перешептываются о проклятиях и привидениях в Драговике. И что же его хозяин на самом деле делает в башенной комнате?','Нет данных'),(13030,'Северная звезда',1943,108,0.0,6.6,102,'1943-11-04','https://st.kp.yandex.net/images/film/13030.jpg','The North Star','В фильме описывается героическая партизанская борьба украинских колхозников против немецких захватчиков.','Нет данных'),(13033,'Дьявол и Дэниэл Уэбстер',1941,85,0.0,6.6,329,'1941-10-16','https://st.kp.yandex.net/images/film_iphone/iphone360_13033.jpg','All That Money Can Buy','Бедный фермер продает душу дьяволу в обмен на удачу. Но постепенно он начинает сомневаться, стоило ли заключать сделку, и в итоге решает вернуть душу.','Нет данных'),(13034,'Жестокий Шанхай',1941,95,0.0,6.4,323,'1941-12-25','https://st.kp.yandex.net/images/film_iphone/iphone360_13034.jpg','The Shanghai Gesture','В самом крупном казино Шанхая, принадлежащем экстравагантной Мамаше Джин Слинг, появляется красавица Виктория Чартерис, также известная как Поппи Смит. В это же время Сэр Гай Чартерис, богатый предприниматель, скупивший большую часть кварталов Шанхая, вынуждает Мамашу Джин закрыть к наступающему китайскому Новому Году свое игорное заведение. Теперь он хозяин земли.<br><br>Мамаша Джин просто так не желает бросить все, что нажито непосильным трудом. Выяснив, что Поппи дочь Чартериса, Мамаша дает задание декаденту-поэту доктору Омару ухаживать за девушкой, вкрадчиво и намеренно склоняя ее к азартной игре и алкоголю. Хозяйка казино узнает в Чартерисе своего бывшего мужа, который сменил имя и бросил ее много лет назад. Женщина жаждет мести и приглашает его на званый обед в честь Нового Года…','$1 000 000'),(13044,'Дождь',1932,94,0.0,6.5,105,'1932-10-12','https://st.kp.yandex.net/images/film_iphone/iphone360_13044.jpg','Rain','Для жителей самоанской деревни Паго-Паго, жизнь проста, пока не прибыл корабль с двумя парами: миссионером Альфредом Дэвидсоном и доктором Робертом МакФэйлом с женами и с девушкой легкого поведения, которую звали Сэди Томпсон. Глава миссионеров Дэвидсон является больше, чем просто религиозным фанатиком, он сумасшедший человек. Когда корабль, который плыл в другой порт, сел на мель, пассажиров из-за возможной вспышки холеры на борту, высадили на остров.<br><br>Сэди не теряет время зря и устраивает «вечеринки» для американских солдат, дислоцированных на острове. Это шокирует чопорных жен, и они исходят ядом в своем «благочестивом» порыве порицания. Поведение девушки является вызовом и для Альфреда Дэвидсона и он мрачно настроен наставить на путь истинный беспутницу для спасения ее души…','Нет данных'),(13057,'Превратности любви',1998,121,0.0,7.1,5578,'1998-12-18','https://st.kp.yandex.net/images/film_iphone/iphone360_13057.jpg','Playing by Heart','Два клаббера, повстречавшиеся в ночном клубе. Пожилая пара, заново дающая друг другу обет. Антисоциальная женщина, принимающая приглашение на свидание от незнакомца. Парень, умирающий от СПИДа, и его мать, не желавшая принять сына из-за его гомосексуальности. Пара, у которой затягивается роман. И мужчина, бродящий по барам и рассказывающий там о своих несчастьях.<br /><br />Шесть совершенно непохожих друг на друга и не взаимосвязанных историй постепенно сплетутся воедино…','$20 000 000'),(13058,'Гриль-бар «Порох»',1995,117,0.0,7.2,139,'1996-01-24','https://st.kp.yandex.net/images/film_iphone/iphone360_13058.jpg','The Spitfire Grill','Освободившись из тюрьмы, Перси Тэлбот выбирает небольшой и отдаленный городок, где устраивается на работу в бар под названием «Порох». Она встречает доброжелательное отношение местных жителей.<br><br>Но находится человек, который не верит в ее исправление, и ему предоставляется случай доказать это. В результате — трагедия и запоздалое раскаяние.','Нет данных'),(13060,'Клуб для вдов',1993,102,0.0,6.0,87,'1993-02-03','https://st.kp.yandex.net/images/film/13060.jpg','The Cemetery Club','Что может объединить трех одиноких пятидесятилетних дам: рецепт нового пирога или события, происходящие в любимой «мыльной опере»? Нет! Причиной дружеского союза Эстер, Дорис и Люсиль послужила смерть их мужей. Теперь они регулярно собираются на кладбище, чтобы поболтать о жизни.<br><br>Но, в конце концов, им это надоедает, и дамочки отправляются на поиски симпатичных холостяков. Они и не подозревают, на сколько это увлекательное и забавное занятие.','Нет данных'),(13067,'В то же время, в следующем году',1978,119,0.0,7.4,362,'1978-11-22','https://st.kp.yandex.net/images/film_iphone/iphone360_13067.jpg','Same Time, Next Year','Действие начинается в 1951 году на курорте в Северной Калифорнии. Дорис, 24-летняя домохозяйка из Окленда, и Джордж, 27-летний бухгалтер из Нью-Джерси, знакомятся за ужином, сходятся ближе, и возникает любовный роман. На следующее утро они просыпаются в одной кровати, говорят о том, что произошло, оба осознают, что, когда они оба будут счастливо женаты с шестью детьми и так далее, оба будут любить друг друга.','Нет данных'),(13069,'Провидение',1977,110,0.0,7.4,835,'1977-01-25','https://st.kp.yandex.net/images/film_iphone/iphone360_13069.jpg','Providence','Писатель Клайв Лэнгэм накануне 78-летия проводит бессонную ночь в муках, пытаясь забыть о боли при помощи алкоголя и литературной фантазии. Он сочиняет в воображении свой последний роман, герои которого — его родственники: родной сын и внебрачный, жена, покончившая жизнь самоубийством семь лет назад, возлюбленные сыновей. Писатель, не заботящийся о верности реальности, как бы исполняет роль Провидения, управляя героями будто марионетками.','Нет данных'),(13070,'Гарри и Тонто',1974,115,0.0,7.1,394,'1974-08-12','https://st.kp.yandex.net/images/film_iphone/iphone360_13070.jpg','Harry and Tonto','Гарри — пожилой нью-йоркский вдовец, которого выгнали из его квартиры, поскольку дом предназначен на снос. Для дальнейшей борьбы за выживание у него нет ни сил, ни средств, а из друзей остался лишь верный кот Тонто. С этим единственным другом и отправляется он в путешествие в никуда по дорогам Америки.','$980 000'),(13071,'Тропик Рака',1970,87,0.0,5.4,252,'1970-02-27','https://st.kp.yandex.net/images/film_iphone/iphone360_13071.jpg','Tropic of Cancer','Это история любви и ненависти, творчества и безумия, феерическая полифония возвышенного и земного, смесь тонкой стилистики и шокирующей физиологичности деталей… Это судьба писателя в пораженном раковой опухолью мире','Нет данных');
INSERT INTO `movies` VALUES (13077,'Любовь и мрак',1994,103,0.0,6.0,198,'1994-10-06','https://st.kp.yandex.net/images/film_iphone/iphone360_13077.jpg','Of Love and Shadows','Ирен — молодая американка, проживающая в Чили времен диктаторства Пиночета, работает редактором в журнале. Однажды к ней на работу устраивается фотограф Франциско, который через короткое время становится ее любовником. Завоевав доверие Ирен, Франциско сообщает ей, что является членом тайной политической группировки, которая борется с политическим режимом их страны. Это признание заставляет Ирен по-другому взглянуть на жизнь и осознать весь ужас событий, происходящих в Чили.','Нет данных'),(13078,'Возможности карьеры',1991,83,0.0,6.2,2464,'1991-03-29','https://st.kp.yandex.net/images/film_iphone/iphone360_13078.jpg','Career Opportunities','Работать ночным сторожем в огромном супермаркете, где можно врубить музыку на всю громкость, наесться всякой всячины от пуза, кока-колы напиться на всю оставшуюся жизнь, а потом в пустом торговом зале до самого утра кататься на роликовых коньках, — может ли быть мечта прекраснее, если тебе лет 16-17 и ты представления не имеешь, чем заняться в ближайшем будущем?<br><br>У Джима эта мечта сбылась: его взяли на работу ночным сторожем в местный супермаркет. Немедленно после закрытия входных дверей и включения сигнализации молодой человек приступил к воплощению в жизнь сокровенных желаний. И скоро обнаружил, что он в магазине не один… незнакомая девушка пробралась в супермаркет, потому как у нее тоже была похожая мечта…','Нет данных'),(13079,'Звезда',1989,101,0.0,6.3,248,'1989-03-17','https://st.kp.yandex.net/images/film/13079.jpg','Etoile','Американская балерина приезжает в Венгрию, чтобы поступить в балетную школу. Но вскоре девушка понимает, что здесь все является не тем, чем кажется на первый взгляд.','Нет данных'),(13080,'Некоторые девчонки',1988,94,0.0,6.1,373,'1988-09-09','https://st.kp.yandex.net/images/film_iphone/iphone360_13080.jpg','Some Girls','Студент колледжа Майкл приезжает на Рождество в Канаду, чтобы провести его с семьей своей подружки Габриэллы. Однако та сразу заявляет, что больше его не любит. Вынужденный остаться на праздники в доме Габриэллы, Майкл обнаруживает, что ее семья очень странная. Отец, писатель, постоянно ходит по дому обнаженным. Бабушка принимает Майкла за своего покойного мужа, а сестры Габриэллы проявляют к нему явный интерес…','Нет данных'),(13081,'Семь минут на небесах',1985,88,0.0,6.0,161,'1985-05-09','https://st.kp.yandex.net/images/film_iphone/iphone360_13081.jpg','Seven Minutes in Heaven','Натали Бекер — красавица, отличница, остается дома одна. Ей и её друзьям придется многое узнать о жизни, зрелости и любви.','Нет данных'),(13082,'Феномен',1984,115,0.0,6.9,3188,'1985-01-31','https://st.kp.yandex.net/images/film_iphone/iphone360_13082.jpg','Phenomena','Красавицу-студентку Дженнифер Корвино родители отправили в престижный женский пансион в Швейцарии. Вскоре выясняется, что девушка — сомнамбула, гуляющая по ночам, в то время как кто-то убивает её подруг с неподдающейся описанию жестокостью. Весьма странный биолог, изучающий трупных червей и насекомых, берётся помочь полиции в определении времени убийств…','$3 800 000'),(13084,'Оранжевый мишка',2000,48,0.0,6.6,92,'2000-11-01','https://st.kp.yandex.net/images/film_iphone/iphone360_13084.jpg','The Tangerine Bear: Home in Time for Christmas!','Перед Рождеством на фабрике игрушек кипит работа. Все дети ждут подарков, поэтому нужно успеть сделать как можно больше красивых кукол, веселых мартышек и плюшевых медвежат. Но одному медвежонку не повезло — в спешке ему неправильно пришили рот, и вместо улыбки получилась унылая гримаса.<br><br>Таким он и попал на магазинную полку, где его никто не хотел покупать. Медвежонок совсем пал духом и уж было решил, что так навсегда и останется один. Но в Рождество всегда случаются чудеса и в маленьком магазинчике, который теперь стал его домом, Мишка неожиданно встречает верных друзей — таких же, как он странных и чудаковатых игрушек.','Нет данных'),(13085,'Шестой игрок',1997,107,0.0,7.2,6821,'1997-03-28','https://st.kp.yandex.net/images/film_iphone/iphone360_13085.jpg','The Sixth Man','Кенни Тайлер и его старший брат Энтони — звезды школьной баскетбольной команды. Неожиданная смерть Энтони не оставляет ему практически никаких шансов на успех. Но вдруг все меняется. Бывший аутсайдер одерживает победу за победой.<br><br>Как будто кто-то невидимый помогает будущим чемпионам… Какая-то таинственная сила… или просто призрак старшего брата, который самовольно вышел на площадку в качестве шестого игрока. Казалось бы, лучше и быть не может, но Кени хочет выиграть честно…','$11 000 000'),(13086,'Я достану тебя, ублюдок',1988,85,0.0,6.1,480,'1988-12-16','https://st.kp.yandex.net/images/film_iphone/iphone360_13086.jpg','I\'m Gonna Git You Sucka','Джек Спейд возвращается из армии в родной черный квартал, где погиб его брат, Джун Баг. Джек объявляет войну мистеру Бигу, местному боссу мафии. Армию Джека поведет вперед кумир Джека с детских лет, Джон Слейд, человек, имеющий огромный опыт ведения военных действий против плохих парней.','$3 000 000'),(13089,'Отпетые волшебники',2000,108,0.0,6.1,248,'2008-02-03','https://st.kp.yandex.net/images/film/13089.jpg','Magicians','Фокусник-неудачник Макс «ловит за руку» карманника Хьюго. Макс не сдает его в полицию, посчитав, что вдвоем они смогут организовать такое шоу, что поставят на уши всю Америку.<br><br>Взяв с собой Майло, старого учителя Макса, и знойную красавицу-официантку Лидию, мечтающую о жизни, полной приключений, они садятся в краденый фургон и отправляются из Нью-Йорка в Лас-Вегас, где должны сбыться все волшебные мечты. И ничто не собьет их с пути к заветной цели: ни провальные выступления, ни разозленные зрители, ни полицейские погони…','$10 000 000'),(13091,'Пять тузов',1998,95,0.0,6.2,192,'1999-05-28','https://st.kp.yandex.net/images/film_iphone/iphone360_13091.jpg','Five Aces','Крис очень боится предстоящей свадьбы. Как и любой мужчина, собирающийся возложить на себя святые узы брака, он терзается сомнениями. Желая поразмыслить над превратностями судьбы и насладиться последними днями свободы, Крис отправляется в родной город, где живут его четверо друзей детства.<br><br>Когда-то они «наводили шорох» на всю округу и были известны всем как «Пять тузов». Парни уже давно стали взрослыми, у каждого свои проблемы, но в душе «тузы» остались такими же, как много лет назад. И при первой же встрече с друзьями Крис понял, что его ожидает настоящий мальчишник.','Нет данных'),(13092,'Восемнадцатый ангел',1997,95,0.0,5.7,371,'1997-12-06','https://st.kp.yandex.net/images/film_iphone/iphone360_13092.jpg','The Eighteenth Angel','Пять столетий назад были созданы астрономические часы с целью объявить миру день возращения Люцифера. С тех пор отсчет начался, и день был известен.<br><br>И вот теперь служители Сатаны должны найти 18 прекрасных ангелов, как было указано в Писании, чтобы предъявить их Люциферу. И один из них будет избран, чтобы Люцифер предстал не в обличии зверя, а в ангельском виде…','$25 000 000'),(13093,'Флаббер',1997,93,0.0,6.8,17521,'1997-11-16','https://st.kp.yandex.net/images/film_iphone/iphone360_13093.jpg','Flubber','Флаббер. Последнее изобретение профессора химии, над которым он трудился всю жизнь. Рассеянный ученый даже не подозревает, какое важное открытие подарил миру. Ведь на самом деле этот непримечательный кусок резины — концентрированный сгусток энергии невероятной мощности.<br><br>Наденьте тапочки из волшебного материала, и можете смело отправляться на соревнования по прыжкам в высоту. Если вам этого мало — заправьте им свой автомобиль, но лучше не нажимать на газ, иначе вскоре радары обнаружат в воздухе неопознанный летающий объект.<br><br>А теперь представьте, что может произойти, если неуправляемая материя исчезает прямо из — под носа счастливого профессора и попадает в руки злодеев…','$80 000 000'),(13094,'Проделки Бивера',1997,84,0.0,6.2,530,'1997-08-22','https://st.kp.yandex.net/images/film_iphone/iphone360_13094.jpg','Leave It to Beaver','В центре действия картины крепкая американская семья. Мудрый отец Уорд, любящая мать Джун, старший сын Уолли и младшенький — восьмилетний Бивер.<br><br>Малыш Бивер больше всего на свете хочет вырасти поскорее и стать таким, как его старший брат — самый популярный тинэйджер в школе. Когда Уолли попадает в любовный треугольник и ссорится со своим лучшим другом, Бивер берется уладить все проблемы и создает новые…','$15 000 000'),(13095,'Изнасилование',1998,95,0.0,5.9,378,'1998-07-09','https://st.kp.yandex.net/images/film_iphone/iphone360_13095.jpg','Jaded','Изнасилование… Горькая история Мэг Харис. Стыд и ненависть, невозможность смыть с себя следы чужих рук, воспоминания, которые не дают уснуть. Пытаясь облегчить душевную боль, она решает обратиться в суд.<br><br>Общественность въедливо смакует подробности, изучает улики, лишь одно останавливает присяжных в вынесении приговора — в конституции США нет статьи за изнасилование, совершенное женщинами…','Нет данных'),(13096,'Баскетбольная лихорадка',1996,91,0.0,6.5,624,'1996-04-19','https://st.kp.yandex.net/images/film_iphone/iphone360_13096.jpg','Celtic Pride','На что можно решиться ради победы любимой команды? «На все!» — решают Майк и Джимми накануне финального матча между их любимой «Бостон Селтик» и «Юта Джаз». Они идут на отчаянный шаг и похищают лучшего игрока соперников, Льюиса Скотта, напоив его в баре до полусмерти. Но все идет совсем не так, как они задумали…','Нет данных'),(13097,'Скорость падения',1994,102,0.0,6.2,1456,'1994-09-09','https://st.kp.yandex.net/images/film_iphone/iphone360_13097.jpg','Terminal Velocity','Броди — бесстрашный инструктор по парашютному спорту. Его новая очаровательная ученица быстро постигает азы этой опасной науки. Но во время первого совместного прыжка она погибает. Однако Броди не узнает в погибшей свою подопечную… Пытаясь найти разгадку, он оказывается в эпицентре дерзкого преступления: русские террористы, бывшие агенты КГБ, похищают самолет с золотом. И тогда судьба снова сводит его с бывшей ученицей…','$50 000 000'),(13098,'Цветок у дороги',1993,89,0.0,6.2,901,'1994-05-07','https://st.kp.yandex.net/images/film/13098.jpg','The Road Killers','На отдых отправляются две добропорядочные американские семьи. В пути они сталкиваются с уродом-маньяком. Беда настигает их в тот момент, когда заинтересовавшись необычным цветком у дороги, мальчик выходит из машины. Главный герой, вынужденный взяться за оружие, оказался страшен и беспощаден в своем гневе…','$6 580 000'),(13103,'Шизо',1990,86,0.0,5.2,74,'1990-07-10','https://st.kp.yandex.net/images/film_iphone/iphone360_13103.jpg','Playroom','Археолог Крис, страдающий от постоянных ночных кошмаров, одержим идеей найти древнюю гробницу юного принца, по легенде продавшего душу дьяволу. В тщетном поиске захоронения проходят дни и недели, и в конце концов одержимость Криса становится прямой угрозой для остальных членов археологической экспедиции.','Нет данных'),(13105,'Соседские мальчишки',1985,91,0.0,6.7,325,'1986-03-14','https://st.kp.yandex.net/images/film_iphone/iphone360_13105.jpg','The Boys Next Door','Друзья Бо и Рой после окончания колледжа решают отправиться на уик-энд в Лос-Анджелес. Но увеселительная прогулка оборачиваете кошмаром: ребята неожиданно совершают убийство, и их кровавое путешествие шокирует всю страну. Что могло подтолкнуть к бесчеловечным поступкам обычных ребят — таких же, что живут с тобой по соседству?','$5 000 000'),(13108,'Брейк-данс',1984,90,0.0,6.3,526,'1984-05-03','https://st.kp.yandex.net/images/film_iphone/iphone360_13108.jpg','Breakin\'','Дочь богатых родителей Келли и двое уличных парней Турбо и Озон — великолепно танцуют каждый в своем стиле. Они объединяют свои усилия для того, чтобы победить в соревнованиях по танцам и, естественно, получить признание…','Нет данных'),(13110,'Катафалк',1980,99,0.0,4.7,111,'1980-04-25','https://st.kp.yandex.net/images/film_iphone/iphone360_13110.jpg','The Hearse','Решив провести лето в доме, доставшемся в наследство от покойной тетушки, Джейн Харди не знала, что ее престарелая родственница активно практиковала черную магию. После переезда Джейн начал преследовать загадочный черный катафалк, а все происходящее стало похоже на какой-то безумный кошмар. Одновременно Джейн знакомится с привлекательным молодым человеком и влюбляется в него. Однако вскоре становится ясно, что между ее избранником и водителем катафалка есть какая-то связь…','Нет данных'),(13118,'Хватай и беги',1986,97,0.0,6.3,166,'1986-08-22','https://st.kp.yandex.net/images/film_iphone/iphone360_13118.jpg','Touch and Go','Суперзвезда хоккея Бобби полностью посвятил свою жизнь спорту. Очаровательная Дэниз думает только о своем маленьком сыне, которого она пытается оградить от дурной компании. Их встреча дает начало этой веселой и милой истории со счастливом концом.','Нет данных'),(13124,'Жажда крови',1992,90,0.0,5.7,123,'1992-12-16','https://st.kp.yandex.net/images/film_iphone/iphone360_13124.jpg','Out for Blood','Днем Джон Декер преуспевающий адвокат, а ночью — беспощадный вершитель правосудия, уничтожающий всех бандитов и наркоторговцев, попадающихся на его пути, потому что несколько лет назад бандиты напали на его семью и зверски убили его жену и сына.','Нет данных'),(13130,'Эвита',1996,135,0.0,7.3,3078,'1996-12-14','https://st.kp.yandex.net/images/film_iphone/iphone360_13130.jpg','Evita','Фильм основан на биографии Эвы Дуарте, которая, приехав в 15-летнем возрасте в Буэнос-Айрес, сумела стать знаменитой актрисой и выйти замуж за полковника Хуана Перона, ставшего впоследствии президентом страны. Эва, используя свое природное обаяние, стала величайшей личностью в истории страны, отношение к которой в Аргентине до сих пор крайне неоднозначно.','$55 000 000'),(13131,'Энджи',1994,107,0.0,6.3,101,'1994-02-28','https://st.kp.yandex.net/images/film_iphone/iphone360_13131.jpg','Angie','Многие жизни похожи друг на друга. И чтобы выйти из замкнутого круга, необходимо настоящее мужество. Энджи узнает, что она беременна, и отец ребенка делает ей предложение — для женщины за тридцать это великолепный шанс устроить свое будущее. Ведь так поступает большинство, и решение должно прийти само собой.<br><br>Но, к удивлению окружающих, Энджи отказывает влюбленному жениху. Она решает, что должна полагаться только на себя в поисках счастья. Но когда на развилке судьбы человек выбирает неожиданный и рискованный путь, он не может знать, что ждет его за поворотом.','Нет данных'),(13132,'Глава государства',2003,95,0.0,6.0,1139,'2003-03-28','https://st.kp.yandex.net/images/film_iphone/iphone360_13132.jpg','Head of State','В самый разгар предвыборной кампании кандидат на пост президента от округа Вашингтон неожиданно приказал долго жить. Именно поэтому демократической партии ничего не остаётся, как заменить его темнокожим оболтусом Мэйсом Гиллиамом.<br><br>Никто, впрочем, не подозревает, что Гиллиам, внезапно оказавшийся в центре внимания, разовьёт очень бурную деятельность…','$35 200 000'),(13134,'29 пальм',2002,93,0.0,5.6,215,'2002-07-29','https://st.kp.yandex.net/images/film_iphone/iphone360_13134.jpg','29 Palms','Все против всех и каждый за себя в отчаянной погоне за заветной сумкой с крадеными деньгами. Бродяга, похитив на автобусной станции в городке 29 Пальм черную сумку, набитую наличными, пытается уберечь свою добычу от наемного убийцы, крутого полицейского, охранника казино и коварного судьи, каждый из которых жаждет завладеть деньгами.<br><br>Заключив вынужденный союз с официанткой, бродяга пытается перехитрить преследователей, но в довершение всего узнает, что владелец местного казино, скорее напоминающий крестного отца, просто жаждет увидеть его труп…','$5 000 000'),(13137,'Больше, чем жизнь',1996,93,0.0,7.2,4382,'1996-07-26','https://st.kp.yandex.net/images/film_iphone/iphone360_13137.jpg','Larger Than Life','Обаятельный интеллектуал Джек получает в наследство… огромную слониху Веру. Как избавиться от такого внезапно свалившегося счастья? Джек решает отправить ее в Шри-Ланку, но перевозка слона весом 4 тонны — это проблема такого же размера, как и само животное.<br><br>А чтобы заставить ее слушаться, Джек должен научиться виртуозно свистеть. Постепенно привязываясь друг к другу, наши герои становятся настоящими друзьями. Джек понимает, что Вера умна и талантлива, и меняет свое первоначальное решение — вместо Шри-Ланки они едут… в Голливуд!','$30 000 000'),(13139,'Мужчины за работой',1990,98,0.0,6.9,2443,'1990-08-24','https://st.kp.yandex.net/images/film_iphone/iphone360_13139.jpg','Men at Work','Два мусорщика, Джеймс и Карл, для которых закон не писан, а начальник — не авторитет, часто пренебрегают своими прямыми обязанностями ради очередного веселенького приключеньица. Но их забавам приходит конец, когда на помойке Карл и Джеймс обнаруживают труп местного политика.<br><br>Ведь они понимают, что станут первыми подозреваемыми в деле об убийстве. И вот мусорщики пытаются спасти свои шкуры, а за ними под веселую музыку, шутки и прибаутки гонятся полицейские и настоящие убийцы.','Нет данных'),(13140,'Брэддок: Без вести пропавшие 3',1988,103,0.0,5.9,577,'1988-01-22','https://st.kp.yandex.net/images/film_iphone/iphone360_13140.jpg','Braddock: Missing in Action III','Полковник Брэддок, которому удалось бежать из жестокого плена, возвращается обратно во Вьетнам на поиски жены, которую он считал погибшей во время бомбежки в последние дни перед уходом американцев.','Нет данных'),(13148,'Глубина',2002,105,0.0,6.8,10949,'2002-10-11','https://st.kp.yandex.net/images/film_iphone/iphone360_13148.jpg','Below','Разгар Второй мировой войны. Американская подводная лодка «Тигровая акула», посланная на выручку оставшимся в живых членам экипажа британского плавучего госпиталя, вынуждена скрываться на глубине от шныряющих ближе к поверхности немецких субмарин.<br /><br />Уходя ближе ко дну, подводники обнаруживают, что там, внизу, есть еще что-то — явно не нацистские судна, нечто необъяснимое и, возможно, сверхъестественное.','Нет данных'),(13149,'Дом, где говорят Да',1997,85,0.0,6.0,300,'1997-09-12','https://st.kp.yandex.net/images/film_iphone/iphone360_13149.jpg','The House of Yes','Какая мысль возникает у молодой девушки, когда жених впервые приглашает ее на ужин в свою семью?<br><br>Его семья — это «сдвинутая» сестра — близняшка, извращенка, размахивающая заряженным ружьем и переодетая в обмундирование — таким представляется главной героине семья ее избранника — Дом под названием «Да», где неприлично говорить «Нет».','$1 500 000'),(13151,'Ксанаду',1980,96,0.0,5.8,196,'1980-08-08','https://st.kp.yandex.net/images/film_iphone/iphone360_13151.jpg','Xanadu','Этот фильм — взгляд в будущее и нежные воспоминания о событиях и жизни в эпоху расцвета Голливуда. Здесь сороковые встречаются с восьмидесятыми на фоне весьма необычной любовной истории и щедро насыщенного мелодиями старомодного мюзикла, в котором звучит вполне современная музыка.','Нет данных'),(13153,'40 карат',1973,110,0.0,7.3,208,'1973-06-28','https://st.kp.yandex.net/images/film_iphone/iphone360_13153.jpg','40 Carats','В Греции случайно встречаются Питер и Энн Стенли, которая старше его на много лет. Но любовь Питера оказывается настолько сильной, что он готов преодолеть все преграды, в том числе и нерешительность самой Энн, чтобы жениться на любимой женщине.','Нет данных'),(13154,'Девушки из Рошфора',1967,125,0.0,7.0,884,'1967-03-08','https://st.kp.yandex.net/images/film_iphone/iphone360_13154.jpg','Les demoiselles de Rochefort','В маленький приморский городок рядом с базой ВМС приезжают бродячие музыканты, чтобы устроить карнавал. Среди гостей оказываются двое молодых людей, Этьен и Билл, которых незадолго до того бросили их подружки, сбежав с моряками. Чтобы приготовить музыкальный номер, юношам приходится обратиться за помощью к местным сестрам-близняшкам Соланж и Дельфине, которые тоже занимаются музыкой.','Нет данных'),(13155,'Пожнешь бурю',1960,128,0.0,7.8,1141,'1960-06-26','https://st.kp.yandex.net/images/film_iphone/iphone360_13155.jpg','Inherit the Wind','Этот фильм посвящен событиям 1925 года в Дейтоне, штат Теннесси, когда школьный учитель был осужден за преподавание эволюционной теории, что в то время было запрещено. Несмотря на моральную победу адвоката (ранее протестовавшего против такого запрета) в этих дебатах, учитель был осужден и приговорен к штрафу в 100 долларов.','Нет данных'),(13158,'Гёрлз',1957,114,0.0,6.6,200,'1957-10-03','https://st.kp.yandex.net/images/film_iphone/iphone360_13158.jpg','Les Girls','Бэрри, Анжель, Джой и Сибил — бывшие члены популярного европейского кабаре «Бэрри Николс и Лес Герлз». Через несколько лет после распада группы Сибил публикует мемуары о том, что происходило за кулисами между Бэрри и его партнершами в романтическом плане. Анжель возмущена откровениями и подает на Сибил в суд, начинается разбирательство, и фильм превращается в музыкальный «Расемон», когда каждый из главных героев рассказывает историю так, как он ее помнит. Все их воспоминания очень сильно различаются…','Нет данных'),(13164,'Бригадун',1954,108,0.0,6.8,115,'1954-09-08','https://st.kp.yandex.net/images/film_iphone/iphone360_13164.jpg','Brigadoon','Двое ньюйоркцев, Джефф и Томми, отправляются в Шотландию. Заблудившись в горах, они натыкаются на деревушку под названием Бригадун, которая появляется из туманов в один и тот же день каждые сто лет. Селяне находятся в самом развеселом расположении духа, и американцы с удовольствием присоединяются к общим танцам и развлечениям.<br><br>Томми влюбляется в очаровательную деревенскую девушку по имени Файона. После этого ему приходится решать, возвращаться ли в Нью-Йорк или остаться со своей любимой на древней земле.','Нет данных'),(13166,'Летние гастроли',1950,108,0.0,7.2,130,'1950-08-31','https://st.kp.yandex.net/images/film_iphone/iphone360_13166.jpg','Summer Stock','Джейн Фалбури молодая хозяйка на ферме в новой Англии. Ее хозяйство в запустении, так как уже третий год — неурожай. Она и ее гувернантка Арти с трудом сводят концы с концами, вдобавок последние двое работников решили уйти от нее на заработки. Несмотря на такие трудности Джейн не унывает, она едет в город берет в кредит семена, удобрения и трактор и решает сама сеять и жать.<br><br>Вернувшись на ранчо, девушка застает целую толпу молодых людей, которые выгружают из грузовика театральный реквизит, превращая ее старый добрый сарай в репетиционную базу для будущего Бродвейского шоу. Оказывается ее младшая сестра Абигейл пригласила своего бойфренда Джо деPoca и его друзей актеров к ним на ранчо, дабы сэкономить на аренде помещения для репетиций, и к тому же Абигейл обещана главная роль в шоу.<br><br>Джейн поначалу отрицательно встретила эту затею сестры, но, подумав, поставила свои условия — взамен платы за аренду сарая ребята должны отработать на ее ферме, пока не будет окончательно поставлен спектакль…','Нет данных'),(13168,'Три мушкетера',1948,125,0.0,7.0,353,'1948-10-19','https://st.kp.yandex.net/images/film_iphone/iphone360_13168.jpg','The Three Musketeers','Д`Артаньян молодой провинциал приезжает покорять столицу Франции — Париж. Юноша жаждет приключений и поступает на службу в королевский полк мушкетеров. Красавец и виртуозный фехтовальщик добьется своего: его ожидают приключения, тайны, новые друзья, новые враги, поединки и, конечно же, любовь.<br><br>Судьба улыбнется Д`Артаньяну -он обретет верных, честных, веселых и благородных друзей, а его возлюбленная девушка будет самой прелестной на свете. Именно ему предстоит спасти саму королеву Франции и получить награду из ее рук. Действуя по велению дружбы, любви и долга, герой наживет себе и злейших врагов. Среди них и могущественный кардинал Ришелье, и красавица-миледи, которая поклялась отомстить храброму гасконцу.','$4 474 000'),(13169,'Пират',1948,102,0.0,7.0,195,'1948-05-14','https://st.kp.yandex.net/images/film/13169.jpg','The Pirate','Чтобы завоевать сердце романтически настроенной девушки, актер из бродячей труппы выдает себя за знаменитого пирата, в то время как ее скучный жених всеми силами пытается скрыть свое темное прошлое.','$3 700 000'),(13171,'Безумства Зигфилда',1945,110,0.0,7.1,232,'1945-08-13','https://st.kp.yandex.net/images/film_iphone/iphone360_13171.jpg','Ziegfeld Follies','Стремясь ошеломить и ослепить зрителя феерическим блеском, необычайной пышностью своих постановок, красотой танцовщиц — «герлс», Зигфилд тратил на каждую постановку огромные средства. Эти постановки, известные под названием «Зигфельд фоллис», были очень популярны в 1907-31.','$3 240 816'),(13172,'Рождественские каникулы',1944,93,0.0,6.2,311,'1944-06-28','https://st.kp.yandex.net/images/film/13172.jpg','Christmas Holiday','Лейтенант Чарльз Мэйсон, от которого недавно ушла невеста, оказывается вместе со своим новым знакомым в Новоорлеанском публичном доме. Там он встречает певицу Джекки Ламонт, женщину с таинственным прошлым.<br /><br />Ее настоящее имя — Абигейл Монетт, а ее муж, Роберт Монетт, отбывает наказание в тюрьме за убийство. Роберт бежит из тюрьмы, чтобы отомстить супруге за измену. Тем временем, Джекки мечтает начать новую жизнь. Она уже строит планы в отношении лейтенанта, в которого искренне влюблена.','Нет данных'),(13173,'Девушка с обложки',1944,107,0.0,7.2,593,'1944-03-20','https://st.kp.yandex.net/images/film/13173.jpg','Cover Girl','Танцовщица бруклинского ночного клуба Расти Паркер обожает хореографа Дэнни, но тот не замечает настырную девицу. В надежде изменить свою жизнь, она принимает участие в конкурсе на право стать «девушкой с обложки» и побеждает, несмотря на козни конкуренток.<br><br>Неожиданно Дэнни понимает — что он может потерять — и начинает атаку на Расти. Что же выберет честолюбивая девушка — любовь или карьеру…','Нет данных'),(13176,'Для меня и моей девочки',1942,104,0.0,7.3,129,'1942-10-21','https://st.kp.yandex.net/images/film_iphone/iphone360_13176.jpg','For Me and My Gal','США. 1916 год. Молодые актеры прибывают в маленький городок на гастроли, один из них Гарри Палмер — популярный американский комик и танцор. Во время гастролей герой знакомится с молодой актрисой Джо, и пробует ухаживать за ней, но девушка не проявляет к нему интереса.<br><br>Путем всяческих хитросплетений он добивается ее расположения, и в итоге они создают творческий дуэт. В это время США вступает в войну в Европе. Гарри ломает пальцы, чтобы получить отсрочку и участвовать в запланированном шоу. Узнав об этом, девушка в отчаянии обвиняет своего любимого в трусости.<br><br>Чтобы оправдать себя он идет в добровольцы, но его отстраняют в виду проблем со здоровьем. Тогда Гарри идет работать в состав театральных фронтовых бригад, поднимая боевой дух солдат веселым куплетом и зажигательным танцем.<br><br>Пройдя через невзгоды и трудности, первой мировой войны Гарри и Джо уже не надеются увидеться вновь, ведь многие остались на полях сражений, но у водевиля не бывает грустного финала, они встретятся вновь на эстраде и споют свою любимую песню.','Нет данных'),(13177,'Хеллоу, Долли!',1969,146,0.0,7.6,1060,'1969-12-16','https://st.kp.yandex.net/images/film_iphone/iphone360_13177.jpg','Hello, Dolly!','Нью-Йорк, 1890 год. История о свахе, которая находит всем мужей и жен и не забывает про себя.','$25 000 000'),(13182,'Ад кромешный',1982,82,0.0,4.0,94,'1982-04-02','https://st.kp.yandex.net/images/film_iphone/iphone360_13182.jpg','Pandemonium','Храбрый канадский рейнджер в компании с верной лошадью выслеживает серийного убийцу, давно наводящего ужас на обитателей расположенного неподалёку лагеря девушек-болельщиц.','Нет данных'),(13184,'Тысяча и одна ночь',1961,100,0.0,6.2,146,'1961-10-31','https://st.kp.yandex.net/images/film_iphone/iphone360_13184.jpg','Le meraviglie di Aladino','По мотивам арабских сказок из одноименного цикла. Бедный молодой человек находит волшебную лампу и выпускает из нее джина, который дает своему освободителю три желания.','Нет данных'),(13188,'Назовите меня мадам',1953,114,0.0,6.3,132,'1953-03-25','https://st.kp.yandex.net/images/film_iphone/iphone360_13188.jpg','Call Me Madam','Салли Адаме, женщина с практической хваткой, твердо стоящая на ногах, порывистая и темпераментная, направляется в качестве посла США в маленькое Европейское государство Лихтенбург. У нового посла, впрочем, есть один недостаток. Точнее качество, не слишкомотвечающее ее дипломатическому статусу: она чрезвычайно непосредственна и склонна поступать в соответствии с душевными порывами, которые, порой, идут вразрез с государственными интересами.','Нет данных'),(13222,'Небо и земля',1993,140,0.0,7.1,1433,'1993-12-25','https://st.kp.yandex.net/images/film_iphone/iphone360_13222.jpg','Heaven & Earth','Драматическая история вьетнамской женщины на протяжении 30 лет — три разных периода ее жизни. Когда-то ее жизнь была безмятежной и прекрасной… Но ее мир рухнул, когда началась Вьетнамская война. Ее судьба — это судьба женщины, оказавшейся на родной земле между двух огней — Севера и Юга. Ее пытали защитники старого режима, коммунисты изнасиловали. Работая в богатом доме в Сайгоне, она «прижила» ребенка от хозяина. Лишь выйдя замуж за американского сержанта Стива Батлера, героиня фильма узнала, что такое любовь и уважение. Вскоре она уезжает с мужем в Америку, где ее ждут новые испытания.','$33 000 000');
